(1, '<p>Genus Healthcare Solution has been a part of the US &amp; Indian healthcare industry circuit solidifying its position now for close to two decades.</p>\r\n\r\n<p>We are emerging as a competent contender in (BPM) Business Process Management offering services in verticals like Medical Billing, Coding et al; designing tailored solutions and serving some leading and well-known healthcare companies in the US including pharmaceutical, biotech and healthcare institutions.</p>\r\n\r\n<p>Our outlook and goals are shaped by what we&rsquo;ve observed in our day-to-day experience including a dearth of good talent and challenges faced by various verticals in healthcare industry.</p>\r\n\r\n<p>While offering various solutions, we&rsquo;ve combined our knowledge of healthcare industry and Business Process Management (BPM) with technology; creating solutions based on best industrial practices, and ensuring best talent within India at your service.</p>\r\n\r\n<p>We offer three types of services through this website. Facilitate Training to candidates interested in pursuing career that will help them find employment opportunities in select verticals in healthcare industries worldwide; suitable Recruitment &amp; Placement of trained individuals (Currently in India only); and Outsourcing Medical Billing &amp; Coding services to clinics, pharmacy companies, &amp; hospitals worldwide through our robust framework of technology, specialists, and experts. We&rsquo;re also equipped to provide customised services &amp; solutions to meet specific requirements like large BPO projects etc.</p>\r\n\r\n<p>To deliver high standard training and meet outsource demands we use the most relevant infrastructure, high-end software &amp; technologies, client centric approach, expert MTs, QAs, Coders and Billing Execs rendering 24 x 7 end to end solutions in varied spheres of medical care.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h1><span class=\"marker\"><strong>Terms and Condition:&nbsp; </strong></span></