(1, 'Now You Can Blog from Everywhere!', '1650532788.jpg', 'With Wix Blog, you’re not only sharing your voice with the world, you can also grow an active online community. That’s why the Wix blog...', '<h3>Now You Can Blog from Everywhere!</h3>\r\n\r\n<p>We&rsquo;ve made it quick and convenient for you to manage your blog from anywhere. In this blog post we&rsquo;ll share the ways you can post to your Wix Blog.</p>\r\n\r\n<h3>Blogging from Your Wix Blog Dashboard</h3>\r\n\r\n<p>On the dashboard, you have everything you need to manage your blog in one place. You can create new posts, set categories and more. To head to your Dashboard, open the Wix Editor and click on Blog &gt; Posts.</p>\r\n\r\n<h3>Blogging from Your Published Site</h3>\r\n\r\n<p>Did you know that you can blog right from your published website? After you publish your site, go to your website&rsquo;s URL and login with your Wix account. There you can write and edit posts, manage comments, pin posts and more! Just click on the 3 dot icon ( ⠇) to see all the things you can do.</p>\r\n\r\n<div class=\"article-footer\">\r\n<div class=\"article-tags\"><a href=\"#\">Share</a></div>\r\n\r\n<div class=\"article-share\">\r\n<ul class=\"social\">\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"comments-area\">\r\n<div class=\"comment-respond\">\r\n<h3 class=\"comment-reply-title\">Leave a Reply</h3>\r\n\r\n<div class=\"comment-form\">\r\n<p class=\"comment-notes\"><span id=\"email-notes\">Your email address will not be published.</span> Required fields are marked <span class=\"required\">*</span></p>\r\n\r\n<p class=\"comment-form-author\"><label>Name <span class=\"required\">*</span></label> <input id=\"author\" name=\"author\" required=\"required\" type=\"text\" /></p>\r\n\r\n<p class=\"comment-form-email\"><label>Email <span class=\"required\">*</span></label> <input id=\"email\" name=\"email\" required=\"required\" type=\"email\" /></p>\r\n\r\n<p class=\"comment-form-url\"><label>Website</label> <input id=\"url\" name=\"url\" type=\"url\" /></p>\r\n\r\n<p class=\"comment-form-comment\"><label>Comment</label><textarea cols=\"45\" id=\"comment\" maxlength=\"65525\" name=\"comment\" required=\"required\" rows=\"5\"></textarea></p>\r\n\r\n<p class=\"form-submit\"><input class=\"submit\" id=\"submit\" name=\"submit\" type=\"submit\" value=\"Post A Comment\" /></p>\r\n</div>\r\n</div>\r\n</div>', 'Sep 06, 2022', 0, '2022-04-21 00:01:20', '2022-09-06 09:23:26'),
(3, 'CPC vs CCS Certification Medical Coding', '1650532820.jpg', 'Medical Coding Career for Generation Next', '<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Medical Coding Career what to do CPC or CCS. AAPC or AHIMA</b></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Duration of Training CPC/CCS: 3 Months (Monday to Friday)</b></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Course Material&nbsp;</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CPC- CPT, ICD-10 CM, HCPCS</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CCS-&nbsp; CPT, ICD-10 CM, ICD-10-PCS, HCPCS</b></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">What is CPC?</b></h2>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">The Certified Professional Coder (CPC) certification is a nationally recognized medical coding certificate provided by the American Academy of Professional Coders (AAPC). Earning a CPC certification can demonstrate to hiring managers that you have medical coding training and experience in the healthcare industry.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Getting a CPC certificate can prepare you to support general practitioners, work in doctor&#39;s offices and focus on outpatient services. To be eligible for the CPC examination, you typically need to have two years of experience in medical coding and submit two letters of recommendation to the AAPC. If you&#39;re new to the field, consider taking the CPC exam before obtaining professional experience to earn a CPC apprentice (CPC-A) title. A CPC-A can emphasize your commitment to a new career in medical coding, which may boost your chances of getting an interview.</b></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">What is CCS?</b></h2>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">The Certified Coding Specialist (CCS) certificate is a medical coding credential from the American Health Information Management Association (AHIMA). This widely recognized coding credential can highlight your diagnostic coding proficiency and data quality standards.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Having a CCS certificate can prepare you to evaluate, organize and code medical information in inpatient facilities such as hospitals and other healthcare environments. To prepare for the CCS examination, you can complete one or more of the prerequisites below:</b></p>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Gain two years of relevant coding experience</b></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Enroll and pass required courses, including anatomy, ICD diagnostic coding, pathophysiology, medical terminology, procedural coding, medical services and pharmacology</b></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Hold another advanced coding certification from AHIMA, such as a Physician-based Coding Specialist certification (CCS-P)</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Key differences between CPC and CCS</b></h2>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">While CPC and CCS certifications are both effective ways of validating your medical coding expertise, it&#39;s useful to understand how they differ to ensure you target the right credential for your career goals. The certificate you pursue may vary based on your target employer&#39;s policies, the demands of your intended field and your current experience in the industry. Here are a few of the core differences between CPC and CCS credentials:</b></p>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Experience: While the CPC credential is fitting for people beginning a career in medical coding, the CCS is well-suited to experienced medical coders who are interested in advancing their careers.</b></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Prerequisites: The CPC certification requires fewer prerequisites, while candidates who pursue a CCS credential typically fulfill a range of advanced requirements.</b></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Work environment: While CCS professionals have a background in procedural coding, they often focus on diagnostic coding. They typically work in hospitals and other inpatient facilities. In contrast, CPC professionals focus on reimbursement-related coding and often work in outpatient facilities, such as private medical practices.</b></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Pros and cons of earning a CPC certification</b></h2>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Since some employers require candidates to have a medical coding certification, becoming a CPC can help you advance your medical coding career. Medical coders who are just entering the industry may consider getting a CPC if they&#39;re interested in increasing their career prospects in outpatient facilities, boosting their earning potential and demonstrating their dedication to a career in medical coding.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Like any professional development investment, there are both benefits and drawbacks to becoming a CPC, including:</b></p>\r\n\r\n<h3 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Cost of the exam- To take the CPC examination, aspiring medical coders need to become a member of AAPC first, which typically costs about $190. Candidates also need to pay $530 to take the exam. Candidates also need to pay a 2% equalization Levy. Candidates will get two attempts for one fee.</b></h3>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Difficulty of the exam-The medical coding industry recognizes the CPC examination as an accurate evaluation of highly developed medical coding skills. Depending on your background in coding and healthcare, the CPC exam can be a challenging test. However, some examinees find it easier than similar medical coding exams. To increase your chances of success on the exam, consider taking it on site, since in-person examinees can take the test up to two times.</b></p>\r\n\r\n<h3 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Industry competition-Having a CPC certification can make you an ideal candidate for outpatient work, which can catch a hiring manager&#39;s attention and help you get an interview. CPC certifications are one of the most common credentials new medical coders earn when entering the industry. This can mean more competition when you&#39;re applying for a job, so earning additional credentials, investing in professional development and engaging in networking can show a potential employer how you&#39;re distinct from other candidates.</b></h3>\r\n\r\n<h2 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Pros and cons of getting a CCS certification</b></h2>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Depending on the career you&#39;re aiming for, a potential employer may require you to have a CCS credential. If you&#39;re currently working in medical coding and interested in changing work environments, increasing your salary and developing your diagnostic coding skills, earning a CCS can help you achieve your career goals.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Similar to CPC certifications, there are advantages and disadvantages to becoming a CCS, such as:</b></p>\r\n\r\n<h3 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Exam difficulty-To become eligible for the CCS examination, aspiring medical coders typically need more coding experience and medical education than CPC candidates. Based on your understanding of medical terminology, insurance reimbursement procedures and diagnostic coding, the CCS examination may be more challenging than the CPC test. In addition, AHIMA allows candidates to take the CCS exam only one time at one fee. Enrolling in professional development courses related to CCS requirements, taking practice exams and diligently studying can help you pass the CCS examination and earn the certification successfully.</b></h3>\r\n\r\n<h3 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Cost of the exam</b></h3>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">To take the CCS examination, candidates need to pay $399 which includes a single attempt to clear the CCS Exam.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Career opportunities- While CCS professionals typically work with complex code, they often earn a higher salary than CPC professionals. They are also responsible for tasks like reimbursement assurance and diagnostic coding, which can be more challenging than the procedural coding CPCs typically handle, depending on your background. Since it takes more experience to earn a CCS certification, professionals with this title may face less competition when applying for jobs.</b></p>\r\n\r\n<h3 dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Career fulfillment</b></h3>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CCS professionals are trained to create code that supports doctors in giving more informed diagnoses, helps public health officials monitor patterns of disease and aids medical researchers in performing targeted research. While this focus can make a CCS professional&#39;s daily work responsibilities more complex than a CPC&#39;s, it can also increase career satisfaction.</b></p>\r\n\r\n<p dir=\"ltr\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Depending on your preferences, the demands of working in a hospital, surgery center or other inpatient environments can also affect your mental health. If you&#39;re interested in helping people with long-term conditions and helping doctors receive adequate payment, earning a CCS certification may be right for you.</b></p>\r\n\r\n<div class=\"article-footer\">\r\n<div class=\"article-tags\"><a href=\"#\">Share</a></div>\r\n\r\n<div class=\"article-share\">\r\n<ul class=\"social\">\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n	<li>&nbsp;</li>\r\n</ul>\r\n</div>\r\n</div>\r\n\r\n<div class=\"comments-area\">\r\n<div class=\"comment-respond\">\r\n<h3 class=\"comment-reply-title\">Leave a Reply</h3>\r\n\r\n<div class=\"comment-form\">\r\n<p class=\"comment-notes\"><span id=\"email-notes\">Your email address will not be published.</span> Required fields are marked <span class=\"required\">*</span></p>\r\n\r\n<p class=\"comment-form-author\"><label>Name <span class=\"required\">*</span></label> <input id=\"author\" name=\"author\" required=\"required\" type=\"text\" /></p>\r\n\r\n<p class=\"comment-form-email\"><label>Email <span class=\"required\">*</span></label> <input id=\"email\" name=\"email\" required=\"required\" type=\"email\" /></p>\r\n\r\n<p class=\"comment-form-url\"><label>Website</label> <input id=\"url\" name=\"url\" type=\"url\" /></p>\r\n\r\n<p class=\"comment-form-comment\"><label>Comment</label><textarea cols=\"45\" id=\"comment\" maxlength=\"65525\" name=\"comment\" required=\"required\" rows=\"5\"></textarea></p>\r\n\r\n<p class=\"form-submit\"><input class=\"submit\" id=\"submit\" name=\"submit\" type=\"submit\" value=\"Post A Comment\" /></p>\r\n</div>\r\n</div>\r\n</div>', 'Jun 02, 2023', 0, '2022-04-21 00:39:41', '2023-06-02 12:37:52'),
(4, 'CPC vs CCS Certification Medical Coding', '1650532809.jpg', 'Medical Coding A booming career for next generation', '<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Medical Coding Career what to do CPC or CCS. AAPC or AHIMA</b></span></small></h2>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Duration of Training CPC/CCS: 3 Months (Monday to Friday)</b></small></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Course Material&nbsp;</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CPC- CPT, ICD-10 CM, HCPCS</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CCS-&nbsp; CPT, ICD-10 CM, ICD-10-PCS, HCPCS</b></small></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">What is CPC?</b></span></small></h2>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">The Certified Professional Coder (CPC) certification is a nationally recognized medical coding certificate provided by the American Academy of Professional Coders (AAPC). Earning a CPC certification can demonstrate to hiring managers that you have medical coding training and experience in the healthcare industry.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Getting a CPC certificate can prepare you to support general practitioners, work in doctor&#39;s offices and focus on outpatient services. To be eligible for the CPC examination, you typically need to have two years of experience in medical coding and submit two letters of recommendation to the AAPC. If you&#39;re new to the field, consider taking the CPC exam before obtaining professional experience to earn a CPC apprentice (CPC-A) title. A CPC-A can emphasize your commitment to a new career in medical coding, which may boost your chances of getting an interview.</b></small></p>\r\n\r\n<p><br />\r\n&nbsp;</p>\r\n\r\n<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">What is CCS?</b></span></small></h2>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">The Certified Coding Specialist (CCS) certificate is a medical coding credential from the American Health Information Management Association (AHIMA). This widely recognized coding credential can highlight your diagnostic coding proficiency and data quality standards.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Having a CCS certificate can prepare you to evaluate, organize and code medical information in inpatient facilities such as hospitals and other healthcare environments. To prepare for the CCS examination, you can complete one or more of the prerequisites below:</b></small></p>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Gain two years of relevant coding experience</b></small></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Enroll and pass required courses, including anatomy, ICD diagnostic coding, pathophysiology, medical terminology, procedural coding, medical services and pharmacology</b></small></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Hold another advanced coding certification from AHIMA, such as a Physician-based Coding Specialist certification (CCS-P)</b></small></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Key differences between CPC and CCS</b></span></small></h2>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">While CPC and CCS certifications are both effective ways of validating your medical coding expertise, it&#39;s useful to understand how they differ to ensure you target the right credential for your career goals. The certificate you pursue may vary based on your target employer&#39;s policies, the demands of your intended field and your current experience in the industry. Here are a few of the core differences between CPC and CCS credentials:</b></small></p>\r\n\r\n<ul>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Experience: While the CPC credential is fitting for people beginning a career in medical coding, the CCS is well-suited to experienced medical coders who are interested in advancing their careers.</b></small></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Prerequisites: The CPC certification requires fewer prerequisites, while candidates who pursue a CCS credential typically fulfill a range of advanced requirements.</b></small></p>\r\n	</li>\r\n	<li aria-level=\"1\" dir=\"ltr\">\r\n	<p dir=\"ltr\" role=\"presentation\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Work environment: While CCS professionals have a background in procedural coding, they often focus on diagnostic coding. They typically work in hospitals and other inpatient facilities. In contrast, CPC professionals focus on reimbursement-related coding and often work in outpatient facilities, such as private medical practices.</b></small></p>\r\n	</li>\r\n</ul>\r\n\r\n<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Pros and cons of earning a CPC certification</b></span></small></h2>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Since some employers require candidates to have a medical coding certification, becoming a CPC can help you advance your medical coding career. Medical coders who are just entering the industry may consider getting a CPC if they&#39;re interested in increasing their career prospects in outpatient facilities, boosting their earning potential and demonstrating their dedication to a career in medical coding.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Like any professional development investment, there are both benefits and drawbacks to becoming a CPC, including:</b></small></p>\r\n\r\n<h3 dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Cost of the exam- To take the CPC examination, aspiring medical coders need to become a member of AAPC first, which typically costs about $190. Candidates also need to pay $530 to take the exam. Candidates also need to pay a 2% equalization Levy. Candidates will get two attempts for one fee.</b></small></h3>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Difficulty of the exam-The medical coding industry recognizes the CPC examination as an accurate evaluation of highly developed medical coding skills. Depending on your background in coding and healthcare, the CPC exam can be a challenging test. However, some examinees find it easier than similar medical coding exams. To increase your chances of success on the exam, consider taking it on site, since in-person examinees can take the test up to two times.</b></small></p>\r\n\r\n<h3 dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Industry competition-Having a CPC certification can make you an ideal candidate for outpatient work, which can catch a hiring manager&#39;s attention and help you get an interview. CPC certifications are one of the most common credentials new medical coders earn when entering the industry. This can mean more competition when you&#39;re applying for a job, so earning additional credentials, investing in professional development and engaging in networking can show a potential employer how you&#39;re distinct from other candidates.</b></small></h3>\r\n\r\n<h2 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Pros and cons of getting a CCS certification</b></span></small></h2>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Depending on the career you&#39;re aiming for, a potential employer may require you to have a CCS credential. If you&#39;re currently working in medical coding and interested in changing work environments, increasing your salary and developing your diagnostic coding skills, earning a CCS can help you achieve your career goals.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Similar to CPC certifications, there are advantages and disadvantages to becoming a CCS, such as:</b></small></p>\r\n\r\n<h3 dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Exam difficulty-To become eligible for the CCS examination, aspiring medical coders typically need more coding experience and medical education than CPC candidates. Based on your understanding of medical terminology, insurance reimbursement procedures and diagnostic coding, the CCS examination may be more challenging than the CPC test. In addition, AHIMA allows candidates to take the CCS exam only one time at one fee. Enrolling in professional development courses related to CCS requirements, taking practice exams and diligently studying can help you pass the CCS examination and earn the certification successfully.</b></small></h3>\r\n\r\n<h3 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Cost of the exam</b></span></small></h3>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">To take the CCS examination, candidates need to pay $399 which includes a single attempt to clear the CCS Exam.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Career opportunities- While CCS professionals typically work with complex code, they often earn a higher salary than CPC professionals. They are also responsible for tasks like reimbursement assurance and diagnostic coding, which can be more challenging than the procedural coding CPCs typically handle, depending on your background. Since it takes more experience to earn a CCS certification, professionals with this title may face less competition when applying for jobs.</b></small></p>\r\n\r\n<h3 dir=\"ltr\"><small><span class=\"marker\"><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Career fulfillment</b></span></small></h3>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">CCS professionals are trained to create code that supports doctors in giving more informed diagnoses, helps public health officials monitor patterns of disease and aids medical researchers in performing targeted research. While this focus can make a CCS professional&#39;s daily work responsibilities more complex than a CPC&#39;s, it can also increase career satisfaction.</b></small></p>\r\n\r\n<p dir=\"ltr\"><small><b id=\"docs-internal-guid-27492f78-7fff-bd23-bb54-ae12b09ac61d\">Depending on your preferences, the demands of working in a hospital, surgery center or other inpatient environments can also affect your mental health. If you&#39;re interested in helping people with long-term conditions and helping doctors receive adequate payment, earning a CCS certification may be right for you.</b></small></p>\r\n\r\n<p><br />\r\n&nbsp;</p>', 'Jun 02, 2023', 1, '2022-04-21 01:27:31', '2023-06-02 12:42:50');
