INSERT INTO `company_details` (`id`, `title`, `photo`, `content`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Privacy Policy', '1650599262.jpg', 'GENUS HEALTHCARE SOLUTION AND IT CONSULTING PRIVATE LIMITED is committed to ensuring that your privacy is protected. Should we ask you to provide certain information by which you can be identified when using this website, and then you can be assured that it will only be used in accordance with this privacy statement.\r\n\r\nGENUS HEALTHCARE SOLUTION AND IT CONSULTING PRIVATE LIMITED may change this policy from time to time by updating this page. You should check this page from time to time to ensure that you are happy with any changes.\r\n\r\nWe may collect the following information:\r\n\r\nName and job title\r\n\r\nContact information including email address\r\n\r\nDemographic information such as postcode, preferences and interests\r\n\r\nOther information relevant to customer surveys and/or offers\r\n\r\nWhat we do with the information we gather\r\n\r\nWe require this information to understand your needs and provide you with a better service, and in particular for the following reasons:\r\n\r\nInternal record keeping.\r\n\r\nWe may use the information to improve our products and services.\r\n\r\nWe may periodically send promotional emails about new products, special offers or other information which we think you may find interesting using the email address which you have provided.\r\n\r\nFrom time to time, we may also use your information to contact you for market research purposes. We may contact you by email, phone, fax or mail. We may use the information to customise the website according to your interests.\r\n\r\nWe are committed to ensuring that your information is secure. In order to prevent unauthorised access or disclosure we have put in suitable measures.\r\n\r\nHow we use cookies\r\n\r\nA cookie is a small file which asks permission to be placed on your computer\'s hard drive. Once you agree, the file is added and the cookie helps analyses web traffic or lets you know when you visit a particular site. Cookies allow web applications to respond to you as an individual. The web application can tailor its operations to your needs, likes and dislikes by gathering and remembering information about your preferences.\r\n\r\nWe use traffic log cookies to identify which pages are being used. This helps us analyses data about webpage traffic and improve our website in order to tailor it to customer needs. We only use this information for statistical analysis purposes and then the data is removed from the system.\r\n\r\nOverall, cookies help us provide you with a better website, by enabling us to monitor which pages you find useful and which you do not. A cookie in no way gives us access to your computer or any information about you, other than the data you choose to share with us.\r\n\r\nYou can choose to accept or decline cookies. Most web browsers automatically accept cookies, but you can usually modify your browser setting to decline cookies if you prefer. This may prevent you from taking full advantage of the website.\r\n\r\nControlling your personal information\r\n\r\nYou may choose to restrict the collection or use of your personal information in the following ways:\r\n\r\nwhenever you are asked to fill in a form on the website, look for the box that you can click to indicate that you do not want the information to be used by anybody for direct marketing purposes\r\n\r\nif you have previously agreed to us using your personal information for direct marketing purposes, you may change your mind at any time by writing to or emailing us at vikas.maheshwari@genushealthcaresolution.com\r\n\r\nWe will not sell, distribute or lease your personal information to third parties unless we have your permission or are required by law to do so. We may use your personal information to send you promotional information about third parties which we think you may find interesting if you tell us that you wish this to happen.\r\n\r\nIf you believe that any information we are holding on you is incorrect or incomplete, please write to or email us as soon as possible, at the above address. We will promptly correct any information found to be incorrect.', 1, '2022-04-21 05:27:06', '2023-04-24 18:26:50');
