(20, 6, 8, 1, '<p><strong>A 56-year-old receives general anesthesia for an open pleura biopsy. An anesthesiologist medically directs two other cases, and medically directs 2 CRNA on this case. What are the anesthesia codes and modifiers reported for the anesthesiologist and CRNA?&nbsp;</strong></p>', '00540-AA, 00540-QZ', '00540-QK, 00540-QX', '00541-AA, 00540-QZ', '00541-QK, 00541-QX', '2022-05-13 09:52:49', '2022-05-13 10:49:50', 'ans_b'),
(21, 6, 8, 1, '<p><strong>A patient is given general anesthesia by the anesthesiologist for a carpal tunnel nerve release. After the surgery the anesthesiologist is called to perform an axillary block for postoperative pain management on the same patient. What are the appropriate codes?</strong></p>', '01829, 64417-59', '01840, 64417-59', '01810, 64417-59', '01830, 64417-59', '2022-05-13 09:54:41', '2022-05-13 10:50:01', 'ans_c'),
(22, 6, 8, 1, '<p><strong>A healthy 45-year-old is having a needle thyroid biopsy. The anesthesiologist begins to prepare the patient for surgery at 09:00 am. The surgery begins at 09:15 am and ends at 09:45 am. The anesthesiologist turns over the patient&rsquo;s care to the recovery room nurse at 10:00 am. Which is the appropriate anesthesia code and what is the anesthesia time?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p>', '00320, One hour', '00320, 45 minutes', '00322, 45 minutes', '00322, One hour', '2022-05-13 09:56:23', '2022-05-13 10:50:09', 'ans_d'),
(23, 6, 8, 1, '<p><strong>The anesthesiologist performed MAC (monitored anesthesia care) for a patient undergoing an arthroscopy of the right knee. Code the anesthesia service.</strong></p>', '01382-AA', '01382-AA-QS', '01400-AA', '01400-AA-QS', '2022-05-13 10:48:01', '2022-05-13 10:50:19', 'ans_b'),
(24, 6, 8, 1, '<p><strong>General anesthesia is administered to a 9-month-old undergoing a tracheostomy. Code the anesthesia service.&nbsp;</strong></p>', '00320, 99100', '00320', '00326', '00326, 99100', '2022-05-13 10:49:16', '2022-05-13 10:50:28', 'ans_c'),
(31, 6, 8, 1, '<p><strong>A 42-year-old with renal pelvis cancer receives general anesthesia for a laparoscopic radical nephrectomy. The patient has controlled type II diabetes otherwise no other co-morbidities. What is the correct CPT&reg; and ICD-10-CM code for the anesthesia services?</strong></p>', '00860-P1, C64.9 E11.9', '00840-P3, C65.9, E11.9', '00862-P2, C65.9  E11.9', '00868-P2, C79.00  E11.9', '2022-05-13 11:25:33', '2022-05-13 11:25:33', 'ans_c'),
(32, 6, 8, 1, '<p><strong>A patient is having knee replacement surgery. The surgeon requests that in addition to the general anesthesia for the procedure that the anesthesiologist also insert a lumbar epidural cathater&nbsp;for postoperative pain management. The anesthesiologist performs postoperative management for two postoperative days.&nbsp;</strong></p>', '01400-AA, 62326', '01402-AA, 01996 x 2', '01402-AA, 62326-59, 01996 x 2', '01400-AA, 62326', '2022-05-13 11:26:42', '2022-06-14 07:25:35', 'ans_c'),
(33, 6, 8, 1, '<p><strong>A healthy 32-year-old with a closed distal radius fracture received monitored anesthesia care for an ORIF of the distal radius. What is the code for the anesthesia service?</strong></p>', '01830-P1', '01860-QS-P1', '01830-QS-P1', '01860-QS-G9-P1', '2022-05-13 11:28:52', '2022-05-13 11:28:52', 'ans_c'),
(34, 6, 8, 1, '<p><strong>&nbsp;If the anesthesia service were provided to a patient who had severe systemic disease, what would the physical status modifier be?</strong></p>', 'P1', 'P2', 'P3', 'P4', '2022-05-13 11:30:42', '2022-05-13 11:30:42', 'ans_c'),
(35, 6, 8, 1, '<p><strong>What qualifying circumstances code would be used to identify the administration of anesthesia that is complicated by an emergency condition?</strong></p>', '99100', '99116', '99135', '99140', '2022-05-13 11:32:28', '2022-05-13 11:32:28', 'ans_d'),
(36, 6, 8, 1, '<p><strong>Anesthesia service includes the following care:</strong></p>', 'Preoperative, intraoperative', 'Preoperative, intraoperative, postoperative', 'Intraoperative, postoperative', 'Preoperative, postoperative', '2022-05-13 11:34:18', '2022-05-13 11:34:18', 'ans_b'),
(37, 6, 8, 1, '<p><strong>The following is the anesthesia formula:</strong></p>', 'BTC', 'TBC', 'BTQ', 'BTM', '2022-05-13 11:37:19', '2022-05-13 11:37:19', 'ans_d'),
(38, 6, 8, 1, '<p><strong>Which HCPCS modifier indicates an anesthesia service in which the anesthesiologist medically directs one CRNA?</strong></p>', 'QX', 'QY', 'QZ', 'QQ', '2022-05-13 11:40:01', '2022-05-13 11:40:01', 'ans_b'),
(39, 6, 8, 1, '<p><strong>Anesthesia service for a pneumocentesis for lung aspiration, 32420.</strong></p>', '00522', '00500', '00520', '00524', '2022-05-13 11:41:47', '2022-05-13 11:41:47', 'ans_d'),
(40, 6, 8, 1, '<p><strong>Patient received by the anesthesiologist for carpal tunnel surgery</strong></p>', '01810-AA-G8', '01840-AA', '01810-AA', '01840-AA-QS', '2022-05-13 11:43:29', '2022-06-14 07:04:41', 'ans_c'),
(41, 6, 8, 1, '<p><strong>A 65 year old patient is brought emergently to OR for elevation of a compound depressed skull fracture that was sustained in an automobile accident. What are the CPT codes for the anesthesiologist services</strong></p>', '00210, 99140', '00215, 99140', '00215, 99100, 99140', '00210, 99100, 99140', '2022-05-13 11:45:00', '2022-05-13 11:45:00', 'ans_b'),
(42, 6, 8, 1, '<p><strong>A 64-year-old fell in the kitchen while mopping the floor and could not get up. the fall resulted in a broken hip. Upon examination of the break, the physician decides a hip replacement is needed. The patient is taken to the operating room where anesthesia is administered for the surgery of a total hip replacement. Which CPT code(s) should be used for the anesthesiologist services</strong></p>', '01210, 99100', '01210', '01214', '01214, 99100', '2022-05-13 11:47:06', '2022-12-13 16:16:08', 'ans_c'),
(43, 6, 8, 1, '<p><strong>A patient is coming in for arthroscopic knee surgery. Anesthesiologist prepares the patient at 9.15 am and the surgery begins at 9:30 am. The Surgery finishes at 11:30 am and the anesthesiologist leave patient care at 11:45 am. What is the anesthesia time reported.</strong></p>', '2 hours and 15 minutes', '2 Hours', '2 Hours and 30 minutes', '2 Hours and 45 Minutes', '2022-05-13 11:50:10', '2022-05-13 11:50:10', 'ans_c'),
(44, 6, 8, 1, '<p><strong>A 56 year old male pt underwent coronary artery bypass. A cardiopulmonary bypass machine and One Lung Ventilation will be used this procedure&nbsp;</strong></p>\r\n\r\n<p><strong>And the pt. will be placed under general anesthesia?</strong></p>', '00537', '00566', '00567', '00562', '2022-05-13 11:54:17', '2022-06-14 07:28:34', 'ans_c'),
(45, 6, 8, 1, '<p><strong>A patient presents to the labor and delivery department in the first stages of labor. The baby is in correct position for head presentation to perform a Cesearian delivery. The patient is taken to the operating room where she received anesthesia for this procedure</strong></p>\r\n\r\n<p><strong>what anesthesia code should be used</strong></p>', '01958', '01961', '01967', '01960', '2022-05-13 11:56:14', '2022-05-13 11:56:14', 'ans_b'),
(46, 6, 11, 1, '<p><strong>OPERATIVE REPORT&nbsp;</strong></p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: Excision of back lesion.&nbsp;</strong></p>\r\n\r\n<p><strong>INDICATIONS FOR SURGERY: The patient has an enlarging lesion on the upper mid back.&nbsp; FINDINGS AT SURGERY: There was a 5-cm, upper mid back lesion.&nbsp;</strong></p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: With the patient prone, the back was prepped and draped in the usual sterile fashion. The skin and underlying tissues were anesthetized with 30 mL of 1% lidocaine with epinephrine. Through a 5-cm transverse skin incision, the lesion was excised. Hemostasis was ensured. The incision was&nbsp; closed using 3-0 Vicryl for the deep layers and running 3-0 Prolene&nbsp; subcuticular stitch with Steri-Stripsfor the skin. The patient was returned to the same-day surgery center in stable postoperative condition. All sponge, needle, and instrument counts were correct. Estimated blood loss is 0mL. PATHOLOGY REPORT LATER INDICATED: Follicular cyst, infundibular type, skin of back.&nbsp;&nbsp;</strong></p>', '11406, 12002', '11424', '11406, 12032', '11606', '2022-05-20 07:39:18', '2022-05-20 07:39:18', 'ans_c'),
(47, 6, 11, 1, '<p><strong>EMERGENCY DEPARTMENT REPORT&nbsp;</strong></p>\r\n\r\n<p><strong>CHIEF COMPLAINT: Nasal bridge laceration.&nbsp;</strong></p>\r\n\r\n<p><strong>SUBJECTIVE: The patient is a 74-year-old male who presents to the emergency department with a laceration&nbsp; to the bridge of his nose. He fell in the bathroom tonight. He recalls the incident. He just sort of lost his&nbsp; balance. He denies any vertigo. He denies any chest pain or shortness of breath. He denies any head pain or&nbsp; neck pain. There was no loss of consciousness. He slipped on a wet floor in the bathroom and lost his&nbsp; balance; that is how it happened. He has not had any blood from the nose or mouth. PAST MEDICAL HISTORY:&nbsp;</strong></p>\r\n\r\n<p><strong>1. Parkinson&#39;s&nbsp;</strong></p>\r\n\r\n<p><strong>2. Back pain&nbsp;</strong></p>\r\n\r\n<p><strong>3. Constipation&nbsp;</strong></p>\r\n\r\n<p><strong>MEDICATIONS: See the patient record for a complete list of medications.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>ALLERGIES: NKDA.&nbsp;</strong></p>\r\n\r\n<p><strong>REVIEW OF SYSTEMS: Per HPI. Otherwise, negative.&nbsp;</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAMINATION: The exam showed a 74-year-old male in no acute distress. Examination of the HEAD showed no obvious trauma other than the bridge of the nose, where there is approximately a 1.5- to 2-cm laceration. He had no bony tenderness under this. Pupils were equal, round, and reactive.&nbsp; EARS and NOSE:&nbsp;</strong></p>\r\n\r\n<p><strong>OROPHARYNX was unremarkable. NECK was soft and supple. HEART was regular.&nbsp;</strong></p>\r\n\r\n<p><strong>LUNGS were clear but slightly diminished in the bases.&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE: The wound was draped in a sterile fashion and anesthetized with 1% Xylocaine with sodium bicarbonate. It was cleansed with sterile saline and then repaired using interrupted 6- 0 Ethilon sutures(Dr. Barney Teller, first-year resident, assisted with the suturing).&nbsp; ASSESSMENT: Nasal bridge laceration,status post fall.&nbsp;</strong></p>\r\n\r\n<p><strong>Plan: Keep clean. Sutures out in 5 to 7 days. Watch for signs of infection.&nbsp;</strong></p>', '12051, S01.21XA, W18.49XA', '12011, S01.21XA, W18.49XA', '12011, S01.22XA, W18.30XA', '12011, 11000, S01.22XA, X58.XXXS', '2022-05-20 07:41:20', '2022-05-20 07:41:20', 'ans_b'),
(48, 6, 11, 1, '<p><strong>SAME-DAY SURGERY&nbsp;</strong></p>\r\n\r\n<p><strong>DIAGNOSIS: Inverted nipple with mammary duct ectasia, left.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>OPERATION: Excision of mass deep to left nipple.&nbsp;</strong></p>\r\n\r\n<p><strong>With the patient under general anesthesia, a circumareolarincision was made with sharp dissection and carried down into the breast tissue. The nipple complex was raised up using a small retractor. We gently&nbsp; dissected underneath to free up the nipple entirely. Once this was done, we had the nipple fully unfolded,&nbsp; and there was some evident mammary duct ectasis. An area 3 &times; 4 cm was excised using electrocautery. Hemostasis was maintained with the electrocautery, and then the breast tissue deep to the nipple was&nbsp; reconstructed using sutures of 3-0 chromic. Subcutaneoustissue was closed using 3-0 chromic, and then the&nbsp; skin was closed using 4-0 Vicryl. Steri-Strips were applied. The patient tolerated the procedure well and was&nbsp; returned to the recovery area in stable condition. At the end of the procedure, all sponges and instruments&nbsp; were accounted for.&nbsp;</strong></p>', '19120-RT, N60.41', '11404-LT, N62', '19112, N60.42', '19120-LT, N60.42', '2022-05-20 07:44:08', '2023-05-30 04:55:18', 'ans_d'),
(49, 6, 11, 1, '<p><strong>This patient returns today for palliative care to her feet. Her toenails have become elongated and&nbsp; thickened, and she is unable to trim them on her own. She states that she has had no problems and no acute&nbsp; signs of any infection or otherwise to her feet. She returns today strictly for nail debridement to her feet. EXAMINATION: Her pedal pulses are palpable bilaterally. The nails are mycotic, 1 through 4 on the left, and 1&nbsp; through 3 on the right.&nbsp;</strong></p>\r\n\r\n<p><strong>ASSESSMENT: Onychomycosis, 1 through 4 on the left and 1 through 3 on the right. PLAN: Mild debridement of mycotic nails &times;7. This patient is to return to the clinic in 3 to 4 months for follow up palliative care. </strong></p>', '11721 × 7, B48.8', '99212, 11721, B35.1', '11719, B35.1', '11721, B35.1', '2022-05-20 07:47:31', '2022-05-20 07:47:31', 'ans_d'),
(50, 6, 11, 1, '<p><strong>With the patient having had a wire localization performed by radiology,she was taken to the operating room&nbsp; and, under local anesthesia of the left breast, was prepped and draped in a sterile manner. A breast line&nbsp; incision was made through the entry point of the wire, and a core of tissue surrounding the wire&nbsp; (approximately 1 &times; 2 cm) was removed using electrocautery for hemostasis. The specimen, including the wire, was then submitted to radiology, and the presence of the lesion within the specimen was confirmed. The wound was checked for hemostasis, and this was maintained with electrocautery. The breast tissue was&nbsp; reapproximated using 2-0 and 3-0 chromic. The skin was closed using 4-0 Vicryl in a subcuticular manner.&nbsp; Steri-Strips were applied.&nbsp;</strong></p>\r\n\r\n<p><strong>The patient tolerated the procedure well and was discharged from the operating room in stable condition. At&nbsp; the end of the procedure, all sponges and instruments were accounted for. Pathology report later indicated:&nbsp; Benign lesion.&nbsp;</strong></p>', '11602-LT, D48.60', '11400-LT, C50.919', '19125-LT, D24.2', '19125-LT, D49.3', '2022-05-20 07:50:55', '2022-05-20 07:50:55', 'ans_c'),
(51, 6, 11, 1, '<p><strong>What code(s) would be used to code a split-thickness skin graft, both thighs to the abdomen, measuring 45 &times; 21 cm?&nbsp;</strong></p>', '15100 × 2', '15100, 15101 × 9', '15100, 15101 × 9-51', '15100 × 10', '2022-05-20 07:52:22', '2023-01-04 08:24:20', 'ans_b'),
(52, 6, 11, 1, '<p><strong>Carl Ostrick, a 21-year-old male, slipped on a patch of ice on his sidewalk while shoveling snow. When he&nbsp; fell, his left hand was wedged under his body and his index finger was dislocated. After manipulating the joint back into normal alignment, the surgeon fixed the dislocation by placing a wire percutaneously through the carpometacarpal joint to maintain alignment.&nbsp;</strong></p>', '26608-F1', '26650-FA', '26706-LT', '26676-F1', '2022-05-20 07:57:29', '2022-05-20 07:57:29', 'ans_d'),
(53, 6, 11, 1, '<p><strong>John, an 84-year-old male, tripped while on his morning walk. He stated he was thinking aboutsomething&nbsp; else when he inadvertently tripped over the sidewalk curb and fell to his knees. X-ray indicated a fracture of his right patella. With the patient under general anesthesia, the area was opened and extensively irrigated. The left aspect of the patella was severely fragmented, and a portion of the patella was subsequently removed. The remaining patella fractures were wired. The surrounding tissue was repaired, thoroughly irrigated, and closed in the usual manner.&nbsp;</strong></p>', '27524-RT, S82.001A, W10.1XXA', '27520-RT, S82.009A, W10.1XXA', '27524-RT, S82.001B, W19.XXXA', '27524-RT, S82.009A, W19.XXXA', '2022-05-20 08:00:05', '2022-05-20 08:00:05', 'ans_a'),
(54, 6, 11, 1, '<p><strong>Maryann received a blow to her right tibial shaft while moving a large stuffed chair up a flight of stairs&nbsp; when the person in front of the chair slipped and released his hold on the chair. The full weight of the chair&nbsp; was pushed against her; when she was unable to hold the chair in place, both she and the chair fell to the&nbsp; landing a dozen steps below. The chair tipped on its side and landed on her tibia. On x-ray, the right tibia shaft was fractured in three places. Percutaneousscrews and pins were placed to secure the fracture sites.</strong></p>', '27750-RT, S82.201A, W10.8XXA', '27756-RT, S82.201A, W19.XXXA', '27756-RT, S82.201A , W10.8XXA', '27750-RT, S82.209A, W10.8XXA', '2022-05-20 08:01:09', '2022-05-20 08:01:09', 'ans_c'),
(55, 6, 11, 1, '<p><strong>Darin was a passenger in an automobile rollover accident and was not wearing a seat belt at the time. He&nbsp; was thrown from the automobile and was pinned under the rear of the overturned vehicle. He sustained&nbsp; craniofacialseparation that required complicated internal and external fixation using an open approach to&nbsp; repair the extensive damage. A halo device was used to hold the head immobile.&nbsp;</strong></p>', '21435, 20661', '21435', '21432', '21436, 20661', '2022-05-20 08:02:54', '2022-05-20 08:02:54', 'ans_b'),
(56, 6, 11, 1, '<p><strong>Libby was thrown from a horse while riding in the ditch; a truck that honked the horn as it passed her&nbsp; startled her horse. The horse reared up, and Libby was thrown to the ground. Her left tibia was fractured and&nbsp; required insertion of multiple pins to stabilize the defect area. A unilateral multiplane external fixation system was then attached to the pins.&nbsp;</strong></p>', '20661-LT, S82.202A, V88.9XXA', '20692-LT, S82.202A, V80.11XA', '20692-LT, S82.201A, V80.11XA', '20690-LT, S82.201A, V80.11XA', '2022-05-20 08:08:27', '2022-05-20 08:08:27', 'ans_b'),
(57, 6, 11, 1, '<p><strong>A small incision was made over the left proximal tibia, and a traction pin was inserted through the bone to the opposite side. Weights were then affixed to the pins to stabilize the tibial fracture temporarily until&nbsp; fracture repair could be performed.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', '20650-LT', '20663-LT', '20690-LT', '20692-LT', '2022-05-20 08:10:24', '2022-05-20 08:10:24', 'ans_a'),
(58, 6, 11, 1, '<p><strong>Code only the operative procedure and diagnosis (es).&nbsp;</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS:&nbsp;</strong></p>\r\n\r\n<p><strong>1. Hypoxia&nbsp;</strong></p>\r\n\r\n<p><strong>2. Pneumothorax&nbsp;</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS:&nbsp;</strong></p>\r\n\r\n<p><strong>1. Hypoxia&nbsp;</strong></p>\r\n\r\n<p><strong>2. Pneumothorax&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE: Chest tube placement&nbsp;</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The patient was previously sedated with Versed and paralyzed with Nimbex.&nbsp; Lidocaine was used to numb the incision area in the midlateral left chest at about nipple level. After the&nbsp; lidocaine, an incision was made, and we bluntly dissected to the area of the pleural space, making sure we&nbsp; were superior to the rib. On entrance to the pleural space, there was immediate release of air noted. An 18- gauge chest tube was subsequently placed and sutured to the skin. There were no complicationsfor the&nbsp; procedure, and blood loss was minimal.&nbsp;</strong></p>\r\n\r\n<p><strong>DISPOSITION: Follow-up,single-view, chest x-ray showed significant resolution of the pneumothorax except for a small apical pneumothorax that was noted.&nbsp;</strong></p>', '32554, R09.02, J93.11', '32551, R09.02, J93.11, 71010', '32551, R09.02, J93.11', '32554, R09.02, J93.0', '2022-05-20 08:11:40', '2022-05-20 08:11:40', 'ans_c'),
(59, 6, 11, 1, '<p><strong>OPERATIVE PROCEDURE&nbsp;</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: 68-year-old male in a coma.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: 68-year-old male in a coma.&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Placement of a triple lumen central line in right subclavian vein. With the usual&nbsp; Betadine scrub to the right subclavian vein area and with a second attempt, the subclavian vein was&nbsp; cannulated and the wire was threaded. The first time the wire did not thread right, and so the attempt was&nbsp; aborted to make sure we had good identification of structures. Once the wire was in place the needle was&nbsp; removed and a tissue dilator was pushed into position over the wire. Once that was removed, then the&nbsp; central lumen catheter was pushed into position at 17 cm and the wire removed. All three ports were&nbsp; flushed. The catheter was sewn into position, and a dressing applied.&nbsp;</strong></p>', '36011, R40.1', '36011, R40.20', '36556, R40.1', '36556, R40.20', '2022-05-20 08:32:17', '2022-07-12 11:11:13', 'ans_d'),
(60, 6, 11, 1, '<p><strong>OPERATIVE REPORT: The patient is in for a bone marrow biopsy. The patient was sterilized by standard&nbsp; procedure. Bone marrow core biopsies were obtained from the left posterior iliac crest with minimal&nbsp; discomfort. At the end of the procedure, the patient denied discomfort, without evidence of complications. </strong></p>', '20225', '38221', '38230', '38220', '2022-05-20 08:33:19', '2022-07-12 11:06:03', 'ans_b'),
(61, 6, 11, 1, '<p><strong>What code would you use to report the percutaneous insertion of a dual-chamber pacemaker by means&nbsp; of the subclavian vein?&nbsp;</strong></p>', '33249', '33217', '33208', '33240', '2022-05-20 08:34:46', '2022-05-20 08:34:46', 'ans_c'),
(62, 6, 11, 1, '<p><strong>Patient is a 40-year-old male who was involved in a motor vehicle crash. He is having some pulmonary&nbsp; insufficiency.&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE: Bronchoscope was inserted through the accessory point on the end of the ET tube and was then&nbsp; advanced through the ET tube. The ET tube came pretty close down to the carina. We selectively intubated</strong></p>\r\n\r\n<p><strong>the right main stem bronchus with the bronchoscope. There were some secretions here, and these were&nbsp; aspirated. We then advanced this selectively into first the lower and then the middle and upper lobes. Secretions were present, more so in the middle and lower lobes. No mucous plug was identified. We then&nbsp; went into the left main stem and looked at the upper and lower lobes. There was really not much in the way&nbsp; of secretions present. We did inject some saline and aspirated this out. We then removed the bronchoscope&nbsp; and put the patient back on the supplemental O2 We waited a few minutes. The oxygen level actually stayed&nbsp; pretty good during this time. We then reinserted the bronchoscope and went down to the right side again.&nbsp; We aspirated out all secretions and made sure everything was clear. We then removed the bronchoscope and&nbsp; pulled back on the ET tube about 1.5 cm. We then again placed the patient on supplemental oxygenation. FINDINGS: No mucous plug was identified. Secretions were found mainly in the right lung and were&nbsp; aspirated. The left side looked pretty clear.&nbsp;</strong></p>', '31646, J95.1, V89.2XXA', '32654, J80, V49.88XA', '31645, J80, V49.88XA', '31645, J95.1, V89.2XXA', '2022-05-20 08:37:50', '2022-05-20 08:37:50', 'ans_d'),
(63, 6, 11, 1, '<p><strong>This 52-year-old male has undergone several attempts at extubation, all of which failed. He also has&nbsp;morbid obesity and significant subcutaneous fat in his neck. We performed now a flap tracheostomy&nbsp;and cervical lipectomy. The cervical lipectomy is necessary for adequate exposure and access to the trachea&nbsp; and also to secure tracheotomy tube placement.</strong></p>', '31610, 15839-51', '31610', '31610, 15839', '31603, 15839-51', '2022-05-20 08:38:58', '2022-10-13 07:35:02', 'ans_a'),
(64, 6, 11, 1, '<p>24 year old Connie was brought to the operating room for a diaphragmatic hernia, and transthoracic repair was&nbsp;performed.</p>', '43334', '39503', '43335', '43332', '2022-05-20 08:40:23', '2022-08-02 07:10:35', 'ans_a'),
(65, 6, 11, 1, '<p><strong>What code would you use if the physician performs a pyloroplasty and vagotomy in the same surgical&nbsp; session? </strong></p>', '43865', '50400', '43635', '43640', '2022-05-20 08:41:37', '2022-05-20 08:41:37', 'ans_d'),
(66, 6, 11, 1, '<p><strong>OPERATIVE REPORT&nbsp;</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Proximal ileostomy for diversion of colon. Oversew of right colonic fistula.&nbsp;</strong></p>\r\n\r\n<p><strong>OPERATIVE NOTE: This patient was taken back to the operating room from the intensive care unit. She was&nbsp; having acute signs of leakage from an anastomosisI performed 3 days previously. We took down some of the&nbsp; sutures holding the wound together. We basically exposed all of this patient&#39;s intestine. It was evident that she was leaking from the small bowel as well as from the right colon. I thought the only thing we could do would be to repair the right colon. This was done in two layers, and then we freed up enough bowel to try to make an ileostomy proximal to the area of leakage. We were able to do this with great difficulty, and there was only a small amount of bowel to be brought out. We brought this out as an ileostomy stoma, realizing that it was of questionable viability and that it should be watched closely. With that accomplished, we then packed the wound and returned the patient to the intensive care unit.&nbsp;</strong></p>', '44310, T81.30XA', '44310-78, K91.89', '45136, T85.398A', '45136-78, T81.30XA', '2022-05-20 08:42:43', '2023-10-26 01:14:34', 'ans_b'),
(67, 6, 11, 1, '<p><strong>This patient is taken to the operating room from the intensive care unit (ICU). The area of the stoma&nbsp; appears to be necrotic, and on this basis the surgeon indicates that the patient has been taken back to the&nbsp; operating room. The surgeon performing the revision is not the same surgeon that originally placed the&nbsp; stoma, nor is the stoma being revised during the postoperative period of any previous procedure. PROCEDURE PERFORMED: Revision ileostomy stoma.&nbsp;</strong></p>\r\n\r\n<p><strong>OPERATIVE NOTE: With the patient moved onto the operating table, the abdomen was prepped and draped.&nbsp; The segment of bowel that was serving as the ileostomy was freed up. Going in through this large open&nbsp; wound, we were able to identify which segment of bowel this was. We resected the end of the bowel that&nbsp; was necrotic and freed up enough of the distal small bowel so that we could bring it out through a new stoma&nbsp; that was placed lateral to the original stoma. The stoma was created, the bowel was brought out, and the mucosa was seen onto the skin. With this accomplished, we appeared to have a viable stoma. The patient tolerated this procedure and was returned to the ICU in stable condition.&nbsp;</strong></p>', '44310, K56.7', '45136, A09', '44312, K94.19, K55.0', '44314, K55.0', '2022-05-20 08:43:50', '2022-05-20 08:43:50', 'ans_c'),
(69, 6, 13, 1, '<p><strong>Which punctuation mark between codes in the index of the CPT manual indicates a range of codes is available?</strong></p>', 'period', 'comma', 'semicolon', 'hyphen', '2022-06-03 06:19:41', '2022-06-03 06:19:41', 'ans_d'),
(70, 6, 13, 1, '<p><strong>The term that indicates this is the type of code for which the full code description can be known only if a previous code is referenced:</strong></p>', 'stand-alone', 'indented', 'independent', 'partial', '2022-06-03 06:20:34', '2022-06-03 06:20:34', 'ans_b'),
(71, 6, 13, 1, '<p><strong>The symbol that indicates an add-on code is:</strong></p>', '∆', 'ʘ', '+', 'ᴓ', '2022-06-03 06:21:08', '2022-06-03 06:21:08', 'ans_c'),
(72, 6, 13, 1, '<p><strong>When you see the&nbsp; ᴓ&nbsp; symbol next to a code in the CPT manual, you know that:</strong></p>', 'the code is a new code.', 'new or revised text', 'the code is a modifier -51 exempt code.', 'FDA approval pending.', '2022-06-03 06:21:47', '2022-06-03 06:21:47', 'ans_c'),
(73, 6, 13, 1, '<p><strong>What five categories do the central venous access procedures or devices fall into?</strong></p>', 'Insertion, replacement repair, partial, complete replacement, and removal', 'Removal, partial insertion, replacement repair, complete, and non-replacement', 'Insertion, partial insertion, repair, complete replacement, and removal', 'Removal, insertion, non-removal, partial replacement, and minor repair', '2022-06-03 06:22:22', '2022-06-03 06:22:22', 'ans_a'),
