(76, 6, 13, 1, '<p><strong>The abbreviation HIPAA stands for what act?</strong></p>', 'Health Income Portability and Accountability Act', 'Health Insurance Portability and Accountability Act', 'Health Insurance Possibility and Accountability Act', 'Health Income Position and Accountability Act', '2022-06-03 06:23:40', '2022-06-03 06:23:40', 'ans_b'),
(77, 6, 13, 1, '<p><strong>What are the CPT codes for destruction via laser of eight genital warts on the patient&#39;s&nbsp; vulva?&nbsp;</strong></p>', '56515', '56501', '17003 x 7', '17000, 17003 x 6', '2022-06-03 06:26:06', '2022-06-03 06:26:06', 'ans_b'),
(78, 6, 13, 1, '<p><strong>A patient presents to the emergency room with severe leg pain following a skateboard accident.&nbsp; Radiological findings reveal retention of embedded gravel in the torn muscle. The ER physician states the&nbsp; patient has an open fracture of the tibia. The physician extends the open wound under anesthesia to&nbsp; remove the embedded gravel until clean tissue remain.&nbsp;</strong></p>\r\n\r\n<p><strong>What CPT would report the patient&rsquo;s condition as well as the procedure?&nbsp;</strong></p>', '11011', '11012', '11044', '11043', '2022-06-03 06:26:39', '2022-06-03 06:26:39', 'ans_a'),
(79, 6, 13, 1, '<p><strong>A 36-year-old male presents to have multiple lesions destroyed. Three benign lesions on his face are destroyed and five actinic keratoses on his left arm are destroyed. Codes for the procedures are:</strong></p>', '17000, 17003', '17000, 17003 x 4, 17110', '17110', '17260 x 5, 17110 x 3', '2022-06-03 06:27:14', '2022-06-03 06:27:14', 'ans_b'),
(80, 6, 13, 1, '<p><strong>The physician removes a tumor from the patient&rsquo;s neck using the Mohs micrographic surgery technique. During the first stage, the physician takes four tissue blocks and reviews them under a microscope. The exam of the tissue blocks reveals a second stage is necessary to remove areas where the tumor is still present. The physician removes two additional tissue blocks during second stage. What are the appropriate CPT&reg; codes for reporting the procedure?&nbsp;</strong></p>', '17311, 17312, 17315', '17313, 17315', '17313, 17314, 17315', '17311, 17312', '2022-06-03 06:27:49', '2022-07-08 05:57:15', 'ans_d'),
(81, 6, 13, 1, '<p><strong>24 year old patient had an abscess by her vulva which burst. She has developed a soft tissue infection caused by gas gangrene. The area was debrided of necrotic infected tissue. All of the pus was removed and irrigation was performed with a liter of saline until clear and clean. The infected area was completely drained and the wound was packed gently with sterile saline moistened gauze and pads were placed on top of this. The correct CPT code is:&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>', '56405', '10061', '11004', '11042', '2022-06-03 06:28:22', '2022-06-03 06:28:22', 'ans_c'),
(82, 6, 13, 1, '<p><strong>46 year old female had a previous biopsy that indicated positive margins anteriorly on the right side of her neck. A 0.5 cm margin was drawn out and a 15 blade scalpel was used for full excision of an 8cm lesion. Light undermining of all margins was performed along with layered closure. The specimen was sent for permanent histopathologic examination. What are the code(s) for this procedure?</strong></p>', '11426', '11626', '11626, 12044-51', '11426, 13132, 13133', '2022-06-03 06:28:57', '2022-06-03 06:28:57', 'ans_c'),
(83, 6, 14, 1, '<p>The patient is brought to surgery for an open wound of the left leg, the total extent measuring approximately 40 &times; 35 cm.<br />\r\nDESCRIPTION OF PROCEDURE: The legs were prepped with Betadine scrub and solution and then draped in a routine sterile fashion. Split-thicknessskin grafts measuring about a 10,000th inch thick were taken from both thighs, meshed with a 3:1 ratio mesher, and stapled to the wounds. The donor sites were dressed with scarlet red, and the recipient sites were dressed with Xeroform, Kerlix fluffs, and Kerlix roll, and a few ABD pads were used for absorption. Estimated blood loss was negligible. The patient tolerated the procedure well and left surgery in good condition.</p>', '15120, 15121 × 12, S81.809A, X58.XXXS', '15100, 15101, 11010, S81.809A', '15220, 15221 × 13, S71.109A, S71.101A, X58.XXXS', '15100, 15101 × 13, S81.802A', '2022-06-03 06:29:22', '2023-04-17 05:54:56', 'ans_d'),
(84, 6, 13, 1, '<p><strong>A 32-year-old male who underwent a previous repair of his flexor tendon a year ago presents today&nbsp; with sprained tendon. The injury occurred when he twisted his right leg while playing tackle football.&nbsp; Repairing the flexor tendon this time involves debridement of scar tissue and requires a tendon graft for&nbsp; repair. Which procedure coding combination best describes this encounter?</strong></p>', '27659-RT', '27654-RT', '27652-RT, 20924', '27665-RT', '2022-06-03 06:29:48', '2022-06-03 06:29:48', 'ans_a'),
(85, 6, 14, 1, '<p>What code would be used to code the destruction of a malignant lesion on the genitalia<br />\r\nmeasuring 1.6 cm using cryosurgery?</p>', '17272', '11602', '11420', '11622', '2022-06-03 06:31:01', '2022-06-03 06:31:01', 'ans_a'),
(86, 6, 13, 1, '<p><strong>Pre and post operative diagnosis&nbsp;</strong></p>\r\n\r\n<p><strong>Right tibial plateau fracture involving medial and lateral condyles.&nbsp;</strong></p>\r\n\r\n<p><strong>Right midshaft tibia fracture&nbsp;</strong></p>\r\n\r\n<p><strong>Technique: The patient was taken to the operating room and placed supine on the operating table where&nbsp; successful general anesthetic was performed. The right leg was prepped and draped in the usual sterile&nbsp; fashion. Appropriate preoperative antibiotics were given. A Medial incision was made over the tibial&nbsp; plateau, through skin and subcutaneous tissue below. A small fragment. T plate was placed up along the&nbsp; medial tibial plateau, along the periosteum, which was not stripped. The plate was secured in a buttress&nbsp; fashion supporting the medial tibial plateau. Same was done for the lateral tibial plateau. An anterior lateral&nbsp; incision was made through the skin and subcutaneous tissue below.&nbsp;</strong></p>\r\n\r\n<p><strong>The fascia had been ruptured near the fracture site. The anterior compartment musculature was elevated&nbsp; off the tibia. Careful hemo stasis was applied throughout. There fracture was identified at the shaft of the&nbsp; tibia and reduced. It was held with large reduction forceps. Once this accomplished, attention was drawn&nbsp; to the tibial plateau laterally where a Zimmer periarticular plate was placed along the lateral border of the&nbsp; tibia. This was held with a clamp. Then was placed along the lateral border of the tibia. This was held with a&nbsp; clamp. Then 4.5 mm screws were placed across the tibia plateau. The patient&#39;s bone quality was extremely&nbsp; poor. There was significant amount of osteoporosis making it difficult for good bites with the screws. We&nbsp; were able to interlock the lateral screws with the medial plate using a combination of bolts and washers.&nbsp; This method provided a very stable proximal construct. The plate was then secured distally using a&nbsp; combination of interfragmentary screws and screwed through the plate using more 4.5 mm screws. Stable&nbsp; construct was identified. The wound was irrigated. C-arm images were satisfactory. The wound was closed&nbsp; with a combination of 2.0 Vicryl and 3.0 nylon running suture. Note that the fascia was not closed entirely&nbsp; laterally to allow for some compartment release.&nbsp;</strong></p>', '27535-RT, 27758-RT', '27759-RT', '27536-RT, 27758-RT', '27540-RT, 27756-RT-51', '2022-06-03 06:31:06', '2022-06-03 06:31:06', 'ans_c'),
(87, 6, 13, 1, '<p><strong>This is a 32 year old female who presents today with sacroilitis. On the physical exam there was pain on palpation of the left sacroiliac joint and imaging confirmation was done for the needle positioning. Then 80 mg of Depo-Medrol and 1 mL of bupivacaine at 0.5% was injected into the left sacroiliac joint with a 22 gauge needle. The patient was able to walk from the exam room without difficulty. Follow up will be as needed. The correct CPT code is:&nbsp;</strong></p>', '20610, 77003-26', '20551', '27096-LT', '20555', '2022-06-03 06:31:41', '2022-06-03 06:31:41', 'ans_c'),
(88, 6, 13, 1, '<p><strong>52 year old female has a mass growing on her right flank for several years. It has finally gotten significantly larger and is beginning to bother her. She is brought to the Operating Room for definitive excision. An incision was made directly overlying the mass. The mass was down into the subcutaneous tissue and the surgeon encountered a well encapsulated lipoma approximately 4 centimeters. This was excised primarily bluntly with a few attachments divided with electrocautery. What CPT should be reported?</strong></p>', '21932, D17.9', '21935, D17.1', '21931, D17.1', '21925, R19.09', '2022-06-03 06:32:18', '2022-06-03 06:32:18', 'ans_c'),
(89, 6, 14, 1, '<p>What code(s) is used by the radiologist when performing preoperative placement of a needle localization wire of a single lesion of the breast to be excised?</p>', '19281, 19125', '19125', '19281', '19296', '2022-06-03 06:32:27', '2022-06-17 07:13:19', 'ans_c'),
(90, 6, 13, 1, '<p><strong>A 61 year-old gentleman with a history of a fall while intoxicated suffered a blow to the forehead and imaging revealed a posteriorly displaced odontoid fracture. The patient was taken into the Operating Room, and placed supine on the operating room table. Under mild sedation, the patient was placed in Gardner-Wells tongs and gentle axial traction under fluoroscopy was performed to gently try to reduce the fracture. It did reduce partially without any change in the neurologic examination. More manipulation would be necessary and it was decided to intubate and use fiberoptic technique. The anterior neck was prepped and draped and an incision was made in a skin crease overlying the C 4-C5 area. Using hand-held retractors, the ventral aspect of the spine was identified and the C2-C3 disk space was identified using lateral fluoroscopy. Using some pressure upon the ventral aspect of the C2 body, we were able to achieve a satisfactory reduction of the fracture. Under direct AP and lateral fluoroscopic guidance, a Kirschner wire was advanced into the C2 body through the fracture line and into the odontoid process. This was then drilled, and a 42 millimeter cannulated lag screw was advanced through the C2 body into the odontoid process. What procedure code should be used?&nbsp;</strong></p>', '22505', '22305', '22315', '22318', '2022-06-03 06:33:10', '2022-06-03 06:33:10', 'ans_d'),
(91, 6, 13, 1, '<p><strong>After adequate anesthesia was obtained the patient was turned prone in a kneeling position on the spinal table. A lower midline lumbar incision was made and the soft tissues divided down to the spinous processes. The soft tissues were stripped way from the lamina down to the facets and discectomies and laminectomies were then carried out at L3-4, L4-5 and L5-S1. Interbody fusions were set up for the lower three levels using the Danek allografts and augmented with structural autogenous bone from the iliac crest. The posterior instrumentation of a 5.5 mm diameter titanium rod was then cut to the appropriate length and bent to confirm to the normal lordotic curve. It was then slid immediately onto the bone screws and at each level compression was carried out as each of the two bolts were tightened so that the interbody fusions would be snug and as tight as possible. Select the appropriate CPT code(s) for this visit?</strong></p>', '22612, 22614 x 2, 22842, 20938, 20930', '22533, 22534 x 2, 22842', '22630, 22632 x 2, 22842, 20938, 20930', '22554, 22632 x 2, 22842', '2022-06-03 06:33:49', '2022-06-03 06:33:49', 'ans_c'),
(92, 6, 13, 1, '<p><strong>A 4 year old requiring ECMO requires percutaneous insertion of a peripheral cannula. What is the&nbsp; correct code?&nbsp;</strong></p>', '33951', '33952', '33953', '33954', '2022-06-03 06:34:24', '2022-06-03 06:34:24', 'ans_a'),
(93, 6, 13, 1, '<p><strong>A 35 year old female presented with chronic ethmoid sinusitis. The physician performed nasal endoscopy with bilateral anterior ethmoidectomy. What is the correct code for this service?</strong></p>', '31231-50, 31254-50', '31237-50', '31255-50', '31254-50', '2022-06-03 06:34:55', '2022-06-03 06:34:55', 'ans_d'),
(94, 6, 14, 1, '<p>Patient returns for treatment for 8 extensive warts located on the right and left feet. In the<br />\r\nlast visit a decision was made to inject each wart with an antigen drug on a monthly basis<br />\r\nuntil the warts have resolved. What CPT code is reported?</p>', '11900', '11900 x 8', '11901', '17110 x 8', '2022-06-03 06:34:59', '2022-06-03 06:34:59', 'ans_c'),
(95, 6, 13, 1, '<p><strong>A patient presented with cerebrospinal fluid leak. The physician fractured the middle turbinate and placed a nasal endoscope. The ethmoid sinus was entered through the ethmoid bull. The cerebrospinal fluid leak was isolated and mucosal flaps were developed to plug the defect. What is the correct code for this service?</strong></p>', '63707', '31291', '31290', '62100', '2022-06-03 06:35:24', '2022-06-03 06:35:24', 'ans_c'),
(96, 6, 13, 1, '<p><strong>A 36 year old male presented with a post-traumatic defect in the chest wall. The physician repaired the large defect in the chest wall using muscle and skin flaps. What is the correct code for this service?</strong></p>', '32810', '32820', '21740', '32905', '2022-06-03 06:35:54', '2022-06-03 06:35:54', 'ans_b'),
(97, 6, 13, 1, '<p><strong>A patient had empyma with bronchopleural fistula. The physician closed the bronchopleural fistula and performed a thoracoplasty. Extensive unroofing of the empyema space was done by resecting the overlying ribs and portions of membrane lining the chest cavity. The bronchopleural fistula was resected and then closed by suturing. After the repair of the fistula, the muscles in the area were partially closed over gauze packing and the skin partially closed by suturing in layers. What is the correct code for this service?</strong></p>', '32906', '32905', '32820', '32900', '2022-06-03 06:36:28', '2022-06-03 06:36:28', 'ans_a'),
(98, 6, 13, 1, '<p><strong>What code would you use to report the percutaneous insertion of a dual-chamber pacemaker by means of the subclavian vein?</strong></p>', '33249', '33217', '33208', '33240', '2022-06-03 06:37:02', '2022-06-03 06:37:02', 'ans_c'),
(99, 6, 14, 1, '<p>The dermatologist has performed Mohs micrographic surgery to excise a melanoma from the<br />\r\npatient calf area. Three stages were performed. First stage and second stage had 8 tissue blocks<br />\r\nper stage. The third stage had 3 tissue blocks removed. The appropriate mapping and<br />\r\ndocumentation was done on separate operative report. What CPT codes are reported?</p>', '17313, 17314-51, 17314-51', '17313, 17314, 17314, 17315X6', '17313, 17314, 17314, 17315', '17313, 17315, 17315, 17315', '2022-06-03 06:37:08', '2022-06-03 06:37:08', 'ans_b'),
(100, 6, 13, 1, '<p><strong>A patient with an existing stent in the right hepatic duct presents today for the exchange of the right&nbsp; stent. Placement of a new stent in the right hepatic duct is performed.&nbsp;</strong></p>', '43276-RT, 43274-59-LT', '43276-RT', '43275-LT, 43275-59-RT, 43276-59-LT, 43276-59-RT', '43275-LT, 43276-59-RT', '2022-06-03 06:37:37', '2022-06-03 06:37:37', 'ans_b'),
(101, 6, 13, 1, '<p><strong>7 year old male has obesity with a BMI of 35. He has decided to have a Roux-En-Y gastric bypass. The&nbsp;</strong></p>\r\n\r\n<p><strong>patient is brought to the operating room and placed in supine position. A midline abdominal incision is&nbsp; made. The stomach is mobilized and the proximal stomach is divided and stapled creating a small proximal&nbsp; pouch in continuity with the esophagus. A short limb of the proximal bowel of 115cm is divided. It is&nbsp; brought up and anastomosed to the gastric pouch. The other end of the divided bowel is connected back&nbsp; into the distal small bowel to the short limb&rsquo;s gastric anastomosis to restore intestinal continuity. The&nbsp; abdominal incision is closed.&nbsp;</strong></p>', '43645', '43644', '43846', '43847', '2022-06-03 06:38:07', '2022-06-03 06:38:07', 'ans_c'),
(102, 6, 13, 1, '<p><strong>Abdominal washout with Vac placement at bedside. Indication: Retroperitoneal abscess. Permit: Signed&nbsp;and on the chart. Sedation: Versed 10 Mg. anesthesia Fentanyl. 300 mg. This procedure was done at&nbsp; bedside.&nbsp; The skin was prepped with Chlora prep and the&nbsp; patient was draped in sterile fashion. The bowel did not appear edematous. There were portions of the&nbsp; bowel which appeared to have fibrinous exudate, however there were no sign of pus or necrotic material.&nbsp; The abscess was then drained and area irrigated with approximately 2 L of warm normal saline and&nbsp; Abdominal VAC was placed and secured in place with staples. A seal was established and maintained. The&nbsp; patient tolerated the procedure well. a time out was done before the commencement of this procedure.</strong></p>', '49020', '49060', '49002', '49010', '2022-06-03 06:38:38', '2022-07-14 07:56:31', 'ans_b'),
(103, 6, 13, 1, '<p><strong>Pt with jaundice was seen by the doctor. To obtain liver biopsies. A needle biopsy was taken using CT&nbsp; guidance for needle placement. The doctor. Obtain to care biopsy which were then sent to pathology.&nbsp;</strong></p>', '47000, 47001, 77002', '47000, 77012', '47000, 76942', '47000, 10022, 76942', '2022-06-03 06:39:24', '2022-06-03 06:39:24', 'ans_b'),
(104, 6, 14, 1, '<p>Mary tells her physician that she has been having pain in her left wrist for several weeks. The<br />\r\nphysician examines the area and palpates a ganglion cyst of the tendon sheath. He marks the<br />\r\ninjection sites, sterilizes the area, and injects corticosteroid into\\ two areas.</p>', '20550-LT × 2, M67.442', '20551-LT, M67.432', '20551-LT × 2, M67.40', '20612-LT, 20612-59-LT, M67.432', '2022-06-03 06:40:28', '2022-06-14 09:37:03', 'ans_d'),
(105, 6, 13, 1, '<p><strong>&nbsp;55-year-old patient was admitted with massive gastric dilation. The endoscope was inserted with a catheter placement. The endoscope is passed through the cricopharyngeal muscle area without difficulty. Esophagus is normal, some chronic reflux changes at the esophagogastric junction noted. Stomach significant distention with what appears to be multiple encapsulated tablets in the stomach at least 20 to 30 of these are noted. Some of these are partially dissolved. Endoscope could not be engaged due to high grade narrowing in the pyloric channel. It seems to be a high grade outlet obstruction with a superimposed volvulus. What code should be used for this procedure?</strong></p>', '43246-53', '43241-53', '43235', '43241-52', '2022-06-03 06:40:43', '2022-06-14 11:32:06', 'ans_b'),
(106, 6, 13, 1, '<p><strong>An 82-year-old female had a CAT scan which revealed evidence of a proximal small bowel obstruction. She was taken to the Operating Room where an elliptical abdominal incision was made, excising the skin and subcutaneous tissue. There were extensive adhesions along the entire length of the small bowel: the omentum and bowel were stuck up to the anterior abdominal wall. Time- consuming tedious lysis of adhesions was performed to free up the entire length of the gastrointestinal tract from the ligament to Treitz to the ileocolic anastomosis. The correct CPT code is:&nbsp;</strong></p>', '44005', '44180-22', '44005-22', '44180-59', '2022-06-03 06:41:26', '2022-06-03 06:41:26', 'ans_c'),
(107, 6, 13, 1, '<p><strong>A 30-year-old patient vaginally delivered her first child a healthy boy infant. The patient moves to&nbsp; another city and is going to do her pospartum care with a new OB/GYN provider. What CPT code her new&nbsp; OB/GYN provider code.&nbsp;</strong></p>', '59430', '59400', '59614', '59410', '2022-06-03 06:42:06', '2022-06-03 06:42:06', 'ans_a'),
(108, 6, 14, 1, '<p>The physician applies a body cast from the hips to the shoulders and to the head including thighs. Before application, a stockinette is stretched over the patient, and further padding of the bony areas with felt padding was done.</p>', '29040', '29055', '29046', '29000', '2022-06-03 06:42:19', '2022-08-03 11:04:45', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(109, 6, 13, 1, '<p><strong>The patient is placed supine on the OR table, placed under general anesthesia, scrubbed and draped in usual sterile manner. The abdomen is cannulated and insufflated with CO2. Four ports are placed. The&nbsp; colon is retracted. The laser port is inserted and both fallopian tubes were fulgurated. The area was&nbsp; copiously irrigated with saline and good hemostatis was achieved.&nbsp;</strong></p>', '58356', '58670', '58740', '58662', '2022-06-03 06:42:52', '2022-06-03 06:42:52', 'ans_b'),
(110, 6, 13, 1, '<p><strong>A neonatal male had an elective circumcision before being discharged home from the newborn nursery. The physician uses a ring block for the local anesthetic and the foreskin is placed over the glans. A clamp is selected for the size of the glans and a constricting circular ring is placed over the foreskin to compress and devascularize the foreskin. The devascularized foreskin is excised with a scalpel and the clamp is left in place. Which CPT&reg; code should be used?</strong></p>', '54150', '54160', '54161', '54150-52', '2022-06-03 06:43:32', '2022-09-15 06:26:45', 'ans_a'),
(111, 6, 13, 1, '<p><strong>A 30-year-old disabled Medicare patient is scheduled for surgery due to the discovery of what looks like an ovarian mass on the right ovary. On entering the abdomen, the surgeon finds an enlarged ovarian cyst on the right, but the ovary is otherwise normal. The left ovary is necrotic looking. The decision is made, based on the patient&rsquo;s age, to remove the cyst from the right ovary and to remove the entire left ovary and fallopian tube. Code this encounter.</strong></p>\r\n\r\n<p>&nbsp;</p>', '58920, 58940-51', '58925, 58720-59', '58925-50, 58720-50-59', '58920-50, 58700-50-59', '2022-06-03 06:44:01', '2022-06-03 06:44:01', 'ans_b'),
(112, 6, 13, 1, '<p><strong>The patient is a 25-year-old G2P1 female at 13 weeks with a molar pregnancy. She has had irregular bleeding for one week. Ultrasound was performed yesterday and the physician confirms a 16 week size uterus with hydatidiform molar pregnancy. She is admitted today for an evacuation and curettage. What are the CPT&reg; and ICD-10-CM codes?</strong></p>\r\n\r\n<p>&nbsp;</p>', '59870, O01.9', '59812, O02.89', '57505, O02.0', '59160, O01.9', '2022-06-03 06:44:34', '2022-06-03 06:44:34', 'ans_a'),
(113, 6, 13, 1, '<p><strong>Newborn male is scheduled for a circumcision. He is sterilely prepped and draped; a penile nerve block is performed. The circumcision is performed by a ring device. Hemostasis is achieved. Vaseline Gauze dressing applied. Patient tolerated the procedure well. How would this encounter be coded?</strong></p>', '54160', '54150', '54161, 64450', '54150, 64450', '2022-06-03 06:45:09', '2023-09-08 02:53:43', 'ans_b'),
(114, 6, 13, 1, '<p><strong>What is the CPT Code reported for the surgical release of the ulnar nerve involving the forearm wrist&nbsp; region?&nbsp;</strong></p>', '64716', '64718', '64708', '64719', '2022-06-03 06:45:44', '2022-06-03 06:45:44', 'ans_d'),
(115, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Open fracture, left humerus, with possible loss of left radial pulse.<br />\r\nPROCEDURE PERFORMED: Open reduction internal fixation, left open humerusfracture.<br />\r\nPROCEDURE: While under a general anesthetic, the patient&amp;#39;sleft arm was prepped with Betadine and</p>\r\n\r\n<p>draped in sterile fashion. We then created a longitudinal incision over the anterolateral aspect of his<br />\r\nleft arm and carried the dissection through the subcutaneoustissue. We attempted to identify the lateral<br />\r\nintermuscular septum and progressed to the fracture site, which was actually fairly easily to do because<br />\r\nthere was some significant tearing and rupturing of the biceps and brachialis muscles. These were<br />\r\npartial ruptures, but the bone was relatively easy to expose through this. We then identified the fracture<br />\r\nsite and thoroughly irrigated it with several liters of saline. We also noted that the radial nerve was<br />\r\neasily visible, crossing along the posterolateral aspect of the fracture site. It was intact. We carefully<br />\r\ndetected it throughout the remainder of the procedure. We then were able to strip the periosteum away<br />\r\nfrom the lateral side of the shaft of the humerus both proximally and distally from the fracture site. We<br />\r\ndid this just enough to apply a 6-hole plate, which we eventually held in place with six corticalscrews.<br />\r\nWe did attempt to compressthe fracture site. Due to some comminution,the fracture was not quite<br />\r\nanatomically aligned, but certainly it was felt to be very acceptable. Once we had applied the plate, we<br />\r\nthen checked the radial pulse with a Doppler. We found that the radial pulse was present using the<br />\r\nDoppler, but not with palpation. We then applied Xeroform dressings to the wounds and the incision.<br />\r\nAfter padding the arm thoroughly, we applied a long-arm splint with the elbow flexed about 75<br />\r\ndegrees. He tolerated the procedure well, and the radial pulse was again present on Doppler<br />\r\nexamination at the end of the procedure.</p>', '24515-RT, S42.302B, W19.XXXA', '24500-LT, S42.302B, W19.XXXA', '24515-LT, S42.302B, W19.XXXA', '24505-LT, S42.302B, W19.XXXA', '2022-06-03 06:45:57', '2022-06-03 06:45:57', 'ans_c'),
(116, 6, 13, 1, '<p><strong>Patient has herniated nucleus pulposus. A unilateral posterior laminotomy is performed between C2- C3, C3-C4, C4-C5. At this time, decompression of the nerve roots and disc removal are also done.&nbsp;</strong></p>', '63042-50, 63044-50x2', '63030, 63035 x 2', '63017', '63020, 63035 x2', '2022-06-03 06:46:18', '2022-06-03 06:46:18', 'ans_d'),
(117, 6, 13, 1, '<p><strong>An injection is performed to anesthetize a nerve located between two ribs to block chest wall pain. Which nerve injection code is reported?</strong></p>', '64415', '64421', '64435', '64420', '2022-06-03 06:46:45', '2022-08-02 07:45:41', 'ans_d'),
(118, 6, 13, 1, '<p><strong>A 65-year-old patient presented with ectropion of the right lower eyeliD. Repair with tarsal wedge excision is performed for correction. Attention was then directed to the left eye. The patient also had an ectropion of the left lower lid, which was repaired by suture. Code this procedure.&nbsp;</strong></p>', '67916-50', '67916-E4, 67914-E2', '67914-50', '67923-E4, 67921-E2', '2022-06-03 06:47:26', '2022-06-03 06:47:26', 'ans_b'),
(119, 6, 13, 1, '<p><strong>A 42-year-old patient was in the hosptial three days ago in which a lumbar puncture was preformed to find the etiology of the patient&rsquo;s headaches. Today he is in the neurology clinic because after having the lumbar puncture the headaches have increased in intensity over the past three days. The neurologist examines the patient and finds a CSF leak from the lumbar puncture. A blood patch is performed by epidural injection to repair the leak. Code the service(s) for today&rsquo;s visit.</strong></p>', '62272', '62273', '62270, 62273', '62270, 62282', '2022-06-03 06:48:02', '2022-06-03 06:48:02', 'ans_b'),
(120, 6, 13, 1, '<p><strong>A 63-year-old woman presented to the eye clinic as with symptoms of flashing lights and floaters in the right eye for two days. The ophthalmologist dilates her eyes and checking her with an indirect ophthalmoscope, revealing peripheral retinal break. The physician explains to the patient that there is a high likelihood of retinal detachment. The patient agrees to have the procedure done. The physician lasers the retinal tear and tells the patient to come back in 24 hours for follow-up. Code this visit.</strong></p>\r\n\r\n<p>&nbsp;</p>', '67210', '67145', '67220', '67141', '2022-06-03 06:50:24', '2022-06-03 06:50:24', 'ans_b'),
(121, 6, 13, 1, '<p><strong>A 16-year-old female has just moved to the area from out of state. She has numerous problems and is&nbsp;seen for evaluation and management. The physician documents a medically appropriate history and physical. He reviews complex and detailed medical records from&nbsp;her previous physicians and completes treatment plan and spent 30 minutes.&nbsp;After the visit the physician spends 10 minutes time in&nbsp;a prolonged discussion with the patient&#39;s parents. He personally initiates the care&nbsp;plan with the local health agency and a dietician.&nbsp;</strong></p>\r\n\r\n<p><strong>What is the correct CPT Code(s) for this visit?</strong></p>', '99204, 99358', '99204', '99203', '99202, 99358', '2022-06-03 06:51:20', '2023-10-05 05:04:45', 'ans_b'),
(122, 6, 13, 1, '<p><strong>A patient returns to the physician&#39;s office to see the nurse for a urine dip stick. The patient finished a&nbsp;course of antibiotics for UTI and physician wants to check his urine to make sure the infection is gone. The&nbsp;patient states he still see blood in his urine and frequent urination. The nurse performs a U/A dip and&nbsp;microscopic exam and the test comes back positive. The patient is given another prescription for the UTI.&nbsp;The physician documents the findings and sign off on the nurse&#39;s note.</strong></p>\r\n\r\n<p><strong>What E/M and diagnosis codes should be used?&nbsp;</strong></p>', '99212, 81002', '99211, 81002', '99212, 81000', '99211, 81000', '2022-06-03 06:52:01', '2023-10-06 02:04:54', 'ans_d'),
(123, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Left thigh abscess.<br />\r\nPROCEDURE PERFORMED: Incision and drainage of left thigh abscess.<br />\r\nOPERATIVE NOTE: With the patient under general anesthesia, he was placed in the lithotomy<br />\r\nposition. The area around the anus was carefully inspected, and we saw no evidence of communication<br />\r\nwith the perirectal space. This appears to have risen in the crease at the top of the leg, extending from<br />\r\nthe posterior buttocks region up toward&nbsp;the side of the base of the penis. In any event, the area was<br />\r\nprepped and draped in a sterile manner. Then we incised the area in fluctuation. We obtained a lot of<br />\r\nvery foul-smelling, almoststool-like material (it was not stool, but it was brown and very foul-smelling<br />\r\nmaterial). This was not the typical pus one sees with a Staphylococcus aureus-type infection. The<br />\r\nincision was widened to allow us to probe the cavity fully. Again, I could see no evidence of<br />\r\ncommunication to the rectum, but there was extension down the thigh and extension up into the groin<br />\r\ncrease. The fascia was darkened from the purulent material. I opened some of the fascia to make sure<br />\r\nthe underlying muscle was viable. This appeared viable. No gas was present. There was nothing to<br />\r\nsuggest a necrotizing fasciitis. The patient did have a very extensive inflammation within this abscess<br />\r\ncavity. The abscess cavity was irrigated with peroxide and saline and packed with gauze vaginal<br />\r\npacking. The patient tolerated the procedure well and was discharged from the operating room in stable<br />\r\ncondition.<br />\r\n&nbsp;</p>', '26990-LT, L03.116', '27301-LT, L02.416', '27301-LT, L03.116', '26990-LT, L02.416', '2022-06-03 06:52:25', '2022-06-20 09:05:36', 'ans_b'),
(124, 6, 13, 1, '<p><strong>Patient presents to the physician&rsquo;s office for the first time in 2.5 years with coughing. The physician&nbsp; performs medically appropriate history &amp; exam. Physician reviewed his recently performed CBC and other lab results and ordered chest X-ray AP &amp; Lat view.&nbsp;After reviewing the results of X-ray he assesses&nbsp;the patient with cough-variant asthma with acute exacerbation and GERD. He given bronchodilators, cough syrup and pantoprozole.&nbsp;</strong></p>\r\n\r\n<p><strong>What are the appropriate E/M&nbsp;code(s) for this service?&nbsp;</strong></p>', '99204', '99205', '99214', '99215', '2022-06-03 06:53:06', '2023-10-06 02:36:56', 'ans_c'),
(125, 6, 13, 1, '<p><strong>How much time of complex chronic care management must be performed and documented to code&nbsp; 99487, and 99489.</strong></p>', '90 minutes', '120 Minutes', '150 minutes', '60 minutes', '2022-06-03 06:53:45', '2023-10-06 02:38:09', 'ans_a'),
(126, 6, 14, 1, '<p>A 35-year old is coming in for trigger point injections for right sided thoracic spine pain.</p>\r\n\r\n<p>Four points are injected with Depo with Depo Medrol 40 mg/mg. On the rhomboid major and<br />\r\nlevator scapular muscles. Which CPT code is reported for injections?</p>', '20605x4', '20552', '20553', '20553 x 3', '2022-06-03 06:54:14', '2022-06-03 06:54:14', 'ans_b'),
(127, 6, 13, 1, '<p><strong>A patient that is allergic to peanuts is coming to the allergist&#39;s office for his allergy injection. The&nbsp; patient brings his own supply of the allergy serum and gives it to the nurse. 2 injections are provided by&nbsp; nurse What CPT code is reported?&nbsp;</strong></p>', '95120', '95115', '95117', '95144', '2022-06-03 06:54:25', '2022-06-03 06:54:25', 'ans_c'),
(128, 6, 13, 1, '<p><strong>A 65-year-old female has had several episode of tightness in the chest. Her physician ordered a PTCA&nbsp; of the RCA and left anterior descending coronary artery. The procedure revealed atherosclerosis in the&nbsp; native vessels. It was determined a stent would be required in RCA and atherectomy in LAD to keep the&nbsp; arteries open. The stent was inserted during the procedure. What CPT and diagnosis codes are reported?&nbsp;</strong></p>', '92928-LD', '92920-LD, 92929-59', '92924-LD, 92928-RC', '92920-LD, 92928-59', '2022-06-03 06:55:20', '2022-06-03 06:55:20', 'ans_c'),
(129, 6, 14, 1, '<p>A 32 year old has torn meniscus from a sports injury. The repair is performed with an arthroscope placed into the patellofemoral joint. It showed grade 2 chondromalacia on the patellar side of the joint. The medial compartment was entered and a complex posterior horn tear of the medial meniscus was noted. Repair of the meniscus was carried out to a stable rim along with shaving the articular cartilage. Next, the lateral compartment was entered with a similar tissue removing the meniscus with shaving of the articular cartilage to smooth all surfaces. What CPT code(s) should be reported?</p>', '29881, 29880', '29883', '29880', '29881, 29882', '2022-06-03 06:55:35', '2022-06-17 08:01:24', 'ans_d'),
(130, 6, 14, 1, '<p>A 32 year old has torn meniscus from a sports injury. The repair is performed with an arthroscope placed into the patellofemoral joint. It showed grade 2 chondromalacia on the<br />\r\npatellar side of the joint. The medical compartment was entered and a complex posterior horn tear of the medial meniscus was noted. Repair of the meniscus was carried out to a stable rim<br />\r\nalong with shaving the articular cartilage.&nbsp;What CPT code(s) should be reported?</p>', '29881, 29880', '29883, 29880', '29882', '29880, 29882-51', '2022-06-03 06:55:36', '2022-06-17 11:04:06', 'ans_c'),
(131, 6, 13, 1, '<p><strong>A 56 year old male pt. had a coronary artery bypass two months ago. He now presents for a re operation for coronary bypass. A cardiopulmonary bypass machine will be used this procedure along with&nbsp; hypothermic circulatory arrest and the pt. will be placed under general anesthesia.</strong></p>', '00563', '00560', '00530', '00562', '2022-06-03 06:55:52', '2022-06-03 06:55:52', 'ans_a'),
(132, 6, 13, 1, '<p><strong>A male pt. passes out while jogging in the park. Upon examination at the hospital, he is found to&nbsp; have a wide complex tachycardia and undergoes AICD insertion. For this procedure he is placed under&nbsp; general anesthesia.&nbsp;&nbsp;</strong></p>', '00534-P1', '01926-P1', '01922-P1', '00537-P1', '2022-06-03 06:56:34', '2022-06-03 06:56:34', 'ans_a'),
(133, 6, 14, 1, '<p>This patient returns to the operating room for planned placement of an additional chest tube for an anterior pneumothorax due to a contusion lung injury. The same physician had just placed a chest tube 4 days earlier.</p>', '32551, S27.329A', '32406, S27.309A', '32551-58, S27.329A', '32551-79, S27.309A', '2022-06-03 06:56:58', '2022-06-20 09:32:04', 'ans_c'),
(134, 6, 13, 1, '<p><strong>A 56-year-old receives general anesthesia for an open pleura biopsy. An anesthesiologist medically directs two other cases, and medically directs 2 CRNA on this case. What are the anesthesia codes and modifiers reported for the anesthesiologist and CRNA?&nbsp;</strong></p>', '00540-AA, 00540-QZ', '00540-QK, 00540-QX', '00541-AA, 00540-QZ', '00541-QK, 00541-QX', '2022-06-03 06:57:06', '2022-06-03 06:57:06', 'ans_b'),
(135, 6, 13, 1, '<p><strong>A patient is given general anesthesia by the anesthesiologist for a carpal tunnel nerve release. After the surgery the anesthesiologist is called to perform an axillary block for postoperative pain management on the same patient. What are the appropriate codes?</strong></p>\r\n\r\n<p>&nbsp;</p>', '01829, 64417-59', '01840, 64417-59', '01810, 64417-59', '01830, 64417-59', '2022-06-03 06:57:40', '2022-06-03 06:57:40', 'ans_c'),
(136, 6, 13, 1, '<p><strong>EXAMINATION OF: Right hip.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>DIAGNOSIS: Osteoarthritisright hip.&nbsp;</strong></p>\r\n\r\n<p><strong>ONE-VIEW RIGHT HIP: A single frontal view is obtained of the right hip. No previousstudies are available for comparison. Right hip arthroplasty is seen. Alignment appears grossly unremarkable on this single view.&nbsp; There are skin staples present. Air is seen in the soft tissues, likely due to recent surgery. There appear to be&nbsp; two drains present. The tip of one overliesthe soft tissues superiolateral to the greater trochanter. The&nbsp; second one is more inferior. The tip overliesthe right proximal femoral prosthesis.&nbsp;</strong></p>\r\n\r\n<p><strong>IMPRESSION: Single view of the right hip with findings consistent with recent right total hip arthroplasty.&nbsp;&nbsp;</strong></p>', '72100, M25.451', '73500-RT, M16.9', '72100-26, M19.90', '73501-RT-26, M16.9', '2022-06-03 06:58:19', '2022-06-03 06:58:19', 'ans_d'),
(137, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Atelectasis of the left lower lobe.<br />\r\nPROCEDURE PERFORMED: Bronchoscopy with brushings.<br />\r\nPROCEDURE: The patient was already sedated, on a ventilator, and intubated; so his bronchoscopy was done through the ET tube. It was passed easily down to the carina. About 2 to 2.5 cm above the carina, we could see the trachea, which appeared good, as was the carina. In the right lung, all segments were patent and entered, and no masses were seen. The left lung, however, had petechial ecchymotic areas scattered throughout the airways. The tissue was friable and swollen, but no mucous plugs were noted, and all the airways were open, just some what swollen. No abnormal secretions were noted at all. Brushings were, including some with Mucomyst to see whether we could get some distal mucous plug, but nothing really significant was returned. The specimens were sent to appropriate cytological and bacteriologicalstudies. The patient tolerated the procedure fairly well.</p>', '31624, J98.19', '31623, J98.19', '31623, J98.11', '31622, J98.11', '2022-06-03 06:58:49', '2022-06-20 09:19:23', 'ans_c'),
(138, 6, 13, 1, '<p><strong>EXAMINATION OF: Cervicalspine.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>CLINICAL SYMPTOMS: Herniated disk.&nbsp;</strong></p>\r\n\r\n<p><strong>FINDINGS: A single spot fluoroscopic film from the operating room is submitted for interpretation. The&nbsp; cervical spine is not well demonstrated above the level of the inferior aspect of C6. There is a metallic surgical&nbsp; plate seen anterior to the cervicalspine. The cephalic portion of the plate is at the level of C6 at its superior&nbsp; endplate. That extends in an inferior direction, presumably anterior to C7; however, there is not adequate visualization of C7 to confirm location. Density overlies the C6-7 intervertebral disk space,suggesting the&nbsp; presence of a bone plug in this area; however, again visualization is not adequate in this area. Further evaluation with plain radiographsis recommended. </strong></p>', '72100-26, M51.26', '72020-26, M50.20', '72100-52-26, M50.20', '72020-52-26, M51.24', '2022-06-03 06:58:57', '2022-06-03 06:58:57', 'ans_b'),
(139, 6, 13, 1, '<p><strong>This patient is suffering from primary lung cancer and is in for a follow-up CT scan of the thorax with&nbsp;contrast material. Code the physician component only. </strong></p>', '71250-26, C78.00', '71260, C34.90', '71260-26, C34.90', '71250-26, D49.1', '2022-06-03 06:59:34', '2022-06-23 09:46:11', 'ans_c'),
(140, 6, 13, 1, '<p><strong>This 69-year-old female is in for a magnetic resonance examination of the brain because of new seizure activity. After imaging without contrast, contrast was administered and further sequences were performed. Examination results indicated no apparent neoplasm or vascular malformation.</strong></p>', '70543-26, R56.00', '70543-26, R56.9', '70553-26, R56.9', '70553, G40.909', '2022-06-03 07:00:07', '2022-06-03 07:00:07', 'ans_c'),
(141, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Atelectasis of the left lower lobe.<br />\r\nPROCEDURE PERFORMED: Fiberoptic bronchoscopy with brushing.<br />\r\nPROCEDURE: The patient was already sedated, on a ventilator, and intubated;so his bronchoscopy was done through the ET tube. It was passed easily down to the carina. About 2 to 2.5 cm above the carina, we could see the trachea, which appeared good, as was the carina. In the right lung, all segments were patent and entered, and no masses were seen. The left lung, however, had petechial ecchymotic areas scattered throughout the airways. The tissue was friable and swollen, but no mucous plugs were noted, and all the airways were open, just somewhatswollen. No abnormal secretions were noted at all. Brushings were taken, including some&nbsp;Mucomyst to see whether we could get some distal mucous plug, but nothing really significant was returned. The specimens were sent to appropriate cytological and bacteriologicalstudies. The<br />\r\npatient tolerated the procedure fairly well.</p>', '31622, 31623-51, J98.11', '31622, J98.11', '31623, J98.11', '31624, P28.0', '2022-06-03 07:00:16', '2022-07-05 11:04:23', 'ans_c'),
(142, 6, 13, 1, '<p><strong>This patient undergoes a gallbladder sonogram due to epigastric pain. The report indicates that the visualized portions of the liver are normal. No free fluid noted within Morison&#39;s pouch. The gallbladder is identified and is empty. No evidence of wall thickening or surrounding fluid is seen. There is no ductal dilatation. The common hepatic duct and common bile duct measure 0.4 and 0.8 cm, respectively. The common bile duct measurement is at the upper limits of normal.</strong></p>', '76700-26, R10.84', '76705-26, R10.13', '76775-26, R10.33', '76705, R10.84', '2022-06-03 07:00:40', '2022-06-03 07:00:40', 'ans_b'),
