(146, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.<br />\r\nPOSTOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.<br />\r\nOPERATIVE PROCEDURE: Coronary bypass grafts &times;2 with a single graft from the aorta to the<br />\r\ndistal left anterior descending and from the aorta to the distal right coronary artery.<br />\r\nPROCEDURE: The patient was brought to the operating room and placed in a supine position under<br />\r\ngeneral intubation anesthesia, the anterior chest and legs were prepped and draped in the usual<br />\r\nmanner. A segment of greatersaphenous vein was harvested from the left thigh, utilizing the<br />\r\nendoscopic vein harvesting technique, and prepared for grafting. The sternum was opened in the<br />\r\nusual fashion, and the left internal mammary artery was taken down and prepared for grafting. The<br />\r\nflow through the internal mammary artery was very poor. The patient did have a 25-mm difference<br />\r\nin arterial pressure between the right and left arms, the right arm being higher. The left internal<br />\r\nmammary artery was therefore not used. The pericardium was incised sharply and a pericardial well<br />\r\ncreated. The patient was systemically heparinized and placed on bicaval to aortic cardiopulmonary<br />\r\nbypass with the sump in the main pulmonary artery for cardiac decompression. The patient was<br />\r\ncooled to 26, and on fibrillation an aortic cross-clamp was applied and potassium-rich cold<br />\r\ncrystalline cardioplegic solution was administered through the aortic root with satisfactory cardiac<br />\r\narrest. Subsequent doses were given down the vein grafts as the anastomoses were completed and<br />\r\nvia the coronary sinus in a retrograde fashion. Attention was directed to the right coronary artery.<br />\r\nThe end of the greater saphenous vein was then anastomosed thereto with 7-0 continuous Prolene<br />\r\ndistally. The remaining graft material was then grafted to the left anterior descending at the junction<br />\r\nof the middle and distal third. The aortic cross-clamp was removed after 149 minutes with<br />\r\nspontaneous cardio version. The usual maneuversto remove air from the left heart were then carried<br />\r\nout using transesophageal echocardiographic technique. After all the air was removed and the<br />\r\npatient had returned to a satisfactory temperature, he was weaned from cardiopulmonary bypass<br />\r\nafter 213 minutes utilizing 5 g per kilogram per minute of dopamine. The chest was closed in the<br />\r\nusual fashion. A sterile compression dressing was applied, and the patient returned to the surgical<br />\r\nintensive care unit in satisfactory condition.</p>', '33511, 33517, I70.90', '33511, 33508, I25.10', '33534, 33508, I25.10', '33511, 33517, I25.10', '2022-06-03 07:02:58', '2022-06-03 07:02:58', 'ans_b'),
