(152, 6, 14, 1, '<p>A 33 year old patient needs a peripherally inserted venous access device for cancer treatment.<br />\r\nThe patient was placed in the supine position. Following the administration of light anesthesia,<br />\r\nthe right arm was prepped and draped in the usual fashion. 50 cc of 1 percent Lidocaine with<br />\r\nbicarb was infused in the skin and subcutaneous tissue and the basilic vein is punctured. Using</p>\r\n\r\n<p>seldinger technique the subclavian vein was cannulated on the first attempt. A j-wire passed<br />\r\neasily under fluoroscopic guidance to the subclavian vein. An incision was made and a pocket<br />\r\nmade on the fascia for the port. The catheter was trimmed to length attached to the port and the<br />\r\nport placed in the subcutaneous pocket. Catheter and port were sutured to the fascia. The wound<br />\r\nwas closed with 3-0 Vicryl.</p>', '36570', '36576', '36571', '36568', '2022-06-03 07:05:58', '2022-06-03 07:05:58', 'ans_c'),
