(155, 6, 14, 1, '<p>Pre and Post-operative Dx: Acute MI, severe left main arteriosclerotic coronary<br />\r\nartery disease.</p>\r\n\r\n<p>Procedure performed: IABP right common femoral artery</p>\r\n\r\n<p>Description: Patient&#39;s right groin was prepped and draped in the usual sterile fashion. Access was obtained through the skin using a 4 French sheath into the right common femoral artery. The guidewire was placed and then the intra-aortic balloon pump was placed after the right common femoral artery has been dilated with the small dilator. The balloon pump had good waveform. The balloon pump catheter was secured to his skin after local anesthesia of 2 cc of 1% Xylocaine was used to numb the area. Balloon pump was secured with a 0 silk suture. The patient had sterile dressing placed. The patient tolerated the procedure.</p>', '33967', '33975', '33970', '33973', '2022-06-03 07:07:57', '2022-06-17 07:34:01', 'ans_a'),
