(165, 6, 14, 1, '<p>OPERATIVE REPORT PREOPERATIVE DIAGNOSIS: Melena. POSTOPERATIVE<br />\r\nDIAGNOSIS: Normal endoscopy. PROCEDURE: The video therapeutic flexible endoscope was<br />\r\npassed without difficulty into the oropharynx. The gastroesophageal junction was seen at 40 cm.<br />\r\nInspection of the esophagusrevealed no erythema, ulceration, varices, or other mucosal abnormalities.</p>\r\n\r\n<p>The stomach was entered and the endoscope advanced to the second duodenum. Inspection of the<br />\r\nsecond duodenum, first duodenum, duodenal bulb, and pylorusrevealed no abnormalities. Retroflexion<br />\r\nrevealed no lesions along the curvature. Inspection of the antrum, body, and fundus of the stomach<br />\r\nrevealed no abnormalities. The patient tolerated the procedure well.</p>', '45378', '43235', '49320', '43255', '2022-06-03 07:13:54', '2022-06-03 07:13:54', 'ans_b'),
