(189, 6, 13, 1, '<p><strong>Which statement is TRUE about Z codes:&nbsp;</strong></p>', 'Z codes are never reported as a primary code.', 'Z codes are only reported with injury codes.', 'Z codes may be used either as a primary code or a secondary code.', 'Z codes are always reported as a secondary code.', '2022-06-03 07:36:24', '2022-06-03 07:36:24', 'ans_c'),
(190, 6, 14, 1, '<p>This patient is in for a recurrent herniated disk at L4-S1 on the left. The procedure performed is a<br />\r\nrepeat laminotomy and foraminotomy at the L5-S1 interspace.</p>', '63030-LT, M51.27', '63030-LT, M51.25', '63042-LT, M51.25', '63042-LT, M51.27', '2022-06-03 07:36:33', '2022-06-03 07:36:33', 'ans_d'),
(191, 6, 13, 1, '<p><strong>Which of the following is not an example of PHI?&nbsp;&nbsp;</strong></p>', 'Email addresses', 'An explanation of benefits', 'Health plan beneficiary numbers', 'Number of calories burned', '2022-06-03 07:37:03', '2022-06-24 09:21:13', 'ans_d'),
(192, 6, 13, 1, '<p><strong>The patient is a 67-year-old gentleman with metastatic colon cancer recently operated on for a brain metastasis, now for placement of an Infuse-A-Port for continued chemotherapy. The left subclavian vein was located with a needle and a guide wire placed. This was confirmed to be in the proper position fluoroscopically. A transverse incision was made just inferior to this and a subcutaneous pocket created just inferior to this. After tunneling, the introducer was placed over the guide wire and the power port line was placed with the introducer and the introducer was peeled away. The tip was placed in the appropriate position under fluoroscopic guidance and the catheter trimmed to the appropriate length and secured to the power port device. The locking mechanism was fully engaged. The port was placed in the subcutaneous pocket and everything sat very nicely fluoroscopically. It was secured to the underlying soft tissue with 2-0 silk stitch. What code should be used for this procedure?</strong></p>', '36556, 77001-26', '36558', '36561, 77001-26', '36571', '2022-06-03 07:37:38', '2022-06-03 07:37:38', 'ans_c'),
(193, 6, 13, 1, '<p><strong>The patient is a 59-year-old white male who underwent carotid endarterectomy for symptomatic left carotid stenosis a year ago. A carotid CT angiogram showed a recurrent 90% left internal carotid artery stenosis extending into the common carotid artery. He is taken to the operating room for re-do left carotid endarterectomy. The left neck was prepped and the previous incision was carefully reopened. Using sharp dissection, the common carotid artery and its branches were dissected free. The patient was systematically heparinized and after a few minutes clamps applied to the common carotid artery and its branches. A longitudinal arteriotomy was carried out with findings of extensive layering of intimal hyperplasia with no evidence of recurrent atherosclerosis. A silastic balloon-tip shunt was inserted first proximally and then distally, with restoration of flow. Several layers of intima were removed and the endarterectomized surfaces irrigated with heparinized saline. An oval Dacron patch was then sewn into place with running 6-0 Prolene. Which CPT&reg; code(s) is/are reported?&nbsp;</strong></p>', '35301', '35301, 35390', '35302', '35311, 35390', '2022-06-03 07:38:07', '2022-06-03 07:38:07', 'ans_b'),
(194, 6, 13, 1, '<p><strong>The patient is a 64-year-old female who is undergoing a removal of a previously implanted Medtronic pain pump and catheter due to a possible infection. The back was incised; dissection was carried down to the previously placed catheter. There was evidence of infection with some fat necrosis in which cultures were taken. The intrathecal portion of the catheter was removed. Next the pump pocket was incised and the pump was dissected from the anterior fascia. A 7-mm Blake drain was placed in the pump pocket through a stab incision and secured to the skin with interrupted Prolene. The pump pocket was copiously irrigated with saline and closed in two layers. What are the CPT&reg; and ICD-10-CM codes for this procedure?</strong></p>', '62365, 62350-51, T85.89XA, Z46.2', '62360, 62355-51, T85.79XA', '62365, 62355-51, T85.79XA', '36590, I97.42, T85.89XA', '2022-06-03 07:38:40', '2022-06-03 07:38:40', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(195, 6, 13, 1, '<p><strong>79-year-old male with symptomatic bradycardia and syncope is taken to the Operating Suite where an insertion of a DDD pacemaker will be performed. A left subclavian venipuncture was carried out. A guide wire was passed through the needle, and the needle was withdrawn. A second subclavian venipuncture was performed, a second guide wire was passed and the second needle was withdrawn. An oblique incision in the deltopectoral area incorporating the wire exit sites. A subcutaneous pocket was created with the cautery on the pectoralis fascia. An introducer dilator was passed over the first wire and the wire and dilator were withdrawn. A ventricular lead was passed through the introducer, and the introducer was broken away in the routine fashion. A second introducer dilator was passed over the second guide wire and the wire and dilator were withdrawn. An atrial lead was passed through the introducer and the introducer was broken away in the routine fashion. Each of the leads were sutured down to the chest wall with two 2-0 silk sutures each, connected the leads to the generator, curled the leads, and the generator was placed in the pocket. We assured hemostasis. We assured good position with the fluoroscopy. What code should be used for this procedure?&nbsp;</strong></p>', '33208', '33212', '33226', '33235, 71090-26', '2022-06-03 07:39:16', '2022-06-03 07:39:16', 'ans_a'),
(196, 6, 14, 1, '<p>What code would you assign to report a left partial thyroid lobectomy, with<br />\r\nisthmusectomy?</p>', '60210-LT', '60220-LT', '60212-LT', '60225-LT', '2022-06-03 07:39:23', '2022-06-17 07:06:40', 'ans_a'),
(197, 6, 13, 1, '<p><strong>A 5-year-old male with a history of prematurity was found to have a chordee due to congenital hypospadias. He presents for surgical management for a plastic repair in straightening the abnormal curvature. Under general anesthesia, bands were placed around the base of the penis and incisions were made degloving the penis circumferentially. The foreskin was divided in Byers flaps and the penile skin was reapproximated at the 12 o&rsquo;clock position. Two Byers flaps were reapproximated, recreating a mucosal collar which was then criss-crossed and trimmed in the midline in order to accommodate median raphe reconstruction. This was reconstructed with use of a horizontal mattress suture. The shaft skin was then approximated to the mucosal collar with sutures correcting the defect. Which CPT&reg; code should be used?</strong></p>', '54304', '54340', '54360', '54440', '2022-06-03 07:39:56', '2022-06-03 07:39:56', 'ans_a'),
(198, 6, 13, 1, '<p><strong>22-year-old is 14 weeks pregnant and wants to terminate the pregnancy. She has consented for a D&amp;E. She was brought to the operating room where MAC anesthesia was given. She was then placed in the dorsal lithotomy position and a weighted speculum was placed into her posterior vaginal vault. Cervix was identified and dilated. A 6.5-cm suction catheter hooked up to a suction evacuator was placed and products of conception were evacuated. A medium size curette was then used to curette her endometrium. There was noted to be a small amount of remaining products of conception in her left cornua. Once again the suction evacuator was placed and the remaining products of conception were evacuated. At this point she had a good endometrial curetting with no further products of conception noted. Which CPT&reg; code should be used?&nbsp;</strong></p>', '59840', '59841', '59812', '59851', '2022-06-03 07:40:25', '2022-06-03 07:40:25', 'ans_b'),
(199, 6, 13, 1, '<p><strong>A 37-year-old female has menorrhagia and wants permanent sterilization. The patient was placed in Allen stirrups in the operating room. Under anesthesia the cervix was dilated and the hysteroscope was advanced to the endometrium into the uterine cavity. No polyps or fibroids were seen. The Novasure was used for endometrial ablation. A knife was then used to make an incision in the right lower quadrant and left lower quadrant with 5-mm trocars inserted under direct visualization with no injury to any abdominal contents. Laparoscopic findings revealed the uterus, ovaries and fallopian tubes to be normal. The appendix was normal as were the upper quadrants. Because of the patient&#39;s history of breast cancer and desire for no further children, it was decided to take out both the tubes and ovaries. This had been discussed with the patient prior to surgery. What are the codes for these procedures? </strong></p>', '58660, 58353-51', '58661, 58563-51', '58661, 58558-51', '58662, 58563-51', '2022-06-03 07:40:53', '2022-06-03 07:40:53', 'ans_b'),
(200, 6, 13, 1, '<p><strong>The patient is a 51-year-old gentleman who has end-stage renal disease. He was in the OR yesterday for a revision of his AV graft. The next day the patient had complications of the graft failing. The patient was back to the operating room where an open thrombectomy was performed on both sides getting good back bleeding, good inflow. An arteriogram was shot. There was a small amount of what looked like pseudo-intima in the distal anastomosis of the venous tract that was causing a flow defect which was taken out with a Fogarty catheter. A Conquest balloon was ballooned up again with a 6 millimeter and a 7 millimeter. An arteriogram was reshot in both directions. The arterial anastomosis looked fine as did the venous anastomosis. Select the appropriate codes for this visit:</strong></p>', '36831-76, 35460-51-76, 75978-26', '36831, 35460-51, 75978-26', '36831-78, 75791-26, 35460-78, 75978-26', '36831-58, 35460-51-58, 75978-26', '2022-06-03 07:41:24', '2022-06-03 07:41:24', 'ans_c'),
(201, 6, 13, 1, '<p><strong>The patient is a 77-year-old white female who has been having right temporal pain and headaches with some visual changes and has a sed rate of 51. She is scheduled for a temporal artery biopsy to rule out temporal arteritis. A Doppler probe was used to isolate the temporal artery and using a marking pen the path of the artery was drawn. Lidocaine 1% was used to infiltrate the skin, and using a 15 blade scalpel the skin was opened in the preauricular area and dissected down to the subcutaneous tissue where the temporal artery was identified in its bed. It was a medium size artery and we dissected it out for a length of approximately 4 cm with some branches. The ends were ligated with 4-0 Vicryl, and the artery was removed from its bed and sent to Pathology as specimen. What code should be used for this procedure?</strong></p>', '37609', '37605', '36625', '37799', '2022-06-03 07:41:49', '2022-06-03 07:41:49', 'ans_a'),
(202, 6, 13, 1, '<p><strong>25-year-old female in the OR for ectopic pregnancy. Once the trocars were place a pneumoperitoneum was created and the laparoscope introduced. The left fallopian tube was dilated and was bleeding. The left ovary was normal. The uterus was of normal size, shape and contour. The right ovary and tube were normal. Due to the patient&rsquo;s body habitus the adnexa could not be visualized to start the surgery. At this point the laparoscopic approach was terminated. The pneumoperitoneum was deflated, and trocar sites were sutured closed. The trocars and laparoscopic instruments had been removed. Open surgery was performed incising a previous transverse scar from a cesarean section. The gestation site was bleeding and all products of conception and clots were removed. The left tube was grasped, clamped and removed in its entirety and passed off to pathology. What code(s) should be used for this procedure?&nbsp;</strong></p>', '59150, 59120', '59151', '59121', '59120', '2022-06-03 07:42:23', '2022-06-03 07:42:23', 'ans_d'),
(203, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Paralytic ectropion, left eye.<br />\r\nPROCEDURE PERFORMED: Medial tarsorrhaphy, left eye.</p>\r\n\r\n<p>In the operating room, after intravenoussedation, the patient was given a total of about 0.5 mL oflocal<br />\r\ninfiltrative anesthetic. The skin surfaces on the medial area of the lid, medial to the punctum, were<br />\r\ndenuded. A bolster had been prepared and double 5-0 silk suture was passed through the bolster,<br />\r\nwhich was passed through the inferiorskin and raw lid margin, then through the superior margin, and<br />\r\nout through the skin. A superior bolster was then applied. The puncta were probed with wire<br />\r\ninstrument and found not to be obstructed. The suture was then fully tied and trimmed. Bacitracin<br />\r\nointment was placed on the surface of the skin. The patient left the operating room in stable condition,<br />\r\nwithout complications, having tolerated the procedure well.</p>', '67875-LT, H02.129', '67710-LT, H02.139', '67882-LT, H02.109', '67880-LT, H02.156', '2022-06-03 07:42:59', '2022-09-05 06:50:31', 'ans_d'),
(204, 6, 14, 1, '<p>This 66-year-old male has been diagnosed with a senile cataract of the posteriorsubcapsular and is<br />\r\nscheduled for a cataract extraction by phacoemulsification of the right eye. The physician has taken<br />\r\nthe patient to the operating room to perform a posteriorsubcapsular cataract extraction with IOL,<br />\r\ndiffuse of the right eye.</p>', '66982-RT, H26.061', '66984-RT, H25.041', '66983-RT, H25.091', '66830-RT, H25.041', '2022-06-03 07:45:00', '2022-06-03 07:45:00', 'ans_b'),
(205, 6, 14, 1, '<p>Patient has estropia of the left eye and presents to operating suite for strabismus surgery. The<br />\r\nphysician resects the medial and lateral rectus muscles of the eye and secure it with sutures.<br />\r\nExtensive scar tissue noted due a previous surgery. Scar tissue is released on the inferior<br />\r\nrectus muscles. What CPT code will be reported for this surgery?</p>', '67312, 67343', '67312', '67311,67343', '67316', '2022-06-03 07:47:01', '2022-06-03 07:47:01', 'ans_a'),
(206, 6, 14, 1, '<p>Pre-op and Post OP Dx: Chronic Otitis Media<br />\r\nProcedure: After the patient was properly identified, he has brought into the operating room<br />\r\nand placed in supine position. The patient was prepped and draped in the usual fashion.<br />\r\nGeneral anesthesia was administered via inhalation mask, and after adequate sedation was<br />\r\nachieved, a Medium sized speculum was placed in the ear and cerumen was removed<br />\r\natraumatically using instruments with operative microscope. An incision was made in the<br />\r\nanterior inferior quadrant of the right tympanum and thick mucoid fluid was suctioned. An<br />\r\nArmstrong grommet ventilating tube was placed without difficulty followed by antibiotic<br />\r\ndrops in cotton balls. Also serous fluid was noted. The patient was awakened after having<br />\r\ntolerated the procedure well and taken to the recovery room in stable<br />\r\ncondition.</p>', '69436-50', '69436-RT', '69433-50', '69420-LT', '2022-06-03 07:48:35', '2022-06-03 07:48:35', 'ans_b'),
(207, 6, 14, 1, '<p>A neurological consultation in the emergency department of the local hospital is requested for a 25- year-old male with suspected closed head trauma. The patient had a loss of consciousness(LOC) this morning&nbsp;after receiving a blow to the head in a high school basketball game. He presents to the emergency&nbsp;department with a headache, dizziness, and confusion. During the history, the girlfriend&nbsp;relates that the patient has been very irritable and confused since the incident. Physical examination reveals&nbsp;the patient to be unsteady and exhibit difficulty in concentration when stating monthsin reverse. The pupils&nbsp;dilate unequally. The physician continues with the physical examination involving an extensive review of&nbsp;neurological function. The neurologist orders a stat CT and MRI. The radiological exam shows a subdural hematoma and the physician made a decision of evacuation of hematoma by craniotomy.</p>', '99285', '99253', '99245', '99255', '2022-06-03 08:40:23', '2023-10-05 02:38:19', 'ans_c'),
(208, 6, 14, 1, '<p>An obstetrician is requested to provide an office consultation to a 23-year-old female with first- trimester bleeding. The patient presents with a history of brownish discharge and occasional pinkish discharge. During the history, the patient relates that she has had suprapubic pain in the past week and&nbsp;cramping. She has felt nausea and has vomited on three occasions. On one occasion, the nausea was accompanied by dizziness and vertigo. The physician conducts a physical examination focused on the&nbsp;patient&#39;s chief complaint. The uterus is found to be soft and involuted. There is cervical motion tenderness and significant abdominal tenderness on palpation. A left pelvic mass is palpated in the left quadrant. The&nbsp;physician orders a pelvic ultrasound, a complete CBC, and differential. The physician spent 45 minutes with the patient.&nbsp;</p>', '99255', '99242', '99244', '99235', '2022-06-03 08:42:45', '2023-10-05 02:57:05', 'ans_c'),
(209, 6, 14, 1, '<p>A 56-year-old established male patient presents to his family physician for an annual checkup at the local outpatient clinic. The physician conducts a detailed history and physical examination, and&nbsp;anticipatory guidance, and the checkup takes 45 minutes.</p>', '99214', '99403', '99386', '99396', '2022-06-03 08:47:02', '2023-10-05 02:59:07', 'ans_d'),
(210, 6, 14, 1, '<p><strong>Kiara Advani, a 37-year-old female, is an established patient who presents to the office with pain in&nbsp;the RLQ with fever. The physician takes a medically appropriate&nbsp;history and examination. The patient was asked to start Meftal and ciplox for 3 days.&nbsp;The physician orders ultrasound of the abdomen locally targeted to the painfull area and ordered CBC if pain does not decreas after 3 days and&nbsp;and was asked to return to office after 3 days with the reports, if required.</strong></p>', '99203', '99213', '99214', '99221', '2022-06-03 08:49:39', '2023-10-05 03:09:00', 'ans_c'),
(211, 6, 14, 1, '<p>Garry, a 4-year-old male, was brought to the emergency department by his mother, where Dr. Black, the&nbsp; emergency department physician, examined the child. Dr. Black has not provided service to this child in the&nbsp;past. During the history, the mother stated that the child has had a temperature of 101&ordm; F for&nbsp;the past 24 hours, has been very fussy, and has been pulling on his left ear. The physician examined the child&nbsp;during and diagnosed otitis media, for which he prescribed a 10-day course of amoxicillin.&nbsp;</p>', '99203', '99283', '99284', '99281', '2022-06-03 08:51:51', '2023-10-05 03:15:45', 'ans_b'),
(212, 6, 14, 1, '<p>Dr. Robertson provided the first month of care planning oversight for home care of a 64-year-<br />\r\nold male patient with advanced pancreatic cancer. He developed a plan that included home<br />\r\noxygen, intravenous diuretics, and pain control management by means of intravenous morphine.<br />\r\nThe time spent in the low intensity oversight for the month was 45 minutes</p>', '99378', '99374', '99375', '99380', '2022-06-03 08:53:27', '2022-06-03 08:53:27', 'ans_c'),
(213, 6, 14, 1, '<p>Which HCPCS modifier indicates an anesthesia service in which the anesthesiologist medically<br />\r\ndirects one CRNA?</p>', 'QX', 'QY', 'QZ', 'QQ', '2022-06-03 08:54:31', '2022-06-03 08:54:31', 'ans_b'),
(214, 6, 17, 1, '<p><strong>Which CPT codes describe the destruction using electrosurgery to the right leg on a patient diagnosed&nbsp; with 10 premalignant lesions and removal of 10 fibrocutaneous tags during the same session? </strong></p>', '17004, 11200', '17004 x 15, 11200', '17111, 11200', '17000, 17003 X 9, 11200', '2022-06-03 08:57:15', '2022-06-03 08:57:15', 'ans_d'),
(215, 6, 17, 1, '<p><strong>A 59-year-old female has a non-palpable right breast mass. An ultrasound exam 2 days back showed that&nbsp; the mass is not a simple cyst. Fine needle aspiration biopsy of the mass is performed. What procedure&nbsp; code(s) will be reported? </strong></p>', '19100', '10022, 76942', '10021', '19100, 76942', '2022-06-03 08:57:54', '2022-06-03 08:57:54', 'ans_c'),
(216, 6, 17, 1, '<p><strong>The patient presents to the ER with multiple lacerations which require repair. The patient has a 1.4 cm&nbsp; laceration on the right arm, 1.1 cm laceration on the left arm, a 2.5 cm on the right cheek and a 2 cm&nbsp; laceration on the forehead. The deep lacerations on the arms require extensive undermining with layers&nbsp; closures. The lacerations on the patient&#39;s face require extensive debridement of glass particles and a single&nbsp; layer closure.&nbsp;</strong></p>', '13121, 12053-59', '13120, 12052-59', '12034, 12014-59', '12032, 12031-59, 12013-59, 12011-59', '2022-06-03 08:58:55', '2022-06-03 08:58:55', 'ans_b'),
(217, 6, 17, 1, '<p><strong>A 15 year old female with hypertrophic breasts is experiencing back pain. She was seen with her parents&nbsp; requesting surgical treatment for this problem. A few weeks later she received a mammoplasty removing&nbsp; breast tissue to correct this problem. What are the correct CPT codes for this scenario?&nbsp;</strong></p>', '19318', '19301', '19306', '19316', '2022-06-03 08:59:44', '2022-06-03 08:59:44', 'ans_a'),
(218, 6, 17, 1, '<p><strong>A 32-year-old male with basal cell cancer, morphea type of the forehead that had been left untreated&nbsp; undergoes a wide excision 2 x 3 sq cm at the vertex. A V-Y plasty flap is done to allow the wound edges to&nbsp; come together without tension and to preserve the hairline. The forehead was undetermined and wound&nbsp; edges were well approximated. The deeper layer was closed with 2-0 monocryl and 2-0 prolene was used&nbsp; for the skin.&nbsp;</strong></p>', '11622, 14020-51, 12032-51', '14020', '14040', '11622', '2022-06-03 09:00:19', '2022-06-03 09:00:19', 'ans_c'),
(219, 6, 17, 1, '<p><strong>A surgeon performs a unilateral radical mastectomy including pectoral muscles and internal mamary lymph nodes&nbsp; on a breast cancer patient. At the same time, she places a permanent tissue expander beneath the skin and&nbsp; chest muscle. Through a small injection port under the skin, saline is injected into the expander over a&nbsp; period of two months to gradually fill it to the desired size while stretching the overlying tissue.&nbsp;</strong></p>', '19305, 19357-51', '19305, 19340-51', '19305, 19364-51', '19306, 19357-51', '2022-06-03 09:00:49', '2023-05-30 02:17:16', 'ans_d'),
(220, 6, 14, 1, '<p>Anesthesia service for a pneumo centesis for lung aspiration, 32420.</p>', '00522', '00500', '00520', '00524', '2022-06-03 09:05:33', '2022-06-03 09:05:33', 'ans_d'),
(221, 6, 14, 1, '<p>A patient is coming in for arthroscopic knee surgery. Anesthesiologist prepares the patient at<br />\r\n9.00 am and the surgery begins at 9:30 am. The Surgery finishes at 11:30 am and the<br />\r\nanesthesiologist leave patient care at 11:30 am. What is the anesthesia time reported?</p>', '2 hours and 15 minutes', '2 Hours', '2 Hours and 30 minutes', '2 Hours and 45 Minutes', '2022-06-03 09:06:47', '2022-06-03 09:06:47', 'ans_c'),
(222, 6, 14, 1, '<p>Pediatric patient that is 6 months old is having a planned tracheostomy. What anesthesia<br />\r\ncode is/are reported?</p>', '00350, 99100', '00326, 99100', '00326', '00350, 99140', '2022-06-03 09:08:01', '2022-06-03 09:08:01', 'ans_c'),
(223, 6, 17, 1, '<p><strong>70 year old male has compression fractures of the L2 and L3 due to osteoporosis. Vertebroplasty is&nbsp; performed by using bone filler devices advanced into the vertebral body anteriorly near the midline and&nbsp; deposit a total of 1.75 ml of radiopaque bone cement at the L2 level and 5.5 ml of radiopaque cement at&nbsp; the L3 level on the right and left sides.&nbsp;</strong></p>', '22511, 22512', '22514-50, 22515-50-51', '22514, 22515', '22514, 22515-51', '2022-06-03 09:08:59', '2022-06-20 05:29:17', 'ans_c'),
(224, 6, 17, 1, '<p><strong>An elderly female presented with increasing pain in her left dorsal foot. The patient was brought to the&nbsp; operating room at which time she was placed under general anesthesia. A curvilinear incision was centered&nbsp; over the lesion itself. Soft tissue dissection was carried down through the ganglion. The ganglion was&nbsp; clearly identified as gelatinous material. It was excised directly off the bone and sent to pathology. There&nbsp; was noted to be a large bony spur at the level of the talus. Using double action rongueurs the spur itself&nbsp; was removed and sequestrectomy was performed. Following that a rasp was utilized to smooth the bone&nbsp; surface. The eburnated bony surface was then covered utilizing bone wax. The wound was irrigated and&nbsp; closed in layers. What are the correct CPT codes for the above procedure?&nbsp;&nbsp;</strong></p>', '28122, 28090-51', '28120, 28090-51', '28045, 28092-51', '28100, 28092-51', '2022-06-03 09:09:35', '2022-06-03 09:09:35', 'ans_b'),
(225, 6, 17, 1, '<p><strong>A patient presents with broken screws of the left ankle. The patient was placed on the OR table in the&nbsp; supine position. After satisfactory induction of general anesthesia, the patient&#39;s left ankle was prepped and&nbsp;</strong></p>\r\n\r\n<p><strong>draped. The tourniquet was not positioned or utilized. An incision about 1 cm long was made in the&nbsp; previous incision and superficial dissection was carried to remove the lower broken screws. The wounds&nbsp; were thoroughly irrigated with copious amounts of antibiotics containing saline. Skin was closed in a&nbsp; layered fashion sterile dressing applied. Which CPT codes should be reported for this procedure?&nbsp;</strong></p>', '20670, 12032', '20680', '20670 LT', '20680, 12032', '2022-06-03 09:10:12', '2022-06-03 09:10:12', 'ans_c'),
(226, 6, 17, 1, '<p><strong>Pre and post operative diagnosis: Left humeral supracondylar fracture Indication: 80-year old female fell in the nursing home, fracturing her left supracondylar humerus. Patient&nbsp; and family have been told of the risk and benefits and wished to proceed with surgery Technique: Patient was brought to the operating suite and placed in supine position on the operating table. General anesthesia was induced and antibiotics were given preoperatively. The left arm was prepped and&nbsp; draped with land marks identified. An incision from the midline of the arm to just distal of olecranon is&nbsp; performed. Dissection is performed. Dissection was carried down through the fascia to the bone. The&nbsp; fracture site was seen and traction was applied and a bone clamp achieving anatomic reduction. Two 3.5&nbsp; screws were placed and countersunk near anatomic alignment. A 10 hole locking large fragment plate from&nbsp; Synthes placed on the anterolateral aspect of the humerus. Multiple locking and standard screw fixation&nbsp; both proximally and distally for a stable construct. Next attention was diverted towards intercondylar&nbsp; extension. Multiplanar C arm fluoroscopic imaging confirmed good anatomic alignment with good screw&nbsp; lengths and nice construct. Wound was irrigated thoroughly and closed in layered fashion over a drain.&nbsp; Sterile dressing applied. Patient taken to the recovery room in stable condition. No operative&nbsp; complications. Estimated blood loss was 300 cc and all counts were correct.&nbsp;</strong></p>', '24545-LT', '24575-LT', '24546-LT', '24577-LT', '2022-06-03 09:10:43', '2022-06-03 09:10:43', 'ans_c'),
(227, 6, 17, 1, '<p><strong>What are the CPT codes for an orthopedic surgeon repairing a mal-union of a tibia fracture using an&nbsp;iliac autograft?&nbsp;</strong></p>', '27724', '27720x2', '27720', '27722x2', '2022-06-03 09:11:13', '2023-04-17 06:57:18', 'ans_a'),
(228, 6, 17, 1, '<p><strong>A surgical arthroscopy of the left knee is performed for a patient with arthropathy associated with&nbsp; tuberculosis. What CPT codes are used for reporting this scenario?&nbsp;</strong></p>', '29871-LT', '29843-LT', '29843-LT, 29840-LT', '29843-LT, 29840-LT-59', '2022-06-03 09:11:44', '2022-06-03 09:11:44', 'ans_a'),
(229, 6, 17, 1, '<p><strong>A lymphangiogram is performed on a patient with early onset of endocervical cancer. Code the&nbsp; condition as well as the injection procedure with radiological imaging on both sides&nbsp;</strong></p>', '38790, 75805', '38792-50, 78195', '38790-50, 75807', '38792, 76942', '2022-06-03 09:12:14', '2022-07-07 08:30:27', 'ans_c'),
(230, 6, 17, 1, '<p><strong>A patient suffers a dissecting infrarenal abdominal aortic aneurysm requiring emergent placement of an&nbsp; aorto-uni-iliac endograft along with stent. What CPT code should the vascular surgeon use to report this&nbsp; procedure?&nbsp;</strong></p>', '34703, 76942', '34703', '34705', '34706', '2022-06-03 09:13:08', '2022-06-03 09:13:08', 'ans_b'),
(231, 6, 17, 1, '<p><strong>A 4-year-old patient undergoes placement of double lumen Hickman (central venous) for cancer&nbsp; treatment. The patient was placed in the supine position. Following the administration of light anaesthesia&nbsp; the right was chest prepped and draped in the usual fashion. 50 cc of 1 percent lidocaine with bicarb was&nbsp; infused in the skin and subcutaneous tissue just below the right clavicle. Using Seldinger technique the&nbsp;</strong></p>\r\n\r\n<p><strong>subclavian vein was cannulated on the first attempt. A wire was inserted and extended down into the right&nbsp; atrium. The anterior right chest wall was then anesthetized. A stab incision was made and the catheter was&nbsp; tunneled from site just above the nipple and lateral to the wire site. Sheath dilator was then inserted over&nbsp; the wire and the wire and dilator were removed. Catheter tip was inserted in to the sheath and the peel&nbsp; away sheath was removed. The tip of the catheter was confirmed be in the right atrium. Flow in the&nbsp; catheter was checked and was excellent.&nbsp;</strong></p>', '36558', '36557', '36560', '36563', '2022-06-03 09:14:03', '2022-06-03 09:14:03', 'ans_b'),
(232, 6, 17, 1, '<p><strong>A Medicare patient is seen by her pulmonologist because she has a chronic productive cough with&nbsp; slightly bloody sputum, wheezing and shortness of breath. The physician performs a rigid bronchoscopy&nbsp; under fluoroscopic guidance and determines that it will be necessary so perform two endobronchial&nbsp; biopsies. </strong></p>', '31625', '36218 X 2', '31628', '32607', '2022-06-03 09:14:57', '2022-06-03 09:14:57', 'ans_a'),
(233, 6, 17, 1, '<p><strong>The operative report reflects that the cardiologist made an incision into the sub the subclavicular&nbsp; pocket which housed a single chamber pacemaker. He detached a malfunctioning ventricular electrode,&nbsp; removed it from the patient and made the decision to have a thoracic surgeon implant an epicardial lead&nbsp; later in the day no new hardware was implanted. He then closed the skin pocket with multiple layers of&nbsp; suture.&nbsp;</strong></p>', '33249', '33234', '33238', '33235', '2022-06-03 09:15:24', '2022-06-03 09:15:24', 'ans_b'),
(234, 6, 17, 1, '<p><strong>Which code(s) is/are reported when the provider removes and replaces the pulse generator for a&nbsp; transvenous single lead defibrillator system?&nbsp;</strong></p>', '33270', '33262, 33272', '33263', '33262', '2022-06-03 09:15:53', '2022-06-03 09:15:53', 'ans_d'),
(235, 6, 17, 1, '<p><strong>A 42-year old patient has symptomatic internal and external hemorrhoids in a single group. In the&nbsp; lithotomy position the perianal tissue is anesthetized with Marcaine 0.25% with epinephrine. the&nbsp; hemorrhoid on the right was grasped and elliptically excised. Attention was turned to the right lower&nbsp; hemorrhoid which was excised down to the internal sphincter muscle. Fissures were also excised. What&nbsp; procedure code should be used? </strong></p>', '46255', '46257', '46260', '46945', '2022-06-03 09:16:33', '2022-06-03 09:16:33', 'ans_b'),
(236, 6, 17, 1, '<p><strong>Operative Report Preoperative Diagnosis: Incarcerated left inguinal hernia in 38 year old male&nbsp; Postoperative Diagnosis: As above Finding: Huge incarcerated left inguinal hernia containing bowel and&nbsp; ascetic fluid, recurrent. Technique: The patient was placed on the operating room table in the supine&nbsp; position. IV sedation was administered without complications. Oxygen and monitoring were in place per&nbsp; protocol. Left groin and scrotum were prepped with Betadine and draped in a sterile fashion. Local&nbsp; anesthesia was infiltrated in the subcutaneous tissue in a field block using a mixture of lidocaine, Marcaine,&nbsp; Saline. The patient was placed general Trendelenburg position. The incision was made over the inguinal&nbsp; ligament and dissection was carried down sharply to the external oblique aponeurosis which was opened&nbsp; along the course of its fibers. Hernia and spermatic cord was encircled with a Penrose drain at the public&nbsp; tubercle. The ilioinguinal nerve was identified and carefully preserved, retracted superiorly. The&nbsp; incarcerated hernia sac was gently dissected away from the vas and the testicular vessels with careful&nbsp; preservation of the vessels. The hernia was then reduced and the defect closed with an extra-large Marlex&nbsp; mesh plug which was sutured in place at various points using 2-0 Vicryl suture. The mesh onlay patch was&nbsp; then placed as reinforcement. The Illoinguinal nerve was placed back in the canal. The onlay patch was&nbsp; sutured together lateral to the internal ring. External oblique was closed with running 2-0 Vicryl suture.&nbsp; Scarpus was closed with interrupted 2-0 Vicryl suture. Skin was closed with staples. Antibiotic ointment and&nbsp; sterile dressing were placed over the incision. All sponge, instrument and needle counts were correct. The&nbsp; patient tolerated the procedure well. He was taken back to the recovery room in stable condition.</strong></p>', '49507', '49521', '49525', '49507, 49568', '2022-06-03 09:17:16', '2022-06-03 09:17:16', 'ans_b'),
(237, 6, 17, 1, '<p><strong>A patient diagnosed with three liver tumors is taken to the operating room. The physician uses a needle&nbsp; electrode to go through the skin administering cryoablation for destruction of the tumors. CT guidance was used to verify the needle was placed in the correct spots and to monitor treatment. What are the&nbsp; procedure and diagnosis codes? </strong></p>', '47382, 77013-26', '47382 x 3, 77013-26', '47380 x 3, 77013-26', '47383, 77013-26', '2022-06-03 09:17:59', '2022-06-03 09:17:59', 'ans_d'),
(238, 6, 17, 1, '<p><strong>A patient complains of tarry, black stools. She has some epigastric tightness. An&nbsp; esophagogastroduodenoscopy is recommended to evaluate the source of the bleeding. Endoscopic is&nbsp; inserted. The esophagus appears normal on scope insertion. No evidence of bleeding in the stomach.&nbsp; Scope is then passed into the duodenum where a polyp is found and removed with Snare technique. No&nbsp; evidence of bleeding post procedure.</strong></p>', '43251', '43270', '43239', '43250', '2022-06-03 09:18:29', '2022-06-03 09:18:29', 'ans_a'),
(239, 6, 17, 1, '<p><strong>A 34 year old male is taken to the OR for takedown of his colostomy and reversal of his Hartmann&#39;s&nbsp; pouch after 6 months of bowel rest for his colitis. The patient is placed supine on the operating table and&nbsp; general endotracheal anesthesia is administered. his abdomen is prepped and draped in the usual sterile&nbsp; manner. The colostomy stoma was incised and dissected sharply from the abdominal wall. this was closed&nbsp; with 0-0 vchornic and 3-0 prolene. The distal portion of the colon was brought up reopened and refreshed.&nbsp; The GIA staple was used to re-anastomse the colon to the rectum.&nbsp;</strong></p>', '44227', '44620', '44625', '44626', '2022-06-03 09:19:00', '2022-06-03 09:19:00', 'ans_d'),
(240, 6, 17, 1, '<p><strong>A patient undergoes a partial Colectomy of the transverse colon including closure of distal segment due&nbsp; to recurrent colon adenocarcinoma. What are the appropriate procedure code? </strong></p>', '44140', '44141', '44143', '44207', '2022-06-03 09:19:32', '2022-06-03 09:19:32', 'ans_c'),
(241, 6, 17, 1, '<p><strong>Diagnosis: Prostatic hyperplasia. </strong></p>\r\n\r\n<p><strong>Procedure: Cystoscopy and transurethral electrosurgical resection of&nbsp; prostate. </strong></p>\r\n\r\n<p><strong>Description: After through betadine prepping and draping and a suitable general anesthesia, the&nbsp; optical dilator was inserted per urethra. Urethra was normal. Prostatic hyperplasia noted particularly&nbsp; lateral lobe hyperplasia. A systematic transurethral resection was performed. All chips were removed.&nbsp; Minimal bleeding. Catheter placed, three way type. The patient tolerated the procedure well and was&nbsp; taken to the recovery room in good condition.</strong></p>', '52601', '52630', '52640', '52648', '2022-06-03 09:19:57', '2022-07-21 10:04:21', 'ans_a'),
(242, 6, 17, 1, '<p><strong>8 year old female requested to have sterilization. The patient is placed supine on the OR table, placed under general anesthesia, scrubbed and draped in the usual sterile manner. The abdomen is cannulated&nbsp; and insufflated with CO2. Four ports are placed. The colon is retracted. A band is used to occlude the&nbsp; fallopian tubes. The physician occludes the fallopian tubes. All ports were removed and port sites sutured&nbsp; closed with 2-prolene.&nbsp;</strong></p>', '58671', '58662', '58673', '58670', '2022-06-03 09:20:30', '2022-06-03 09:20:30', 'ans_a'),
(243, 6, 14, 1, '<p>This 69-year-old female is in for a magnetic resonance examination of the brain because of new<br />\r\nseizure activity. After imaging without contrast, contrast was administered and further sequences were<br />\r\nperformed. Examination results indicated no apparent neoplasm or vascular malformation.</p>', '70543-26, R56.00', '70543-26, R56.9', '70553-26, R56.9', '70553, G40.909', '2022-06-03 09:20:32', '2022-09-21 09:20:48', 'ans_c'),
(244, 6, 17, 1, '<p><strong>A couple presents to the freestanding fertility clinic. The wife has finished her cancer treatment and&nbsp; ready to have in vitro fertilization. The embryos are aspirated in a catheter. The catheter is passed through&nbsp; the cervical os and into the fallopian tubes. The embroys are injected into the fallopian tubes.&nbsp;</strong></p>', '58970', '58976', '58974', '58999', '2022-06-03 09:20:57', '2022-06-03 09:20:57', 'ans_b'),
(245, 6, 17, 1, '<p><strong>A paravaginal defect repair including a cystocele via vaginal approach is performed on a 38-year-old patient.&nbsp;</strong></p>', '57284', '57284, 57240-51', '57285', '57260, 57285-51', '2022-06-03 09:21:26', '2022-06-03 09:21:26', 'ans_c'),
(246, 6, 14, 1, '<p>This patient undergoes a gallbladder sonogram due to epigastric pain. The report indicates that the<br />\r\nvisualized portions of the liver are normal. No free fluid noted within Morison&amp;#39;s pouch. The gallbladder<br />\r\nis identified and is empty. No evidence of wall thickening or surrounding fluid is seen. There is no<br />\r\nductal dilatation. The common hepatic duct and common bile duct measure 0.4 and 0.8 cm,<br />\r\nrespectively. The common bile duct measurement is at the upper limits of normal.</p>', '76700-26, R10.84', '76705-26, R10.13', '76775-26, R10.33', '76705, R10.84', '2022-06-03 09:21:46', '2022-06-14 06:48:09', 'ans_b'),
(247, 6, 17, 1, '<p><strong>A Patient with a history of infertility underwent in vitro fertilization by her physician eight months ago&nbsp; with success. Her twin Pregnancy has been uneventful and she is now in active labor, ready to deliver. Both&nbsp; babies are delivered by Cesarean section and post partum care is done.&nbsp;</strong></p>', '59510 x 2', '59515', '59514', '59620', '2022-06-03 09:21:54', '2022-06-03 09:21:54', 'ans_b'),
(248, 6, 17, 1, '<p><strong>Preoperative Dx: Elevated PSA<br />\r\nA patient presents to the hospital special procedure suite and was placed in the left lateral decubitus&nbsp; position. Five needle transperineal biopsises were obtained from each prostate lobe under stereotactic&nbsp; guidance. A multinodular prostate with an approximate size of 79 grams was identified without apparent urinary obstruction.&nbsp;</strong></p>', '55700, 76942-26,', '55706, 76942-26,', '55700, 77777-26,', '55860, 77776-26,', '2022-06-03 09:22:26', '2022-06-03 09:22:26', 'ans_b'),
(249, 6, 14, 1, '<p>EXAMINATION OF: Chest.<br />\r\nCLINICAL SYMPTOMS: Pneumonia.<br />\r\nPA AND LATERAL CHEST X-RAY.<br />\r\nCONCLUSION: Ventilation within the lung fields has improved compared with previous study.</p>', '71045-26, J15.8', '71048, J15.6', '71046-26, J18.9', '71046, J18.9', '2022-06-03 09:23:20', '2022-06-15 05:06:58', 'ans_c'),
(250, 6, 17, 1, '<p><strong>A 45 Year old from Thoracic spondylosis presents to an outpatient facility to receive transforaminal&nbsp;epidural steroid injections. The injections are administered on the left side in T3, T4 and T5 levels&nbsp;under ultrasonic guidance. What are the correct CPT codes selection for this patient encounter? </strong></p>', '64479-LT, 64480-LT, 76942-59', '64479-RT, 64480-LT', '64999', '64999x 4', '2022-06-03 09:24:12', '2023-10-03 01:52:33', 'ans_a'),
(251, 6, 17, 1, '<p><strong>A patient has chronic cholesteatoma in the right middle ear. The otolaryngologist performed a tympanoplasty with a modified radical mastoidectomy removing the middle ear cholesteatoma. A&nbsp; reconstruction of the canal wall and ossicular chain with PORP was performed and grafting technique was&nbsp; used to repair the eardrum. What is the correct CPT code to report for this surgery?</strong></p>', '69646', '69636', '69642', '69644', '2022-06-03 09:24:40', '2022-06-20 07:24:32', 'ans_a'),
(252, 6, 14, 1, '<p>EXAMINATION OF: Abdomen and pelvis.</p>\r\n\r\n<p>CLINICAL SYMPTOMS: Ascites.</p>\r\n\r\n<p>CT OF ABDOMEN AND PELVIS: Technique: CT of the abdomen and pelvis was performed without oral or IV contrast material per physician request. No previous CT scans for comparison.</p>\r\n\r\n<p>FINDINGS: No ascites. Moderate-sized pleural effusion on the right.</p>', '74150-26, 72192-26, R18.8', '74176-26, J91.8', '74150-26, 72192-26, J91.8', '74176-26, R18.8', '2022-06-03 09:25:01', '2022-06-20 09:22:18', 'ans_b'),
(253, 6, 14, 1, '<p>EXAMINATION OF: Brain.<br />\r\nCLINICAL FINDING: Headache.<br />\r\nCOMPUTED TOMOGRAPHY OF THE BRAIN was performed without contrast material.<br />\r\nFINDINGS: There is blood within the third ventricle. The lateral ventricles show mild dilatation with<br />\r\nsmall amounts of blood.<br />\r\nIMPRESSION: Acute subarachnoid hemorrhage.</p>', '70460-26, R51', '70250, R51', '70450-26, I60.9', '70450-26, R51', '2022-06-03 09:26:40', '2022-06-03 09:26:40', 'ans_c'),
(254, 6, 14, 1, '<p>Report both the technical and professional components of the following service: This 68-year-old<br />\r\nmale is seen in Radiation Oncology Department for prostate cancer. The oncologist performs a</p>\r\n\r\n<p>complex clinical treatment planning, dosimetry calculation, and a complex isodose plan; treatment<br />\r\ndevices include blocks, special shields, and wedges. The patient had 5 days of radiation treatments for 2<br />\r\nweeks, a total of 10 days of treatment.</p>', '77263, 77300, 77307, 77334, C61', '77300, 77315, 77334, 77427 × 2, C61', '77263, 77307, 77334, 77427 × 2, C61', '77263, 77427 × 2, C61', '2022-06-03 09:28:10', '2022-06-03 09:28:10', 'ans_c'),
