(256, 6, 17, 1, '<p><strong>A 55 year old man presents with uncontrolled tremors that have become quite severe and are now&nbsp; disabling. A Trial of a deep brain stimulator electrode is recommended. The patient is placed in head holder&nbsp; adapter for the frame. The scalp is incised exposing the skull and hole is cut in the cranium to reach&nbsp; cerebellar tissue of the brain. The Neurostimulator placed in the cerebellum and are tested to verify&nbsp; placement. What CPT code is reported?&nbsp;</strong></p>', '61863', '61860', '61868', '61867', '2022-06-03 09:32:45', '2023-05-26 13:28:56', 'ans_b'),
