(258, 6, 17, 1, '<p><strong>A 12 year old child with congenital hydrocephalus presents with headache and blurred vision. The&nbsp; patient has shunt that is malfunctioning due to an obstructed valve. The old valve is preplaced with new&nbsp; and shunt system has been tested&nbsp;</strong></p>', '62258', '62256', '62230', '62256, 62258-51', '2022-06-03 09:33:40', '2022-06-03 09:33:40', 'ans_c'),
(259, 6, 17, 1, '<p><strong>A 30 year old was rock climbing and hit his head on a rock suffering an injury resulting in subdural&nbsp; hematoma and skull fracture on right. He has been unconscious for 30 min. surgeon uses burr to create&nbsp; hole in skull over the affected area. The duramater has been exposed and the hole is used to access and&nbsp; drain the hematoma&nbsp;</strong></p>', '61154', '61108', '61156', '61150', '2022-06-03 09:34:09', '2022-06-03 09:34:09', 'ans_a'),
(260, 6, 17, 1, '<p><strong>A 61-year-old patient was diagnosed last year with obstructive sleep apnea. It has been 3.5 years from&nbsp;her last visit. A new doctor in the same specialty group will be examining her. The physician performs a&nbsp;medically appropriate history &amp; examination. Physican reviewed previously performed lab results and chest X ray and ordered a sleep study for the problem, also he prescribed Acetazolamide. The&nbsp; level of service for the encounter is:</strong></p>', '99204', '99205', '99214', '99215', '2022-06-03 09:34:40', '2023-10-04 01:43:21', 'ans_a'),
(261, 6, 17, 1, '<p><strong>52 years old male patient comes in to the ED with severe shortness of breath. The ED physician&nbsp;performed a medically appropriate&nbsp;history &amp; exam.&nbsp;Physician reviewed the X-ray of chest, that confirms&nbsp;COPD. ED physician started albuterol.&nbsp;What CPT code should&nbsp;be reported?&nbsp;</strong></p>', '99283', '99282', '99285', '99284', '2022-06-03 09:35:09', '2023-05-31 00:19:55', 'ans_a'),
(262, 6, 17, 1, '<p><strong>Dr. X requests an endocrinologist to take over treatment for his patient with a new diagnosis of Type 1&nbsp;diabetes mellitus. The endocrinologist sees the patient on day 2 of a hospital admission. He performs a&nbsp;medically appropriate history and exam. He evaluates the patient&#39;s newly diagnosed type 1 diabetes and orders&nbsp;blood glucose levels to continue to be monitored TID. He prescribes Humulin for the patient on second day which she will&nbsp;start receiving during the hospital admission, the endocrinologist performs a moderate MDM and his observations indicate that the patient&#39;s glucose levels are still&nbsp; erratic and adjusts the insulin dosage.&nbsp;</strong></p>\r\n\r\n<p><strong>What CPT code should be reported by the endocrinologist for these two days?</strong></p>', '99243, 99242', '99233, 99232', '99231, 99232', '99254, 99252', '2022-06-03 09:35:45', '2023-10-05 04:43:06', 'ans_c'),
(263, 6, 17, 1, '<p><strong>A 15 year old girl is an established patient scheduled for her yearly physical with her pediatrician.&nbsp;</strong></p>\r\n\r\n<p><strong>During his examination for the physical he discovers lesions on her legs and arms. The physician performs a&nbsp;medically appropriate Hystory and Physical exam and additional documentation on the lesions providing a&nbsp;moderate complexity medical decision making. What CPT code(s) is/are reported for this visit?&nbsp;</strong></p>', '99394-25, 99213-59', '99394, 99213-25', '99394, 99214-25', '99384, 99214-24', '2022-06-03 09:36:18', '2023-05-31 00:05:19', 'ans_c'),
(264, 6, 14, 1, '<p>This patient presented to the laboratory yesterday for a creatine measurement. The results came<br />\r\nback at higher than normal levels; therefore, the patient was asked to return to the laboratory today for<br />\r\na repeat creatine test before the nephrologist is consulted. Report the second day of test only.</p>', '82540 × 2, R79.89', '82550, R79.89', '82550, R79.81', '82540, R79.89', '2022-06-03 09:36:49', '2022-06-03 09:36:49', 'ans_d'),
(265, 6, 17, 1, '<p><strong>A Medicaid patient is seen by the nurse for a pneumonia vaccination. The physician reviews the chart&nbsp; and signs off on the nurse&#39;s note. What procedure and diagnosis codes should be used?</strong></p>', '90471, 90670', 'G0009, 90670', '99211-25, G0008, 90656', 'G0008, 90656', '2022-06-03 09:36:49', '2023-10-05 04:46:37', 'ans_a'),
(266, 6, 17, 1, '<p><strong>Primary Care Provider: Bryan (Internal Medicine)</strong></p>\r\n\r\n<p><strong>Physician Service Provided and Documented by: Oram (Internal Medicine)</strong></p>\r\n\r\n<p><strong>Patient: Ramsy&nbsp;</strong></p>\r\n\r\n<p><strong>DOS: 1/2/2011&nbsp;</strong></p>\r\n\r\n<p><strong>Patient is a 26 year old female Estabilished to this group practice. She has symptoms indicative of gastritis with&nbsp;increasing abdominal bloating. I am&nbsp;seeing the patient first time and contracted as a locum tenum to substitute for Dr. Bryan while&nbsp;he is on vacation for two weeks. What CPT code should be reported?&nbsp;</strong></p>', '99211', '99212-Q6', '99202', '99202-Q6', '2022-06-03 09:37:19', '2023-10-05 04:51:52', 'ans_b'),
(267, 6, 17, 1, '<p><strong>Patient receives monitored anesthesia which is personally monitored by the surgeon for carpal tunnel&nbsp; surgery. </strong></p>', '01810-AA-G8', '001840-AA', '01810-47-G8', '01840-47-QS', '2022-06-03 09:37:51', '2022-06-03 09:37:51', 'ans_c'),
