(269, 6, 17, 1, '<p><strong>A 65 year old patient is brought emergently to OR for elevation of a compound depressed skull&nbsp; fracture that was sustained in an automobile accident. Patient is hypotensive. What are the CPT codes for&nbsp; the anesthesiologist services?&nbsp;</strong></p>', '00210, 99100', '00215, 99140, 99135', '00215, 99100, 99140', '00210, 99100, 99140', '2022-06-03 09:38:18', '2022-06-03 09:38:18', 'ans_b'),
(270, 6, 17, 1, '<p><strong>A 74-year-old fell in the kitchen while mopping the floor and could not get up. The fall resulted in a&nbsp; broken hip. Upon examination of the break, the physician decides a hip replacement is needed. The patient&nbsp; is taken to the operating room where anesthesia is administered for the surgery of a total hip replacement.&nbsp; Which CPT code(s) should be used for the anesthesiologist services?&nbsp;</strong></p>', '01210, 99100', '01210', '01214', '01214, 99100', '2022-06-03 09:38:48', '2022-12-13 16:16:26', 'ans_d'),
(271, 6, 17, 1, '<p><strong>A patient presents to the labor and delivery department in the first stages of labor. The baby is in&nbsp; breech position for head presentation to perform a cesarean delivery. The patient is taken to the operating&nbsp; room where she received anesthesia for this procedure. What anesthesia code should be used?&nbsp; </strong></p>', '01958', '01961', '01967', '01960', '2022-06-03 09:39:17', '2022-06-03 09:39:17', 'ans_b'),
(272, 6, 14, 1, '<p>On examination, the physician notes a gray vaginal discharge, which he places<br />\r\non one side. He puts a drop of saline and views the slide under the microscope and<br />\r\ndetermines that the patient has bacterial vaginitis. Keeping in mind that the lab test<br />\r\nwas performed in the office, and lab setting is regulated by federal rules under the<br />\r\nClinical Laboratory improvement amendments (CLIA), which of the following is<br />\r\nappropriate billing for the test performed in MD office.</p>', '87210-QW', '87210-GA', '87205-GA', '87205-QW', '2022-06-03 09:39:32', '2022-06-03 09:39:32', 'ans_a'),
(273, 6, 17, 1, '<p><strong>This 69-year-old female is in for a magnetic resonance examination of the brain because of new seizure&nbsp; activity. After imaging without contrast, contrast was administered and further sequences were performed.&nbsp; Examination results indicated no apparent neoplasm or vascular malformation.&nbsp;</strong></p>', '70543-26, R56.00', '70543-26, R56.9', '70553-26, R56.9', '70553, G40.909', '2022-06-03 09:39:49', '2022-06-03 09:39:49', 'ans_c'),
