(276, 6, 17, 1, '<p><strong>This 69-year-old female is in for a magnetic resonance examination of the brain because of new seizure&nbsp; activity. After imaging without contrast, contrast was administered and further sequences were performed.&nbsp; Examination results indicated no apparent neoplasm or vascular malformation.&nbsp;</strong></p>', '70543-26, R56.00', '70543-26, R56.9', '70553-26, R56.9', '70553, G40.909', '2022-06-03 09:41:29', '2022-06-03 09:41:29', 'ans_c'),
(277, 6, 17, 1, '<p><strong>This patient undergoes a gallbladder sonogram due to epigastric pain. The report indicates that the&nbsp; visualized portions of the liver are normal. No free fluid noted within Morison&#39;s pouch. The gallbladder is&nbsp; identified and is empty. No evidence of wall thickening or surrounding fluid is seen. There is no ductal&nbsp; dilatation. The common hepatic duct and common bile duct measure 0.4 and 0.8 cm, respectively. The&nbsp; common bile duct measurement is at the upper limits of normal.&nbsp;</strong></p>', '76700-26, R10.84', '76705-26, R10.13', '76775-26, R10.33', '76705, R10.84', '2022-06-03 09:41:59', '2022-06-03 09:41:59', 'ans_b'),
(278, 6, 17, 1, '<p><strong>EXAMINATION OF: Chest.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>CLINICAL SYMPTOMS: Pneumonia.&nbsp;</strong></p>\r\n\r\n<p><strong>PA AND LATERAL CHEST X-RAY.&nbsp;</strong></p>\r\n\r\n<p><strong>CONCLUSION: Ventilation within the lung fields has improved compared with previous day study.&nbsp;</strong></p>', '71045-26, J15.8', '71048, J15.6', '71046-26, J18.9', '71046, J18.9', '2022-06-03 09:42:31', '2022-11-21 10:36:52', 'ans_c'),
(279, 6, 17, 1, '<p><strong>EXAMINATION OF: Abdomen and pelvis.</strong></p>\r\n\r\n<p><strong>CLINICAL SYMPTOMS: AscitesCT OF ABDOMEN AND PELVIS: Technique: CT of the abdomen and pelvis was performed without oral or IV contrast material per physician request. No previous CT scans for comparison.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>FINDINGS: No ascites. Moderate-sized pleural effusion on the right.&nbsp;</strong></p>', '74150-26, 72192-26 R18.8', '74176-26, J91.8', '74150-26, 72192-26 J91.8', '74176-26, R18.8', '2022-06-03 09:43:04', '2022-06-03 09:43:04', 'ans_b'),
(280, 6, 17, 1, '<p><strong>EXAMINATION OF: Brain.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>CLINICAL FINDING: Headache.&nbsp;</strong></p>\r\n\r\n<p><strong>COMPUTED TOMOGRAPHY OF THE BRAIN was performed without contrast material. FINDINGS: There is blood within the third ventricle. The lateral ventriclesshow mild dilatation with small&nbsp; amounts of blood.&nbsp;</strong></p>\r\n\r\n<p><strong>IMPRESSION: Acute subarachnoid hemorrhage.&nbsp;</strong></p>', '70460-26, R51', '70250, R51', '70450-26, I60.9', '70450-26, R51', '2022-06-03 09:43:36', '2022-06-03 09:43:36', 'ans_c'),
(281, 6, 17, 1, '<p><strong>Report both the technical and professional components of the following service: This 68-year-old male is&nbsp; seen in Radiation Oncology Department for prostate cancer. The oncologist performs a complex clinical&nbsp; treatment planning, dosimetry calculation, and a complex isodose plan; treatment devices include blocks,&nbsp; special shields, and wedges. The patient had 5 days of radiation treatments for 2 weeks, a total of 10 days of&nbsp; treatment.&nbsp;</strong></p>', '77263, 77307, 77334, C61', '77300, 77315, 77334, 77427 × 2, C61', '77263, 77307, 77334, 77427 × 2, C61', '77263, 77427 × 2, C61', '2022-06-03 09:44:31', '2022-09-21 09:16:43', 'ans_c'),
