(283, 6, 17, 1, '<p><strong>Within the organ or disease oriented panels, which four panels include codes for tests of potassium&nbsp; (84132), Glucose (82947), and Sodium (84295)&nbsp;</strong></p>', '80048, 80050, 80053, 80061', '80048, 80050, 80053, 80061', '80047, 80048, 80050, 80069', '80051, 80055, 80069, 80076', '2022-06-03 09:45:54', '2022-06-03 09:45:54', 'ans_c'),
(284, 6, 17, 1, '<p><strong>A physician orders an obstetric panel to include syphilis screening using the non- treponemal antibody&nbsp; approach and automated CBC with manual differential WBC count. What code(s) should be reported for&nbsp; lab test(s)? </strong></p>', '80055', '85027, 85007, 87340, 86762, 86780, 86850, 86900, 86901', '85025, 87340, 86762, 86592, 86850, 86900, 86901', '85027, 85004, 87340, 86762, 86780, 86850, 86900, 86901', '2022-06-03 09:46:29', '2022-06-03 09:46:29', 'ans_a'),
(285, 6, 17, 1, '<p><strong>Peripheral stem cells are removed from a patient by apheresis. The cells are stored in a liquid nitrogen&nbsp; freezer with the temperature monitored very closely. What CPT code should be used to report the&nbsp; cryopreservation and storage of cells?&nbsp;</strong></p>', '86932', '89258', '88240', '88241', '2022-06-03 09:47:02', '2022-06-03 09:47:02', 'ans_c'),
(286, 6, 17, 1, '<p><strong>Modifier 91 is applied to a laboratory code under what circumstances?&nbsp;</strong></p>', 'When a test is repeated due to error or insufficient specimen', 'When a test is repeated due to medical necessity', 'When multiple tests are run on the same specimen', 'Under no circumstance should modifier 91 be applied to a laboratory code', '2022-06-03 09:48:08', '2022-06-03 09:48:08', 'ans_b'),
(287, 6, 17, 1, '<p><strong>A patient is brought to the ED by a police officer. It appears the patient has altered cognitive abilities however the patient does not admit to any drug use. The ED physician orders presumptive drug testing for&nbsp; alcohol, methamphetamines and opiates using an automated chemistry analyzer using LC-MS/MS. The test&nbsp; come back positive for alcohol. A definitive test is performed for alcohol. Select the correct code(s).&nbsp;</strong></p>', '80307, 80320', '80305 x 3, 80320', '80306, 80361', '80305 X 3, 80361', '2022-06-03 09:48:38', '2022-06-03 09:48:38', 'ans_a'),
(288, 6, 17, 1, '<p><strong>DIALYSIS INPATIENT NOTE: This 24-year-old male patient is on continuous ambulatory peritoneal dialysis (CAPD) using 1.5%. He drains more than 600 ml. He is tolerating dialysis well. He continues to have some abdominal pain, but his abdomen is not distended. He has some diarrhea. His abdomen does not look like acute abdomen. His vitals, other than blood pressure in the 190s over 100s, are fine. He is afebrile.</strong></p>\r\n\r\n<p><strong>At this time, I will continue with 1.5% dialysate. I gave him labetalol IV for blood pressure. Because of diarrhea, I am going to check stool for white cells, culture. Next we will see what the primary physician says today. His HIDA scan was normal. The patient suffers from ESRD.</strong></p>', '90947, 90960, N18.6, R19.7', '90945, N18.6, R19.7', '90960, N18.6', '90945, N18.6', '2022-06-03 09:49:08', '2022-06-03 09:49:08', 'ans_b'),
(289, 6, 17, 1, '<p><strong>INDICATION: Hypertension with newly diagnosed acute myocardial infarction.</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Insertion of Swan-Ganz catheter.</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The right internal jugular and subclavian area was prepped with antiseptic solution. Sterile drapes were applied. Under usual sterile precautions, the right internal jugular vein was cannulated. A 9 French introducer was inserted, and a 7 French Swan-Ganz catheter was inserted without difficulty. Right atrial pressures were 2 to 3, right ventricular pressures 24/0, and pulmonary artery 26/9 with a wedge pressure of 5. This is a Trendelenburg position. The patient tolerated the procedure well.</strong></p>', '93451, 93503-51, I10', '93503, I10', '93503, 99356, I10, I21.3', '93503, I10, I21.3', '2022-06-03 09:49:36', '2022-06-03 09:49:36', 'ans_d'),
(290, 6, 17, 1, '<p><strong>DIAGNOSIS: Atrial flutter.</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Electrical cardioversion.</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The patient was sedated with Versed and morphine. She was given a total of 5 mg of Versed. She was cardioverted with 50 joules into sinus tachycardia. The patient was given a 20-mg Cardizem IV push. Her heart rate went down to the 110s, and she was definitely in sinus tachycardia.</strong></p>\r\n\r\n<p><strong>CONCLUSION: Successful electrical cardioversion of atrial flutter into sinus tachycardia.</strong></p>', '92961, I49.1', '92960, I48.92', '92960, 92973, I48.92', '92960, I49.8', '2022-06-03 09:50:16', '2022-06-03 09:50:16', 'ans_b'),
