(322, 6, 14, 1, '<p>DIALYSIS INPATIENT NOTE: This 24-year-old male patient is on continuous<br />\r\nambulatory peritoneal dialysis (CAPD) using 1.5%. He drains more than 600 ml. He is<br />\r\ntolerating dialysis well. He continues to have some abdominal pain, but his abdomen is not<br />\r\ndistended. He has some diarrhea. His abdomen does not look like acute abdomen. His vitals,<br />\r\nother than blood pressure in the 190s over 100s, are fine. He is afebrile.At this time, I will<br />\r\ncontinue with 1.5% dialysate. I gave him labetalol IV for blood pressure. Because of diarrhea,<br />\r\nI am going to check stool for white cells, culture. Next we will see what the primary<br />\r\nphysician says today. His HIDA scan was normal. The patient suffers from ESRD.</p>', '90947, 90960, N18.6, R19.7', '90945, N18.6, R19.7', '90960, N18.6', '90945, N18.6', '2022-06-03 10:06:19', '2022-09-19 06:48:10', 'ans_b'),
