(326, 6, 14, 1, '<p>INDICATION: Hypertension with newly diagnosed acute myocardial infarction.<br />\r\nPROCEDURE PERFORMED: Insertion of Swan-Ganz catheter.<br />\r\nDESCRIPTION OF PROCEDURE: The right internal jugular and subclavian area was<br />\r\nprepped with antiseptic solution. Sterile drapes were applied. Under usual sterile precautions,<br />\r\nthe right internal jugular vein was cannulated. A 9 French introducer was inserted, and a 7<br />\r\nFrench Swan-Ganz catheter was inserted without difficulty. Right atrial pressures were 2 to 3,<br />\r\nright ventricular pressures 24/0, and pulmonary artery 26/9 with a wedge pressure of 5. This<br />\r\nis a Trendelenburg position. The patient tolerated the procedure well.</p>', '93451, 93503-51, I10', '93503, I10', '93503, 99356, I10, I21.3', '93503, I10, I21.3', '2022-06-03 10:08:14', '2022-09-19 06:54:51', 'ans_d'),
