(331, 6, 17, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: Excision of back lesion.</strong></p>\r\n\r\n<p><strong>INDICATIONS FOR SURGERY: The patient has an enlarging lesion on the upper midback.</strong></p>\r\n\r\n<p><strong>FINDINGS AT SURGERY: There was a 5-cm, upper midback lesion.</strong></p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: With the patient prone, the back was prepped and draped in the usual sterile fashion. The skin and underlying tissues were anesthetized with 30 mL of 1% lidocaine with epinephrine.</strong></p>\r\n\r\n<p><strong>Through a 5-cm transverse skin incision, the lesion was excised. Hemostasis was ensured. The incision was closed using 3-0 Vicryl for the deep layers and running 3-0</strong></p>\r\n\r\n<p><strong>Prolene subcuticular stitch with Steri-Strips for the skin. The patient was returned to the same-day surgery center in stable postoperative condition. All sponge, needle, and instrument counts were correct. Estimated blood loss is 0 mL.</strong></p>\r\n\r\n<p><strong>PATHOLOGY REPORT LATER INDICATED: Follicular cyst, infundibular type, skin of back.</strong></p>', '11406, 12002', '11424', '11406, 12032', '11606', '2022-06-03 10:14:40', '2022-06-03 10:14:40', 'ans_c'),
(332, 6, 17, 1, '<p><strong>EMERGENCY DEPARTMENT REPORT</strong></p>\r\n\r\n<p><strong>CHIEF COMPLAINT: Nasal bridge laceration.</strong></p>\r\n\r\n<p><strong>SUBJECTIVE: The patient is a 74-year-old male who presents to the emergency department with a laceration to the bridge of his nose. He fell in the bathroom tonight. He recalls the incident. He just sort of lost his balance. He denies any vertigo. He denies any chest pain or shortness of breath. He denies any head pain or neck pain. There was no loss of consciousness. He slipped on a wet floor in the bathroom and lost his balance; that is how it happened. He has not had any blood from the nose or mouth.</strong></p>\r\n\r\n<p><strong>PAST MEDICAL HISTORY:</strong></p>\r\n\r\n<p><strong>1. Parkinson&#39;s</strong></p>\r\n\r\n<p><strong>2. Back pain</strong></p>\r\n\r\n<p><strong>3. Constipation</strong></p>\r\n\r\n<p><strong>MEDICATIONS: See the patient record for a complete list of medications.</strong></p>\r\n\r\n<p><strong>ALLERGIES: NKDA.</strong></p>\r\n\r\n<p><strong>REVIEW OF SYSTEMS: Per HPI. Otherwise, negative.</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAMINATION: The exam showed a 74-year-old male in no acute distress. Examination of the HEAD showed no obvious trauma other than the bridge of the nose, where there is approximately a 1.5- to 2-cm laceration. He had no bony tenderness under this. Pupils were equal, round, and reactive.&nbsp;</strong></p>\r\n\r\n<p><strong>EARS and NOSE:</strong></p>\r\n\r\n<p><strong>OROPHARYNX was unremarkable. NECK was soft and supple. HEART was regular.</strong></p>\r\n\r\n<p><strong>LUNGS were clear but slightly diminished in the bases.</strong></p>\r\n\r\n<p><strong>PROCEDURE: The wound was draped in a sterile fashion and anesthetized with 1%</strong></p>\r\n\r\n<p><strong>Xylocaine with sodium bicarbonate. It was cleansed with sterile saline and then repaired using interrupted 6-0 Ethilon sutures (Dr. Barney Teller, first-year resident, assisted with the suturing).</strong></p>\r\n\r\n<p><strong>ASSESSMENT: Nasal bridge laceration, status post fall.</strong></p>\r\n\r\n<p><strong>Plan: Keep clean. Sutures out in 5 to 7 days. Watch for signs of infection.</strong></p>', '12051, S01.21XA, W18.49XA', '12011, S01.21XA, W18.49XA', '12011, S01.22XA, W18.30XA', '12011, 11000, S01.22XA, X58.XXXS', '2022-06-03 10:15:25', '2022-06-03 10:15:25', 'ans_b'),
(333, 6, 17, 1, '<p><strong>SAME-DAY SURGERY</strong></p>\r\n\r\n<p><strong>DIAGNOSIS: Inverted nipple with mammary duct ectasia, left.</strong></p>\r\n\r\n<p><strong>OPERATION: Excision of mass deep to left nipple.</strong></p>\r\n\r\n<p><strong>With the patient under general anesthesia, a circumareolar incision was made with sharp dissection and carried down into the breast tissue. The nipple complex was raised up using a small retractor. We gently dissected underneath to free up the nipple entirely. Once this was done, we had the nipple fully unfolded, and there was some evident mammary duct ectasis. An area 3 &times; 4 cm was excised using electrocautery.</strong></p>\r\n\r\n<p><strong>Hemostasis was maintained with the electrocautery, and then the breast tissue deep to the nipple was reconstructed using sutures of 3-0 chromic. Subcutaneous tissue was closed using 3-0 chromic, and then the skin was closed using 4-0 Vicryl. Steri-Strips were applied. The patient tolerated the procedure well and was returned to the recovery area in stable condition. At the end of the procedure, all sponges and instruments were accounted for.</strong></p>', '19120-RT, N60.42', '11404-LT, N62', '19112, N60.42', '19120-LT, N60.42', '2022-06-03 10:16:00', '2023-05-30 04:55:38', 'ans_d'),
(334, 6, 14, 1, '<p>Osteomalacia is a condition:</p>', 'Hardening of bone', 'Softening of bone', 'Discoloration', 'Narrowing', '2022-06-03 10:16:00', '2022-06-03 10:16:00', 'ans_b'),
(335, 6, 17, 1, '<p><strong>This patient returns today for palliative care to her feet. Her toenails have become elongated and thickened, and she is unable to trim them on her own. She states that she has had no problems and no acute signs of any infection or otherwise to her feet. She returns today strictly for nail debridement to her feet.&nbsp;</strong></p>\r\n\r\n<p><strong>EXAMINATION: Her pedal pulses are palpable bilaterally. The nails are mycotic, 1 through 4 on the left, and 1 through 3 on the right.</strong></p>\r\n\r\n<p><strong>ASSESSMENT: Onychomycosis, 1 through 4 on the left and 1 through 3 on the right.</strong></p>\r\n\r\n<p><strong>PLAN: Mild debridement of mycotic nails &times;7. This patient is to return to the clinic in 3 to 4 months for follow-up palliative care.</strong></p>', '11721 × 7, B48.8', '99212, 11721, B35.1', '11719, B35.1', '11721, B35.1', '2022-06-03 10:16:29', '2022-06-03 10:16:29', 'ans_d'),
(336, 6, 17, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p><strong>With the patient having had a wire localization performed by radiology, she was taken to the operating room and, under local anesthesia of the left breast, was prepped and draped in a sterile manner. A breast line incision was made through the entry point of the wire, and a core of tissue surrounding the wire (approximately 1 &times; 2 cm) was removed using electrocautery for hemostasis. The specimen, including the wire, was then submitted to radiology, and the presence of the lesion within the specimen was confirmed. The wound was checked for hemostasis, and this was maintained with electrocautery. The breast tissue was reapproximated using 2-0 and 3-0 chromic. The skin was closed using 4-0 Vicryl in a subcuticular manner. Steri-Strips were applied.</strong></p>\r\n\r\n<p><strong>The patient tolerated the procedure well and was discharged from the operating room in stable condition. At the end of the procedure, all sponges and instruments were accounted for. Pathology report later indicated: Benign lesion.</strong></p>', '11602-LT, D48.60', '11400-LT, C50.919', '19125-LT, D24.2', '19125-LT, D49.3', '2022-06-03 10:17:01', '2022-06-03 10:17:01', 'ans_c'),
(337, 6, 14, 1, '<p>The act of turning upward, such as the hand turned palm upward:</p>', 'supination', 'adduction', 'pronation', 'circumduction', '2022-06-03 10:17:09', '2022-06-03 10:17:09', 'ans_a'),
(338, 6, 17, 1, '<p><strong>The patient is brought to surgery for an open wound of the left leg, the total extent measuring approximately 40 &times; 35 cm.</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The legs were prepped with Betadine scrub and solution and then draped in a routine sterile fashion. Split-thickness skin grafts measuring about a 10,000th inch thick were taken from both thighs, meshed with a 3:1 ratio mesher, and stapled to the wounds. The donor sites were dressed with scarlet red, and the recipient sites were dressed with Xeroform, Kerlix fluffs, and Kerlix roll, and a few ABD pads were used for absorption. Estimated blood loss was negligible. The patient tolerated the procedure well and left surgery in good condition.</strong></p>', '15120, 15121 × 12, S81.809A, X58.XXXS', '15100, 15101, 11010, S81.809A, X58.XXXS', '15220, 15221 × 13, S71.109A, S71.101A, X58.XXXS', '15100, 15101 × 13, S71.109A, S71.101A, X58.XXXS', '2022-06-03 10:17:32', '2022-06-03 10:17:32', 'ans_d'),
(339, 6, 17, 1, '<p><strong>PRE OP DIAGNOSIS: Left Breast Abnormal MMX or Palpable Mass; Other Disorders of Breast PROCEDURE: Automated Stereotactic Biopsy Left Breast FINDINGS: Lesion is located in the lateral region, just at or below the level of the nipple on the 90 degree lateral view. There is a subglandular implant in place. I discussed the procedure with the patient today including risks, benefits and alternatives. Specifically discussed was the fact that the implant would be displaced out of the way during this biopsy procedure. Possibility of injury to the implant was discussed with the patient. Patient has signed the consent form and wishes to proceed with the biopsy. The patient was placed prone on the stereotactic table; the left breast was then imaged from the inferior approach. The lesion of interest is in the anterior portion of the breast away from the implant which was displaced back toward the chest wall. After imaging was obtained and stereotactic guidance used to target coordinates for the biopsy, the left breast was prepped with Betadine. 1% lidocaine was injected subcutaneously for local anesthetic. Additional lidocaine with epinephrine was then injected through the indwelling needle. The SenoRx needle was then placed into the area of interest. Under stereotactic guidance we obtained 9 core biopsy samples using vacuum and cutting technique. The specimen radiograph confirmed representative sample of calcification was removed. The tissue marking clip was deployed into the biopsy cavity successfully. This was confirmed by final stereotactic digital image and confirmed by post core biopsy mammogram left breast. The clip is visualized projecting over the lateral anterior left breast in satisfactory position. No obvious calcium is visible on the final post core biopsy image in the area of interest. The patient tolerated the procedure well. There were no apparent complications. The biopsy site was dressed with Steri-Strips, bandage and ice pack in the usual manner. The patient did receive written and verbal post-biopsy instructions. The patient left our department in good condition. IMPRESSION: 1. SUCCESSFUL STEREOTACTIC CORE BIOPSY OF LEFT BREAST CALCIFICATIONS. 2. SUCCESSFUL DEPLOYMENT OF THE TISSUE MARKING CLIP INTO THE BIOPSY CAVITY 3. PATIENT LEFT OUR DEPARTMENT IN GOOD CONDITION TODAY WITH POST-BIOPSY INSTRUCTIONS. 4. PATHOLOGY REPORT IS PENDING; AN ADDENDUM WILL BE ISSUED AFTER WE RECEIVE THE PATHOLOGY REPORT. What are the codes for the procedures?&nbsp;</strong></p>', '19081', '19283', '19081, 19283', '19100, 19283', '2022-06-03 10:18:06', '2022-06-03 10:18:06', 'ans_a'),
(340, 6, 17, 1, '<p><strong>42-year-old male has a frozen left shoulder. An arthroscope was inserted in the posterior portal in the glenohumeral joint. The articular cartilage was normal except for some minimal grade III-IV changes, about 5% of the humerus just adjacent to the rotator cuff insertion of the supraspinatus. The biceps was inflamed, not torn at all. The superior labrum was not torn at all, the labrum was completely intact. The rotator cuff was completely intact. An anterior portal was established high in the rotator interval. The rotator interval was very thick and contracted and this was released with electrocautery and the Bovie including the superior glenohumeral ligament. After this was all released, the middle glenohumeral ligament was released as well as the tendinous portion of the subscapularis. After this was all done with a shaver and electrocautery, the arthroscope was placed anteriorly and the shaver was used to debride some of the posterior capsule and the posterior capsule was released in its posterosuperior and then posteroinferior aspect. After this was done, the arthroscope was then placed back posteriorly and used to release the anteroinferior capsule down to 6&rsquo;oclock. This was done with electrocautery. The arthroscope was then placed anteriorly and used to release the posteroinferior capsule. The arthroscope was then placed back posteriorly and used to confirm that there was still one little strip of capsule around the biceps superiorly and there was one little strip from 6-7 o&rsquo;clock posteroinferiorly that was only partially cut. The rest of the capsule was completely circumferentially released. What CPT&reg; code describes this procedure?</strong></p>', '29823-LT', '29822-LT', '29805-LT, 29806-51-LT', '29825-LT', '2022-06-03 10:18:37', '2022-06-20 05:55:15', 'ans_a'),
(341, 6, 14, 1, '<p>The middle layer of the skin, also known as the corium or true skin, is the:</p>', 'epidermis.', 'stratum corneum', 'dermis', 'subcutaneous.', '2022-06-03 10:18:46', '2022-06-03 10:18:46', 'ans_c'),
(342, 6, 17, 1, '<p><strong>PREOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna. POSTOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna. OPERATIVE PROCEDURE: Reduction with application external fixator, left wrist fracture FINDINGS: The patient is a 46-year-old right-hand-dominant female who fell off stairs 4 to 5 days ago sustaining an impacted distal radius fracture with possible intraarticular component and an associated ulnar styloid fracture. Today in surgery, fracture was reduced anatomically and an external fixator was applied. PROCEDURE: Under satisfactory general anesthesia, the fracture was manipulated and C-arm images were checked. The left upper extremity was prepped and draped in the usual sterile orthopedic fashion. Two small incisions were made over the second metacarpal and after removing soft tissues including tendinous structures out of the way, drawing was carried out and blunt-tipped pins were placed for the EBI external fixator. The frame was next placed and the site for the proximal pins was chosen. Small incision was made. Subcutaneous tissues were carried out of the way. The pin guide was placed and 2 holes were drilled and blunt-tipped pins placed. Fixator was assembled. C-arm images were checked. Fracture reduction appeared to be anatomic. Suturing was carried out where needed with 4-0 Vicryl interrupted subcutaneous and 4-0 nylon interrupted sutures. Sterile dressings were applied. Vascular supply was noted to be satisfactory. Final frame tightening was carried out. What CPT&reg; code(s) is/are reported?&nbsp;</strong></p>', '25600-LT, 20692-51', '25605- LT, 20690-51', '25606-LT', '25607-LT', '2022-06-03 10:19:05', '2022-06-03 10:19:05', 'ans_b'),
(343, 6, 17, 1, '<p><strong>PREOPERATIVE DIAGNOSIS: Medial meniscus tear, right knee POSTOPERATIVE DIAGNOSIS: Medial meniscus tear, extensive synovitis with an impingement medial synovial plica, right knee TITLE OF PROCEDURE: Diagnostic operative arthroscopy, partial medial meniscectomy and synovectomy, right knee The patent was brought to the operating room, placed in the supine position after which he underwent general anesthesia. The right knee was then prepped and draped in the usual sterile fashion. The arthroscope was introduced through an anterolateral portal, interim portal created anteromedially. The suprapatellar pouch was inspected. The findings on the patella and the femoral groove were as noted above. An intra-articular shaver was introduced to debride the loose fibrillated articular cartilage from the medial patellar facet. The hypertrophic synovial scarring between the patella and the femoral groove was debrided. The hypertrophic impinging medial synovial plica was resected. The hypertrophic synovial scarring overlying the intercondylar notch and lateral compartment was debrided. The medial compartment was inspected. An upbiting basket was introduced to transect the base of the degenerative posterior horn flap tear. This was removed with a grasper. The meniscus was then further contoured and balanced with an intra-articular shaver, reprobed and found to be stable. The cruciate ligaments were probed, palpated and found to be intact. The lateral compartment was then inspected. The lateral meniscus was probed and found to be intact. The loose fibrillated articular cartilage along the lateral tibial plateau was debrided with the intra-articular shaver. The knee joint was then thoroughly irrigated with the arthroscope. The arthroscope was then removed. Skin portals were closed with 3-0 nylon sutures. A sterile dressing was applied. The patient was then awakened and sent to the recovery room in stable condition. What CPT&reg; and ICD-10-CM codes should be reported?&nbsp;</strong></p>', '29880-RT, M23.203, M65.80, M94.261, M22.41', '29881-RT, M23.211, M65.861, M94.261, M22.41', '29881-RT, M23.221, M65.861, M94.261, M22.41', '29880-RT, 29877-59-RT, M23.621, M65.80, M94.261, M22.41', '2022-06-03 10:19:36', '2022-06-03 10:19:36', 'ans_c'),
