(350, 6, 14, 1, '<p>Mr. Hallberger has multiple problems. I am examining him in the intensive critical<br />\r\ncare unit. I understand he has fluid overload with acute renal failure and was started on<br />\r\nultrafiltration by the nephrologist on duty. He has an abnormal chest x-ray. He has<br />\r\npreexisting type 2 diabetes mellitus and sepsis. We are left with a patient now who is still<br />\r\nsedated and on a ventilator because of respiratory failure. Code the diagnosis(es) only.</p>', 'R60.9, N18.9, R83.9, E11.29, A42.9, J96.90', 'R18.8, N17.2, R91.8, E11.29, A42.9, J96.90', 'E86.9, N26.9, R91.8, E11.9, A41.9, J96.90, T67.3XXA', 'E87.70, N17.9, R91.8, E11.9, A41.9, J96.90, R65.20', '2022-06-03 10:30:06', '2022-06-03 10:30:06', 'ans_d'),
