(362, 6, 14, 1, '<p>Which place of service code should be reported on the physician&rsquo;s claim for a surgical<br />\r\nprocedure performed in an ASC?</p>', '21', '22', '24', '11', '2022-06-03 10:53:11', '2022-06-03 10:53:11', 'ans_c'),
