(364, 6, 14, 1, '<p>A 70-year-old with significant pelvic prolapse and grade IV cystocele who has failed<br />\r\nprevious primary repair and is status post hysterectomy. She presents for anterior repair and<br />\r\ncolpopexy. Procedure: Patient placed in the dorsal lithotomy position and general anesthetic<br />\r\nwas induced without problems. A midline incision is made from just above is made from just<br />\r\nabove the bladder neck to the vaginal cuff. She is noted to have a grade IV cystocele. Vaginal<br />\r\nflaps were dissected to the level of the pubocervical fascia. Her vaginal mucosa was in good<br />\r\ncondition but near the urethra and bladder neck it was a little thinner. There is significant<br />\r\nscarring on the left side from previous procedures. Ishcial spine is identified and swept fiber<br />\r\nfatty tissue off of the sacrospinous ligament bilaterally. No scarring or adhesions in this area.<br />\r\nAnterior needles were passed into place on the elevate mesh and these were fixed in a manner<br />\r\nsimilar to the MiniArC. They were passed along just below the bladder neck toward the<br />\r\nobturaton foramen and fixed in place. An anterior support was created without tension at the<br />\r\nviscourethral junction. Apical needles were then used to pass the apical arms into place.<br />\r\nThere were gently fixed into place along the sacrospinous ligament approximately 2cm away<br />\r\nfrom the ischial spine. This was done bilaterally. They passed in a single pass and were fixed<br />\r\nin place confirmed by gentle tugging on both arms. Three Vicryl sutures had been placed and<br />\r\nthe vaginal apex were then passed over into the mesh and tied down. The apical arms were<br />\r\nplaced through the eyelets of the mesh and passed down toward the sacrospinous ligament<br />\r\nbilaterally to create good apical support. Eyelet fasteners placed bilaterally and mesh arms<br />\r\ntrimmed providing excellent apical and anterior support. Vaginal mucosa was closed and<br />\r\nvaginal packed placed. No complications. What CPT&reg; code(s) describe(s) this procedure?</p>', '57250, 57280', '57240, 57282', '57240, 57283', '57250, 57283', '2022-06-03 10:55:52', '2022-06-03 10:55:52', 'ans_b'),
(365, 6, 14, 1, '<p>Preoperative Diagnosis: Right hydronephrosis Postoperative Diagnosis: Right<br />\r\nhydronephrosis<br />\r\nOperation: Cystoscopy and right retrograde pyelogram Procedure: Patient prepped and<br />\r\ndraped in the dorsolithotomy position. Placed under general anesthesia a 23 French<br />\r\ncystoscope was passed into the bladder. No tumors were visualized. Urine from the bladder<br />\r\nwas sent for urine cytology. Then a 6 French access catheter was passed into the right uretal<br />\r\norfice. Contrast was injected and there were no filling defects noted. There was no fixed<br />\r\ntumor and no stone. There was mild hydroureteral nephrosis against the bladder. There was a<br />\r\nnarrowing at the UVJ no abnormalities. Renal pelvis barbotaged with saline and renal pelvis</p>\r\n\r\n<p>urine sent to pathology for urine cytology. After the retrograde pyelogram was performed the<br />\r\naccess catheter was removed.</p>', '52000-RT, 74420-26', '52281-RT, 74425-26', '52007-RT, 74400-26', '52005-RT, 74420-26', '2022-06-03 10:57:03', '2022-06-03 10:57:03', 'ans_d'),
(366, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.<br />\r\nPOSTOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.<br />\r\nPROCEDURE: Suction D&amp;C.<br />\r\nThe patient was prepped and draped in a lithotomy position under general mask anesthesia,<br />\r\nand the bladder was straight catheterized; a weighted speculum was placed in the vagina. The<br />\r\nanterior lip of the cervix was grasped with a single-tooth tenaculum. The uterus was then<br />\r\nsounded to a depth of 8 cm. The cervical os was then serially dilated to allow passage of a<br />\r\nsize 10 curved suction curette. A size 10 curved suction curette was then used to evacuate the<br />\r\nintrauterine contents. Sharp curette was used to gently palpate the uterine wall with negative<br />\r\nreturn of tissue, and the suction curette was again used with negative return of tissue. The<br />\r\ntenaculum was removed from the cervix. The speculum was removed from the vagina. All<br />\r\nsponges and needles were accounted for at completion of the procedure. The patient left the<br />\r\noperating room in apparent good condition having tolerated the procedure well. Pathology<br />\r\nreport indicated benign polyp.</p>', '59812, O03.9', '59812, O07.4', '59820, O02.1', '59856, O02.1', '2022-06-03 10:58:27', '2022-06-17 07:04:16', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(367, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Right ureteral stricture.<br />\r\nPOSTOPERATIVE DIAGNOSIS: Right ureteral stricture.<br />\r\nPROCEDURE PERFORMED: Cystoscopy, right ureteral stent change.<br />\r\nPROCEDURE NOTE: The patient was placed in the lithotomy position after receiving IV<br />\r\nsedation. He was prepped and draped in the lithotomy position. The 21 French cystoscope<br />\r\nwas passed into the bladder, and urine was collected for culture Inspection of the bladder<br />\r\ndemonstrated findings consistent with radiation cystitis, which has been previously</p>\r\n\r\n<p>diagnosed. There is no frank neoplasia. The right ureteral stent was grasped and removed<br />\r\nthrough the urethral meatus; under fluoroscopic control, a guide wire was advanced up the<br />\r\nstent, and the stent was exchanged for a 7 French 26-cm stent under fluoroscopic control in<br />\r\nthe usual fashion. The patient tolerated the procedure well.</p>', '51702-LT, N13.5', '51702-RT, N30.90', '52332-RT, N30.90', '52332-RT, N13.5', '2022-06-03 11:00:04', '2022-06-03 11:00:04', 'ans_d'),
(368, 6, 14, 1, '<p>This patient is a 52-year-old female who has been having prolonged and heavy bleeding.<br />\r\nSURGICAL FINDINGS: On pelvic exam under anesthesia, the uterus was normal size and<br />\r\nfirm. The examination revealed no masses. She had a few small endometrial polyps in the<br />\r\nlower uterine segment.<br />\r\nDESCRIPTION OF PROCEDURE: After induction of general anesthesia, the patient was<br />\r\nplaced in the dorsolithotomy position, after which the perineum and vagina were prepped, the<br />\r\nbladder straight catheterized, and the patient draped. After bimanual exam was performed, a<br />\r\nweighted speculum was placed in the vagina and the anterior lip of the cervix was grasped<br />\r\nwith a single toothed tenaculum. An endocervical curettage was then done with a Kevorkian<br />\r\ncuret. The uterus was then sounded to 8.5 cm. The endocervical canal was dilated to 7 mm<br />\r\nwith Hegar dilators. A 5.5-mm Olympus hysteroscope was introduced using a distention<br />\r\nmedium. The cavity was systematically inspected, and the preceding findings noted. The<br />\r\nhysteroscope was withdrawn and the cervix further dilated to 10 mm. Polyp forceps was<br />\r\nintroduced, and a few small polyps were removed. These were sent separately. Sharp<br />\r\nendometrial curettage was then done. The hysteroscope was then reinserted, and the polyps<br />\r\nhad essentially been removed. The patient tolerated the procedure well and returned to the<br />\r\nrecovery room in stable condition (Pathology confirmed benign endometrial polyps).<br />\r\nPathology confirmed benign endometrial polyps.</p>', '58558, 57460-51, N92.0, N84.0', '58558, N92.0, N84.0', '58558, 57558-51, N92.0, N84.0', '58558, N92.1, D49.5', '2022-06-03 11:01:21', '2022-06-03 11:01:21', 'ans_b'),
(369, 6, 14, 1, '<p>OPERATIVE REPORT<br />\r\nPREOPERATIVE DIAGNOSIS: Possible recurrent transitional cell carcinoma of the<br />\r\nbladder.<br />\r\nPOSTOPERATIVE DIAGNOSIS: No evidence of recurrence.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy with multiple bladder biopsies.<br />\r\nPROCEDURE NOTE: The patient was given a general mask anesthetic, prepped, and draped<br />\r\nin the lithotomy position. The 21 French cystoscope was passed into the bladder. There was a<br />\r\nhyperemic area on the posterior wall of the bladder, and a biopsy was taken. Random<br />\r\n4 biopsies of the bladder were performed. A catheter was left at the end of the procedure. The patient tolerated<br />\r\nthe procedure well and was transferred to the recovery room in good condition. The<br />\r\npalthology report indicated no evidence of recurrence.</p>', '52204, Z85.51', '51020, 52204, Z80.59', '52234, D41.4', '52204 × 4, Z85.51', '2022-06-03 11:03:51', '2022-08-03 06:09:14', 'ans_a'),
(370, 6, 14, 1, '<p>This 41-year-old female presented with a right labial lesion. A biopsy was taken, and the<br />\r\nresults were reported as VIN-III, cannot rule out invasion. The decision was therefore made<br />\r\nto proceed with wide local excision of the right vulva.<br />\r\nPROCEDURE: The patient was taken to the operating room, and general anesthesia was<br />\r\nadministered. The patient was then prepped and draped in the usual manner in lithotomy<br />\r\nposition, and the bladder was emptied with a straight catheter. The vulva was then inspected.<br />\r\nOn the right labium minora at approximately the 11 o&amp;#39;clock position, there was a multifocal<br />\r\nlesion. A marking pen was then used to mark out an elliptical incision, leaving a 1-cm border<br />\r\non all sides. The skin ellipse was then excised using a knife. Bleeders were cauterized with<br />\r\nelectrocautery. A running locked suture of 2-0 Vicryl was then placed in the deeper tissue.<br />\r\nThe skin was finally re approximated with 4 0 Vicryl in an interrupted fashion. Good<br />\r\nhemostasis was thereby achieved. The patient tolerated this procedure well. There were no<br />\r\ncomplications.</p>', '56605, C51.9', '56625, D07.1', '56620, D07.1', '11620, C51.9', '2022-06-03 11:05:57', '2022-06-03 11:05:57', 'ans_c'),
(371, 6, 14, 1, '<p>Indications: 15-year-old boy was burned in a fire and assessed to have received burns to<br />\r\n75 percent of his total body surface area. He was transferred to a burn center for definitive<br />\r\ntreatment. Once stable, he was brought to the OR. Procedure: Due to extent of the patient&rsquo;s<br />\r\nburns and lack of sufficient donor sites, his full-thickness burns will be excised and covered<br />\r\nwith xenograft (skin substitute graft), and a split-thickness skin biopsy will be harvested for<br />\r\npreparation of autologous grafts to be applied in the coming weeks, when available. After<br />\r\ninduction of anesthesia, extensive debridement of the full-thickness burns was undertaken.<br />\r\nAttention was first directed to the patient&rsquo;s face, neck, and scalp. A total of 500 sq cm in this<br />\r\narea received full-thickness burns. The eschar involving this area was excised down to viable<br />\r\ntissue. Hemostasis was achieved using electrocautery. Attention was then turned to the trunk.</p>\r\n\r\n<p>A total of 950 sq cm in this area received full-thickness burns. The eschar involving this area<br />\r\nwas excised down to viable tissue. Hemostasis was achieved. Attention was then turned to the<br />\r\narms and legs. A total of 725 sq cm received full-thickness burns. The eschar involving this<br />\r\narea was excised down to viable tissue. Hemostasis was achieved. Attention was then turned<br />\r\nto the hands and feet. A total of 300 sq cm in this area received full-thickness burns. The<br />\r\neschar involving this area was excised down to viable tissue. All involved areas were then<br />\r\ncovered with xenograft. Finally a split thickness skin graft of 0.015 inches in depth was<br />\r\nharvested using a dermatome from a separate donor site. A total of 85 sq cm was recovered.<br />\r\nWhat procedures codes would be reported service?</p>', '15200, 15201 x 123, 15004, 15005, 15002, 15003', '15275, 15276 x 31, 15271, 15272 x 66, 15004, 15005 x 16, 15002, 15003 x 7', '15277, 15278 x 7, 15273, 15274 x 16, 15004, 15005 x 7, 15002, 15003 x 16, 15040', '15130, 15131 x 7, 15135, 15136 x 16, 15004, 15005 x 7, 15002, 15003 x 16', '2022-06-03 11:07:22', '2022-06-03 11:07:22', 'ans_c'),
(372, 6, 14, 1, '<p>Diagnosis: Basal cell carcinoma, left chin.</p>\r\n\r\n<p>Procedure: Wide local excision of<br />\r\n3.0 cm with 0.3 cm margin basal cell carcinoma of the left chin with a 4 cm closure.</p>\r\n\r\n<p>Procedure details: The patient&rsquo;s left chin was examined. The site of intended excision was marked<br />\r\nout. The site was then prepped. The patient was then prepped and draped in the usual fashion.<br />\r\nA 15 blade scalpel was then used to make an incision in the previously marked site. It was<br />\r\ncarried down to the subcuticular fat. The lesion was then sharply dissected off underlying<br />\r\ntissue bed using a 15-blade scalpel. It was tagged for pathologic orientation. The hyfrecator<br />\r\nwas used for hemostasis. The wound was then closed by advancing the tissue surrounding the<br />\r\nlesion and closing in layers with 3-0 Vicryl for the deep layer, followed by 5-0 Prolene for<br />\r\nthe skin. The skin closure was in a running subcuticular fashion. Steri-Strips were then<br />\r\napplied. What are the procedure and diagnosis codes?</p>', '11644, 12052-51, C44.319', '11643, 12013-51, C44.319', '11444, 12052-51, D49.2', '11443, 12013-51, D49.2', '2022-06-03 11:08:47', '2022-06-14 06:30:14', 'ans_a'),
(373, 6, 14, 1, '<p>PRE OP DIAGNOSIS: Left Breast Abnormal MMX or Palpable Mass; Other Disorders<br />\r\nOf Breast PROCEDURE: Automated Stereotactic Biopsy Left Breast<br />\r\nFINDINGS: Lesion is located in the lateral region, just at or below the level of the nipple on<br />\r\nthe 90 degree lateral view. There is a subglandular implant in place. I discussed the procedure<br />\r\nwith the patient today including risks, benefits and alternatives. Specifically discussed was<br />\r\nthe fact that the implant would be displaced out of the way during this biopsy procedure.<br />\r\nPossibility of injury to the implant was discussed with the patient. Patient has signed the<br />\r\nconsent form and wishes to proceed with the biopsy. The patient was placed prone on the<br />\r\nstereotactic table; the left breast was then imaged from the inferior approach. The lesion of<br />\r\ninterest is in the anterior portion of the breast away from the implant which was displaced<br />\r\nback toward the chest wall. After imaging was obtained and stereotactic guidance used to</p>\r\n\r\n<p>target coordinates for the biopsy, the left breast was prepped with Betadine. 1% lidocaine was<br />\r\ninjected subcutaneously for local anesthetic. Additional lidocaine with epinephrine was then<br />\r\ninjected through the indwelling needle. The SenoRx needle was then placed into the area of<br />\r\ninterest. Under stereotactic guidance we obtained 9 core biopsy samples using vacuum and<br />\r\ncutting technique. The specimen radiograph confirmed representative sample of calcification<br />\r\nwas removed. The tissue marking clip was deployed into the biopsy cavity successfully. This<br />\r\nwas confirmed by final stereotactic digital image and confirmed by post core biopsy<br />\r\nmammogram left breast. The clip is visualized projecting over the lateral anterior left breast<br />\r\nin satisfactory position. No obvious calcium is visible on the final post core biopsy image in<br />\r\nthe area of interest. The patient tolerated the procedure well. There were no apparent<br />\r\ncomplications. The biopsy site was dressed with Steri-Strips, bandage and ice pack in the<br />\r\nusual manner. The patient did receive written and verbal post-biopsy instructions. The patient<br />\r\nleft our department in good condition.<br />\r\nIMPRESSION: 1. SUCCESSFUL STEREOTACTIC CORE BIOPSY OF LEFT BREAST<br />\r\nCALCIFICATIONS.<br />\r\n2. SUCCESSFUL DEPLOYMENT OF THE TISSUE MARKING CLIP INTO THE<br />\r\nBIOPSY CAVITY<br />\r\n3. PATIENT LEFT OUR DEPARTMENT IN GOOD CONDITION TODAY WITH POST-<br />\r\nBIOPSY INSTRUCTIONS.<br />\r\n4. PATHOLOGY REPORT IS PENDING; AN ADDENDUM WILL BE ISSUED AFTER<br />\r\nWE RECEIVE THE PATHOLOGY REPORT. What are the correct CPT codes?</p>', '19081', '19101, 19081', '19100, 19283, 76942-26', '19283', '2022-06-03 11:10:20', '2022-06-03 11:10:20', 'ans_a'),
(374, 6, 18, 1, '<p><strong>Indication: Patient has a hypertrophic scar on the posterior side of the left leg, at the level of the knee. This has begun to restrict his mobility. His physical therapy trial was unsuccessful. Procedure: After the proper induction of anesthesia, the subcutaneous tissue of the patient&rsquo;s left leg beneath the scar was infiltrated with crystalloid solution containing epinephrine to minimize blood loss. The scar was then excised down to viable dermis. Hemostasis was obtained with epinephrine soaked pads. Skin was harvested from the patient&rsquo;s thigh in a split thickness fashion and was used to cover the 90 sq cm defect created by the surgery. The graft was secured with skin staples, and then dressed with fine mesh gauze followed by medication-soaked gauze. The donor site was dressed with mesh followed by Adaptic, followed by a dry dressing and an Ace wrap.</strong></p>\r\n\r\n<p>&nbsp;</p>', '15110-52, 15002', '15100, 11406', '15100, 15002', '15110, 15002', '2022-06-04 04:12:11', '2022-06-04 04:12:11', 'ans_c'),
(375, 6, 18, 1, '<p><strong>30 year old female is having debridement performed on an infected ulcer with eschar on the right foot. Using sharp dissection, the ulcer and eschar infection was debrided all the way to down to the bone of the foot. The bone had to be minimally trimmed because of a sharp point at the end of the metatarsal. After debriding the area, there was minimal bleeding because of very poor circulation of the foot. It seems that the toes next to the ulcer may have some involvement and cultures were taken. The area was dressed with sterile saline and dressings and then wrapped. What CPT code should be reported?&nbsp;</strong></p>', '11000', '11011', '11044', '15004', '2022-06-04 04:12:39', '2022-06-04 04:12:39', 'ans_c'),
(376, 6, 18, 1, '<p><strong>53-year-old male for removal of 2 lesions located on his nose and lower lip. Lesions were identified and marked. Utilizing a 3-mm punch, a biopsy was taken of the left supratip nasal area. The lower lip lesion of 4mm in size was shaved to the level of the superficial dermis. What are the codes for these procedures? </strong></p>', '11104, 11103', '11104, 11313', '17000, 17003', '11440, 11310', '2022-06-04 04:13:09', '2022-08-04 11:16:02', 'ans_b'),
(377, 6, 18, 1, '<p><strong>45 year old male is in outpatient surgery to excise a basal cell carcinoma of the right nose and have reconstruction with an advancement flap. The 1.2 cm lesion with an excised diameter of 1.5 cm was excised with a 15-blade scalpel down to the level of the subcutaneous tissue, totaling a primary defect of 1.8 sq cm. Electrocautery was used for hemostasis. An adjacent tissue transfer of 3 sq cm was taken from the nasolabial fold and was advanced into the primary defect. Which CPT code(s) should be used?&nbsp;</strong></p>', '14060', '11642, 14060', '11642, 15115', '15574', '2022-06-04 04:13:39', '2022-06-04 04:13:39', 'ans_a'),
(378, 6, 18, 1, '<p><strong>64 year old female who has multiple sclerosis fell from her walker and landed on a glass table. She lacerated her forehead, cheek and chin and the total length of these lacerations was 6 cm. Her right arm and left leg had deep cuts measuring 5 cm on each extremity. Her right hand and right foot had a total of 3 cm lacerations. The ED physician repaired the lacerations as follows: The forehead, cheek, and chin had debridement and cleaning of glass debris with the lacerations being closed with 6-0 Prolene sutures. The arm and leg were repaired by 6-0 Vicryl subcutaneous sutures and prolene sutures on the skin. The hand and foot were closed with adhesive strips. Select the appropriate procedure codes for this visit.</strong></p>', '12014, 12034-51, 12002-51, 11042-51', '12053, 12034-51, 12002-51', '12014, 12034-51', '12053, 12034-51', '2022-06-04 04:14:16', '2022-06-04 04:14:16', 'ans_d'),
(379, 6, 18, 1, '<p><strong>76-year-old has dermatochalasis on bilateral upper eyelids. A belpharoplasty will be performed on the eyelids. A lower incision line was marked at approximately 5 mm above the lid margin along the crease. Then using a pinch test with forceps the amount of skin to be resected was determined and marked. An elliptical incision was performed on the left eyelid and the skin was excised. In a similar fashion the same procedure was performed on the right eye. The wounds were closed with sutures. The correct CPT codes are? </strong></p>', '15822, 15823-51', '15823-50', '15822-50', '15820-LT, 15820-RT', '2022-06-04 04:14:52', '2022-06-04 04:14:52', 'ans_c'),
(380, 6, 18, 1, '<p><strong>The patient is a 66-year-old female who presents with Dupuytren&#39;s disease in the right palm and ring finger. This results in a contracture of the ring digit MP joint. She is having a subtotal palmar fasciectomy for Dupuytren&#39;s disease right ring digit and palm. An extensile Brunner incision was then made beginning in the proximal palm and extending to the ring finger PIP crease. This exposed a large pretendinous cord arising from the palmar fascia extending distally over the flexor tendons of the ring finger. The fascial attachments to the flexor tendon sheath were released. At the level of the metacarpophalangeal crease, one band arose from the central pretendinous cord-one coursing toward the middle finger. The digital nerve was identified, and this diseased fascia was also excised. What procedure code should be used?&nbsp;</strong></p>', '26123-RT, 26125', '26121-RT', '26035-RT', '26040-RT', '2022-06-04 04:15:31', '2022-06-04 04:15:31', 'ans_a'),
(381, 6, 18, 1, '<p><strong>A small incision was made over the left proximal tibia, and a traction pin was inserted through the bone to the opposite side. Weights were then affixed to the pins to stabilize the tibial fracture temporarily until fracture repair could be performed.</strong></p>', '20650-LT', '20663-LT', '20690-LT', '20692-LT', '2022-06-04 04:16:06', '2022-06-04 04:16:06', 'ans_a'),
(382, 6, 18, 1, '<p><strong>Mary tells her physician that she has been having pain in her left wrist for several weeks. The physician examines the area and palpates a ganglion cyst of the tendon sheath. He marks the injection sites, sterilizes the area, and injects corticosteroid into\\ two areas.</strong></p>', '20550-LT × 2, M67.432', '20551-LT, M67.442', '20551-LT × 2, M67.40', '20612-LT, 20612-59-LT, M67.432', '2022-06-04 04:16:39', '2022-06-04 04:16:39', 'ans_d'),
(383, 6, 18, 1, '<p><strong>The physician applies a body cast from the hips to the shoulders and to the head including left thigh. Before application, a stockinette is stretched over the patient&#39;s torso, and further padding of the bony areas with felt padding was done.</strong></p>', '29040', '29055', '29000', '29044', '2022-06-04 04:17:08', '2022-09-21 06:31:35', 'ans_d'),
(384, 6, 18, 1, '<p><strong>Patient is having ongoing back and hip pain. The physician elects to perform a sacroiliac injection at an ambulatory surgery center. After sterile prep, the patient is placed prone position. A needle is placed under fluoroscopic guidance into the SI joint and a mixture of 20 mg of Celestone and Marcaine is injected for pain relief. Code the procedure(s).&nbsp;</strong></p>', '27096, 77003-26', '20611', '20552', '27096', '2022-06-04 04:17:38', '2022-06-04 04:17:38', 'ans_d'),
(385, 6, 18, 1, '<p><strong>Patient is seen in the hospital&rsquo;s outpatient surgical area with a diagnosis of a displaced comminuted closed fracture of the lateral condyle, right elbow. An ORIF procedure was performed, which included the following techniques: An incision was made in the area of the lateral epicondyle. This was carried through subcutaneous tissue, and the fracture site was easily exposed. Inspection revealed the fragment to be rotated in two places, about 90 degrees. It was possible to manually reduce this quite easily, and the manipulation resulted in an almost anatomic reduction. This was fixed with two pins driven across the humerus. The pins were cut off below skin level. The wound was closed with plain catgut subcutaneously and 5-0 nylon for the skin. Dressings and a long arm cast were applied. Which is the correct ICD-10-CM and CPT&reg; code assignment?</strong></p>', '24579-RT, 29065-51-RT, S42.451B', '24577-RT, S42.451A', '24579-RT, S42.451A', '24575-RT, S42.451B', '2022-06-04 04:18:12', '2022-06-04 04:18:12', 'ans_c'),
(386, 6, 18, 1, '<p><strong>This 52-year-old male has undergone several attempts at extubation, all of which failed. He also has morbid obesity and significant subcutaneous fat in his neck. We performed now a flap tracheostomy and cervical lipectomy. The cervical lipectomy is necessary for adequate exposure and access to the trachea and also to secure tracheotomy tube placement.</strong></p>', '31610, 15839-51', '31610', '31610, 15839', '31603, 15839-51', '2022-06-04 04:18:49', '2022-10-13 07:35:36', 'ans_a'),
(387, 6, 18, 1, '<p>This patient returns to the operating room for planned placement of an additional chest tube for an anterior pneumothorax due to a contusion lung injury. The same physician had just placed a chest tube 4 days earlier.</p>', '32551, S27.329A', '32406, S27.309A', '32551-58, S27.329A', '32551-79, S27.309A', '2022-06-04 04:19:21', '2022-06-20 09:34:25', 'ans_c'),
(388, 6, 18, 1, '<p><strong>50-year-old female has recurrent lymphoma in the axilla. Ultrasound was used to localize the lymph node in&nbsp; for needle guidance. An 11 blade scalpel was used to perform a small dermatotomy. An 18 x 10 cm Biopence needle was advanced through the dermatotomy to the periphery of the lymph node. A total of 4 biopsy specimens were obtained. Two specimens were placed an RPMI and 2 were placed in formalin and sent to laboratory. The correct CPT code is:&nbsp;</strong></p>', '10022', '38500, 77002-26', '38505, 76942-26', '38525, 76942-26', '2022-06-04 04:19:55', '2022-06-04 04:19:55', 'ans_c'),
(389, 6, 18, 1, '<p><strong>The patient is a 67 -year-old gentleman with metastatic colon cancer recently operated on for a brain metastasis, now for placement of an Infuse-A-Port for continued chemotherapy. The left subclavian vein was located with a needle and a guide wire placed. This was confirmed to be in the proper position fluoroscopically. A transverse incision was made just inferior to this and a subcutaneous pocket created just inferior to this. After tunneling, the introducer was placed over the guide wire and the power port line was placed with the introducer and the introducer was peeled away. The tip was placed in the appropriate position under fluoroscopic guidance and the catheter trimmed to the appropriate length and secured to the power port device. The locking mechanism was fully engaged. The port was placed in the subcutaneous pocket and everything sat very nicely fluoroscopically. It was secured to the underlying soft tissue with 2-0 silk stitch. What code should be used for this procedure?</strong></p>', '36556, 77001-26', '36558', '36561, 77001-26', '36571', '2022-06-04 04:20:29', '2022-06-04 04:20:29', 'ans_c'),
(390, 6, 18, 1, '<p><strong>79-year-old male with symptomatic bradycardia and syncope is taken to the Operating Suite where an insertion of a DDD pacemaker will be performed. A left subclavian venipuncture was carried out. A guide wire was passed through the needle, and the needle was withdrawn. A second subclavian venipuncture was performed, a second guide wire was passed and the second needle was withdrawn. An oblique incision in the deltopectoral area incorporating the wire exit sites. A subcutaneous pocket was created with the cautery on the pectoralis fascia. An introducer dilator was passed over the first wire and the wire and dilator were withdrawn. A ventricular lead was passed through the introducer, and the introducer was broken away in the routine fashion. A second introducer dilator was passed over the second guide wire and the wire and dilator were withdrawn. An atrial lead was passed through the introducer and the introducer was broken away in the routine fashion. Each of the leads were sutured down to the chest wall with two 2-0 silk sutures each, connected the leads to the generator, curled the leads, and the generator was placed in the pocket. We assured hemostasis. We assured good position with the fluoroscopy. What code should be used for this procedure?&nbsp;</strong></p>', '33208', '33212', '33208, 76000-26', '33235, 71090-26', '2022-06-04 04:20:59', '2022-06-04 04:20:59', 'ans_a'),
(391, 6, 18, 1, '<p><strong>The patient is a 59-year-old white male who underwent carotid endarterectomy for symptomatic left carotid stenosis a year ago. A carotid CT angiogram showed a recurrent 90% left internal carotid artery stenosis extending into the common carotid artery. He is taken to the operating room for re-do left carotid endarterectomy. The left neck was prepped and the previous incision was carefully reopened. Using sharp dissection, the common carotid artery and its branches were dissected free. The patient was systematically heparinized and after a few minutes clamps applied to the common carotid artery and its branches. A longitudinal arteriotomy was carried out with findings of extensive layering of intimal hyperplasia with no evidence of recurrent atherosclerosis. A silastic balloon-tip shunt was inserted first proximally and then distally, with restoration of flow. Several layers of intima were removed and the endarterectomized surfaces irrigated with heparinized saline. An oval Dacron patch was then sewn into place with running 6-0 Prolene. Which CPT code should be used?&nbsp;</strong></p>', '35301', '35301, 35390', '35302', '35311, 35390', '2022-06-04 04:21:28', '2022-06-04 04:21:28', 'ans_b'),
(392, 6, 18, 1, '<p><strong>Preoperative Diagnosis: Chronic tonsillitis. Chronic adenoiditis. Postoperative Diagnosis: Same. Procedure: Tonsillectomy and adenoidectomy. Patient is a 24-year-old male who was taken to the operating room and put under IV sedation by the anesthesia department. An initial curettage of adenoids was done and packing was placed. The left tonsil was then identified and dissected out extracapsular and removed with scissors. Hemostasis was maintained by packing the left tonsil. Next, the right tonsil was identified and incision was made. Dissection was done extracapsular and the right tonsil was then removed. Both the right and left tonsil were sent as specimens as well as adenoid tissue. What are the procedure and diagnosis codes?</strong></p>', '42826, 42831-59, J35.02', '42820, J35.03', '42821, 42836-59, J35.01, J35.02', '42821, J35.03', '2022-06-04 04:22:02', '2022-06-04 04:22:02', 'ans_d'),
(393, 6, 18, 1, '<p><strong>Diagnostic esophagogastroduodenoscopy of the esophagus, stomach, and duodenum was performed after esophageal balloon dilation (less than 30 mm diameter) was done at the same operative session. Code the procedure(s).</strong></p>', '43249, 43235-51', '43249', '43220, 43200-51', '43220', '2022-06-04 04:22:31', '2022-06-04 04:22:31', 'ans_b'),
(394, 6, 18, 1, '<p><strong>15 year-old female is to have a tonsillectomy performed for chronic tonsillitis and hypertrophied tonsils. A McIver mouth gag was put in place and the tongue was depressed. The nasopharynx was digitalized. No significant adenoid tissue was felt. The tonsils were then removed bilaterally by dissection. The uvula was a huge size because of edema, a part of this was removed and the raw surface oversewn with 3-0 chromic catgut. Which CPT code(s) should be used?</strong></p>', '42821', '42825, 42104-51', '42826, 42106-51', '42842', '2022-06-04 04:23:02', '2022-06-04 04:23:02', 'ans_c'),
(395, 6, 18, 1, '<p><strong>An 11 year old male presented with chronic tonsillitis. The physician resected both the tonsils. The adenoid pad was also ablated. What is the correct code for this service?</strong></p>', '42821', '42825, 42830', '42820', '42820 -50', '2022-06-04 04:23:31', '2022-06-04 04:23:31', 'ans_c'),
(396, 6, 18, 1, '<p><strong>A 50 year old female presented with dysphagia and acid reflux. An upper GI endoscopy was scheduled. The&nbsp; scope was passed into the esophagus after moderate sedation. There were erosions in the distal part of esophagus. The scope was then passed into the stomach. There was a stricture at the distal end of stomach and therefore, the scope could not be passed into the duodenum. No biopsies were taken. The patient tolerated the procedure well and was sent to recovery room. What is the correct code for this service?</strong></p>', '43200', '43235-52', '43235-74', '43239', '2022-06-04 04:24:02', '2022-06-04 04:24:02', 'ans_b'),
(397, 6, 18, 1, '<p><strong>A 59 year old male presented with a dysplastic sigmoid colon polyp and was scheduled for colectomy. The physician made an abdominal incision. The selected segment of colon was isolated and divided proximally and distally to the remaining colon and removed. The proximal end of colon was brought through a separate incision on the abdominal wall and onto the skin as a colostomy. The incision was closed. What is the correct code for this service?</strong></p>', '44143', '44130', '44140', '44141', '2022-06-04 04:24:29', '2022-07-14 08:11:44', 'ans_d'),
(398, 6, 18, 1, '<p><strong>67-year-old female having urinary incontinence with intrinsic sphincter deficiency is having a cystoscopy performed with a placement of a sling. An incision was made over the mid urethra dissected laterally to urethropelvic ligament. Cystoscopy revealed no penetration of the bladder. The edges of the sling were weaved around the junction of the urethra and brought up to the suprapubic incision. A hemostat was then placed between the sling and the urethra, ensuring no tension. What code should be used for this procedure?</strong></p>', '57288', '57287', '52000, 57288', '52000, 51992', '2022-06-04 04:24:58', '2022-06-04 04:24:58', 'ans_a'),
(399, 6, 18, 1, '<p><strong>55-year-old female has a symptomatic rectocele. She had been admitted and taken to the main OR. An incision is made in the vagina into the perineal body (central tendon of the perineum). Dissection was carried underneath posterior vaginal epithelium all the way over to the rectocele. Fascial tissue was brought together with sutures creating a bridge and the rectocele had been reduced with good support between the vagina and rectum. What procedure code should be reported?&nbsp;</strong></p>', '45560', '57284', '57250', '57240', '2022-06-04 04:25:25', '2022-06-04 04:25:25', 'ans_c'),
(400, 6, 18, 1, '<p><strong>5-year-old female has a history of post void dribbling. She was found to have extensive labial adhesions, which have been unresponsive to topical medical management. She is brought to the operating suite in a supine position. Under general anesthesia the labia majora is retracted and the granulating chronic adhesions were incised midline both anteriorly and posteriorly. The adherent granulation tissue was excised on either side. What code should be used for this procedure?&nbsp;</strong></p>', '58660', '58740', '57061', '56441', '2022-06-04 04:25:52', '2022-06-04 04:25:52', 'ans_d'),
(401, 6, 18, 1, '<p><strong>A 37-year-old female has menorrhagia and wants permanent sterilization. The patient was placed in Allen stirrups in the operating room. Under anesthesia the cervix was dilated and the hysteroscope was advanced to the endometrium into the uterine cavity. No polyps or fibroids were seen. The Novasure was used for endometrial ablation. A knife was then used to make an incision in the right lower quadrant and left lower quadrant with 5-mm trocars inserted under direct visualization with no injury to any abdominal contents. Laparoscopic findings revealed the uterus, ovaries and fallopian tubes to be normal. The appendix was normal as were the upper quadrants. Because of the patient&#39;s history of breast cancer and desire for no further children, it was decided to take out both the tubes and ovaries. This had been discussed with the patient prior to surgery. What are the codes for these procedures? </strong></p>', '58660, 58353', '58661,58563-51', '58661, 58558', '58662, 58563-51', '2022-06-04 04:26:25', '2022-06-04 04:26:25', 'ans_b'),
(402, 6, 18, 1, '<p><strong>25-year-old female in the OR for ectopic pregnancy. Once the trocars were place a pneumoperitoneum was created and the laparoscope introduced. The left fallopian tube was dilated and was bleeding. The left ovary was normal. The uterus was of normal size, shape and contour. The right ovary and tube were normal. Due to the patient&rsquo;s body habitus the adnexa could not be visualized to start the surgery. At this point the laparoscopic approach was terminated. The pneumoperitoneum was deflated, and trocar sites were sutured closed. The trocars and laparoscopic instruments had been removed. Open surgery was performed incising a previous transverse scar from a cesarean section. The gestation site was bleeding and all products of conception and clots were removed. The left tube was grasped, clamped and removed in its entirety and passed off to pathology. What code(s) should be used for this procedure?&nbsp;</strong></p>', '59150, 59120', '59151', '59121', '59120', '2022-06-04 04:26:52', '2022-06-04 04:26:52', 'ans_d'),
(403, 6, 18, 1, '<p><strong>23-year-old who is pregnant at 39 weeks and 3 days is presenting for a low transverse cesarean section. An abdominal incision is made and was extended superiorly and inferiorly with good visualization of the bladder. The bladder blade was then inserted and the lower uterine segment incised in a transverse fashion with the scalpel. The bladder blade was removed and the infant&#39;s head delivered atraumatically. The nose and mouth were suctioned with the bulb suction trap and the cord doubly clamped and cut. The placenta was then removed manually. What code should be reported for this procedure? </strong></p>', '59610, O34.21, Z37.0 , Z3A.39', '59510, O82, Z37.0, Z3A.39', '59514, O82, Z37.0, Z3A.39', '59515, O82, Z37.0, Z3A.39', '2022-06-04 04:27:24', '2022-06-04 04:27:24', 'ans_c'),
(404, 6, 18, 1, '<p><strong>Operation: Replacement of shunt valve with medium pressure ventriculo-peritoneal shunt assembly with in-line 0-25 Aesculap Shunt Assistant Implant ICP Monitor.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>Procedure: After obtaining general anesthesia, patient prepped and draped. Right parietal scalp incision was reopened and shunt catheter identified. The shunt reservoir was delivered from the wound and the distal catheter freed from it. Abdominal incision reopened, shunt passer was used to bring the distal catheter from the head wound to the abdominal wound. The old ventricular catheter was removed. A new ventricular-catheter was inserted into the tract of the old catheter and fed, good flow seen. It was then attached to the shunt reservoir that was then seated after attaching a 0-25 shunt assistant valve to it. The distal catheter was then fed into the peritoneal cavity. Subcutaneous tissues were closed in multi-layer fashion and skin with staples. Patient tolerated the procedure well and taken to PICU in stable condition. Code this procedure.</strong></p>', '62223, 62225-51', '62258, 62160', '62230, 62225-51', '62256, 62225-51', '2022-06-04 04:27:54', '2022-06-04 04:27:54', 'ans_c'),
(405, 6, 18, 1, '<p><strong>Physician is performing an intracapsular cataract extraction. The anterior chamber of the eye is entered performing an anterior capsulotomy using forceps. The lens nucleus was hydrodissected and loosened. Using phacoemulsification unit, the lens nucleus was divided and emulsified. Cortical and capsular fragments were removed. The anterior chamber and capsule bag inflated. Using lens inserter an intraocular lens prosthesis, Cystalens, was inserted and rotated to the horizontal position. Topical solution applied, conjunctiva repositioned over the wound with wet field cautery and patch applied. Which CPT&reg; code(s) should be reported?</strong></p>', '66984, 66985', '66983, 66985', '66985', '66983', '2022-06-04 04:28:27', '2022-06-04 04:28:27', 'ans_d'),
(406, 6, 18, 1, '<p><strong>5-year-old male has diminished hearing in the left ear due to chronic otitis media. He has had hearing aid prosthetic devices in the ear which have resulted in additional infections. Parents have decided on an osseointegrated implant to restore hearing. The mastoid cortex is exposed. Spiral drilling is performed to create a pilot hole. The stem of the titanium pedestal is placed in the tunnel adjacent to the cochlea and abutment subsequently secured to the fixture. Which CPT&reg; code should be used?</strong></p>', '69717-LT', '69717-RT', '69714-LT', '69714-RT', '2022-06-04 04:29:00', '2023-05-26 04:08:17', 'ans_c'),
(407, 6, 18, 1, '<p><strong>The physician performs a right thyroid lobectomy. The patient was prepped and draped. After adequate general anesthesia, the neck was incised on the right side and sharp dissection was then used to cut down onto the strap muscles and sternodcleidomastoid muscles. The strap muscles were separated and transected on the right side. A small thyroid lobe was visualized and dissected free. There was no evidence of a tumor. The wound was closed with 3-0 interrupted Vicryl for the platysma, 4-0 Vicryl for the deep tissues and 6-0 fast absorbing gut for the skin. Code the encounter.</strong></p>', '60252-RT', '60210-RT', '60220-RT', '60260-RT', '2022-06-04 04:31:26', '2022-06-04 04:31:26', 'ans_c'),
(408, 6, 18, 1, '<p><strong>PROCEDURE: Bilateral lumbar medial branch block under ultrasound guidance for the L3, L4, L5 medial branches injecting the L4-L5, L5-S1 facets for diagnostic and therapeutic purposes. PROCEDURE: The patient was placed in the prone position and automated blood pressure cuff and pulse oximeter applied. The skin entry points for approaching the anatomic target points of the bilateral segmental medial branches or dorsal ramus of L3, L4, L5 were identified with a 22.5 degree from an ultrasound view and marked. Following thorough Chloraprep preparation of the skin and draping and 1% lidocaine infiltration of the skin entry points and subcutaneous tissues, a 22 gauge 6&quot; spinal needle was placed under ultrasound guidance for the L4-L5 and L5-S1 facet joints. At each joint 1 mL consisting of 0.5% bupivacaine and Depo-Medrol was injected. A total of 80 mg of Depo-Medrol was given in both sides. Which CPT&reg; codes should be used?</strong></p>', '0216T-50, 0217T-50, 0218T-50, 76942-26', '64493-50, 64494-50, 64495-50', '64493-50, 64494-50, 76942-26', '0216T-50, 0217T-50', '2022-06-04 04:31:57', '2022-06-04 04:31:57', 'ans_d'),
(409, 6, 18, 1, '<p>&nbsp;</p>\r\n\r\n<p><strong>A craniectomy is being performed on a patient who has Chiari malformation. Once the posterior inferior scalp was removed a C-1 and a partial C-2 laminectomy was then performed. The right cerebellar tonsil was dissected free of the dorsal medulla and a gush of cerebrospinal fluid gave good decompression of the posterior fossa content. Which CPT code should be used?</strong></p>', '61322', '61345', '61343', '61458', '2022-06-04 04:32:29', '2022-06-04 04:32:29', 'ans_c'),
(410, 6, 18, 1, '<p><strong>Mrs. Smith was seen by her family physician in a follow up visit, Dr. Marks. Mrs. Smith complains she has had a sore throat, breathing problems, and a fever for five days. She is a diabetic patient and has been taking over-the-counter medications that have interfered with her insulin medication. Dr. Marks documented a medically approprate history &amp; examination. Dr. Marks spent 35 minutes with the patient during the examination. How should the physician report this service?</strong></p>', '99215', '99204', '99205', '99214', '2022-06-04 04:33:04', '2023-10-04 01:50:49', 'ans_d'),
(411, 6, 18, 1, '<p><strong>Dr. Gavin, a pediatrician, continues to follow Baby Girl Laura, who is not critically ill but requires intensive observation for lung function and respiratory and oxygen monitoring. Laura is 14 days old with a current weight of 1,200 grams. Dr. Gavin initially provided care on Monday. He continued to see her on Tuesday and Wednesday. How should Dr. Gavin report all three days of care?&nbsp;</strong></p>', '99468 x 3', '99460, 99479 x 2', '99477 x 3', '99477, 99478 x 2', '2022-06-04 04:33:35', '2022-06-04 04:33:35', 'ans_d'),
(412, 6, 18, 1, '<p><strong>Bill, a retired U.S. Air Force pilot, was on observation status 14&nbsp;hours to assess the outcome of a fall from the back of a pickup truck into a gravel pit. The physician discharged Bill from observation that same day after determining that no further monitoring of his condition was necessary. The physician provided a comprehensive history and examination and spent 50 minutes with the patient.</strong></p>', '99222, Z04.9, W18.30XA', '99234, Z04.3, W17.2XXA', '99221, Z04.3, W18.30XA', '99234, 99217, Z04.3, W17.2XXA', '2022-06-04 04:34:10', '2023-05-31 04:47:57', 'ans_b'),
(413, 6, 18, 1, '<p><strong>Dr. Martin admits a 65-year-old patient to the hospital with acute pericarditis following a severe viral infection. The patient has complained of retrosternal, sharp, intermittent pain of 2 days&#39; duration that is reduced by sitting up and leaning forward, accompanied by tachypnea. The physician completes a comprehensive history and physical examination. The physician ordered an electrocardiogram, x-rays, and routine laboratory workup. The physician considers the multiple diagnoses of pericarditis following infection, unstable angina, dissecting aneurysm, pulmonary infarction, or esophageal disease, indicating a high level of medical decision making complexity.</strong></p>', '99236, R07.2, R06.82', '99223, I30.0, I20.0, I72.9, I26.99, K22.9', '99245, I30.0, I20.0, I72.9, I26.99, K22.9', '99223, R07.2, R06.82', '2022-06-04 04:35:31', '2022-06-04 04:35:31', 'ans_d'),
(414, 6, 18, 1, '<p><strong>A gynecologist admits an established patient, a 35-year-old female with dysfunctional uterine bleeding (DUB), after seeing her in the clinic that day. During the course of the comprehensive history, the physician notes that the patient has a history of irregular periods of heavy flow. She has had irregular heavy periods and intermittent spotting for 4 years. The patient has been on a 3-month course of oral contraceptives (OCP). The family history is positive for endometrial cancer, with mother, two aunts, and two sisters who had endometrial cancer. The patient has a personal history of cervical and endometrial polyp removal 3 years prior to admission. As a part of the comprehensive physical examination, the physician notes the patient has a large amount of blood in the vault and an enlarged uterus. The prolonged hemorrhaging has resulted in a very thin and friable endometrial lining. The physician orders the patient to be started on intravenous Premarin and orders a full laboratory workup. The medical decision making is of moderate complexity.</strong></p>', '99215, 99222, Z87.42, Z80.49', '99222, N92.1, Z87.42, Z80.49', '99215, 99222, N89.8, Z87.42, Z80.49', '99222, N91.5, Z80.49', '2022-06-04 04:37:49', '2022-06-04 04:37:49', 'ans_b'),
(415, 6, 18, 1, '<p><strong>Dr. Black admits a patient with an 8-day history of a low-grade fever, tachycardia, tachypnea, and basal consolidation of the lung and limited pleural effusion on the left side. An extensive past, family,</strong></p>\r\n\r\n<p><strong>and social history is taken as part of a comprehensive history. Bowel sounds are feeble. The pulse is rapid and thready. The comprehensive examination further indicates a jaundiced appearance with distention of the abdomen.</strong></p>\r\n\r\n<p><strong>There is a bluish discoloration of the flanks. The physician orders laboratory tests and radiographic studies, including an abdominal sonogram as he considers the extensive diagnostic options and the medical decision making complexity is high for this patient.</strong></p>', '99233, R50.9, R00.0, R06.82, J91.8, R19.15', '99233, R50.9, I47.1, R06.82, J18.9, J91.8', '99223, R50.9, R00.0, R06.82, J13', '99223, R50.9, R00.0, R06.82, J91.8, R19.15', '2022-06-04 04:38:26', '2022-09-21 09:08:38', 'ans_d'),
(416, 6, 18, 1, '<p><strong>A 10-month-old child is taken to the operating room for removal of a laryngeal mass. What is the appropriate anesthesia code?</strong></p>', '00320', '00326', '00320, 99100', '00326, 99100', '2022-06-04 04:38:58', '2022-06-04 04:38:58', 'ans_b'),
(417, 6, 18, 1, '<p><strong>A very large lipoma is removed from the chest measuring 8 sq cm and the defect is 12.2 cm requiring a layered closure with extensive undermining. MAC is performed by a medically directed Certified Registered Nurse Anesthetist (CRNA). Code the anesthesia service.&nbsp;</strong></p>', '00400-QS-QX', '00400-QS', '00300-QS', '00300-QS-QX', '2022-06-04 04:39:36', '2022-06-04 04:39:36', 'ans_a'),
(418, 6, 18, 1, '<p><strong>A 50-year-old female had a left subcutaneous mastectomy for cancer. She now returns for reconstruction which is done with a single TRAM flap. Right mastopexy is done for asymmetry. Code the anesthesia for this procedure.&nbsp;</strong></p>', '00404', '00402', '00406', '00400', '2022-06-04 04:40:13', '2022-06-04 04:40:13', 'ans_b'),
(419, 6, 18, 1, '<p><strong>A 42-year-old with renal pelvis cancer receives general anesthesia for a laparoscopic radical nephrectomy. The patient has controlled type II diabetes otherwise no other co-morbidities. What is the correct CPT&reg; and ICD-10-CM code for the anesthesia services?</strong></p>', '00860-P1, C64.9 E11.9', '00840-P3, C65.9, E11.9', '00862-P2, C65.9  E11.9', '00868-P2, C79.00  E11.9', '2022-06-04 04:40:49', '2022-06-04 04:40:49', 'ans_c'),
(420, 6, 18, 1, '<p><strong>A 32-year-old pregnant female has gestational diabetes at 34 weeks gestation. Her doctor is concerned about decreased fetal movement. The patient is sent to the radiology department of the hospital for a biophysical profile (BPP). The radiologist performs and interprets four elements scored by the ultrasound an it was reassuring, 8/8. A non-stress test will be performed by the obstetrician at the patient&#39;s next office visit, not the radiologist. What is the correct CPT&reg; code for the fetal profile performed by the radiologist?</strong></p>', '76818', '76815', '76819', '76820', '2022-06-04 04:41:20', '2022-06-04 04:41:20', 'ans_c'),
(421, 6, 18, 1, '<p><strong>A patient with colon cancer receives five sessions of radiation treatments. During the course of treatments, the physician views the port films, reviews the treatment parameters, and assesses the patient&rsquo;s response to the treatment. The patient receives two more treatment sessions when ending the course of treatment. Code the radiation treatment management.</strong></p>', '77427', '77431 x 7', '77427 x 2', '77427, 77431', '2022-06-04 04:41:52', '2022-06-04 04:41:52', 'ans_a'),
(422, 6, 18, 1, '<p><strong>A 78-year-old with lower back pain and leg pain is scheduled for a MRI of lumbar spine without contrast. Following the MRI, the patient is diagnosed with spinal stenosis of the lumbar region. What are the procedure and diagnosis codes?</strong></p>', '72020-26, M54.5, M79.606, M48.06', '72149-26, M48.06', '72148-26, M48.06', '72158-26, M48.07, M54.5, M79.606', '2022-06-04 04:42:25', '2022-06-04 04:42:25', 'ans_c'),
(423, 6, 18, 1, '<p><strong>22-year-old driver loss control of her car and crashed into a light pole on the highway.&nbsp; She arrived to the hospital. She had CT scans without contrast of the brain and chest. She had X-rays of AP and PA views of her left ribs and AP and PA views of her right ribs with a posterioanterior view of the chest. The CT scan of the brain showed a fracture of the skull base with no hemorrhage of the brain. The CT of the lung showed no puncture of the lungs. The X-ray showed fractures in the right and left second, third, and fifth ribs. What CPT&reg; and ICD-10-CM codes should be reported.</strong></p>', '70450-26, 71250-26, 71101-26, S02.10XA, S22.43XA, V47.32XA, Y92.411', '70460-26, 71260-26, 71110-26, S02.01XA, S22.49XB V47.0XXA, Y92.411', '70450-26, 71250-26, 71111-26, 71010-26, S01.10XA, S22.49XA, V47.32XA, Y92.411', '70450-26, 71250-26, 71111-26, S02.10XA, S22.43XA, V47.52XA, Y92.411', '2022-06-04 04:43:03', '2022-06-04 04:43:03', 'ans_d'),
(424, 6, 18, 1, '<p><strong>The physician orders an ultrasound on a patient 25 weeks pregnant with twins to access fetal heart rate and fetal position. Select the code(s).&nbsp;</strong></p>', '76805, 76810', '76811, 76812', '76816 x 2', '76815', '2022-06-04 04:43:34', '2022-06-04 04:43:34', 'ans_d'),
(425, 6, 18, 1, '<p><strong>65-year-old woman is one year post with B-cell non-Hodgkin&rsquo;s lymphoma. She is having recurrent fever and pain. Tumor recurrence was confirmed by CT studies and chest X-ray. She has failed prior chemotherapy and radiation treatments. A new treatment is being contemplated and she is referred for a radiopharmaceutical distribution imaging as a requirement before starting this new treatment. The provider injects small amounts of gamma-emitting radioactive material paying particular attention for potential reaction. A gamma camera is used to take planar images of the whole body for three days. Three sets of image data are interpreted. Qualitative assessment of distribution and determination of treatment with monoclonal antibody are provided. A report is dictated and placed in the medical recorD. Which CPT&reg; code is reported?</strong></p>', '78806-2', '78802-26', '78804-26', '78801-26', '2022-06-04 04:44:06', '2022-06-04 04:44:06', 'ans_c'),
(426, 6, 18, 1, '<p><strong>This 34-year-old established female patient is in for her yearly physical and lab. The physician orders a comprehensive metabolic panel, hemogram automated and manual differential WBC count (CBC), and a thyroid stimulating hormone. Code the lab only.</strong></p>', '99395, 80050', '80050-52', '80069, 80050', '80050', '2022-06-04 04:44:38', '2022-06-04 04:44:38', 'ans_d');
