(427, 6, 18, 1, '<p><strong>This is a patient with atrial fibrillation who comes to the clinic laboratory routinely for a quantitative digoxin level.</strong></p>', '80101, 80102, I50.9', '81001, I49.01', '80162, I48.91', '80162, R00.0', '2022-06-04 04:45:10', '2022-06-04 04:45:10', 'ans_c'),
(428, 6, 18, 1, '<p><strong>This patient presented to the laboratory yesterday for a creatine measurement. The results came back at higher than normal levels; therefore, the patient was asked to return to the laboratory today for a repeat creatine test before the nephrologist is consulted. Report the second day of test only.</strong></p>', '82540 × 2, R79.89', '82550, R79.89', '82550, R79.81', '82540, R79.89', '2022-06-04 04:45:43', '2022-06-04 04:45:43', 'ans_d'),
