(430, 6, 18, 1, '<p><strong>What code would you use to code a bilirubin, total (transcutaneous)?</strong></p>', '82252', '82247', '82248', '88720', '2022-06-04 04:46:42', '2022-06-04 04:46:42', 'ans_d'),
(431, 6, 18, 1, '<p><strong>18-year-old female with a history of depression comes into the ER in a coma. The ER physician orders a drug screen on benzodiazepines and barbiturates. The lab performs a screening for drug class using an immunoassay in a random access analyzer. Presence of each benzodiazephines is found and a drug confirmation is performed to identify the particular drug. What correct CPT&reg; codes are reported?&nbsp;</strong></p>', '80305, 80346', '80307, 80345', '80307, 80346', '80306, 80346', '2022-06-04 04:47:14', '2022-06-04 04:47:14', 'ans_c'),
(432, 6, 18, 1, '<p><strong>A patient who is a singer has been hoarse for a few months following an upper respiratory infection. She is in a voice laboratory to have a laryngeal function study performed by an otolaryngologist. She starts off with the acoustic testing first. Before she moves on to the aerodynamic testing she complains of throat pain and is rescheduled to come back to have the other test performed. What CPT&reg; code(s) should be reported? </strong></p>', '99211, 92520', '92700', '92520-52', '99211, 92700-52', '2022-06-04 04:47:43', '2022-06-04 04:47:43', 'ans_c'),
(433, 6, 18, 1, '<p><strong>A patient presents to her oncologist&rsquo;s office for schedule chemotherapy. The patient is severely dehydrated. The physician decides to schedule the chemotherapy for another day and orders hydration therapy to be performed today instead of the chemotherapy. The therapy is ordered and administered for one hour and 10 minutes. Select the code(s).</strong></p>', '96413-53, 96360', '96360', '96360, 96361', '96413, 96361', '2022-06-04 04:48:17', '2022-06-04 04:48:17', 'ans_b'),
(434, 6, 18, 1, '<p><strong>Left heart catheterization retrograde from the femoral artery with injection procedures for selective coronary angiography and selective left ventriculography, including imaging supervision and interpretation with report, are performed. The cardiologist performed all of the services at the hospital. The CPT&reg; codes are:</strong></p>', '93458-26', '93459-26', '93452-26', '93460-26', '2022-06-04 04:48:47', '2022-06-04 04:48:47', 'ans_a'),
(435, 6, 18, 1, '<p><strong>A patient is coming in to have osteopathic manipulative treatment (OMT) performed on two root lesions in his cervical region and three root lesions in the thoracic region. Which code is reported by the physician for the OMT?</strong></p>', '98927', '98940', '98925', '98942', '2022-06-04 04:49:14', '2022-06-04 04:49:14', 'ans_c'),
(436, 6, 18, 1, '<p><strong>The patient is admitted to the hospital for a radio16 channel EEG to determine the focus of her cerebral seizures. The test also consists of video recording and interpretation with nurse&nbsp;attendance. The EEG is performed in 12 hours. Select the appropriate coding.</strong></p>\r\n\r\n<p>&nbsp;</p>', '95711', '95718', '95717', '95712', '2022-06-04 04:49:46', '2022-08-04 11:10:49', 'ans_b'),
