(445, 6, 18, 1, '<p><strong>What is being done when a surgeon performs a bilateral oopherectomy</strong></p>', 'A sling procedure for vaginal prolapse', 'Removal of both ovaries', 'Removal of both fallopian tubes', 'Laparoscopic removal of the uterus', '2022-06-04 04:56:05', '2022-06-04 04:56:05', 'ans_b'),
(446, 6, 18, 1, '<p><strong>44-year-old had a history of adenocarcinoma of the cervix on a conization in March 20XX who has been followed with twice-yearly endocervical curettages and Pap smears that were all negative for two years, per the recommendation of a GYN oncologist. Her Pap smear results from the last visit noted atypical glandular cells. In light of this, she underwent a colposcopy and the biopsy of the normal-appearing cervix on colposcopy was benign. The endocervical curettage was benign endocervical glands, and the endometrial sampling was benign endometrium. In light of the fact that she had had previous atypical glandular cells that led to diagnosis of adenocarcinoma and the concerns that this may have recurred, she had been recommended for a cone biopsy and fractional dilatation and curettage, which she is undergoing today. What ICD-10-CM code(s) should be reported?</strong></p>', 'R87.619, C53.9', 'D39.0', 'R87.619  Z85.41', 'Z12.4, Z85.41', '2022-06-04 04:56:54', '2022-06-04 04:56:54', 'ans_c'),
(447, 6, 18, 1, '<p><strong>Patient comes into see her primary care physician for a productive cough and shortness of breath. The physician takes a chest x-ray which indicates the patient has congestive pneumonia. Select the ICD-10-CM code(s) for this visit.&nbsp;</strong></p>', 'J18.9,R05.9, R06.02', 'R05.9, R06.02, J18.9', 'J18.9', 'J18.0', '2022-06-04 04:57:27', '2023-04-14 08:12:52', 'ans_c'),
(448, 6, 18, 1, '<p><strong>What is the correct way to code a patient having bradycardia due to Demerol that was correctly prescribed and properly administered?</strong></p>', 'T40.2X4A, R00.1, T40.2X5A', 'T50.995A, R00.1', 'R00.1, T40.2X5A', 'T40.2X4A, R00.1, T40.2X1A', '2022-06-04 04:57:59', '2022-06-04 04:57:59', 'ans_c'),
(449, 6, 18, 1, '<p><strong>27-year-old was frying chicken when an explosion of the oil had occurred and she sustained second-degree burns on her face (3%), third degree burns on both hands (4%), and second degree burns on her lower left arm (3%). There was a total of 10 percent of the body surface that was burned. Select which ICD-10-CM codes should be used.&nbsp;</strong></p>', 'T20.20XA, T23.309A, T22.20XA, T31.10, X12.XXXA', 'T23.309A, T20.20XA, T22.20XA, T31.10, X12.XXXA', 'T23.309A, T20.20XA, T22.219A, T31.10, X12.XXXA', 'T23.309A, T30.0, T31.0, X12.XXXA', '2022-06-04 04:58:45', '2022-06-04 04:58:45', 'ans_c'),
(450, 6, 18, 1, '<p><strong>A patient that has cirrhosis of the liver just had an endoscopy performed showing hemorrhagic esophageal varices. The ICD-10-CM codes should be reported:</strong></p>', 'I85.11, K74.60', 'I85.10, K74.60', 'K74.60, I85.11', 'I85.01, K74.60', '2022-06-04 04:59:23', '2022-06-04 04:59:23', 'ans_c'),
