(452, 6, 18, 1, '<p><strong>What is the HCPCS code for 1 cc of Testosterone Cypionate 200 mg?</strong></p>', 'J1071x200', 'J1060', 'J3230x4', 'J3145x200', '2022-06-04 05:00:16', '2022-08-04 11:23:12', 'ans_a'),
(453, 6, 18, 1, '<p><strong>Which modifier indicates diagnostic mammogram converted from screening mammogram on the same day?</strong></p>', '59', '58', 'AT', 'GH', '2022-06-04 05:00:51', '2022-06-04 05:00:51', 'ans_d'),
(454, 6, 18, 1, '<p><strong>A 6-year-old girl fell on the playground at school. An x-ray revealed a distal radial fracture.</strong></p>\r\n\r\n<p><strong>Where is this located?</strong></p>', 'Thumb side of lower forearm', 'Outside lower leg', 'Just below elbow on the thumb side', 'Lower part of the upper arm', '2022-06-04 05:02:08', '2022-06-04 05:02:08', 'ans_a'),
(455, 6, 18, 1, '<p><strong>Which term describes the most important reason for the care provided to the patient; that is, the first diagnosis code listed on the insurance form?</strong></p>', 'Complications', 'Adverse effect', 'Primary diagnosis', 'Symptoms', '2022-06-04 05:03:09', '2022-06-04 05:03:09', 'ans_c'),
(456, 6, 18, 1, '<p><strong>The term &ldquo;adverse effect&rdquo; means:</strong></p>', 'Secondary diagnosis code used to identify the external cause for a condition for which the patient is being seen', 'A morbid phenomenon or departure from the normal structure, function, or sensation experienced by the patient and indicative of the disease', 'The term denoting name of the disease or syndrome a person has or is believed to have', 'None of the above', '2022-06-04 05:03:48', '2022-06-04 05:03:48', 'ans_b'),
(457, 6, 18, 1, '<p><strong>Which of the following is a FALSE statement?</strong></p>', 'When only ancillary services are provided, list the appropriate Z code first and the problem or condition second.', 'Code the primary diagnosis code first followed by the secondary, tertiary, and so on. Code any co-existing conditions that affect the treatment of the patient for the visit or procedure as supplementary information.', 'Only code a chronic diagnosis once, as it is not applicable to the patient’s current treatment.', 'Identify the service(s) or visit(s) for circumstances other than the disease or injury such as follow-up care', '2022-06-04 05:04:24', '2022-06-04 05:04:24', 'ans_c'),
(458, 6, 18, 1, '<p><strong>The symbol [ ] indicates:</strong></p>', 'Synonyms, alternate wording, or explanatory phrases', 'Supplementary words that may be present or absent without affecting the code assignment', 'A series of terms, each of which is modified by the statement appearing to the right', 'The code is specified', '2022-06-04 05:04:57', '2022-06-04 05:04:57', 'ans_a'),
(459, 6, 18, 1, '<p><strong>The central nervous system consist of the</strong></p>', 'Cerebellum and cortex', 'Nerves and receptors', 'Brain and Spinal cord', 'Frontal, parietal, temporal & occipital lobes', '2022-06-04 05:05:32', '2022-06-04 05:05:32', 'ans_c'),
(460, 6, 18, 1, '<p><strong>A 16-year-old female was admitted to the ER for abdominal pain, nausea and vomiting, and diarrhea. Upon discharge, she was diagnosed with a ruptured ovarian cyst.</strong></p>', 'R10.9', 'N83.209', 'R10.31, R11.2', 'N83.209, R11.2', '2022-06-04 05:06:03', '2022-06-04 05:06:03', 'ans_b'),
(461, 6, 18, 1, '<p><strong>PREOPERATIVE DIAGNOSIS: Left breast carcinoma.&nbsp;</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: Left breast carcinoma.&nbsp;</strong></p>\r\n\r\n<p><strong>NAME OF PROCEDURE: Left lumpectomy and sentinel node biopsy.&nbsp;</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The patient is a 65-year female admitted with a diagnosis of left breast carcinoma. Risks and benefits of the procedure had been discussed preoperatively including risks of bleeding, infection, deformity in the breast, chronic pain, numbness, chronic lymph edema associated with the lymph node biopsy as well as other possible complications. The patient agreed to proceed. Because the wire was located in the upper outer quadrant of the breast over the lesion and the length of the wire was 10 cm, it was felt that it would be best to approach the node biopsy as well as the lumpectomy through the same incision in the upper outer quadrant of the left breast. Incision was made with a 15-blade through skin and subcutaneous. Homeostasis achieved with Bovie electrocautery. Flaps were formed in the usual manner. A wire was brought out through the incision. We then circumferentially removed all the tissue around the wire down to the tip. We marked the specimen with a long lateral stitch, short superior stitch, 2 lateral clips, and 1 superior clip. We were able to identify a hot node in the axilla and at least 2 lymph nodes that were blue-dyed within the sentinel nodes. We did perform lymphoscintigraphy and injected 2 cc of methylene blue dye in the periareolar area preoperatively and massaged the breast for 5 minutes. The lymph nodes were excised and a biopsy was performed on the axillary node. At this point, we copiously irrigated the area to assure good homeostasis. We placed clips throughout the entire cavity. We then closed the deep dermal tissue with interrupted 3-0 Vicryl sutures and then closed the skin with a fine 5-0 nylon. The patient tolerated the procedure well. Sponge count was correct. Blood loss was minimal. The patient was sent to the recovery room in stable condition. What are the codes for these procedures?</strong></p>', '19120, 38530-51-LT', '19301, 38525-52-51-LT, 38792-51-LT', '19302, 38520-51-LT', '19120, 38510-51-LT, 38792-51-LT', '2022-06-04 05:06:38', '2022-06-04 05:06:38', 'ans_b'),
(462, 6, 18, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: Atelectasis of the left lower lobe.</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Fiberoptic bronchoscopy with brushings and cell washings.</strong></p>\r\n\r\n<p><strong>PROCEDURE: 34yo male patient was already sedated, on a ventilator, and intubated; so his bronchoscopy was done through the ET tube. It was passed easily down to the carina. About 2 to 2.5 cm above the carina, we could see the trachea, which appeared good, as was the carina. In the right lung, all segments were patent and entered, and no masses were seen. The left lung, however, had petechial ecchymotic areas scattered throughout the airways. The tissue was friable and swollen, but no mucous plugs were noted, and all the airways were open, just somewhat swollen. No abnormal secretions were noted at all. Brushings were taken as well as washings, including some with Mucomyst to see whether we could get some distal mucous plug, but nothing really significant was returned. The specimens were sent to appropriate cytological and bacteriological studies. The patient tolerated the procedure fairly well.</strong></p>', '31622, 31623-51, J98.11', '31623, P28.0', '31623, J98.11', '31624, P28.0', '2022-06-04 05:07:10', '2022-08-04 11:31:51', 'ans_c'),
(463, 6, 18, 1, '<p><strong>OPERATIVE PROCEDURE</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: 68-year-old male in a coma.</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: 68-year-old male in a coma.</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Placement of a triple lumen central line in right subclavian vein. With the usual Betadine scrub to the right subclavian vein area and with a second attempt, the subclavian vein was cannulated and the wire was threaded. The first time the wire did not thread right, and so the attempt was aborted to make sure we had good identification of structures. Once the wire was in place the needle was removed and a tissue dilator was pushed into position over the wire. Once that was removed, then the central lumen catheter was pushed into position at 17 cm and the wire removed. All three ports were flushed. The catheter was sewn into position, and a dressing applied.</strong></p>', '36011, R40.1', '36011, R40.20', '36556, R40.1', '36556, R40.20', '2022-06-04 05:07:47', '2022-06-04 05:07:47', 'ans_d'),
(464, 6, 18, 1, '<p><strong>Patient is a 40-year-old male who was involved in a motor vehicle crash. He is having some pulmonary insufficiency.</strong></p>\r\n\r\n<p><strong>PROCEDURE: Bronchoscope was inserted through the accessory point on the end of the ET tube and was then advanced through the ET tube. The ET tube came pretty close down to the carina. We selectively intubated the right mainstem bronchus with the bronchoscope. There were some secretions here, and these were aspirated. We then advanced this selectively into first the lower and then the middle and upper lobes.</strong></p>\r\n\r\n<p><strong>Secretions were present, more so in the middle and lower lobes. No mucous plug was identified. We then went into the left mainstem and looked at the upper and lower lobes. There was really not much in the way of secretions present. We did inject some saline and aspirated this out. We then removed the bronchoscope and put the patient back on the supplemental O2 We waited a few minutes. The oxygen level actually stayed pretty good during this time. We then reinserted the bronchoscope and went down to the right side again. We aspirated out all secretions and made sure everything was clear. We then removed the bronchoscope and pulled back on the ET tube about 1.5 cm. We then again placed the patient on supplemental oxygenation.</strong></p>\r\n\r\n<p><strong>FINDINGS: No mucous plug was identified. Secretions were found mainly in the right lung and were aspirated. The left side looked pretty clear.</strong></p>', '31646, J95.1, V89.2XXA', '32654, J80, V49.88XA', '31645, J80, V49.88XA', '31645, J95.1, V89.2XXA', '2022-06-04 05:08:20', '2022-06-04 05:08:20', 'ans_d'),
(465, 6, 18, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.</strong></p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: Coronary bypass grafts &times;2 with a single graft from the aorta to the distal left anterior descending and from the aorta to the distal right coronary artery.</strong></p>\r\n\r\n<p><strong>PROCEDURE: The patient was brought to the operating room and placed in a supine position under general intubation anesthesia, the anterior chest and legs were prepped and draped in the usual manner. A segment of greater saphenous vein was harvested from the left thigh, utilizing the endoscopic vein harvesting technique, and prepared for grafting. The sternum was opened in the usual fashion, and the left internal mammary artery was taken down and prepared for grafting. The flow through the internal mammary artery was very poor. The patient did have a 25-mm difference in arterial pressure between the right and left arms, the right arm being higher. The left internal mammary artery was therefore not used. The pericardium was incised sharply and a pericardial well created. The patient was systemically heparinized and placed on bicaval to aortic cardiopulmonary bypass with the sump in the main pulmonary artery for cardiac decompression. The patient was cooled to 26, and on fibrillation an aortic cross-clamp was applied and potassium-rich cold crystalline cardioplegic solution was administered through the aortic root with satisfactory cardiac arrest. Subsequent doses were given down the vein grafts as the anastomoses were completed and via the coronary sinus in a retrograde fashion. Attention was directed to the right coronary artery. The end of the greater saphenous vein was then anastomosed thereto with 7-0 continuous Prolene distally. The remaining graft material was then grafted to the left anterior descending at the junction of the middle and distal third. The aortic cross-clamp was removed after 149 minutes with spontaneous cardio version. The usual maneuvers to remove air from the left heart were then carried out using transesophageal echocardiographic technique. After all the air was removed and the patient had returned to a satisfactory temperature, he was weaned from cardiopulmonary bypass after 213 minutes utilizing 5 g per kilogram per minute of dopamine. The chest was closed in the usual fashion. A sterile compression dressing was applied, and the patient returned to the surgical intensive care unit in satisfactory condition.</strong></p>', '33511, 33517, I70.90', '33511, 33508, I25.10', '33534, 33508, I25.10', '33511, 33517, I25.10', '2022-06-04 05:08:56', '2022-06-04 05:08:56', 'ans_b'),
(466, 6, 18, 1, '<p><strong>PREOPERATIVE DIAGNOSIS:</strong></p>\r\n\r\n<p><strong>1. Hypoxia</strong></p>\r\n\r\n<p><strong>2. Pneumothorax</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS:</strong></p>\r\n\r\n<p><strong>1. Hypoxia</strong></p>\r\n\r\n<p><strong>&nbsp;2. Pneumothorax</strong></p>\r\n\r\n<p><strong>PROCEDURE: Chest tube placement</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The patient was previously sedated with Versed and paralyzed with Nimbex. Lidocaine was used to numb the incision area in the midlateral left chest at about nipple level. After the lidocaine, an incision was made, and we bluntly dissected to the area of the pleural space, making sure we were superior to the rib. On entrance to the pleural space, there was immediate release of air noted. An 18-gauge chest tube was subsequently placed and sutured to the skin. There were no complications for the procedure, and blood loss was minimal.</strong></p>\r\n\r\n<p><strong>DISPOSITION: Follow-up, single-view, chest x-ray showed significant resolution of the</strong></p>\r\n\r\n<p><strong>pneumothorax except for a small apical pneumothorax that was noted.</strong></p>', '32554, R09.02, J93.11', '32551, R09.02, J93.11, 71045', '32551, R09.02, J93.11', '32554, R09.02, J93.0', '2022-06-04 05:10:00', '2022-06-04 05:10:00', 'ans_c'),
(467, 6, 18, 1, '<p><strong>PREOPERATIVE DIAGNOSIS: Diverticulitis, perforated diverticula POST OPERATIVE DIAGNOSIS: Diverticulitis, perforated diverticula PROCEDURE: Hartman procedure, which is a sigmoid resection with Hartman pouch and colostomy. DESCRIPTION OF THE PROCEDURE: Patient was prepped and draped in the supine position under general anesthesia. Prior to surgery patient was given 4.5 grams of Zosyn and Rocephin IV piggyback. A lower midline incision was made, abdomen was entered. Upon entry into the abdomen, there was an inflammatory mass in the pelvis and there was a large abscessed cavity, but no feces. The abscess cavity was drained and irrigated out. The left colon was immobilized, taken down the lateral perineal attachments. The sigmoid colon was mobilized. There was an inflammatory mass right at the area of the sigmoid colon consistent with a divertiliculitis or perforation with infection. Proximal to this in the distal left colon, the colon was divided using a GIA stapler with 3.5 mm staples. The sigmoid colon was then mobilized using blunt dissection. The proximal rectum just distal to the inflammatory mass was divided using a GIA stapler with 3.5 mm staples. The mesentary of the sigmoid colon was then taken down and tied using two 0 Vicryl ties. Irrigation was again performed and the sigmoid colon was removed with inflammatory mass. The wall of the abscessed cavity that was next to the sigmoid colon where the inflammatory mass was, showed no leakage of stool, no gross perforation, most likely there is a small perforation in one of the diverticula in this region. Irrigation was again performed throughout the abdomen until totally clear. All excess fluid was removed. The distal descending colon was then brought out through a separate incision in the lower left quadrant area and a large 10 mm 10 French JP drain was placed into the abscessed cavity. The sigmoid colon or the colostomy site was sutured on the inside using interrupted 3-0 Vicryl to the peritoneum and then two sheets of film were placed into the intra- abdominal cavity. The fascia was closed using a running #1 double loop PDS suture and intermittently a #2 nylon retention suture was placed. The colostomy was matured using interrupted 3-0 chromic sutures. I palpated the colostomy; it was completely patent with no obstructions. Dressings were applied. Colostomy bag was applied. Which CPT code should be used?&nbsp;</strong></p>', '44140', '44143', '44160', '44208', '2022-06-04 05:10:33', '2022-06-04 05:10:33', 'ans_b'),
(468, 6, 18, 1, '<p><strong>Name of Procedure: Endoscopic retrograde cholangiopancreatogram with stent placement and antral biopsy. Indications: 50-year-old male who underwent liver transplantation for end-stage liver disease secondary to chronic hepatits C and hepatocellular carcinoma in 01/2007. The patient has chloestatic liver enzymes, requiring ERCP before placement of a 7-French 12 cm stent and to evaluate the biliary system. Description of Procedure: The patient was taken to the fluoroscopy suite in the GI lab where he was found to be alert and oriented x 3. After discussing risks and benefits of the procedure, informed consent was obtained. Patient was kept in the semi prone position. After adequated conscious sedation, an Olympus side-viewing therapeutic scope was inserted through the mouth all the way to the second portion of the duodenum. Then, the common bile duct was cannulated and the cholangiogram was obtained. After the fluoroscopy evaluation of the choangiogram a 12 cm stent was deployed for biliary drainage. A biopsy from the antrum was obtained. The patient tolerated the procedure well. There were no immediate complications.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Which CPT&reg; codes should be reported?</strong></p>', '43276, 43261-51', '43274, 43261-51', '43266, 43239-51', '43212, 43202-51', '2022-06-04 05:11:05', '2022-06-04 05:11:05', 'ans_b'),
(469, 6, 18, 1, '<p><strong>Preoperative Diagnosis: Lower left inguinal pain Postoperative Diagnosis: Inguinal hernia Procedure: This 30-year-old patient presented with lower left inguinal pain and on examination was found to have a left inguinal hernia. The decision to perform a left inguinal hernia repair was made. The procedure was performed in the outpatient hospital surgery center. Risks and benefits of the surgery were discussed with the patient and the patient decided to proceed with the surgery. A skin incision was placed at the umbilicus where the left rectus fascia was incised anteriorly. The rectus muscle was retracted laterally. Balloon dissector was passed below the muscle and above the peritoneum. Insufflation and deinsufflation were done with the balloon removed. The structural balloon was placed in the preperitoneal space and insufflated to 10 mm Hg carbon dioxide. The other trocars were placed in the lower midline times two. The hernia sac was easily identified and was well-defined. It was dissected off the cord anteromedially. It was an indirect sac. It was taken back down and reduced into the peritoneal cavity. Mesh was then tailored and placed overlying the defect, covering the femoral, indirect, and direct spaces, tacked into place. After this was completed, there was good hemostasis. The cord, structures, and vas were left intact. The trocars were removed. The wounds were closed with 0 Vicryl for the fascia, 4-0 for the skin. Steri-Strips were applied. The patient was awakened and carried to the recovery room in good condition, having tolerated the procedure well. What are the correct procedure and diagnostic codes?&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</strong></p>', '49650-LT, K40.90', '49651-LT, 49568, K40.90', '49650-LT, K40.20', '49652-LT, K40.20', '2022-06-04 05:11:39', '2022-06-04 05:11:39', 'ans_a'),
(470, 6, 18, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Proximal ileostomy for diversion of colon. Oversew of right colonic fistula.</strong></p>\r\n\r\n<p><strong>OPERATIVE NOTE: This patient was taken back to the operating room from the intensive care unit. She was having acute signs of leakage from an anastomosis I performed 3 days previously. We took down some of the sutures holding the wound together. We basically exposed all of this patient&#39;s intestine. It was evident that she was leaking from the small bowel as well as from the right colon. I thought the only thing we could do would be to repair the right colon. This was done in two layers, and then we freed up enough bowel to try to make an ileostomy proximal to the area of leakage. We were able to do this with great difficulty, and there was only a small amount of bowel to be brought out. We brought this out as an ileostomy stoma, realizing that it was of questionable viability and that it should be watched closely. With that accomplished, we then packed the wound and returned the patient to the intensive care unit.</strong></p>', '44310, T81.30XA', '44310-78, K91.89', '45136, T85.398A', '45136-78, T81.30XA', '2022-06-04 05:12:19', '2022-06-04 05:12:19', 'ans_b'),
(471, 6, 19, 1, '<p>The physician is called in to perform repairs for a 17-year-old girl involved in a motor vehicle accident. She sustained an 8.6 cm laceration to her forehead, a 5.5 cm laceration to her right cheek, a 4 cm laceration to her left cheek, a 4 cm laceration across her chin, and a 12.5 cm laceration to her chest. The wound on her chin required a layered closure. All other wounds required complex closure.</p>', '13132, 13133 x 4, 13101, 12052', '13132, 13133 x 3, 13133-52, 13101, 13102, 12052', '13132, 13133 x 3, 13101, 13102, 12052', '13131, 13132, 13133 x 3, 13101, 13102, 12052', '2022-06-04 07:12:30', '2022-06-04 07:12:30', 'ans_c'),
(472, 6, 19, 1, '<p>The left breast was prepped and draped in a sterile fashion. An incision from the 3 around to the 9 o&rsquo;clock position on the areolar border on its inferior aspect was made in the skin and extended to the subcutaneous tissue. The breast mass was excised by sharp dissection. The mass was found to be approximately 1.5 - 2 cm in maximum dimension.&nbsp; Hemostasis was made adequate using electrocautery and the Argon beam coagulator. After this was accomplished, the skin margins were reapproximated with running inverted 3-0 Vicryl subcuticular suture. Select the procedure and diagnosis codes.</p>\r\n\r\n<p>&nbsp;</p>', '19120, N63', '19301, D49.3', '19125, N60.82', '19101, N64.51', '2022-06-04 07:13:50', '2022-06-04 07:13:50', 'ans_a'),
(473, 6, 19, 1, '<p>Indications: 55-year-old female had a sizeable 1.5 cm basal cell carcinoma on the right upper lip. She had a 2 cm defect. After excision, it was reconstructed in a first stage with a nasolabial cheek flap. The margins were clear and she is planned for the second stage.&nbsp; Operative Procedure: Under intravenous sedation, patient in supine position, the face was prepped and draped. Division performed to the bridge between the base of the flap of the upper lip. Unfurled the base of the flap that was excised until it was soft and pliable. It is defatted and laid back onto the cheek with interrupted 5-0 Monocryl and running 6-0 plain catgut. Similar procedure was performed on the redundant portion of the flap and permanently set into the upper lip. Steri-strips applied. Which CPT&reg; should be used?</p>\r\n\r\n<p>&nbsp;</p>', '15758-79', '15630-58', '15758-76', '15630-78', '2022-06-04 07:15:18', '2022-06-04 07:15:18', 'ans_b'),
(474, 6, 19, 1, '<p>A 7-year-old riding his bike struck a tree stump throwing him off his bike. He received multiple lacerations. He had a 3 cm dermis laceration on his scalp with two 0.5 cm lacerations on his face. His right arm had a 5 cm laceration and right leg has a 5 cm laceration. The physician stapled the laceration for the scalp. Physician used steri-strips (adhesive strips) to close the wounds on the face. The legs and arms were cleaned by heavily irrigating them with normal saline and removal of embedded debris performed on both wounds, followed with a single-layer closure. Select the repair codes to report.</p>', '12032, 12032-59, 12011-59, 12002-59', '12002, 12002-59, 12011-59, 12002-59', '12005, 11042-59', '12034, 12002-59', '2022-06-04 07:16:27', '2022-06-04 07:16:27', 'ans_d'),
(475, 6, 19, 1, '<p>A 55-year-old male presents in the office with an ingrown toenail on the right and left foot. The procedure was discussed in detail and the patient elected to have it performed. The right foot was prepped and draped in sterile fashion. The right great toe was anesthetized with 50/50 solution of 2 percent lidocaine and .05 percent Marcaine. A mini-tourniquet was placed around the toe for hemostasis in which part of the nail plate and maxtrixectomy were performed. Phenol was then applied, the toe was then flushed. Tourniquet was released and dressing applied. At this time the patient elected to only have one performed and will return in two weeks for the left foot. Code the procedure.</p>', '11765-T5', '11750-T5', '. 11752-T5', '11740-T5', '2022-06-04 07:17:49', '2022-06-04 07:17:49', 'ans_b'),
(476, 6, 19, 1, '<p>Procedure Diagnosis: Basal cell carcinoma, left chin. Procedure: Wide local excision of 3.0 cm with 0.3 cm margin basal cell carcinoma of the left chin with a 4 cm closure. Procedure: The patient&rsquo;s left chin was examined. The site of intended excision was marked out. The site was then prepped. The patient was then prepped and draped in the usual fashion. A 15 blade scalpel was then used to make an incision in the previously marked site. It was carried down to the subcuticular fat. The lesion was then sharply dissected off underlying tissue bed using a 15-blade scalpel. It was tagged for pathologic orientation. The hyfrecator was used for hemostasis. The wound was then closed by advancing the tissue surrounding the lesion and closing in layers with 3-0 Vicryl for the deep layer, followed by 5-0 Prolene for the skin. The skin closure was in a running subcuticular fashion. Steri-Strips were then applied. What are the procedure and diagnosis codes?</p>', '11644, 12052-51, C44.319', '11643, 12013-51, C44.319', '11444, 12052-51, D49.2', '11443, 12013-51, D49.2', '2022-06-04 07:19:44', '2022-06-04 07:19:44', 'ans_a'),
(477, 6, 19, 1, '<p>An infant with genu valgum is brought to the operating room to have a bilateral medial distal femur hemiepiphysiodesis done. On each knee, the C-arm was used to localize the growth plate. With the growth plate localized, an incision was made medially on both sides. This was taken down to the fascia, which was opened. The periosteum was not opened. The Orthofix figure-of-eight plate was placed and checked with x-ray. We then irrigated and closed the medial fascia with 0 Vicryl suture. The skin was closed with 2-0 Vicryl and 3-0 Monocryl. What procedure code should be used?</p>', '27470-50', '27475-50', '27477-50', '27485-50', '2022-06-04 07:21:06', '2022-06-04 07:21:06', 'ans_d'),
(478, 6, 19, 1, '<p>Carl Ostrick, a 21-year-old male, slipped on a patch of ice on his sidewalk while shoveling snow. When he fell, his left hand was wedged under his body and his index finger was dislocated. After manipulating the joint back into normal alignment, the surgeon fixed the dislocation by placing a wire percutaneously through the carpometacarpal joint to maintain alignment.</p>', '26608-F1', '26650-FA', '26706-LT', '26676-F1', '2022-06-04 07:23:02', '2022-06-04 07:23:02', 'ans_d'),
(479, 6, 19, 1, '<p>John, an 84-year-old male, tripped while on his morning walk. He stated he was thinking about something else when he inadvertently tripped over the sidewalk curb and fell to his knees. X-ray indicated a fracture of his right patella. With the patient under general anesthesia, the area was opened and extensively irrigated. The left aspect of the patella was severely fragmented, and a portion of the patella was subsequently removed. The remaining patella fractures were wired. The surrounding tissue was repaired, thoroughly irrigated, and closed in the usual manner.</p>', '27524-RT, S82.001A, W10.1XXA', '27520-RT, S82.009A, W10.1XXA', '27524-RT, S82.001B, W19.XXXA', '27524-RT, S82.009A, W19.XXXA', '2022-06-04 07:24:24', '2022-06-04 07:24:24', 'ans_a'),
(480, 6, 19, 1, '<p>Maryann received a blow to her right tibial shaft while moving a large stuffed chair up a flight of stairs when the person in front of the chair slipped and released his hold on the chair. The full weight of the chair was pushed against her; when she was unable to hold the chair in place, both she and the chair fell to the landing a dozen steps below.</p>\r\n\r\n<p>The chair tipped on its side and landed on her tibia. On x-ray, the right tibia shaft was fractured in three places. Percutaneous screws and pins were placed to secure the fracture sites.</p>', '27750-RT, S82.201A, W10.8XXA', '27756-RT, S82.209A, W19.XXXA', '27756-RT, S82.201A, W10.8XXA', '27750-RT, S82.209A, W10.8XXA', '2022-06-04 07:25:55', '2022-06-04 07:25:55', 'ans_c'),
(481, 6, 19, 1, '<p>Darin was a passenger in an automobile rollover accident and was not wearing a seat belt at the time. He was thrown from the automobile and was pinned under the rear of the overturned vehicle. He sustained craniofacial separation that required complicated internal and external fixation using an open approach to repair the extensive damage. A halo device was used to hold the head immobile.</p>', '21435, 20661', '21435', '21432', '21436, 20661', '2022-06-04 07:27:53', '2022-06-04 07:27:53', 'ans_b'),
(482, 6, 19, 1, '<p>Libby was thrown from a horse while riding in the ditch; a truck that honked the horn as it passed her startled her horse. The horse reared up, and Libby was thrown to the ground. Her left tibia was fractured and required insertion of multiple pins to stabilize the defect area. A unilateral multiplane external fixation system was then attached to the pins.</p>', '20661-LT, S82.202A, V88.9XXA', '20692-LT, S82.201A, V80.11XA', '20692-LT, S82.202A, V80.11XA', '20690-LT, S82.201A, V80.11XA', '2022-06-04 07:29:21', '2022-06-04 07:29:21', 'ans_c'),
(483, 6, 19, 1, '<p>The patient is a fifty-eight-year-old white male, one month status post pneumonectomy. He had a post pneumonectomy empyema treated with a tunneled cuffed pleural catheter which has been draining the cavity for one month with clear drainage. He has had no evidence of a block or pleural fistula. Therefore a planned return to surgery results in the removal of the catheter. The correct CPT code is:</p>', '32440-78', '32035-58', '32036-79', '32552-58', '2022-06-04 07:30:46', '2022-06-04 07:30:46', 'ans_d'),
(484, 6, 19, 1, '<p>A CT scan identified moderate-sized right pleural effusion in a 50-year-old male. This was estimated to be 800 cc in size and had an appearance of fluid on the CT Scan. A surgical puncture using an aspirating needle punctured through the chest tissues and entered the pleural cavity. Fluid was aspirated, draining the effusion under ultrasound guidance using 1% lidocaine as local anesthetic. What procedure code should be used?</p>', '32555', '32555, 77002-26', '32405, 76942-26', '32400, 77012-26', '2022-06-04 07:32:59', '2022-06-04 07:32:59', 'ans_a'),
(485, 6, 19, 1, '<p>This 67 year-old man presented with a history of progressive shortness of breath, mostly related to exercise. He has had a diagnosis of a secundum atrial septal defect for several years, and has had atrial fibrillation intermittently over this period of time. He was in atrial fibrillation when he came to the operating room, and with the patient cannulated and on bypass. The right atrium was then opened. A large 3 x 5 cm defect was noted at fossa ovalis, and this also included a second hole in the same general area. Both of these holes were closed with a single pericardial patch. What CPT and ICD-9 codes should be reported?</p>', '33675, Q21.0', '33647, R06.02, Q21.0', '33645, Q21.2, R06.02', '33641, Q21.1', '2022-06-04 07:35:13', '2022-06-04 07:35:13', 'ans_d'),
(486, 6, 19, 1, '<p>The patient is a 51 year old gentleman who has end-stage renal disease. He was in the OR yesterday for a revision of his AV graft. The next day the patient had complications of the graft failing. The patient was back to the operating room where an open thrombectomy was performed on both sides getting good back bleeding, good inflow. An arteriogram was shot. There was a small amount of what looked like pseudo-intima in the distal anastomosis of the venous tract that was causing a flow defect which was taken out with a Fogarty catheter. A Conquest balloon was ballooned up again with a 6 millimeter and a 7 millimeter. An arteriogram was reshot in both directions. The arterial anastomosis looked fine as did the venous anastomosis. Select the appropriate codes for this visit:</p>', '36831-76', '36831', '36831-78', '36831-58', '2022-06-04 07:37:22', '2022-06-04 07:37:22', 'ans_c'),
(487, 6, 19, 1, '<p>The patient is a 77 year-old white female who has been having right temporal pain and headaches with some visual changes and has a sed rate of 51. She is scheduled for a temporal artery biopsy to rule out temporal arteritis. A Doppler probe was used to isolate the temporal artery and using a marking pen the path of the artery was drawn. Lidocaine 1% was used to infiltrate the skin, and using a 15 blade scalpel the skin was opened in the preauricular area and dissected down to the subcutaneous tissue where the temporal artery was identified in its bed. It was a medium size artery and we dissected it out for a length of approximately 4 cm with some branches. The ends were ligated with 4-0 Vicryl, and the artery was removed from its bed and sent to Pathology as specimen. What code should be used for this procedure?</p>', '37609', '37605', '36625', '37799', '2022-06-04 07:38:36', '2022-06-04 07:38:36', 'ans_a'),
(488, 6, 19, 1, '<p>OPERATIVE REPORT: The patient is in for a bone marrow biopsy. The patient was sterilized by standard procedure. Bone marrow core biopsies were obtained from the left posterior iliac crest with minimal discomfort. At the end of the procedure, the patient denied discomfort, without evidence of complications.</p>', '20225', '38221', '38230', '38220', '2022-06-04 07:40:12', '2022-06-04 07:40:12', 'ans_b'),
(489, 6, 19, 1, '<p>The patient is a 78-year-old white female with morbid obesity that presented with small bowel obstruction. She had surgery approximately one week ago and underwent exploration, which required a small bowel resection of the terminal ileum and anastomosis leaving her with a large inferior ventral hernia. Two days ago she started having drainage from her wound which has become more serious. She is now being taken back to the operating room. Reopening the original incision with a scalpel, the intestine was examined and the anastomosis was reopened , excised at both ends, and further excision of intestine. The fresh ends were created to perform another end- to-end anastomosis. The correct procedure code is:</p>', '44120-78', '44126-79', '44120-76', '44202-58', '2022-06-04 07:41:44', '2022-06-04 07:41:44', 'ans_a'),
(490, 6, 19, 1, '<blockquote>\r\n<p>The patient is a 50-year-old gentleman who presented to the emergency room with signs and symptoms of acute appendicitis with possible rupture. He has been brought to the operating room. An infraumbilical incision was made which a 5-mm VersaStep trocar was inserted. A 5-mm 0- degree laparoscope was introduced. A second 5-mm trocar was placed suprapubically and a 12-mm trocar in the left lower quadrant. A window was made in the mesoappendix using blunt dissection with no rupture noted. The base of the appendix was then divided and placed into an Endo-catch bag and the 12-mm defect was brought out. Select the appropriate code for this visit:</p>\r\n</blockquote>', '44970', '44950', '44960', '44979', '2022-06-04 07:43:52', '2022-06-04 07:43:52', 'ans_a'),
(491, 6, 19, 1, '<p>A 52-year-old patient is admitted to the hospital for chronic cholecystitis for which a laparoscopic cholecystectomy will be performed. A transverse infraumbilical incision was made sharply dissecting to the subcutaneous tissue down to the fascia using access under direct vision with a Vesi-Port and a scope was placed into the abdomen. Three other ports were inserted under direct vision. The fundus of the gallbladder was grasped through the lateral port, where multiple adhesions to the gallbladder were taken down sharply and bluntly: The gallbladder appeared chronically inflamed. Dissection was carried out to the right of this identifying a small cystic duct and artery, was clipped twice proximally, once distally and transected. The gallbladder was then taken down from the bed using electrocautery, delivering it into an endo-bag and removing it from the abdominal cavity with the umbilical port. What CPT and ICD-10 codes should be reported?</p>', '47564, K80.18', '47562, K81.1', '47610, K80.64', '47600, K81.9', '2022-06-06 06:43:49', '2022-06-06 06:43:49', 'ans_b'),
(492, 6, 19, 1, '<p>34-year-old male developed a ventral hernia when lifting a 60 pound bag. The patient is in surgery for a ventral herniorrhaphy. The abdomen was entered through a short midline incision revealing the fascial defect. The hernia sac and contents were able to easily be reduced and a large plug of mesh was placed into the fascial defect. The edge of the mesh plug was sutured to the fascia. What procedure code(s) should be used?</p>', '49591', '49593', '49595', '49592', '2022-06-06 06:44:50', '2023-04-17 08:51:56', 'ans_a'),
(493, 6, 19, 1, '<p>A 70-year-old female who has a history of strangulated ventral hernia was advised to undergo laparoscopic evaluation and repair. An incision was made in the epigastrium and dissection was carried down through the subcutaneous tissue. Two 5-mm trocars were placed, one in the left upper quadrant and one in the left lower quadrant and the laparoscope was inserted. Dissection was carried down to the area of the hernia where a small defect was clearly visualized. There was some omentum, which was adhered to the hernia and this was delivered back into the peritoneal cavity. The mesh was tacked on to cover the defect. What procedure code(s) should be used?</p>', '49594', '49591', '49595', '49562', '2022-06-06 06:45:57', '2023-04-17 08:54:41', 'ans_b'),
(494, 6, 19, 1, '<p>A 67-year-old male patient is referred for a flex sigmoidoscopy exam to remove polyps. The physician found three polyps in the rectosigmoid junction. They were removed by hot biopsy forceps. The path report indicated the polyps were benign. Code the encounter.</p>', '45333', '45315', '45384', '45346', '2022-06-06 06:47:12', '2022-06-06 06:47:12', 'ans_a'),
(495, 6, 19, 1, '<p>A laparoscopic assisted total hysterectomy is planned for a patient who has severe intramural fibroids. After inserting the laparoscope, extensive adhesions are noted to the extent that the ligaments supporting the uterus cannot be visualized. The physician decides to convert the procedure to an open abdominal hysterectomy in which the uterus and cervix are removed. What CPT&reg; code(s) should be reported?</p>', '58262, 58570-53', '58150', '58260, 58550-22', '58570', '2022-06-06 06:49:18', '2022-06-06 06:49:18', 'ans_b'),
(496, 6, 19, 1, '<p>Patient has consented for further testing to determine the extent of her cervical dysplasia. A cervical cone biopsy of endocervical tissue was cut using a laser. It was tagged with a single stitch. Dilation and curettage was performed. Small amount of tissue was obtained and sent to pathology.&nbsp; Which procedure code(s) should be used?</p>', '57520, 58120', '57461', '57520', '57500, 57505', '2022-06-06 07:33:47', '2022-06-06 07:33:47', 'ans_c'),
(497, 6, 19, 1, '<p>A 46-year-old female with history of cervical carcinoma underwent placement of an ileal conduit, with subsequent development of left hydronephrosis. A retrograde ureteral catheter was recently placed. She returns today for catheter exchange. Patient was placed in the supine position. The ileal conduit was accessed. The existing catheter was removed over a guidewire and replaced with a similar 10 French 50 cm long locking pigtail catheter. Contrast was injected for monitoring, confirming good position of the catheter placement. IMPRESSION: Left retrograde ureteral catheter exchange via the ileal conduit.</p>', '50435', '50693', '50385', '50688, 75984-26', '2022-06-06 07:35:40', '2022-06-06 07:35:40', 'ans_d');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(498, 6, 19, 1, '<p>45-year-old male is going to donate his kidney to his son. Operating ports where placed in standard position and the scope was inserted. Dissection of the renal artery and vein was performed isolating the kidney. The kidney was suspended only by the renal artery and vein as well as the ureter. A stapler was used to divide the vein just above the aorta and three clips across the ureter, extracting the kidney. This was placed on ice and sent to the recipient room. The correct CPT code is:</p>', '50543', '50547', '50300', '50320', '2022-06-06 07:37:30', '2022-06-06 07:37:30', 'ans_b'),
(499, 6, 19, 1, '<p>16-day&nbsp;old male baby is in the OR for a repeat circumcision due to redundant foreskin that caused circumferential scarring from the original circumcision. Anesthetic was injected and an incision was made at base of the foreskin. Foreskin was pulled back and the excess foreskin was taken off and the two raw skin surfaces were sutured together to create a circumferential anastomosis. Select the appropriate code for this surgery:</p>', '54150', '54160', '54163', '54164', '2022-06-06 07:39:10', '2022-07-26 06:34:22', 'ans_c'),
(500, 6, 19, 1, '<p>5-year-old male with a history of prematurity was found to have penile curvature, congenital hypospadias. He presents for surgical management for straightening the curvature. Under general anesthesia, bands were placed around the base of the penis and incisions were made degloving the penis circumferentially. The foreskin was divided in Byers flaps and the penile skin was reapproximated at the 12 o&rsquo;clock position. Two Byers flaps were reapproximated, recreating a mucosal collar which was then criss- crossed and trimmed in the midline in order to accommodate median raphe reconstruction. This was reconstructed with use of a horizontal mattress suture. The shaft skin was then approximated to the mucosal collar with sutures correcting the defect. Which CPT code should be used?</p>', '54304', '54340', '54360', '54440', '2022-06-06 07:40:17', '2022-06-06 07:40:17', 'ans_a'),
(501, 6, 19, 1, '<p>An injection is performed to anesthetize a nerve located between two ribs to block chest wall pain. Which nerve injection code is reported?</p>', '64415', '64421', '64400', '64420', '2022-06-06 07:41:26', '2022-08-02 07:45:58', 'ans_d'),
(502, 6, 19, 1, '<p>A 65-year-old patient presented with ectropion of the right lower eyeliD. Repair with tarsal wedge excision is performed for correction. Attention was then directed to the left eye. The patient also had an ectropion of the left lower lid, which was repaired by suture. Code this procedure.</p>', '67916-50', '67916-E4, 67914-E2', '67914-50', '67923-E4, 67921-E2', '2022-06-06 07:43:04', '2022-06-06 07:43:04', 'ans_b'),
(503, 6, 19, 1, '<p>A 42-year-old patient was in the hosptial three days ago in which a lumbar puncture was preformed to find the etiology of the patient&rsquo;s headaches. Today he is in the neurology clinic because after having the lumbar puncture the headaches have increased in intensity over the past three days. The neurologist examines the patient and finds a CSF leak from the lumbar puncture. A blood patch is performed by epidural injection to repair the leak. Code the service(s) for today&rsquo;s visit.</p>', '62272', '62273', '62270, 62273', '62270, 62282', '2022-06-06 07:44:07', '2022-06-06 07:44:07', 'ans_b'),
(504, 6, 19, 1, '<p>A 63-year-old woman presented to the eye clinic as with symptoms of flashing lights and floaters in the right eye for two days. The ophthalmologist dilates her eyes and checking her with an indirect ophthalmoscope, revealing peripheral retinal break. The physician explains to the patient that there is a high likelihood of retinal detachment. The patient agrees to have the procedure done. The physician lasers the retinal tear and tells the patient to come back in 24 hours for follow-up. Code this visit.</p>', '67210', '67145', '67220', '67141', '2022-06-06 07:45:23', '2022-06-06 07:45:23', 'ans_b'),
(505, 6, 19, 1, '<p>A 58-year-old female has lumbar degenerative spondylolisthesis with severe stenosis and instability. The spinous process of L4 and L5 are decompressed bilaterally by performing a laminectomies, right-sided forminotomies and then left-sided facetectomy completely decompressing the nerve roots as well as the dura. How is this procedure reported?</p>', '63047, 63048', '63030-50, 63035-50', '63017', '63047-50, 63048-50', '2022-06-06 07:47:06', '2022-06-06 07:47:06', 'ans_a'),
(506, 6, 19, 1, '<p>Physician is performing an intracapsular cataract extraction. The anterior chamber of the eye is entered performing an anterior capsulotomy using forceps. The lens nucleus was hydrodissected and loosened. Using phacoemulsification unit, the lens nucleus was divided and emulsified. Cortical and capsular fragments were removed. The anterior chamber and capsule bag inflated. Using lens inserter an intraocular lens prosthesis, Cystalens, was inserted and rotated to the horizontal position. Topical solution applied, conjunctiva repositioned over the wound with wet field cautery and patch applied. Which CPT&reg; code(s) should be reported?</p>', '66984, 66985', '66983, 66985', '66985', '66983', '2022-06-06 07:48:11', '2022-06-06 07:48:11', 'ans_d'),
(507, 6, 19, 1, '<p>Mrs. Smith was seen by her family physician, Dr. Marks. Mrs. Smith complains she has had a sore throat, breathing problems, and a fever for five days. She is a diabetic patient and has been taking over-the-counter medications that have interfered with her insulin medication. Dr. Marks documented a medically appropriate&nbsp;history &amp; examination. Dr. Marks spent 35 minutes with the patient during the examination. How should the physician report this service?</p>', '99215', '99204', '99205', '99214', '2022-06-06 07:49:21', '2023-10-04 02:03:49', 'ans_d'),
(508, 6, 19, 1, '<p>Dr. Gavin, a pediatrician, continues to follow Baby Girl Laura, who is not critically ill but requires intensive observation for lung function and respiratory and oxygen monitoring. Laura is 14 days old with a current weight of 1,200 grams. Dr. Gavin initially provided care on Monday. He continued to see her on Tuesday and Wednesday. How should Dr. Gavin report all three days of care?</p>', '99468 x 3', '99460, 99479 x 2', '99477 x 3', '99477, 99478 x 2', '2022-06-06 07:50:20', '2022-06-06 07:50:20', 'ans_d'),
(509, 6, 19, 1, '<p>Bill, a retired U.S. Air Force pilot, was on observation status 7&nbsp;hours to assess the outcome of a fall from the back of a pickup truck into a gravel pit. The physician discharged Bill from observation that same day after determining that no further monitoring of his condition was necessary. The physician provided a comprehensive history and examination and spent 60 minutes with the patient.</p>', '99221, Z04.9, W18.30XA', '99234, Z04.3, W18.30XA', '99222, Z04.3, W17.2XXA', '99234, 99217, Z04.3, W17.2XXA', '2022-06-06 07:54:06', '2023-05-31 04:51:57', 'ans_c'),
(510, 6, 19, 1, '<p>Dr. Martin admits a 65-year-old patient to the hospital with acute pericarditis following a severe viral infection. The patient has complained of retrosternal, sharp, intermittent pain of 2 days&#39; duration that is reduced by sitting up and leaning forward, accompanied by tachypnea. The physician completes a comprehensive history and physical examination. The physician ordered an electrocardiogram, x-rays, and routine laboratory workup. The physician considers the multiple diagnoses of pericarditis following infection, unstable angina, dissecting aneurysm, pulmonary infarction, or esophageal disease, indicating a high level of medical decision making complexity.</p>', '99236, R07.2, R06.82', '99223, I30.0, I20.0, I72.9, I26.99, K22.9', '99245, I30.0, I20.0, I72.9, I26.99, K22.9', '99223, R07.2, R06.82', '2022-06-06 07:55:26', '2022-06-06 07:55:26', 'ans_d'),
(511, 6, 19, 1, '<p>A 57-year-old male was sent by his family physician to a urologist for an office consultation. The patient has had bright red blood in his urine sporadically for the past 3 weeks. The urologist obtains a medically appropriate history from the patient and continues with physical examination. The urologist recommends a cystoscopy to be scheduled for the following week and discusses the procedure and risks with the patient. The physician spent a total time of 45 mins with the patient.&nbsp;The urologist report back his opinion with refering physican. Report the CPT code for the service.</p>', '99244-57', '99244-57, 52000', '99244', '99253', '2022-06-06 07:56:49', '2023-10-09 02:19:50', 'ans_c'),
(512, 6, 19, 1, '<p>A 56-year-old new male patient presents to his family physician for AWV&nbsp;at the local outpatient clinic. The physician conducts a detailed history and physical examination and anticipatory guidance was discussed, and the checkup takes 45 minutes.</p>', '99214', '99403', '99386', '99396', '2022-06-06 07:58:01', '2023-10-05 02:59:34', 'ans_c'),
(513, 6, 19, 1, '<p>A healthy 45-year-old is having a needle thyroid biopsy. The anesthesiologist begins to prepare the patient for surgery at 09:00 am. The surgery begins at 09:15 am and ends at 09:45 am. The anesthesiologist turns over the patient&rsquo;s care to the recovery room nurse at 10:00 am. Which is the appropriate anesthesia code and what is the anesthesia time?&nbsp;&nbsp;&nbsp;&nbsp;</p>', '00320, One hour', '00320, 45 minutes', '00322, 45 minutes', '00322, One hour', '2022-06-06 07:59:28', '2022-06-06 07:59:28', 'ans_d'),
(514, 6, 19, 1, '<p>The anesthesiologist performed MAC (monitored anesthesia care) for a patient undergoing an arthroscopy of the right knee. Code the anesthesia service.</p>', '01382-AA', '01382-AA-QS', '01400-AA', '01400-AA-QS', '2022-06-06 08:00:54', '2022-06-06 08:00:54', 'ans_b'),
(515, 6, 19, 1, '<p>General anesthesia is administered to a 9-month-old undergoing a tracheostomy. Code the anesthesia service.</p>', '00320, 99100', '00320', '00326', '00326, 99100', '2022-06-06 08:02:10', '2022-06-06 08:02:10', 'ans_c'),
(516, 6, 19, 1, '<p>A 6-month-old patient is administered general anesthesia to repair a cleft palate. What anesthesia code(s) should be used for this procedure?</p>', '00170, 99100', '00172', '00172, 99100', '00176', '2022-06-06 08:03:30', '2022-06-06 08:03:30', 'ans_c'),
(517, 6, 19, 1, '<p>This patient is suffering from primary lung cancer and is in for a follow-up CT scan of the thorax with contrast material. Code the physician component only.</p>', '71250-26, C78.00', '71260, C34.90', '71260-26, C34.90', '71250-26, D49.1', '2022-06-06 08:05:31', '2022-06-23 09:48:50', 'ans_c'),
(518, 6, 19, 1, '<p>A patient had a whole-body thyroid carcinoma metastases imaging with uptake completed. Select the appropriate codes to report the professional services.</p>', '78015-26, 78003-26', '78010, 78020', '78010, 78020', '78018-26, 78020-26', '2022-06-06 08:07:06', '2022-06-06 08:07:06', 'ans_d'),
(519, 6, 19, 1, '<p>76-year-old female had a ground level fall when she tripped over her dog earlier this evening in her apartment. The Emergency Department took x-rays of the wrist in oblique and lateral views which revealed a displaced distal radius fracture, grade I open right wrist. What radiological service and ICD-9 codes should be reported?</p>', '73100-26, S52.509B, W01.0XXA, Y92.039', '73110-26, S52.501B, W01.10XA, Y92.039', '73115-26, S52.509A, W01.0XXA, Y92.039', '73100-26, S52.501B, W01.0XXA, Y92.039', '2022-06-06 08:10:05', '2022-06-06 08:10:05', 'ans_d'),
(520, 6, 19, 1, '<p>The patient is 15 weeks pregnant with twins coming back to her obstetrician to have a transabdominal ultrasound performed to reassess anatomic abnormalities of both fetuses that were previously demonstrated in the last ultrasound. What code(s) should be used for this procedure?</p>', '76815', '76816, 76816-59', '76801, 76802', '76805, 76810', '2022-06-06 08:11:10', '2022-06-06 08:11:10', 'ans_b'),
(521, 6, 19, 1, '<p>56-year-old female is having a bilateral mammogram with computer aid detection conducted as a screening since the patient has had a previous cyst in the right breast. What radiological services are reported?</p>', '77065', '77066', '77067', '77066, G0279', '2022-06-06 08:12:24', '2022-06-06 08:12:24', 'ans_c'),
(522, 6, 19, 1, '<p>A CT density study is performed on a post-menopausal female to screen for osteoporosis. Today&rsquo;s visit the bone density study will be performed on the spine. Which CPT code should be used?</p>', '77075', '77080', '77078', '72010', '2022-06-06 08:16:11', '2022-06-06 08:16:11', 'ans_c'),
(523, 6, 19, 1, '<p>Select the appropriate code for non automated urinalysis for glucose and ketones in a diabetic patient. Microscope was not used for the study.</p>', '81005', '81015', '81000', '81002', '2022-06-06 08:17:11', '2022-06-06 08:17:11', 'ans_d'),
(524, 6, 19, 1, '<p>A screening stool guaiac was ordered by the physican to confirm the presence of blood in the stool. The patient was provided with a single triple card to obtain three consecutive stool specimens and send the same to the physician office for performance of the test. Select the appropriate code for this service.</p>', '82271', '82272', '82270', '82274', '2022-06-06 08:18:46', '2022-06-06 08:18:46', 'ans_c'),
(525, 6, 19, 1, '<p>The physician ordered a sweat chloride test in a 12 year old male suspected with cystic fibrosis. Sweat was obtained from the forearm by pilocarpine iontophoresis. It was then analyzed for chloride content. Select the appropriate code for this service.</p>', '82435', '89230, 82435', '89230, 82438', '82438', '2022-06-06 08:19:59', '2022-06-06 08:19:59', 'ans_c'),
(526, 6, 19, 1, '<p>Select the appropriate code for pathological fracture examination of curettings obtained from the Femur. Decalcification of the specimen was also done for proper evaluation.</p>', '88304, 88311', '88307, 88311', '88307, 88311, 88312', '88305, 88312', '2022-06-06 08:21:09', '2022-06-06 08:21:09', 'ans_b'),
(527, 6, 19, 1, '<p>This patient is in for a kidney biopsy (50200) because a mass was identified by ultrasound. The specimen is sent to pathology for gross and microscopic examination.</p>\r\n\r\n<p>Report the technical and professional components for this service. The results were inconclusive.</p>', '88305-26, N28.9', '88307-26, N28.89', '88307, N28.9', '88305, N28.9', '2022-06-06 08:22:19', '2022-06-06 08:22:19', 'ans_d'),
(528, 6, 19, 1, '<p>This 69-year-old female presents to the laboratory after her physician ordered troponin, quantitative, and troponin, qualitative assay, to assist in the diagnosis of her chief complaint of acute onset of chest pain.</p>', '84484, 80299, R07.2', '84512, 84484, 80299, R07.89', '84484, 84512, R07.9', '84484, 84512, R07.89', '2022-06-06 08:23:43', '2022-06-06 08:23:43', 'ans_c'),
(529, 6, 19, 1, '<p>10-year-old patient had a recent placement of a chochlear implant. She and her family see an audiologist to check the pressure and determine the strength of the magnet. The transmitter, microphone and cable are connected to the external speech processor and maximum loudness levels are determined under programming computer control. Which CPT&reg; code should be used?</p>', '92601', '92603', '92562', '92626', '2022-06-06 08:25:21', '2022-06-06 08:25:21', 'ans_b'),
(530, 6, 19, 1, '<p>A new patient is having a cardiovascular stress test done in his cardiologist&rsquo;s office. Before the test is started the physician documents a comprehensive history and exam and moderate complexity medical decision making. The physician will be supervising and interpreting the stress on the patient&rsquo;s heart during the test. What procedure code should be documented for this encounter?</p>', '93015-26, 99204-25', '93016, 93018, 99204-25', '93015, 99204-25', '93018-26, 99204-25', '2022-06-06 08:26:51', '2022-06-06 08:26:51', 'ans_c'),
(531, 6, 19, 1, '<p>A cardiologist pediatrician sends a four-week-old baby to an outpatient facility to have an echocardiogram. The baby has been having rapid breathing. He is sedated and a probe is placed on the chest wall and images are taken through the chest wall. A report is generated and sent to the pediatrician. The interpretation of the report by the pediatrician reveals the baby has an atrial septal defect. Choose the CPT&reg; code the cardiologist pediatrician should report.</p>', '93303', '93315-26', '93303-26', '93315', '2022-06-06 08:28:27', '2022-09-27 06:45:12', 'ans_c'),
(532, 6, 19, 1, '<p>A cancer patient is coming in to have a chemotherapy infusion. The physician notes the patient is dehydrated and will first administer a hydration infusion. The infusion time was 1 hour and 30 minutes. Select the code(s) that should be reported for this encounter?</p>', '96360', '96360, 96361', '96365, 96366', '96422', '2022-06-06 08:32:03', '2022-06-06 08:32:03', 'ans_a'),
(533, 6, 19, 1, '<p>A patient that has multiple sclerosis has been seeing a therapist for four visits. In today&rsquo;s visit the therapist will be performing a comprehensive reevaluation to determine the extent of progress in parameters and whether the patient is reaching his goals for common impairments associated with this neurologic condition, which includes performing activities of daily living, movement, muscle strength and reasoning abilities for independent living and revise the treatment plan accordingly. What CPT&reg; and ICD-10-CM codes should be reported?</p>', '97168, Z51.89, G35', '97165, Z51.89, G35', '97167, Z51.89, G35', '97164, Z56.89, G35', '2022-06-06 08:33:07', '2022-06-06 08:33:07', 'ans_a'),
(534, 6, 19, 1, '<p>Patient with hemiparesis on the dominant side due to having a CVA lives at home alone and has a therapist at his home site to evaluate meal preparation. The therapist observes the patient&rsquo;s functional level of performing kitchen management activities within safe limits. The therapist then teaches meal preparation using one handed techniques along with adaptive equipment to handle different kitchen appliances. The total time spent on this visit was 45 minutes. Report the CPT&reg; and ICD-10-CM codes for this encounter.</p>', '97530 x 3, I67.89 G81.91', '97535 x 3, G81.91, I69.951', '97530 x 3, I69.951, I67.89', '97535 x 3, I69.951', '2022-06-06 08:34:26', '2022-06-06 08:34:26', 'ans_d'),
(535, 6, 19, 1, '<p>Oophor/o word root is for:</p>', 'Uterus', 'Fallopian tubes', 'Ovary', 'Testis', '2022-06-06 08:35:24', '2022-06-06 08:35:24', 'ans_c'),
(536, 6, 19, 1, '<p>Standard prone position</p>', 'Lies with chest down and back up', 'Legs up', 'Standing erect straight', 'Palm of the hands facing inferior', '2022-06-06 08:36:28', '2022-06-06 08:36:28', 'ans_a'),
(537, 6, 19, 1, '<p>Pyemia means:</p>', 'Infection in the blood', 'Pus in the blood', 'Lack of WBC', 'Pus in lungs', '2022-06-06 08:37:40', '2022-06-06 08:37:40', 'ans_b'),
(538, 6, 19, 1, '<p>Ecto means:</p>', 'Inside', 'Forward', 'Downward', 'Outside', '2022-06-06 08:39:02', '2022-06-06 08:39:02', 'ans_d'),
(539, 6, 19, 1, '<p>A part of the small intestine</p>', 'A part of the small intestine', 'Descending colon', 'Jejunum', 'Rectum', '2022-06-06 08:42:34', '2022-06-06 08:42:34', 'ans_c'),
(540, 6, 19, 1, '<p>Part of the appendicular skeleton</p>', 'Sternum', 'Clavicle', 'Cervical', 'Ribs', '2022-06-06 08:44:55', '2022-06-06 08:44:55', 'ans_b'),
(541, 6, 19, 1, '<p>Brachii triceps are muscles of:</p>', 'Lower extremity, foot', 'Upper extremities', 'Spine', 'Thorax', '2022-06-06 08:46:23', '2022-06-06 08:46:23', 'ans_b'),
(542, 6, 19, 1, '<p>Channel between pharynx and middle ear:</p>', 'Ear canal', 'Eustachian Tube', 'Middle ear', 'Pinna', '2022-06-06 08:47:43', '2022-06-06 08:47:43', 'ans_b'),
(543, 6, 19, 1, '<p>44-year-old had a history of adenocarcinoma of the cervix on a conization in March 20XX who has been followed with twice-yearly endocervical curettages and Pap smears that were all negative for two years, per the recommendation of a GYN oncologist. Her Pap smear results from the last visit noted atypical glandular cells. In light of this, she underwent a colposcopy and the biopsy of the normal-appearing cervix on colposcopy was benign. The endocervical curettage was benign endocervical glands, and the endometrial sampling was benign endometrium. In light of the fact that she had had previous atypical glandular cells that led to diagnosis of adenocarcinoma and the concerns that this may have recurred, she had been recommended for a cone biopsy and fractional dilatation and curettage, which she is undergoing today. What ICD-10-CM code(s) should be reported?</p>', 'R87.619, C53.9', 'D39.0', 'R87.619  Z85.41', 'Z12.4, Z85.41', '2022-06-06 08:49:21', '2022-06-06 08:49:21', 'ans_c'),
(544, 6, 19, 1, '<p>Patient comes in to see her primary care physician for a productive cough and shortness of breath. The physician takes a chest x-ray which indicates the patient has congestive pneumonia. Select the ICD-10-CM code(s) for this visit.</p>', 'J18.9,R05.9, R06.02', 'R05.9, R06.02, J18.9', 'J18.9', 'J18.0', '2022-06-06 08:51:21', '2023-04-14 08:12:34', 'ans_c'),
(545, 6, 19, 1, '<p>What is the correct way to code a patient having bradycardia due to Demerol that was correctly prescribed and properly administered?</p>', 'T40.2X4A, R00.1, T40.2X5A', 'T50.995A, R00.1', 'R00.1, T40.2X5A', 'T40.2X4A, R00.1, T40.2X1A', '2022-06-06 08:53:03', '2022-06-06 08:53:03', 'ans_c'),
(546, 6, 19, 1, '<p>27-year-old was frying chicken when an explosion of the oil had occurred and she sustained second-degree burns on her face (3%), third degree burns on both hands (4%), and second degree burns on her lower left arm (3%). There was a total of 10 percent of the body surface that was burned. Select which ICD-10-CM codes should be used.</p>', 'T20.20XA, T23.309A, T22.20XA, T31.10, X12.XXXA', 'T23.309A, T20.20XA, T22.20XA, T31.10, X12.XXXA', 'T23.309A, T20.20XA, T22.219A, T31.10, X12.XXXA', 'T23.309A, T30.0, T31.0, X12.XXXA', '2022-06-06 08:54:37', '2022-06-06 08:54:37', 'ans_c'),
(547, 6, 19, 1, '<p>A patient that has cirrhosis of the liver just had an endoscopy performed showing hemorrhagic esophageal varices. The ICD-10-CM codes should be reported:</p>', 'I85.11, K74.60', 'I85.10, K74.60', 'K74.60, I85.11', 'I85.01, K74.60', '2022-06-06 08:59:29', '2022-06-06 08:59:29', 'ans_c'),
(548, 6, 19, 1, '<p>Which modifier is used to describe a CLIA waived test?</p>', 'QP', 'QW', 'GA', 'SG', '2022-06-06 09:04:46', '2022-06-06 09:04:46', 'ans_b'),
(549, 6, 19, 1, '<p>Which of the following is the correct HCPCS code for 250 mg of Cyclosporin, parenteral?</p>', 'J7502', 'J7516', 'K0121', 'J7515', '2022-06-06 09:05:51', '2022-06-06 09:05:51', 'ans_b'),
(550, 6, 19, 1, '<p>What is the HCPCS code for wound closure using tissue adhesive(s) only?</p>', 'A6250', 'G0168', 'A6265', 'G0170', '2022-06-06 09:06:53', '2022-06-06 09:06:53', 'ans_b'),
(551, 6, 19, 1, '<p>The Medicare program is made up of several parts. Which part is most</p>\r\n\r\n<p>significant to coders working in physician offices and covers physician fees</p>\r\n\r\n<p>without the use of a private insurer?</p>', 'Part A', 'Part B', 'Part C', 'Part D', '2022-06-06 09:28:00', '2022-06-06 09:28:00', 'ans_b'),
