(561, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.</p>\r\n\r\n<p>PROCEDURE: Suction D&amp;C.</p>\r\n\r\n<p>The patient was prepped and draped in a lithotomy position under general mask anesthesia, and the bladder was straight catheterized; a weighted speculum was placed in the vagina. The anterior lip of the cervix was grasped with a single-tooth tenaculum. The uterus was then sounded to a depth of 8 cm. The cervical os was then serially dilated to allow passage of a size 10 curved suction curette. A size 10 curved suction curette was then used to evacuate the intrauterine contents. Sharp curette was used to gently palpate the uterine wall with negative return of tissue, and the suction curette was again used with negative return of tissue. The tenaculum was removed from the cervix. The speculum was removed from the vagina. All sponges and needles were accounted for at completion of the procedure. The patient left the operating room in apparent good condition having tolerated the procedure well. Pathology report indicated benign polyp.</p>', '59812, O03.9', '59812, O07.4', '59820, O02.1', '59856, O02.1', '2022-06-06 09:42:18', '2022-06-06 09:42:18', 'ans_c'),
(562, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Right ureteral stricture.</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Right ureteral stricture.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy, right ureteral stent change.</p>\r\n\r\n<p>PROCEDURE NOTE: The patient was placed in the lithotomy position after receiving IV sedation. He was prepped and draped in the lithotomy position. The 21 French cystoscope was passed into the bladder, and urine was collected for culture Inspection of the bladder demonstrated findings consistent with radiation cystitis, which has been previously diagnosed. There is no frank neoplasia. The right ureteral stent was grasped and removed through the urethral meatus; under fluoroscopic control, a guide wire was advanced up the stent, and the stent was exchanged for a 7 French 26-cm stent under fluoroscopic control in the usual fashion. The patient tolerated the procedure well.</p>', '51702-LT, N13.5', '51702-RT, N30.90', '52332-RT, N30.90', '52332-RT, N13.5', '2022-06-06 09:44:28', '2022-06-06 09:44:28', 'ans_d'),
(563, 6, 19, 1, '<p>This patient is a 52-year-old female who has been having prolonged and heavy bleeding.</p>\r\n\r\n<p>SURGICAL FINDINGS: On pelvic exam under anesthesia, the uterus was normal size and firm. The examination revealed no masses. She had a few small endometrial polyps in the lower uterine segment.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: After induction of general anesthesia, the patient was placed in the dorsolithotomy position, after which the perineum and vagina were prepped, the bladder straight catheterized, and the patient draped. After bimanual exam was performed, a weighted speculum was placed in the vagina and the anterior lip of the cervix was grasped with a single toothed tenaculum. An endocervical curettage was then done with a Kevorkian curet. The uterus was then sounded to 8.5 cm. The endocervical canal was dilated to 7 mm with Hegar dilators. A 5.5-mm Olympus hysteroscope was introduced using a distention medium. The cavity was systematically inspected, and the preceding findings noted. The hysteroscope was withdrawn and the cervix further dilated to 10 mm. Polyp forceps was introduced, and a few small polyps were removed. These were sent separately. Sharp endometrial curettage was then done. The hysteroscope was then reinserted, and the polyps had essentially been removed. The patient tolerated the procedure well and returned to the recovery room in stable condition (Pathology confirmed benign endometrial polyps). Pathology confirmed benign endometrial polyps.</p>', '58558, 57460-51, N92.0, N84.0', '58558, N92.0, N84.0', '58558, 57558-51, N92.0, N84.0', '58558, N92.1, D49.5', '2022-06-06 09:45:50', '2022-06-06 09:45:50', 'ans_b'),
(564, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Possible recurrent transitional cell carcinoma of the bladder.</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Bladder tumor 2cm.</p>\r\n\r\n<p>PROCEDURE PERFORMED: TURBT.</p>\r\n\r\n<p>PROCEDURE NOTE: The patient was given a general mask anesthetic, prepped, and draped in the lithotomy position. The 21 French cystoscope was passed into the bladder. Tumor was removed and sent for biopsy. Random 4 biopsies of the bladder were also performed. A catheter was left at the end of the procedure. The patient tolerated the procedure well and was transferred to the recovery room in good condition. The palthology report indicated no evidence of recurrence.</p>', '52224, Z85.51', '51020, 52204, Z80.59', '52234, D49.4, Z85.51', '52234, 52224 × 4, D41.4', '2022-06-06 09:47:08', '2022-08-03 06:15:54', 'ans_c'),
(565, 6, 19, 1, '<p>This 41-year-old female presented with a right labial lesion. A biopsy was taken, and the results were reported as VIN-III, cannot rule out invasion. The decision was therefore made to proceed with wide local excision of the right vulva.</p>\r\n\r\n<p>PROCEDURE: The patient was taken to the operating room, and general anesthesia was administered. The patient was then prepped and draped in the usual manner in lithotomy position, and the bladder was emptied with a straight catheter. The vulva was then inspected. On the right labium minora at approximately the 11 o&#39;clock position, there was a multifocal lesion. A marking pen was then used to mark out an elliptical incision, leaving a 1-cm border on all sides. The skin ellipse was then excised using a knife. Bleeders were cauterized with electrocautery. A running locked suture of 2-0 Vicryl was then placed in the deeper tissue. The skin was finally re approximated with 4 0 Vicryl in an interrupted fashion. Good hemostasis was thereby achieved. The patient tolerated this procedure well. There were no complications.</p>', '56605, C51.9', '56625, D07.1', '56620, D07.1', '11620, C51.9', '2022-06-06 09:50:16', '2022-06-06 09:50:16', 'ans_c'),
(566, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Fever.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Lumbar puncture.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was placed in the lateral decubitus position with the left side up. The legs and hips were flexed into the fetal position The lumbosacral area was sterilely prepped. It was then numbed with 1% Xylocaine. I then placed a 22-gauge spinal needle on the first pass into the intrathecal space between the L4 and L5 spinous processes. The fluid was minimally xanthochromic. I sent the fluid for cell count for differential, protein, glucose, Gram stain, and culture. The patient tolerated the procedure well without apparent complication. The needle was removed at the end of the procedure. The area was cleansed, and a Band-Aid was placed.</p>', '62272, R68.12', '62268, R50.9', '62272, R60.9, R50.9', '62270, R50.9', '2022-06-06 09:52:19', '2022-06-06 09:52:19', 'ans_d'),
(567, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Herniated disk L4-5 on the left.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Laminotomy, foraminotomy, removal of herniated disk L4-5 on the left.</p>\r\n\r\n<p>PROCEDURE: Under general anesthesia, the patient was placed in the prone position and the back was prepped and draped in the usual manner. An incision was made in the skin extending through subcutaneous tissue. Lumbodorsal fascia was divided. The erector spinae muscles were bluntly dissected from the lamina of L4-5 on the left. The interspace was localized. I then performed a generous laminotomy and foraminotomy here, and retracted on the nerve root. It was obvious there was a herniated disk. I removed it, entered the space, and removed degenerating material, satisfied that I had decompressed the root well. There were free fragments lying around beneath the nerve root. We removed all of these. I was able to pass a hockey stick down the foramen across the midline, satisfied I had taken out the large fragments from the interspace at L4-5, and decompressed it well. I irrigated the wound well, put a Hemovac drain in the wound, and then closed the wound in layers using doubleknotted 0 chromic on the lumbodorsal fascia with Vicryl, 2-0 plain in the subcutaneous tissue and surgical staples on the skin. A dressing was applied. The patient was discharged to the recovery room.</p>', '63030-LT, M51.26', '63012-LT, M51.46', '63047-LT, M51.46', '63047-LT, 63048-LT, M51.26', '2022-06-06 09:53:44', '2022-06-06 09:53:44', 'ans_a'),
(568, 6, 19, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Brain tumor versus abscess.</p>\r\n\r\n<p>PROCEDURE: Craniotomy.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: Under general anesthesia, the patient&#39;s head was prepped and draped in the usual manner. It was placed in Mayfield pins. We then proceeded with a craniotomy. An inverted U-shaped incision was made over the posterior right occipital area. The flap was turned down. Three burr holes were made.</p>\r\n\r\n<p>Having done this, I then localized the tumor through the burr holes and dura. We then made an incision in the dura in an inverted U-shaped fashion. The cortex looked a little swollen but normal. We then used the localizer to locate the cavity. I separated the gyrus and got right into the cavity and saw pus, which was removed. Cultures were taken and sent for pathology report, which came back later describing the presence of clusters of gram-positive cocci, confirming that this was an abscess. We cleaned out the abscessed cavity using irrigation and suction. The bed of the abscessed cavity was cauterized. Then a small piece of Gelfoam was used for hemostasis. Satisfied that it was dry, I closed the dura. I approximated the scalp. A dressing was applied. The patient was discharged to the recovery room.</p>', '61154, G06.0', '61154, D49.6', '61150, G06.0', '61150, D49.6', '2022-06-06 09:55:10', '2022-06-06 09:55:10', 'ans_c'),
(569, 6, 19, 1, '<p>PREOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna. POSTOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna. OPERATIVE PROCEDURE: Reduction with application external fixator, left wrist fracture FINDINGS: The patient is a 46-year-old right-hand-dominant female who fell off stairs 4 to 5 days ago sustaining an impacted distal radius fracture with possible intraarticular component and an associated ulnar styloid fracture. Today in surgery, fracture was reduced anatomically and an external fixator was applied. PROCEDURE: Under satisfactory general anesthesia, the fracture was manipulated and C-arm images were checked. The left upper extremity was prepped and draped in the usual sterile orthopedic fashion. Two small incisions were made over the second metacarpal and after removing soft tissues including tendinous structures out of the way, drawing was carried out and blunt-tipped pins were placed for the EBI external fixator. The frame was next placed and the site for the proximal pins was chosen. Small incision was made. Subcutaneous tissues were carried out of the way. The pin guide was placed and 2 holes were drilled and blunt-tipped pins placed. Fixator was assembled. C-arm images were checked. Fracture reduction appeared to be anatomic. Suturing was carried out where needed with 4-0 Vicryl interrupted subcutaneous and 4-0 nylon interrupted sutures. Sterile dressings were applied. Vascular supply was noted to be satisfactory. Final frame tightening was carried out. What CPT and ICD-10-CM codes should be reported?</p>\r\n\r\n<p>&nbsp;</p>', '25600-LT, 20692-51', '25605- LT, 20690-51', '25606-LT', '25607-LT', '2022-06-06 09:56:52', '2022-09-27 06:43:47', 'ans_b'),
(570, 6, 19, 1, '<p>PREOPERATIVE DIAGNOSIS: Right scaphoid fracture. TYPE OF PROCEDURE: Open reduction and internal fixation of right scaphoid fracture. DESCRIPTION OF PROCEDURE: The patient was brought to the operating room, anesthesia having been administered. The right upper extremity was prepped and draped in a sterile manner. The limb was elevated, exsanguinated, and a pneumatic arm tourniquet was elevated. An incision was made over the dorsal radial aspect of the right wrist. Skin flaps were elevated. Cutaneous nerve branches were identified and very gently retracted. The interval between the second and third dorsal compartment tendons was identified and entered. The respective tendons were retracted. A dorsal capsulotomy incision was made, and the fracture was visualized. There did not appear to be any type of significant defect at the fracture site. A 0.045 Kirschner wire was then used as a guidewire, extending from the proximal pole of the scaphoid distalward. The guidewire was positioned appropriately and then measured. A 25-mm Acutrak drill bit was drilled to 25 mm. A 22.5-mm screw was selected and inserted and rigid internal fixation was accomplished in this fashion. This was visualized under the OEC imaging device in multiple projections. The wound was irrigated and closed in layers. Sterile dressings were then applied. The patient tolerated the procedure well and left the operating room in stable condition. What code should be used for this procedure?</p>', '25628-RT', '25624-RT', '25645-RT', '25651-RT', '2022-06-06 09:58:16', '2022-06-06 09:58:16', 'ans_a'),
