(605, 6, 50, 1, '<p>Richard Carter has &nbsp;type 1 diabetese with&nbsp;history of poliomyelitis admitted to the hospital for right hip arthroplasty for&nbsp;primary localized osteoarthritis. Provide correct ICD code for this encounter</p>', 'M16.11, E10.9, Z86.12', 'M16.51, E10.9, A80.4', 'M16.11, E10.9, A80.9', 'M16.9, E10.9, B91', '2022-06-07 05:14:06', '2022-11-14 05:59:40', 'ans_a'),
(606, 6, 50, 1, '<p>&nbsp;Ramesh&nbsp;admitted to the hospital for dehydration due to chemotherapy going on for Primary liver cancer. Provide correct Principal and Secondary Diagnosis.&nbsp;</p>', 'E86.0, C78.7', 'E86.0, C22.8', 'C78.7, E86.0', 'C22.8, E86.0', '2022-06-07 05:16:01', '2022-11-14 05:59:55', 'ans_b'),
(607, 6, 50, 1, '<p>Manish went to physicin clinic for a screening colonoscopy. During colonoscopy examination phsycian removed multiple colon polyp. Provide ICD codes in correct sequence&nbsp;</p>', 'Z01.818, K63.5', 'K63.5, Z01.818', 'Z12.11, K63.5', 'K63.5, Z12.11', '2022-06-07 05:16:33', '2022-11-14 06:00:14', 'ans_c'),
(608, 6, 50, 1, '<p>Marry Patel, a 65 years old female has Alzheimer&rsquo;s disease along wtith dementia with wandering. Provide correct Sequence of ICD codes.</p>', 'G30.0, F02.81, Z91.83', 'G30.9, F02.80, Z91.83', 'F02.81, G30.0, Z91.83', 'F02.80, G30.9, Z91.83', '2022-06-07 05:17:08', '2023-02-13 08:23:28', 'ans_a'),
(609, 6, 50, 1, '<p>A patient with systemic inflammatory response syndrome (SIRS) develops acute hepatic failure as a result. How is this reported?</p>', 'R65.11, K72.00', 'R65.20, K72.00', 'K72.00, R65.11', 'A41.9, K72.00', '2022-06-07 05:17:40', '2022-11-14 06:00:54', 'ans_a'),
(610, 6, 50, 1, '<p>Mr John&nbsp;is suffering from&nbsp;tendonitis of right shoulder&nbsp;prescribed&nbsp;naproxen by physician. He feels&nbsp;dizziness and nausea after taking correct dose of prescribed Meds. Provide corect ICD codes for next day visit he makes to physician office.&nbsp;</p>', 'T39.315A, R42, R11.0', 'R42, R11.0, T39.315A', 'T39.314A, R42, R11.0', 'R42, R11.0, T39.314A', '2022-06-07 05:18:08', '2022-11-14 06:01:07', 'ans_b'),
(611, 6, 50, 1, '<p>Physician make desctruction of 15 benign lesion. What will be the correct CPT code for this scenario</p>', '17111x15', '17110, 17111', '17004', '17111', '2022-06-07 05:18:40', '2022-11-14 06:01:21', 'ans_d'),
(612, 6, 50, 1, '<p>Dr Hackerman done biopsy with a curette for patient&nbsp;2 m neck lesion.&nbsp;</p>', '11102', '11104', '11103', '11105', '2022-06-07 05:19:24', '2022-11-14 06:01:45', 'ans_a'),
(613, 6, 50, 1, '<p><strong>Johnson went to visit the dermatologist office. Physician diagnosed both lesions as basal cell carcinoma. The right arm lesion 0.3 cm in diameter with 0.2 cm margins and excised. Another lesion on the left leg measures 1.2 cm in diameter with 0.2 cm margins and excised.</strong></p>', '11602, 11601-51', '11403, 11402-51', '11402, 11401-51', '11603, 11602-51', '2022-06-07 05:19:57', '2023-08-08 00:21:10', 'ans_a'),
(614, 6, 50, 1, '<p>A patient who is under Global period of past procedure returns for a planned delayed flap to repair a defect from the removal of a tumor on the forehead. The formation flap created at the trunk is removed and transferred to the recipient site of the forehead. The graft placed was trimmed and inset into the skin at the distal edge of the wound using 3-0 Vicryl&nbsp;sutures.</p>', '15620-58', '15574-58', '13600-58', '15570-58', '2022-06-07 05:20:30', '2022-11-14 06:03:26', 'ans_a'),
(615, 6, 50, 1, '<p>A Dermatologist&nbsp;finds two malignant lesions on Peter&#39;s scalp and and Arm. Scalp&nbsp;lesion Measure 1.5 cm and arm lesion is&nbsp;2.5 cm. Both Lesion has been removed via&nbsp;cryosurgery (liquid nitrogen).</p>', '17263, 17272-51', '17110', '17000, 17003', '17110x2', '2022-06-07 05:24:30', '2022-11-14 06:03:40', 'ans_a'),
(616, 6, 50, 1, '<p>Martina Hingis&nbsp;has third-degree burns&nbsp;on her upper right thigh&nbsp;and upper arm&nbsp;. An escharotomy is performed on the right thigh with three incisions and two incisions on upper&nbsp;arm.&nbsp;</p>', '16030, 16035, 16036', '16035, 16036', '16035, 16036 x 4', '16030, 16036 x4', '2022-06-07 05:24:59', '2022-11-14 06:03:56', 'ans_c'),
(617, 6, 50, 1, '<p>Kim brought in ED by her parents to repair lacerations on her face and her neck. A 3 cm laceration on her forehead is repaired with a simple repair (Single layer closure with nylon suture). A 2 cm laceration on her chin and 2 cm laceration on her neck also&nbsp;repaired with a simple repair using tissue adhesive. Provide Correct CPT codes for the procedure performed in ED.</p>', '12014', '12013', '12013, 12011-59, 12001-59', '12002', '2022-06-07 05:25:29', '2023-07-06 00:38:23', 'ans_b'),
(618, 6, 50, 1, '<p>Roselina has a stage 4 coccygeal pressure ulcer. Physician make an elliptical incision with a 12-blade scalpel. Ulcerated tissue around the sacrum region down to the bone was removed. The coccyx Was excised to allow draining of the presacral space. Provide correct CPT and ICD&nbsp;</p>', '15922, L89.154', '15922, L98.426', '15920, L89.154', '15820, L98.416', '2022-06-07 05:25:58', '2022-11-14 06:04:37', 'ans_c'),
(619, 6, 50, 1, '<p>James has type 1 diabetes developed diabetic ulcers on his&nbsp;left foot which were debrided and homografted last week. He&nbsp;is scheduled to return to the operating suite for split-thickness auto graft.&nbsp; A graft has been harvested from thigh measuring 135 cm.&nbsp;The skin graft was applied over the wound, measured 125 cm&nbsp;in dimension on his&nbsp;left foot. Provide CPT code for the visit</p>', '15120-58', '15120-58, 15121-58', '15120-78, 15121-78', '15120-78', '2022-06-07 05:26:28', '2022-11-14 06:05:30', 'ans_b'),
(620, 6, 50, 1, '<p>Mohs microscopic surgher has been performed to&nbsp;excise a melanoma from&nbsp;Riht&nbsp;hand in two&nbsp;stages. First&nbsp;stage consist 5&nbsp;tissue blocks and second stage contain 7 tissue blocks. How we need to report this encounter.</p>', '17311, 17312, 17315 x2', '17311, 17315, 17315', '17311, 17312-51, 17315x2-51', '17313, 17314, 17314', '2022-06-07 05:26:58', '2022-11-14 06:05:46', 'ans_a'),
(621, 6, 50, 1, '<p>A patient was diagnosed with carpal tunnel syndrome of the right and left wrists. The pain management physician injected both wrists with a corticosteroid. What CPT&reg; coding is reported?</p>', '20551', '20526', '20526-50', '20551-50', '2022-06-07 05:27:26', '2022-11-14 06:06:07', 'ans_c'),
(622, 6, 50, 1, '<p>A 28-year-old male comes in with a right ring finger abscess. Physician lances the finger with a scalpel, and a small amount of clear fluid is drained. Patient is to return 7-10 days for follow-up. What CPT&reg; code is reported?</p>', '26010-F8', '10060-F8', '10061-F8', '26011-F8', '2022-06-07 05:27:58', '2022-11-14 06:06:28', 'ans_a'),
(623, 6, 50, 1, '<p>Which code is reported for a hip joint injection with contrast under general anesthesia for an arthrography?</p>', '27095', '27096', '20610', '20552', '2022-06-07 05:28:27', '2022-11-14 06:06:42', 'ans_a'),
(624, 6, 50, 1, '<p>A small-bore needle is introduced into the forearm and a muscle biopsy is performed. What CPT&reg; code is reported?</p>', '20206', '20205', '25065', '25066', '2022-06-07 05:29:01', '2022-11-14 06:07:11', 'ans_a'),
(625, 6, 50, 1, '<p>This 40-year-old male presents with infective tenosynovitis of the left hand in the OR. With a sterile approach to the left wrist, an incision is made dissecting down to the tendon sheat and an&nbsp;Incision to the flexor carpi radialis opens the tendon sheath, releasing the fibro-osseous tunnel along the ulnar border of the trapezium. Incisions are repaired in layers. What are the correct CPT&nbsp;and ICD-10-CM codes for this service?</p>', '25001, M65.142', '25001, M65.842', '25000, M65.18', '25024, M65.142', '2022-06-07 05:29:31', '2022-11-14 06:07:27', 'ans_a'),
(626, 6, 50, 1, '<p>A.70-year-old male is complaining of persistent pain in her right shoulder. Magnetic resonance imaging scan of her shoulder is consistent with a tear of the right rotator cuff. There is no history of an injury to the shoulder. Given these clinical findings the patient is taken to the operating room for surgery. A scope Is placed into the subacromial space and the rotator cuff tear{swell visualized. Arthrex 5.0 bioabsorbable suture anchors with #2 Fiber Wire are passed through the rotator cuff tendon in a simple fashion using anchors with excellent fixation into the humeral head. What are the CPT and ICD-10-CM codes?</p>', '23412-RT, M75.101', '29827-RT, M75.101', '23412-RT, S46.001A', '29827-RT, S46.001A', '2022-06-07 05:31:22', '2022-11-14 06:07:42', 'ans_b'),
(627, 6, 50, 1, '<p>Patient presents for excision of two lipomas in his right leg. After satisfactory local anesthesia, a longitudinal skin incision was made, and one lipoma in the subcutaneous tissue of the thigh, measuring 4 cm was sharply dissected from the surrounding subcutaneous tissue. The second lipoma in the subcutaneous tissue of the lower leg, measuring 2.5 cm, was also sharply dissected. After adequate hemostasis, the incisions were closed by using 3-0 Vicryl sutures sub cuticulatly, followed by staples for both incisions. What is the CPT coding?</p>', '27328 RT, 27619-51-RT', '27337-RT', '27634-RT', '27337-RT, 27618.51-RT', '2022-06-07 05:32:02', '2022-11-14 06:07:57', 'ans_d'),
(628, 6, 50, 1, '<p>A 50-year-old male sustained an injury, a ruptured Achilles tendon, when he tripped over another player and fell while playing touch football. The rupture is extensive and there is insufficient length of the tendon to repair. The repair requires a tendon graft. A fascial graft is harvested. Its incorporated at the rupture site and sutured into place. Which procedure code best describes this encounter?</p>', '27665-LT', '27652-LT', '27654-RT', '27650-LT', '2022-06-07 05:33:08', '2022-11-14 06:08:13', 'ans_b'),
(629, 6, 50, 1, '<p>A 70-year-old male has pathological fractures of the C6 and C7 spine due to senile osteoporosis. Vertebroplasty is performed by advancing bone filler devices into the vertebral body anteriorly near the midline and depositing 1.75 mL of radiopaque bone cement on the right and left sides at the C&eacute; level and 5.5 mL at the C7 level on the right and left sides. What CPT&reg; and diagnosis codes are reported?</p>', '22510-50, 22512 x 2, 99143, M80.08XA', '22510, 22512, M80.9XXA, M81.0', '22513, 22515, M80.00XA', '22510, 22512, M80.08XA', '2022-06-07 05:34:24', '2022-11-14 06:09:20', 'ans_d'),
(630, 6, 50, 1, '<p>An elderly female presents with increasing pain in her left dorsal foot. She has a ganglion cyst and a bunion that needs removal. The patient is brought to the operating room and placed under general anesthesia. An incision is made on the dorsal side of the foot. dissection carried down through the subcutaneous tissue, and a ganglion cyst is identified as gelatinous material. It is excised off the tendon and sent to pathology. Then, attention is given to the bunion at the level of the 1st metatarsal of the big toe. The joint capsule is removed exposing the first metatarsal head which is removed completely. Pins and wires are used to maintain the correct position. The wound Is irrigated and closed in layers. What CPT &reg; codes are reported?</p>', '28111, 28090-51', '28100, 28092-51', '28122, 28090-51', '28045, 28092-51', '2022-06-07 05:35:03', '2022-11-14 06:09:38', 'ans_a'),
(631, 6, 50, 1, '<p>An oncologist performs a bone marrow aspiration and a bone marrow biopsy on the right posterior llac spine. The procedures were performed during the same encounter. Select the appropriate coding.</p>', '38221', '38222', '38220', '38221, 38220', '2022-06-07 05:35:55', '2022-11-14 06:09:59', 'ans_b'),
(632, 6, 50, 1, '<p>An ethmoidectomy is performed. Diseased tissue is surgically removed from the anterior and posterior ethmoid sinuses by an intranasal surgical approach. A curette is used to remove the diseased tissue. What CPT&reg; code is reported for the procedure?</p>', '31255', '31201', '31205', '31200', '2022-06-07 05:37:09', '2022-11-14 06:10:21', 'ans_b'),
(633, 6, 50, 1, '<p>The patient is brought to the ED with an obstructed airway. The provider immediately makes an incision through the cricothyroid membrane and inserts a tracheostomy tube to assist the patient&rsquo; breathing. What CPT &reg; code is reported for this scenario?</p>', '31605', '31603', '31600', '31601', '2022-06-07 05:37:53', '2022-11-14 06:10:35', 'ans_a'),
(634, 6, 50, 1, '<p>37-year-old has adenoma of the liver. The tumor is invading the diaphragm. Electrocautery is used to remove part of the diaphragm and repaired primarily with two running 0-Prolenesutures. What CPT&reg; code is reported?</p>', '39540', '39560', '39561', '39545', '2022-06-07 05:38:20', '2022-11-14 06:10:53', 'ans_b'),
(635, 6, 50, 1, '<p>Alymphangiogram is performed for identification of a sentinel node in a patient with early onset of a malignant mastocytoma. Code the condition as well as the injection procedure with lymphatic nuclear medicine and imaging. What are the correct CPT and ICD-10-CM codes?</p>', '38790, 78195, C96.29', '38792, 78195, C96.29', '38500, 38900, 76842, C47.09', '38792, 76842, C85.80', '2022-06-07 05:39:21', '2022-11-14 06:11:09', 'ans_b'),
(636, 6, 50, 1, '<p>Patient has lung cancer in hs lower right lobe. Patient is in the operating suite to have a video-assisted thoracoscopic surgery (VATS). A 10 mm zero-degree thoracoscope was inserted in the right pleural cavity through a port site placed in the sixth intercostal space on the midaxillaryine. Two additional port sites were placed in the fifth intercostal space on the posterior and anterior midaxillary line. Removal ofthe total right lower lobe with the mass is performed thorascopically. Inspection of the lung revealed normal pulmonary parenchyma. After closing the port sites and inserting a chest tube, the patient was extubated and was transferred to the surgical intensive care unit for observation. What CPT&reg; coding is reported?</p>', '32671', '32663, 32601-51', '32480', '32663', '2022-06-07 05:39:52', '2022-11-14 06:11:27', 'ans_d'),
(637, 6, 50, 1, '<p>Malissa, 51 year old female presents for Mediastinoscopy for mediastinal mass. Biopsy of the mass shows cancer. Provide the correct CPT and ICD-10 codes.</p>', '39401, C38.3', '39401 x 4, C38.2', '39402, C38.3', '39402 x 4, C38.3,', '2022-06-07 05:40:36', '2022-11-14 06:11:45', 'ans_a'),
(638, 6, 50, 1, '<p>Patient has lung cancer in his right middle and inferior lobes and is in the OR for a bilobectomy. A thoracotomy is performed, and a rib spreader is used to access the right lung, Removal of the total right middle and inferior lobe with the mass is performed. The incision is closed with staples and the patient is transferred to the surgical intensive care unit for observation. What CPT&reg; code is reported?</p>', '32670', '32482', '32662', '32480', '2022-06-07 05:41:13', '2022-11-14 06:12:04', 'ans_b'),
(639, 6, 50, 1, '<p><strong>Operative Report:</strong></p>\r\n\r\n<p>Preoperative Diagnosis: Lesion in the false vocal cord</p>\r\n\r\n<p>Postoperative Diagnosis: Lesion in the false vocal cord</p>\r\n\r\n<p>Procedure: Direct laryngoscopy with lesion biopsy</p>\r\n\r\n<p>Anesthesia: General endotracheal tube anesthetic</p>\r\n\r\n<p>Indications for Procedure: This is a 45-year-old male with a history of tobacco abuse who has chronic hoarseness and who was found on rigid laryngoscopy to have a lesion involving both vocal cords. The decision was made to perform a biopsy in order to obtain a diagnosis.</p>\r\n\r\n<p>Technical Procedure: After informed consent was obtained and the operative site identified, the patient was taken to the operating room and placed on the table in the supine position. General endotracheal tube anesthesia was induced, and attention turned to the oral cavity. A tooth protector was placed and the shoulder roll applied. The patient was draped in the usualsterile fashion. A time out was taken, and then the inferior commissure laryngoscope used to visualize the vallecula, the right and left pyriform sinus, the post cricoid sinus, the false vocal cord, and the true vocal cord. Biopsy forceps were used to obtain biopsies of the polypoid lesions on the right and left, and these were sent separately to Pathology for a demonstration. Once this was completed, the area was suctioned out, and the laryngoscope and tooth guard removed. The patient was awakened, extubated, and transferred to PACU in stable condition. Select the procedure code for this service:</p>', '31535', '31512', '31530', '31510', '2022-06-07 05:41:54', '2022-11-14 06:12:22', 'ans_a'),
(640, 6, 50, 1, '<p>Garry, 22-year-old male needs a peripherally inserted venous access catheter for cancer treatment. The patient was placed in the supine position. Following the administration of light anesthesia, the right arm was prepped and draped in the usual fashion. Next, 50 cc of 1 percent Lidocaine with bicarb was infused in the skin and subcutaneous tissue and the basilic vein was punctured. CPT&reg; coding is reported? Using Seldinger technique, the subclavian vein was cannulated on the first attempt. A J-wire passed easily under fluoroscopic guidance to the subclavian vein. The wound was closed with a 3-OVieryl. Benzoin and Steri-Strips were applied. Sponge and needle count correct. The patient was awakened from light anesthesia and taken to the recovery room in stable condition.</p>', '36573', '36571, 77001', '36570', '36569, 77001', '2022-06-07 05:42:22', '2022-11-14 06:12:38', 'ans_a'),
(641, 6, 50, 1, '<p>55 year old female patient is in the oncologist&rsquo;s office for chemotherapy. She complains of vomiting and diarrhea since this morning and is dehydrated, The chemotherapy is postponed until next week and she receives an infusion of 1,000 mL of normal saline for 1 hour 30 minutes. According to CPT&reg; guidelines and parenthetical statements, how is the hydration reported?</p>', '96365, 96366', '96365', '96360, 96361', '96360', '2022-06-07 05:42:55', '2022-11-14 06:13:01', 'ans_d'),
(642, 6, 22, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>OPERATIVE PROCEDURE: Excision of back lesion.</p>\r\n\r\n<p>INDICATIONS FOR SURGERY: The patient has an enlarging lesion on the upper midback.&nbsp; FINDINGS AT SURGERY: There was a 5-cm, upper midback lesion.</p>\r\n\r\n<p>OPERATIVE PROCEDURE: With the patient prone, the back was prepped and draped in the usual sterile fashion. The skin and underlying tissues were anesthetized with 30 mL of 1% lidocaine with epinephrine. Through a 5-cm transverse skin incision, the lesion was excised. Hemostasis was ensured. The incision was&nbsp; closed using 3-0 Vicryl for the deep layers and running 3-0 Prolene&nbsp; subcuticular stitch with Steri-Stripsfor the skin. The patient was returned to the same-day surgery center in stable postoperative condition. All sponge, needle, and instrument counts were correct. Estimated blood loss is 0mL. PATHOLOGY REPORT LATER INDICATED: Follicular cyst, infundibular type, skin of back.&nbsp;</p>', '11406, 12002', '11424', '11406, 12032', '11606', '2022-06-07 05:59:08', '2022-06-07 05:59:08', 'ans_c'),
(643, 6, 22, 1, '<p>. EMERGENCY DEPARTMENT REPORT</p>\r\n\r\n<p>CHIEF COMPLAINT: Nasal bridge laceration.</p>\r\n\r\n<p>SUBJECTIVE: The patient is a 74-year-old male who presentsto the emergency department with a laceration&nbsp; to the bridge of his nose. He fell in the bathroom tonight. He recalls the incident. He just sort of lost his&nbsp; balance. He denies any vertigo. He denies any chest pain or shortness of breath. He denies any head pain or&nbsp; neck pain. There was no loss of consciousness. He slipped on a wet floor in the bathroom and lost his&nbsp; balance; that is how it happened. He has not had any blood from the nose or mouth. PAST MEDICAL HISTORY:</p>\r\n\r\n<p>1. Parkinson&#39;s</p>\r\n\r\n<p>2. Back pain</p>\r\n\r\n<p>3. Constipation</p>\r\n\r\n<p>MEDICATIONS: See the patient record for a complete list of medications.&nbsp;</p>\r\n\r\n<p>ALLERGIES: NKDA.</p>\r\n\r\n<p>REVIEW OF SYSTEMS: Per HPI. Otherwise, negative.</p>\r\n\r\n<p>PHYSICAL EXAMINATION: The exam showed a 74-year-old male in no acute distress. Examination of the HEAD showed no obvious trauma other than the bridge of the nose, where there is approximately a 1.5- to 2-cm laceration. He had no bony tenderness under this. Pupils were equal, round, and reactive.&nbsp; EARS and NOSE:</p>\r\n\r\n<p>OROPHARYNX was unremarkable. NECK was soft and supple. HEART was regular.</p>\r\n\r\n<p>LUNGS were clear but slightly diminished in the bases.</p>\r\n\r\n<p>PROCEDURE: The wound was draped in a sterile fashion and anesthetized with 1% Xylocaine with sodium bicarbonate. It was cleansed with sterile saline and then repaired using interrupted 6- 0 Ethilon sutures(Dr. Barney Teller, first-year resident, assisted with the suturing).&nbsp; ASSESSMENT: Nasal bridge laceration,status post fall.</p>\r\n\r\n<p>Plan: Keep clean. Sutures out in 5 to 7 days. Watch for signs of infection.</p>', '12051, S01.21XA, W18.49XA', '12011, S01.21XA, W18.49XA', '12011, S01.22XA, W18.30XA', '12011, 11000, S01.22XA, X58.XXXS', '2022-06-07 06:01:15', '2022-06-07 06:01:15', 'ans_b'),
(644, 6, 22, 1, '<p>SAME-DAY SURGERY</p>\r\n\r\n<p>DIAGNOSIS: Inverted nipple with mammary duct ectasia, left.&nbsp;</p>\r\n\r\n<p>OPERATION: Excision of mass deep to left nipple.</p>\r\n\r\n<p>With the patient under general anesthesia, a circumareolarincision was made with sharp dissection and carried down into the breast tissue. The nipple complex was raised up using a small retractor. We gently&nbsp; dissected underneath to free up the nipple entirely. Once this was done, we had the nipple fully unfolded,&nbsp; and there was some evident mammary duct ectasis. An area 3 &times; 4 cm was excised using electrocautery. Hemostasis was maintained with the electrocautery, and then the breast tissue deep to the nipple was&nbsp; reconstructed using sutures of 3-0 chromic. Subcutaneoustissue was closed using 3-0 chromic, and then the&nbsp; skin was closed using 4-0 Vicryl. Steri-Strips were applied. The patient tolerated the procedure well and was&nbsp; returned to the recovery area in stable condition. At the end of the procedure, all sponges and instruments&nbsp; were accounted for.</p>', '19120-LT, N60.42', '11404-LT, N62', '19112, N60.42', '19120-RT, N60.41', '2022-06-07 06:03:08', '2023-05-30 04:56:13', 'ans_a'),
(645, 6, 22, 1, '<p>This patient returns today for palliative care to her feet. Her toenails have become elongated and&nbsp; thickened, and she is unable to trim them on her own. She states that she has had no problems and no acute&nbsp; signs of any infection or otherwise to her feet. She returnstoday strictly for nail debridement to her feet. EXAMINATION: Her pedal pulses are palpable bilaterally. The nails are mycotic, 1 through 4 on the left, and 1&nbsp; through 3 on the right.</p>\r\n\r\n<p>ASSESSMENT: Onychomycosis, 1 through 4 on the left and 1 through 3 on the right. PLAN: Mild debridement of mycotic nails &times;7. This patient is to return to the clinic in 3 to 4 monthsfor follow up palliative care.</p>', '11721 × 7, B48.8', '99212, 11721, B35.1', '11719, B35.1', '11721, B35.1', '2022-06-07 06:04:56', '2022-06-07 06:04:56', 'ans_d'),
(646, 6, 22, 1, '<p>OPERATIVE REPORT&nbsp;</p>\r\n\r\n<p>With the patient having had a wire localization performed by radiology,she was taken to the operating room&nbsp; and, under local anesthesia of the left breast, was prepped and draped in a sterile manner. A breast line&nbsp; incision was made through the entry point of the wire, and a core of tissue surrounding the wire&nbsp; (approximately 1 &times; 2 cm) was removed using electrocautery for hemostasis. The specimen, including the wire, was then submitted to radiology, and the presence of the lesion within the specimen was confirmed. The wound was checked for hemostasis, and this was maintained with electrocautery. The breast tissue was&nbsp; reapproximated using 2-0 and 3-0 chromic. The skin was closed using 4-0 Vicryl in a subcuticular manner.&nbsp; Steri-Strips were applied.</p>\r\n\r\n<p>The patient tolerated the procedure well and was discharged from the operating room in stable condition. At&nbsp; the end of the procedure, all sponges and instruments were accounted for. Pathology report later indicated:&nbsp; Benign lesion.</p>', '11602-LT, D48.60', '11400-LT, C50.919', '19125-LT, D24.2', '19125-LT, D49.3', '2022-06-07 06:07:12', '2022-06-07 06:07:12', 'ans_c'),
(647, 6, 50, 1, '<p>Mr Anderson is complaining of flashes and floaters in his&nbsp;right eye. Ophthalmologist performs an initial extended ophthalmoscopy on right&nbsp;eye and identifies retinal tear. Physician performed Retinal drawing, interpretation and report. Provide correct CPT code for this visit.</p>', '92018', '92202', '92201', '92060', '2022-06-07 06:09:26', '2022-11-14 06:13:24', 'ans_c'),
(648, 6, 50, 1, '<p>John seen by his physician&nbsp;two times during a dialysis procedure to declot the access cannula during the hemodialysis process. Declotting of canulla has been done. Provide CPT code for the service provided by physician.</p>', '90936', '90935, 36861', '90937, 36860', '36860', '2022-06-07 06:10:05', '2022-11-14 06:13:43', 'ans_c'),
(649, 6, 51, 1, '<p>James Hose who is suffering from emphysema admitted to the&nbsp;ER with complaint of shortness of breath. A nebulizer treatment is administered in ER and same&nbsp;treatment repeated after three hours later. Provide CPt code for this visit</p>', '94640, 94640-76', '94644, 94644-76', '94644', '94640', '2022-06-07 06:10:36', '2022-11-14 06:15:10', 'ans_a'),
(650, 6, 51, 1, '<p>A 65-year-old comes into the ED with atrial fibrillation. Two paddles are placed on the patient&rsquo;s chest and a direct current of 120 | of synchronized shock was delivered but atrial fibrillation appeared to persist after a few sinus beats. Therefore, a 200 J of synchronized biphasic shock was delivered, and this time sinus rhythm was restored and persisted. How is this procedure reported?</p>', '92970', '92961', '92953', '92960', '2022-06-07 06:11:09', '2022-11-14 06:15:26', 'ans_d'),
(651, 6, 51, 1, '<p>&nbsp;A 41-year-old is seen for somatic dysfunction in multiple body areas. Osteopathic manipulative treatment is performed to the following regions: cervical, thoracic, mbar, sacrum, pelvis, both legs and abdominal/visceral. What CPT&reg; coding is reported?</p>', '98928 x8', '98928 x7', '98929 x9', '98928', '2022-06-07 06:11:36', '2022-11-14 06:15:40', 'ans_d'),
(652, 6, 51, 1, '<p>The patient presents for an echocardiogram. The indication for the procedure is intermittent episodes of shortness of breath. Echocardiography, transthoracic, real-time with image documentation with M-mode recording, complete is performed. What is the correct CPT&reg; code for the physician-ordered test?</p>', '93307', '93312', '93350', '93306', '2022-06-07 06:12:06', '2022-11-14 06:15:53', 'ans_a'),
(653, 6, 51, 1, '<p>Mrs. Kinder has 20 actinic keratosis on the trunk of her body. A physician assistant (PA) applies a photosensitizing drug to the patient&#39;s precancerous lesions. The PA asks the patient to comeback later in the day following the application of the drug. When the patient returns later that day the PA then exposes the area to blue light. The photosensitizing drug in the lesion absorbs the light and produces an active form of oxygen that destroys abnormal cells. What CPT coding is reported for the procedure?</p>', '96573 x20', '96567 x20', '96573', '96567', '2022-06-07 06:12:39', '2022-11-14 06:16:06', 'ans_c'),
(654, 6, 51, 1, '<p>A patient was seen in the emergency department after falling off her bike in the local park. The patient suffered abrasions on her right lower leg, which needed to be debrided. Debridement facility service 267 po is&nbsp;was performed using wet to moist dressings, without anesthesia. Silvadene application, wound assessment, and dressings were also applied. Report the CPT &reg; and ICD-10-CM codes for the</p>', '97602, S80.811A, V18.0XXA, Y92.830', '97597, S81.801, W17.89XA, Y92.830', '97602, S81.801A, W17.89XA, Y92.830', '97597, S80.811A, VI8.0XXA, Y92.830', '2022-06-07 06:13:07', '2023-09-18 01:49:18', 'ans_a'),
(655, 6, 51, 1, '<p>A 31-year-old sees his treating physician and collaborative care management team for initial psychiatric collaborative care management for depression. The total time spent with patient is 85minutes. What EM coding is reported?</p>', '99493, 99494', '99493', '99492', '99492, 99494', '2022-06-07 06:13:38', '2022-11-14 06:16:32', 'ans_c'),
(656, 6, 51, 1, '<p>The provider visits his patient in the hospital on the morning rounds and spends 20 minutes with the patient. Later that same day, he sees the patient and discharges her, providing a detailed exam, spending another 20 minutes on the discharge. What is reported for the discharge services?</p>', '99239', '99238', '99217', '99234', '2022-06-07 06:14:07', '2022-11-14 06:16:47', 'ans_a'),
(657, 6, 51, 1, '<p>Mrs David, 62-years-old female, returns to her provider to discuss&nbsp;lab results that were ordered at her preventive visit last week. The physician spends 30 minutes going over the lab results, counseling her on heart disease prevention, and implementing a diet plan and an exercise program.</p>', '99396', '99386', '99402', '99411', '2022-06-07 06:14:36', '2022-11-14 06:17:22', 'ans_c'),
(658, 6, 51, 1, '<p>According to the CPT&reg; guidelines for Initial Observation, when a patient is admitted to observation care and is discharged the following day, which E/M code range is reported for the patient being admitted in observation?</p>', '99234.99236', '99221-99223', '99202-99205', '99218-99220', '2022-06-07 06:15:14', '2023-05-31 04:52:41', 'ans_b'),
(659, 6, 51, 1, '<p>Dr. Barker sees Mrs. Ross today in the nursing facility for follow up on the status of her chronic conditions. An expanded problem focused history is obtained, a detailed exam performed, and medical decision making is moderate. The status of her COPD is stable, and bronchodilator therapy will continue and an X-ray will be done to check the lungs status. Her last HgbA1C is within normal range and there are no changes for diabetes management. She&#39;s doing well the antidepressant started last week for her depression. Dr. Barker will see her again next week. What E/M code is reported?</p>', '99308', '99304', '99309', '99305', '2022-06-07 06:15:43', '2023-10-12 00:47:42', 'ans_c'),
(660, 6, 51, 1, '<p>Bob was on a cruise in Mexico when he developed nausea, vormmiting, and diarrhea. The ship doctor examined Bob in his cabin. A detailed history was obtained and an expanded problem focused exam was performed. Medical decision making was low. The doctor gave him vomikind tab and advised Bob to hydrate and to avoid alcohol and rich/spicy food for 48 hours. What E/M code is reported?</p>', '99343', '99342', '99341', '99350', '2022-06-07 06:16:23', '2023-09-08 05:07:25', 'ans_b'),
(661, 6, 51, 1, '<p>Sara has a follow-up appointment with her physician for depression. She has seen no improvement since the last visit. The physician performs a medically appropriate history and exam and gives the patient a prescription for Celexa. The total time spent on the encounter the day of the visit is 25 minutes. What E/M code is reported?</p>', '99203', '99214', '99202', '99213', '2022-06-07 06:16:52', '2022-11-14 06:18:56', 'ans_d'),
(662, 6, 51, 1, '<p>A patient comes in with borderline obesity to Dr Marry&#39;s office. She performs a medically appropriate history and exam. She spends 34&nbsp;minutes discussing the risk associated with obesity. She prescribes diet and exercise. What established patient office evaluation and management code is reported?</p>', '99213', '99214', '99215', '99212', '2022-06-07 06:17:24', '2022-11-14 06:19:11', 'ans_b'),
(663, 6, 51, 1, '<p>The larynx is in which organ systerm?</p>', 'Cardiovascular', 'Urinary', 'Respiratory', 'Musculoskeletal', '2022-06-07 06:20:46', '2022-11-14 06:19:31', 'ans_c'),
(664, 6, 51, 1, '<p>Which structure below is found in the mediastinum?</p>', 'Pineal gland', 'Spleen', 'Thymus gland', 'Tonsils', '2022-06-07 06:21:17', '2022-11-14 06:20:00', 'ans_c'),
(665, 6, 51, 1, '<p>Which body organ concentrates and stores bile produced in the liver?</p>', 'Peritoneum', 'Gallbladder', 'Cecum', 'Pancreas', '2022-06-07 06:21:48', '2022-11-14 06:20:18', 'ans_b'),
(666, 6, 51, 1, '<p>Which of the following is part of the peripheral nervous system?</p>', 'Spinal cord', 'Dura mater', 'Brachial plexus', 'Pons', '2022-06-07 06:22:32', '2022-11-14 06:20:33', 'ans_c'),
(667, 6, 51, 1, '<p>Which is NOT part of the female genitalia?</p>', 'Bartholin’s glands', 'Vulva', 'Cowper\'s glands', 'Skene’s glands', '2022-06-07 06:23:06', '2022-11-14 06:20:48', 'ans_c'),
(668, 6, 51, 1, '<p>Which one is NOT part of the auditory system?</p>', 'Cochlea', 'Ossicles', 'Incus', 'Ciliary body', '2022-06-07 06:23:34', '2022-11-14 06:21:00', 'ans_d'),
(669, 6, 51, 1, '<p>The anterior neck and the right anterior iliac crest areas were prepped and draped in the usual sterile fashion. A transverse incision was marked over the anterior neck overlying the CS level based on fluoroscopy. The skin area was inflitrated with local anesthetic. Local was also placed over the skin area of the anterior iliac crest on the right side. A small stab incision was created here and a jamshidi&trade; needle used to obtain bone marrow aspirate sufficient to mix with Bio Adapt&reg; demineralized bone matrix for later use in the fusion. Based on this documentation, where was the bone marrow aspirate harvested from?</p>', 'Hip bone', 'Thigh bone', 'Arm bone', 'Cervical vertebra', '2022-06-07 06:24:03', '2022-11-14 06:21:12', 'ans_a'),
(670, 6, 51, 1, '<p>The ______gland is a small gland in the brain that regulates mood and secretes the hormone melatonin.</p>', 'Bartholin’s', 'Pineal', 'Adrenal', 'Parotid', '2022-06-07 06:24:31', '2022-11-14 06:21:27', 'ans_b'),
(671, 6, 51, 1, '<p>A surgical hysteroscopy with tubal occlusion by placement of permanent implants is performed. What is the anesthesia code reported by the anesthesiologist?</p>', '00950', '00952', '00940', '00851', '2022-06-07 06:25:06', '2022-11-14 06:21:48', 'ans_b'),
(672, 6, 51, 1, '<p>Physical status modifiers for anesthesia coding are used to report:</p>', 'The patient\'s health condition at the time of the anesthesia service', 'Patients receiving postoperative pain management', 'A patient’s response to the anesthesia', 'Patients of extreme age', '2022-06-07 06:25:36', '2022-11-14 06:22:03', 'ans_a'),
(673, 6, 51, 1, '<p>Patient receives monitored anesthesia by the anesthesiologist for a therapeutic cardiac catheterization with stent placement to the left anterior descending artery. The patient is physical status 4, Report the services of the anesthesiologist.</p>', '01924-AA.G8-P4', '01920-AA-G8-P4', '01924-AA-QS-P4', '01925-AA-QS-P4', '2022-06-07 06:26:03', '2022-11-14 06:22:22', 'ans_d'),
(674, 6, 51, 1, '<p>A 30 year old suffered an injury to his left knee in a work-related altercation when he was tripped by the suspect without falling. This resulted in a tear of his anterior cruciate ligament and a tear of his lateral meniscus. He is having an arthroscopic ACL reconstruction and lateral meniscal repair. What anesthesia code is reported?</p>', '01380', '01402', '01320', '01400', '2022-06-07 06:26:31', '2022-11-14 06:22:36', 'ans_d'),
(675, 6, 51, 1, '<p>75:year-old patient is brought emergently to operating room for craniotomy for the evacuation of a hematoma, What CPT codes are reported for the anesthesiologists services?</p>', '00215-AA, 99140', '00211-AA, 99100, 99140', '00210-AA 99100, 99140', '00211-AA, 99100', '2022-06-07 06:27:07', '2022-11-14 06:22:49', 'ans_b'),
(676, 6, 51, 1, '<p>A.7-year-old female in good physical health is having an appendectomy. The anesthesiologist begins to prepare this patient for surgery at 10:30 am, The surgery begins at 10:45 am and ends at 12:00 pm. The anesthesiologist releases the patient to the PACU nurses at 12:15 pm. What is the anesthesia time and anesthesia code are reported?</p>', '1 hour, 15 minutes; 00790', '1 hour, 30 minutes; 00840', '1 hour, 45 minutes; 00840', '2.hours, 15 minutes; 00790', '2022-06-07 06:27:41', '2022-11-14 06:23:02', 'ans_c'),
(677, 6, 51, 1, '<p>A.16-year-old was involved in a motorcycle accident and urgently taken to the operating room. Under general endotracheal anesthesia a vascular surgeon performed a repair of a laceration of the right tibial artery in the left leg. Report the service of the anesthesiologist.</p>', '01390', '01500', '01260', '01520', '2022-06-07 06:28:17', '2022-11-14 06:23:18', 'ans_b'),
(678, 6, 51, 1, '<p>Mrs. Jax age 65 is in poor health with diabetes and associated peripheral neuropathy. She is having a femoral-bypass graft. The CRNA is performing the anesthesia without medical direction, The CRNA also places a percutaneous arterial line. What CPT coding is reported?</p>', '01270-QZ, 36625', '01270-QZ, 36620', '01272-QY, 36625', '01272-QY, 36620', '2022-06-07 06:29:32', '2022-11-14 06:23:32', 'ans_b'),
(679, 6, 51, 1, '<p>A surgeon incises and drains a superficial abscess near the anal canal. What CPT@&reg; code is reported for the procedure?</p>', '45020', '46050', '46045', '45005', '2022-06-07 06:30:02', '2022-11-14 06:23:45', 'ans_b'),
(680, 6, 51, 1, '<p>A.40-year-old female has an infected peritoneal abscess. The surgeon incises the abdomen and drains the abscess. What CPT&reg; code is reported?</p>', '49040', '49082', '49083', '49020', '2022-06-07 06:30:33', '2022-11-14 06:24:00', 'ans_d'),
(681, 6, 51, 1, '<p>What CPT&reg; code is reported when the surgeon makes an incision in the chest wall to the esophagus, then an incision is made through the musculature of the esophagus, and a repair is performed using a fundic flap?</p>', '43330', '43279', '43331', '32665', '2022-06-07 06:31:18', '2022-11-14 06:24:13', 'ans_c'),
(682, 6, 22, 1, '<p>What code(s) would be used to code a split-thickness skin graft, both thighs to the abdomen, measuring 45 &times; 21 cm?</p>', '15100 × 2', '15100, 15101 × 9', '15100, 15101 × 9-51', '15100 × 10', '2022-06-07 06:36:12', '2022-11-17 09:50:08', 'ans_b'),
(683, 6, 22, 1, '<p>What code would be used to report a massive debridement of an open abdominal wound, including&nbsp; subcutaneous tissue and muscle?</p>', '11000', '11010', '11042', '11043', '2022-06-07 06:37:46', '2022-06-07 06:37:46', 'ans_d'),
(684, 6, 51, 1, '<p>An 82,year-old male had a percutaneous gastrostomy tube placed due to malnutrition. The gastrostomy catheter has become clogged. The physician removes the gastrostomy catheter and replaces it via percutaneous approach. How is this procedure reported?</p>', '43752', '43761', '43762', '43763', '2022-06-07 06:39:03', '2022-11-14 06:24:27', 'ans_c'),
(685, 6, 51, 1, '<p>21. patient is seen in the gastroenterologist&rsquo;s clinic for a diagnostic colonoscopy. While performing the service, the physician notes suspicious looking polyps and removes three of these using hot biopsy forceps to send to pathology for further testing. What is the procedure coding?</p>', '45380', '45384', '45378, 45364-51', '45378, 45380-51', '2022-06-07 06:39:37', '2022-11-14 06:24:44', 'ans_b'),
(686, 6, 22, 1, '<p>The patient is brought to surgery for an open wound of the left leg, the total extent measuring&nbsp; approximately 40 &times; 35 cm.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The legs were prepped with Betadine scrub and solution and then draped in a&nbsp; routine sterile fashion. Split-thicknessskin grafts measuring about a 10,000th inch thick were taken from both&nbsp; thighs, meshed with a 3:1 ratio mesher, and stapled to the wounds. The donor sites were dressed with scarlet&nbsp; red, and the recipient sites were dressed with Xeroform, Kerlix fluffs, and Kerlix roll, and a few ABD</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>pads were used for absorption. Estimated blood loss was negligible. The patient tolerated the procedure well and left surgery in good condition.</p>', '15120, 15121 × 12, S81.809A, X58.XXXS', '15100, 15101, 11010, S81.809A, X58.XXXS', '15220, 15221 × 13, S71.109A, S71.101A, X58.XXXS', '15100, 15101 × 13, S71.109A, S71.101A, X58.XXXS', '2022-06-07 06:39:57', '2022-06-07 06:39:57', 'ans_d'),
(687, 6, 51, 1, '<p>&nbsp;A 44-year-old male is taken back to the OR for a takedown of his colostomy and reversal of his small intestines after six months of bowel rest for his colitis. The patient is placed supine on the&lsquo; operating table and general endotracheal anesthesia is administered. His abdomen is prepped and draped in the usual sterile manner. An incision is made near the site of the colostomy stoma and dissected sharply from the abdominal wall. After the stoma is mobilized and taken down from the abdominal wall, it is resected and colorectal anastomosis is performed connecting both bowel ends with staples. The abdominal incisions were closed in the usual fashion. Which CPT &reg; code is reported?</p>', '44227', '44625', '44626', '44620', '2022-06-07 06:40:06', '2022-11-14 06:24:58', 'ans_c'),
(688, 6, 51, 1, '<p>A patient is seen at the doctor&#39;s office for nausea, vomiting, and abdominal pain. Labs come back indicating an increased WBC count. The physician determines the patient has a subacute appendicitis. The physician schedules an OR and takes the patient to the operating room. An abdominal incision is made, and an appendectomy is performed. What CPT&reg; and ICD-10-CM codes should be reported?</p>', '44950, K37, R11.2, R10.9', '44960, K36, R11.2, R10.9', '44960, K35.80', '44950, K36', '2022-06-07 06:40:34', '2022-11-14 06:25:11', 'ans_d'),
(689, 6, 22, 1, '<p>. What code would be used to code the destruction of a malignant lesion on the genitalia measuring 1.6&nbsp; cm using cryosurgery?</p>', '17272', '11602', '11420', '11622', '2022-06-07 06:40:59', '2022-06-07 06:40:59', 'ans_a'),
(690, 6, 51, 1, '<p>A patient who has colon adenocarcinoma undergoes a laparoscopic partial colectomy. The surgeon removes the proximal colon and terminal ileum and reconnects the cut ends of the distal ileum and remaining colon, What are the appropriate procedure and diagnosis codes?</p>', '44204, C18.2', '44205, C18.9', '44160, C18.2', '44140, C189', '2022-06-07 06:41:04', '2022-11-14 06:25:23', 'ans_b'),
(691, 6, 51, 1, '<p>32-year-old female has morbid obesity with a BMI of 44, She has decided to have a Roux-en-Y gastric bypass. The patient is brought to the operating room and placed in supine position. An incision made to insert a scope and trocars. The stomach is mobilized and the proximal stomach is divided and stapled creating a small proximal pouch in continuity with the esophagus. A short limb of the proximal bowel of 160 cm is divided. It is brought up and anastomosed to the gastric pouch. The other end of the divided bowel is connected back into the distal small bowel to the short limb&rsquo;s gastric anastomosis to restore intestinal continuity. The instruments are removed. What are the procedure and diagnosis codes for this encounter?</p>', '43847, E66.01, Z68.41', '43646, E66.01, Z68.41', '43644, E66.8, Z68.41', '43645, E66.01, Z68.41', '2022-06-07 06:41:36', '2022-11-14 06:25:41', 'ans_d'),
(692, 6, 51, 1, '<p>A patient is seen at the doctor&#39;s office for nausea, vomiting, and sharp abdominal pain. Labs come back indicating an increased WBC count. The physician determines the patient has acute appendicitis. The physician schedules an appendectomy and takes the patient to the operating room. A scope is inserted through an umbilical incision. Trocars and ports are inserted. The appendix is severed from the intestines and removed. The area is closed with staples where the appendix was removed. What CPT@ and diagnosis codes are reported?</p>', '44970, K35.80, R11.2, R10.9', '44950, K35.890, R11.2, R10.9', '44950, K35.891', '44970, K35.80', '2022-06-07 06:42:05', '2022-11-14 06:25:54', 'ans_d'),
(693, 6, 22, 1, '<p>What code(s) is used by the radiologist when performing preoperative placement of a needle localization&nbsp; wire of a single lesion of the breast to be excised?</p>', '19281, 19125', '19125', '19281', '19296', '2022-06-07 06:42:16', '2022-06-07 06:42:16', 'ans_c'),
(694, 6, 51, 1, '<p>A urologist performs a ligation of penile veins via an incision through the abdomen. Which CPT code is reported?</p>', '58540', '55535', '55550', '55530', '2022-06-07 06:42:39', '2022-11-14 06:26:30', 'ans_b'),
(695, 6, 51, 1, '<p>&nbsp;A 60-year-old male presents in the emergency department with acute urinary retention for 8 hours. The ED physician places a temporary indwelling catheter and empties 300 cc of urine.What CPT &reg; code is reported?</p>', '51700', '51702', '51703', '51701', '2022-06-07 06:43:15', '2022-11-14 06:26:45', 'ans_b'),
(696, 6, 22, 1, '<p>Patient returns for treatment for 8 extensive warts located on the right and left feet. In the last visit a&nbsp; decision was made to inject each wart with an antigen drug on a monthly basis until the warts have&nbsp; resolved. What CPT code is reported?</p>', '11900', '11900 x 8', '11901', '17110 x 8', '2022-06-07 06:43:43', '2022-06-07 06:43:43', 'ans_c'),
(697, 6, 51, 1, '<p>A surgeon is performing a laparoscopic partial nephrectomy. What CPT&reg; code is reported?</p>', '50545', '50540', '50240', '50543', '2022-06-07 06:43:55', '2022-11-14 06:26:57', 'ans_d'),
(698, 6, 51, 1, '<p>At 15.weeks of pregnancy Nancy started bleeding. An ultrasound revealed a snow-flake pattern. Diagnosis is a complete hydatidiform mole. Her obstetrician performs a hysterotomy. The hydatidiform mole is removed from the uterus via an open abdominal approach, What is the CPT &reg; code for the procedure and the ICD-10-CM code for the diagnosis?</p>', '58120, O020', '59841, O02.0', '59100, O01.0', '59870, O01.0', '2022-06-07 06:44:24', '2022-11-14 06:27:28', 'ans_c'),
(699, 6, 22, 1, '<p>The dermatologist has performed Mohs micrographic surgery to excise a melanoma from the patient calf&nbsp; area. Three stages were performed. First stage and second stage had 8 tissue blocks per stage. The third&nbsp; stage had 3 tissue blocks removed. The appropriate mapping and documentation was done on separate&nbsp; operative report. What CPT codes are reported?</p>', '17313, 17314-51, 17314-51', '17313, 17314, 17314, 17315X6', '17313, 17314, 17314, 17315', '17313, 17315, 17315, 17315', '2022-06-07 06:44:47', '2022-06-07 06:44:47', 'ans_b'),
(700, 6, 51, 1, '<p>A 4-year-old has phimosis. The decision is made to treat this condition with circumcision. Anesthesia is injected. The foreskin is pulled away from the body of the penis. The unwanted foreskin is cut away by a scalpel. The skin edges created are sutured together. What CPT &reg; and ICD-10-CM codes are reported?</p>', '54160, N47.2', '54150-52, N47.1', '54163, N47.2', '54161, N47.1', '2022-06-07 06:44:56', '2022-11-14 06:27:41', 'ans_d'),
(701, 6, 51, 1, '<p>At 12 weeks of pregnancy, Lilly was already much bigger than with either of her other two pregnancies. When she started bleeding, she was directed to see her doctor. An ultrasound revealed a &ldquo;snowflake&rdquo; pattern with a diagnosis given for molar pregnancy. The next day she had an evacuation and curettage. What are the CPT&reg; and ICD-10-CM codes?</p>', '59812, O01.0', '59100, O01.9', '59870, O02.0', '58120, O02.0', '2022-06-07 06:45:52', '2022-11-14 06:27:53', 'ans_c'),
(702, 6, 22, 1, '<p>Which CPT codes describe the destruction using electrosurgery to the right leg on a patient diagnosed&nbsp; with 10 premalignant lesions and removal of 10 fibrocutaneous tags during the same session?</p>', '17004, 11200', '17004 x 15, 11200', '17111, 11200', '17000, 17003 X 9, 11200', '2022-06-07 06:46:07', '2022-06-07 06:46:07', 'ans_d'),
(703, 6, 51, 1, '<p>A 67-year-old is having worsening vulvar pressure and a mass that is protruding from her vagina. She had distal defects in the anterior and posterior compartments. The provider performs a colporrhaphy. The surgery combines repair of both the anterior and posterior vaginal walls. The repairs of the vaginal tissues over the weakened spots to support the area return the bladder and rectum to their correct positions via vaginal approach. What CPT@ coding is reported?</p>', '57240, 77550', '57210', '57200', '57260', '2022-06-07 06:46:32', '2022-11-14 06:28:06', 'ans_d'),
(704, 6, 51, 1, '<p>A patient pregnant with twins goes into labor at 36 weeks gestation. The first baby is delivered vaginally. The second baby&rsquo;s cord prolapsed, and an emergency cesarean section was performed under general endotracheal anesthesia, The physician who delivered the twins also performed the antepartum care and will provide the postpartum care. Both babies are well and healthy. What CPT@ coding is reported for the twin delivery?</p>', '59400 x2', '59510, 59409-51', '59514, 59409-51', '59510x2', '2022-06-07 06:47:04', '2022-11-14 06:28:19', 'ans_b'),
(705, 6, 22, 1, '<p>A 59-year-old female has a non-palpable right breast mass. An ultrasound exam 2 days back showed that&nbsp; the mass is not a simple cyst. Fine needle aspiration biopsy of the mass is performed. What procedure&nbsp; code(s) will be reported?</p>', '19100', '10022, 76942', '10021', '19100, 76942', '2022-06-07 06:47:14', '2022-06-07 06:47:14', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(706, 6, 51, 1, '<p>Operative Report Preoperative Diagnosis: Postoperative bladder neck contracture (BNC) due to prostatectomy surgery Postoperative Diagnosis: Postoperative bladder neck contracture (BNC) due to prostatectomy surgery Procedure: Transurethral resection of bladder neck contracture Justification for Procedure: This 60-year-old gentleman had prior laser prostatectomy a year ago and now has scarring resulting in contracture of the bladder neck. Description of Procedure: After thorough Betadine prepping and draping and suitable general anesthesia, the cystourethroscope was inserted to view the bladder neck and urethra. Urethra was normal. A &nbsp; &nbsp;resectoscope was inserted to resect the scar tissue in the bladder neck using a cutting electrocautery knife. There was minimal bleeding. The scope was removed. A catheter was placed for removal of urine during the postoperative period. The patient tolerated the procedure well and was transferred to the recovery room in good condition. What procedure code is reported?</p>', '52647', '52640', '52630', '52500', '2022-06-07 06:47:46', '2022-11-14 06:28:31', 'ans_b'),
(707, 6, 51, 1, '<p>A 2:year-old child with congenital hydrocephalus is seeing her neurologist for reprogramming of her programmable CSF shunt system. The neurologist adjusts the pressure setting to an acceptable cerebrospinal fluid flow level. What is the correct procedure code for this surgery?</p>', '62252', '62225', '62258', '62230', '2022-06-07 06:48:14', '2022-11-14 06:28:44', 'ans_a'),
(708, 6, 22, 1, '<p>The patient presents to the ER with multiple lacerations which require repair. The patient has a 1.4 cm&nbsp; laceration on the right arm, 1.1 cm laceration on the left arm, a 2.5 cm on the right cheek and a 2 cm&nbsp; laceration on the forehead. The deep lacerations on the arms require extensive undermining with layers&nbsp; closures. The lacerations on the patient&#39;s face require extensive debridement of glass particles and a single&nbsp; layer closure.</p>', '13121, 12053-59', '13120, 12052-59', '12034, 12014-59', '12032, 12031-59, 12013-59, 12011-59', '2022-06-07 06:48:25', '2022-06-07 06:48:25', 'ans_b'),
(709, 6, 52, 1, '<p>Patient was diagnosed with a retina lesion of the left eye. The ophthalmologist destroys the lesion via cryoprobe in two sessions. What procedure code is reported?</p>', '67208 x2', '67227 x2', '67208', '67227', '2022-06-07 06:48:42', '2022-11-14 06:30:42', 'ans_c'),
(710, 6, 52, 1, '<p>A patient has excess hormone production due to tumors in each adrenal gland, The endocrinologist makes a vertical incision in the middle of the abdomen and removes both adrenal glands. How is this reported?</p>', '60540-50', '60650', '60650-50', '60540', '2022-06-07 06:49:18', '2022-11-14 06:30:57', 'ans_a'),
(711, 6, 52, 1, '<p>A CT scan is performed on a 31-year-old revealing a supra tentorial hematoma located in the subdural space. A craniotomy is performed, and the hematoma is evacuated by a suction device. The area is irrigated making sure there s no longer a hemorrhage. What CPT&reg; code is</p>', '61314', '61304', '61320', '61312', '2022-06-07 06:49:46', '2022-11-14 06:31:28', 'ans_d'),
(712, 6, 52, 1, '<p>A Needle is passed into the tumor. Aspiration of the initial samples reveals a soft necrotic tumor. This is sent for pathologic examination, which comes back as benign. What CPT&reg; and ICD-10-CM codes are reported?</p>', '61750, D33.0', '61750, D49.6', '61751, D49.6', '61751, D33.0', '2022-06-07 06:50:16', '2022-11-14 06:31:41', 'ans_a'),
(713, 6, 52, 1, '<p>A.45-year-old female had a closed fracture of the T4 -T8 vertebrae 15 years ago and now has displacement of the thoracic intervertebral disc. The surgeon will decompress the spinal cord involving one segment of the thoracic spine. The surgeon performs the surgery by using a transpedicular approach, going through the pedicle on the side of the disc bulge to reach the herniated disc. The lamina and facet joint are removed along with disc fragments. What is the correct procedure code to report?</p>', '63077', '63064', '63085', '63055', '2022-06-07 06:50:45', '2022-11-14 06:31:57', 'ans_d'),
(714, 6, 52, 1, '<p>A 30-year-old suffering from lumbar spondylosis presents to an outpatient facility to receive transforaminal epidural steroid injections. The injections are administered bilaterally in L2, L3 and L4 levels under fluoroscopic guidance. What are the correct CPT codes for this patient&#39;s encounter?</p>', '64483-50, 64484 x4', '64493-50, 64494 x2', '64483, 64484 x 2, 77003', '64520-50 x 3, 77003', '2022-06-07 06:51:20', '2022-11-14 06:32:19', 'ans_a'),
(715, 6, 22, 1, '<p>A 15 year old female with hypertrophic breasts is experiencing back pain. She was seen with her parents&nbsp; requesting surgical treatment for this problem. A few weeks later she received a mammoplasty removing&nbsp; breast tissue to correct this problem. What are the correct CPT codes for this scenario?</p>', '19318', '19301', '19306', '19316', '2022-06-07 06:51:41', '2022-06-07 06:51:41', 'ans_a'),
(716, 6, 53, 1, '<p>A 30-year-old suffering from lumbar spondylosis presents to an outpatient facility to receive transforaminal epidural steroid injections. The injections are administered bilaterally in L2, L3 and L4 levels under fluoroscopic guidance. What are the correct CPT codes for this patient&#39;s encounter?</p>', '64483-50, 64484 x4', '64493-50, 64494 x2', '64483, 64484 x 2, 77003', '64520-50 x 3, 77003', '2022-06-07 06:51:47', '2022-11-14 06:32:49', 'ans_a'),
(717, 6, 52, 1, '<p>A patient is diagnosed with discitis in the cervicothoracic region. The physician aspirates fluid via needle from the intervertebral disc using fluoroscopic guidance. This diagnostic service will help to identify the cause of the disc inflammation.</p>', '62267, 77003, M46.42, M46.44', '62268, 77003, M46.42, M46.44', '62268, 77003, M46.43', '62267, 77003, M46.43', '2022-06-07 06:52:20', '2022-11-14 06:33:07', 'ans_d'),
(718, 6, 52, 1, '<p>Chronic otitis media with effusion Postoperative Diagnosis: Chronic otitis media with effusion .PROCEDURE: Tympanostomy with ventilation tube placement, 7 mm vent tubes[A 2year-old female was taken to the OR and prepped and draped in a sterile manner. General anesthesia was used via endotracheal intubation by the anesthesia department. An incision was then manufactured in the anterior inferior quadrant of the right tympanic membrane utilizing the tympanostomy knife. The patient had significant debris within the middle ear. It was evacuated with #5 Frazier tip suction, A 7 mm vent tube was then placed within the tympanic membrane without difficulty or complications. Cortispor in drops along with the sterile cotton ball were applied. The same procedure was performed on the left tympanic membrane without difficulty or complications. The patient was sent to the recovery room in satisfactory condition. What CPT&reg; and ICD-10-CM codes are reported?</p>', '69421-50, H65.491, H65.492', '69436-50, H65.493', '69436, H65.491', '69421, H65.491', '2022-06-07 06:52:54', '2023-05-26 13:37:12', 'ans_b'),
(719, 6, 22, 1, '<p>A 32-year-old male with basal cell cancer, morphea type of the forehead that had been left untreated&nbsp; undergoes a wide excision 2 x 3 sq cm at the vertex. A V-Y plasty flap is done to allow the wound edges to&nbsp; come together without tension and to preserve the hairline. The forehead was undetermined and wound&nbsp; edges were well approximated. The deeper layer was closed with 2-0 monocryl and 2-0 prolene was used&nbsp; for the skin.</p>', '11622, 14020-51, 12032-51', '14020', '14040', '11622', '2022-06-07 06:52:55', '2022-06-07 06:52:55', 'ans_c'),
(720, 6, 52, 1, '<p>IMPRESSION: Elevated intraocular pressure, poorly controlled glaucoma INDICATIONS: 45-year-old has a poorly functioning or encapsulated bleb following filtering eye surgery 5 days ago. Repair of anterior segment of the eye is needed for this post-op complication. The treatment | recommend is to break up scar tissue underneath the bleb with a needle for the purpose of improving flow of aqueous humor, the fluid inside the left eye, into the bleb. Patient understands the risks involved and elects to proceed with bleb needling. She will return to the operating room for the procedure. PROCEDURE: A mixture of 50:50 lidocaine with epinephrine and 0.2mg/ml MMC (total 0.2ml) was injected in the superior subconjunctival space. She was prepped in the standard fash-on and a lid speculum was placed. She was positioned under the microscope. A Lederer&rsquo;s needle was used to break up any conjunctival scar tissue and tenon&rsquo;s cyst and to elevate the sclera flap. This was done on both sides of the bleb as needed. The area was checked afterward for leaking and a combination of pressure with a cotton swab and low temperature cautery was applied as needed. What CPT&reg; coding is reported?</p>', '66680-58', '66680-22', '66250-78', '66250-79', '2022-06-07 06:53:28', '2022-11-14 06:33:33', 'ans_c'),
(721, 6, 52, 1, '<p>A diagnostic mammogram is performed on the left breast to analyze lesions using computer-aided detection. What CPT&reg; coding is reported for this service?</p>', '77053.LT, 77063,', '77066-52', '77067-52', '77065-LT', '2022-06-07 06:53:55', '2022-11-14 06:33:48', 'ans_d'),
(722, 6, 22, 1, '<p>A surgeon performs a unilateral radical mastectomy including pectoral muscles and axillary lymph nodes&nbsp; on a breast cancer patient. At the same time, she places a permanent tissue expander beneath the skin and&nbsp; chest muscle. Through a small injection port under the skin, saline is injected into the expander over a&nbsp; period of two months to gradually fill it to the desired size while stretching the overlying tissue.</p>', '19305, 19357-51', '19306, 19340-51', '19305, 19364-51', '19306, 19357-51', '2022-06-07 06:53:57', '2023-05-30 02:15:25', 'ans_a'),
(723, 6, 52, 1, '<p>An ultrasound of a transplanted kidney is performed without a duplex Doppler. How is this coded?</p>', '76700', '76775', '76776', '76705', '2022-06-07 06:54:25', '2022-11-14 06:34:05', 'ans_b'),
(724, 6, 52, 1, '<p>The cardiologist believes Mrs. jolly sat risk for heart failure. A cardiac MRI without contrast and an adenosine injection for stress imaging is ordered. The MRI results will determine if there is any narrowing or blockage in the heart. What CPT&reg; code Is reported?</p>', '75561', '75557', '75563', '75559', '2022-06-07 06:54:54', '2022-11-14 06:34:16', 'ans_d'),
(725, 6, 52, 1, '<p>30-year-old male has been complaining of chronic headaches. A brain imaging metabolic positron emission tomography scan is performed. The scan shows an enhancing abnormality in the region of the frontal lobe. A diagnostic of malignant neoplasm of the frontal lobe of the brain is documented. What CPT and ICD-10-CM codes are reported?</p>', '70450, C71.1, R51.9', '78610, C71.1, 851.9', '78600, C71.1', '78608, C71.1', '2022-06-07 06:55:20', '2022-11-14 06:34:28', 'ans_d'),
(726, 6, 52, 1, '<p>A patient has disc herniation at cervical C5-C6 and thoracic T2-T3. The radiologist performs a myelography of the cervical and thoracic regions to detect further cord impingements. What CPT&reg; coding is reported?</p>', '72285-26', '72270-26, 72270-26', '72240-26, 72255-26', '72270-26', '2022-06-07 06:55:52', '2022-11-14 06:34:39', 'ans_d'),
(727, 6, 52, 1, '<p>A 50-year-old male on examination has a couple thyroid nodules without clinical symptoms of hyperthyroidism. Blood thyroid function tests indicate euthyroidism. The physician images the thyroid gland by intravenously administering radioiodine. Multiple images are acquired from different angles and documenting the patient&#39;s position. The vascular flow in around the nodules looked at to determine benign from malignant flow characteristics. What radiology code is reported?</p>', '78013', '78070', '78012', '78015', '2022-06-07 06:56:23', '2022-11-14 06:34:55', 'ans_a'),
(728, 6, 52, 1, '<p>A patient in her 2&quot; trimester with a quadruplet pregnancy Is seen in the obstetrician&rsquo;s office for an obstetrical ultrasound that is only assessing the fetal heartbeats and position of the fetuses. What CPT&reg; coding reports the ultrasound?</p>', '76805, 76810 x3', '76815 x4', '76815', '76811, 76812 x3', '2022-06-07 06:56:49', '2022-11-14 06:35:10', 'ans_c'),
(729, 6, 52, 1, '<p>Patient who may have blockage in the right leg is undergoing an angiogram in which the left femoral artery is cannulated with a catheter and advanced into the aorta and then into the right external iliac artery. Contrast medium is injected. There is an 80% lesion in the popliteal artery. What CPT&reg; codes are reported for the professional component?</p>', '36216, 75736-26', '36246, 75710-26', '36216, 75716-26', '36286, 75716-26', '2022-06-07 06:57:17', '2022-11-14 06:35:36', 'ans_b'),
(730, 6, 52, 1, '<p>An independent radiologist who is not employed by the facility performs the injection and radiology supervision and interpretation for a wrist arthrography. What is the correct coding?</p>', '25246-26, 73115-26', '20605, 73115-26', '96372, 73115-26-TC', '25246, 73115-26', '2022-06-07 06:57:45', '2023-09-19 00:47:31', 'ans_d'),
(731, 6, 52, 1, '<p>A.12 year-old male seen in the emergency department sustained an injury several hours ago to his right ankle when his brother kicked him accidentally while playing soccer at a public park. Ankle X-rays were taken in lateral and transverse positions to rule out a fracture. The interpretation of the X-rays revealed there was no fracture. He is diagnosed with a sprained ankle. What CPT&reg; and diagnosis codes are reported?</p>', '73600-26, S93.401A, WS0.1XXA, Y92.830, Y93.66, Y99.8', '73610-26, S93.401A, W50.1XXA, Y92.830, Y93.66, Y99.8', '73600-26, S99.911A, W50.1XXA, Y92.830, Y93.66, Y99.8', '73610-26, S82.891A, W50.1XXA, Y92.830, Y93.66, Y99.8', '2022-06-07 06:58:16', '2022-11-14 06:36:00', 'ans_a'),
(732, 6, 52, 1, '<p>An endocrinologist orders an ACTH stimulation testing for 3 beta-hydroxydehydrogenase deficiency. The lab tests for cortisol and 17 beta-hydroxypregnenolone deficiency are performed two times each. How is this reported?</p>', '80406', '80400', '82533 x 2, 84143 x2', '80402', '2022-06-07 06:58:42', '2022-11-14 06:36:17', 'ans_a'),
(733, 6, 52, 1, '<p>A lab performs creatine kinase total and isoenzymes to aid in diagnosis of acute myocardial infarction. How is this reported?</p>', '82565', '82552', '82550', '82550, 82552', '2022-06-07 06:59:13', '2022-11-14 06:36:31', 'ans_d'),
(734, 6, 52, 1, '<p>Provider orders prothrombin factor I! test to diagnose coagulation factor Il deficiency associated with a patient with liver disease. The testis positive for clotting formation. What lab code is reported?</p>', '85670', '85210', '85347', '85610', '2022-06-07 06:59:44', '2022-11-14 06:36:45', 'ans_b'),
(735, 6, 52, 1, '<p>A female patient presents with complaints of fatigue, headache, and muscle weakness. The patient lives near a lake. The provider suspects West Nile virus. A serum sample from the patient is obtained and tested for West Nile virus antibodies. The IgM titer is positive. What lab test is reported?</p>', '86788', '86789', '86794', '86790', '2022-06-07 07:00:12', '2022-11-14 06:36:57', 'ans_a'),
(736, 6, 52, 1, '<p>A 55-year-old female has a biopsy for suspected breast cancer. Two specimens were sent to the pathologist for evaluation and determination. Manual staining of each specimen identified each tissue as ER/PR positive and Her-2 negative based on manual morphometric analysis. Based on the patient&#39;s history and pathology results, she is diagnosed with invasive ductilecarcinoma. How is this pathology test reported?</p>', '88360', '88358 x2', '88358', '88360 x2', '2022-06-07 07:00:42', '2022-11-14 06:37:10', 'ans_d'),
(737, 6, 52, 1, '<p>A patient presents to the office with dysuria and slight nausea. The physician thinks she has an UTI. The physician performs an automated urinalysis, which reads negative for having UTI. What is the appropriate coding for this encounter?</p>', '81001, N39.0, R30.0, R11.0', '81001, R30.0, R11.0', '81003, R30.0, R11.0', '81002, R30.0, R11.0', '2022-06-07 07:01:11', '2022-11-14 06:37:23', 'ans_c'),
(738, 6, 52, 1, '<p>A 55-year-old male has a history of myeloid leukemia and is no longer on treatment. He is in the outpatient facility for a bone marrow aspiration. A 15-guage needle is used to perform the aspiration on right posterior iliac crest. The following specimens were reviewed for pathology: (1) Peripheral smear bone marrow aspirate and (2) iron stain. What CPT@&reg; and ICD-10-CM codes</p>', '85097, 88313, Z85.6', '85060, 88313, C92.90', '85097, 88312, C92.90', '85060, 88312, Z85.6', '2022-06-07 07:01:40', '2022-11-14 06:37:35', 'ans_a'),
(739, 6, 52, 1, '<p>A 25-year-old female with a family history of breast cancer i tested for BRCA and 2 on the same day, The test includes full sequence and duplication analysis to determine her risk of developing cancer. Testing revealed she is BRCA1 positive. How I this testing reported?</p>', '81162', '81165, 81166, 81216, 81167', '81165, 81216', '81163, 81164', '2022-06-07 07:02:12', '2022-11-14 06:37:46', 'ans_a'),
(740, 6, 52, 1, '<p>A patient with Turner syndrome is tested for cytogenic analysis. A peripheral blood specimen is obtained by the patient to grow a tissue culture for lymphocytes. What CPT&reg; code is reported?</p>', '88237', '88230', '88235', '88239', '2022-06-07 07:02:43', '2022-11-14 06:37:58', 'ans_b'),
(741, 6, 52, 1, '<p>Physician orders a comprehensive panel and obstetric panel. The obstetric panel includes the automated complete CBC with manual differential WBC count and HIV-1 antigen), with HIV-1and HIV antibodies, single result. What codes are reported for lab panels?</p>', '80053, 80055, 87389', '80053, 80055', '80053, 80081', '80055, 87389', '2022-06-07 07:03:15', '2022-11-14 06:38:13', 'ans_c'),
(742, 6, 52, 1, '<p>A patient is given a joint injection of 40 mg Depo-Medrol&reg; into the right shoulder. How is the medication reported?</p>', 'J1040', 'J1030', 'J1050', 'J1020', '2022-06-07 07:03:52', '2022-11-14 06:38:23', 'ans_b'),
(743, 6, 52, 1, '<p>What is the HCPCS Level il code for a short arm plaster cast for a 9-year-old patient?</p>', 'Q4007', 'Q4013', 'Q4011', 'Q4009', '2022-06-07 07:04:47', '2022-11-14 06:38:39', 'ans_c'),
(744, 6, 52, 1, '<p>What code is reported for the supply of a single chamber rate responsive pacemaker?</p>', 'C1786', 'C1785', 'C2610', 'C2620', '2022-06-07 07:05:17', '2022-11-14 06:38:51', 'ans_a'),
(745, 6, 52, 1, '<p>75-year-old established Medicare patient presents for her annual exam for cervical and breast cancer screening. She has no history of the disease. Today, pelvic and clinical breast exams are performed, What HCPCS Level I code is reported for this procedure?</p>', 'G0124', 'G0101', 'G0123', 'S0612', '2022-06-07 07:05:48', '2022-11-14 06:39:06', 'ans_b'),
(746, 6, 52, 1, '<p>Mrs. Strong is in a skilled nursing facility and is having shortness of breath and chest pain. The doctor at the facility arranges for her to be transported by advanced life support emergency transport from the skilled nursing facility to the hospital. Doctor provided information to the patient&#39;s family about the mental treatment of the p[atient to be provided. How is this coded?</p>', 'A0426-QN-SH', 'A0427-QN-HS', 'A0426-QM-NH', 'A0427-QM-HS', '2022-06-07 07:06:33', '2023-08-01 01:09:28', 'ans_d'),
(747, 6, 52, 1, '<p>Which place of service code is submitted on the claim for a service that is performed in a group home?</p>', '12', '14', '23', '22', '2022-06-07 07:07:07', '2022-11-14 06:42:04', 'ans_b'),
(748, 6, 22, 1, '<p>What are the CPT codes for destruction via laser of eight genital warts on the patient&#39;s&nbsp; vulva?</p>', '56515', '56501', '17003 x 7', '17000, 17003 x 7', '2022-06-07 07:07:14', '2022-07-07 07:56:29', 'ans_b'),
(749, 6, 52, 1, '<p>What is also known as a waiver of liability that is given to a Medicare patient by a provider before a service or test is performed that Medicare may not cover?</p>', 'Benefits of Explanation', 'Advance Beneficiary Notice', 'Automated Benefit Notice', 'Service Waive Notice', '2022-06-07 07:07:41', '2022-11-14 06:42:23', 'ans_b'),
(750, 6, 52, 1, '<p>Which is NOT included in the global surgical package?</p>', 'Preoperative visit on the day of the procedure', 'Immediate postoperative care', 'Topical anesthesia', 'A visit unrelated to the diagnosis for which the surgical procedure was performed', '2022-06-07 07:08:12', '2022-11-14 06:43:08', 'ans_d'),
(751, 6, 22, 1, '<p>A patient presents to the emergency room with severe leg pain following a skateboard accident.&nbsp; Radiological findings reveal retention of embedded gravel in the torn muscle. The ER physician states the&nbsp; patient has an open fracture of the tibia. The physician extends the open wound under anesthesia to&nbsp; remove the embedded gravel until clean tissue remain.</p>\r\n\r\n<p>What CPT would report the patient&rsquo;s condition as well as the procedure?</p>', '11011', '11012', '11044', '11043', '2022-06-07 07:08:43', '2022-06-07 07:08:43', 'ans_a'),
(752, 6, 52, 1, '<p>Medicare has classified certain surgical CPT&reg; codes as major and minor surgeries. What is the postoperative period for &quot;Major Surgeries&quot;?</p>', '0 Days', '120 Days', '10 Days', '90 Days', '2022-06-07 07:08:47', '2022-11-14 06:43:24', 'ans_d'),
(753, 6, 52, 1, '<p>A _______is assigned to each CPT@ code and is used to sequence codes on a claim form for reimbursement,</p>', 'Local coverage determination (LCD)', 'Relative value unit (RVU)', 'National Correct Coding initiative (NCCI)', 'National coverage determination (NCD)', '2022-06-07 07:09:28', '2022-11-14 06:43:43', 'ans_b'),
(754, 6, 22, 1, '<p>A patient presents for an incision and drainage of a pilonidal cyst. What is the correct code for these&nbsp; services?</p>', '10060', '10061', '10080', '10081', '2022-06-07 07:09:41', '2022-06-07 07:09:41', 'ans_c'),
(755, 6, 22, 1, '<p>Heather presents for removal of three benign sebaceous cysts. The first lesion excised from her leg is&nbsp; 3&nbsp;cm (which requires a four cm incision). The second lesion excised from her abdomen is 5&nbsp;cm (which&nbsp;required a 5.5 incision). The third lesion excised from her scalp is 0.5 cm (Which required a one cm incision).&nbsp;The physician performed intermediate layered closure to the wound on her abdomen. The other wounds&nbsp; were repaired by simple closure: What are the correct code(s) for these services?</p>', '11406, 11404, 11421, 12032-59', '12032, 11406-51, 11403-51, 11421-51', '12032, 11406 x 2, 11402', '12032, 11406-51, 11403-59, 11421-59', '2022-06-07 07:10:39', '2023-10-13 02:12:05', 'ans_a'),
(756, 6, 22, 1, '<p>A splinter is removed from the subcutaneous tissue of a patient&#39;s index finger through an incision made&nbsp; by the physician. The medical record states that this was a complicated procedure. How should the physician&nbsp; code this procedure?</p>', '10121', '10120', '11010', '11011', '2022-06-07 07:11:40', '2022-06-07 07:11:40', 'ans_a'),
(757, 6, 22, 1, '<p>On January 31st, Barbara had a two cm malignant lesion excised from her left foot. During a&nbsp; postoperative check-up on February 2nd, a residual tumor was noted at the margin of the original excision&nbsp; and the margins were re-excised. The re-excision included a three cm excised diameter. How would the same&nbsp; physician code the re-excision?</p>', '11622, 11623-59', '11626', '11623 lt-59', '11623 Lt-58', '2022-06-07 07:13:18', '2022-06-07 07:13:18', 'ans_d'),
(758, 6, 22, 1, '<p>Dr. Smith completed an extensive debridement due to infected skin. The patient was an 18- year-old who&nbsp; was fully cooperative. The debridement included 13% of the total body surface including portions of his&nbsp; abdominal wall. How would you code Dr. Smith&#39;s services?</p>', '11005, 11001-59', '11000, 11001-52', '11000, 11001', '11005', '2022-06-07 07:15:06', '2022-06-07 07:15:06', 'ans_c'),
(759, 6, 22, 1, '<p>Dr. Faye, a dermatologist specializing in Mohs, completed surgery on Howard&#39;s right thigh for an ill defined cancer. Dr. Faye is acting as both the surgeon and pathologist for this surgery. The surgery consisted&nbsp;of nine excised specimens prepared and examined during stage one. Additionally, a total of seven excised&nbsp;specimens were prepared and examined during stage two. How would you code Dr. Faye&#39;s services?</p>', '17313, 17314, 17315x6', '17313, 17314-51, 17315x6-51', '17311, 17312, 17315', '17313x9, 17314x7', '2022-06-07 07:16:21', '2022-07-08 05:52:44', 'ans_a'),
(760, 6, 22, 1, '<p>A patient presents to the dermatologist&#39;s office to have six benign foot lesions removed. The&nbsp; dermatologist destroys these lesions by use of electrosurgery. How should the office code these services?</p>', '17000, 17003-59', '17110', '17000, 17003 X 5', '17000, 17003', '2022-06-07 07:18:32', '2022-07-07 07:54:26', 'ans_b'),
(761, 6, 22, 1, '<p>Gavin, a 39-year-old male patient, underwent a mastectomy for gynecomastia. His recovery was&nbsp; uneventful. What is the correct code to report the mastectomy?</p>', '19300', '19301', '19499', 'None of the above', '2022-06-07 07:19:37', '2022-06-07 07:19:37', 'ans_a'),
(762, 6, 22, 1, '<p>A diabetic patient presents to Dr. Willard&#39;s office with a severe infection of the left great toenail. The&nbsp; patient requires a complete simple avulsion of the left great toenail plate. During the exam the patient is&nbsp; found to have infection of two additional toenails, which require partial simple avulsion. Digital blocks were&nbsp; used for this procedure. How should you code Dr. Willard&#39;s services?</p>', '11730, 11732 X 2, 01462 .', '11730-TA, 11732 X 2', '11730 X 3, 01462', '11720', '2022-06-07 07:20:42', '2022-06-07 07:20:42', 'ans_b'),
(763, 6, 22, 1, '<p>A five-year-old patient lacerated his forehead. He presents to the emergency room with his parents. It is&nbsp; determined that the patient will need multiple sutures to repair the wound. The patient has Down&#39;s&nbsp; syndrome and is unable to cooperate with the medial staff. His parents consent to general anesthesia for the wound repair. After general anesthesia intermediate sutures are completed to repair the six cm wound.&nbsp; What code(s) correctly capture this service?</p>', '00190-23 ·', '12053-23', '12053, 00190', '12053, 00190', '2022-06-07 07:22:33', '2022-06-07 07:22:33', 'ans_b'),
(764, 6, 22, 1, '<p>The patient is seen in follow-up for excision of the basal cell carcinoma of his nose. I examined his nose&nbsp; noting the wound has healed well. His pathology showed the margins were clear. He has a mass on his&nbsp; forehead; he says it is from a piece of sheet metal from an injury to his forehead. He has an X-ray showing a&nbsp; foreign body, we have offered to remove it. After obtaining consent we proceeded. The area was infiltrated&nbsp; with local anesthetic. I had drawn for him how I would incise over the foreign body. He observed this in the mirror so he could understand the surgery and agree on the location. I incised a thin ellipse over the&nbsp; mass to give better access to it, the mass was removed. There was a capsule around this, containing what appeared to be a black-colored piece of stained metal; I felt it could potentially cause a permanent black mark on his forehead. I offered to excise the metal, he wanted me to, so I went ahead and removed the&nbsp; capsule with the stain and removed all the black stain. I consider this to be a complicated procedure.&nbsp; Hemostasis was achieved with light pressure. The wound was closed in layers using 4-0 Monocryl and 6-0&nbsp; Prolene.</p>\r\n\r\n<p>What CPT&reg; and ICD-10-CM codes are reported?</p>', '10121, L92.3, Z18.10', '11010, S01.82XA, Z18.10', '10121, M79.5, Z18.10', '11010, M79.5, Z18.10', '2022-06-07 07:24:10', '2022-06-07 07:24:10', 'ans_c'),
(765, 6, 22, 1, '<p>The patient is here because the cyst in her chest has come to a head and is still painful even though she has been on antibiotics for a week. I offered to drain it for her. After obtaining consent, we infiltrated the area with 1 cc of 1% lidocaine with epinephrine, prepped the area with Betadine and incised opened the cyst in the relaxed skin tension lines of her chest, and removed the cystic material. There was no obvious purulence. We are going to have her clean this with a Q-tip. We will let it heal on its own and eventually excise it. I will have her come back a week from Tuesday to reschedule surgery. What CPT&reg;&nbsp; and ICD-10-CM codes are reported?</p>', '10140, L70.8', '10060, L72.3', '10061, L72.3', '10160, R22.2', '2022-06-07 07:25:57', '2022-06-07 07:25:57', 'ans_b'),
(766, 6, 22, 1, '<p>. Patient has returned to the operating room to aspirate a seroma that has developed from a surgical&nbsp; procedure that was performed two days ago. A 16-gauge needle is used to aspirate 600 cc of non-cloudy&nbsp; serosanguinous fluid. What codes are reported?</p>', '10160-78', '10180-58', '10140-78', '10140-58', '2022-06-07 07:29:40', '2022-06-07 07:29:40', 'ans_a'),
(767, 6, 22, 1, '<p>Operative Report</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Squamous cell carcinoma, scalp.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Squamous carcinoma, scalp.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Excision of Squamous cell carcinoma, scalp with Yin-Yang flap repair</p>\r\n\r\n<p>ANESTHESIA: Local, using 4 cc of 1% lidocaine with epinephrine.&nbsp;</p>\r\n\r\n<p>COMPLICATIONS: None.</p>\r\n\r\n<p>ESTIMATED BLOOD LOSS: Less than 5 cc.</p>\r\n\r\n<p>SPECIMENS: Squamous cell carcinoma, scalp sutured at 12 o&rsquo;clock, anterior tip</p>\r\n\r\n<p>INDICATIONS FOR SURGERY: The patient is a 43-year-old white man with a biopsy-proven&nbsp; basosquamous cell carcinoma of his scalp measuring 2.1 cm. I marked the area for excision with gross&nbsp; normal margins of 4 mm and I drew my planned Yin-Yang flap closure. The patient observed these&nbsp; markings in two mirrors, so he can understand the surgery and agreed on the location and we proceeded.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The area was infiltrated with local anesthetic. The patient was placed&nbsp; prone, his scalp and face were prepped and draped in sterile fashion. I excised the lesion as drawn to include the galea. Hemostasis was achieved with the Bovie cautery. Pathologic analysis showed the margins to be&nbsp; clear. I incised the Yin-Yang flaps and elevated them with the underlying galea. Hemostasis was achieved in&nbsp; the donor site using Bovie cautery. The flap rotated into the defect with total measurements of 2.9 cm x 3.2&nbsp; cm. The donor sites were closed and the flaps inset in layers using 4-0</p>\r\n\r\n<p>Monocryl and the skin stapler. Loupe magnification was used. The patient tolerated the procedure well.&nbsp;</p>\r\n\r\n<p>What CPT&reg; and ICD-10-CM codes are reported?</p>', '14060, 172.3', '14040, 173.42', '14041, 172.40', '14020, 173.42', '2022-06-07 07:31:32', '2022-06-07 07:31:32', 'ans_d'),
(768, 6, 22, 1, '<p>The patient is coming in for removal of fatty tissue of the posterior iliac crest, abdomen, and the medial and&nbsp; lateral thighs. Suction-assisted lipectomy was undertaken in the left posterior iliac crest area and was&nbsp; continued on the right and the lateral trochanteric and posterior aspect of the medial thighs. The medial right and left thighs were suctioned followed by the abdomen. The total amount infused was 2300 cc and the total amount removed was 2400 cc. The incisions were closed and a compression garment was applied. What CPT&reg; code(s) are reported?</p>', '15830, 15832-50-51', '15877, 15879-50-51', '15830, 15839-50-51, 15847', '15877, 15878-50-51', '2022-06-07 07:33:12', '2022-06-07 07:33:12', 'ans_b'),
(769, 6, 22, 1, '<p>Operative Report</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Diabetic foot ulceration.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Diabetic foot ulceration.</p>\r\n\r\n<p>OPERATION PERFORMED: Debridement and split thickness autografting of left foot</p>\r\n\r\n<p>ANESTHESIA: General endotracheal.</p>\r\n\r\n<p>INDICATIONS FOR PROCEDURE: This patient with multiple complications from Type II diabetes has&nbsp; developed ulcerations which were debrided and homografted last week. The homograft is taking quite&nbsp; nicely; the wounds appear to be fairly clean; he is ready for autografting.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: After informed consent the patient is brought to the operating room and&nbsp; placed in the supine position on the operating table. Anesthetic monitoring was instituted, internal anesthesia&nbsp; was induced. The left lower extremity is prepped and draped in a sterile fashion. Staples were removed and&nbsp; the homograft was debrided from the surface of the wounds. One wound appeared to have healed; the remaining two appeared to be relatively clean. We debrided this sharply with good bleeding in all areas.&nbsp; Hemostasis was achieved with pressure, Bovie cautery, and warm saline soaked sponges. With good&nbsp; hemostasis a donor site was then obtained on the left anterior thigh, measuring less than 100 cm2. The wounds were then grafted with a split-thickness autograft that was harvested with a patch of Brown&nbsp; dermatome set at 12,000 of an inch thick. This was meshed 1.5:1. The donor site was infiltrated with&nbsp; bupivacaine and dressed. The skin graft was then applied over the wound, measured approximately 60 cm2 in dimension on the left foot. This was secured into place with skin staples and was then dressed with&nbsp; Acticoat 18&#39;s, Kerlix incorporating a catheter, and gel pad. The patient tolerated the procedure well. The&nbsp; right foot was redressed with skin lubricant sterile gauze and Ace wrap. Anesthesia was reversed. The patient was brought back to the ICU in satisfactory condition.</p>\r\n\r\n<p>What CPT&reg; codes are reported?</p>', '15220-58, 15004-58', '15120-58, 15004-58', '15950-78, 15004-78', '11044-78, 15120-78, 15004-78', '2022-06-07 07:37:36', '2022-06-07 07:37:36', 'ans_b'),
(770, 6, 22, 1, '<p>Operative Report</p>\r\n\r\n<p>Diagnosis: Basal Cell Carcinoma</p>\r\n\r\n<p>Procedure: Mohs micrographic excision of skin cancer.&nbsp;</p>\r\n\r\n<p>Site: face left lateral canthus eyelid</p>\r\n\r\n<p>Pre-operative size: 0.8 cm</p>\r\n\r\n<p>Indications for surgery: Area of high recurrence, area of functional and/or cosmetic importance Discussed&nbsp; procedure including alternative therapy, expectations, complications, and the possibility of a larger or deeper defect than expected requiring significant reconstruction. Patient&rsquo;s questions were answered. Local anesthesia 1:1 marcaine and 1% lidocaine with epinephrine. Sterile prep and drape. Stage 1: The clinically apparent lesion was marked out with a small rim of normal appearing tissue and&nbsp; excised down to subcutaneous fat level with a defect size of 1.2 cm. Hemostasis was obtained and a&nbsp; pressure bandage placed. The tissue was sent for slide preparation. Review of the slides show clear&nbsp; margins for the site.</p>\r\n\r\n<p>Repair: Complex repair.</p>\r\n\r\n<p>Repair of Mohs micrographic surgical defect. Wound margins were extensively undermined in order to&nbsp; mobilize tissue for closure. Hemostasis was achieved. Repair length 3.4 cm. Narrative: Burrows triangles removed anteriorly (medial) and posteriorly (lateral). A layered closure was performed. Multiple buried absorbable sutures were placed to re-oppose deep fat. The epidermis and dermis were re-opposed using&nbsp; monofilament sutures. There were no complications; the patient tolerated the procedure well. Post procedure expectations (including discomfort management), wound care and activity restrictions were&nbsp; reviewed. Written Instructions with urgent contact numbers given, follow-up visit and suture removal in 3- 5 days</p>\r\n\r\n<p>What CPT&reg; codes are reported?</p>', '13152, 11642-51', '13152, 11442-51', '17313, 13152-51', '17311, 13152-51', '2022-06-07 07:42:51', '2022-06-07 07:42:51', 'ans_d'),
(771, 6, 22, 1, '<p>PREOPERATIVE &amp; POSTOPERATIVE DIAGNOSES:</p>\r\n\r\n<p>1. Macromastia.</p>\r\n\r\n<p>2. Back pain.</p>\r\n\r\n<p>3. Neck pain.</p>\r\n\r\n<p>4. Shoulder pain.</p>\r\n\r\n<p>5. Shoulder grooving</p>\r\n\r\n<p>6. Intertrigo.</p>\r\n\r\n<p>NAME OF PROCEDURE:</p>\r\n\r\n<p>1. Right breast reduction of 1950 g.</p>\r\n\r\n<p>2. Right free-nipple graft.</p>\r\n\r\n<p>3. Left breast reduction of 1915 g.</p>\r\n\r\n<p>4. Left free-nipple graft.</p>\r\n\r\n<p>INDICATIONS FOR SURGERY: The patient is a 43-year-old female with macromastia and associated&nbsp; back pain, neck pain, shoulder pain, shoulder grooving and intertrigo. She desired a breast reduction.&nbsp; Because of the</p>\r\n\r\n<p>extreme ptotic nature of her breasts, we felt she would need a free-nipple graft technique. In the preoperative holding area, we marked her for this free-nipple graft technique of breast reduction. The patient observed&nbsp; these markings so she could understand the surgery and agree on the location, and we proceeded. The&nbsp; patient also was morbidly obese with a body mass index of 54. Because of this, we felt she met the criteria for DVT prophylaxis, which included Lovenox injection. The patient understood this would increase her risk of bleeding. She also made it known she is a Jehovah&#39;s Witness and refused blood products, but she did&nbsp; understand her risk of bleeding would significantly increase and we proceeded.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was given 40 mg of subcutaneous Lovenox in the&nbsp; preoperative holding area. She was then taken to the operating room. Bilateral thigh-high TED hose, in&nbsp; addition to bilateral pneumatic compression stockings were used throughout the procedure. IV Ancef 1g&nbsp; was given. Anesthesia was induced. Both arms were secured on padded arm boards using Kerlix rolls. A&nbsp; similar body bear hugger was placed. The chest and abdomen were prepped and draped in sterile fashion. I began by circumscribing around each nipple-areolar complex using a 42-mm areolar marker. On each side</p>\r\n\r\n<p>the free-nipple grafts were harvested. They were marked to be side specific and were stored on the back table in moistened lap sponges. Meticulous hemostasis was achieved using Bovie cautery. The tail of the apex of each breast was deepithelialized using the scalpel. I amputated the inferior portion of the&nbsp; breast from the right side. Again, meticulous hemostasis was achieved using the Bovie cautery. There were also large feeder vessels divided and ligated using either a medium Ligaclip or 3-0 silk tie sutures. I then moved to the left and again amputated the inferior portion of the breast. Meticulous hemostasis was&nbsp; achieved using the Bovie cautery. Each of these wounds were temporarily closed using the skin stapler. The patient was then sat up. I felt we had achieved a very symmetrical result. The new positions for the nipple-areolar complexes were marked with a 42-mm areolar marker and methylene blue. The patient was&nbsp; then placed in the supine position and the new positions for the nipple-areolar complexes were&nbsp; deepithelialized using the scalpel. Meticulous hemostasis was then achieved again using the Bovie cautery. The free-nipple grafts were then retrieved from the back table. They were each defatted using&nbsp; scissors and were placed in an onlay fashion on the appropriate side, and each was inset using 5-0 plain sutures. Vents were made in the skin graft to allow for the egress of fluid on each side. A vertical mattress&nbsp; suture was used, tied over a piece of Xeroform in critical areas of each of the nipple-areolar complexes. A Xeroform bolster wrapped over a mineral oil-moistened sponge was affixed to each of the nipple-areolar&nbsp; complexes using 5-0 nylon suture. The vertical and transverse incisions were closed using 3-0 Monocryl,&nbsp; both interrupted and running suture, and 5-0 Prolene. The patient tolerated the procedure well. Again, meticulous hemostasis was achieved using the Bovie cautery. She was given another 1 g of Ancef at the 2-hour mark by our anesthesiologist, and was taken to the recovery room in good condition.&nbsp; What CPT&reg; codes are reported?</p>', '19316-50, 19355-59-50', '19318-50, 19350-59-50', '19318-50, 19355-59-50', '19340-50, 19350-59-50', '2022-06-07 07:46:25', '2022-06-07 07:46:25', 'ans_b'),
(772, 6, 22, 1, '<p>INDICATIONS FOR SURGERY: The patient is an 82-year-old white male with biopsy-proven basal cell&nbsp;carcinoma of his right lower eyelid and cheek laterally. I marked the area for rhomboidal excision and I&nbsp;drew my planned rhomboid flap. The patient observed these markings in a mirror, he understood the surgery and agreed on the location and we proceeded.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The area was infiltrated with local anesthetic. The cheek was prepped&nbsp; and draped in sterile fashion. I excised the lesion as drawn into the subcutaneous fat. Hemostasis was&nbsp; achieved using Bovie cautery. Modified Mohs analysis showed the margin to be clear. I incised the&nbsp; rhomboid flap as drawn and elevated the flap with a full-thickness of subcutaneous fat. Hemostasis was&nbsp; achieved in the donor site, the Bovie cautery was not used, hand held cautery was used. The flap was&nbsp; rotated into the defect. The donor site was closed and flap inset in layers using 5-0 Monocryl and 6-0 Prolene. The patient tolerated the procedure well. The total site measured 1.3 cm x 2.7 cm What CPT&nbsp;code(s) should be reported?</p>', '14020', '14040', '14060', '11643', '2022-06-07 07:50:34', '2023-09-04 00:30:35', 'ans_b'),
(773, 6, 22, 1, '<p>Wire placement in the lower outer aspect of the right breast was done by a radiologist the day prior to this&nbsp; procedure. During this operative session, the surgeon created an incision through the wire track and the&nbsp; wire track was followed down to its entrance into breast tissue. A nodule of breast tissue was noted&nbsp; immediately adjacent to the wire. This entire area was excised by sharp dissection, sent to pathology and&nbsp; returned as a benign lesion. Bleeders were cauterized, and subcutaneous tissue was closed with 3-0 Vicryl. Skin edges were approximated with 4-0 subcuticular sutures and adhesive strips were applied. The&nbsp; patient left the operating room in satisfactory condition. What should be the correct code(s) for the surgeon&rsquo;s services?</p>', '19125-RT', '11400-RT', '19125-RT, 19285', '19120-RT', '2022-06-07 07:52:27', '2022-06-07 07:52:27', 'ans_a'),
(774, 6, 22, 1, '<p>46‐year‐old female had a previous biopsy that indicated positive malignant margins&nbsp; anteriorly on the right side of her neck. A 0.5 cm margin was drawn out and a 15 blade&nbsp; scalpel was used for full excision of an 8cm lesion. Layered closure was performed after the&nbsp; removal. The specimen was sent for permanent histopathologic examination. What are the&nbsp; code(s) for this procedure?</p>', '11626', '11626, 12004‐51', '11626, 12044‐51', '11626, 13132‐51, 13133', '2022-06-07 07:53:42', '2022-06-07 07:53:42', 'ans_c'),
(775, 6, 22, 1, '<p>30‐year‐old female is having 15 sq cm debridement performed on an infected ulcer with&nbsp; eschar on the right foot. Using sharp dissection, the ulcer was debrided all the way to down&nbsp; to the bone of the foot. The bone had to be minimally trimmed because of a sharp point at&nbsp; the end of the metatarsal. After debriding the area, there was minimal bleeding because of&nbsp; very poor circulation of the foot. It seems that the toes next to the ulcer may have some&nbsp; involvement and cultures were taken. The area was dressed with sterile saline and dressings&nbsp; and then wrapped. What CPT&reg; code should be reported?</p>', '11043', '11012', '11044', '11042', '2022-06-07 07:54:43', '2022-06-07 07:54:43', 'ans_c'),
(776, 6, 22, 1, '<p>PRE OP DIAGNOSIS: Left Breast Abnormal MMX or Palpable Mass; Other Disorders of Breast PROCEDURE: Automated Stereotactic Biopsy Left Breast FINDINGS: Lesion is located in the&nbsp; lateral region, just at or below the level of the nipple on the 90 degree lateral view. There is&nbsp; a subglandular implant in place. I discussed the procedure with the patient today including risks, benefits and alternatives. Specifically discussed was the fact that the implant would be&nbsp; displaced out of the way during this biopsy procedure. Possibility of injury to the implant&nbsp; was discussed with the patient. Patient has signed the consent form and wishes to proceed&nbsp; with the biopsy. The patient was placed prone on the stereotactic table; the left breast was&nbsp; then imaged from the inferior approach. The lesion of interest is in the anterior portion of&nbsp; the breast away from the implant which was displaced back toward the chest wall. After&nbsp; imaging was obtained and stereotactic guidance used to target coordinates for the biopsy,&nbsp; the left breast was prepped with Betadine. 1% lidocaine was injected subcutaneously for&nbsp; local anesthetic. Additional lidocaine with epinephrine was then injected through the&nbsp; indwelling needle. The SenoRx needle was then placed into the area of interest. Under&nbsp; stereotactic guidance we obtained 9 core biopsy samples using vacuum and cutting&nbsp; technique. The specimen radiograph confirmed representative sample of calcification was&nbsp; removed. The tissue marking clip was deployed into the biopsy cavity successfully. This was&nbsp; confirmed by final stereotactic digital image and confirmed by post core biopsy&nbsp; mammogram left breast. The clip is visualized projecting over the lateral anterior left breast&nbsp; in satisfactory position. No obvious calcium is visible on the final post core biopsy image in&nbsp; the area of interest. The patient tolerated the procedure well. There were no apparent&nbsp; complications. The biopsy site was dressed with Steri‐Strips, bandage and ice pack in the&nbsp; usual manner. The patient did receive written and verbal post‐biopsy instructions. The&nbsp; patient left our department in good condition. IMPRESSION: 1. SUCCESSFUL STEREOTACTIC CORE BIOPSY OF LEFT BREAST CALCIFICATIONS. 2. SUCCESSFUL DEPLOYMENT OF THE&nbsp; TISSUE MARKING CLIP INTO THE BIOPSY CAVITY 3. PATIENT LEFT OUR DEPARTMENT IN&nbsp; GOOD CONDITION TODAY WITH POST‐BIOPSY INSTRUCTIONS. 4. PATHOLOGY REPORT IS&nbsp; PENDING; AN ADDENDUM WILL BE ISSUED AFTER WE RECEIVE THE PATHOLOGY REPORT.&nbsp; What are the codes for the procedures?</p>', '19081', '19283', '19081, 19283', '19100, 19283', '2022-06-07 07:56:15', '2022-06-07 07:56:15', 'ans_a'),
(777, 6, 22, 1, '<p>53‐year‐old male is in the dermatologist&#39;s office for removal of 2 lesions located on his nose&nbsp; and lower lip. Lesions were identified and marked. Utilizing a 3‐mm punch, a biopsy was&nbsp; taken of the left supratip nasal area. The lower lip lesion of 4mm in size was shaved to the&nbsp; level of the superficial dermis. What are the codes for these procedures?</p>', '11104, 11105', '11104, 11310‐51', '17000, 17003', '11440, 11310‐51', '2022-06-07 07:57:32', '2023-05-30 03:47:37', 'ans_b'),
(778, 6, 22, 1, '<p>76‐year‐old has dermatochalasis on bilateral upper eyelids. A belpharoplasty will be&nbsp; performed on the eyelids. A lower incision line was marked at approximately 5 mm above&nbsp; the lid margin along the crease. Then using a pinch test with forceps the amount of skin to&nbsp; be resected was determined and marked. An elliptical incision was performed on the left&nbsp; eyelid and the skin was excised. In a similar fashion the same procedure was performed on&nbsp; the right eye. The wounds were closed with sutures. The correct CPT&reg; code(s) is/are?</p>', '15822, 15823‐51', '15823‐50', '15822‐50', '15820‐LT, 15820‐RT', '2022-06-07 07:59:49', '2022-06-07 07:59:49', 'ans_c'),
(779, 6, 22, 1, '<p>Patient has basal cell carcinoma on his upper back. A map was prepared to correspond to&nbsp; the area of skin where the excisions of the tumor will be performed using Mohs&nbsp; micrographic surgery technique. There were three tissue blocks that were prepared for&nbsp; cryostat, sectioned, and removed in the first stage. Then a second stage had six tissue blocks&nbsp; which were also cut and stained for microscopic examination. The entire base and margins&nbsp; of the excised pieces of tissue were examined by the surgeon. No tumor was identified after&nbsp; the final stage of the microscopically controlled surgery. What procedure codes should be&nbsp; reported?</p>', '17313, 17314 x 2', '17313, 17315', '17260, 17313, 17314', '17313,17314, 17315', '2022-06-07 08:01:47', '2022-06-07 08:01:47', 'ans_d'),
(780, 6, 22, 1, '<p>45‐year‐old male is in outpatient surgery to excise a basal cell carcinoma of the right nose&nbsp; and have reconstruction with an advancement flap. The 1.2 cm lesion with an excised&nbsp; diameter of 1.5 cm was excised with a 15‐blade scalpel down to the level of the&nbsp; subcutaneous tissue, totaling a primary defect of 1.8 cm. Electrocautery was used for&nbsp; hemostasis. An adjacent tissue transfer of 3 sq cm was taken from the nasolabial fold and&nbsp; was advanced into the primary defect. Which CPT&reg; code(s) should be used?</p>', '14060', '11642, 14060', '11642, 15115', '11012', '2022-06-07 08:06:33', '2022-07-06 10:02:26', 'ans_a');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(781, 6, 22, 1, '<p>24‐year‐old patient had an abscess by her vulva which burst. She has developed a soft tissue&nbsp; infection caused by gas gangrene. The area was debrided of necrotic infected tissue. All of&nbsp; the pus was removed and irrigation was performed with a liter of saline until clear and&nbsp; clean. The infected area was completely drained and the wound was packed gently with&nbsp; sterile saline moistened gauze and pads were placed on top of this. The correct CPT&reg; code&nbsp; is:</p>', '56405', '10061', '11004', '11042', '2022-06-07 08:07:49', '2022-06-07 08:07:49', 'ans_c'),
(782, 6, 22, 1, '<p>76‐year‐old female had a recent mammographic and ultrasound abnormality in the 6 o&rsquo;clock&nbsp; position of the left breast. She underwent core biopsies which showed the presence of a&nbsp; papilloma. The plan now is for needle localization with excisional biopsy to rule out occult malignancy. After undergoing preoperative needle localization with hookwire needle&nbsp; injection with methylene blue, the patient was brought to the operating room and was&nbsp; placed on the operating room table in the supine position where she underwent laryngeal&nbsp; mask airway (LMA) anesthesia. The left breast was prepped and draped in a sterile fashion.&nbsp; A radial incision was then made in the 6 o&#39;clock position of the left breast corresponding to&nbsp; the tip of the needle localizing wire. Using blunt and sharp dissection, we performed a&nbsp; generous excisional biopsy around the needle localizing wire including all of the methylene&nbsp; blue‐stained tissues. The specimen was then submitted for radiologic confirmation followed&nbsp; by permanent section pathology. Once hemostasis was assured, digital palpation of the&nbsp; depths of the wound field failed to reveal any other palpable abnormalities. At this point,&nbsp; the wound was closed in 2 layers with 3‐0 Vicryl and 5‐0 Monocryl. Steri‐Strips were applied.&nbsp; Local anesthetic was infiltrated for postoperative analgesia. What CPT&reg; and ICD‐10‐CM&nbsp; codes describe this procedure?</p>', '19100, N63', '19285, C50.912', '19120, R92.8', '19125, D24.2', '2022-06-07 08:10:26', '2022-06-07 08:10:26', 'ans_d'),
(783, 6, 24, 1, '<p><strong>DIALYSIS INPATIENT NOTE: This 24-year-old male patient is on continuous ambulatory peritoneal dialysis (CAPD) using 1.5%. He drains more than 600 ml. He is tolerating dialysis well. He continuesto have some abdominal pain, but his abdomen is not distended. He has some diarrhea. His abdomen does not look&nbsp; like acute abdomen. His vitals, other than blood pressure in the 190s over 100s, are fine. He is afebrile. At this time, I will continue with 1.5% dialysate. I gave him labetalol IV for blood pressure. Because of diarrhea, I am going to check stool for white cells, culture. Next we will see what the primary physician says today. His HIDA scan was normal. The patientsuffers from ESRD. </strong></p>', '90947, 90960, N18.6, R19.7', '90945, N18.6, R19.7', '90960, N18.6', '90945, N18.6', '2022-06-08 03:33:10', '2022-06-08 03:33:10', 'ans_b'),
(784, 6, 24, 1, '<p><strong>INDICATION: Hypertension with newly diagnosed acute myocardial infarction.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Insertion of Swan-Ganz catheter.&nbsp;</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The right internal jugular and subclavian area was prepped with antiseptic&nbsp; solution. Sterile drapes were applied. Under usual sterile precautions, the right internal jugular vein was&nbsp; cannulated. A 9 French introducer was inserted, and a 7 French Swan-Ganz catheter was inserted without&nbsp; difficulty. Right atrial pressures were 2 to 3, right ventricular pressures 24/0, and pulmonary artery 26/9 with&nbsp; a wedge pressure of 5. This is a Trendelenburg position. The patient tolerated the procedure well. </strong></p>', '93451, 93503-51, I10', '93503, I10', '93503, 99356, I10, I21.3', '93503, I10, I21.3', '2022-06-08 03:33:54', '2022-06-08 03:33:54', 'ans_d'),
(785, 6, 24, 1, '<p><strong>DIAGNOSIS: Atrial flutter.&nbsp;</strong></p>\r\n\r\n<p><strong>PROCEDURE PERFORMED: Electrical cardioversion.&nbsp;</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: The patient was sedated with Versed and morphine. She was given a total of 5&nbsp; mg of Versed. She was cardioverted with 50 joules into sinus tachycardia. The patient was given a 20-mg&nbsp; Cardizem IV push. Her heart rate went down to the 110s, and she was definitely in sinus tachycardia. CONCLUSION: Successful electrical cardioversion of atrial flutter into sinus tachycardia. </strong></p>', '92961, I49.1', '92960, I48.92', '92960, 92973, I48.92', '92960, I49.8', '2022-06-08 03:34:40', '2022-06-08 03:34:40', 'ans_b'),
(786, 6, 24, 1, '<p><strong>A patient presents for a pleural cavity chemotherapy session with 10 mg doxorubicin HCl that requires a&nbsp; thoracentesis to be performed:&nbsp;</strong></p>', '96446, J9000', '96440, 32554, J9000', '96440, J9000', '96446, 32554, J9000', '2022-06-08 04:05:07', '2022-06-08 04:05:07', 'ans_c'),
