(793, 6, 24, 1, '<p><strong>The Medicine section of CPT has which of the following unlisted services or procedures? </strong></p>', '99499, 96999, 68899', '93799, 96999, 99600', '99199, 99499, 96999, 99600', '93799, 96999, 49999', '2022-06-08 04:09:36', '2023-10-09 00:12:16', 'ans_b'),
(794, 6, 24, 1, '<p><strong>&nbsp;Mr. North presented for his weekly therapeutic visit with his physician. During this visit Mr. North had a&nbsp; comprehensive computer-based motion analysis study with videotaping and 3-D kinematicis, with dynamic&nbsp; plantar pressure measurements during walking. This study was completed to assist with major therapeutic </strong><strong>decision-making for continued gait training and rehabilitation after a stroke. What code(s) should correctly&nbsp; capture this procedure? </strong></p>', '96001', '99214, 96000', '97116', '97116, 96001-59', '2022-06-08 04:19:42', '2022-06-08 04:19:42', 'ans_a'),
(795, 6, 24, 1, '<p><strong>Left heart catheterization retrograde from the femoral artery with injection procedures for selective&nbsp; coronary angiography and selective left ventriculography, including imaging supervision and interpretation&nbsp; with report, are performed. The cardiologist performed all of the services at the hospital. The CPT&reg; codes&nbsp; are:&nbsp;</strong></p>', '93458-26', '93459-26', '93452-26', '93460-26', '2022-06-08 04:20:18', '2022-06-08 04:20:18', 'ans_a'),
(796, 6, 24, 1, '<p><strong>Jeffery, a six-year-old established patient, was given a measles, mumps, rubella, and varicella (MMRV)&nbsp; vaccination. This vaccination was completed the same day as his regularly scheduled annual pediatric&nbsp; checkup. The physician completed all necessary paperwork and examination for Jeffery. The physician&nbsp; provided face-to-face counseling with Jeffery&#39;s mother, while she was in the exam room with Jeffrey. The&nbsp; physician stayed in the exam room during the vaccine administration to continue to answer questions. What&nbsp; codes correctly capture the physician&#39;s services?&nbsp;</strong></p>', '90704, 90707, 90708', '99213, 90471, 90710', '99393, 90710, 90460, 90461X3', '99383, 90710, 90460', '2022-06-08 04:21:05', '2022-06-08 04:21:05', 'ans_c'),
(797, 6, 24, 1, '<p><strong>Which services are included with hydration, therapeutic, prophylactic, and diagnostic injections and&nbsp; infusions (excluding chemotherapy)?&nbsp;</strong></p>', 'Use of local anesthesia, IV start, access to indwelling IV, subcutaneous catheter or port', 'Flush at conclusion of infusion', 'Standard tubing, syringes, and supplies', 'All of the above', '2022-06-08 04:21:44', '2022-06-08 04:21:44', 'ans_d'),
(798, 6, 24, 1, '<p><strong>A physician performed a spirometry graphic record, timed vital capacity, and expiratory flow rate&nbsp; measurements with maximal voluntary ventilation. What code captures thiis service?</strong></p>', '94010', '94014', '94016', '94015', '2022-06-08 04:22:15', '2022-06-08 04:22:15', 'ans_a'),
(799, 6, 24, 1, '<p><strong>Joe, a 42-year-old construction worker, had hot packs applied to his knee and elbow and ultrasound for&nbsp; 30 minutes. He is scheduled to have eight physical rehabilitation sessions to help eliminate pain in his knee&nbsp; and elbow suffered when he fell from a ladder. This is his second visit and reports some relief. What codes&nbsp; correctly capture these services?&nbsp;</strong></p>', '97010 x 2, 97035', '97010, 97035 X 2', '97014, 97035', '97010 X 2, 97035 X 2', '2022-06-08 04:22:49', '2022-06-08 04:22:49', 'ans_b'),
(800, 6, 24, 1, '<p><strong>Madison was attending a soccer camp when she complained of fatigue, dizziness, and a headache. Her&nbsp; mother took her to Dr Boyle&#39;s office for a checkup that afternoon. Dr. Boyle completed an expanded&nbsp; problem-focused history and examination, and then determined that Madison was dehydrated. Madison&nbsp; received 5 hours of IV infusion. What codes capture these services?&nbsp;</strong></p>', '99203, 96360 X 2, 96361 X 2', '99213, 96360, 96361 X 4', '96360, 96361 X 4', '99223, 96360 X 2, 96361 X 2', '2022-06-08 04:23:27', '2022-06-08 04:23:27', 'ans_c'),
(801, 6, 24, 1, '<p><strong>According to the CPT manual ophthalmology services are defined by which of the following terms? </strong></p>', 'Intermediate, comprehensive, and special', 'Brief, intermediate, and extensive', 'Limited, intermediate, and advanced', 'Extensive, advanced, and enormous', '2022-06-08 04:24:04', '2022-06-08 04:24:04', 'ans_a'),
(802, 6, 24, 1, '<p><strong>Colin had a comprehensive audiometry threshold evaluation and speech recognition testing to the left&nbsp; ear. What code(s) capture this procedure? </strong></p>', '92557-52', '92553, 92556', '92557', '92700-59', '2022-06-08 04:24:32', '2022-06-08 04:24:32', 'ans_a'),
(803, 6, 24, 1, '<p><strong>A female patient fell on the floor as she got out of bed. She has no known head trauma. She noticed some slight stiffness in her joints and weakness in her lower extremity muscles, with slight stiffness in her&nbsp; arm joints. The physician decided to test for possible multiple sclerosis (MS). She was sent to a clinic providing somatosensory studies. The testing included upper and lower limbs. What CPT&reg; codes are&nbsp; reported?&nbsp;</strong></p>', '95938', '95925', '95927', '95926 d. 95926', '2022-06-08 04:25:07', '2022-06-08 04:25:07', 'ans_a'),
(804, 6, 24, 1, '<p><strong>64-year-old patient came to the emergency department complaining of chest pressure. The physician&nbsp; evaluated the patient and ordered a 12 lead EKG. Findings included signs of acute cardiac damage.&nbsp; Appropriate initial management was continued by the ED physician who contacted the cardiologist on call in the hospital. Admission to the cardiac unit was ordered. No beds were available in the cardiac unit&nbsp; and the patient was held in the ED. The cardiologist left the ED after completing the evaluation of the patient. Several hours passed and the patient was still in the ED. During an 80-minute period, the patient&nbsp; experienced acute breathing difficulty, increased chest pain, arrhythmias, and cardiac arrest. The patient&nbsp; was managed by the ED physician during this 80-minute period. Included in the physician management&nbsp; were a new 12 lead EKG, endotracheal intubation and efforts to restore the patient&rsquo;s breathing and&nbsp; circulation for 20 minutes. CPR was unsuccessful, the patient was pronounced dead after a total of 44&nbsp; minutes critical care time, exclusive of other separately billable services. What CPT&reg; codes are reported&nbsp; by the physician? </strong></p>', '99285-25, 93010 x 2, 31500, 92950', '99291-25, 31500, 93000, 92950', '99291-25, 99292-25, 93005-59 x 2, 31500', '99291-25, 31500, 92950', '2022-06-08 04:25:43', '2022-06-08 04:25:43', 'ans_d'),
(805, 6, 24, 1, '<p><strong>A patient with Sickle cell anemia with painful sickle crisis received normal saline IV, 100 cc per hour to&nbsp; run over 5 hours for hydration in the physician&rsquo;s office. She will be given Morphine &amp; Phenergan, prn&nbsp; (as needed). What codes are reported?&nbsp;</strong></p>', '96360, 96361 x 4, J7050 x 2', '96360 x 5, J7050', '96360, 96361 x 3, J7030', '96360, J7030', '2022-06-08 04:26:20', '2022-06-08 04:26:20', 'ans_a'),
(806, 6, 24, 1, '<p><strong>4‐year‐old is getting over his cold and will be getting three immunizations in the&nbsp; pediatrician&rsquo;s office by the nurse. The first vaccination administered is the Polio vaccine&nbsp; intramuscularly. The next one is the live influenza (LAIV3) administered in the nose. The last&nbsp; vaccination is the Varicella (live) by subcutaneous route. What CPT&reg; codes are reported for&nbsp; the administration and vaccines?&nbsp;</strong></p>', '90713, 90660, 90716, 90460, 90461 x 2', '90713, 90660, 90716, 90460, 90461 x 1', '90713, 90660, 90716, 90471, 90472, 90474', '90713, 90660, 90716, 90471, 90472, 90473', '2022-06-08 04:30:01', '2022-07-01 09:11:10', 'ans_c'),
(807, 6, 24, 1, '<p><strong>64‐year‐old female who has multiple sclerosis fell from her walker and landed on a glass&nbsp; table. She lacerated her forehead, cheek and chin and the total length of these lacerations&nbsp; was 6 cm. Her right arm and left leg had deep cuts measuring 5 cm on each extremity. Her&nbsp; right hand and right foot had a total of 3 cm lacerations. The ED physician repaired the&nbsp; lacerations as follows: The forehead, cheek, and chin had debridement and cleaning of glass&nbsp; debris with the lacerations being closed with one layer closure, 6‐0 Prolene sutures. The arm&nbsp; and leg were repaired by layered closure, 6‐0 Vicryl subcutaneous sutures and prolene&nbsp; sutures on the skin. The hand and foot were closed with adhesive strips. Select the&nbsp; appropriate procedure codes for this visit.&nbsp;</strong></p>', '99283‐25, 12014, 12034‐59, 12002‐59, 11042‐51', '99283‐25, 12053, 12034‐59, 12002‐59', '99283‐25, 12014, 12034‐59, 11042‐51', '99283‐25, 12053, 12034‐59', '2022-06-08 04:30:39', '2022-06-08 04:30:39', 'ans_d'),
