(820, 6, 25, 1, '<p><strong>What is being done when a surgeon performs a bilateral oophorectomy?&nbsp;</strong></p>', 'A sling procedure for vaginal prolapse', 'Removal of both ovaries', 'Removal of both fallopian tubes', 'Laparoscopic removal of the uterus', '2022-06-08 07:29:07', '2022-06-08 07:29:07', 'ans_b'),
