(830, 6, 25, 1, '<p><strong>Which of the following is true about the tympanic membrane?&nbsp;</strong></p>', 'It separates the middle ear from the inner ear', 'It separates the external ear from the middle ear', 'It sits within the middle ear', 'It sits within the inner ear', '2022-06-08 07:38:19', '2022-06-08 07:38:19', 'ans_b'),
(831, 6, 25, 1, '<p><strong>What parts of the body are examined during a sigmoidoscopy?&nbsp;</strong></p>', 'Rectum', 'Sigmoid colon', 'Portion of descending colon', 'All of the above', '2022-06-08 07:38:55', '2022-06-08 07:38:55', 'ans_d'),
