(836, 6, 25, 1, '<p><strong>Which term defines a swelling or mass of blood confined to an organ, tissue, or space&nbsp; caused by a break in a blood vessel?&nbsp;</strong></p>', 'Hematuria', 'Hematoma', 'Hematemesis', 'Hemangioma', '2022-06-08 09:27:40', '2022-06-08 09:27:40', 'ans_b'),
(837, 6, 25, 1, '<p><strong>Which term describes a type of fracture?&nbsp;</strong></p>', 'Greenstick', 'Comminuted', 'Depressed', 'All of the above', '2022-06-08 09:28:10', '2022-06-08 09:28:10', 'ans_d'),
(838, 6, 25, 1, '<p><strong>How does Hodgkin&#39;s lymphoma differ from Non-Hodgkin&#39;s lymphoma?&nbsp;</strong></p>', 'The type of treatment the patient had in the past six weeks for an infarction.', 'Hodgkin\'s is a respiratory disorder that is only non-cancerous.', 'It is staged as low-grade or high-grade bladder system disorder detected only in males', 'It is distinguished by the presence of Reed-Sternberg cells.', '2022-06-08 09:34:59', '2022-06-08 09:34:59', 'ans_d'),
(839, 6, 25, 1, '<p><strong>Which suffix means blood or blood condition?&nbsp;</strong></p>', 'emia', 'oma', 'pena', 'uria', '2022-06-08 09:35:30', '2022-06-08 09:35:30', 'ans_a'),
(840, 6, 25, 1, '<p><strong>What term refers to toward or nearer the midline?&nbsp;</strong></p>', 'Ventral', 'Distal', 'Dorsal', 'Medial', '2022-06-08 09:35:59', '2022-06-08 09:35:59', 'ans_d'),
(841, 6, 25, 1, '<p><strong>Which term describes an additional respiratory sound commonly referred to as wheezing?</strong></p>', 'Rale', 'Bruit', 'Rhonchi', 'Stridor', '2022-06-08 09:36:28', '2022-07-22 06:24:28', 'ans_d'),
(842, 6, 25, 1, '<p><strong>Which lung has three lobes?&nbsp;</strong></p>', 'Left lung', 'Right lung', 'Upper left Lung', 'Lower Right lung', '2022-06-08 09:37:57', '2022-06-08 09:37:57', 'ans_b'),
(843, 6, 25, 1, '<p><strong>What does the hard palate of the mouth form?&nbsp;</strong></p>', 'A separation between the interior and exterior portions of the nose', 'A barrier between the tonsils and the adenoids.', 'The floor of the nasal cavity separating the nasal and oral cavities', 'The separation of the nasal septum', '2022-06-08 09:38:35', '2022-06-08 09:38:35', 'ans_c'),
(844, 6, 25, 1, '<p><strong>The nervous system can be grouped into what two major categories?</strong></p>', 'Parasympathetic and sympathetic nervous systems', 'Somatic and norepinephrine nervous systems', 'Efferent and peripheral nervous systems', 'Central and peripheral nervous systems', '2022-06-08 10:20:13', '2022-06-08 10:20:13', 'ans_d'),
(845, 6, 25, 1, '<p><strong>What are the main functions of the integumentary system?&nbsp;</strong></p>', 'Sensation, protection, thermoregulation, and secretion', 'Sensation, protection, secretion, and exchange of gases', 'Sensation, secretion, fluid exchange, and thermoregulation', 'Sensation, elimination of solid waste, and protection', '2022-06-08 10:24:07', '2022-06-08 10:24:07', 'ans_a'),
(846, 6, 25, 1, '<p><strong>The eyeball has which of the following?&nbsp;</strong></p>', 'Vitreous Body', 'Growth hormone', 'Adrenaline', 'Insulin', '2022-06-08 10:27:03', '2022-07-22 11:16:55', 'ans_a'),
(847, 6, 25, 1, '<p><strong>Mobilization of an organ by freeing adhesions is referred to as?&nbsp;</strong></p>', 'Irrigation', 'Fusion', 'Extraction', 'Lysis', '2022-06-08 10:29:27', '2022-06-08 10:29:27', 'ans_d'),
(848, 6, 25, 1, '<p><strong>&nbsp;Bleeding from the bladder is best described by which term?&nbsp;</strong></p>', 'Cystoptosis', 'Cystorrhagia', 'Cystorrhaphy', 'Cystorrhexis', '2022-06-08 10:32:51', '2022-06-08 10:32:51', 'ans_b'),
(849, 6, 25, 1, '<p><strong>Which term means the tissue death of an artery or arteries?&nbsp;</strong></p>', 'Atherostenosis', 'Arterosclerosis', 'Artherosclerosis', 'Arterionecrosis', '2022-06-08 10:33:35', '2022-06-08 10:33:35', 'ans_d'),
(850, 6, 25, 1, '<p><strong>Which term describes a surgical puncture of the eardrum?&nbsp;</strong></p>', 'Thoracentesis', 'Arthrocentesis', 'Tympanocentesis', 'Pleurodesis', '2022-06-08 10:34:06', '2022-07-22 11:24:47', 'ans_c'),
(851, 6, 25, 1, '<p><strong>The musculoskeletal system includes which of the following:&nbsp;&nbsp;</strong></p>', 'Muscles', 'Bones, cartilage', 'Ligaments, tendons', 'All of the above', '2022-06-08 10:34:36', '2022-06-08 10:34:36', 'ans_d'),
(852, 6, 25, 1, '<p><strong>What is the difference between entropion and ectropion?&nbsp;</strong></p>', 'Entropion is the inward turning of the eyelid and ectropion is the outward turning of the  eyelid.', 'Entropion is facial droop and ectropion is a facial spasm.', 'Entropion is the outward turning of the hands and ectropion is the inward turning of the  hands.', 'Entropion inward turning of the feet and ectropion is the outward turning of the feet due  to muscle disorder.', '2022-06-08 10:35:28', '2022-06-08 10:35:28', 'ans_a'),
(853, 6, 25, 1, '<p><strong>Ventral, umbilical, spigelian and incisional are types of:&nbsp;&nbsp;</strong></p>', 'Surgical approaches', 'Hernias', 'Organs found in the digestive system', 'Cardiac catheterizations', '2022-06-08 10:36:03', '2022-06-08 10:36:03', 'ans_b'),
(854, 6, 25, 1, '<p><strong>Fracturing the acetabulum involves what area?&nbsp;&nbsp;</strong></p>', 'Skull', 'Shoulder', 'Pelvis', 'Leg', '2022-06-08 10:36:30', '2022-06-08 10:36:30', 'ans_c'),
(855, 6, 25, 1, '<p><strong>When a patient is having a tenotomy performed on the abductor hallucis&nbsp; muscle, where is this muscle located?&nbsp;</strong></p>', 'Foot', 'Upper Arm', 'Upper Leg', 'Hand', '2022-06-08 10:36:57', '2022-06-08 10:36:57', 'ans_a'),
(856, 6, 25, 1, '<p><strong>A patient is having pyeloplasty performed to treat a uretero‐pelvic junction obstruction.&nbsp; What is being performed? </strong></p>', 'Surgical repair of the bladder', 'Removal of the kidney', 'Cutting into the ureter', 'Surgical reconstruction of the renal pelvis', '2022-06-08 10:37:35', '2022-06-08 10:37:35', 'ans_d'),
(857, 6, 26, 1, '<p>Carl Ostrick, a 21-year-old male, slipped on a patch of ice on his sidewalk while shoveling snow. When he&nbsp; fell, his left hand was wedged under his body and his index finger was dislocated. After manipulating the joint back into normal alignment, the surgeon fixed the dislocation by placing a wire percutaneously through the carpometacarpal joint to maintain alignment.</p>', '26608-F1', '26650-FA', '26706-LT', '26676-F1', '2022-06-09 07:36:46', '2022-06-09 07:36:46', 'ans_d'),
(858, 6, 26, 1, '<p>John, an 84-year-old male, tripped while on his morning walk. He stated he was thinking aboutsomething&nbsp; else when he inadvertently tripped over the sidewalk curb and fell to his knees. X-ray indicated a fracture of his right patella. With the patient under general anesthesia, the area was opened and extensively irrigated. The left aspect of the patella was severely fragmented, and a portion of the patella was subsequently removed. The remaining patella fractures were wired. The surrounding tissue was repaired, thoroughly irrigated, and closed in the usual manner.</p>', '27524-RT, S82.001A, W10.1XXA', '27520-RT, S82.009A, W10.1XXA', '27524-RT, S82.001B, W19.XXXA', '27524-RT, S82.009A, W19.XXXA', '2022-06-09 07:38:10', '2022-06-09 07:38:10', 'ans_a'),
(859, 6, 26, 1, '<p>Maryann received a blow to her right tibial shaft while moving a large stuffed chair up a flight of stairs&nbsp; when the person in front of the chair slipped and released his hold on the chair. The full weight of the chair&nbsp; was pushed against her; when she was unable to hold the chair in place, both she and the chair fell to the&nbsp; landing a dozen steps below. The chair tipped on its side and landed on her tibia. On x-ray, the right tibia shaft was fractured in three places. Percutaneousscrews and pins were placed to secure the fracture sites.</p>', '27750-RT, S82.201A, W10.8XXA', '27756-RT, S82.201A, W19.XXXA', '27756-RT, S82.201A , W10.8XXA', '27750-RT, S82.209A, W10.8XXA', '2022-06-09 07:39:37', '2022-06-09 07:39:37', 'ans_c'),
(860, 6, 26, 1, '<p>Darin was a passenger in an automobile rollover accident and was not wearing a seat belt at the time. He&nbsp; was thrown from the automobile and was pinned under the rear of the overturned vehicle. He sustained&nbsp; craniofacialseparation that required complicated internal and external fixation using an open approach to&nbsp; repair the extensive damage. A halo device was used to hold the head immobile.</p>', '21435, 20661', '21435', '21432', '21436, 20661', '2022-06-09 07:48:15', '2022-06-09 07:48:15', 'ans_b'),
(861, 6, 26, 1, '<p>Libby was thrown from a horse while riding in the ditch; a truck that honked the horn as it passed her&nbsp; startled her horse. The horse reared up, and Libby was thrown to the ground. Her left tibia was fractured and&nbsp; required insertion of multiple pins to stabilize the defect area. A unilateral multiplane external fixation system was then attached to the pins.</p>', '20661-LT, S82.202A, V88.9XXA', '20692-LT, S82.202A, V80.11XA', '20692-LT, S82.201A, V80.11XA', '20690-LT, S82.201A, V80.11XA', '2022-06-09 07:57:00', '2022-06-09 07:57:00', 'ans_b'),
(862, 6, 26, 1, '<p>A small incision was made over the left proximal tibia, and a traction pin was inserted through the bone</p>\r\n\r\n<p>to the opposite side. Weights were then affixed to the pins to stabilize the tibial fracture temporarily until&nbsp; fracture repair could be performed.</p>', '20650-LT', '20663-LT', '20690-LT', '20692-LT', '2022-06-09 07:58:41', '2022-06-09 07:58:41', 'ans_a'),
(863, 6, 26, 1, '<p>Mary tells her physician that she has been having pain in her left wrist for several weeks. The physician&nbsp; examines the area and palpates a ganglion cyst of the tendon sheath. He marks the injection sites, sterilizes&nbsp; the area, and injects corticosteroid into\\ two areas.</p>', '20550-LT × 2, M67.432', '20551-LT, M67.442', '20551-LT × 2, M67.40', '20612-LT, 20612-59-LT, M67.432', '2022-06-09 07:59:57', '2022-06-09 07:59:57', 'ans_d'),
(864, 6, 26, 1, '<p>The physician applies a Minerva-type fiberglass body cast from the hips to the shoulders and to the head.&nbsp; Before application, a stockinette is stretched over the patient&#39;storso, and further padding of the bony areas&nbsp; with felt padding was done.</p>', '29040', '29055', '29035', '29000', '2022-06-09 08:01:52', '2022-08-03 11:00:01', 'ans_a'),
(865, 6, 26, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Open fracture, left humerus, with possible loss of left radial pulse.&nbsp; PROCEDURE PERFORMED: Open reduction internal fixation, left open humerusfracture. PROCEDURE: While under a general anesthetic, the patient&#39;sleft arm was prepped with Betadine and draped&nbsp; in sterile fashion. We then created a longitudinal incision over the anterolateral aspect of his left arm and&nbsp; carried the dissection through the subcutaneoustissue. We attempted to identify the lateral intermuscular&nbsp; septum and progressed to the fracture site, which was actually fairly easily to do because there was some&nbsp; significant tearing and rupturing of the biceps and brachialis muscles. These were partial ruptures, but the&nbsp; bone was relatively easy to expose through this. We then identified the fracture site and thoroughly irrigated&nbsp; it with several liters of saline. We also noted that the radial nerve was easily visible, crossing along the&nbsp; posterolateral aspect of the fracture site. It was intact. We carefully detected it throughout the remainder of&nbsp; the procedure. We then were able to strip the periosteum away from the lateral side of the shaft of the&nbsp; humerus both proximally and distally from the fracture site. We did this just enough to apply a 6-hole plate,&nbsp; which we eventually held in place with six corticalscrews. We did attempt to compressthe fracture site. Due&nbsp; to some comminution,the fracture was not quite anatomically aligned, but certainly it was felt to be very&nbsp; acceptable. Once we had applied the plate, we then checked the radial pulse with a Doppler. We found that&nbsp; the radial pulse was present using the Doppler, but not with palpation. We then applied Xeroform dressings to the wounds and the incision. After padding the arm thoroughly, we applied a long-arm splint with the elbow flexed about 75 degrees. He tolerated the procedure well, and the radial pulse was again present on Doppler examination at the end of the procedure.</p>', '24515-RT, S42.302B, W19.XXXA', '24500-LT, S42.302B, W19.XXXA', '24515-LT, S42.302B, W19.XXXA', '24505-LT, S42.302B, W19.XXXA', '2022-06-09 08:22:44', '2022-06-09 08:22:44', 'ans_c'),
(866, 6, 26, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Left thigh abscess.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Incision and drainage of left thigh abscess.</p>\r\n\r\n<p>OPERATIVE NOTE: With the patient under general anesthesia, he was placed in the lithotomy position. The&nbsp; area around the anus was carefully inspected, and we saw no evidence of communication with the perirectal&nbsp; space. This appearsto have risen in the crease at the top of the leg, extending from the posterior buttocks&nbsp; region up toward the side of the base of the penis. In any event, the area was prepped and draped in a sterile manner. Then we incised the area in fluctuation. We obtained a lot of very foul-smelling, almoststool-like material (it was not stool, but it was brown and very foul-smelling material). This was not the typical pus one sees with a <em>Staphylococcus aureus</em>-type infection. The incision was widened to allow us to probe the cavity fully. Again, I could see no evidence of communication to the rectum, but there was extension down the thigh and extension up into the groin crease. The fascia was darkened from the purulent material. I opened some of the fascia to make sure the underlying muscle was viable. This appeared viable. No gas was present. There was nothing to suggest a necrotizing fasciitis. The patient did have a very extensive inflammation within this</p>\r\n\r\n<p>abscess cavity. The abscess cavity was irrigated with peroxide and saline and packed with gauze vaginal packing. The patient tolerated the procedure well and was discharged from the operating room in stable condition.</p>', '26990-LT, L03.116', '27301-LT, L02.416', '27301-LT, L03.116', '26990-LT, L02.416', '2022-06-09 08:24:35', '2022-06-20 09:07:17', 'ans_b'),
(867, 6, 26, 1, '<p>A 35-year old is coming in for trigger point injections for right sided thoracic spine pain. Four points are&nbsp; injected with Depo with Depo Medrol 40 mg/mg. On the rhomboid major and levator scapular muscles. Which CPT code is reported for injections?</p>', '20605x4', '20552', '20553', '20553 x 3', '2022-06-09 08:25:36', '2022-06-09 08:25:36', 'ans_b'),
(868, 6, 26, 1, '<p>A 32 year old has torn meniscus from a sports injury. The repair is performed with an arthroscope&nbsp; placed into the patellofemoral joint. It showed grade 2 chondromalacia on the patellar side of the joint.&nbsp; The medical compartment was entered and a complex posterior horn tear of the medial meniscus was&nbsp; noted. Repair of the meniscus was carried out to a stable rim along with shaving the articular cartilage. Next, the lateral compartment was entered with a similar tissue removing the meniscus with shaving of the&nbsp; articular cartilage to smooth all surfaces. What CPT code(s) should be reported?</p>', '29881, 29877', '29883, 29877', '29880', '29882, 29881-59', '2022-06-09 08:26:53', '2023-09-23 00:58:19', 'ans_d'),
(869, 6, 26, 1, '<p>70 year old male has compression fractures of the L2 and L3 due to osteoporosis. Vertebroplasty is&nbsp; performed by using bone filler devices advanced into the vertebral body anteriorly near the midline and&nbsp; deposit a total of 1.75 ml of radiopaque bone cement at the L2 level and 5.5 ml of radiopaque cement at&nbsp; the L3 level on the right and left sides.</p>', '22511, 22512', '22514-50, 22515-50-51', '22514, 22515', '22514, 22515-51', '2022-06-09 08:28:44', '2022-06-20 05:31:28', 'ans_c'),
(870, 6, 26, 1, '<p>An elderly female presented with increasing pain in her left dorsal foot. The patient was brought to the&nbsp; operating room at which time she was placed under general anesthesia. A curvilinear incision was centered&nbsp; over the lesion itself. Soft tissue dissection was carried down through the ganglion. The ganglion was&nbsp; clearly identified as gelatinous material. It was excised directly off the bone and sent to pathology. There&nbsp; was noted to be a large bony spur at the level of the talus. Using double action rongueurs the spur itself&nbsp; was removed and sequestrectomy was performed. Following that a rasp was utilized to smooth the bone&nbsp; surface. The eburnated bony surface was then covered utilizing bone wax. The wound was irrigated and&nbsp; closed in layers. What are the correct CPT codes for the above procedure?&nbsp;</p>', '28122, 28090-51', '28120, 28090-51', '28045, 28092-51', '28100, 28092-51', '2022-06-09 08:29:51', '2022-06-09 08:29:51', 'ans_b'),
(871, 6, 26, 1, '<p>A patient presents with broken screws of the left ankle. The patient was placed on the OR table in the&nbsp; supine position. After satisfactory induction of general anesthesia, the patient&#39;s left ankle was prepped and draped. The tourniquet was not positioned or utilized. An incision about 1 cm long was made in the&nbsp; previous incision and superficial dissection was carried to remove the lower broken screws. The wounds&nbsp; were thoroughly irrigated with copious amounts of antibiotics containing saline. Skin was closed in a&nbsp; layered fashion sterile dressing applied. Which CPT codes should be reported for this procedure?</p>', '20670, 12032', '20680', '20670 LT', '20680, 12032', '2022-06-09 08:31:20', '2022-06-09 08:31:20', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(872, 6, 26, 1, '<p>Pre and post operative diagnosis: Left humeral supracondylar fracture</p>\r\n\r\n<p><img alt=\"Icon\r\n\r\nDescription automatically generated\" src=\"data:image/png;base64,\" style=\"float:left; height:189px; width:5px\" /><img alt=\"Shape\r\n\r\nDescription automatically generated\" src=\"data:image/png;base64,\" style=\"float:left; height:387px; width:7px\" />Indication: 80-year old female fell in the nursing home, fracturing her left supracondylar humerus. Patient&nbsp; and family have been told of the risk and benefits and wished to proceed with surgery Technique: Patient was brought to the operating suite and placed in supine position on the operating table. General anesthesia was induced and antibiotics were given preoperatively. The left arm was prepped and&nbsp; draped with land marks identified. An incision from the midline of the arm to just distal of olecranon is&nbsp; performed. Dissection is performed. Dissection was carried down through the fascia to the bone. The&nbsp; fracture site was seen and traction was applied and a bone clamp achieving anatomic reduction. Two 3.5&nbsp; screws were placed and countersunk near anatomic alignment. A 10 hole locking large fragment plate from&nbsp; Synthes placed on the anterolateral aspect of the humerus. Multiple locking and standard screw fixation&nbsp; both proximally and distally for a stable construct. Next attention was diverted towards intercondylar&nbsp; extension. Multiplanar C arm fluoroscopic imaging confirmed good anatomic alignment with good screw&nbsp; lengths and nice construct. Wound was irrigated thoroughly and closed in layered fashion over a drain.&nbsp; Sterile dressing applied. Patient taken to the recovery room in stable condition. No operative&nbsp; complications. Estimated blood loss was 300 cc and all counts were correct.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>A)&nbsp;24545-LT</p>\r\n\r\n<p>B)&nbsp;24575-LT</p>\r\n\r\n<p>C)&nbsp;24546-LT</p>\r\n\r\n<p>D)&nbsp;24577-LT</p>', '24575-LT', '24577-LT', '24546-LT', '24545-LT', '2022-06-09 08:35:34', '2023-04-17 06:58:42', 'ans_d'),
(873, 6, 26, 1, '<p>A surgical arthroscopy of the left knee is performed for a patient with arthropathy associated with&nbsp; tuberculosis. What CPT codes are used for reporting this scenario?</p>', '29871-LT', '29843-LT', '29843-LT, 29840-LT', '29843-LT, 29840-LT-59', '2022-06-09 08:36:49', '2022-06-09 08:36:49', 'ans_a'),
(874, 6, 26, 1, '<p>A 32-year-old male who underwent a previous repair of his flexor tendon a year ago presents today&nbsp; with sprained tendon. The injury occurred when he twisted his right leg while playing tackle football.&nbsp; Repairing the flexor tendon this time involves debridement of scar tissue and requires a tendon graft for&nbsp; repair. Which procedure coding combination best describes this encounter?</p>', '27659-RT,', '27654-RT,', '27652-RT, 20924', '27665-RT', '2022-06-09 08:38:05', '2022-06-09 08:38:05', 'ans_a');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(875, 6, 26, 1, '<p>Pre and post operative diagnosis</p>\r\n\r\n<p>Right tibial plateau fracture involving medial and lateral condyles.</p>\r\n\r\n<p>Right midshaft tibia fracture</p>\r\n\r\n<p>Technique: The patient was taken to the operating room and placed supine on the operating table where&nbsp; successful general anesthetic was performed. The right leg was prepped and draped in the usual sterile&nbsp; fashion. Appropriate preoperative antibiotics were given. A Medial incision was made over the tibial&nbsp; plateau, through skin and subcutaneous tissue below. A small fragment. T plate was placed up along the&nbsp; <img alt=\"Icon\r\n\r\nDescription automatically generated\" src=\"data:image/png;base64,\" style=\"float:left; height:189px; width:34px\" />medial tibial plateau, along the periosteum, which was not stripped. The plate was secured in a buttress&nbsp; fashion supporting the medial tibial plateau. Same was done for the lateral tibial plateau. An anterior lateral&nbsp; incision was made through the skin and subcutaneous tissue below.</p>\r\n\r\n<p><img alt=\"Shape\r\n\r\nDescription automatically generated\" src=\"data:image/png;base64,\" style=\"float:right; height:379px; width:22px\" />The fascia had been ruptured near the fracture site. The anterior compartment musculature was elevated&nbsp; off the tibia. Careful hemo stasis was applied throughout. There fracture was identified at the shaft of the&nbsp; tibia and reduced. It was held with large reduction forceps. Once this accomplished, attention was drawn&nbsp; to the tibial plateau laterally where a Zimmer periarticular plate was placed along the lateral border of the&nbsp; tibia. This was held with a clamp. Then was placed along the lateral border of the tibia. This was held with a&nbsp; clamp. Then 4.5 mm screws were placed across the tibia plateau. The patient&#39;s bone quality was extremely&nbsp; poor. There was significant amount of osteoporosis making it difficult for good bites with the screws. We&nbsp; were able to interlock the lateral screws with the medial plate using a combination of bolts and washers.&nbsp; This method provided a very stable proximal construct. The plate was then secured distally using a&nbsp; combination of interfragmentary screws and screwed through the plate using more 4.5 mm screws. Stable&nbsp; construct was identified. The wound was irrigated. C-arm images were satisfactory. The wound was closed&nbsp; with a combination of 2.0 Vicryl and 3.0 nylon running suture. Note that the fascia was not closed entirely&nbsp; laterally to allow for some compartment release.</p>', '27535-RT, 27758-RT', '27759-RT', '27536-RT, 27758-RT', '27540-RT, 27756-RT-51', '2022-06-09 08:40:43', '2022-06-09 08:40:43', 'ans_c'),
(876, 6, 26, 1, '<p>A surgeon performed a radical resection of both a malignant tumor from the soft tissue of the scalp and a&nbsp; malignant tumor of the mandible. A bone graft was completed during the same surgical session to the&nbsp; mandible. How would the surgeon code this procedure?</p>', '21015, 21215-51, 21045-51', '21015, 21045-59, 21215-51', '61501, 21045, 21215', '61501, 21045-59, 21215-51', '2022-06-09 08:42:26', '2022-06-09 08:42:26', 'ans_b'),
(877, 6, 26, 1, '<p>Dr. Rami, an orthopedic surgeon, removed prosthesis from Cindy&#39;s left knee. Dr. Rami inserted a spacer&nbsp; during the same surgery. How would you code for Dr. Rami&#39;s services? &middot;</p>', '27445-LT', '27310', '27331', '27488-LT', '2022-06-09 08:44:02', '2022-06-09 08:44:02', 'ans_d'),
(878, 6, 26, 1, '<p>During a postpartum check-up, Kayla told Dr. Terry, her OBGYN, about a recurrent lump on her right&nbsp; wrist. Kayla has a history of ganglion cysts on both wrists. Dr. Terry refers Kayla to Dr. Eagen, a general&nbsp; surgeon, who excises the cyst. How would you code Dr. Eagen&#39;s services?</p>', '25112-RT', '26160', '25111', 'All services are included in postpartum care and should not be reported separately', '2022-06-09 08:46:52', '2022-06-09 08:46:52', 'ans_a');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(879, 6, 26, 1, '<p>A patient has been diagnosed with Treacher-Collins Syndrome. A surgeon performs LeFort II to&nbsp; reconstruct the midface by anterior intrusion. How would you code for the surgeon&#39;s services?</p>', '21150-22', '21141', '21150', '21151', '2022-06-09 08:48:47', '2022-06-09 08:48:47', 'ans_c'),
(880, 6, 26, 1, '<p>Bart&#39;s jaw needs to be set back. He consults with Dr. Todd, an orthopedic surgeon, and is scheduled for&nbsp; the recommended procedure. Dr. Todd reconstructs the mandibular rami by sagittal split with internal rigid&nbsp; fixation. She uses a saw to cut the mandible bone along the inside, top, and outside surfaces. Then, she uses&nbsp; osteotomes to pry the mandible bone apart along cuts in the sagittal plane. Once separated, she moves the&nbsp; mandible into the desired position and stabilized the bone with screws. She repairs a one cm incision site of&nbsp;</p>\r\n\r\n<p>the skin and mucosa membranes with sutures. How would you code for Dr. Todd&#39;s services?</p>', '21196, 13131-51', '21195', '21196', '21196, 12001', '2022-06-09 08:50:50', '2022-06-09 08:50:50', 'ans_c'),
(881, 6, 26, 1, '<p>What code(s) would be used to report the transfer of tendons to restore intrinsic function on all four&nbsp; fingers on the left hand with layered closure?</p>', '26498, 12041', '26492', '26498 X 4', '26498-LT .', '2022-06-09 08:54:54', '2022-06-09 08:54:54', 'ans_d'),
(882, 6, 26, 1, '<p>Judy noticed swelling in both her hips. She is referred to Dr. Roy, an orthopedic surgeon, who performs a&nbsp; fasciotomy on both hips. Prior to surgery, Dr. Roy obtains the patient&#39;s permission to have a resident observe&nbsp; the surgery. What is the correct code for Dr. Roy&#39;s services?</p>', '27025 x 2', '27025-50', '27025', '27025-80', '2022-06-09 09:04:11', '2022-06-09 09:04:11', 'ans_b'),
(883, 6, 26, 1, '<p>Zachery injured his back while playing tennis; his injury required surgery. He was taken to the operating&nbsp; room where an orthopedic surgeon preformed an anterior osteotomy, including diskectomy to three&nbsp; thoracic vertebral segments. Additionally, Zachery required a structural bone graft obtained from a cadaver.&nbsp; How would you code this procedure?</p>', '22222, 22226 X 2, 20931', '22226, 22222, 20931-51', '22216, 22212, 20938', '22212, 22216 X 2, 20938-51', '2022-06-09 09:06:49', '2022-06-09 09:06:49', 'ans_a'),
(884, 6, 26, 1, '<p>A patient noticed a mass on his neck. He was referred to a general surgeon who determined that the&nbsp; mass was a 5 cm soft tissue lipoma. The surgeon took the patient to the operating room and removed the&nbsp; lipoma. The surgeon dictated in the operative report that the procedure was deep. How would you code the&nbsp; surgeon&#39;s services?</p>', '21554', '21556', '21556, 15819-51', '21555, 15819-59', '2022-06-09 09:08:47', '2022-06-09 09:08:47', 'ans_a'),
(885, 6, 26, 1, '<p>A bronchoscopy is</p>', 'always a surgical procedure', 'aIways a diagnostic procedure', 'sometimes performed unilaterally or bilaterally', 'always performed bilaterally', '2022-06-09 09:11:51', '2022-06-09 09:11:51', 'ans_c'),
(886, 6, 26, 1, '<p>A 22-year-old female sustained a dislocation of the right elbow with a medial epicondyle fracture while on vacation. The patient was put under general anesthesia and the elbow was reduced and was stable. The</p>\r\n\r\n<p>medial elbow was held in the appropriate position and was reduced in acceptable position and elevated to&nbsp; treat non-surgically. A long arm splint was applied. The patient is referred to an orthopedist when she&nbsp; returns to her home state in a few days. What CPT&reg; code(s) are reported?</p>', '24575-54-RT, 24615-54-51-RT', '24576-54-RT, 24620-54-51-RT', '24577-54-RT, 24600-54-51-RT', '24565-54-RT, 24605-54-51-RT', '2022-06-09 09:16:09', '2022-06-09 09:16:09', 'ans_d'),
(887, 6, 26, 1, '<p>A 45-year-old presents to the operating room with a right index trigger finger and left shoulder bursitis. The left shoulder was injected with 1 cc of Xylocaine, 1 cc of Celestone, and 1 cc of Marcaine. An&nbsp; incision was made over the A1 pulley in the distal transverse palmar crease, about an inch in length. This&nbsp; incision was taken through skin and subcutaneous tissue. The Al pulley was identified and released in its&nbsp; entirety. The wound was irrigated with antibiotic saline solution. The subcutaneous tissue was injected&nbsp; with Marcaine without epinephrine. The skin was closed with 4-0 Ethilon suture. Clean dressing was&nbsp; applied. What CPT&reg; codes are reported?</p>', '26055-F6, 20610-76-LT', '20552-F6, 20605-52-LT', '26055-F6, 20610-51-LT', '20553-F6, 20610-51-LT', '2022-06-09 09:21:03', '2022-06-09 09:21:03', 'ans_c'),
(888, 6, 26, 1, '<p>A patient presents with a healed fracture of the left ankle. The patient was placed on the OR table in the&nbsp; supine position. After satisfactory induction of general anesthesia, the patient&rsquo;s left ankle was prepped and&nbsp; draped. A small incision about 1 cm long was made in the previous incision. The lower screws were&nbsp; removed. Another small incision was made just lateral about 1 cm long. The upper screws were removed&nbsp; from the plate. Both wounds were thoroughly irrigated with copious amounts of antibiotic containing&nbsp; saline. Skin was closed in a layered fashion and sterile dressing applied. What CPT&reg; code(s) should be&nbsp; reported?</p>', '20680-LT', '20680-LT, 20680-59-LT', '20670-LT', '20680-LT, 20670-59-LT', '2022-06-09 09:22:44', '2022-06-09 09:22:44', 'ans_a'),
(889, 6, 26, 1, '<p>A patient is seen in the hospital&rsquo;s outpatient surgical area with a diagnosis of a displaced comminuted&nbsp; fracture of the lateral condyle, right elbow. An ORIF (open reduction) procedure was performed and&nbsp; included the following techniques: An incision was made in the area of the lateral epicondyle. This was&nbsp; carried through subcutaneous tissue, and the fracture site was easily exposed. Inspection revealed the&nbsp; fragment to be rotated in two places about 90 degrees. It was possible to manually reduce this quite easily,&nbsp; and the manipulation resulted in an almost anatomic reduction. This was fixed with two pins driven across the humerus. The pins were cut off below skin level. The wound was closed with plain catgut&nbsp; subcutaneously and 5-0 nylon for the skin. Dressings and a long arm cast were applied. What CPT&reg;&nbsp;&nbsp; codes are reported?</p>', '24579-RT, 29065-51-RT', '24577-RT', '24579-RT', '24575-RT', '2022-06-09 09:24:15', '2022-06-09 09:24:15', 'ans_c'),
(890, 6, 26, 1, '<p>A 47-year-old patient was previously treated with external fixation for a Grade III left tibial fracture. There is now nonunion of the left proximal tibia and he is admitted for open reduction of tibia with bone&nbsp; grafting. Approximately 30 grams of cancellous bone was harvested from the iliac crest. The fracture site&nbsp; was exposed and the area of nonunion was osteotomized, cleaned, and repositioned. Intrafragmentary&nbsp; compression was applied with three screws. The harvested bone graft was packed into the fracture site.&nbsp; What CPT&reg; and ICD-10-CM codes are reported?</p>', '27724-LT, S82.192N', '27722-LT, S82.192K', '27722-LT, S82.192K', '27724-RT, S82.192N', '2022-06-09 09:26:21', '2022-06-09 09:26:21', 'ans_a'),
(891, 6, 26, 1, '<p>A Grade I, high velocity open right femur shaft fracture was incurred when a 15-year-old female&nbsp; pedestrian was hit by a car. She was taken to the operating room within four hours of her injury for&nbsp; thorough irrigation and debridement, including excision of devitalized bone. The patient was prepped,&nbsp; draped, and positioned. Intramedullary rodding was carried out with proximal and distal locking screws.&nbsp; What CPT&reg; codes should be reported?</p>', '27506-RT, 11044-51-RT', '27506-RT, 11012-51-RT', '27507-RT, 11012-51-RT', '27507-RT, 11044-51-RT', '2022-06-09 09:27:30', '2022-06-09 09:27:30', 'ans_b'),
(892, 6, 26, 1, '<p>A 49-year-old female had two previous rotator cuff procedures and now has difficulty with shoulder&nbsp; function, deltoid muscle function, and axillary nerve function. An arthrogram is scheduled. After&nbsp; preparation, the shoulder is anesthetized with 1% lidocaine, 8 cc without epinephrine. The needle was&nbsp; placed into the shoulder area posteriorly under image intensification. It appeared as if the dye was in the&nbsp; shoulder joint. She was moved and a good return of flow was obtained. The shoulder was then mobilized&nbsp; and there was no evidence of any cuff tear from the posterior arthrogram. What CPT&reg; codes are reported?</p>', '20551, 73040-26', '20610, 73040-26', '23350, 73040-26', '20552, 73040-26', '2022-06-09 09:28:37', '2022-06-09 09:28:37', 'ans_c'),
(893, 6, 26, 1, '<p>A 31-year-old secretary returns to the office with continued complaints of numbness involving three radial digits of the upper right extremity. Upon examination, she has a positive Tinel&rsquo;s test of the median nerve in the left wrist. Anti-inflammatory medication has not relieved her pain. Previous electrodiagnostic studies show sensory mononeuropathy. She has clinical findings consistent with carpal tunnel syndrome. She has failed physical therapy and presents for injection of the left carpal canal. The left carpal area is prepped&nbsp; sterilely. A 1.5 inch 25 or 22 gauge needle is inserted radial to the palmaris longus or ulnar to the carpi radialis tendon at an oblique angle of approximately 30 degrees. The needle is advanced a short distance&nbsp; about 1 or 2 cm observing for any complaints of paresthesias or pain in a median nerve distribution. The&nbsp; mixture of 1 cc of 1% lidocaine and 40 mg of Kenalog-10 is injected slowly along the median nerve. The injection area is cleansed and a bandage is applied to the site. What codes are</p>\r\n\r\n<p>reported?</p>', '20526, J3301 x 4', '20551, J3301 x 4', '20526, J3301', '20550, J3301', '2022-06-09 09:29:45', '2022-06-09 09:29:45', 'ans_a'),
(894, 6, 26, 1, '<p>An elderly female presented with increasing pain in her left dorsal foot. The patient was brought to the&nbsp; operating room, and placed under general anesthesia. A curvilinear incision was centered over the lesion&nbsp; itself. Soft tissue dissection was carried through to the ganglion. The ganglion was clearly identified as a&nbsp; gelatinous material. It was excised directly off the bone and sent to pathology. There was noted to be a&nbsp; large bony spur at the level of the head of the 1st metatarsal. Using double action rongeurs, the spur itself&nbsp; was removed and sequestrectomy was performed. A rasp was utilized to smooth the bone surface. The&nbsp; eburnated bony surface was then covered, utilizing bone wax. The wound was irrigated and closed in&nbsp; layers. What CPT&reg; codes are reported?</p>', '28122-LT2, 28090-51-LT', '28111-LT, 28092-51-LT', '28045-LT, 28090-51-LT', '28100-LT, 28092-51-LT', '2022-06-09 09:30:53', '2022-06-09 09:30:53', 'ans_a'),
(895, 6, 26, 1, '<p>Under general anesthesia, a 45-year-old patient was sterilely prepped. The wrist joint was injected with&nbsp; Marcaine and epinephrine. Three arthroscopic portals were created. The articulating surface between the&nbsp; scaphoid and the lunate clearly showed disruption of the ligamentous structures. We could see soft tissue&nbsp; pouching out into the joint; this was debrided. There was abnormal motion noted within the scapholunate&nbsp; articulation. At this point the C-arm was brought in; arthroscopic instruments were placed in the joint and&nbsp; confirmed the location of the shaver as a probe in the scapholunate ligament. There was a significant gap&nbsp; between the capitate and lunate. K-wire was utilized from the dorsal surface into the lunate, restoring the&nbsp; space. Further examination revealed gross instability between the capitate and lunate. With the wrist in&nbsp; neutral position, a K-wire was passed through the scaphoid, through the capitate and into the hamate. This&nbsp; provided stabilization of the wrist joint. Stitches were placed, and a thumb spica cast was applied. What&nbsp; CPT&reg; code(s) should be reported?</p>', '29847', '29840', '29846', '29847, 29840-51', '2022-06-09 09:34:32', '2022-06-09 09:34:32', 'ans_a'),
(896, 6, 26, 1, '<p>A patient presents to the hospital with an embedded piece of wood in his left shoulder. The patient&nbsp; stated that he was cutting down a tree when a limb fell and punctured his shoulder. Dr. Weber, a surgeon,&nbsp; administered general anesthesia for removal of a foreign body to a patient shoulder. What code captures the&nbsp; surgeon&#39;s services?</p>', '23330-22', '00450-P1', '23330-47', '00450-47', '2022-06-09 09:35:57', '2022-06-09 09:35:57', 'ans_c'),
(897, 6, 26, 1, '<p>52‐year‐old female has a mass growing on her right flank for several years. It has finally&nbsp; gotten significantly larger and is beginning to bother her. She is brought to the Operating&nbsp; Room for definitive excision. An incision was made directly overlying the mass. The mass&nbsp; was down into the subcutaneous tissue and the surgeon encountered a well encapsulated&nbsp; lipoma approximately 4 centimeters. This was excised primarily bluntly with a few&nbsp; attachments divided with electrocautery. What CPT&reg; should be reported?</p>', '21932, D17.39', '21935, D17.1', '21931, D17.1', '21925, D17.9', '2022-06-09 09:37:12', '2022-06-09 09:37:12', 'ans_c'),
(898, 6, 26, 1, '<p>PREOPERATIVE DIAGNOSIS: Right scaphoid fracture. TYPE OF PROCEDURE: Open reduction&nbsp; and internal fixation of right scaphoid fracture. DESCRIPTION OF PROCEDURE: The patient&nbsp; was brought to the operating room, anesthesia having been administered. The right upper&nbsp; extremity was prepped and draped in a sterile manner. The limb was elevated,&nbsp; exsanguinated, and a pneumatic arm tourniquet was elevated. An incision was made over&nbsp; the dorsal radial aspect of the right wrist. Skin flaps were elevated. Cutaneous nerve&nbsp; branches were identified and very gently retracted. The interval between the second and&nbsp; third dorsal compartment tendons was identified and entered. The respective tendons&nbsp; were retracted. A dorsal capsulotomy incision was made, and the fracture was visualized.&nbsp; There did not appear to be any type of significant defect at the fracture site. A 0.045&nbsp; Kirschner wire was then used as a guidewire, extending from the proximal pole of the&nbsp; scaphoid distalward. The guidewire was positioned appropriately and then measured. A&nbsp; 25-mm Acutrak drill bit was drilled to 25 mm. A 22.5-mm screw was selected and inserted&nbsp; and rigid internal fixation was accomplished in this fashion. This was visualized under the&nbsp; OEC imaging device in multiple projections. The wound was irrigated and closed in layers.&nbsp; Sterile dressings were then applied. The patient tolerated the procedure well and left the&nbsp; operating room in stable condition. What code should be used for this procedure?&nbsp;</p>', '25628-RT', '25624-RT', '25645-RT', '25651-RT', '2022-06-09 09:38:14', '2022-06-09 09:38:14', 'ans_a'),
(899, 6, 26, 1, '<p>An infant with genu valgum is brought to the operating room to have a bilateral medial&nbsp; distal femur hemiepiphysiodesis done. On each knee, the C-arm was used to localize the&nbsp; growth plate. With the growth plate localized, an incision was made medially on both sides.&nbsp; This was taken down to the fascia, which was opened. The periosteum was not opened. The&nbsp; Orthofix figure-of-eight plate was placed and checked with X-ray. We then irrigated and&nbsp; closed the medial fascia with 0 Vicryl suture. The skin was closed with 2-0 Vicryl and 3-0&nbsp; Monocryl. What procedure code is reported?</p>', '27470-50', '27475-50', '27477-50', '27485-50', '2022-06-09 09:39:09', '2022-06-09 09:39:09', 'ans_d'),
(900, 6, 26, 1, '<p>42‐year‐old male has a frozen left shoulder. An arthroscope was inserted in the posterior&nbsp; portal in the glenohumeral joint. The articular cartilage was normal except for some minimal&nbsp; grade III‐IV changes, about 5% of the humerus just adjacent to the rotator cuff insertion of&nbsp; the supraspinatus. The biceps was inflamed, not torn at all. The superior labrum was not&nbsp; torn at all, the labrum was completely intact. The rotator cuff was completely intact. An&nbsp; anterior portal was established high in the rotator interval. The rotator interval was very&nbsp; thick and contracted and this was released with electrocautery and the Bovie including the&nbsp; superior glenohumeral ligament. After this was all released, the middle glenohumeral&nbsp; ligament was released as well as the tendinous portion of the subscapularis. After this was&nbsp; all done with a shaver and electrocautery, the arthroscope was placed anteriorly and the&nbsp; shaver was used to debride some of the posterior capsule and the posterior capsule was&nbsp; released in its posterosuperior and then posteroinferior aspect. After this was done, the&nbsp; arthroscope was then placed back posteriorly and used to release the anteroinferior capsule&nbsp; down to 6&rsquo;oclock. This was done with electrocautery. The arthroscope was then placed&nbsp; anteriorly and used to release the posteroinferior capsule. The arthroscope was then placed&nbsp; anteriorly and used to release the posteroinferior capsule. The arthroscope was then placed&nbsp; back posteriorly and used to confirm that there was still one little strip of capsule around&nbsp; the biceps superiorly and there was one little strip from 6‐7 o&rsquo;clock posteroinferiorly that&nbsp; was only partially cut. The rest of the capsule was completely circumferentially released.&nbsp; What CPT&reg; code describes this procedure?</p>', '29823-LT', '29822-LT', '29805‐LT, 29806‐51‐LT', '29825‐LT', '2022-06-09 09:41:01', '2022-06-20 05:57:02', 'ans_a'),
(901, 6, 26, 1, '<p>After adequate anesthesia was obtained the patient was turned prone in a kneeling position&nbsp; on the spinal table. A lower midline lumbar incision was made and the soft tissues divided&nbsp; down to the spinous processes. The soft tissues were stripped way from the lamina down to&nbsp; the facets and discectomies and laminectomies were then carried out at L3‐4, L4‐5 and L5‐ S1. Interbody fusions were set up for the lower three levels using the Danek allografts and&nbsp; augmented with structural autogenous bone from the iliac crest. The posterior&nbsp; instrumentation of a 5.5 mm diameter titanium rod was then cut to the appropriate length&nbsp; and bent to confirm to the normal lordotic curve. It was then slid immediately onto the&nbsp; bone screws and at each level compression was carried out as each of the two bolts were&nbsp; tightened so that the interbody fusions would be snug and as tight as possible. Select the&nbsp; appropriate CPT&reg; codes for this visit?</p>', '22612, 22614 x 2, 22842, 20938, 20930', '22533, 22534 x 2, 22842', '22630, 22632 x 2, 22842, 20938, 20930', '22554, 22632 x 2, 22842', '2022-06-09 09:42:09', '2022-06-09 09:42:09', 'ans_c'),
(902, 6, 26, 1, '<p>PREOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna.&nbsp; POSTOPERATIVE DIAGNOSIS: Displaced impacted Colles fracture, left distal radius and ulna.&nbsp; OPERATIVE PROCEDURE: Reduction with application external fixator, left wrist fracture&nbsp; FINDINGS: The patient is a 46‐year‐old right‐hand‐dominant female who fell off stairs 4 to 5&nbsp; days ago sustaining an impacted distal radius fracture with possible intraarticular&nbsp; component and an associated ulnar styloid fracture. Today in surgery, fracture was reduced&nbsp; anatomically and an external fixator was applied. PROCEDURE: Under satisfactory general&nbsp; anesthesia, the fracture was manipulated and C‐arm images were checked. The left upper&nbsp; extremity was prepped and draped in the usual sterile orthopedic fashion. Two small&nbsp; incisions were made over the second metacarpal and after removing soft tissues including&nbsp; tendinous structures out of the way, drawing was carried out and blunt‐tipped pins were&nbsp; placed for the EBI external fixator. The frame was next placed and the site for the proximal &nbsp;pins was chosen. Small incision was made. Subcutaneous tissues were carried out of the&nbsp; way. The pin guide was placed and 2 holes were drilled and blunt‐tipped pins placed. Fixator&nbsp; was assembled. C‐arm images were checked. Fracture reduction appeared to be anatomic.&nbsp; Suturing was carried out where needed with 4‐0 Vicryl interrupted subcutaneous and 4‐0&nbsp; nylon interrupted sutures. Sterile dressings were applied. Vascular supply was noted to be&nbsp; satisfactory. Final frame tightening was carried out. What CPT&reg; code(s) is/are reported?</p>', '25600‐LT, 20692‐51', '25605‐ LT, 20690‐51', '25606‐LT', '25607‐LT', '2022-06-09 09:43:18', '2022-06-09 09:43:18', 'ans_b'),
(903, 6, 26, 1, '<p>The patient is a 66‐year‐old female who presents with Dupuytren&#39;s disease in the right palm&nbsp; and ring finger. This results in a contracture of the ring digit MP joint. She is having a&nbsp; subtotal palmar fasciectomy for Dupuytren&#39;s disease right ring digit and palm. An extensile&nbsp; Brunner incision was then made beginning in the proximal palm and extending to the ring&nbsp; finger PIP crease. This exposed a large pretendinous cord arising from the palmar fascia&nbsp; extending distally over the flexor tendons of the ring finger. The fascial attachments to the&nbsp; flexor tendon sheath were released. At the level of the metacarpophalangeal crease, one&nbsp; band arose from the central pretendinous cord‐one coursing toward the middle finger. The&nbsp; digital nerve was identified, and this diseased fascia was also excised. What procedure&nbsp; code(s) should be used?&nbsp;</p>', '26123‐RT, 26125‐F7', '26121‐RT', '26035‐RT', '26040‐RT', '2022-06-09 09:44:20', '2022-06-09 09:44:20', 'ans_a'),
(904, 6, 26, 1, '<p>This is a 32‐year‐old female who presents today with sacroilitis. On the physical exam there&nbsp; was pain on palpation of the left and right sacroiliac joint and fluoroscopic guidance was&nbsp; done for the needle positioning. Then 80 mg of Depo‐Medrol and 1 mL of bupivacaine at&nbsp; 0.5% was injected into the left and right sacroiliac joint with a 22 gauge needle. The patient&nbsp; was able to walk from the exam room without difficulty. Follow up will be as needed. The&nbsp; correct CPT&reg; code(s) is (are):</p>', '20611', '27096‐50, 77012', '27096‐50', '27096, 27096‐51, 77012', '2022-06-09 09:45:34', '2022-06-09 09:45:34', 'ans_c'),
(905, 6, 26, 1, '<p>PREOPERATIVE DIAGNOSIS: Medial meniscus tear, right knee POSTOPERATIVE&nbsp; DIAGNOSIS: Medial meniscus tear, extensive synovitis with an impingement medial synovial&nbsp; plica, right knee TITLE OF PROCEDURE: Diagnostic operative arthroscopy, partial medial&nbsp; meniscectomy and synovectomy, right knee The patent was brought to the operating room,&nbsp; placed in the supine position after which he underwent general anesthesia. The right knee&nbsp; was then prepped and draped in the usual sterile fashion. The arthroscope was introduced&nbsp; through an anterolateral portal, interim portal created anteromedially. The suprapatellar&nbsp; pouch was inspected. The findings on the patella and the femoral groove were as noted&nbsp; above. An intra‐articular shaver was introduced to debride the loose fibrillated articular&nbsp; cartilage from the medial patellar facet. The hypertrophic synovial scarring between the&nbsp; patella and the femoral groove was debrided. The hypertrophic impinging medial synovial&nbsp; plica was resected. The hypertrophic synovial scarring overlying the intercondylar notch and&nbsp; lateral compartment was debrided. The medial compartment was inspected. An upbiting&nbsp; basket was introduced to transect the base of the degenerative posterior horn flap tear.&nbsp; This was removed with a grasper. The meniscus was then further contoured and balanced&nbsp; with an intra‐articular shaver, reprobed and found to be stable. The cruciate ligaments were&nbsp; probed, palpated and found to be intact. The lateral compartment was then inspected. The lateral meniscus was probed and found to be intact. The loose fibrillated articular&nbsp; cartilage along the lateral tibial plateau was debrided with the intra‐articular shaver. The&nbsp; knee joint was then thoroughly irrigated with the arthroscope. The arthroscope was then&nbsp; removed. Skin portals were closed with 3‐0 nylon sutures. A sterile dressing was applied.&nbsp; The patient was then awakened and sent to the recovery room in stable condition. What&nbsp; CPT&reg; and ICD‐10‐CM codes should be reported?</p>', '29880‐RT, M23.203, M65.80, M94.261, M22.41', '29881‐RT, M23.211, M65.861, M94.261, M22.41', '29881‐RT, M23.221, M65.861, M94.261, M22.41', '29880‐RT, 29877‐59‐RT, M23.621, M65.80, M94.261, M22.41', '2022-06-09 09:48:05', '2023-04-24 05:01:17', 'ans_c'),
(906, 7, 27, 1, '<p><strong>Chief Complaint: 1. Chest pains/heart problems&nbsp;</strong></p>\r\n\r\n<p><strong>History of Present Illness HPI: 6-year-old male brought into office as a new patient by his Dad for chest pain and headaches. Chest pain started about two weeks ago and occurs daily. It happens about 1-2 times/day but is not associated with eating or activity. Patient reports feeling that his heart is beating quickly. Patient has also complained of intermittent headaches for the past few days. No associated nausea, vomiting, vision changes, sinus pressure, congestion, or sore throat. He has not taken any medications for either symptoms.&nbsp;</strong></p>\r\n\r\n<p><strong>No family history of cardiac disease.&nbsp;</strong></p>\r\n\r\n<p><strong>Current Medications Not-Talking/PRN</strong></p>\r\n\r\n<p><strong>&bull; Albuterol Inhaler (ProAir HFA) (10M) 90mcg/Inh Inhaler as directed inhaled.&nbsp;</strong></p>\r\n\r\n<p><strong>Medication List reviewed and reconciled with the patient&#39;s Past Medical History Asthma.&nbsp;</strong></p>\r\n\r\n<p><strong>Surgical History Denies Past Surgical History&nbsp;</strong></p>\r\n\r\n<p><strong>Family History father: alive, ADHD, bipolar disorder</strong></p>\r\n\r\n<p><strong>Mother: alive&nbsp;</strong></p>\r\n\r\n<p><strong>Paternal great grandfather died of heart attack at 42 years of age.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>Social History</strong></p>\r\n\r\n<p><strong>First grade student; no learning disabilities known</strong></p>\r\n\r\n<p><strong>Vision impaired: No</strong></p>\r\n\r\n<p><strong>Hearing impaired: No</strong></p>\r\n\r\n<p><strong>Tobacco Use: no</strong></p>\r\n\r\n<p><strong>Exposed to 2nd hand smoke: No</strong></p>\r\n\r\n<p><strong>Travelled in the last 6 months: No.&nbsp;</strong></p>\r\n\r\n<p><strong>Allergies N.K.D.A.&nbsp;</strong></p>\r\n\r\n<p><strong>Hospitalization/Major Diagnostic Procedure Denies Past Hospitalization&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>Review of Systems</strong></p>\r\n\r\n<p><strong>General/Constitutional: cough Denies. Abdominal pain Denies. Nausea Denies. Vomiting Denies. chest pain Admits. Shortness of Breath Denies. Dizziness Denies. Change in appetite Denies. Fatigue Denies. Fever Denies. Headache Admits.&nbsp;</strong></p>\r\n\r\n<p><strong>Vital Signs Ht 47, Wt 58.4, BMI 18.59, BP 117/72 mm Hg, repeat:105/58, Pulse 87, Pain scale 0 1-10, Oxygen Sat Pre 98 %,&nbsp; Ht % 36.41 %, Wt % 82.17 %, BMI % 93.38 %, Ht-cm 119.38 cm, Wt-kg 26.49 kg, Weight Change 5 lbs.&nbsp;</strong></p>\r\n\r\n<p><strong>Examination General Examination: GENERAL APPEARANCE: alert, in no acute distress, well developed, well nourished.</strong></p>\r\n\r\n<p><strong>HEAD: normocephalic, atraumatic.</strong></p>\r\n\r\n<p><strong>EYES: pupils equal, conjunctiva clear, no discharge.</strong></p>\r\n\r\n<p><strong>EARS: both ears, tympanic membrane:, intact, clear, external auditory canal clear.&nbsp;</strong></p>\r\n\r\n<p><strong>THROAT: clear, no erythema, no exudate, uvula midline.</strong></p>\r\n\r\n<p><strong>NOSE: nares patent, turbinates pale and swollen.</strong></p>\r\n\r\n<p><strong>NECK/THYROID: neck supple, full range of motion.</strong></p>\r\n\r\n<p><strong>ORAL CAVITY: mucosa moist, no lesions.</strong></p>\r\n\r\n<p><strong>LYMPH NODES: no cervical adenopathy.</strong></p>\r\n\r\n<p><strong>LUNGS: clear to auscultation bilaterally, no wheezes, no rales, no rhonchi.</strong></p>\r\n\r\n<p><strong>HEART: regular rate and rhythm, no murmurs, Sl, S2 normal.</strong></p>\r\n\r\n<p><strong>CHEST: normal shape and expansion, no subcostal or intercostal retractions.</strong></p>\r\n\r\n<p><strong>ABDOMEN: soft, nontender, nondistended, no guarding or rigidity, no hepatosplenomegaly.</strong></p>\r\n\r\n<p><strong>PERIPHERAL PULSES: 2+ radial.</strong></p>\r\n\r\n<p><strong>NEUROLOGIC: nonfocal, alert and oriented, normal strength, tone and reflexes , gait normal.&nbsp;</strong></p>\r\n\r\n<p><strong>Assessment. 1. Chest pain, unspecified</strong></p>\r\n\r\n<p><strong>2. Headache, unspecified&nbsp;</strong></p>\r\n\r\n<p><strong>Treatment Plan.&nbsp;</strong></p>\r\n\r\n<p><strong>1. Chest pain, unspecified Routine, 12 lead EKG with Interp &amp; Report performed.&nbsp;</strong></p>\r\n\r\n<p><strong>Normal.IMAGING: X-RAY CHEST 2 VIEWS ordered Notes: EKG reassuring with sinus arrhythmia, likely normal variant. Will order chest x-ray to evaluate further. RTC in 1-2 weeks after radiograph is completed. Consider cardiology referral if chest pain persists. Present to ER If chest pain is severe, does not go away quickly, or if he has associated dizziness or syncope.</strong></p>\r\n\r\n<p><strong>2. Headache, unspecified Start Ibuprofen Suspension, 100 MG/SML, 10 ml with food or milk as needed for pain, Orally, Three times a day, 5 days, 150 ml, Refills 0. Start Fluticasone Propionate Suspension, 50 MCG/ACT, 1 spray in each nostril once a day, 30 day(s), 1 Bottle, Refills 2 3. Allergic rhinitis. Will treat with nasal steroid spray to see if there is improvement in headaches. May give ibuprofen as needed for headache pain. Encouraged healthy habits include increased water intake, healthy well-balanced meals, regular exercise, decreased screen time. RTC as needed if headaches persist. Follow Up2 Weeks (Reason: Follow up chest pain) Assign appropriate E&amp;M code and all applicable ICD-10 diagnosis codes.</strong></p>', 'A) 99214-25, 93010, R07.9, R51.9, J30.9', 'B) 99204-25, 93000, R07.9, R51.9, J30.9', 'C) 99212.25, 93010, R07.9, R51.9, J30.9', 'D) 99203-25, 93000, j30.9', '2022-06-09 09:48:58', '2022-07-05 10:27:30', 'ans_b'),
(907, 6, 26, 1, '<p>A 61‐year‐old gentleman with a history of a fall while intoxicated suffered a blow to the&nbsp; forehead and imaging revealed a posteriorly displaced odontoid fracture. The patient was&nbsp; taken into the Operating Room, and placed supine on the operating room table. Under mild&nbsp; sedation, the patient was placed in Gardner‐Wells tongs and gentle axial traction under&nbsp; fluoroscopy was performed to gently try to reduce the fracture. It did reduce partially&nbsp; without any change in the neurologic examination. More manipulation would be necessary&nbsp; and it was decided to intubate and use fiberoptic technique. The anterior neck was prepped&nbsp; and draped and an incision was made in a skin crease overlying the C 4‐C5 area. Using hand‐ held retractors, the ventral aspect of the spine was identified and the C2‐C3 disk space was&nbsp; identified using lateral fluoroscopy. Using some pressure upon the ventral aspect of the C2&nbsp; body, we were able to achieve a satisfactory reduction of the fracture. Under direct AP and&nbsp; lateral fluoroscopic guidance, a Kirschner wire was advanced into the C2 body through the&nbsp; fracture line and into the odontoid process. This was then drilled, and a 42 millimeter&nbsp; cannulated lag screw was advanced through the C2 body into the odontoid process. What&nbsp; procedure code should be used?</p>', '22505', '22305', '22315', '22318', '2022-06-09 09:49:13', '2022-06-09 09:49:13', 'ans_d'),
(908, 7, 27, 1, '<p><strong>CC: Cough, weakness&nbsp;</strong></p>\r\n\r\n<p><strong>HPI: A 25yr old presents to the office with complaints of cough for 2 days with generalized weakness and patient states his neighbour tested COVID-19 positive and he was around him recently.&nbsp;</strong></p>\r\n\r\n<p><strong>ROS: Resp: Cough, no sob GI: no abdominal pain Allergies: No known medicine, food, or environmental allergies&nbsp;</strong></p>\r\n\r\n<p><strong>PMH: NIL</strong></p>\r\n\r\n<p><strong>Physical Exam: Vitals: Temperature, 98.6 F; heart rate 88; respiratory rate, 22; blood pressure 120/80 General: She is well appearing but anxious, Respiratory: No abnormal lung sounds.&nbsp;</strong></p>\r\n\r\n<p><strong>Laboratory Studies: Rapid SARS Antigen test for COVID-19 completed. Negative. Chest X-ray: Impression: Normal&nbsp;</strong></p>\r\n\r\n<p><strong>Assessment and Plan Cough, Generalized Weakness, Negative for COVID-19&nbsp;</strong></p>\r\n\r\n<p><strong>Treatment: OTC cough suppressants&nbsp;</strong></p>\r\n\r\n<p><strong>Assign all applicable ICD-10 diagnosis codes for this encounter.</strong></p>', 'A) U07.1, Z20.822', 'B) Z20.822', 'C) R05.9, R53.1, Z20.822', 'D) R05.9, R53.1', '2022-06-09 09:53:44', '2023-04-14 08:13:16', 'ans_c'),
(909, 7, 27, 1, '<p><strong>A 74-year-old established patient was seen in the office today for blurred vision which has continued to worsen; right eye worse than left. He is unable to see well enough to drive now. Visual acuity on exam is 20/60 O.D. and 20/40 O.S. with corrections. After discussion, recommendation was to undergo cataract surgery for an age-related cataract of the right eye. The patient agreed to this and was scheduled for this procedure in 2 weeks. He was counselled on the risks and benefits of undergoing cataract surgery. The post-operative care was also explained. The patient verbalized understanding of this information. Assign the E&amp;M code and all applicable ICD-10 diagnosis codes.</strong></p>', 'A) 99214-57, H25.11', 'B) 99213-57, H25.12', 'C) 99214, H25.11', 'D) 99213, H25.11', '2022-06-09 09:59:21', '2022-07-05 10:28:16', 'ans_c'),
(910, 6, 28, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p><em>Code only the operative procedure and diagnosis (es). </em></p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS:</p>\r\n\r\n<p>1. Hypoxia</p>\r\n\r\n<p>2. Pneumothorax</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS:</p>\r\n\r\n<p>1. Hypoxia</p>\r\n\r\n<p>2. Pneumothorax</p>\r\n\r\n<p>PROCEDURE: Chest tube placement</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was previously sedated with Versed and paralyzed with Nimbex.&nbsp; Lidocaine was used to numb the incision area in the midlateral left chest at about nipple level. After the&nbsp; lidocaine, an incision was made, and we bluntly dissected to the area of the pleural space, making sure we&nbsp; were superior to the rib. On entrance to the pleural space, there was immediate release of air noted. An 18- gauge chest tube was subsequently placed and sutured to the skin. There were no complicationsfor the&nbsp; procedure, and blood loss was minimal.</p>\r\n\r\n<p>DISPOSITION: Follow-up,single-view, chest x-ray showed significant resolution of the pneumothorax except for a small apical pneumothorax that was noted.</p>', '32554, R09.02, J93.11', '32551, R09.02, J93.11, 71010', '32551, R09.02, J93.11', '32554, R09.02, J93.0', '2022-06-13 10:38:05', '2022-06-13 10:38:05', 'ans_c'),
(911, 6, 28, 1, '<p>OPERATIVE PROCEDURE</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: 68-year-old male in a coma.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: 68-year-old male in a coma.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Placement of a triple lumen central line in right subclavian vein. With the usual&nbsp; Betadine scrub to the right subclavian vein area and with a second attempt, the subclavian vein was&nbsp; cannulated and the wire was threaded. The first time the wire did not thread right, and so the attempt was&nbsp; aborted to make sure we had good identification of structures. Once the wire was in place the needle was&nbsp; removed and a tissue dilator was pushed into position over the wire. Once that was removed, then the&nbsp; central lumen catheter was pushed into position at 17 cm and the wire removed. All three ports were&nbsp; flushed. The catheter was sewn into position, and a dressing applied.</p>', '36011, R40.1', '36011, R40.20', '36556, R40.1', '36556, R40.20', '2022-06-13 10:40:21', '2022-07-12 11:10:02', 'ans_d'),
(912, 6, 28, 1, '<p>What code would you use to report the percutaneous insertion of a dual-chamber pacemaker by means&nbsp; of the subclavian vein?</p>', '33249', '33217', '33208', '33240', '2022-06-13 10:42:51', '2022-06-13 10:42:51', 'ans_c'),
(913, 6, 28, 1, '<p>Patient is a 40-year-old male who was involved in a motor vehicle crash. He is having some pulmonary&nbsp; insufficiency.</p>\r\n\r\n<p>PROCEDURE: Bronchoscope was inserted through the accessory point on the end of the ET tube and was then&nbsp; advanced through the ET tube. The ET tube came pretty close down to the carina. We selectively intubated</p>\r\n\r\n<p>the right main stem bronchus with the bronchoscope. There were some secretions here, and these were&nbsp; aspirated. We then advanced this selectively into first the lower and then the middle and upper lobes. Secretions were present, more so in the middle and lower lobes. No mucous plug was identified. We then&nbsp; went into the left main stem and looked at the upper and lower lobes. There was really not much in the way&nbsp; of secretions present. We did inject some saline and aspirated this out. We then removed the bronchoscope&nbsp; and put the patient back on the supplemental O2 We waited a few minutes. The oxygen level actually stayed&nbsp; pretty good during this time. We then reinserted the bronchoscope and went down to the right side again.&nbsp; We aspirated out all secretions and made sure everything was clear. We then removed the bronchoscope and&nbsp; pulled back on the ET tube about 1.5 cm. We then again placed the patient on supplemental oxygenation. FINDINGS: No mucous plug was identified. Secretions were found mainly in the right lung and were&nbsp; aspirated. The left side looked pretty clear.</p>', '31646, J95.1, V89.2XXA', '32654, J80, V49.88XA', '31645, J80, V49.88XA', '31645, J95.1, V89.2XXA', '2022-06-13 10:46:49', '2022-06-13 10:46:49', 'ans_d'),
(914, 6, 28, 1, '<p><strong>This 52-year-old male has undergone several attempts at extubation, all of which failed. He also has morbid obesity and significant subcutaneous fat in his neck. We performed now a flap tracheostomy and cervical lipectomy. The cervical lipectomy is necessary for adequate exposure and access to the trachea and also to secure tracheotomy tube placement.</strong></p>', '31610, 15839-51', '31610', '31610, 15839', '31603, 15839-51', '2022-06-13 10:49:59', '2022-10-13 07:38:55', 'ans_a'),
(915, 6, 28, 1, '<p>This patient returns to the operating room for planned placement of an additional chest tube for an anterior pneumothorax due to a contusion lung injury. The same physician had just placed a chest tube 4 days earlier.</p>', '32551, S27.329A', '32406, S27.309A', '32551-58, S27.329A', '32551-79, S27.309A', '2022-06-13 10:53:02', '2022-09-14 06:15:17', 'ans_c'),
(916, 6, 28, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Atelectasis of the left lower lobe.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Fiberoptic bronchoscopy with brushings and cell washings.</p>\r\n\r\n<p>&nbsp;PROCEDURE: 3&nbsp;week old&nbsp;female&nbsp;patient was already sedated, on a ventilator, and intubated;so his bronchoscopy was done&nbsp; through the ET tube. It was passed easily down to the carina. About 2 to 2.5 cm above the carina, we could&nbsp; see the trachea, which appeared good, as was the carina. In the right lung, all segments were patent and&nbsp; entered, and no masses were seen. The left lung, however, had petechial ecchymotic areas scattered&nbsp; throughout the airways. The tissue was friable and swollen, but no mucous plugs were noted, and all the&nbsp; airways were open, just somewhatswollen. No abnormalsecretions were noted at all. Brushings were taken&nbsp; as well as washings, including some with Mucomyst to see whether we could get some distal mucous plug,&nbsp; but nothing really significant was returned. The specimens were sent to appropriate cytological and&nbsp; bacteriologicalstudies. The patient tolerated the procedure fairly well.</p>', '31622, 31623-51, J98.11', '31623, P28.0', '31623, J98.11', '31624, P28.0', '2022-06-13 11:00:20', '2023-04-21 07:25:16', 'ans_b'),
(917, 6, 28, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Atherosclerotic heart disease.</p>\r\n\r\n<p>OPERATIVE PROCEDURE: Coronary bypass grafts &times;2 with a single graft from the aorta to the distal left anterior descending and from the aorta to the distal right coronary artery.</p>\r\n\r\n<p>PROCEDURE: The patient was brought to the operating room and placed in a supine position under general&nbsp; intubation anesthesia, the anterior chest and legs were prepped and draped in the usual manner. A segment&nbsp; of greatersaphenous vein was harvested from the left thigh, utilizing the endoscopic vein harvesting&nbsp; technique, and prepared for grafting. The sternum was opened in the usual fashion, and the left internal&nbsp; mammary artery was taken down and prepared for grafting. The flow through the internal mammary artery was very poor. The patient did have a 25-mm difference in arterial pressure between the right and left arms,&nbsp; the right arm being higher. The left internal mammary artery was therefore not used. The pericardium was incised sharply and a pericardial well created. The patient was systemically heparinized and placed on bicaval&nbsp; to aortic cardiopulmonary bypass with the sump in the main pulmonary artery for cardiac decompression. The patient was cooled to 26, and on fibrillation an aortic cross-clamp was applied and potassium-rich cold&nbsp; crystalline cardioplegic solution was administered through the aortic root with satisfactory cardiac arrest.&nbsp; Subsequent doses were given down the vein grafts as the anastomoses were completed and via the coronary&nbsp; sinus in a retrograde fashion. Attention was directed to the right coronary artery. The end of the greater&nbsp; saphenous vein was then anastomosed thereto with 7-0 continuous Prolene distally. The remaining graft&nbsp; material was then grafted to the left anterior descending at the junction of the middle and distal third. The&nbsp; aortic cross-clamp was removed after 149 minutes with spontaneous cardio version. The usual maneuversto&nbsp; remove air from the left heart were then carried out using transesophageal echocardiographic technique.&nbsp; After all the air was removed and the patient had returned to a satisfactory temperature, he was weaned&nbsp; from cardiopulmonary bypass after 213 minutes utilizing 5 g per kilogram per minute of dopamine. The chest&nbsp; was closed in the usual fashion. A sterile compression dressing was applied, and the patient returned to the&nbsp; surgical intensive care unit in satisfactory condition.</p>', '33511, 33517, I70.90', '33511, 33508, I25.10', '33534, 33508, I25.10', '33511, 33517, I25.10', '2022-06-13 11:01:36', '2022-06-13 11:01:36', 'ans_b'),
(918, 6, 28, 1, '<p>A 33 year old patient needs a peripherally inserted venous access device for cancer treatment.&nbsp; The patient was placed in the supine position. Following the administration of light anesthesia, the right&nbsp; arm was prepped and draped in the usual fashion. 50 cc of 1 percent Lidocaine with bicarb was infused in&nbsp; the skin and subcutaneous tissue and the basilic vein is punctured. Using seldinger technique the&nbsp; subclavian vein was cannulated on the first attempt. A j-wire passed easily under fluoroscopic guidance to&nbsp; the subclavian vein. An incision was made and a pocket made on the fascia for the port. The catheter was&nbsp; trimmed to length attached to the port and the port placed in the subcutaneous pocket. Catheter and port&nbsp; were sutured to the fascia. The wound was closed with 3-0 Vicryl.</p>', '36570', '36576', '36571', '36568', '2022-06-13 11:02:55', '2022-06-13 11:02:55', 'ans_c'),
(919, 6, 28, 1, '<p>Pre and Post-operative Dx: Acute MI, severe left main arteriosclerotic coronary artery disease Procedure performed: IABP right common femoral artery</p>\r\n\r\n<p>Description: Patient&#39;s right groin was prepped and draped in the usual sterile fashion. Access was obtained&nbsp; through the skin using a 4 French sheath into the right common femoral artery. The guidewire was placed&nbsp; and then the intra-aortic balloon pump was placed after the right common femoral artery has been dilated&nbsp; with the small dilator. The balloon pump had good waveform. The balloon pump catheter was secured to&nbsp; his skin after local anesthesia of 2 cc of 1% Xylocaine was used to numb the area. Balloon pump was&nbsp; secured with a 0 silk suture. The patient had sterile dressing placed. The patient tolerated the procedure.</p>', '33967', '33975', '33970', '33973', '2022-06-13 11:04:21', '2022-06-13 11:04:21', 'ans_a'),
(920, 6, 28, 1, '<p>The cardiothoracic surgeon takes a patient to the operating room to perform an open balloon&nbsp; angioplasty of the femoral popliteal artery with atherectomy. During the same operative session, the&nbsp; surgeon performs an open transluminal peripheral atherectomy of the iliac artery.</p>', '37224, 75964-26', '37226, 0238T', '37225, 0238T', '37225, 0238T', '2022-06-13 11:06:27', '2022-06-13 11:06:27', 'ans_c'),
(921, 6, 28, 1, '<p>A lymphangiogram is performed on a patient with early onset of endocervical cancer. Code the&nbsp; condition as well as the injection procedure with radiological imaging on both sides</p>', '38790, 75805', '38792-50, 78195', '38790-50, 75807', '38792, 76942', '2022-06-13 11:07:46', '2022-07-07 08:30:53', 'ans_c'),
(922, 6, 28, 1, '<p>A patient suffers a dissecting infrarenal abdominal aortic aneurysm requiring emergent placement of an&nbsp; aorto-uni-iliac endograft along with stent. What CPT code should the vascular surgeon use to report this&nbsp; procedure?</p>', '34703, 76942', '34703', '34705', '34706', '2022-06-13 11:09:59', '2022-06-13 11:09:59', 'ans_b'),
(923, 6, 28, 1, '<p>A 4-year-old patient undergoes placement of double lumen Hickman (central venous) for cancer&nbsp; treatment. The patient was placed in the supine position. Following the administration of light anaesthesia&nbsp; the right was chest prepped and draped in the usual fashion. 50 cc of 1 percent lidocaine with bicarb was&nbsp; infused in the skin and subcutaneous tissue just below the right clavicle. Using Seldinger technique the subclavian vein was cannulated on the first attempt. A wire was inserted and extended down into the right&nbsp; atrium. The anterior right chest wall was then anesthetized. A stab incision was made and the catheter was&nbsp; tunneled from site just above the nipple and lateral to the wire site. Sheath dilator was then inserted over&nbsp; the wire and the wire and dilator were removed. Catheter tip was inserted in to the sheath and the peel&nbsp; away sheath was removed. The tip of the catheter was confirmed be in the right atrium. Flow in the&nbsp; catheter was checked and was excellent.</p>', '36558', '36557', '36560', '36563', '2022-06-13 11:12:35', '2022-06-13 11:12:35', 'ans_b'),
(924, 6, 28, 1, '<p>A Medicare patient is seen by her pulmonologist because she has a chronic productive cough with&nbsp; slightly bloody sputum, wheezing and shortness of breath. The physician performs a rigid bronchoscopy&nbsp; under fluoroscopic guidance and determines that it will be necessary so perform two endobronchial&nbsp; biopsies.</p>', '31625', '36218 X 2', '31628', '32607', '2022-06-13 11:14:18', '2022-06-13 11:14:18', 'ans_a'),
(925, 6, 28, 1, '<p>The operative report reflects that the cardiologist made an incision into the sub the subclavicular&nbsp; pocket which housed a single chamber pacemaker. He detached a malfunctioning ventricular electrode,&nbsp; removed it from the patient and made the decision to have a thoracic surgeon implant an epicardial lead&nbsp; later in the day no new hardware was implanted. He then closed the skin pocket with multiple layers of&nbsp; suture.</p>', '33249', '33234', '33238', '33235', '2022-06-13 11:16:00', '2022-06-13 11:16:00', 'ans_b'),
(926, 6, 28, 1, '<p>Which code(s) is/are reported when the provider removes and replaces the pulse generator for a&nbsp; transvenous single lead defibrillator system?</p>', '33270', '33262, 33272', '33263', '33262', '2022-06-13 11:18:16', '2022-06-13 11:18:16', 'ans_d'),
(927, 6, 28, 1, '<p>A 4 year old requiring ECMO requires percutaneous insertion of a peripheral cannula. What is the&nbsp; correct code?</p>', '33951', '33952', '33953', '33954', '2022-06-13 11:22:03', '2022-06-13 11:22:03', 'ans_a'),
(928, 6, 28, 1, '<p>Which code would be used to report a complete, primary, reshaping of the external nose with elevation&nbsp; of the nasal tip?</p>', '30450', '30410', '30400', 'None of the above', '2022-06-13 11:23:32', '2022-06-13 11:23:32', 'ans_b');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(929, 6, 28, 1, '<p>Riley suffers from recurrent sinus infections. He underwent the following procedure to remove pus from&nbsp; the right sphenoid sinus. His physician entered the sphenoid sinus through the sphenoethmoidal recess in&nbsp; the superior nasal cavity. A flexible cannula was inserted into the opening and the right sinus was irrigated&nbsp; with saline solution. What is the correct code for this procedure?</p>', '31002-RT', '31000-RT', '31299', '31002-50', '2022-06-13 11:25:41', '2022-06-13 11:25:41', 'ans_a'),
(930, 6, 28, 1, '<p>Which of the following coding combination is correct if reported together?</p>', '31526, 69990', '31561, 69990', '31571, 69990', 'None of the above', '2022-06-13 11:27:12', '2022-06-13 11:27:12', 'ans_d'),
(931, 6, 28, 1, '<p>How is an endoscopic diagnostic bronchoscopy coded if it is performed by the same physician during the&nbsp; same session as a surgical bronchoscopy?</p>', '31622', '31624', '31625', 'Surgical bronschoscopy includes a diagnostic bronchoscopy when performed by the same physician in the  same session.', '2022-06-13 11:28:37', '2022-06-13 11:28:37', 'ans_d'),
(932, 6, 28, 1, '<p>Mr. Garrett was seen by his cardiologist, Dr. Kelly. During the examination, Dr. Kelly talked with Mr.&nbsp; Garret and his family about the need for a pacemaker and its benefits for Mr. Garret&#39;s condition. Mr. Garrett&nbsp; was scheduled for the procedure the following day. Dr. Kelly inserted a permanent pacemaker, pulse&nbsp; generator, and placed a transvenous electrode in the ventricle. What code indicates this service?</p>', '33207', '33212', '33210', '33220', '2022-06-13 11:30:15', '2022-06-13 11:30:15', 'ans_a'),
(933, 6, 28, 1, '<p>Polly had the battery changed for her single chamber permanent pulse generator, which was inserted&nbsp; one year ago. This procedure was completed in the same session by the same provider. How should the&nbsp; provider&#39;s services be coded?</p>', '33233, 33212-59', '33233, 33212-51', '33234, 33213-59', '33234, 33213-51', '2022-06-13 11:34:13', '2022-06-13 11:34:13', 'ans_b'),
(934, 6, 28, 1, '<p>A physician performed an open biopsy of four deep cervical lymph nodes. How should the office code&nbsp; this service?</p>', '38510 x 4', '57500', '38510', '38500', '2022-06-13 11:35:49', '2022-06-13 11:35:49', 'ans_c'),
(935, 6, 28, 1, '<p>A physician performs a lymphangiography bilaterally to the extremities. She also provides the radiological&nbsp; supervision and interpretation for this procedure, which was completed in a hospital setting. How would you&nbsp; code the physician services?</p>', '35000, 75801', '38792, 78195', '38790-50, 75803-26', '38790-50, 75801-26', '2022-06-13 11:37:47', '2022-06-13 11:37:47', 'ans_c'),
(936, 6, 28, 1, '<p>A physician performs a transluminal balloon angioplasty of the left iliac by inserting a catheter through&nbsp; the skin for revascularisation. The balloon is inflated several times during this procedure. The physician did not provide the radiological supervision and interpretation with this procedure. Which code indicates this&nbsp; service?</p>', '37246', '37220', '37248', '36902', '2022-06-13 11:40:09', '2022-06-13 11:40:09', 'ans_b'),
(937, 6, 28, 1, '<p>A patient underwent bilateral nasal/sinus diagnostic endoscopy. Finding the airway obstructed the&nbsp; physician fractures the middle turbinates to perform the surgical endoscopy with total ethmoidectomy and&nbsp; bilateral nasal septoplasty. What CPT&reg; codes are reported?</p>', '30930, 31255-51, 30520-51', '31255-50, 30520-50-51', '31231, 30130-51, 31255-50', '31255, 30520-51', '2022-06-13 11:42:49', '2022-06-13 11:42:49', 'ans_b'),
(938, 6, 28, 1, '<p>55-year-old female smoker presents with cough, hemoptysis, slurred speech, and weight loss. Chest X-ray&nbsp; done today demonstrates a large, unresectable right upper lobe mass, and brain scan is suspicious for&nbsp; metastasis. Under fluoroscopic guidance in an outpatient facility, a percutaneous needle biopsy of the</p>\r\n\r\n<p>lung lesion is performed for histopathology and tumor markers. A diagnosis of small cell carcinoma is&nbsp; made and chemoradiotherapy is planned. What CPT&reg; codes are reported?</p>', '32408, 77002-26', '32400, 77002-26', '32607, 77002-26', '32408', '2022-06-13 11:44:18', '2022-07-12 11:03:40', 'ans_d'),
(939, 6, 28, 1, '<p>A surgeon performs a high thoracotomy with resection of a single lung segment on a 57-year-old heavy&nbsp; smoker who had presented with a six-month history of right shoulder pain. An apical lung biopsy had&nbsp; confirmed lung cancer. What CPT&reg; codes are reported?</p>', '32100', '32484', '32503', '19271, 32551-51', '2022-06-13 11:45:40', '2022-06-13 11:45:40', 'ans_b'),
(940, 6, 28, 1, '<p>A 3-year-old girl is playing with a marble and sticks it in her nose. Her mother is unable to dislodge the&nbsp; marble so she takes her to the physician&rsquo;s office. The physician removes the marble with hemostats.&nbsp; What CPT&reg; are reported?</p>', '30300', '30310', '30150', '30320', '2022-06-13 11:46:42', '2022-06-13 11:46:42', 'ans_a'),
(941, 6, 28, 1, '<p>An ICU diabetic patient who has been in a coma for weeks as the result of a head injury becomes conscious and begins to improve. The physician performs a tracheostomy closure and since the scar tissue is minimal,&nbsp; the plastic surgeon is not needed. What CPT&reg; are reported for this procedure?</p>', '31800', '31820', '31805', '31825', '2022-06-13 11:47:45', '2022-06-13 11:47:45', 'ans_b'),
(942, 6, 28, 1, '<p>A patient has a complete TTE performed to assess her mitral valve prolapse (congenital). The physician&nbsp; performs the study in his cardiac clinic.</p>', '93303', '93306', '93308', '93312', '2022-06-13 11:49:02', '2022-06-13 11:49:02', 'ans_a'),
(943, 6, 28, 1, '<p>A patient has a Transtelephonic rhythm strip pacemaker evaluation for his dual chamber pacemaker. It has been more than two months from his last evaluation due to him moving. The physician evaluates&nbsp; remotely retrieved information, checking the device&rsquo;s current programming, battery, lead, capture and&nbsp; sensing function, and heart rhythm. The monitoring period has been 35 days. What can the physician&nbsp; report for the service?</p>', '93293-52', '93295', '93296', '93293', '2022-06-13 11:50:58', '2022-06-13 11:50:58', 'ans_d'),
(944, 6, 28, 1, '<p>A patient is brought to the operating suite when she experiences a large output of blood in her chest tubes&nbsp; post CABG. The physician performing the original CABG yesterday is concerned about the post- operative&nbsp; bleeding. He explores the chest and finds a leaking anastomosis site and he resutured.</p>', '35246', '35246-78', '35820-78', '35241', '2022-06-13 11:52:33', '2022-06-13 11:52:33', 'ans_c'),
(945, 6, 28, 1, '<p>MAZE procedure is performed on a patient with atrial fibrillation. The physician isolates and ablates the&nbsp; electric paths of the pulmonary veins in the left atrium, the right atrium, and the atrioventricular annulus&nbsp; while on cardiopulmonary bypass.</p>', '33254', '33255', '33256', '33259', '2022-06-13 11:53:59', '2022-06-13 11:53:59', 'ans_c'),
(946, 6, 28, 1, '<p>Patient undergoes a mitral valve repair with a ring insertion and an aortic valve replacement, on&nbsp; cardiopulmonary bypass.</p>', '33464, 33406-51', '33426, 33405-51', '33430, 33405-51', '33468, 33426-51', '2022-06-13 11:55:20', '2022-06-13 11:55:20', 'ans_b'),
(947, 6, 28, 1, '<p>The patient is a 67-year-old gentleman with metastatic colon cancer recently operated on&nbsp; for a brain metastasis, now for placement of an Infuse-A-Port for continued chemotherapy.&nbsp; The left subclavian vein was located with a needle and a guide wire placed. This was&nbsp; confirmed to be in the proper position fluoroscopically. A transverse incision was made just&nbsp; inferior to this and a subcutaneous pocket created just inferior to this. After tunneling, the&nbsp; introducer was placed over the guide wire and the power port line was placed with the introducer and the introducer was peeled away. The tip was placed in the appropriate&nbsp; position under fluoroscopic guidance and the catheter trimmed to the appropriate length&nbsp; and secured to the power port device. The locking mechanism was fully engaged. The port&nbsp; was placed in the subcutaneous pocket and everything sat very nicely fluoroscopically. It&nbsp; was secured to the underlying soft tissue with 2‐0 silk stitch. What code should be used for&nbsp; this procedure?</p>', '36556, 77001‐26', '36558', '36561, 77001‐26', '36571', '2022-06-13 11:56:41', '2022-06-13 11:56:41', 'ans_c'),
(948, 6, 28, 1, '<p>A CT scan identified moderate‐sized right pleural effusion in a 50‐year‐old male. This was&nbsp; estimated to be 800 cc in size and had an appearance of fluid on the CT Scan. A needle is&nbsp; used to puncture through the chest tissues and enter the pleural cavity to insert a guidwire.&nbsp; A pigtail catheter is then inserted at the length of the guidwire and fluid was drained under&nbsp; ultrasound guidance using 1% lidocaine as local anesthetic. What procedure code should be&nbsp; used?</p>', '32557', '32555', '32556', '32550', '2022-06-13 11:57:48', '2022-06-13 11:57:48', 'ans_a'),
(949, 6, 28, 1, '<p>The patient is a 59‐year‐old white male who underwent carotid endarterectomy for&nbsp; symptomatic left carotid stenosis a year ago. A carotid CT angiogram showed a recurrent&nbsp; 90% left internal carotid artery stenosis extending into the common carotid artery. He is&nbsp; taken to the operating room for re‐do left carotid endarterectomy. The left neck was&nbsp; prepped and the previous incision was carefully reopened. Using sharp dissection, the&nbsp; common carotid artery and its branches were dissected free. The patient was systematically&nbsp; heparinized and after a few minutes clamps applied to the common carotid artery and its&nbsp; branches. A longitudinal arteriotomy was carried out with findings of extensive layering of&nbsp; intimal hyperplasia with no evidence of recurrent atherosclerosis. A silastic balloon‐tip&nbsp; shunt was inserted first proximally and then distally, with restoration of flow. Several layers&nbsp; of intima were removed and the endarterectomized surfaces irrigated with heparinized&nbsp; saline. An oval Dacron patch was then sewn into place with running 6‐0 Prolene. Which&nbsp; CPT&reg; code(s) is/are reported?</p>', '35301', '35301, 35390', '35302', '35311, 35390', '2022-06-13 11:59:19', '2022-06-13 11:59:19', 'ans_b'),
(950, 6, 28, 1, '<p>A catheter is placed in the left common femoral artery which was directed into the right the&nbsp; external iliac (antegrade). Dye was injected and a right lower extremity angiogram was&nbsp; performed which revealed patency of the common femoral and profundafemoris. The&nbsp; catheter was then manipulated into the superficial femoral artery (retrograde) in which a&nbsp; lower extremity angiogram was performed which revealed occlusion from the popliteal to&nbsp; the tibioperoneal artery. What are the procedure codes that describe this procedure?</p>', '36217, 75736‐26', '36247, 75716‐26', '36217, 75658‐26', '36247, 75710‐26', '2022-06-13 12:00:41', '2022-06-13 12:00:41', 'ans_d'),
(951, 6, 28, 1, '<p>79‐year‐old male with symptomatic bradycardia and syncope is taken to the Operating Suite&nbsp; where an insertion of a DDD pacemaker will be performed. A left subclavian venipuncture&nbsp; was carried out. A guide wire was passed through the needle, and the needle was&nbsp; withdrawn. A second subclavian venipuncture was performed, a second guide wire was&nbsp; passed and the second needle was withdrawn. An oblique incision in the deltopectoral area&nbsp; incorporating the wire exit sites. A subcutaneous pocket was created with the cautery on&nbsp; the pectoralis fascia. An introducer dilator was passed over the first wire and the wire and&nbsp; dilator were withdrawn. A ventricular lead was passed through the introducer, and the&nbsp; introducer was broken away in the routine fashion. A second introducer dilator was passed&nbsp; over the second guide wire and the wire and dilator were withdrawn. An atrial lead was&nbsp; passed through the introducer and the introducer was broken away in the routine fashion.&nbsp; Each of the leads were sutured down to the chest wall with two 2‐0 silk sutures each,&nbsp; connected the leads to the generator, curled the leads, and the generator was placed in the&nbsp; pocket. We assured hemostasis. We assured good position with the fluoroscopy. What code&nbsp; should be used for this procedure?</p>', '33208', '33212', '33226', '33235, 71090‐26', '2022-06-13 12:02:11', '2022-06-13 12:02:11', 'ans_a'),
(952, 6, 28, 1, '<p>Patient has lung cancer in his upper right and middle lobes. Patient is in the&nbsp; operating suite to have a video‐assisted thorascopy surgery (VATS). A 10‐mm‐zero‐degree&nbsp; thoracoscope is inserted in the right pleural cavity through a port site placed in the ninth&nbsp; and seventh intercostal spaces. Lung was deflated. The tumor is in the right pleural. Both&nbsp; lobes were removed thorascopically. Port site closed. A chest tube was placed to suction&nbsp; and patient was sent to recovery in stable condition. Which CPT&reg; code is reported for this&nbsp; procedure?</p>', '32482', '32484', '32670', '32671', '2022-06-13 12:03:25', '2022-07-12 11:14:13', 'ans_c'),
(953, 6, 28, 1, '<p>The patient is a 58‐year‐old white male, one month status post pneumonectomy. He had a&nbsp; post pneumonectomy empyema treated with a tunneled cuffed pleural catheter which has&nbsp; been draining the cavity for one month with clear drainage. He has had no evidence of a&nbsp; block or pleural fistula. Therefore a planned return to surgery results in the removal of the&nbsp; catheter. The correct CPT&reg; code is:</p>', '32440‐78', '32552‐58', '32036‐79', '32035‐58', '2022-06-13 12:04:41', '2023-07-12 04:25:08', 'ans_b'),
(954, 6, 28, 1, '<p>This 67‐year‐old man presented with a history of progressive shortness of breath. He has&nbsp; had a diagnosis of a secundum atrioseptal defect for several years, and has had atrial&nbsp; fibrillation intermittently over this period of time. He was in atrial fibrillation when he came&nbsp; to the operating room, and with the patient cannulated and on bypass, The right atrium was&nbsp; then opened. A large 3 x 5 cm defect was noted at fossa ovalis, and this also included a second hole in the same general area. Both of these holes were closed with a single&nbsp; pericardial patch. What CPT&reg; and ICD‐10‐CM codes should be reported?</p>', '33675, Q21.0', '33647, Q21.1, R06.02', '33645, Q21.2, R06.02', '33641, Q21.1', '2022-06-13 12:06:09', '2022-06-13 12:06:09', 'ans_d'),
(955, 6, 28, 1, '<p>The patient is a 51‐year‐old gentleman who has end‐stage renal disease. He was in the OR&nbsp; yesterday for a revision of his AV graft. The next day the patient had complications of the&nbsp; graft failing. The patient was back to the operating room where an open thrombectomy was&nbsp; performed on both sides getting good back bleeding, good inflow. An arteriogram was shot.&nbsp; There was a small amount of what looked like pseudo‐intima in the distal anastomosis of&nbsp; the common femoral venous tract that was causing a flow defect which was taken out with&nbsp; a Fogarty catheter. A Conquest balloon was ballooned up again with a 6 millimeter and a 7 mm. An arteriogram was reshot in both directions. The arterial anastomosis looked fine as&nbsp; did the venous anastomosis. Select the appropriate codes for this visit:</p>', '36831‐76, 36907‐26', '36831, 36903‐26', '36831‐78, 36902‐26', '36831‐58, 36902‐26', '2022-06-13 12:14:07', '2022-06-13 12:14:07', 'ans_c'),
(956, 6, 28, 1, '<p>The patient is a 77‐year‐old white female who has been having right temporal pain and&nbsp; headaches with some visual changes and has a sed rate of 51. She is scheduled for a&nbsp; temporal artery biopsy to rule out temporal arteritis. A Doppler probe was used to isolate&nbsp; the temporal artery and using a marking pen the path of the artery was drawn. Lidocaine 1%&nbsp; was used to infiltrate the skin, and using a 15 blade scalpel the skin was opened in the&nbsp; preauricular area and dissected down to the subcutaneous tissue where the temporal artery&nbsp; was identified in its bed. It was a medium size artery and we dissected it out for a length of&nbsp; approximately 4 cm with some branches. The ends were ligated with 4‐0 Vicryl, and the&nbsp; artery was removed from its bed and sent to Pathology as specimen. What code should be&nbsp; used for this procedure?&nbsp;</p>', '37609', '37605', '36625', '37799', '2022-06-13 12:15:27', '2022-06-13 12:15:27', 'ans_a'),
(957, 6, 28, 1, '<p>50‐year‐old female has recurrent lymphoma in the axilla. Ultrasound was used to localize&nbsp; the lymph node in question for needle guidance. An 11 blade scalpel was used to perform a&nbsp; small dermatotomy. An 18 x 10 cm Biopence needle was advanced through the&nbsp; dermatotomy to the periphery of the lymph node. A total of 4 biopsy specimens were&nbsp; obtained. Two specimens were placed an RPMI and 2 were placed in formalin and sent to&nbsp; laboratory. The correct CPT code is:</p>', '10022', '38500, 77002‐26', '38505, 76942‐26', '38525, 76942‐26', '2022-06-13 12:16:48', '2022-06-13 12:16:48', 'ans_c'),
(958, 6, 28, 1, '<p>67‐year‐old female fractured a port‐a‐cath surgically placed a year ago. Under sonographic&nbsp; guidance a needle was passed into the right common femoral vein. The loop snare was&nbsp; positioned in the right atrium where a portion of the fractured catheter was situated. The&nbsp; catheter crossed the atrioventricular valve with the remaining aspect of the catheter in the&nbsp; ventricle. A pigtail catheter was then utilized to loop the catheter and pull the catheter tip&nbsp; into the inferior vena cava. The catheter was then snared and pulled through the right groin&nbsp; removed in its entirety. What CPT&reg; and ICD‐10‐CM codes should be reported?</p>', '37200, T81.509D', '37197, T82.514A', '37193, T80.219A', '37217, T88.8XXA', '2022-06-13 12:17:54', '2022-06-13 12:17:54', 'ans_b'),
(959, 6, 29, 1, '<p>24 year old Connie was brought to the operating room for a diaphragmatic hernia, and transthoracic repair was&nbsp;performed.</p>', '43334', '39503', '43335', '43332', '2022-06-14 11:27:54', '2022-08-02 07:10:23', 'ans_a'),
(960, 6, 29, 1, '<p>What code would you use if the physician performs a pyloroplasty and vagotomy in the same surgical&nbsp; session?</p>', '43865', '50400', '43635', '43640', '2022-06-14 11:29:13', '2022-06-14 11:29:13', 'ans_d'),
(961, 6, 29, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Leaking from intestinal anastomosis.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Proximal ileostomy for diversion of colon. Oversew of right colonic fistula.</p>\r\n\r\n<p>OPERATIVE NOTE: This patient was taken back to the operating room from the intensive care unit. She was&nbsp; having acute signs of leakage from an anastomosisI performed 3 days previously. We took down some of the&nbsp; sutures holding the wound together. We basically exposed all of this patient&#39;s intestine. It was evident that she was leaking from the small bowel as well as from the right colon. I thought the only thing we could do would be to repair the right colon. This was done in two layers, and then we freed up enough bowel to try to make an ileostomy proximal to the area of leakage. We were able to do this with great difficulty, and there was only a small amount of bowel to be brought out. We brought this out as an ileostomy stoma, realizing that it was of questionable viability and that it should be watched closely. With that accomplished, we then packed the wound and returned the patient to the intensive care unit.</p>', '44310, T85.398A', '44310-78, K91.89', '45136, T81.30XA', '45136-78, T81.30XA', '2022-06-14 11:30:48', '2023-10-26 01:14:07', 'ans_b'),
(962, 6, 29, 1, '<p>This patient is taken to the operating room from the intensive care unit (ICU). The area of the stoma&nbsp; appears to be necrotic, and on this basis the surgeon indicates that the patient has been taken back to the&nbsp; operating room. The surgeon performing the revision is not the same surgeon that originally placed the&nbsp; stoma, nor is the stoma being revised during the postoperative period of any previous procedure. PROCEDURE PERFORMED: Revision ileostomy stoma.</p>\r\n\r\n<p>OPERATIVE NOTE: With the patient moved onto the operating table, the abdomen was prepped and draped.&nbsp; The segment of bowel that was serving as the ileostomy was freed up. Going in through this large open&nbsp; wound, we were able to identify which segment of bowel this was. We resected the end of the bowel that&nbsp; was necrotic and freed up enough of the distal small bowel so that we could bring it out through a new stoma&nbsp; that was placed lateral to the original stoma. The stoma was created, the bowel was brought out, and the mucosa was seen onto the skin. With this accomplished, we appeared to have a viable stoma. The patient tolerated this procedure and was returned to the ICU in stable condition.</p>', '44310, K56.7', '45136, A09', '44312, K94.19, K55.0', '44314, K55.0', '2022-06-14 11:32:39', '2022-06-14 11:32:39', 'ans_c'),
(963, 6, 29, 1, '<p>This patient is brought back to the operating room during the postoperative period by the same physician&nbsp; to repair an esophagogastrostomy leak, transthoracic approach, done 2 days ago. The patient is status post&nbsp; esophagectomy for cancer. Code the procedure and the diagnosis for the complication.</p>', '43320-78, K20.9', '43340-78, K92.2', '43341, K91.86', '43415-78, K91.89', '2022-06-14 11:34:00', '2022-06-14 11:34:00', 'ans_d'),
(964, 6, 29, 1, '<p>The physician is using an abdominal approach to perform a proctopexy combined with a sigmoid&nbsp; resection:</p>', '45540', '45541', '45550', '45345', '2022-06-14 11:35:43', '2022-06-14 11:35:43', 'ans_c'),
(965, 6, 29, 1, '<p>OPERATIVE REPORT PREOPERATIVE DIAGNOSIS: Melena. POSTOPERATIVE DIAGNOSIS: Normal endoscopy. PROCEDURE: The video therapeutic flexible endoscope was passed without difficulty into the oropharynx.&nbsp; The gastroesophageal junction was seen at 40 cm. Inspection of the esophagusrevealed no erythema,&nbsp; ulceration, varices, or other mucosal abnormalities. The stomach was entered and the endoscope advanced to the second duodenum. Inspection of the second duodenum, first duodenum, duodenal bulb, and pylorusrevealed no abnormalities. Retroflexion revealed no lesions along the curvature. Inspection of the antrum, body, and fundus of the stomach revealed no abnormalities. The patient tolerated the procedure well.</p>', '45378', '43235', '49320', '43255', '2022-06-14 11:37:13', '2022-06-14 11:37:13', 'ans_b'),
(966, 6, 29, 1, '<p>This 70-year-old male is brought to the operating room for a biopsy of the pancreas. A wedge biopsy is&nbsp; taken and sent to pathology. The report comes back immediately indicating that malignant cells were&nbsp; present in the specimen. The decision was made to perform a total pancreatectomy. Code the operative&nbsp; procedure(s) only.</p>', '48100', '48155', '48155, 48100-51', '48155, 48100-51, 88309', '2022-06-14 11:39:05', '2022-06-14 11:39:05', 'ans_c'),
(967, 6, 29, 1, '<p>The patient was taken to the operating room for a repair of a recurrent strangulated inguinal hernia.</p>', '49521', '49520', '49492', '49521-78', '2022-06-14 11:51:10', '2022-06-14 11:51:10', 'ans_a'),
(968, 6, 29, 1, '<p>This 43-year-old female comes in with a peritonsillar abscess. The patient is brought to same-day surgery&nbsp; and given general anesthetic. On examination of the peritonsillar abscess, an incision was made and fluid was drained. The area was examined again, saline was applied, and then the area was packed with gauze. The patient tolerated the procedure well.</p>', '42825, J36', '42700, J36', '42825, J03.90', '42700, J35.01', '2022-06-14 11:53:13', '2022-06-14 11:53:13', 'ans_b'),
(969, 6, 29, 1, '<p>What code would you use to report a rigid proctosigmoidoscopy with removal of two polyps by snare&nbsp; technique?</p>', '45320', '45383', '45309 × 2', '45315', '2022-06-14 11:54:56', '2022-06-14 11:54:56', 'ans_d'),
(970, 6, 29, 1, '<p>A colonoscopy is performed on a patient. The physician removes 3 Polyps by hot biopsy forceps&nbsp; technique in the ascending colon. In the transverse colon a miniscule polyp is ablated. In the sigmoid are a&nbsp; small polyp is seen and removed in total with cold biopsy forceps. What CPT codes will be billed for the&nbsp; encounter?</p>', '45385, 45384-59, 45380-59', '45385 X 3, 45383-51, 45380-51', '45384, 45388-59, 45380-59', '45385 x 3, 45384-59, 45380-59', '2022-06-14 11:57:08', '2022-06-14 11:57:08', 'ans_c'),
(971, 6, 29, 1, '<p>A 42-year old patient has symptomatic internal and external hemorrhoids in a single group. In the&nbsp; lithotomy position the perianal tissue is anesthetized with Marcaine 0.25% with epinephrine. the&nbsp; hemorrhoid on the right was grasped and elliptically excised. Attention was turned to the right lower&nbsp; hemorrhoid which was excised down to the internal sphincter muscle. Fissures were also excised. What&nbsp; procedure code should be used?</p>', '46255', '46257', '46260', '46945', '2022-06-14 11:58:31', '2022-06-14 11:58:31', 'ans_b'),
(972, 6, 29, 1, '<p>Operative Report Preoperative Diagnosis: Incarcerated left inguinal hernia in 38 year old male&nbsp; Postoperative Diagnosis: As above Finding: Huge incarcerated left inguinal hernia containing bowel and&nbsp; ascetic fluid, recurrent. Technique: The patient was placed on the operating room table in the supine&nbsp; position. IV sedation was administered without complications. Oxygen and monitoring were in place per&nbsp; protocol. Left groin and scrotum were prepped with Betadine and draped in a sterile fashion. Local&nbsp; anesthesia was infiltrated in the subcutaneous tissue in a field block using a mixture of lidocaine, Marcaine,&nbsp; Saline. The patient was placed general Trendelenburg position. The incision was made over the inguinal&nbsp; <img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mP4//8kAwAIkALIk2rdWQAAAABJRU5ErkJggg==\" style=\"float:right; height:379px; width:12px\" />ligament and dissection was carried down sharply to the external oblique aponeurosis which was opened&nbsp; <img src=\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAAEAAAABCAYAAAAfFcSJAAAADUlEQVR42mP4//8cAwAImgLNdRtHNQAAAABJRU5ErkJggg==\" style=\"float:right; height:379px; width:5px\" />along the course of its fibers. Hernia and spermatic cord was encircled with a Penrose drain at the public&nbsp; tubercle. The ilioinguinal nerve was identified and carefully preserved, retracted superiorly. The&nbsp; incarcerated hernia sac was gently dissected away from the vas and the testicular vessels with careful&nbsp; preservation of the vessels. The hernia was then reduced and the defect closed with an extra-large Marlex&nbsp; mesh plug which was sutured in place at various points using 2-0 Vicryl suture. The mesh onlay patch was&nbsp; then placed as reinforcement. The Illoinguinal nerve was placed back in the canal. The onlay patch was&nbsp; sutured together lateral to the internal ring. External oblique was closed with running 2-0 Vicryl suture.&nbsp; Scarpus was closed with interrupted 2-0 Vicryl suture. Skin was closed with staples. Antibiotic ointment and&nbsp; sterile dressing were placed over the incision. All sponge, instrument and needle counts were correct. The&nbsp; patient tolerated the procedure well. He was taken back to the recovery room in stable condition.</p>', '49507', '49521', '49525', '49507, 49568', '2022-06-14 12:00:19', '2022-06-14 12:00:19', 'ans_b'),
(973, 6, 29, 1, '<p>A patient diagnosed with three liver tumors is taken to the operating room. The physician uses a needle&nbsp; electrode to go through the skin administering cryoablation for destruction of the tumors. CT guidance was used to verify the needle was placed in the correct spots and to monitor treatment. What are the&nbsp; procedure and diagnosis codes?</p>', '47382, 77013-26', '47382 x 3, 77013-26', '47380 x 3, 77013-26', '47383, 77013-26', '2022-06-14 12:03:08', '2022-06-14 12:03:08', 'ans_d'),
(974, 6, 29, 1, '<p>A patient complains of tarry, black stools. She has some epigastric tightness. An&nbsp; esophagogastroduodenoscopy is recommended to evaluate the source of the bleeding. Endoscopic is&nbsp; inserted. The esophagus appears normal on scope insertion. No evidence of bleeding in the stomach.&nbsp; Scope is then passed into the duodenum where a polyp is found and removed with Snare technique. No&nbsp; evidence of bleeding post procedure.</p>', '43251', '43270', '43239', '43250', '2022-06-14 12:06:00', '2022-06-14 12:06:00', 'ans_a'),
(975, 6, 29, 1, '<p>A 34 year old male is taken to the OR for takedown of his colostomy and reversal of his Hartmann&#39;s&nbsp; pouch after 6 months of bowel rest for his colitis. The patient is placed supine on the operating table and&nbsp; general endotracheal anesthesia is administered. his abdomen is prepped and draped in the usual sterile&nbsp; manner. The colostomy stoma was incised and dissected sharply from the abdominal wall. this was closed&nbsp; with 0-0 vchornic and 3-0 prolene. The distal portion of the colon was brought up reopened and refreshed.&nbsp; The GIA staple was used to re-anastomse the colon to the rectum.</p>', '44227', '44620', '44625', '44626', '2022-06-14 12:07:46', '2022-06-14 12:07:46', 'ans_d'),
(976, 6, 29, 1, '<p>A patient undergoes a partial Colectomy of the transverse colon including closure of distal segment due&nbsp; to recurrent colon adenocarcinoma. What are the appropriate procedure code?</p>', '44140', '44141', '44143', '44207', '2022-06-14 12:09:20', '2022-06-14 12:09:20', 'ans_c'),
(977, 6, 29, 1, '<p>A patient with an existing stent in the right hepatic duct presents today for the exchange of the right&nbsp; stent. Placement of a new stent in the right hepatic duct is performed.</p>', '43276-RT, 43274-59-LT', '43276-RT', '43275-LT, 43275-59-RT, 43276-59-LT, 43276-59-RT', '43275-LT, 43276-59-RT', '2022-06-14 12:10:47', '2022-06-14 12:10:47', 'ans_b'),
(978, 6, 29, 1, '<p>27 year old male has obesity with a BMI of 35. He has decided to have a Roux-Epatient is brought to the operating room and placed in supine position. A midline abdominal incision is&nbsp; made. The stomach is mobilized and the proximal stomach is divided and stapled creating a small proximal&nbsp; pouch in continuity with the esophagus. A short limb of the proximal bowel of 115cm is divided. It is&nbsp; brought up and anastomosed to the gastric pouch. The other end of the divided bowel is connected back&nbsp; into the distal small bowel to the short limb&rsquo;s gastric anastomosis to restore intestinal continuity. The&nbsp; abdominal incision is closed. n-Y gastric bypass. The</p>', '43645', '43644', '43846', '43847', '2022-06-14 12:13:35', '2022-06-14 12:13:35', 'ans_c'),
(979, 6, 29, 1, '<p>Abdominal washout with Vac placement at bedside. Indication: Retroperitoneal abscess. Permit: Signed&nbsp; and on the chart. Sedation: Versed 10 Mg. anesthesia Fentanyl. 300 mg. This procedure was done at&nbsp; bedside. The skin was prepped with Chlora prep and the&nbsp; patient was draped in sterile fashion. The bowel did not appear edematous. There were portions of the&nbsp; bowel which appeared to have fibrinous exudate, however there were no sign of pus or necrotic material.&nbsp; The abscess was then drained and area irrigated with approximately 2 L of warm normal saline and&nbsp; Abdominal VAC was placed and secured in place with staples. A seal was established and maintained. The&nbsp; patient tolerated the procedure well. a time out was done before the commencement of this procedure.</p>', '49020', '49060', '49002', '49010', '2022-06-14 12:15:18', '2022-07-14 07:57:10', 'ans_b'),
(980, 6, 29, 1, '<p>Pt with jaundice was seen by the doctor. To obtain liver biopsies. A needle biopsy was taken using CT&nbsp; guidance for needle placement. The doctor. Obtain to care biopsy which were then sent to pathology.</p>', '47000, 47001, 77002', '47000, 77012', '47000, 76942', '47000, 10022, 76942', '2022-06-14 12:16:49', '2022-06-14 12:16:49', 'ans_b'),
(981, 6, 29, 1, '<p>Dr. Nicholas performed a diagnostic rigid esophagoscopy to a 72-year-old patient with mild&nbsp; hypertension. This service was completed in Dr. Nicholas&#39;s office. He administered moderate conscious&nbsp; sedation. The intra-service time was 60 minutes. What code(s) capture the physician&#39;s services?</p>', '43200, 99144, 99145 x 2', '43191', '43200-23', '43200', '2022-06-14 12:18:58', '2022-11-01 17:28:55', 'ans_b'),
(982, 6, 29, 1, '<p>Dr. Barns excised a four cm esophageal lesion with primary repair. To excise the lesion Dr. Barns made an&nbsp; upper midline abdominal incision to access the esophagus. The surgical site was closed with two layers of&nbsp; sutures. What code(s) indicate this service?</p>', '43116, 21720', '43101, 11424-59, 12042-51', '43116, 69990', '43101', '2022-06-14 12:20:45', '2022-06-14 12:20:45', 'ans_d'),
(983, 6, 29, 1, '<p>A patient presents with gastroesophageal reflux disease. To treat this disorder, the surgeon performs a&nbsp; laparoscopic Nissen procedure. A diagnostic laparoscopy was completed during the same session. What&nbsp; code(s) indicate this service?</p>', '43280', '43289', '43320', '43280, 43320-52', '2022-06-14 12:23:05', '2022-06-14 12:23:05', 'ans_a'),
(984, 6, 29, 1, '<p>A physician performs a V-excision of the lip with primary direct linear closure. This procedure was&nbsp; completed to remove a lesion. What code(s) describe these services?&nbsp;</p>', '40510, 40520-51', '40520', '40510, 40525-51', '40525', '2022-06-14 12:28:57', '2022-06-14 12:28:57', 'ans_b'),
(985, 6, 29, 1, '<p>Sam, a healthy 32-year-old male, is scheduled for surgery. He has no systemic diseases, doesn&#39;t smoke,&nbsp; and regularly exercises. He is prepped and taken into the operating room. The surgeon performs an&nbsp; endoscopic retrograde cholangiopancreatography with endoscopic retrograde insertion of nasobiliary&nbsp; drainage tube. Within the same operative session, the surgeon also performs a sphincterotomy. How would&nbsp; you code this service?</p>', '43274-51', '43260, 43274-51, 43262-51', '43274', '43262', '2022-06-14 12:35:21', '2022-06-14 12:35:21', 'ans_c'),
(986, 6, 29, 1, '<p>A physician performs a Billroth II procedure, partial distal gastrectomy with gastrojejunostomy, and a&nbsp; vagotomy. Which codes capture these services?</p>', '43631, 43635', '43631, 43635-51', '43632, 43635', '43632, 43635-51', '2022-06-14 12:37:28', '2022-06-14 12:37:28', 'ans_c'),
(987, 6, 29, 1, '<p>PREOPERATIVE DIAGNOSIS: Diverticulitis, perforated diverticula POST OPERATIVE DIAGNOSIS:&nbsp; Diverticulitis, perforated diverticula PROCEDURE: Hartman procedure, which is a sigmoid resection with&nbsp; Hartman pouch and colostomy. DESCRIPTION OF THE PROCEDURE: Patient was prepped and draped in the&nbsp; supine position under general anesthesia. Prior to surgery patient was given 4.5 grams of Zosyn and&nbsp; Rocephin IV piggyback. A lower midline incision was made, abdomen was entered. Upon entry into the&nbsp; abdomen, there was an inflammatory mass in the pelvis and there was a large abscessed cavity, but no feces.&nbsp; The abscess cavity was drained and irrigated out. The left colon was immobilized, taken down the lateral&nbsp; perineal attachments. The sigmoid colon was mobilized. There was an inflammatory mass right at the area of&nbsp; the sigmoid colon consistent with a divertiliculitis or perforation with infection. Proximal to this in the distal&nbsp; left colon, the colon was divided using a GIA stapler with 3.5 mm staples. The sigmoid colon was then&nbsp; mobilized using blunt dissection. The proximal rectum just distal to the inflammatory mass was divided using&nbsp; a GIA stapler with 3.5 mm staples. The mesentary of the sigmoid colon was then taken down and tied using&nbsp; two 0 Vicryl ties. Irrigation was again performed and the sigmoid colon was removed with inflammatory&nbsp; mass. The wall of the abscessed cavity that was next to the sigmoid colon where the inflammatory mass was,&nbsp; showed no leakage of stool, no gross perforation, most likely there is a small perforation in one of the&nbsp; diverticula in this region. Irrigation was again performed throughout the abdomen until totally clear. All&nbsp; excess fluid was removed. The distal descending colon was then brought out through a separate incision in&nbsp; the lower left quadrant area and a large 10 mm 10 French JP drain was placed into the abscessed cavity. The&nbsp; sigmoid colon or the colostomy site was sutured on the inside using interrupted 3-0 Vicryl to the peritoneum&nbsp; and then two sheets of film were placed into the intra- abdominal cavity. The fascia was closed using a&nbsp; running #1 double loop PDS suture and intermittently a #2 nylon retention suture was placed. The colostomy&nbsp; was matured using interrupted 3-0 chromic sutures. I palpated the colostomy; it was completely patent with&nbsp; no obstructions. Dressings were applied. Colostomy bag was applied. Which CPT code should be used?</p>', '44140', '44143', '44160', '44208', '2022-06-15 05:57:19', '2022-06-15 05:57:19', 'ans_b'),
(988, 6, 29, 1, '<p>Garret is diagnosed with ulcerative colitis. He is referred to a surgeon, Dr. Brown. He performs a&nbsp; continent ileostomy as treatment. What code(s) captures this service?</p>', '44316', '44310', '44316, 44320-59', '44799', '2022-06-15 06:10:24', '2022-06-15 06:10:24', 'ans_a'),
(989, 6, 29, 1, '<p>Jim presents to Dr. Martin&#39;s office with severe abdominal pain. Dr. Martin has not made a definitive&nbsp; diagnosis. He schedules Jim for diagnostic laparoscopy that same afternoon. Dr. Martin begins the operation&nbsp; with a diagnostic laparoscopy. He notices Jim has a vermiform appendix. Dr. Martin removes the appendix&nbsp; laparoscopically. The final diagnosis is appendicitis. What code(s) capture these services?</p>', '44950,49320-51', '49320', '44970', '44970, 49320-51', '2022-06-15 07:24:58', '2022-06-15 07:24:58', 'ans_c'),
(990, 6, 29, 1, '<p>Dr. Mist performed the following procedures on a patient: a flexible diagnostic colonoscopy with&nbsp; collection of eight specimens by brushing in the morning. Later the same day, the patient had a diagnostic&nbsp; upper gastrointestinal endoscopy (EGD), including the esophagus, stomach, and the jejunum with transmural&nbsp; drainage of a pseudocyst. These procedures were not staged or related and occurred during different&nbsp; sessions. What codes capture these procedures?</p>', '45380 x 8, 43240-58', '43239 X 8, 44388-59', '45378, 43240-59', '45355,43235-59', '2022-06-15 07:26:36', '2022-06-15 07:26:36', 'ans_c'),
(991, 6, 29, 1, '<p>Dean lost his teeth in an auto accident one year ago. He has had several facial surgeries to restore his&nbsp; nasal function and rebuild the orbit of his eye and cheek. Currently, he is scheduled for a posterior complex&nbsp; vestibuloplasty with muscle repositioning. What code(s) capture the current procedure?</p>', '40845', '40843-52', '40842, 40845', '40899', '2022-06-15 07:28:31', '2022-06-15 07:28:31', 'ans_a'),
(992, 6, 29, 1, '<p>A physician inserts a catheter into a renal abscess under radiologic guidance. The physician then drains&nbsp; the abscess. The procedure was performed at the hospital. How should the physician&#39;s services be coded?</p>', '50020, 75989-26', '49405', '49405, 75989-TC', '50020, 75989-TC', '2022-06-15 07:29:59', '2022-06-15 07:29:59', 'ans_b'),
(993, 6, 29, 1, '<p>66-year-old female is admitted to the hospital with a diagnosis of stomach cancer. The surgeon performs a&nbsp; total gastrectomy with formation of an intestinal pouch. Due to the spread of the disease, the physician also performs a total en bloc splenectomy. What CPT&reg; codes are reported?</p>', '43622, 38100-51', '43622, 38102', '43634, 38115-51', '43634, 38102-51', '2022-06-15 07:31:08', '2022-06-15 07:31:08', 'ans_b'),
(994, 6, 29, 1, '<p>A patient suffering from cirrhosis of the liver presents with a history of coffee ground emesis. The&nbsp; surgeon diagnoses the patient with esophageal gastric varices. Two days later, in the hospital GI lab, the&nbsp; surgeon ligates the varices with bands via an UGI endoscopy. What CPT&reg; are reported?</p>', '43205', '43244', '43400', '43235', '2022-06-15 07:32:59', '2022-06-15 07:32:59', 'ans_b'),
(995, 6, 29, 1, '<p>A patient was taken to the emergency room for severe abdominal pain, nausea and vomiting. A WBC&nbsp; (white blood cell count) was taken and the results showed an elevated WBC count. The general surgeon&nbsp; suspected appendicitis and performed an emergent appendectomy. The patient had extensive adhesions&nbsp; secondary to two previous Cesarean-deliveries. Dissection of this altered anatomical field and required&nbsp; the surgeon to spend 40 additional intraoperative minutes. The surgeon discovered that the appendix was &nbsp;not ruptured nor was it hot. Extra time was documented in order to thoroughly irrigate the peritoneum.&nbsp;</p>\r\n\r\n<p>What CPT&reg; codes are reported?</p>', '44970-22', '44950-22', '44960-22', '44005, 44955', '2022-06-15 07:34:27', '2022-06-15 07:34:27', 'ans_b'),
(996, 6, 29, 1, '<p>The patient was taken to the operating room and placed in the dorsal lithotomy position, prepped and&nbsp; draped in the usual sterile fashion. A vertical paramedian incision was made along the left side of the&nbsp; umbilicus from the symphysis and taken up to above the umbilicus. This incision was carried down to the&nbsp; rectus muscles, which were separated in the midline. The peritoneal cavity was entered with findings as&nbsp; described. The ascitic fluid was removed and hand-held retractors were used to assist in surgical exposure.</p>\r\n\r\n<p>The tumor was resected from the hepatic flexure into the mid transverse colon. The resection was&nbsp; extended into the left upper quadrant and the attachments were also clamped, cut and suture ligated with 2-0 silk sutures in a stepwise fashion until mobilization of the tumor mass could be brought medial and&nbsp; hemostasis was obtained. Attempts to find a dissection plane between the tumor mass and the transverse&nbsp; colon were unsuccessful as it appeared that the tumor mass was invading into the wall of the bowel with extrinsic compression and distortion of the bowel lumen.</p>\r\n\r\n<p>Given the mass could not be resected without removal of bowel, attention was directed to mobilization of&nbsp; the splenic flexure. Retroperitoneal dissection was started in the pelvis and continued along the left&nbsp; paracolic gutter. The ligamentous and peritoneal attachments were taken down with Bovie cautery in a&nbsp; stepwise fashion around the splenic flexure of the colon until the entire left colon was mobilized medially.&nbsp; Similar steps were then carried on the right side as the right colon and hepatic flexure were mobilized. The peritoneal and ligamentous attachments were taken down with Bovie cautery. Vascular attachments&nbsp; were clamped, cut, and suture ligated with 2-0 silk until the right colon was mobilized satisfactorily. The&nbsp; GIA stapler was introduced and fired at both ends to dissect the tumorous bowel free. The bowel was&nbsp; delivered off the operative field.</p>\r\n\r\n<p>Attention was then directed towards re-anastomosis of the colon. Linen-shod clamps were used to gently&nbsp; clamp the proximal and distal segments of the large bowel. The staple line was removed with Metzenbaum scissors, and the colon lumen was irrigated. The silk sutures were used to divide the circumference of the&nbsp; bowel into equal thirds, and the proximal and distal edges of the bowel were reapproximated with silk sutures. The posterior segment of the bowel was then retracted and secured with a TA stapler, ensuring a&nbsp; full thickness bowel wall insertion into the staple line. The additional two thirds were also isolated and,&nbsp; with the TA stapler, clamped, ensuring that all layers of the bowel wall were incorporated into the anastomosis. A third staple line was fired and the integrity of the anastomosis was checked. First complete&nbsp; hemostasis was noted. There was well beyond a finger width lumen within the large bowel. The linen-shod&nbsp; clamps were released and gas and bowel fluid were moved through the anastomosis aggressively with intact staple line, no leakage of gas or fluid. The abdomen was then irrigated and water was left over the anastomosis. The anastomosis was manipulated with no</p>\r\n\r\n<p>extravasation of air. The abdomen and pelvis were then irrigated aggressively. The Mesenteric trap was&nbsp; then reapproximated with interrupted 3-0 silk suture ligatures. All sites were inspected and noted to be&nbsp; hemostatic. Attention was directed towards closing.</p>\r\n\r\n<p>What is the correct CPT&reg; coding for this report?</p>', '44140', '44160', '44140, 44139', '44147, 44139', '2022-06-15 07:37:21', '2022-06-15 07:37:21', 'ans_c'),
(997, 6, 29, 1, '<p>Margaret has a cholecystoenterostomy with a Roux-en-Y; five hours later she has an enormous amount of&nbsp; pain, abdominal swelling and a spike in her temperature. She is returned to the OR for an exploratory&nbsp; laparotomy and subsequent removal of a sponge that remained behind from surgery earlier that day. The&nbsp; area had become inflamed and peritonitis was setting in. What is the correct coding for the subsequent&nbsp; services on this date of service? The same surgeon took her back to the OR as the one who performed the&nbsp; original operation.</p>\r\n\r\n<p>What CPT&reg; code is reported?</p>', '49000-58', '49000-77', '49402-77', '49402-78', '2022-06-15 07:38:37', '2022-06-15 07:38:37', 'ans_d'),
(998, 6, 29, 1, '<p>Operative Report</p>\r\n\r\n<p>Indications: This is a third follow-up EGD dilation on this patient for a pyloric channel ulcer which has&nbsp; been slow to heal with resulting pyloric stricture. This is a repeat evaluation and dilation. Medications: Intravenous Versed 2 mg. Posterior pharyngeal Cetacaine spray.</p>\r\n\r\n<p>Procedure: With the patient in the left lateral decubitus position, the Olympus GIFXQ10 was inserted&nbsp; into the proximal esophagus and advanced to the Z-line. The esophageal mucosa was unremarkable. Stomach was entered revealing normal gastric mucosa. Mild erythema was seen in the antrum. The</p>\r\n\r\n<p>pyloric channel was again widened. However, the ulcer as previously seen was well healed with a scar.&nbsp; The pyloric stricture was still present. With some probing, the 11 mm endoscope could be introduced into the second portion of the duodenum revealing normal mucosa. Marked deformity and scarring was seen in the proximal bulb. Following the diagnostic exam, a 15 mm balloon was placed across the stricture,&nbsp; dilated to maximum pressure, and withdrawn. There was minimal bleeding post-op. Much easier access&nbsp; into the duodenum was accomplished after the dilation. Follow-up biopsies were also taken to evaluate&nbsp; Helicobacter noted on a previous exam. The patient tolerated the procedure well.</p>\r\n\r\n<p>Impressions: Pyloric stricture secondary to healed pyloric channel ulcer, dilated.</p>\r\n\r\n<p>Plan: Check on biopsy, continue Prilosec for at least another 30 days. At that time, a repeat endoscopy&nbsp; and final dilation will be accomplished. He will almost certainly need chronic H2 blocker therapy to&nbsp; avoid recurrence of this divesting complicated ulcer.</p>\r\n\r\n<p>What CPT&reg; codes are reported?</p>', '43245, 43239-51', '43236, 43239-59', '43235, 43239-51', '43248, 43239-59', '2022-06-15 07:42:49', '2022-06-15 07:42:49', 'ans_a'),
(999, 6, 29, 1, '<p>A 70‐year‐old female who has a history of strangulated&nbsp;ventral hernia was advised to undergo&nbsp; laparoscopic evaluation and repair. An incision was made in the epigastrium and dissection was carried&nbsp; down through the subcutaneous tissue. Two 5‐mm trocars were placed, one in the left upper quadrant and&nbsp; one in the left lower quadrant and the laparoscope was inserted. Dissection was carried down to the area&nbsp; of the hernia where a small defect was clearly visualized. There was some omentum, which was adhered &nbsp;to the hernia and this was delivered back into the peritoneal cavity. The mesh was tacked on to cover the&nbsp; defect. What procedure code(s) should be used?</p>', '49591', '49595', '49593', '49592', '2022-06-15 07:45:06', '2023-04-17 09:08:56', 'ans_a'),
(1000, 6, 29, 1, '<p>A patient presents for esophageal dilation. The physician begins dilation by using a bougie. This attempt was unsuccessful. The physician then dilates the esophagus transendoscopically using a balloon (25mm). What CPT&reg; code(s) is/are reported?</p>', '43450, 43220', '43450-53, 43220', '43220, 43450-52', '43220', '2022-06-15 07:47:31', '2022-06-15 07:47:31', 'ans_d'),
(1001, 6, 29, 1, '<p>Surgical laparoscopy with a cholecystectomy and exploration of the common bile duct, for cholelithiasis. What CPT&reg; codes are reported?</p>', '47610', '47564', '47562, 47552', '47610, 47560', '2022-06-15 07:49:23', '2022-06-15 07:49:23', 'ans_b');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1002, 6, 29, 1, '<p>45-year-old patient with liver cancer is scheduled for a liver transplant. The patient&rsquo;s brother is a perfect&nbsp; match and will be donating a portion of his liver for a graft. Segments II and III will be taken from the&nbsp; brother and then the backbench reconstruction of the graft will be performed, both a venous and arterial&nbsp; anastomosis. The orthotopic allotransplantation will then be performed on the patient. What CPT&reg; codes are reported?</p>', '47140, 47146, 47147, 47135', '47141, 47146, 47135', '47140, 47147, 47146, 47136', '47141, 47146, 47136', '2022-06-15 07:52:53', '2022-06-15 07:52:53', 'ans_a'),
(1003, 6, 29, 1, '<p>53‐year‐old woman with ascites consented to a procedure to withdraw fluid from the&nbsp; abdominal cavity. Ultrasonic guidance was used for guiding the needle placement for the&nbsp; aspiration. What CPT&reg; codes should be used?</p>', '49083', '49180, 76942‐26', '49082, 77002‐26', '49180, 76998‐26', '2022-06-15 07:56:09', '2022-06-15 07:56:09', 'ans_a'),
(1004, 6, 29, 1, '<p>15‐year‐old female is to have a tonsillectomy performed for chronic tonsillitis and&nbsp;hypertrophied tonsils. A McIver mouth gag was put in place and the tongue was depressed.&nbsp;The nasopharynx was digitalized. No significant adenoid tissue was felt. The tonsils and pillars were&nbsp;then removed bilaterally by dissection. The premolar trigone&nbsp;was a huge size because of edema, a part&nbsp; of this was removed and the raw surface oversewn with 3‐0 chromic catgut. Which CPT&nbsp;code(s) should be used?</p>', '42821', '42825, 42104‐51', '42826, 42106‐51', '42842', '2022-06-15 07:58:16', '2023-10-27 00:35:16', 'ans_d'),
(1005, 6, 29, 1, '<p>34‐year‐old male developed a ventral hernia when lifting a 60 pound bag. The patient is in&nbsp; surgery for a ventral herniorrhaphy. The abdomen was entered through a short midline&nbsp; incision revealing the fascial defect. The hernia sac and contents were able to easily be&nbsp; reduced and a large plug of mesh was placed into the fascial defect. The edge of the mesh&nbsp; plug was sutured to the fascia. What procedure code(s) should be used?</p>', '49593', '49595', '49592', '49591', '2022-06-15 08:01:40', '2023-04-17 09:09:39', 'ans_d'),
(1006, 6, 29, 1, '<p>An 82‐year‐old female had a CAT scan which revealed evidence of a proximal small bowel&nbsp; obstruction. She was taken to the Operating Room where an elliptical abdominal incision&nbsp; was made, excising the skin and subcutaneous tissue. There were extensive adhesions along&nbsp; the entire length of the small bowel the omentum and bowel were stuck up to the anterior&nbsp; abdominal wall. Time‐ consuming tedious lysis of adhesions was performed to free up the&nbsp; entire length of the gastrointestinal tract from the ligament to Treitz to the ileocolic&nbsp; anastomosis. The correct CPT&reg; code is:</p>', '44005', '44180‐22', '44005‐22', '44180‐59', '2022-06-15 08:02:56', '2022-06-15 08:02:56', 'ans_c'),
(1007, 6, 29, 1, '<p>55‐year‐old patient was admitted with massive gastric dilation. The endoscope was inserted&nbsp; with a catheter placement. The endoscope is passed through the cricopharyngeal muscle&nbsp; area without difficulty. Esophagus is normal, some chronic reflux changes at the&nbsp; esophagogastric junction noted. Stomach significant distention with what appears to be&nbsp; multiple encapsulated tablets in the stomach at least 20 to 30 of these are noted. Some of&nbsp; these are partially dissolved. Endoscope could not be engaged due to high grade narrowing&nbsp; in the pyloric channel, the duodenum was not examined. It seems to be a high grade outlet&nbsp; obstruction with a superimposed volvulus. A repeat examination is not planned at this time.&nbsp; What code should be used for this procedure?</p>', '43246‐53', '43241‐53', '43235', '43241-52', '2022-06-15 08:07:17', '2023-09-14 04:58:39', 'ans_b'),
(1008, 6, 29, 1, '<p>The patient is a 78‐year‐old white female with morbid obesity that presented with small&nbsp; bowel obstruction. She had surgery approximately one week ago and underwent&nbsp; exploration, which required a small bowel resection of the terminal ileum and anastomosis&nbsp; leaving her with a large inferior ventral hernia. Two days ago she started having drainage&nbsp; from her wound which has become more serious. She is now being taken back to the&nbsp; operating room. Reopening the original incision with a scalpel, the intestine was examined&nbsp; and the anastomosis was reopened , excised at both ends, and further excision of intestine.&nbsp; The fresh ends were created to perform another end‐ to‐end anastomosis. The correct&nbsp; procedure code is:</p>', '44120‐78', '44126‐79', '44120‐76', '44202‐58', '2022-06-15 08:09:11', '2023-04-17 06:53:42', 'ans_a'),
(1009, 6, 29, 1, '<p>PREOPERATIVE DIAGNOSIS: Diverticulitis, perforated diverticula POST OPERATIVE&nbsp; DIAGNOSIS: Diverticulitis, perforated diverticula PROCEDURE: Hartmann procedure, which is&nbsp; a sigmoid resection with Hartmann pouch and colostomy. DESCRIPTION OF THE&nbsp; PROCEDURE: Patient was prepped and draped in the supine position under general&nbsp; anesthesia. Prior to surgery patient was given 4.5 grams of Zosyn and Rocephin IV&nbsp; piggyback. A lower midline incision was made, abdomen was entered. Upon entry into the&nbsp; abdomen, there was an inflammatory mass in the pelvis and there was a large abscessed&nbsp; cavity, but no feces. The abscess cavity was drained and irrigated out. The left colon was&nbsp; immobilized, taken down the lateral perineal attachments. The sigmoid colon was&nbsp; mobilized. There was an inflammatory mass right at the area of the sigmoid colon consistent&nbsp; with a divertiliculitis or perforation with infection. Proximal to this in the distal left colon,&nbsp; the colon was divided using a GIA stapler with 3.5 mm staples. The sigmoid colon was then&nbsp; mobilized using blunt dissection. The proximal rectum just distal to the inflammatory mass&nbsp; was divided using a GIA stapler with 3.5 mm staples. The mesentary of the sigmoid colon was then taken down and tied using two 0 Vicryl ties. Irrigation was again performed and&nbsp; the sigmoid colon was removed with inflammatory mass. The wall of the abscessed cavity&nbsp; that was next to the sigmoid colon where the inflammatory mass was, showed no leakage of&nbsp; stool, no gross perforation, most likely there is a small perforation in one of the diverticula&nbsp; in this region. Irrigation was again performed throughout the abdomen until totally clear. All&nbsp; excess fluid was removed. The distal descending colon was then brought out through a&nbsp; separate incision in the lower left quadrant area and a large 10 mm 10 French JP drain was&nbsp; placed into the abscessed cavity. The sigmoid colon or the colostomy site was sutured on&nbsp; the inside using interrupted 3‐0 Vicryl to the peritoneum and then two sheets of film were&nbsp; placed into the intra‐ abdominal cavity. The fascia was closed using a running #1 double&nbsp; loop PDS suture and intermittently a #2 nylon retention suture was placed. The colostomy&nbsp; was matured using interrupted 3‐0 chromic sutures. I palpated the colostomy; it was&nbsp; completely patent with no obstructions. Dressings were applied. Colostomy bag was&nbsp; applied. Which CPT&reg; code should be used?&nbsp;</p>', '44140', '44143', '44160', '44208', '2022-06-15 08:11:08', '2022-07-14 08:13:06', 'ans_b'),
(1010, 6, 29, 1, '<p>A 52‐year‐old patient is admitted to the hospital for chronic cholecystitis for which a&nbsp; laparoscopic cholecystectomy will be performed. A transverse infraumbilical incision was&nbsp; made sharply dissecting to the subcutaneous tissue down to the fascia using access under&nbsp; direct vision with a Vesi‐Port and a scope was placed into the abdomen. Three other ports</p>\r\n\r\n<p>were inserted under direct vision. The fundus of the gallbladder was grasped through the&nbsp; lateral port, where multiple adhesions to the gallbladder were taken down sharply and&nbsp; bluntly: The gallbladder appeared chronically inflamed. Dissection was carried out to the&nbsp; right of this identifying a small cystic duct and artery, was clipped twice proximally, once&nbsp; distally and transected. The gallbladder was then taken down from the bed using&nbsp; electrocautery,delivering it into an endo‐bag and removing it from the abdominal cavity&nbsp; with the umbilical port. What</p>\r\n\r\n<p>CPT&reg; and ICD‐10‐CM codes should be reported?&nbsp;</p>', '47564, K81.2', '47562, K81.1', '47610, K81.2', '47600, K81.1', '2022-06-15 08:12:32', '2022-06-15 08:12:32', 'ans_b'),
(1011, 6, 29, 1, '<p>A 17‐year‐old female who has a reducible&nbsp;ventral hernia was advised to&nbsp;undergo laparoscopic evaluation and repair. An incision was made in the epigastrium and&nbsp; dissection was carried down through the subcutaneous tissue. Two 5‐mm trocars were&nbsp; placed, one in the left upper quadrant and one in the left lower quadrant and the&nbsp; laparoscope was inserted. Dissection was carried down to the area of the hernia where a&nbsp; small defect was clearly visualized. There was some omentum, which was adhered to the&nbsp; hernia and this was delivered back into the peritoneal cavity. The mesh was tacked on to&nbsp; cover the defect. What procedure code(s) should be used?</p>', '49594', '49591', '49595', '49593', '2022-06-15 08:16:22', '2023-04-17 09:10:33', 'ans_b'),
(1012, 6, 29, 1, '<p>The patient is a 50‐year‐old gentleman who presented to the emergency room with signs&nbsp; and symptoms of acute appendicitis with possible rupture. He has been brought to the&nbsp; operating room. An infraumbilical incision was made which a 5‐mm VersaStep trocar was&nbsp; inserted. A 5‐mm 0‐ degree laparoscope was introduced. A second 5‐mm trocar was placed&nbsp; suprapubically and a 12‐mm trocar in the left lower quadrant. A window was made in the&nbsp; mesoappendix using blunt dissection with no rupture noted. The base of the appendix was&nbsp; then divided and placed into an Endo‐catch bag and the 12‐mm defect was brought out.&nbsp; Select the appropriate code for this procedure:&nbsp;</p>', '44970', '44950', '44960', '44979', '2022-06-15 08:19:11', '2022-06-15 08:19:11', 'ans_a'),
(1013, 6, 29, 1, '<p>55‐year‐old female has a symptomatic rectocele. She had been admitted and taken to the&nbsp; main OR. An incision is made in the vagina into the perineal body (central tendon of the&nbsp; perineum). Dissection was carried underneath posterior vaginal epithelium all the way over&nbsp; to the rectocele. Fascial tissue was brought together with sutures creating a bridge and the&nbsp; rectocele had been reduced with good support between the vagina and rectum. What&nbsp; procedure code should be reported?</p>', '45560', '57284', '57250', '57240', '2022-06-15 08:22:24', '2022-06-15 08:22:24', 'ans_a'),
(1014, 6, 11, 1, '<p>This patient is brought back to the operating room during the postoperative period by the same physician&nbsp; to repair an esophagogastrostomy leak, transthoracic approach, done 2 days ago. The patient is status post&nbsp; esophagectomy for cancer. Code the procedure and the diagnosis for the complication.</p>', '43320-78, K20.9', '43340-78, K92.2', '43341, K91.86', '43415-78, K91.89', '2022-06-17 05:56:07', '2022-06-17 05:56:07', 'ans_d'),
(1015, 6, 11, 1, '<p>The physician is using an abdominal approach to perform a proctopexy combined with a sigmoid&nbsp; resection:</p>', '45540', '45541', '45550', '45345', '2022-06-17 05:57:51', '2022-06-17 05:57:51', 'ans_c'),
(1016, 6, 11, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.&nbsp;</p>\r\n\r\n<p>PROCEDURE: Suction D&amp;C.</p>\r\n\r\n<p>The patient was prepped and draped in a lithotomy position under general mask anesthesia, and the bladder&nbsp; was straight catheterized; a weighted speculum was placed in the vagina. The anterior lip of the cervix was&nbsp; grasped with a single-tooth tenaculum. The uterus was then sounded to a depth of 8 cm. The cervical os was</p>\r\n\r\n<p>then serially dilated to allow passage of a size 10 curved suction curette. A size 10 curved suction curette was&nbsp; then used to evacuate the intrauterine contents. Sharp curette was used to gently palpate the uterine wall&nbsp; with negative return of tissue, and the suction curette was again used with negative return of tissue. The&nbsp; tenaculum was removed from the cervix. The speculum was removed from the vagina. All sponges and&nbsp; needles were accounted for at completion of the procedure. The patient left the operating room in apparent&nbsp; good condition having tolerated the procedure well. Pathology report indicated benign polyp.</p>', '59812, O03.9', '59812, O07.4', '59820, O02.1', '59856, O02.1', '2022-06-17 05:59:45', '2022-06-17 05:59:45', 'ans_c'),
(1017, 6, 11, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Right ureteralstricture.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Right ureteralstricture.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy, right ureteral stent change.</p>\r\n\r\n<p>PROCEDURE NOTE: The patient was placed in the lithotomy position after receiving IV sedation. He was&nbsp; prepped and draped in the lithotomy position. The 21 French cystoscope was passed into the bladder, and&nbsp; urine was collected for culture Inspection of the bladder demonstrated findings consistent with radiation&nbsp; cystitis, which has been previously diagnosed. There is no frank neoplasia. The right ureteral stent was&nbsp; grasped and removed through the urethral meatus; under fluoroscopic control, a guide wire was advanced up&nbsp; the stent, and the stent was exchanged for a 7 French 26-cm stent under fluoroscopic control in the usual&nbsp; fashion. The patient tolerated the procedure well.</p>', '51702-LT, N13.5', '51702-RT, N30.90', '52332-RT, N30.90', '52332-RT, N13.5', '2022-06-17 06:01:35', '2022-06-17 06:01:35', 'ans_d'),
(1018, 6, 11, 1, '<p>This patient is a 52-year-old female who has been having prolonged and heavy bleeding.&nbsp; SURGICAL FINDINGS: On pelvic exam under anesthesia, the uterus was normal size and firm. The examination revealed no masses. She had a few small endometrial polyps in the lower uterine segment. DESCRIPTION OF PROCEDURE: After induction of general anesthesia, the patient was placed in the&nbsp; dorsolithotomy position, after which the perineum and vagina were prepped, the bladder straight catheterized, and the patient draped. After bimanual exam was performed, a weighted speculum was placed&nbsp; in the vagina and the anterior lip of the cervix was grasped with a single toothed tenaculum. An endocervical&nbsp; curettage was then done with a Kevorkian curet. The uterus was then sounded to 8.5 cm. The endocervical&nbsp; canal was dilated to 7 mm with Hegar dilators. A 5.5-mm Olympus hysteroscope was introduced using a&nbsp; distention medium. The cavity was systematically inspected, and the preceding findings noted. The&nbsp; hysteroscope was withdrawn and the cervix further dilated to 10 mm. Polyp forceps was introduced, and a&nbsp; few small polyps were removed. These were sent separately. Sharp endometrial curettage was then done. The hysteroscope was then reinserted, and the polyps had essentially been removed. The patient tolerated the procedure well and returned to the recovery room in stable condition (Pathology confirmed benign&nbsp; endometrial polyps). Pathology confirmed benign endometrial polyps.</p>', '58558, 57460-51, N92.0, N84.0', '58558, N92.0, N84.0', '58558, 57558-51, N92.0, N84.0', '58558, N92.1, D49.5', '2022-06-17 06:03:47', '2022-06-17 06:03:47', 'ans_b'),
(1019, 6, 11, 1, '<p>This patient is 35 years old at 36 weeks&#39; gestation. She presented in spontaneouslabor. Because of her&nbsp; prior cesarean section,she is taken to the operating room to have a repeat lower-segment transverse&nbsp; cesarean section performed. The patient also desires sterilization, and so a bilateral tubal ligation will also be&nbsp; performed. A single live born infant was the outcome of the delivery.</p>', '59510, 58600-51, Z30.2', '59620, 58615-51, O60.14X0 Z37.0', '59514, 58605-51, Z37.0, O60.14X0', '59514, 58611, O60.14X0, O34.211, Z37.0, Z30.2', '2022-06-17 06:04:48', '2022-07-26 06:58:41', 'ans_d'),
(1020, 6, 11, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Possible recurrent transitional cell carcinoma of the bladder.&nbsp; POSTOPERATIVE DIAGNOSIS: No evidence of recurrence.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy with multiple bladder biopsies.</p>\r\n\r\n<p>PROCEDURE NOTE: The patient was given a general mask anesthetic, prepped, and draped in the lithotomy&nbsp; position. The 21 French cystoscope was passed into the bladder. There was a hyperemic area on the posterior wall of the bladder, and a biopsy was taken. Random biopsies of the bladder were also performed. This area was fulgurated. A total of 7 cm2 of bladder was fulgurated. A catheter was left at the end of the procedure. The patient tolerated the procedure well and was transferred to the recovery room in good condition. The pathology report indicated no evidence of recurrence.</p>', '52224, Z85.51', '51020, 52204, Z80.59', '52234, Z85.51', '52224 × 4, D41.4', '2022-06-17 06:05:48', '2022-06-17 06:05:48', 'ans_a'),
(1021, 6, 11, 1, '<p>This 41-year-old female presented with a right labial lesion. A biopsy was taken, and the results were&nbsp; reported as VIN-III, cannot rule out invasion. The decision was therefore made to proceed with wide local&nbsp; excision of the right vulva.</p>\r\n\r\n<p>PROCEDURE: The patient was taken to the operating room, and general anesthesia was administered. The&nbsp; patient was then prepped and draped in the usual manner in lithotomy position, and the bladder was emptied with a straight catheter. The vulva was then inspected. On the right labium minora at approximately the 11&nbsp; o&#39;clock position, there was a multifocal lesion. A marking pen was then used to mark out an elliptical incision, leaving a 1-cm border on all sides. The skin ellipse was then excised using a knife. Bleeders were cauterized with electrocautery. A running locked suture of 2-0 Vicryl was then placed in the deeper tissue. The skin was finally re approximated with 4 0 Vicryl in an interrupted fashion. Good hemostasis was thereby achieved. The patient tolerated this procedure well. There were no complications.</p>', '56605, C51.9', '56625, D07.1', '56620, D07.1', '11620, C51.9', '2022-06-17 06:06:57', '2022-06-17 06:06:57', 'ans_c'),
(1022, 6, 11, 1, '<p>Left frontal ventricular puncture for implanting catheter, layered repair of 8-cm scalp laceration, and&nbsp; repair of multiple facial and eyelid lacerations with an approximate total length of 12 cm.</p>', '61020, 12015-51', '61107, 12034-51, 12015-51', '61215, 12015-51', '61107, 12034-51', '2022-06-17 06:08:19', '2022-06-17 06:08:19', 'ans_b'),
(1023, 6, 11, 1, '<p>Marginal laceration involving the left lower eyelid; full-thickness repair of multiple stellate lacerations&nbsp; above the left eye involving the tarsus, totaling 24.2 cm and requiring full-thicknessrepair.</p>', '67935-E2, 12017', '67930-E2, 13152-51, 13153', '67935-E2', '67935-E2, 12017-51', '2022-06-17 06:09:16', '2023-04-17 06:54:32', 'ans_c'),
(1024, 6, 11, 1, '<p>OPERATIVE REPORT PREOPERATIVE&nbsp;</p>\r\n\r\n<p>DIAGNOSIS: Fever. PROCEDURE PERFORMED:</p>\r\n\r\n<p>Lumbar puncture.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was placed in the lateral decubitus position with the left side up.&nbsp; The legs and hips were flexed into the fetal position. The lumbosacral area was sterilely prepped. It was then&nbsp; numbed with 1% Xylocaine. I then placed a 22-gauge spinal needle on the first pass into the intrathecalspace&nbsp; between the L4 and L5 spinous processes. The fluid was minimally xanthochromic. I sent the fluid for cell&nbsp; count for differential, protein, glucose, Gram stain, and culture. The patient tolerated the procedure well&nbsp; without apparent complication. The needle was removed at the end of the procedure. The area was cleansed, and a Band-Aid was placed.</p>', '62272, R68.12', '62268, R50.9', '62272, R60.9, R50.9', '62270, R50.9', '2022-06-17 06:14:20', '2022-06-17 06:14:20', 'ans_d'),
(1025, 6, 11, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Herniated disk L4-5 on the left.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Laminotomy, foraminotomy,removal of herniated disk L4-5 on the left.&nbsp; PROCEDURE: Under general anesthesia, the patient was placed in the prone position and the back was prepped and draped in the usual manner. An incision was made in the skin extending through subcutaneous&nbsp; tissue. Lumbodorsal fascia was divided. The erectorspinae muscles were bluntly dissected from the lamina of&nbsp; L4-5 on the left. The interspace was localized. I then performed a generouslaminotomy and foraminotomy here, and retracted on the nerve root. It was obviousthere was a herniated disk. I removed it, entered the space, and removed degenerating material,satisfied that I had decompressed the root well.&nbsp; There were free fragmentslying around beneath the nerve root. We removed all of these. I was able to pass&nbsp; a hockey stick down the foramen across the midline, satisfied I had taken out the large fragmentsfrom the&nbsp; interspace at L4-5, and decompressed it well. I irrigated the wound well, put a Hemovac drain in the wound, and then closed the wound in layers using double knotted 0 chromic on the lumbodorsal fascia with Vicryl, 2- 0 plain in the subcutaneoustissue and surgicalstaples on the skin. A dressing was applied. The patient was&nbsp; discharged to the recovery room.</p>', '63030-LT, M51.26', '63012-LT, M51.46', '63047-LT, M51.46', '63047-LT, 63048-LT, M51.26', '2022-06-17 06:24:04', '2022-06-17 06:24:04', 'ans_a'),
(1026, 6, 11, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Brain tumor versus abscess.&nbsp;</p>\r\n\r\n<p>PROCEDURE: Craniotomy.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: Under general anesthesia, the patient&#39;s head was prepped and draped in the&nbsp; usual manner. It was placed in Mayfield pins. We then proceeded with a craniotomy. An inverted U-shaped&nbsp; incision was made over the posterior right occipital area. The flap was turned down. Three burr holes were&nbsp;</p>\r\n\r\n<p>made. Having done this, I then localized the tumor through the burr holes and dura. We then made an incision in the dura in an inverted U-shaped fashion. The cortex looked a little swollen but normal. We then used the localizer to locate the cavity. I separated the gyrus and got right into the cavity and saw pus, which was removed. Cultures were taken and sent for pathology report, which came back later describing the presence of clusters of gram-positive cocci, confirming that this was an abscess. We cleaned out the abscessed cavity using irrigation and suction. The bed of the abscessed cavity was cauterized. Then a small piece of Gelfoam was used for hemostasis. Satisfied that it was dry, I closed the dura. I approximated the scalp. A dressing was applied. The patient was discharged to the recovery room.</p>', '61154, G06.0', '61154, D49.6', '61150, G06.0', '61150, D49.6', '2022-06-17 06:25:08', '2022-06-17 06:25:08', 'ans_c'),
(1027, 6, 11, 1, '<p>This patient came in with an obstructed ventriculoperitoneal shunt. The procedure performed was to be a revision of shunt. After inspecting the shunt system, the entire cerebrospinal fluid shunt system was removed and a similar replacement shunt system was placed.</p>', '62180, T82.598A', '62258, T85.09XA', '62256, T85.09XA', '62190, T85.09XA', '2022-06-17 06:26:43', '2022-06-17 06:26:43', 'ans_b'),
(1028, 6, 11, 1, '<p>Bill, a retired U.S. Air Force pilot, was on observation status 12 hours to assess the outcome of a fall&nbsp; from the back of a pickup truck into a gravel pit. The physician discharged Bill from observation that same&nbsp; day after determining that no further monitoring of his condition was necessary. The physician provided a&nbsp; comprehensive history and examination and spent 65 min with the patient.</p>', '99221, Z04.9, W18.30XA', '99234, Z04.3, W17.2XXA', '99222, Z04.3, W18.30XA', '99234, 99217, Z04.3, W17.2XXA', '2022-06-17 06:28:05', '2023-05-31 04:53:51', 'ans_b'),
(1029, 6, 11, 1, '<p>Dr. Martin admits a 65-year-old patient to the hospital with acute pericarditisfollowing a severe viral&nbsp; infection. The patient has complained of retrosternal,sharp, intermittent pain of 2 days&#39; duration that is&nbsp; reduced by sitting up and leaning forward, accompanied by tachypnea. The physician completes a&nbsp; comprehensive history and physical examination. The physician ordered an electrocardiogram, x-rays, and&nbsp; routine laboratory workup. The physician considers the multiple diagnoses of pericarditisfollowing infection,&nbsp; unstable angina, dissecting aneurysm, pulmonary infarction, or esophageal disease, indicating a high level of&nbsp; medical decision making complexity.</p>', '99236, R07.2, R06.82', '99223, I30.0, I20.0, I72.9, I26.99, K22.9', '99245, I30.0, I20.0, I72.9, I26.99, K22.9', '99223, R07.2, R06.82', '2022-06-17 06:31:19', '2022-06-17 06:31:19', 'ans_d'),
(1030, 6, 11, 1, '<p>A gynecologist admits an established patient, a 35-year-old female with dysfunctional uterine bleeding&nbsp; (DUB), after seeing her in the clinic that day. During the course of the comprehensive history, the physician&nbsp;notes that the patient has a history of infrequent periods of heavy flow. She has had irregular heavy periods&nbsp; and intermittent spotting for 4 years. The patient has been on a 3-month course of oral contraceptives (OCP). The family history is positive for endometrial cancer, with mother, two aunts, and two sisters who had endometrial cancer. The patient has a personal history of cervical and endometrial polyp removal 3 years&nbsp; prior to admission. As a part of the comprehensive physical examination, the physician notes the patient has&nbsp; a large amount of blood in the vault and an enlarged uterus. The prolonged hemorrhaging has resulted in a&nbsp; very thin and friable endometrial lining. The physician orders the patient to be started on intravenous&nbsp; Premarin and orders a full laboratory workup. The medical decision making is of moderate complexity.</p>', '99215, 99222, Z87.42, Z80.49', '99222, N92.0, Z87.42, Z80.49', '99215, 99222, N89.8, Z87.42, Z80.49', '99222, N91.5, Z80.49', '2022-06-17 06:32:35', '2022-06-23 09:51:00', 'ans_b'),
(1031, 6, 11, 1, '<p>Dr. Black admits a patient with an 8-day history of a low-grade fever, tachycardia, tachypnea, and basal&nbsp; consolidation of the lung and limited pleural effusion on the left side. An extensive past, family, and social&nbsp; history is taken as part of a comprehensive history. Bowel sounds are feeble. The pulse is rapid and thready.&nbsp; The comprehensive examination further indicates a jaundiced appearance with distention of the abdomen. There is a bluish discoloration of the flanks. The physician orders laboratory tests and radiographic studies,&nbsp; including an abdominalsonogram as he considers the extensive diagnostic options and the medical decision&nbsp; making complexity is high for this patient.</p>', '99233, R50.9, R00.0, R06.82, J91.8, R19.15', '99233, R50.9, I47.1, R06.82, J18.9, J91.8', '99223, R50.9, R00.0, R06.82, J13', '99223, R50.9, R00.0, R06.82, J91.8, R19.15', '2022-06-17 06:33:48', '2022-09-21 09:09:41', 'ans_d'),
(1032, 6, 11, 1, '<p>Dr. Stephanopolis makes subsequent hospital visits to Salanda Ortez, who has been in the hospital for&nbsp; primary viral pneumonia. She was experiencing severe dyspnea, rales, fever, muscle aches, and chest pain.&nbsp; The chest radiography showed patchy bilateral infiltrates and basilar streaking. Sputum microbiology was positive for a secondary bacterial pneumonia. The physician conducted an interval history focused on the&nbsp; patient&#39;s current problems and continued to do a problem-focused physical examination. The medical&nbsp; decision making was straightforward, and the patient was given intravenous antibiotic to address the&nbsp; bacterial pneumonia.</p>', '99231, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99231, J15.8', '99221, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99234, J15.8', '2022-06-17 06:35:29', '2022-06-17 06:35:29', 'ans_b'),
(1033, 6, 11, 1, '<p>A 57-year-old male was sent by his family physician to a urologist for an office consultation. The patient has had bright red blood in his urine sporadically for the past 3 weeks. The urologist obtains a medically appropriate history from the patient and continues with physical examination. The urologist recommends a cystoscopy to be scheduled for the following week and discusses the procedure and risks with the patient. The physician spent a total time of 35&nbsp;mins with the patient. The urologist report back his opinion with refering physican. Report the CPT code(s) for the service.</p>', '99243-57', '99243-57, 52000', '99252', '99243', '2022-06-17 06:36:49', '2023-10-09 02:19:28', 'ans_d'),
