(1039, 6, 11, 1, '<p>This patient undergoes a gallbladder sonogram due to epigastric pain. The report indicates that the&nbsp; visualized portions of the liver are normal. No free fluid noted within Morison&#39;s pouch. The gallbladder is&nbsp; identified and is empty. No evidence of wall thickening or surrounding fluid is seen. There is no ductal&nbsp; dilatation. The common hepatic duct and common bile duct measure 0.4 and 0.8 cm, respectively. The&nbsp; common bile duct measurement is at the upper limits of normal.&nbsp;</p>', '76700-26, R10.84', '76705-26, R10.13', '76775-26, R10.33', '76705, R10.84', '2022-06-17 06:46:45', '2022-06-17 06:46:45', 'ans_b'),
(1040, 6, 11, 1, '<p>EXAMINATION OF: Chest.&nbsp;&nbsp;</p>\r\n\r\n<p>CLINICAL SYMPTOMS: Pneumonia.&nbsp;</p>\r\n\r\n<p>PA AND LATERAL CHEST X-RAY WITH FLUOROSCOPY.&nbsp;</p>\r\n\r\n<p>CONCLUSION: Ventilation within the lung fields has improved compared with previous study.&nbsp;</p>', '71045-26 , J15.8', '71048, J15.6', '71046-26, J18.9', '71046, J18.9', '2022-06-17 06:48:02', '2022-06-17 06:48:02', 'ans_c'),
(1041, 6, 11, 1, '<p>EXAMINATION OF: Abdomen and pelvis.&nbsp;&nbsp;</p>\r\n\r\n<p>CLINICAL SYMPTOMS: Ascites.&nbsp;</p>\r\n\r\n<p>CT OF ABDOMEN AND PELVIS: Technique: CT of the abdomen and pelvis was performed without oral or IV contrast material per physician request. No previous CT scans for comparison.&nbsp;&nbsp;</p>\r\n\r\n<p>FINDINGS: No ascites. Moderate-sized pleural effusion on the right.&nbsp;</p>', '74150-26, 72192-26 R18.8', '74176-26, J91.8', '74150-26, 72192-26 J91.8', '74176-26, R18.8', '2022-06-17 06:49:23', '2022-06-17 06:49:23', 'ans_b'),
(1042, 6, 11, 1, '<p>EXAMINATION OF: Brain.&nbsp;&nbsp;</p>\r\n\r\n<p>CLINICAL FINDING: Headache.&nbsp;</p>\r\n\r\n<p>COMPUTED TOMOGRAPHY OF THE BRAIN was performed without contrast material. FINDINGS: There is blood within the third ventricle. The lateral ventriclesshow mild dilatation with small&nbsp; amounts of blood.&nbsp;</p>\r\n\r\n<p>IMPRESSION: Acute subarachnoid hemorrhage.&nbsp;</p>', '70460-26, R51.9', '70250, R51.9', '70450-26, I60.9', '70450-26, R51.9', '2022-06-17 06:51:05', '2022-06-17 06:51:05', 'ans_c'),
(1043, 6, 11, 1, '<p>Report both the technical and professional components of the following service: This 68-year-old male is&nbsp; seen in Radiation Oncology Department for prostate cancer. The oncologist performs a complex clinical&nbsp; treatment planning, dosimetry calculation, and a complex isodose plan; treatment devices include blocks,&nbsp; special shields, and wedges. The patient had 5&nbsp;days of radiation treatments for 3 weeks, a total of 15 days of&nbsp; treatment.&nbsp;</p>', '77263, 77300, 77307, 77334, C61', '77300, 77315, 77334, 77427 × 2, C61', '77263, 77307, 77334, 77427 × 3, C61', '77263, 77427, C61', '2022-06-17 06:52:34', '2022-09-21 09:18:27', 'ans_c'),
(1044, 6, 11, 1, '<p>Patient is coming in for a pathological examination for ischemia in the left leg. The first&nbsp; specimen is 1.5 cm of a single portion of arterial plaque taken from the left common&nbsp; femoral artery. The second specimen is 8.5 x 2.7 cm across x 1.5 cm in thickness of a&nbsp; cutaneous ulceration with fibropurulent material on the left leg. What surgical pathology&nbsp; codes should be reported for the pathologist?</p>', '88304‐26, 88302‐26', '88305‐26, 88304‐26', '88307‐26, 88305‐26', '88309‐26, 88307‐26', '2022-06-17 06:53:34', '2022-06-17 06:53:34', 'ans_b'),
