(1048, 6, 11, 1, '<p>CLINICAL HISTORY: Necrotic soleus muscle, right leg.&nbsp;</p>\r\n\r\n<p>SPECIMEN RECEIVED: Soleus muscle, right leg.</p>\r\n\r\n<p>GROSS DESCRIPTION: Submitted in formalin, labeled with the patient&#39;s name and &quot;soleus muscle right leg&quot; are multiple irregular fragments of tan, gray, brown soft tissue measuring 8 &times; 8 &times;</p>\r\n\r\n<p>2.5 cm in aggregate. Multiple representative fragments are submitted in four cassettes. MICROSCOPIC DESCRIPTION: The slides show multiple sections of skeletal muscle showing severe coagulative&nbsp; and liquefactive necrosis. Patchy neutrophilic infiltrates are present within the necrotic tissue. DIAGNOSIS: Soft tissue, soleus muscle, right leg debridement; necrosis and patchy acute inflammation,&nbsp; skeletal muscle.</p>', '88305-26, M62.50', '88305-26, M60.009', '88307-26, I96', '88304-26, M62.50', '2022-06-17 07:00:10', '2023-09-06 00:18:34', 'ans_b'),
(1049, 6, 11, 1, '<p>This 34-year-old established female patient is in for her yearly physical and lab. The physician orders a&nbsp; comprehensive metabolic panel, hemogram automated and manual differential WBC count (CBC), and a&nbsp; thyroid stimulating hormone. Code the lab only.</p>', '99395, 80050', '80050-52', '80069, 80050', '80050', '2022-06-17 07:01:23', '2022-06-17 07:01:23', 'ans_d'),
(1050, 6, 11, 1, '<p>DIALYSIS INPATIENT NOTE: This 24-year-old male patient is on continuous ambulatory peritoneal dialysis (CAPD) using 1.5%. He drains more than 600 ml. He is tolerating dialysis well. He continuesto have some abdominal pain, but his abdomen is not distended. He has some diarrhea. His abdomen does not look&nbsp; like acute abdomen. His vitals, other than blood pressure in the 190s over 100s, are fine. He is afebrile. At this time, I will continue with 1.5% dialysate. I gave him labetalol IV for blood pressure. Because of diarrhea, I am going to check stool for white cells, culture. Next we will see what the primary physician says today. His HIDA scan was normal. The patientsuffers from ESRD.</p>', '90947, 90960, N18.6, R19.7', '90945, N18.6, R19.7', '90960, N18.6', '90945, N18.6', '2022-06-17 07:14:31', '2022-06-17 07:14:31', 'ans_b'),
(1051, 6, 11, 1, '<p>INDICATION: Hypertension with newly diagnosed acute myocardial infarction.&nbsp;</p>\r\n\r\n<p>PROCEDURE PERFORMED: Insertion of Swan-Ganz catheter.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The right internal jugular and subclavian area was prepped with antiseptic&nbsp; solution. Sterile drapes were applied. Under usual sterile precautions, the right internal jugular vein was&nbsp; cannulated. A 9 French introducer was inserted, and a 7 French Swan-Ganz catheter was inserted without&nbsp; difficulty. Right atrial pressures were 2 to 3, right ventricular pressures 24/0, and pulmonary artery 26/9 with&nbsp; a wedge pressure of 5. This is a Trendelenburg position. The patient tolerated the procedure well.</p>', '93451, 93503-51, I10', '93503, I10', '93503, 99356, I10, I21.3', '93503, I10, I21.3', '2022-06-17 07:17:50', '2022-06-17 07:17:50', 'ans_d'),
(1052, 6, 11, 1, '<p>DIAGNOSIS: Atrial flutter.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Electrical cardioversion.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was sedated with Versed and morphine. She was given a total of 5&nbsp; mg of Versed. She was cardioverted with 50 joules into sinus tachycardia. The patient was given a 20-mg&nbsp; Cardizem IV push. Her heart rate went down to the 110s, and she was definitely in sinus tachycardia. CONCLUSION: Successful electrical cardioversion of atrial flutter into sinus tachycardia.</p>', '92961, I49.1', '92960, I48.92', '92960, 92973, I48.92', '92960, I49.8', '2022-06-17 07:28:11', '2022-06-17 07:28:11', 'ans_b'),
