(1080, 6, 11, 1, '<p>Which statement regarding lesion excision is true?</p>', 'Codes are selected by measuring the greatest clinical diameter of a lesion excluding the margin required  to complete the excision', 'Excision is defined as full thickness removal of a lesion including margins and includes simple closure  when performed', 'Excision is defined as partial thickness removal of a lesion, including margins and includes simple closure  when performed', 'Excision is defined as full thickness removal of a lesion including margins and includes intermediate  closure when performed', '2022-06-17 11:38:29', '2022-06-17 11:38:29', 'ans_b'),
(1081, 6, 11, 1, '<p>Specific information about coding for each CPT section is located in the:</p>', 'index.', 'introduction.', 'guidelines.', 'Appendix A.', '2022-06-17 11:39:28', '2022-06-17 11:39:28', 'ans_c'),
(1082, 6, 11, 1, '<p>A gynecologist admits an established patient, a 35-year-old female with dysfunctional uterine bleeding (DUB), after seeing her in the clinic that day. During the course of the comprehensive history, the physician notes that the patient has a history of irregular periods of heavy flow. She has had irregular heavy periods and intermittent spotting for 4 years. The patient has been on a 3-month course of oral contraceptives (OCP). The family history is positive for endometrial cancer, with mother, two aunts, and two sisters who had endometrial cancer. The patient has a personal history of cervical and endometrial polyp removal 3 years prior to admission. As a part of the comprehensive physical examination, the physician notes the patient has a large amount of blood in the vault and an enlarged uterus. The prolonged hemorrhaging has resulted in a very thin and friable endometrial lining. The physician orders the patient to be started on intravenous Premarin and orders a full laboratory workup. The medical decision making is of moderate complexity.</p>', '99215, 99222, Z87.42, Z80.49', '99222, N92.1, Z87.42, Z80.49', '99215, 99222, N89.8, Z87.42, Z80.49', '99222, N91.5, Z80.49', '2022-06-17 11:42:42', '2022-06-17 11:42:42', 'ans_b'),
(1083, 6, 11, 1, '<p>Dr. Black admits a patient with an 8-day history of a low-grade fever, tachycardia, tachypnea, and basal consolidation of the lung and limited pleural effusion on the left side. An extensive past, family, and social history is taken as part of a comprehensive history. Bowel sounds are feeble. The pulse is rapid and thready. The comprehensive examination further indicates a jaundiced appearance with distention of the abdomen. There is a bluish discoloration of the flanks. The physician orders laboratory tests and radiographic studies, including an abdominal sonogram as he considers the extensive diagnostic options and the medical decision making complexity is high for this patient.</p>', '99233, R50.9, R00.0, R06.82, J91.8, R19.15', '99233, R50.9, I47.1, R06.82, J18.9, J91.8', '99223, R50.9, R00.0, R06.82, J13', '99223, R50.9, R00.0, R06.82, J91.8, R19.15', '2022-06-17 11:43:33', '2022-09-21 09:09:07', 'ans_d');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1084, 6, 11, 1, '<p>Dr. Stephanopolis makes subsequent hospital visits to Salanda Ortez, who has been in the hospital for primary viral pneumonia. She was experiencing severe dyspnea, rales, fever, muscle aches, and chest pain. The chest radiography showed patchy bilateral infiltrates and basilar streaking. Sputum microbiology was positive for a secondary bacterial pneumonia. The physician conducted an interval history focused on the patient&#39;s current problems and continued to do a problem-focused physical examination. The medical decision making was straightforward, and the patient was given intravenous antibiotic to address the bacterial pneumonia.</p>', '99231, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99231, J15.8', '99221, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99234, J15.8', '2022-06-17 11:44:30', '2022-06-17 11:44:30', 'ans_b'),
(1085, 6, 11, 1, '<p>A neurological consultation in the emergency department of the local hospital is requested for a 25- year-old male with suspected closed head trauma. The patient had a loss of consciousness(LOC) this morning&nbsp;after receiving a blow to the head in a high school basketball game. He presents to the emergency&nbsp;department with a headache, dizziness, and confusion. During the history, the girlfriend&nbsp;relates that the patient has been very irritable and confused since the incident. Physical examination reveals&nbsp;the patient to be unsteady and exhibit difficulty in concentration when stating monthsin reverse. The pupils&nbsp;dilate unequally. The physician continues with the physical examination involving an extensive review of&nbsp;neurological function. The neurologist orders a stat CT and MRI. The radiological exam shows a subdural hematoma and the physician made a decision of evacuation of hematoma by craniotomy.</p>', '99285', '99253', '99245', '99255', '2022-06-17 11:45:25', '2023-10-05 02:38:45', 'ans_c'),
(1086, 6, 11, 1, '<p>An obstetrician is requested to provide an office consultation to a 23-year-old female with first- trimester bleeding. The patient presents with a history of brownish discharge and occasional pinkish discharge. During the history, the patient relates that she has had suprapubic pain in the past week and&nbsp;cramping. She has felt nausea and has vomited on three occasions. On one occasion, the nausea was accompanied by dizziness and vertigo. The physician conducts a physical examination focused on the&nbsp;patient&#39;s chief complaint. The uterus is found to be soft and involuted. There is cervical motion tenderness and significant abdominal tenderness on palpation. A left pelvic mass is palpated in the left quadrant. The&nbsp;physician orders a pelvic ultrasound, a complete CBC, and differential. The physician spent 45 minutes with the patient.&nbsp;</p>', '99255', '99242', '99244', '99235', '2022-06-17 11:46:25', '2023-10-05 02:56:25', 'ans_c'),
(1087, 6, 11, 1, '<p>The patient is a 35-year-old male who presents to the emergency department (ED) after several hours of low back pain, nausea, and chills. The ED physician takes a detailed history and performs a comprehensive examination. A urinalysis lab and CT of the abdomen is ordered. The results of the CT show two small kidney stones. The ED physician discusses the results with the patient and tells him the stones are small and will pass on their own. Medical decision making (MDM) of moderate complexity is made with the patient being discharged, with a prescription of pain medication, and with a diagnosis of kidney stones. Select the E/M code and diagnosis code(s).</p>', '99285, N20.0, M54.5, R11.2, R68.83', '99284, M54.5, R11.2, R68.83, N20.0', '99283, N20.0', '99284, N20.0', '2022-06-17 11:47:25', '2022-06-17 11:47:25', 'ans_d'),
(1088, 6, 11, 1, '<p>A 55-year-old established patient is coming in for a pre-op visit; he is getting a liver transplant due to cirrhosis. The physician performs an expanded problem-focused history, detailed examination, and moderate MDM, physician spent 40 minutes with the patient during the evaluation. Patient agrees with his physician&rsquo;s recommendations and the transplantation will take place as scheduled. After the evaluation, the patient expresses a number of concerns and questions for the prospective liver transplant. Physician spends an additional 30&nbsp;minutes, excluding the time spent performing the E/M service, in answering questions and addressing his concerns regarding the surgery and discussing possible outcomes. What CPT&reg; codes should be reported?&nbsp;&nbsp;&nbsp;&nbsp;</p>', '99214, 99417', '99215, 99417', '99213, 99417', '99215', '2022-06-17 11:48:22', '2023-05-30 04:00:08', 'ans_b'),
(1089, 6, 11, 1, '<p>A plastic surgeon is called to the ED at the request of the emergency department physician to evaluate a patient that arrived with multiple facial fractures that may need surgery. Patient was in an automobile accident and an opinion is needed for reconstructive surgery. The plastic surgeon arrives at the ED, obtains detailed history and performs a detailed exam. The plastic surgeon performs a moderate medical decision making, in deciding that the patient needs major surgery to repair the injuries. The plastic surgeon schedules the patient for surgery the next day and documents her full note with findings in the ED chart. The E/M service reported by the plastic surgeon is:</p>', '99284-57', '99243-32', '99243-57', '99284-32', '2022-06-17 11:49:33', '2022-06-17 11:49:33', 'ans_c'),
(1090, 6, 11, 1, '<p>At the request of the mother&rsquo;s obstetrician, a neonatologist is called to attend the birth of an infant being delivered at 29 weeks gestation. During delivery, the neonate was pale and bradycardic needing resuscitation. Neonatologist performs the suctioning and bag ventilation on this 1000 gram neonate was performed with 100 percent oxygen. Brachycardia worsened, requiring endotracheal intubation and insertion of an umbilical line for fluid resuscitation. Later this critically ill neonate was moved from the delivery room and admitted to the NICU with severe respiratory distress and continued hypotension. What are the appropriate procedure codes reported by the neonatologist?</p>', '99465, 99468', '99465, 99464, 99468-25, 31500-59, 36510-59', '99468, 99464', '99465, 99468-25, 31500-59, 36510-59', '2022-06-17 11:50:41', '2022-06-17 11:50:41', 'ans_c'),
(1091, 6, 11, 1, '<p>A 62-year-old female returns to a family practice having severe chest pain with shortness of breath. It has been 34 weeks&nbsp;since her last visit to the practice. Medically appropriate&nbsp;history&nbsp;&amp; examination is performed. An EKG showed symtomps of MI. The physician referred the patient to hospital after giving <strong>high-potency statin therapy </strong>and spent 45 minutes. The physician diagnosed her with acute MI. What is the correct evaluation and management service for this encounter?</p>', '99205', '99215', '99204', '99214', '2022-06-17 11:51:40', '2023-10-04 02:14:57', 'ans_b'),
(1092, 6, 32, 1, '<p>84. OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Missed abortion with fetal demise, 11 weeks.&nbsp;</p>\r\n\r\n<p>PROCEDURE: Suction D&amp;C.</p>\r\n\r\n<p>The patient was prepped and draped in a lithotomy position under general mask anesthesia, and the bladder&nbsp; was straight catheterized; a weighted speculum was placed in the vagina. The anterior lip of the cervix was&nbsp; grasped with a single-tooth tenaculum. The uterus was then sounded to a depth of 8 cm. The cervical os was</p>\r\n\r\n<p>then serially dilated to allow passage of a size 10 curved suction curette. A size 10 curved suction curette was&nbsp; then used to evacuate the intrauterine contents. Sharp curette was used to gently palpate the uterine wall&nbsp; with negative return of tissue, and the suction curette was again used with negative return of tissue. The&nbsp; tenaculum was removed from the cervix. The speculum was removed from the vagina. All sponges and&nbsp; needles were accounted for at completion of the procedure. The patient left the operating room in apparent&nbsp; good condition having tolerated the procedure well. Pathology report indicated benign polyp.</p>', '59812, O03.9', '59812, O07.4', '59820, O02.1', '59856, O02.1', '2022-06-25 21:23:58', '2022-06-25 21:23:58', 'ans_c'),
(1093, 6, 32, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Right ureteralstricture.&nbsp;</p>\r\n\r\n<p>POSTOPERATIVE DIAGNOSIS: Right ureteralstricture.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy, right ureteral stent change.</p>\r\n\r\n<p>PROCEDURE NOTE: The patient was placed in the lithotomy position after receiving IV sedation. He was&nbsp; prepped and draped in the lithotomy position. The 21 French cystoscope was passed into the bladder, and&nbsp; urine was collected for culture Inspection of the bladder demonstrated findings consistent with radiation&nbsp; cystitis, which has been previously diagnosed. There is no frank neoplasia. The right ureteral stent was&nbsp; grasped and removed through the urethral meatus; under fluoroscopic control, a guide wire was advanced up&nbsp; the stent, and the stent was exchanged for a 7 French 26-cm stent under fluoroscopic control in the usual&nbsp; fashion. The patient tolerated the procedure well.</p>', '51702-LT, N13.5', '51702-RT, N30.90', '52332-RT, N30.90', '52332-RT, N13.5', '2022-06-25 21:25:52', '2022-06-25 21:25:52', 'ans_d'),
(1094, 6, 32, 1, '<p>This patient is a 52-year-old female who has been having prolonged and heavy bleeding.&nbsp; SURGICAL FINDINGS: On pelvic exam under anesthesia, the uterus was normal size and firm. The examination revealed no masses. She had a few small endometrial polyps in the lower uterine segment. DESCRIPTION OF PROCEDURE: After induction of general anesthesia, the patient was placed in the&nbsp; dorsolithotomy position, after which the perineum and vagina were prepped, the bladder straight catheterized, and the patient draped. After bimanual exam was performed, a weighted speculum was placed&nbsp; in the vagina and the anterior lip of the cervix was grasped with a single toothed tenaculum. An endocervical&nbsp; curettage was then done with a Kevorkian curet. The uterus was then sounded to 8.5 cm. The endocervical&nbsp; canal was dilated to 7 mm with Hegar dilators. A 5.5-mm Olympus hysteroscope was introduced using a&nbsp; distention medium. The cavity was systematically inspected, and the preceding findings noted. The&nbsp; hysteroscope was withdrawn and the cervix further dilated to 10 mm. Polyp forceps was introduced, and a&nbsp; few small polyps were removed. These were sent separately. Sharp endometrial curettage was then done. The hysteroscope was then reinserted, and the polyps had essentially been removed. The patient tolerated the procedure well and returned to the recovery room in stable condition (Pathology confirmed benign&nbsp; endometrial polyps). Pathology confirmed benign endometrial polyps.</p>', '58558, 57460-51, N92.0, N84.0', '58558, N92.0, N84.0', '58558, 57558-51, N92.0, N84.0', '58558, N92.1, D49.5', '2022-06-25 21:27:18', '2022-06-25 21:27:18', 'ans_b'),
(1095, 6, 32, 1, '<p>This patient is 35 years old at 36 weeks&#39; gestation. She presented in spontaneouslabor. Because of her&nbsp; prior cesarean section,she is taken to the operating room to have a repeat lower-segment transverse&nbsp; cesarean section performed. The patient also desires sterilization, and so a bilateral tubal ligation will also be&nbsp; performed. A single live born infant was the outcome of the delivery.</p>', '59510, 58600-51, Z30.2', '59620, 58615-51, O60.14X0 Z37.0', '59514, 58605-51, Z37.0, O60.14X0', '59514, 58611, O60.14X0, O34.211, Z37.0, Z30.2', '2022-06-25 21:29:09', '2022-07-26 06:58:18', 'ans_d'),
(1096, 6, 32, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Possible recurrent transitional cell carcinoma of the bladder.&nbsp; POSTOPERATIVE DIAGNOSIS: No evidence of recurrence.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Cystoscopy with multiple bladder biopsies. PROCEDURE NOTE: The patient was given a general mask anesthetic, prepped, and draped in the lithotomy&nbsp; position. The 21 French cystoscope was passed into the bladder. There was a hyperemic area on the posterior wall of the bladder, and a biopsy was taken. Random 4 biopsies of the bladder were performed. A catheter was left at the end of the procedure. The patient tolerated the procedure well and was transferred to the recovery room in good condition. The pathology report indicated no evidence of recurrence.</p>', '52204, Z85.51', '51020, 52204, Z80.59', '52234, Z85.51', '52204 × 4, D41.4', '2022-06-25 21:31:06', '2022-08-03 05:55:15', 'ans_a'),
(1097, 6, 32, 1, '<p>This 41-year-old female presented with a right labial lesion. A biopsy was taken, and the results were&nbsp; reported as VIN-III, cannot rule out invasion. The decision was therefore made to proceed with wide local&nbsp; excision of the right vulva.</p>\r\n\r\n<p>PROCEDURE: The patient was taken to the operating room, and general anesthesia was administered. The&nbsp; patient was then prepped and draped in the usual manner in lithotomy position, and the bladder was emptied with a straight catheter. The vulva was then inspected. On the right labium minora at approximately the 11&nbsp; o&#39;clock position, there was a multifocal lesion. A marking pen was then used to mark out an elliptical incision, leaving a 1-cm border on all sides. The skin ellipse was then excised using a knife. Bleeders were cauterized with electrocautery. A running locked suture of 2-0 Vicryl was then placed in the deeper tissue. The skin was finally re approximated with 4 0 Vicryl in an interrupted fashion. Good hemostasis was thereby achieved. The patient tolerated this procedure well. There were no complications.</p>', '56605, C51.9', '56625, D07.1', '56620, D07.1', '11620, C51.9', '2022-06-25 21:32:29', '2022-06-25 21:32:29', 'ans_c'),
(1098, 6, 32, 1, '<p>This 1-year-old boy has a mid-shaft hypospadias with a very mild degree of chordae. He also has a&nbsp; persistent right hydrocele. The surgeon brought the boy to surgery to perform a right hydrocele repair and&nbsp; one-stage repair of hypospadias with prepucial onlay flap.</p>', '54322, 55040, Q54.9, Q54.4', '54322, 55041-51, Q54.9, Q54.4, N43.3', '54324, 55060-51, Q54.9, Q54.4, N43.3', '54324, 55060, Q54.4, N43.3', '2022-06-25 21:34:13', '2022-06-25 21:34:13', 'ans_c'),
(1099, 6, 32, 1, '<p>The pediatric physician takes this newborn male to the nursery to perform a ritual clamp circumcision.</p>', '54160, Z41.2', '54150, Z41.2', '54160, Z41.3', '54150, Z41.1', '2022-06-25 21:35:40', '2022-08-03 06:17:28', 'ans_b'),
(1100, 6, 32, 1, '<p>This gentleman has worsening bilateral hydronephrosis. He did not have much of a post void residual on&nbsp; bladder scan. He is taken to the operating room to have a bilateral cystoscopy and retrograde pyelogram.&nbsp; The results come back as gross prostatic hyperplasia.</p>', '52005, N42.83', '52000, N13.30 N40.1', '52005-50, N40.0, N13.30', '52000-50, N13.30, N40.1', '2022-06-25 21:37:24', '2022-06-25 21:37:24', 'ans_c'),
(1101, 6, 32, 1, '<p>This 32-year-old female presents with an ectopic pregnancy. The physician performs a laparoscopic&nbsp; salpingectomy.</p>', '59120, O00.80', '59151, O00.90', '59151, N13.30', '59120, O00.80', '2022-06-25 21:38:56', '2022-07-26 06:43:12', 'ans_b'),
(1102, 6, 32, 1, '<p>An oncologist performs a complete radical paravaginectomy and removes the paravaginal tissues. He&nbsp; also performs a total bilateral pelvic lymphadenectomy and periaortic lymph node sampling. Correct&nbsp; coding for this situation would be.</p>', '57111', '56633, 38770-50-51', '57109', '57107, 38770-50-51', '2022-06-25 21:40:05', '2022-06-25 21:40:05', 'ans_c'),
(1103, 6, 32, 1, '<p>A three-year-old patient presents to the outpatient department of the hospital with his mother for a&nbsp; repair of an incomplete circumcision. The surgeon administer adequate anesthesia by using a penile block&nbsp; and removes the remaining foreskin.</p>', '54161, 64450', '54163, 64450', '54162', '54163', '2022-06-25 21:41:13', '2022-06-25 21:41:13', 'ans_b'),
(1104, 6, 32, 1, '<p>Diagnosis: Prostatic hyperplasia. Procedure: Cystoscopy and transurethral electrosurgical resection of&nbsp; prostate. Description: After through betadine prepping and draping and a suitable general anesthesia, the&nbsp; optical dilator was inserted per urethra. Urethra was normal. Prostatic hyperplasia noted particularly&nbsp; lateral lobe hyperplasia. A systematic transurethral resection was performed. All chips were removed.&nbsp; Minimal bleeding. Catheter placed, three way type. The patient tolerated the procedure well and was&nbsp; taken to the recovery room in good condition.</p>', '52601', '52630', '52640', '52648', '2022-06-25 21:42:50', '2022-06-25 21:42:50', 'ans_a'),
(1105, 6, 32, 1, '<p>8 year old female requested to have sterilization. The patient is placed supine on the OR table, placed under general anesthesia, scrubbed and draped in the usual sterile manner. The abdomen is cannulated&nbsp; and insufflated with CO2. Four ports are placed. The colon is retracted. A band is used to occlude the&nbsp; fallopian tubes. The physician occludes the fallopian tubes. All ports were removed and port sites sutured&nbsp; closed with 2-prolene.</p>', '58671', '58662', '58673', '58670', '2022-06-25 21:44:19', '2022-06-25 21:44:19', 'ans_a'),
(1106, 6, 32, 1, '<p>A couple presents to the freestanding fertility clinic. The wife has finished her cancer treatment and&nbsp; ready to have in vitro fertilization. The embryos are aspirated in a catheter. The catheter is passed through&nbsp; the cervical os and into the fallopian tubes. The embroys are injected into the fallopian tubes.</p>', '58970', '58976', '58974', '58999', '2022-06-25 21:46:35', '2022-06-25 21:46:35', 'ans_b'),
(1107, 6, 32, 1, '<p>A paravaginal defect repair including a cystocele via vaginal approach is performed on a 38-year-old patient.</p>', '57284', '57284, 57240-51', '57285', '57260, 57285-51', '2022-06-25 21:48:07', '2022-06-25 21:48:07', 'ans_c'),
(1108, 6, 32, 1, '<p>A Patient with a history of infertility underwent in vitro fertilization by her physician eight months ago&nbsp; with success. Her twin Pregnancy has been uneventful and she is now in active labor, ready to deliver. Both&nbsp; babies are delivered by Cesarean section and post partum care is done.</p>', '59510 x 2', '59515', '59514', '59620', '2022-06-25 21:49:25', '2022-06-25 21:49:25', 'ans_b'),
(1109, 6, 32, 1, '<p>Preoperative Dx: Elevated PSA</p>\r\n\r\n<p>A patient presents to the hospital special procedure suite and was placed in the left lateral decubitus&nbsp; position. Five needle transperineal biopsises were obtained from each prostate lobe under stereotactic&nbsp; guidance. A multinodular prostate with an approximate size of 79 grams was identified without apparent urinary obstruction.</p>', '55700, 76942-26,', '55706, 76942-26,', '55700, 77777-26,', '55860, 77776-26,', '2022-06-25 21:51:06', '2022-06-25 21:51:06', 'ans_b'),
(1110, 6, 32, 1, '<p>A 30-year-old patient vaginally delivered her first child a healthy boy infant. The patient moves to&nbsp; another city and is going to do her pospartum care with a new OB/GYN provider. What CPT code her new&nbsp; OB/GYN provider code.</p>', '59430', '59400', '59614', '59410', '2022-06-25 21:52:40', '2022-06-25 21:52:40', 'ans_a'),
(1111, 6, 32, 1, '<p>The patient is placed supine on the OR table, placed under general anesthesia, scrubbed and draped in usual sterile manner. The abdomen is cannulated and insufflated with CO2. Four ports are placed. The&nbsp; colon is retracted. The laser port is inserted and both fallopian tubes were fulgurated. The area was&nbsp; copiously irrigated with saline and good hemostatis was achieved.</p>', '58356', '58670', '58740', '58662', '2022-06-25 21:55:05', '2022-06-25 21:55:05', 'ans_b'),
(1112, 6, 32, 1, '<p>Mary underwent a bilateral vulvecomy with removal of 92% of the vulvar area. She also had an&nbsp; inguinofemoral lymphadenectomy during the same operative session. What code(s) capture these services?</p>', '56637-50', '56637', '56632', '56625, 38760', '2022-06-26 07:41:59', '2022-06-26 07:41:59', 'ans_b'),
(1113, 6, 32, 1, '<p>A physician performs laser vaporization of the prostate with a vasectomy. The patient had some&nbsp; postoperative bleeding that was controlled at the time of the procedure. What code(s) capture this service?&nbsp;</p>', '52648', '52601, 52648-51', '52647-22', '52601, 52448-51, 54162-59', '2022-06-26 07:42:56', '2022-09-02 06:04:28', 'ans_a'),
(1114, 6, 32, 1, '<p>A patient had a percutaneous cryoablation of two renal tumors. What code captures this service?</p>', '53899', '50592 X 2', '50593', '50592-50', '2022-06-26 07:44:02', '2022-06-26 07:44:02', 'ans_c'),
(1115, 6, 32, 1, '<p>Cheryl is a 36-year-old established patient with Dr. Winn, an OBGYN. During Cheryl&#39;s annual physical&nbsp; examination, Dr. Winn noticed lesions on the perineum. After completing the annual exam, Dr. Winn&nbsp; biopsies five lesions on the perineum. How should his office code the service for the biopsy?</p>', '56605, 56606 x 4', '99395, 56605, 56606 X 4', '56606, 56606-51', '99395, 56606, 56606-59', '2022-06-26 07:45:14', '2022-06-26 07:45:14', 'ans_a'),
(1116, 6, 32, 1, '<p>Mr. Bill has urinary incontinence. The urologist performs an anterior vesicourethropexy to correct the&nbsp; incontinence. The physician documented that this was a complicated repair. What code captures this&nbsp; service?</p>', '51840', '51841', '53440', '53899', '2022-06-26 07:46:11', '2022-06-26 07:46:11', 'ans_b'),
(1117, 6, 32, 1, '<p>Dr. Joyce performs a bilateral corpora cavernosa-saphenous vein shunt. Select the correct code(s) for this&nbsp; procedure.</p>', '54420.', '54420-50', '54420, 54420', '54430', '2022-06-26 07:47:27', '2022-06-26 07:47:27', 'ans_a'),
(1118, 6, 32, 1, '<p>A laparoscopic assisted total hysterectomy is planned for a patient who has severe intramural fibroids.&nbsp; After inserting the laparoscope, extensive adhesions are noted to the extent that the ligaments supporting&nbsp; the uterus cannot be visualized. The physician decides to convert the procedure to an open abdominal&nbsp; hysterectomy in which the uterus and cervix are removed. What CPT&reg; code(s) should be reported?</p>', '58262, 58570-53', '58150', '58260, 58550-22', '58570', '2022-06-26 07:48:26', '2022-06-26 07:48:26', 'ans_b'),
(1119, 6, 32, 1, '<p>A surgeon performed a complete transurethral resection of the prostate. During this surgical session, a&nbsp; meatotomy was also performed. What code(s) capture these services?</p>', '52601, 53020-51', '52630', '53020', '52601', '2022-06-26 07:49:51', '2022-06-26 07:49:51', 'ans_d'),
(1120, 6, 32, 1, '<p>How would Dr. Jay report her services for an injection procedure for retrograde urethrocystography with&nbsp; radiological supervision and interpretation? She completed this procedure in a hospital surgical suite.</p>', '51610', '51610, 74430-26', '51605, 74450-26', '51610, 74450-26', '2022-06-26 07:50:53', '2022-06-26 07:50:53', 'ans_d'),
(1121, 6, 32, 1, '<p>Mrs. Jones is pregnant with twins. She has been with the same obstetrician, Dr. Green, for her entire&nbsp; pregnancy. Now, Mrs. Jones is ready to deliver. Dr. Green helps Mrs. Jones deliver her twins vaginally. What&nbsp; are the correct codes for these services?&nbsp;</p>', '59400, 59400-51', '59400-22', '59610-22', '59400, 59409', '2022-06-26 07:51:48', '2022-09-02 06:01:49', 'ans_d'),
(1122, 6, 32, 1, '<p>67-year-old gentleman with localized prostate cancer will be receiving brachytherapy treatment.</p>\r\n\r\n<p>Following calculation of the planned transrectal ultrasound, guidance was provided for percutaneous&nbsp; placement of 1-125 seeds into the prostate tissue. What CPT&reg; code is reported for needle placement to&nbsp; insert the radioactive seeds into the prostate?</p>', '55860, 77770', '55920, 76965‐26', '55875, 76965‐26', '55876, 76942‐26', '2022-06-26 07:53:02', '2022-07-26 06:28:49', 'ans_c'),
(1123, 6, 32, 1, '<p>Benign prostatic hypertrophy with outlet obstruction and hematuria.</p>\r\n\r\n<p>Operation: TURP&nbsp;</p>\r\n\r\n<p>Anesthesia: Spinal</p>\r\n\r\n<p>Description of procedure: The patient was placed on the operating room table in sitting position and&nbsp; spinal anesthesia induced. He was placed in the lithotomy position, prepped and draped appropriately.&nbsp; Resection was begun at the posterior bladder neck and extended to the verumontanum (a crest near the&nbsp; wall of the urethra). Posterior tissue was resected first from the left lateral lobe, then right lateral lobe,&nbsp; then anterior. Depth of resection was carried to the level of the circular fibers. Bleeding vessels were&nbsp; electrocauterized as encountered. Care was taken to not resect distal to the verumontanum, thus&nbsp; protecting the external sphincter. At the end of the procedure, prostatic chips were evacuated from the&nbsp; bladder. Final inspection showed good hemostasis and intact verumontanum. The instruments were removed, Foley catheter inserted, the patient returned to the recovery area in satisfactory condition. What CPT&reg; code is reported for this service?</p>', '52601-50', '52630', '52640', '52601', '2022-06-26 07:55:10', '2022-06-26 07:55:10', 'ans_d'),
(1124, 6, 32, 1, '<p>The patient presents to the office for CMG (cystometrogram). Complex CMG cystometrogram with&nbsp; voiding pressure studies is done, intraabdominal voiding pressure studies, and complex uroflow are also&nbsp; performed. What CPT&reg; code(s) is/are reported for this service?</p>', '51726', '51726, 51728-51, 51797', '51728, 51797, 51741-51', '51728-26, 51797-26, 51741-51-26', '2022-06-26 07:59:44', '2022-06-26 07:59:44', 'ans_c'),
(1125, 6, 32, 1, '<p>A 56-year-old woman with biopsy-proven carcinoma of the vulva with metastasis to the lymph nodes has&nbsp; complete removal of the skin and deep subcutaneous tissues of the vulva in addition to removal of her&nbsp; inguinofemoral, iliac and pelvic lymph nodes bilaterally. The diagnosis of carcinoma of the vulva with 7&nbsp; of the nodes also positive for carcinoma is confirmed on pathologic review. What are the CPT&reg;&nbsp; codes reported for this procedure?</p>', '56637', '56640-50', '56632-50', '56633, 38765-50', '2022-06-26 08:00:50', '2022-06-26 08:00:50', 'ans_b'),
(1126, 6, 32, 1, '<p>A woman with a long history of rectocele and perineal scarring from multiple episiotomies develops a&nbsp; rectovaginal fistula with perineal body relaxation. She has transperineal repair with perineal body&nbsp; reconstruction and plication of the levator muscles. What are the CPT&reg; codes reported for this&nbsp; procedure?</p>', '57250', '57308', '57300, 56810-51', '57330', '2022-06-26 08:07:07', '2022-06-26 08:07:07', 'ans_b'),
(1127, 6, 32, 1, '<p>An 88-year-old widow with uterine prolapse and multiple comorbid conditions has been unsuccessful in&nbsp; the use of a pessary for treatment elects to receive colpocleisis (LeFort type) to prevent further prolapse&nbsp; and avoid more significant surgery like hysterectomy. The treatment is successful. What are the CPT&reg;&nbsp; codes reported for this procedure?</p>', '59320', '57130', '57120', '57020', '2022-06-26 08:14:13', '2022-06-26 08:14:13', 'ans_c'),
(1128, 6, 32, 1, '<p>A 37 year old woman presents with abdominal pain, bleeding unrelated to menses and an abnormal pap&nbsp; showing LGSIL (low grade squamous intraepithelial lesion). Treatment is hysteroscopy with&nbsp; thermoablation of the endometrium and cryocautery of the cervix. This is performed without difficulty.&nbsp; What are the CPT&reg; codes reported for this procedure?</p>', '58555, 58353-51', '58565, 57511-51', '58350, 57510-51', '58563, 57511-51', '2022-06-26 08:15:37', '2022-06-26 08:15:37', 'ans_d'),
(1129, 6, 32, 1, '<p>45‐year‐old male is going to donate his kidney to his son. Operating ports where placed in&nbsp; standard position and the scope was inserted. Dissection of the renal artery and vein was&nbsp; performed isolating the kidney. The kidney was suspended only by the renal artery and vein&nbsp; as well as the ureter. A stapler was used to divide the vein just above the aorta and three clips across the ureter, extracting the kidney. This was placed on ice and sent to the&nbsp; recipient room. The correct CPT &reg;code is:</p>', '50543', '50547', '50300', '50320', '2022-06-26 08:17:01', '2022-06-26 08:17:01', 'ans_b'),
(1130, 6, 32, 1, '<p>67‐year‐old female having urinary incontinence with intrinsic sphincter deficiency is having a&nbsp; cystoscopy performed with a placement of a sling. An incision was made over the mid&nbsp; urethra dissected laterally to urethropelvic ligament. Cystoscopy revealed no penetration of&nbsp; the bladder. The edges of the sling were weaved around the junction of the urethra and&nbsp; brought up to the suprapubic incision. A hemostat was then placed between the sling and&nbsp; the urethra, ensuring no tension. What CPT&reg; code(s) should be reported?</p>', '57288', '57287', '57288, 52000‐51', '51992, 52000‐51', '2022-06-26 08:18:08', '2022-06-26 08:18:08', 'ans_a'),
(1131, 6, 32, 1, '<p>16‐day‐old male baby is in the OR for a repeat circumcision due to redundant foreskin that&nbsp; caused circumferential scarring from the original circumcision. Anesthetic was injected and&nbsp; an incision was made at base of the foreskin. Foreskin was pulled back and the excess&nbsp; foreskin was taken off and the two raw skin surfaces were sutured together to create a&nbsp; circumferential anastomosis. Select the appropriate code for this surgery:</p>', '54150', '54160', '54163', '54164', '2022-06-26 08:19:17', '2022-06-26 08:19:17', 'ans_c'),
(1132, 6, 32, 1, '<p>5‐year‐old female has a history of post void dribbling. She was found to have extensive labial&nbsp; adhesions, which have been unresponsive to topical medical management. She is brought&nbsp; to the operating suite in a supine position. Under general anesthesia the labia majora is&nbsp; retracted and the granulating chronic adhesions were incised midline both anteriorly and&nbsp; posteriorly. The adherent granulation tissue was excised on either side. What code should&nbsp; be used for this procedure?</p>', '58660', '58740', '57061', '56441', '2022-06-26 08:20:15', '2022-06-26 08:20:15', 'ans_d'),
(1133, 6, 32, 1, '<p>63‐year‐old patient with bilateral ureteral obstruction presents to an outpatient facility for&nbsp; placement of a right and left ureteral stent along with an interpretation of a retrograde&nbsp; pyelogram. What codes</p>\r\n\r\n<p>should be reported?&nbsp;</p>', '52332, 74000', '52332‐50, 74420‐26', '52005, 74420', '52005‐50, 74425‐26', '2022-06-26 08:22:28', '2022-06-26 08:22:28', 'ans_b'),
(1134, 6, 32, 1, '<p>5‐year‐old male with a history of prematurity was found to have a chordee due to&nbsp; congenital hypospadias. He presents for surgical management for a plastic repair in&nbsp; straightening the abnormal curvature. Under general anesthesia, bands were placed around &nbsp;the base of the penis and incisions were made degloving the penis circumferentially. The&nbsp; foreskin was divided in Byers flaps and the penile skin was reapproximated at the 12 o&rsquo;clock&nbsp; position. Two Byers flaps were reapproximated, recreating a mucosal collar which was then&nbsp; criss‐ crossed and trimmed in the midline in order to accommodate median raphe&nbsp; reconstruction. This was reconstructed with use of a horizontal mattress suture. The shaft&nbsp; skin was then approximated to the mucosal collar with sutures correcting the defect. Which&nbsp; CPT&reg; code should be used?</p>', '54304', '54340', '54360', '54440', '2022-06-26 08:23:37', '2022-06-26 08:23:37', 'ans_a'),
(1135, 6, 32, 1, '<p>22‐year‐old is 14 weeks pregnant and wants to terminate the pregnancy. She has consented&nbsp; for a D&amp;E. She was brought to the operating room where MAC anesthesia was given. She&nbsp; was then placed in the dorsal lithotomy position and a weighted speculum was placed into&nbsp; her posterior vaginal vault. Cervix was identified and dilated. A 6.5‐cm suction catheter&nbsp; hooked up to a suction evacuator was placed and products of conception were evacuated. A&nbsp; medium size curette was then used to curette her endometrium. There was noted to be a&nbsp; small amount of remaining products of conception in her left cornua. Once again the suction&nbsp; evacuator was placed and the remaining products of conception were evacuated. At this&nbsp; point she had a good endometrial curetting with no further products of conception noted.&nbsp; Which CPT&reg; code should be used?</p>', '59840', '59841', '59812', '59851', '2022-06-26 08:24:48', '2022-08-31 09:07:08', 'ans_b'),
(1136, 6, 32, 1, '<p>A 37‐year‐old female has menorrhagia and wants permanent sterilization. The patient was&nbsp; placed in Allen stirrups in the operating room. Under anesthesia the cervix was dilated and&nbsp; the hysteroscope was advanced to the endometrium into the uterine cavity. No polyps or&nbsp; fibroids were seen. The Novasure was used for endometrial ablation. A knife was then used&nbsp; to make an incision in the right lower quadrant and left lower quadrant with 5‐mm trocars&nbsp; inserted under direct visualization with no injury to any abdominal contents. Laparoscopic&nbsp; findings revealed the uterus, ovaries and fallopian tubes to be normal. The appendix was&nbsp; normal as were the upper quadrants. Because of the patient&#39;s history of breast cancer and&nbsp; desire for no further children, it was decided to take out both the tubes and ovaries. This&nbsp; had been discussed with the patient prior to surgery. What are the codes for these&nbsp; procedures?</p>', '58660, 58353‐51', '58661, 58563‐51', '58661, 58558‐51', '58662, 58563‐51', '2022-06-26 08:25:47', '2022-08-31 09:08:23', 'ans_b'),
(1137, 6, 32, 1, '<p>25‐year‐old female in the OR for ectopic pregnancy. Once the trocars were place a&nbsp; pneumoperitoneum was created and the laparoscope introduced. The left fallopian tube&nbsp; was dilated and was bleeding. The left ovary was normal. The uterus was of normal size,&nbsp; shape and contour. The right ovary and tube were normal. Due to the patient&rsquo;s body habitus&nbsp; the adnexa could not be visualized to start the surgery. At this point the laparoscopic&nbsp; approach was terminated. The pneumoperitoneum was deflated, and trocar sites were&nbsp; sutured closed. The trocars and laparoscopic instruments had been removed. Open surgery&nbsp; was performed incising a previous transverse scar from a cesarean section. The gestation site was bleeding and all products of conception and clots were removed. The left tube was&nbsp; grasped, clamped and removed in its entirety and passed off to pathology. What code(s)&nbsp; should be used for this procedure?</p>', '59150, 59120', '59151', '59121', '59120', '2022-06-26 08:27:05', '2022-06-26 08:27:05', 'ans_d'),
(1138, 6, 32, 1, '<p>23‐year‐old who is pregnant at 39 weeks and 3 days is presenting for a low transverse&nbsp; cesarean section. An abdominal incision is made and was extended superiorly and inferiorly&nbsp; with good visualization of the bladder. The bladder blade was then inserted and the lower&nbsp; uterine segment incised in a transverse fashion with the scalpel. The bladder blade was&nbsp; removed and the infant&#39;s head delivered atraumatically. The nose and mouth were&nbsp; suctioned with the bulb suction trap and the cord doubly clamped and cut. The placenta&nbsp; was then removed manually. What code should be reported for this procedure?</p>', '59610, O34.21, Z37.0, Z3A.39', '59510, O64.1XX0, Z37.0, Z3A.39', '59514, O82, Z37.0, Z3A.39', '59515, O82, Z37.0, Z3A.39', '2022-06-26 08:28:20', '2022-06-26 08:28:20', 'ans_c'),
(1139, 6, 32, 1, '<p>This gentleman has localized prostate cancer and has chosen to have complete transrectal&nbsp; ultrasonography performed for dosimetry purposes. Following calculation of the planned&nbsp; transrectal ultrasound, guidance was provided for percutaneous placement of 1‐125 seeds.&nbsp; Select the appropriate codes for this procedure.</p>', '55920, 76965‐26', '55876, 76942‐26', '55860, 76873‐26', '55875, 76965‐26', '2022-06-26 08:29:13', '2022-06-26 08:29:13', 'ans_d'),
(1140, 6, 33, 1, '<p>Left frontal ventricular puncture for implanting catheter, layered repair of 8-cm scalp laceration, and&nbsp; repair of multiple facial and eyelid lacerations with an approximate total length of 12 cm.</p>', '61020, 12015-51', '61107, 12034-51, 12015-51', '61215, 12015-51', '61107, 12034-51', '2022-06-29 06:00:15', '2022-06-29 06:00:15', 'ans_b'),
(1141, 6, 33, 1, '<p>Marginal laceration involving the left lower eyelid; full-thickness repair of multiple stellate lacerations&nbsp; above the left eye involving the tarsus, totaling 24.2 cm and requiring full-thicknessrepair.</p>', '67935-E2, 12017', '67930-E2, 13152-51, 13153', '67935-E2, 12056-51', '67935-E2, 12017-51', '2022-06-29 06:01:25', '2022-06-29 06:01:25', 'ans_c'),
(1142, 6, 33, 1, '<p>OPERATIVE REPORT PREOPERATIVE&nbsp;</p>\r\n\r\n<p>DIAGNOSIS: Fever. PROCEDURE PERFORMED:</p>\r\n\r\n<p>Lumbar puncture.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: The patient was placed in the lateral decubitus position with the left side up.&nbsp; The legs and hips were flexed into the fetal position. The lumbosacral area was sterilely prepped. It was then&nbsp; numbed with 1% Xylocaine. I then placed a 22-gauge spinal needle on the first pass into the intrathecalspace&nbsp; between the L4 and L5 spinous processes. The fluid was minimally xanthochromic. I sent the fluid for cell&nbsp; count for differential, protein, glucose, Gram stain, and culture. The patient tolerated the procedure well&nbsp; without apparent complication. The needle was removed at the end of the procedure. The area was cleansed, and a Band-Aid was placed.</p>', '62272, R68.12', '62268, R50.9', '62272, R60.9, R50.9', '62270, R50.9', '2022-06-29 06:02:25', '2022-06-29 06:02:25', 'ans_d'),
(1143, 6, 33, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Herniated disk L4-5 on the left.</p>\r\n\r\n<p>PROCEDURE PERFORMED: Laminotomy, foraminotomy,removal of herniated disk L4-5 on the left.&nbsp; PROCEDURE: Under general anesthesia, the patient was placed in the prone position and the back was prepped and draped in the usual manner. An incision was made in the skin extending through subcutaneous&nbsp; tissue. Lumbodorsal fascia was divided. The erectorspinae muscles were bluntly dissected from the lamina of&nbsp; L4-5 on the left. The interspace was localized. I then performed a generouslaminotomy and foraminotomy here, and retracted on the nerve root. It was obviousthere was a herniated disk. I removed it, entered the space, and removed degenerating material,satisfied that I had decompressed the root well.&nbsp; There were free fragmentslying around beneath the nerve root. We removed all of these. I was able to pass&nbsp; a hockey stick down the foramen across the midline, satisfied I had taken out the large fragmentsfrom the&nbsp; interspace at L4-5, and decompressed it well. I irrigated the wound well, put a Hemovac drain in the wound, and then closed the wound in layers using double knotted 0 chromic on the lumbodorsal fascia with Vicryl, 2- 0 plain in the subcutaneoustissue and surgicalstaples on the skin. A dressing was applied. The patient was&nbsp; discharged to the recovery room.</p>', '63030-LT, M51.26', '63012-LT, M51.46', '63047-LT, M51.46', '63047-LT, 63048-LT, M51.26', '2022-06-29 06:03:44', '2022-06-29 06:03:44', 'ans_a'),
(1144, 6, 33, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Brain tumor versus abscess.&nbsp;</p>\r\n\r\n<p>PROCEDURE: Craniotomy.</p>\r\n\r\n<p>DESCRIPTION OF PROCEDURE: Under general anesthesia, the patient&#39;s head was prepped and draped in the&nbsp; usual manner. It was placed in Mayfield pins. We then proceeded with a craniotomy. An inverted U-shaped&nbsp; incision was made over the posterior right occipital area. The flap was turned down. Three burr holes were&nbsp;</p>\r\n\r\n<p>made. Having done this, I then localized the tumor through the burr holes and dura. We then made an incision in the dura in an inverted U-shaped fashion. The cortex looked a little swollen but normal. We then used the localizer to locate the cavity. I separated the gyrus and got right into the cavity and saw pus, which was removed. Cultures were taken and sent for pathology report, which came back later describing the presence of clusters of gram-positive cocci, confirming that this was an abscess. We cleaned out the abscessed cavity using irrigation and suction. The bed of the abscessed cavity was cauterized. Then a small piece of Gelfoam was used for hemostasis. Satisfied that it was dry, I closed the dura. I approximated the scalp. A dressing was applied. The patient was discharged to the recovery room.</p>', '61154, G06.0', '61154, D49.6', '61150, G06.0', '61150, D49.6', '2022-06-29 06:05:29', '2022-06-29 06:05:29', 'ans_c'),
(1145, 6, 33, 1, '<p>This patient came in with an obstructed ventriculoperitoneal shunt. The procedure performed was to be a revision of shunt. After inspecting the shunt system, the entire cerebrospinal fluid shunt system was removed and a similar replacement shunt system was placed.</p>', '62180, T82.598A', '62258, T85.09XA', '62256, T85.09XA', '62190, T85.09XA', '2022-06-29 06:07:19', '2022-06-29 06:07:19', 'ans_b'),
(1146, 6, 33, 1, '<p>This patient is in for a recurrent herniated disk at L4-S1 on the left. The procedure performed is a repeat&nbsp; laminotomy and foraminotomy at the L5-S1 interspace.</p>', '63030-LT, M51.27', '63030-LT, M51.25', '63042-LT, M51.25', '63042-LT, M51.27', '2022-06-29 06:12:04', '2022-06-29 06:12:04', 'ans_d'),
(1147, 6, 33, 1, '<p>What code would you assign to report a left partial thyroid lobectomy, with isthmusectomy?&nbsp;</p>', '60210', '60220', '60212', '60225', '2022-06-29 06:13:20', '2022-06-29 06:13:20', 'ans_a'),
(1148, 6, 33, 1, '<p>OPERATIVE REPORT</p>\r\n\r\n<p>PREOPERATIVE DIAGNOSIS: Paralytic ectropion, left eye.&nbsp;</p>\r\n\r\n<p>PROCEDURE PERFORMED: Medial tarsorrhaphy, left eye.</p>\r\n\r\n<p>In the operating room, after intravenoussedation, the patient was given a total of about 0.5 mL of local&nbsp; infiltrative anesthetic. The skin surfaces on the medial area of the lid, medial to the punctum, were denuded.&nbsp; A bolster had been prepared and double 5-0 silk suture was passed through the bolster, which was passed&nbsp; through the inferiorskin and raw lid margin, then through the superior margin, and out through the skin. A&nbsp; superior bolster was then applied. The puncta were probed with wire instrument and found not to be&nbsp; obstructed. The suture was then fully tied and trimmed. Bacitracin ointment was placed on the surface of the skin. The patient left the operating room in stable condition, without complications, having tolerated the&nbsp; procedure well.</p>', '67875-LT, H02.129', '67710-LT, H02.139', '67882-LT, H02.109', '67880-LT, H02.156', '2022-06-29 06:14:37', '2022-09-05 06:50:07', 'ans_d'),
(1149, 6, 33, 1, '<p>This 66-year-old male has been diagnosed with a senile cataract of the posteriorsubcapsular and is&nbsp; scheduled for a cataract extraction by phacoemulsification of the right eye. The physician has taken the&nbsp; patient to the operating room to perform a posteriorsubcapsular cataract extraction with IOL, diffuse of the&nbsp; right eye.</p>', '66982-RT, H26.061', '66984-RT, H25.041', '66983-RT, H25.091', '66830-RT, H25.041', '2022-06-29 06:17:08', '2022-06-29 06:17:08', 'ans_b'),
(1150, 6, 33, 1, '<p>Patient has estropia of the left eye and presents to operating suite for strabismus surgery. The&nbsp; physician resects the medial and lateral rectus muscles of the eye and secure it with sutures. Extensive scar&nbsp; tissue noted due a previous surgery. Scar tissue is released on the inferior rectus muscles. What CPT code&nbsp; will be reported for this surgery?</p>', '67312, 67343', '67312', '67311,67343', '67316', '2022-06-29 06:21:27', '2022-06-29 06:21:27', 'ans_a'),
(1151, 6, 33, 1, '<p>Pre-op and Post OP Dx: Chronic Otitis Media</p>\r\n\r\n<p>Procedure: After the patient was properly identified, he has brought into the operating room and placed in&nbsp; supine position. The patient was prepped and draped in the usual fashion. General anesthesia was&nbsp; administered via inhalation mask, and after adequate sedation was achieved, a Medium sized speculum&nbsp; was placed in the ear and cerumen was removed atraumatically using instruments with operative&nbsp; microscope. An incision was made in the anterior inferior quadrant of the right tympanum and thick&nbsp; mucoid fluid was suctioned. An Armstrong grommet ventilating tube was placed without difficulty followed&nbsp; by antibiotic drops in cotton balls. Also serous fluid was noted. The patient was awakened after having&nbsp; tolerated the procedure well and taken to the recovery room in stable&nbsp;</p>\r\n\r\n<p>condition.</p>', '69436-50', '69436-RT', '69433-50', '69420-LT', '2022-06-29 06:24:02', '2022-06-29 06:24:02', 'ans_b'),
(1152, 6, 33, 1, '<p>A 45 Year old from Thoracic spondylosis presents to an outpatient facility to receive transforaminal&nbsp; epidural steroid injections. The injections are administered on the right side in T2, T3, T4 and T5 levels&nbsp; under ultrasonic guidance. What are the correct CPT codes selection for this patient encounter?</p>', '64479, 64480, 76942', '64479, 64480', '64999', '64999x 4', '2022-06-29 06:26:45', '2022-06-29 06:26:45', 'ans_d'),
(1153, 6, 33, 1, '<p>A patient has chronic cholesteatoma in the right middle ear. The otolaryngologist performed a tympanoplasty with a modified radical mastoidectomy removing the middle ear cholesteatoma. A&nbsp; reconstruction of the canal wall and ossicular chain with PORP was performed and grafting technique was&nbsp; used to repair the eardrum. What is the correct CPT code to report for this surgery?</p>', '69646', '69636', '69642', '69644', '2022-06-29 06:27:47', '2022-07-26 06:53:58', 'ans_a'),
(1154, 6, 33, 1, '<p>A 55 year old man presents with uncontrolled tremors that have become quite severe and are now&nbsp; disabling. A Trial of a deep brain stimulator electrode is recommended. The patient is placed in head holder&nbsp; adapter for the frame. The scalp is incised exposing the skull and hole is cut in the cranium to reach&nbsp; cerebellar tissue of the brain. The Neurostimulator placed in the cerebellum and are tested to verify&nbsp; placement. What CPT code is reported?</p>', '61863', '61860', '61868', '61867', '2022-06-29 07:06:56', '2023-05-26 13:29:33', 'ans_b'),
(1155, 6, 33, 1, '<p>A patient is taken to the operating room for unilateral partial thyroid lobectomy of left lobe with&nbsp; isthmusectomy and subtotal lobectomy of right lobe. What CPT code is used to report this procedure?</p>', '60210', '60212', '60220-52', '60225', '2022-06-29 07:08:01', '2022-06-29 07:08:01', 'ans_b'),
(1156, 6, 33, 1, '<p>A 12 year old child with congenital hydrocephalus presents with headache and blurred vision. The&nbsp; patient has shunt that is malfunctioning due to an obstructed valve. The old valve is preplaced with new&nbsp; and shunt system has been tested</p>', '62258', '62256', '62230', '62256, 62258-51', '2022-06-29 07:09:12', '2022-06-29 07:09:12', 'ans_c'),
(1157, 6, 33, 1, '<p>A 30 year old was rock climbing and hit his head on a rock suffering an injury resulting in subdural&nbsp; hematoma and skull fracture on right. He has been unconscious for 30 min. surgeon uses burr to create&nbsp; hole in skull over the affected area. The duramater has been exposed and the hole is used to access and&nbsp; drain the hematoma.</p>', '61154', '61108', '61156', '61150', '2022-06-29 07:09:53', '2022-06-29 07:09:53', 'ans_a'),
(1158, 6, 33, 1, '<p>What is the CPT Code reported for the surgical release of the ulnar nerve involving the forearm wrist&nbsp; region?</p>', '64716', '64718', '64708', '64719', '2022-06-29 07:10:22', '2022-06-29 07:10:22', 'ans_d'),
(1159, 6, 33, 1, '<p>Patient has herniated nucleus pulposus. A unilateral posterior laminotomy is performed between C2- C3, C3-C4, C4-C5. At this time, decompression of the nerve roots and disc removal are also done.</p>', '63042-50, 63044-50x2', '63030, 63035 x 2', '63017', '63020, 63035 x2', '2022-06-29 07:10:56', '2022-06-29 07:10:56', 'ans_d'),
(1160, 6, 33, 1, '<p>Todd was in a motorcycle accident. He suffered multiple fractures and lacerations. During one surgical&nbsp; session, a surgeon elevated a depressed skull fracture. This procedure required repair of the dura. What&nbsp; code(s) capture these services?</p>', '62010', '62000', '62005', '62005, 62010', '2022-06-29 07:11:30', '2022-06-29 07:11:30', 'ans_a'),
(1161, 6, 33, 1, '<p>A physician obtains corneal tissue from an eye bank and sizes the tissue for transplant. The physician&nbsp; then performs a lamellar keratoplasty. He removes the anterior layer of the diseased cornea and replaces it&nbsp; with the prepared donor tissue. What are the correct codes for these services?</p>', '65710', '65755', '65426, 20926-62', '65710, 68371', '2022-06-29 07:12:22', '2022-06-29 07:12:22', 'ans_a');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1162, 6, 33, 1, '<p>A physician removed lens material for a cataract patient using an intracapsular technique and injected&nbsp; saline to restore intraocular pressure. What code(s) correctly capture these services?</p>', '66930', '66920', '66920, 66020', '66930, 66020', '2022-06-29 07:12:59', '2022-06-29 07:12:59', 'ans_b'),
(1163, 6, 33, 1, '<p>Fred, a 45-year-old patient, suffered a profound hearing loss due to an industrial accident and had a&nbsp; cochlear device implanted without a mastoidectomy. The surgeon used an operating microscope during this&nbsp; procedure. What are the correct code(s) for this service?</p>', '69930, 0073T', '69930-50', '69930, 69990', '69930, 69990-51', '2022-06-29 12:17:44', '2022-06-29 12:17:44', 'ans_c'),
(1164, 6, 33, 1, '<p>Mr. Keller had a six cm neoplastic lesion at the base of the anterior cranial fossa excised. The lesion was&nbsp; not connected to the dura matter. Dr. Roberts, a neurosurgeon, excised the lesion. Dr. Reed preformed an&nbsp; extradural craniofacial approach to the anterior cranial fossa without orbital exenteration. What is the&nbsp; correct code for the excision procedure?</p>', '61580, 61600-51', '61600, 61580-58', '61580', '61600', '2022-06-30 07:31:36', '2022-06-30 07:31:36', 'ans_d'),
(1165, 6, 33, 1, '<p>A physician repairs a retinal detachment by depressing a hot probe over the outer layer of the eyeball to&nbsp; seal the choroid to the retina. A scleral buckle is placed around the eyeball to support the healing scar. What&nbsp; code captures this service?</p>', '67101', '67108', '67113', '67107', '2022-06-30 07:32:30', '2022-06-30 07:32:30', 'ans_d'),
(1166, 6, 33, 1, '<p>Today, Terri had are-exploration procedure of the thoracic region of her spine. This procedure is rarely&nbsp; performed, but has FDA approval. Terri has signed extensive consent forms and understands the risks involved. She and her surgeon believe this procedure might offer her pain relief. What is the correct code for&nbsp; this service?&nbsp;</p>', '64999', '63003-52', '63046', '63271', '2022-06-30 07:34:01', '2022-06-30 07:34:01', 'ans_a'),
(1167, 6, 33, 1, '<p>Two-year-old Bobby was running through the house with a Popsicle when he fell, suffering a three cm&nbsp; partial thickness laceration to his left upper eyelid. This injury involved the lid margin and tarsus. Bobby was&nbsp; taken to an emergency room by his parents and the physician did a direct layered closure. How would you&nbsp; code the physician&#39;s service?</p>', '12052-E1', '12002-LT', '67935-E1', '67930-E1', '2022-06-30 07:35:40', '2022-06-30 07:35:40', 'ans_d'),
(1168, 6, 33, 1, '<p>A physician excised multiple chalazions on bilateral eyelids. The procedure required general anesthesia.&nbsp; At the same session, the physician excised another non-chalazion lesion on the right eyelid, which required&nbsp; simple closure. What codes correctly capture the surgeon&#39;s services?</p>', '67808, 67805-51, 67840-51', '67808-50, 67840-59', '67805-50, 67808-50, 67840-59', '67808, 67850-51, 67840-51,11310-51', '2022-06-30 07:39:09', '2022-06-30 07:39:09', 'ans_b'),
(1169, 6, 33, 1, '<p>A patient under general anesthesia had a meatoplasty secondary to congenital atresia with&nbsp; simultaneous tympanostomy. What code(s) correctly capture this service?&nbsp;</p>', '69310, 69433-59', '69320, 69436-51', '69631', '69641, 69433', '2022-06-30 07:40:13', '2022-06-30 07:40:13', 'ans_b'),
(1170, 6, 33, 1, '<p>A patient is diagnosed with an injury to the facial nerve. The surgeon performs a neurorrhaphy with nerve&nbsp; graft to restore innervation to the face using microscopic repair. The surgeon created a 2 cm incision over&nbsp; the damaged nerve, dissected the tissues and located the nerve. The damaged nerve was resected and&nbsp; removed. The 3.0 cm graft taken from the sural nerve was sutured to the proximal and distal ends of the&nbsp; damaged nerve. What CPT&reg; codes are reported?</p>', '64885', '64886', '64886, 69990', '64885, 69990', '2022-06-30 07:41:15', '2022-06-30 07:41:15', 'ans_d'),
(1171, 6, 33, 1, '<p>47-year-old male presents with chronic back pain, and lower left leg radiculitis. A laminectomy is&nbsp; performed on the inferior end of L5. The microscope is used to perform microdissection. There was a&nbsp; large extradural cystic structure on the right side underneath the nerve root as well as the left. The entire&nbsp; intraspinal lesion was evacuated. What CPT&reg; code(s) is/are reported for this procedure?</p>', '63267, 69990', '63252, 69990', '63272', '63277', '2022-06-30 07:42:47', '2022-06-30 07:42:47', 'ans_a'),
(1172, 6, 33, 1, '<p>A patient with primary hyperparathyroidism undergoes parathyroid sestamibi (nuclear medicine scan) and&nbsp; ultrasound and is found to have only one diseased parathyroid. A minimally invasive parathyroidectomy is&nbsp; performed. What CPT&reg; and ICD-10-CM codes are reported for the surgery?</p>', '60500, E21.3', '60502, E21.3', '60505, E21.0', '60500, E21.0', '2022-06-30 07:43:47', '2022-06-30 07:43:47', 'ans_d'),
(1173, 6, 33, 1, '<p>A physician uses cryotherapy for removal trichiasis. What CPT&reg; codes are reported?</p>', '67820', '67825', '67830', '67840', '2022-06-30 07:45:28', '2022-06-30 07:45:28', 'ans_b'),
(1174, 6, 33, 1, '<p>A patient receives chemodenervation with Botulinum toxin injections to stop blepharospasms of the right&nbsp; eye. What are the procedure codes?</p>', '64650', '67345-RT', '64612-RT', '64616-RT', '2022-06-30 07:48:20', '2022-06-30 07:48:20', 'ans_c'),
(1175, 6, 33, 1, '<p>The surgeon performed an insertion of an intraocular lens prosthesis discussed with the patient before the&nbsp; six-week earlier cataract removal (by the same surgeon). What CPT&reg; code is reported?</p>', '66985-58', '66983-58', '66984', '66985', '2022-06-30 07:51:02', '2022-06-30 07:51:02', 'ans_a'),
(1176, 6, 33, 1, '<p>The physician performs an iridotomy using laser on both eyes for chronic angle closure glaucoma; procedure includes local anesthesia. What CPT&reg; codes are reported?</p>', '66710-50', '66762-50, 66990', '66625', '66761-50', '2022-06-30 07:52:30', '2022-06-30 07:52:30', 'ans_d'),
(1177, 6, 33, 1, '<p>A physician extracts a tumor, using a frontal approach, from the lacrimal gland of a 14-year-old patient. What CPT&reg; codes are reported?</p>', '68500', '68505', '68520', '68540', '2022-06-30 07:54:25', '2022-06-30 07:54:25', 'ans_d'),
(1178, 6, 33, 1, '<p>The patient is a 64‐year‐old female who is undergoing a removal of a previously implanted&nbsp; Medtronic pain pump and catheter due to a possible infection. The back was incised;&nbsp; dissection was carried down to the previously placed catheter. There was evidence of&nbsp; infection with some fat necrosis in which cultures were taken. The intrathecal portion of the catheter was removed. Next the pump pocket was incised and the pump was dissected from&nbsp; the anterior fascia. A 7‐mm Blake drain was placed in the pump pocket through a stab&nbsp; incision and secured to the skin with interrupted Prolene. The pump pocket was copiously&nbsp; irrigated with saline and closed in two layers. What are the CPT&reg; and ICD‐10‐CM codes for&nbsp; this procedure?</p>', '62365, 62350‐51, T85.89XA, Z46.2', '62360, 62355‐51, T85.79XA', '62365, 62355‐51, T85.79XA', '36590, I97.42, T85.89XA', '2022-06-30 07:56:40', '2022-06-30 07:56:40', 'ans_c'),
(1179, 6, 33, 1, '<p>The patient is a 73‐year‐old gentleman who was noted to have progressive gait instability&nbsp; over the past several months. Magnetic resonance imaging demonstrated a&nbsp; ventriculomegaly. It was recommended that the patient proceed forward with right frontal&nbsp; ventriculoperitoneal shunt placement with Codman programmable valve. What is the&nbsp; correct code for this surgery?</p>', '62220', '62223', '62190', '62192', '2022-06-30 07:57:45', '2022-06-30 07:57:45', 'ans_b'),
(1180, 6, 33, 1, '<p>What is the CPT&nbsp;code for the decompression of the median nerve found in the space in the&nbsp; wrist on the palmar side?</p>', '64704', '64713', '64721', '64719', '2022-06-30 07:58:41', '2023-04-14 08:07:32', 'ans_c'),
(1181, 6, 33, 1, '<p>2‐year‐old Hispanic male has a chalazion on both upper and lower lid of the right eye. He&nbsp; was placed under general anesthesia. With an #11 blade the chalazion was incised and a&nbsp; small curette was then used to retrieve any granulomatous material on both lids. What code&nbsp; should be used for this procedure?&nbsp;</p>', '67801', '67805', '67800', '67808', '2022-06-30 08:00:12', '2022-06-30 08:00:12', 'ans_d'),
(1182, 6, 33, 1, '<p>A craniectomy is being performed on a patient who has Chiari malformation. Once the&nbsp; posterior inferior scalp was removed a C‐1 and a partial C‐2 laminectomy was then&nbsp; performed. The right cerebellar tonsil was dissected free of the dorsal medulla and a gush of&nbsp; cerebrospinal fluid gave good decompression of the posterior fossa content. Which CPT&reg;&nbsp; code should be used?</p>', '61322', '61345', '61343', '61458', '2022-06-30 08:01:19', '2022-06-30 08:01:19', 'ans_c'),
(1183, 6, 33, 1, '<p>Under fluoroscopic guidance an injection of a combination of steroid and analgesic agent is&nbsp; performed on T2‐T3, T4‐T5, T6‐T7 and T8‐T9 on the left side into the paravertebral facet joints. The procedure was performed for pain due to thoracic root lesions. What are the&nbsp; procedure codes?</p>', '64479, 64480x3, 77003', '64490, 64491, 64492x2, 77003', '64520x4, 77003', '64490, 64491, 64492', '2022-06-30 08:03:15', '2022-06-30 08:03:15', 'ans_d'),
(1184, 6, 33, 1, '<p>An entropian repair is performed on the left lower eyelid in which undermining was&nbsp; performed with scissors of the inferior lid and inferior temporal region. Deep sutures were&nbsp; used to separate the eyelid margin outwardly along with stripping the lateral tarsus to&nbsp; provide firm approximation of the lower lid to the globe. The correct CPT&reg; code is:</p>', '67914‐E4', '67924‐E2', '67921‐E2', '67917‐E1', '2022-06-30 08:04:25', '2022-06-30 08:04:25', 'ans_b'),
(1185, 6, 33, 1, '<p>An extracapsular cataract removal is performed on the right eye by manually using an iris&nbsp; expansion device to expand the pupil. A phacomulsicfication unit was used to remove the&nbsp; nucleus and irrigation and aspiration was used to remove the residual cortex allowing the&nbsp;</p>\r\n\r\n<p>insertion of the intraocular lens. What code should be used for this procedure?</p>', '66985', '66984', '66982', '66983', '2022-06-30 08:05:53', '2023-04-14 04:33:26', 'ans_c'),
(1186, 6, 33, 1, '<p>An infant who has chronic other suppurative otitis media in the right and left ears was placed under general&nbsp; anesthesia and a radial incision was made in the posterior quadrant of the left and right tympanic membranes. A large amount of mucoid effusion was suctioned and then a&nbsp; ventilating tube was placed in both ears. What CPT&reg; and ICD‐10‐CM codes should be&nbsp; reported:</p>', '69436‐50, H65.33', '69436‐50, H66.43', '69433‐50, H65.113', '69421‐50, H65.33', '2022-06-30 08:12:17', '2023-05-26 13:39:23', 'ans_a'),
(1187, 6, 34, 1, '<p>CLINICAL HISTORY: Boil, left groin.</p>\r\n\r\n<p>SPECIMEN RECEIVED: Necrotic fascia left groin and leg (anterior and posterior).</p>\r\n\r\n<p>GROSS DESCRIPTION: The specimen is labeled with the patient&#39;s name and &quot;fascia left groin and leg&quot; and&nbsp; consists of multiple segments of skin and soft tissue measuring up to 30 cm in greatest dimension. The skin is&nbsp; unremarkable, with the soft tissue being hemorrhagic and friable and foul smelling. MICROSCOPIC DESCRIPTION: Sections of skin and soft tissue show coagulative necrosis with neutrophilic&nbsp; exudates.</p>\r\n\r\n<p>DIAGNOSIS: Skin and soft tissue, left groin and leg, anterior and posteriorshowing&nbsp;</p>\r\n\r\n<p>coagulative necrosis and acute inflammation.</p>', '88304, L02.93', '88305-26, L98.8', '88304-26, L98.8, L08.9', '88305, L02.239', '2022-06-30 08:52:11', '2022-06-30 08:52:11', 'ans_c'),
(1188, 6, 34, 1, '<p>Report the global service.&nbsp;</p>\r\n\r\n<p>CLINICAL HISTORY: Mass, ascending colon.&nbsp;</p>\r\n\r\n<p>SPECIMEN RECEIVED: Ascending Colon.</p>\r\n\r\n<p>GROSS DESCRIPTION: The specimen is labeled with patient&#39;s name and &quot;Colon Mass&quot; and consists of a 4 &times; 4 &times; 2 cm&nbsp;mass with a partially calcified hemorrhagic white-tan tissue.&nbsp;</p>\r\n\r\n<p>INTRAOPERATIVE FROZEN SECTION DIAGNOSIS: Myxoma</p>\r\n\r\n<p>MICROSCOPIC DESCRIPTION: Sections show a well-circumscribedmass consisting of fibromyxoid tissue&nbsp; showing numerous vascular channels. Areas of superficial ulceration and chronic inflammatory infiltrate are&nbsp; noted. Areas of calcification are also present.</p>\r\n\r\n<p>DIAGNOSIS: Mucosal&nbsp;colonic myxoma.</p>', '88305, D49.81', '88305, 88331, D12.2', '88307, 88331-26, D12.2', '88305, D12.6', '2022-06-30 08:54:28', '2023-05-30 01:38:49', 'ans_b'),
(1189, 6, 34, 1, '<p>This patient is in for a kidney biopsy (50200) because a mass was identified by ultrasound. The specimen&nbsp; is sent to pathology for gross and microscopic examination.</p>\r\n\r\n<p>Report the technical and professional components for this service. The results were inconclusive.</p>', '88305-26, N28.9', '88305, N28.89', '88307, 88331-26, D30.00', '88305, 88331, N28.89', '2022-06-30 09:05:12', '2023-10-19 00:12:34', 'ans_b'),
(1190, 6, 34, 1, '<p>This patient is in for a kidney biopsy (50200) because a mass was identified by ultrasound. The specimen&nbsp; is sent to pathology for gross and microscopic examination.</p>\r\n\r\n<p>Report the technical and professional componentsfor this service. The results were inconclusive.</p>', '88305-26, N28.9', '88307-26, N28.89', '88307, N28.9', '88305, N28.9', '2022-06-30 09:06:19', '2022-06-30 09:06:19', 'ans_d'),
(1191, 6, 34, 1, '<p>This 69-year-old female presents to the laboratory after her physician ordered troponin, quantitative,&nbsp; and troponin, qualitative assay, to assist in the diagnosis of her chief complaint of acute onset of chest pain.</p>', '84484, 80299, R07.2', '84512, 84484, 80299, R07.89', '84484, 84512, R07.9', '84484, 84512, R07.89', '2022-06-30 09:07:25', '2022-06-30 09:07:25', 'ans_c'),
(1192, 6, 34, 1, '<p>CLINICAL HISTORY: Necrotic soleus muscle, right leg.&nbsp;</p>\r\n\r\n<p>SPECIMEN RECEIVED: Soleus muscle, right leg.</p>\r\n\r\n<p>GROSS DESCRIPTION: Submitted in formalin, labeled with the patient&#39;s name and &quot;soleus muscle right leg&quot; are multiple irregular fragments of tan, gray, brown soft tissue measuring 8 &times; 8 &times;</p>\r\n\r\n<p>2.5 cm in aggregate. Multiple representative fragments are submitted in four cassettes. MICROSCOPIC DESCRIPTION: The slides show multiple sections of skeletal muscle showing severe coagulative&nbsp; and liquefactive necrosis. Patchy neutrophilic infiltrates are present within the necrotic tissue. DIAGNOSIS: Soft tissue, soleus muscle, right leg debridement; necrosis and patchy acute inflammation,&nbsp; skeletal muscle.</p>', '88305-26, M62.50', '88304-26, M60.009', '88307-26, I96', '88305-26, M60.009', '2022-06-30 09:11:07', '2023-09-06 00:17:41', 'ans_d'),
(1193, 6, 34, 1, '<p>This 34-year-old established female patient is in for her yearly physical and lab. The physician orders a&nbsp; comprehensive metabolic panel, hemogram automated and manual differential WBC count (CBC), and a&nbsp; thyroid stimulating hormone. Code the lab only.</p>', '99395, 80050', '80050-52', '80069, 80050', '80050', '2022-06-30 09:12:04', '2022-06-30 09:12:04', 'ans_d'),
(1194, 6, 34, 1, '<p>This is a patient with atrial fibrillation who comes to the clinic laboratory routinely for a quantitative&nbsp; digoxin level.</p>', '80101, 80102, I50.9', '81001, I49.01', '80162, I48.91', '80162, R00.0', '2022-06-30 09:13:24', '2022-06-30 09:13:24', 'ans_c'),
(1195, 6, 34, 1, '<p>What code would you use to code a bilirubin, total (transcutaneous)?&nbsp;</p>', '82252', '82247', '82248', '88720', '2022-06-30 09:37:45', '2022-06-30 09:37:45', 'ans_d'),
(1196, 6, 34, 1, '<p>A patient is diagnosed with Ulcerative colitis and brought for screening for colon cancer. Which of the&nbsp; following tests for fecal occult blood would be ordered?</p>', '82270', '82271', '82272', '82274', '2022-06-30 09:38:58', '2022-06-30 09:38:58', 'ans_a'),
(1197, 6, 34, 1, '<p>On examination, the physician notes a gray vaginal discharge, which he places on one side. He puts a&nbsp; drop of saline and views the slide under the microscope and determines that the patient has bacterial&nbsp; vaginitis. Keeping in mind that the lab test was performed in the office, and lab setting is regulated by&nbsp; federal rules under the Clinical Laboratory improvement amendments (CLIA), which of the following is&nbsp; appropriate billing for the test performed in MD office.</p>', '87210-QW', '87210-GA', '87205-GA', '87205-QW', '2022-06-30 09:40:06', '2022-06-30 09:40:06', 'ans_a'),
(1198, 6, 34, 1, '<p>A patient had vaginal hysterectomy for cervical cancer. A surgical pathology of a gross and microscopic&nbsp; examination was performed on the uterus, fallopian tubes and ovaries. Which CPT code is reported for this&nbsp; service?</p>', '88305', '88307', '88309', '88302', '2022-06-30 09:41:07', '2023-05-26 09:51:08', 'ans_c'),
(1199, 6, 34, 1, '<p>Patient&#39;s low density lipoprotein (LDL) levels are not responding adequately to prescription drug management. The PCP collects and submits a blood sample with the order to the lab for further analysis&nbsp; using ultracentrifugation. What CPT code is assigned to report this test?</p>', '83719', '83698', '83701', '83704', '2022-06-30 09:42:43', '2022-06-30 09:42:43', 'ans_c'),
(1200, 6, 34, 1, '<p>In what section of the pathology chapter of CPT will a coder find codes for a ECSF test.&nbsp;</p>', 'Cytopathology', 'Chemistry', 'Other procedures', 'None of the above', '2022-06-30 09:44:02', '2022-06-30 09:44:02', 'ans_b'),
(1201, 6, 34, 1, '<p>Within the organ or disease oriented panels, which four panels include codes for tests of potassium&nbsp; (84132), Glucose (82947), and Sodium (84295)</p>', '80048, 80050, 80053, 80061', '80048, 80050, 80053, 80061', '80047, 80048, 80050, 80069', '80051, 80055, 80069, 80076', '2022-06-30 09:45:28', '2022-06-30 09:45:28', 'ans_c'),
(1202, 6, 34, 1, '<p>A physician orders an obstetric panel to include syphilis screening using the non- treponemal antibody&nbsp; approach and automated CBC with manual differential WBC count. What code(s) should be reported for&nbsp; lab test(s)?</p>', '80055', '85027, 85007, 87340, 86762, 86780, 86850, 86900, 86901', '85025, 87340, 86762, 86592, 86850, 86900, 86901', '85027, 85004, 87340, 86762, 86780, 86850, 86900, 86901', '2022-06-30 09:46:31', '2022-06-30 09:46:31', 'ans_a'),
(1203, 6, 34, 1, '<p>Peripheral stem cells are removed from a patient by apheresis. The cells are stored in a liquid nitrogen&nbsp; freezer with the temperature monitored very closely. What CPT code should be used to report the&nbsp; cryopreservation and storage of cells?</p>', '86932', '89258', '88240', '88241', '2022-06-30 09:47:57', '2022-06-30 09:47:57', 'ans_c'),
(1204, 6, 34, 1, '<p>Modifier 91 is applied to a laboratory code under what circumstances?</p>', 'When a test is repeated due to error or insufficient specimen', 'When a test is repeated due to medical necessity', 'When multiple tests are run on the same specimen', 'Under no circumstance should modifier 91 be applied to a laboratory code', '2022-06-30 09:49:10', '2022-06-30 09:49:10', 'ans_b'),
(1205, 6, 34, 1, '<p>A patient is brought to the ED by a police officer. It appears the patient has altered cognitive abilities&nbsp;however the patient does not admit to any drug use. The ED physician orders presumptive drug testing for&nbsp; alcohol, methamphetamines and opiates using an automated chemistry analyzer using LC-MS/MS. The test&nbsp; come back positive for alcohol. A definitive test is performed for alcohol. Select the correct code(s).</p>', '80307, 80320', '80305 x 3, 80320', '80306, 80361', '80305 X 3, 80361', '2022-06-30 09:51:09', '2022-06-30 09:51:09', 'ans_a'),
(1206, 6, 87, 1, '<p>Dr. Jones owns the x-ray equipment in his office and serves as the employer to the technologist. He&nbsp; ordered a three-view film of Paula&#39;s zygomatic bone. He reviewed the films and dictated a report while she&nbsp; was in the office. What code captures Dr. Jones&#39; services?</p>', '70150-26', '70150', '70150-TC', '70150-52', '2022-06-30 09:53:51', '2023-05-23 09:51:23', 'ans_b'),
(1207, 6, 87, 1, '<p>Dr. White ordered an MRI of Jerry&#39;s pelvis without contract. Jerry went to the local outpatient imaging&nbsp; center for this study. The MRI was completed and read by a radiologist at the imagining center. A complete&nbsp; report was sent back to Dr. White. What code captures the radiology service?</p>', '72196', '72195', '72195-26', '72198', '2022-06-30 09:54:48', '2023-05-23 09:51:42', 'ans_b'),
(1208, 6, 87, 1, '<p>Becky reported to her physician&#39;s office after feeling a lump in her right breast. Dr. Sarah had the results&nbsp; of Becky&#39;s last screening mammography, which did not show any changes. Dr. Sarah completed an exam and&nbsp; detected a lump in the right breast and abnormal changes in the left breast. After a complete work-up Dr.&nbsp; Sarah ordered a bilateral diagnostic mammography with computer aided detection. What code(s) correctly&nbsp; capture the mammography?</p>', '77067', '77065-RT,LT', '77066', '76642', '2022-06-30 10:08:58', '2023-05-23 09:52:10', 'ans_c'),
(1209, 6, 87, 1, '<p>A 45-year-old female patient had abdominal pain for several days. She had a hysterectomy one year ago&nbsp; with no complications. During her office visit she had a complete pelvic ultrasound. What code correctly&nbsp; captures this ultrasound?</p>', '76801', '76816', '76857', '76856', '2022-06-30 10:10:22', '2023-05-23 09:52:54', 'ans_d'),
(1210, 6, 87, 1, '<p>Mr. Fredrick is in his second phase of radiation treatment for stomach cancer. Today, he reports to the&nbsp; cancer treatment facility for his regularly scheduled treatment. He is given seven MeV to a single area that&nbsp; requires a single port and a simple block. How should the facility report this service?</p>', '77412 x 7', '77407', '77402', '77401-TC', '2022-06-30 10:11:30', '2023-05-23 09:53:10', 'ans_c'),
(1211, 6, 87, 1, '<p>Tiffany is pregnant with twins after a successful IVF treatment. She is in her first trimester of pregnancy.&nbsp; Her physician completed a transabdominal follow-up ultrasound to evaluate the fetal size of both babies and&nbsp; review a suspected abnormality from a previous ultrasound. What code(s) correctly capture this service?</p>', '76816, 76816-59', '76816 X 2', '76801, 76802 X 2', '76811, 76812', '2022-06-30 10:12:43', '2023-05-23 09:52:28', 'ans_a'),
(1212, 6, 87, 1, '<p>What code best describes a CT scan of the abdomen with oral contrast?</p>', '74175', '74170', '74150', '74160', '2022-06-30 10:13:55', '2023-05-23 09:53:28', 'ans_c'),
(1213, 6, 87, 1, '<p>Dr. Hernandez preformed an arthrography injection of the temporomandibular joint (TMJ). He also&nbsp; completed the radiological supervision and interpretation for this procedure. The procedure was completed&nbsp; in a hospital. What code(s) correctly capture Dr. Hernandez&#39;s services?</p>', '21116, 76001-26, 70332-26', '70322-26', '21116, 70332-26', '21116', '2022-06-30 10:15:01', '2023-05-23 09:55:00', 'ans_c'),
(1214, 6, 34, 1, '<p>Which of the following statements are true regarding radiology services?</p>', 'There is not a subsection for clinical treatment planning in the radiology section', 'Modifier -59 is never appended to codes in the 70000 series of codes', 'For spine examinations using computed tomography, magnetic resonance imaging, magnetic resonance  angiography, \"with contrast\" includes intrathecal or intravascular injection', 'Special reports for radiology services never include complexity of symptoms, final diagnosis, follow-up  care, concurrent problems, pertinent physical findings, or diagnostic and therapeutic procedures', '2022-06-30 10:18:17', '2022-06-30 10:18:17', 'ans_c'),
(1215, 6, 34, 1, '<p>Dr. Bob verbally requested Dr. Heinz, a clinical pathologist, to provide a consultation for one of his&nbsp; patients. Dr. Heinz provided a comprehensive consultation with review of the patient&#39;s history, medical&nbsp; records, and sent a written report back to Dr. Bob. Which code correctly captures Dr. Heinz&#39;s services?</p>', '80503', '88321', '88323', '88325', '2022-06-30 10:53:02', '2023-05-26 04:18:45', 'ans_d'),
(1216, 6, 34, 1, '<p>Dr. Shaw performed an electrolyte panel on automated equipment in her office. The tests she includes&nbsp; in this battery are sodium, potassium, chloride, carbon dioxide, and glucagon tolerance test. How should she&nbsp; report these services?</p>', '82374, 82435, 84132,84295, 82946', '80051, 82946', '80051', '80053-52', '2022-06-30 10:54:26', '2022-06-30 10:54:26', 'ans_b'),
(1217, 6, 34, 1, '<p>A patient has been taking Digoxin, per his prescription, for several weeks. Two days ago he ran out of his&nbsp; medicine and stopped. He knew he had an appointment with his physician and decided to wait until his next&nbsp; checkup to get a new prescription. His physician ordered a quantitative drug essay to check the therapeutic&nbsp; level of Digoxin still present in the patient&#39;s blood. What code correctly captures this service?</p>', '80161', '80163', '80162', '80168', '2022-06-30 10:56:11', '2023-05-30 01:08:22', 'ans_c'),
(1218, 6, 34, 1, '<p>A patient presents to the hospital for a scheduled procedure to remove suspicious lesions from the right&nbsp; side of her neck. The surgeon excised one lesion near the anterior portion of the mandible, the second near&nbsp; the clavicle bone. A pathologist received two separately labelled containers, container A-mandible, and&nbsp; container B-clavicle. The surgeon requests a consult during surgery for immediate diagnosis. The pathologist&nbsp; examines each specimen, taking two blocks from specimen A and three blocks from specimen B. Specimen A&nbsp; is further processed into two frozen sections and B into five frozen sections. The blocks are examined&nbsp; microscopically. What codes correctly capture the pathologist&#39;s services?</p>', '88331, 88332-26 x 6', '88331-26 X 2, 88332-26 X 7', '88331x2, 88332 X 3', '88329, 88331-47, 88332-26 X 2', '2022-06-30 10:57:34', '2023-07-11 00:18:43', 'ans_c'),
(1219, 6, 34, 1, '<p>Which CPT code describes a lab test for Prostate specific antigen (PSA); total?</p>', '86316', '84154', '84153', '84152', '2022-06-30 10:58:42', '2022-06-30 10:58:42', 'ans_c'),
(1220, 6, 34, 1, '<p>A 22-year-old female presents in the emergency department in a coma. Her friends tell the attending&nbsp; physician they were drinking and saw her take a couple of pills before she passed out. She has a history of depression and anxiety and is being treated with prescription medication. The physician orders a drug screen&nbsp; for alcohol, tricyclic antidepressants, opiates, and barbiturates. The lab completes a single drug class&nbsp; screening for each analyte by means of immunoassay methods using ELISA. What code(s) correctly capture&nbsp; the lab services?</p>', '80305 x 4', '80307', '80306', '80305', '2022-06-30 11:00:41', '2022-06-30 11:00:41', 'ans_b'),
(1221, 6, 34, 1, '<p>Which code range describes Bethesda System cytopathology?</p>', '88160-88162', '88199-88299', '88241-88143', '88164-88167', '2022-06-30 11:02:08', '2022-06-30 11:02:08', 'ans_d'),
(1222, 6, 34, 1, '<p>Dr. Kim performed a fine needle aspiration of deep tissue under radiological guidance. Two specimens&nbsp; were sent to the hospital laboratory for cytopathology evaluation to determine adequacy of the specimens&nbsp; gathered. What code(s) correctly capture the lab services?</p>', '88173', '88172', '88173, 88333-91', '88712 X 2, 88334-59', '2022-06-30 11:04:29', '2022-06-30 11:04:29', 'ans_b'),
(1223, 6, 34, 1, '<p>A breast biopsy was submitted for surgical pathology gross and microscopic evaluation of the surgical&nbsp; margins. A comprehensive examination and report was completed on the specimen. What code(s) correctly&nbsp; capture the laboratory services?&nbsp;</p>', '88307', '88307, 88331, 88323-26', '88305', '88305, 88331, 88323-26', '2022-06-30 11:05:51', '2022-06-30 11:05:51', 'ans_a'),
(1224, 6, 34, 1, '<p>Which of the following is a procedure to collect a blood sample.</p>', 'Venipuncture', 'Selective catheter placement', 'Angiography', 'Endovenous ablation', '2022-06-30 11:09:05', '2022-06-30 11:09:05', 'ans_a'),
(1225, 6, 34, 1, '<p>A patient has partial removal of his lung. The surgeon also biopsies several lymph nodes in the patient&rsquo;s&nbsp; chest which are examined intraoperatively by frozen section and sent with the lung tissue for Pathologic&nbsp; examination. The pathologist also performs a trichrome stain. What CPT&reg; codes are reported for the lab&nbsp; tests performed?</p>', '88309 x 2, 88313', '88309, 88305, 88313, 88331', '88307, 88305x2, 88332', '88309, 88307, 88313', '2022-06-30 11:10:13', '2022-06-30 11:10:13', 'ans_b'),
(1226, 6, 34, 1, '<p>A couple with inability to conceive has fertility testing. The semen specimen is tested for volume, count,&nbsp; motility and a differential is calculated. The findings indicate infertility due to oligospermia. What CPT&reg; codes are reported?</p>', '89310, 89320', '89257', '89320', '89264', '2022-07-03 18:32:51', '2022-07-03 18:32:51', 'ans_c'),
(1227, 6, 34, 1, '<p>In a legal hearing to determine child support there is a dispute about the child&rsquo;s paternity. The court&nbsp; orders a paternity test, and a nasal smear is taken from the plaintiff and the child. The plaintiff is&nbsp; confirmed as the father of the child. Choose the CPT codes and modifier for the paternity testing.</p>', '89190-32', '86910-32', '86900', '86910', '2022-07-03 18:34:12', '2022-07-03 18:34:12', 'ans_b'),
(1228, 6, 34, 1, '<p>A virus is identified by observing growth patterns on cultured media. What is this type of identification is&nbsp; called?</p>', 'Definitive', 'Qualitative', 'Quantitative', 'Presumptive', '2022-07-03 18:35:19', '2022-07-03 18:35:19', 'ans_d'),
(1229, 6, 34, 1, '<p>A patient&rsquo;s mother and sister have been treated for breast cancer. She has blood drawn for cancer gene&nbsp; analysis with molecular pathology testing. She has previously received genetic counseling. Blood will be&nbsp; tested for full sequence analysis and common duplication or deletion variants (mutations) in BRCA1,&nbsp; BRCA2 (breast cancer 1 and 2). What CPT&reg; code is reported for this molecular pathology procedure?</p>', '81200', '81206', '81162', '81163', '2022-07-03 18:36:28', '2022-07-03 18:36:28', 'ans_c'),
(1230, 6, 34, 1, '<p>A patient with AIDS presents for follow up care. An NK (natural killer cell) total count is ordered. What CPT&reg; code(s) is/are reported?</p>', '86359', '86703', '86361, 86359', '86357', '2022-07-03 18:37:34', '2022-07-03 18:37:34', 'ans_d'),
(1231, 6, 34, 1, '<p>What is/are the code(s) for thawing 4 units of fresh frozen plasma?</p>', '86927', '86927 x 4', '86931', '86931 x 4', '2022-07-03 18:38:38', '2022-07-03 18:38:38', 'ans_b'),
