(1233, 6, 34, 1, '<p>A patient will be undergoing a transplant and needs HLA tissue typing with DR/DQ multiple antigen and&nbsp; lymphocyte mixed culture. How will these services be coded?</p>', '86805-26, 86817', '86817, 86821', '86816-26, 86821', '86806-26, 86817', '2022-07-03 18:48:48', '2022-07-03 18:48:48', 'ans_b'),
