(1235, 6, 87, 1, '<p>41-year-old male is in his doctor&rsquo;s office for a follow up of an abnormality, which was noted, on an&nbsp; abdominal CT scan. He is to have a chest X-ray due to chest tightness. He otherwise states he feels well&nbsp; and is here to go over the results of his chest X-ray (PA and Lateral) performed in the office and the CT&nbsp; scan performed at the diagnostic center. The results of the chest X-ray were normal. CT scan was sent to&nbsp; the office and the physician interpreted and documented that the CT scan of the abdomen showed a small&nbsp; mass in his right upper quadrant. What CPT&reg; codes are reported for the doctor&rsquo;s office radiological&nbsp; services?</p>', '71046-26, 74150-26', '71046, 74150', '71046-26, 74150', '71046, 74150-26', '2022-07-03 18:50:56', '2023-05-23 09:55:48', 'ans_d'),
(1236, 6, 87, 1, '<p>A patient has a history of chronic venous embolism in the superior vena cava (SVC) and is having a&nbsp; radiographic study to visualize any abnormalities. In outpatient surgery the physician accesses the&nbsp; subclavian vein and the catheter is advanced to the superior vena cava for injection and imaging. The&nbsp; supervision and interpretation of the images is performed by the physician. What codes are reported for&nbsp; this procedure?</p>', '36010, 75827-26', '36000, 75820-26', '36000, 75827-26', '36010, 75820-26', '2022-07-03 18:51:58', '2023-05-23 09:56:18', 'ans_a'),
(1237, 6, 87, 1, '<p>70-year-old female presents with a complaint of right knee pain with weight bearing activities. She is also&nbsp; developing pain at rest. She denies any recent injury. There is pain with stair climbing and start up pain. An&nbsp; AP, Lateral and Sunrise views of the right knee are ordered and interpreted. They reveal calcification&nbsp; within the vascular structures. There is decreased joint space through the medial compartment where she&nbsp; has near bone-on-bone contact, flattening of the femoral condyles, no fractures noted. The diagnosis is right knee pain secondary to underlying localized degenerative arthritis. What CPT&reg; codes are reported?</p>', '73560', '73564', '73562', '73565', '2022-07-03 18:53:03', '2023-05-23 09:56:57', 'ans_c'),
(1238, 6, 87, 1, '<p>Myocardial Perfusion Imaging&mdash;Office Based Test</p>\r\n\r\n<p>Indications: Chest pain.</p>\r\n\r\n<p>Procedure: Resting tomographic myocardial perfusion images were obtained following injection of 10&nbsp; mCi of intravenous cardiolite. At peak exercise, 30 mCi of intravenous cardiolite was injected, and post stress tomographic myocardial perfusion images were obtained. Post stress gated images of the left&nbsp; ventricle were also acquired. Myocardial perfusion images were compared in the standard fashion. Findings: This is a technically fair study. There were no stress induced electrocardiographic changes&nbsp; noted. There are no significant reversible or fixed perfusion defects noted. Gated images of the left&nbsp; ventricle reveal normal left ventricular volumes, normal left ventricular wall motion, and an estimated left&nbsp; ventricular ejection fraction of 50%.</p>\r\n\r\n<p>Impression: No evidence of myocardial ischemia or infarction. Normal left ventricular ejection fraction.&nbsp; What CPT&reg; code(s) is/are reported?</p>', '78451', '78451, A9500', '78453', '78451, A9500 x 30', '2022-07-03 18:54:34', '2023-05-23 09:57:57', 'ans_b'),
(1239, 6, 87, 1, '<p>After intravenous administration of 5.1 millicuries Tc-99m DTPA, flow imaging of the kidneys was&nbsp; performed for approximately 30 minutes. Flow imaging demonstrated markedly reduced flow to both&nbsp; kidneys bilaterally. What CPT&reg; code is reported?</p>', '78803', '78701', '78708', '78725', '2022-07-03 18:57:00', '2023-05-23 10:00:18', 'ans_b'),
(1240, 6, 34, 1, '<p>An oncology patient is having weekly radiation treatments with a total of seven conventional fractionated&nbsp; treatments. Two fractionated treatments daily for Monday, Tuesday and Wednesday and one treatment on&nbsp; Thursday. What radiology code(s) is/are appropriate for the clinical management of the radiation&nbsp; treatment?</p>', '77427', '77427 x 7', '77427 x 2', '77427-22', '2022-07-03 19:38:55', '2022-07-03 19:38:55', 'ans_a'),
(1241, 6, 34, 1, '<p>Magnetic resonance imaging of the chest is first done without contrast medium enhancement and then is&nbsp; performed with an injection of contrast. What CPT&reg; code(s) is/are reported for the radiological services?</p>', '71550, 71551', '71552', '71555', '71275', '2022-07-03 19:40:15', '2022-07-03 19:40:15', 'ans_b'),
(1242, 6, 34, 1, '<p>A CT scan confirms improper ossification of cartilages in the upper jawbone and left side of the face area&nbsp; for a patient with facial defects. The CT is performed with contrast material in the hospital. What CPT&reg;&nbsp; code is reported by an independent radiologist contracted by the hospital?</p>', '70460-26', '70481-26', '70487-26', '70542-26', '2022-07-03 19:41:36', '2022-07-03 19:41:36', 'ans_c'),
(1243, 6, 87, 1, '<p>A patient is positioned on the scanning table headfirst with arms at the side for an MRI of the thoracic&nbsp; spine and spinal canal. A contrast agent is used to improve the quality of the images. The scan confirms&nbsp; the size and depth of a previously biopsied leiomyosarcoma metastasized to the thoracic spinal cord.&nbsp; What CPT&reg; codes are reported?</p>', '72255', '72157', '72070', '72147', '2022-07-03 19:44:55', '2023-05-23 09:59:58', 'ans_d'),
(1244, 6, 87, 1, '<p>A young child is taken to the OR to reduce a meconium plug bowel obstruction. A therapeutic enema is&nbsp; performed with fluoroscopy. The patient is in position and barium is instilled into the colon through the&nbsp; anus for the reduction. What CPT&reg; code is reported by the independent radiologist for the radiological&nbsp; service?</p>', '74270-26', '74280-26', '74283-26', '74246-26', '2022-07-03 19:46:13', '2023-05-23 09:59:43', 'ans_c'),
(1245, 6, 87, 1, '<p>A young child is taken to the OR to reduce a meconium plug bowel obstruction. A therapeutic enema is&nbsp; performed with fluoroscopy. The patient is in position and barium is instilled into the colon through the&nbsp; anus for the reduction. What CPT&reg; code is reported by the independent radiologist for the radiological&nbsp; service?</p>', '74270-26', '74280-26', '74283-26', '74246-26', '2022-07-03 19:46:26', '2023-05-23 09:59:22', 'ans_c'),
