(1247, 6, 87, 1, '<p>The patient is 15 weeks pregnant with twins coming back to her obstetrician to have a&nbsp; transabdominal ultrasound performed to reassess anatomic abnormalities of both fetuses&nbsp; that were previously demonstrated in the last ultrasound. What code(s) should be used for&nbsp; this procedure?</p>', '76815', '76816, 76816‐59', '76801, 76802', '76805, 76810', '2022-07-03 19:50:51', '2023-05-23 09:57:23', 'ans_b'),
(1248, 6, 34, 1, '<p>Cells were taken from amniotic fluid for analyzation of the chromosomes for possible&nbsp; Down&rsquo;s syndrome. The geneticist performs the analysis with two G‐banded karyotypes&nbsp; analyzing 30 cells. Select the lab codes for reporting this service.</p>', '88248', '88267, 88280, 88285', '88273, 88280, 88291', '88262, 88285', '2022-07-03 19:52:02', '2023-10-03 01:56:12', 'ans_b'),
(1249, 6, 34, 1, '<p>Sperm is being prepared through a washing method to get it ready for the insemination of&nbsp; five oocytes for fertilization by directly injecting the sperm into each oocyte. Choose the&nbsp; CPT&reg; codes to report this service.</p>', '89257, 89280', '89260, 89280', '89261, 89280', '89260, 89268', '2022-07-03 19:53:46', '2022-07-03 19:53:46', 'ans_b'),
(1250, 6, 34, 1, '<p>A pathologist performs a comprehensive consultation and report after reviewing a patient&rsquo;s&nbsp; records and specimens from another facility. The correct CPT&reg; code to report this service is</p>', '88325', '99244', '80503', '88329', '2022-07-03 19:54:57', '2023-05-26 04:19:32', 'ans_a'),
(1251, 6, 87, 1, '<p>76‐year‐old female had a ground level fall when she tripped over her dog&nbsp; earlier this evening in her apartment. The Emergency Department took X‐rays of the left wrist in oblique and lateral views which revealed a displaced distal radius fracture, type I&nbsp; open left rist. What radiological service and ICD‐10‐CM codes are reported?</p>', '73100‐26, S52.502B, W18.31XA, Y92.039', '73110‐26, S52.602A, W18.31XA, Y92.039', '73115‐26, S52.502A, W18.31XA, Y92.039', '73100‐26, S52.602B, W18.31XA, Y92.039', '2022-07-03 19:56:08', '2023-05-23 09:58:38', 'ans_a'),
(1252, 6, 34, 1, '<p>18‐year‐old female with a history of depression comes into the ER in a coma. The ER&nbsp; physician orders a drug screen on antidepressants, phenothiazines, and benzodiazepines.&nbsp; The lab performs a screening for single drug class using an immunoassay in an instrument&nbsp; assisted chemistry analyzer. Presence of antidepressants is found and a drug confirmation is&nbsp; performed to identify the particular antidepressant. What correct CPT&reg; codes are reported?</p>', '80307, 80338', '80305, 80338', '80307 x 3, 80332', '80306 x 3, 80333', '2022-07-03 19:57:19', '2022-07-03 19:57:19', 'ans_a'),
(1253, 6, 34, 1, '<p>A patient uses Topiramate to control his seizures. He comes in every two months to have a&nbsp; therapeutic drug testing performed to assess serum plasma levels of this medication. What&nbsp; lab code is reported for this testing?</p>', '80307', '80375', '80201', '80305, 80375', '2022-07-03 19:58:54', '2022-07-03 19:58:54', 'ans_c'),
(1254, 6, 34, 1, '<p>Patient that is a borderline diabetic has been sent to the laboratory to have an oral glucose&nbsp; tolerance test. Patient drank the glucose and five blood specimens were taken every 30 to&nbsp; 60 minutes up to three hours to determine how quickly the glucose is cleared from the&nbsp; blood. What code(s) should be reported for this test?</p>', '82947 x 5', '82946', '80422', '82951, 82952 x 2', '2022-07-03 19:59:56', '2022-07-03 19:59:56', 'ans_d'),
(1255, 6, 34, 1, '<p>A patient with severe asthma exacerbation has been admitted. The admitting physician&nbsp; orders a blood glass for oxygen saturation only. The admitting physician performs the&nbsp; arterial puncture drawing blood for a blood gas reading on oxygen saturation only. The&nbsp; physician draws it again in an hour to measure how much oxygen the blood is carrying.&nbsp; Select the codes for reporting this service.</p>', '82805, 82805‐51', '82810, 82810‐91', '82803, 82803‐51', '82805, 82805‐90', '2022-07-03 20:02:55', '2022-07-03 20:02:55', 'ans_b'),
(1256, 6, 87, 1, '<p>35‐year‐old male sees his primary care physician complaining of fever with chills, cough and&nbsp; congestion. The physician performs a chest X‐ray taking lateral and AP views in his office.&nbsp; The physician interprets the X‐ray views and the patient is diagnosed with walking&nbsp; pneumonia. Which CPT&reg; code is reported for the chest X‐rays performed in the office and&nbsp; interpreted by the physician.</p>', '71046-26', '71048‐26', '71046', '71045‐26‐TC', '2022-07-03 20:04:14', '2023-05-26 03:53:44', 'ans_c'),
(1257, 6, 87, 1, '<p>56‐year‐old female is having a bilateral mammogram with computer aid detection&nbsp; conducted as a screening since the patient has had a previous cyst in the right breast. What&nbsp; radiological services are reported?</p>', '77065', '77066', '77067', '77065, 77066', '2022-07-03 20:07:16', '2023-05-23 09:55:24', 'ans_c'),
(1258, 6, 34, 1, '<p>Patient is coming in for a pathological examination for ischemia in the left leg. The first&nbsp; specimen is 1.5 cm of a single portion of arterial plaque taken from the left common&nbsp; femoral artery. The second specimen is 8.5 x 2.7 cm across x 1.5 cm in thickness of a&nbsp; cutaneous ulceration with fibropurulent material on the left leg. What surgical pathology&nbsp; codes should be reported for the pathologist?</p>', '88304‐26, 88302‐26', '88305‐26, 88304‐26', '88307‐26, 88305‐26', '88309‐26, 88307‐26', '2022-07-03 20:08:51', '2022-07-03 20:08:51', 'ans_b'),
(1259, 6, 34, 1, '<p>During a craniectomy the surgeon asked for a consult and sent a frozen section of a large&nbsp; piece of tumor and sent it to pathology. The pathologist received a rubbery pinkish tan tissue measuring in aggregate 3 x 0.8 x 0.8 cm. The entire specimen is submitted in one&nbsp; block and also a gross and microscopic examination was performed on the tissue. The&nbsp; frozen section and the pathology report are sent back to the surgeon indicating that the&nbsp; tumor was a medulloblastoma. What CPT&reg; code(s) will the pathologist report?</p>', '80503', '88331‐26, 88307‐26', '80506', '88331‐26, 88332‐26, 88304‐26', '2022-07-03 20:10:39', '2023-05-26 04:17:45', 'ans_b'),
(1260, 6, 34, 1, '<p>Physician orders a basic (80047) and comprehensive metabolic (80053) panels. Select the&nbsp; code(s) on how this is reported.</p>', '80053, 80047', '80053', '80047, 82040, 82247, 82310, 84075, 84155, 84460, 84450', '80053, 82330', '2022-07-03 20:12:30', '2022-07-03 20:12:30', 'ans_d'),
