(1269, NULL, 36, 1, '<p><strong>Fracture of the right patella with abrasion. </strong></p>', 'S82.001A, S80.819A', 'S82.001A', 'S80.819A, S82.001B', 'S82.101A', '2022-07-07 06:43:30', '2022-07-07 06:43:30', 'ans_b'),
(1270, NULL, 36, 1, '<p><strong>Mr. Hallberger has multiple problems. I am examining him in the intensive critical care unit. I understand&nbsp; he has fluid overload with acute renal failure and was started on ultrafiltration by the nephrologist on duty. He has an abnormal chest x-ray. He has preexisting type 2 diabetes mellitus and sepsis. We are left with a patient now who is still sedated and on a ventilator because of respiratory failure. Code the diagnosis(es) only.&nbsp;</strong></p>', 'R60.9, N18.9, R83.9, E11.29, A42.9, J96.90', 'R18.8, N17.2, R91.8, E11.29, A42.9, J96.90', 'E86.9, N26.9, R91.8, E11.9, A41.9, J96.90, T67.3XXA', 'E87.70, N17.9, R91.8, E11.9, A41.9, J96.90, R65.20', '2022-07-07 06:44:02', '2022-07-07 06:44:02', 'ans_d'),
(1271, NULL, 36, 1, '<p><strong>Susan Oster, 45, was admitted to the hospital with septicemia and SIRS. Her temperature was 38.5&ordm; C,&nbsp; heart rate 102 beats/min, respiration 20/min, WBC 12,500, with respiratory and hepatic failure.</strong></p>', 'A41.9', 'A41.9, J96.90, K72.90', 'R65.20, A41.9', 'A41.9, R65.20, J96.90, K72.90', '2022-07-07 06:44:39', '2022-07-07 06:44:39', 'ans_d'),
(1272, NULL, 36, 1, '<p><strong>A condition where the bridge of the nose is flat and the eyelid size is reduced both horizontally and&nbsp; vertically would be coded to:&nbsp;</strong></p>', 'H02.35', 'N47.1', 'H02.209', 'H02.529', '2022-07-07 06:45:16', '2022-07-07 06:45:16', 'ans_d'),
(1273, NULL, 36, 1, '<p><strong>Smoker diagnosed with CHF due to hypertension.&nbsp;&nbsp;</strong></p>', 'I13.10, Z98.89', 'I11.0, I50.9, Z72.0', 'I50.3, I11.0, Z77.22', 'I13.10, I50.4, Z77.22', '2022-07-07 06:45:49', '2022-07-07 06:45:49', 'ans_b'),
(1274, NULL, 36, 1, '<p><strong>A patient is treated for three pressure ulcers: bilateral buttock ulcers, stage 3 on the right and stage 2&nbsp; on the left; and a stage 4 on the sacral area.&nbsp;</strong></p>', 'L89.323, L89.312, L89.154', 'L89.313, L89.322, L89.154', 'L89.313, L89.312, L89.153', 'L89.313, L89.322, L89.155', '2022-07-07 06:54:02', '2022-07-07 06:54:02', 'ans_b');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1275, NULL, 36, 1, '<p><strong>This 62 year old male is being sent for mild nonproliferative diabetic retinopathy with macular edema.&nbsp; He has Type 2 DM and takes insulin on a daily basis. He also has diabetic cataract in his right eye. What is&nbsp; the correct diagnosis code assignment?&nbsp;</strong></p>', 'E11.321, E11.36', 'E11.321, Z79.4', 'E11.321, E11.36, Z79.4', 'E11.36', '2022-07-07 06:54:38', '2022-07-07 06:54:38', 'ans_c'),
(1276, NULL, 36, 1, '<p><strong>This type 1 diabetic patient has a severe chronic diabetic left foot ulcer with diabetic peripheral&nbsp; angiopathy. He also has diabetic stage 2 chronic kidney disease. He is being evaluated to see if&nbsp; debridement is required for this ulcer with breakdown of the skin. What is the correct diagnosis code&nbsp; assignment?&nbsp;</strong></p>', 'E10.621, E10.51, E10.22, N18.2', 'E10.51, E10.22, N18.2', 'E10.621, L97.521, E10.51, E10.22, N18.2', 'E10.5, I73.9, E11.22, N18.2 3', '2022-07-07 06:55:14', '2022-07-07 06:55:14', 'ans_c'),
(1277, NULL, 36, 1, '<p><strong>&nbsp;This patient is seen for treatment of a recurrent right inguinal hernia with gangrene and obstruction.&nbsp; What is the correct diagnosis code assignment?&nbsp;</strong></p>', 'K40.30, K46.0', 'K40.30', 'K40.41', 'K40.41, K46.0', '2022-07-07 06:56:07', '2022-07-07 06:56:07', 'ans_c'),
(1278, NULL, 36, 1, '<p><strong>&nbsp;Code the following diagnosis code(s): 20-week pregnancy with low weight gain and pre-existing&nbsp; essential hypertension complicating the pregnancy.&nbsp;</strong></p>', 'O26.12, O10.012, Z3A.20', 'O26.13, O10.03, Z3A.20', 'O26.12, O10.112, Z3A.20', 'O26.12, O10.212, Z3A.20', '2022-07-07 06:56:48', '2022-07-07 06:56:48', 'ans_a'),
(1279, NULL, 36, 1, '<p><strong>A fireman suffered third degree burns of his upper back involving 8% TBSA, a second degree burns of&nbsp; the neck involving 2% TBSA, a third degree burns of the right forearm involving&nbsp;</strong></p>\r\n\r\n<p><strong>4% TBSA, while in a house battling a fire. He was taken to the hospital ED for treatment:</strong></p>', 'T20.27XA, T22.311A, T22.33XA, T31.11, Y91.019, X00.0XXA', 'T21.33XA, T22.311A, T20.27XA, T31.11, X00.0XXA, Y92.019', 'T21.73XA, T20.67XA, T22.011xA, T31.0, X02.0XA, Y92.013', 'T20.27xA, T21.34XA, T31.9, X03.0XA, Y92.029', '2022-07-07 06:57:32', '2022-07-07 06:57:32', 'ans_b'),
(1280, NULL, 36, 1, '<p><strong>While chopping vegetables in the kitchen of his mobile home for the local food banks Thanksgiving dinner, John Doe lacerated his right thumb causing injury to the nail.</strong></p>', 'S61.111A, W26.0XXA,  Y92.020, Y93.G1, Y99.2', 'S61.314A, W26.0XXA, Y92.020, Y93.G1, Y99.2', 'S61.111A', 'S61.314A', '2022-07-07 07:00:32', '2022-07-07 07:00:32', 'ans_a'),
(1281, NULL, 36, 1, '<p><strong>Aftercare encounter for management of a subtrochanteric fracture of the left femur. Patient fell and&nbsp; fractured the left femur two weeks earlier.</strong></p>', 'S72.22XD, W19.XXXD', 'S72.22XA, W19.XXXD', 'S72.22XA', 'S72.22XD', '2022-07-07 07:01:09', '2022-07-07 07:01:09', 'ans_a'),
(1282, NULL, 36, 1, '<p><strong>While at church, Fred was standing on a chair when he fell. He suffered a Colles&#39; fracture on right wrist and contusions to his right cheek, right elbow, right hand, and left thigh. What codes would you report for this&nbsp; injury?&nbsp;</strong></p>', 'S52.531A, S00.93XA, S50.10XA, S60.221A, S70.10XA, W07.XXXA, Y92.29', 'S52.531A, S00.93XA, S50.01XA, S60.221A, S70.12XA, W07.XXXA, Y92.29', 'S52.531B, S00.93XA, S50.00XA, S60.221A, S70.10XA, Y92.29', 'S52.531A, S00.93XA, S50.01XA, S60.221A, S70.12XA, W07.XXXA', '2022-07-07 07:01:55', '2022-07-07 07:01:55', 'ans_b'),
(1283, NULL, 36, 1, '<p><strong>Dr. Lloyd, Bill&#39;s family physician, preformed a physical on Bill in December. Dr. Lloyd noted Bill had&nbsp; swollen glands, changes in blood tests and on chest x-ray, as well as the patient&#39;s report of general fatigue&nbsp; and weight loss. Bill was scheduled to see a specialist the following week. Dr. Schapiro, the specialist,&nbsp; examined Bill, performed tests, and told him he had metastatic malignant melanoma from the left lateral&nbsp; chest wall to the cervical lymph nodes. Today, Bill started treatment with Dr. Schapiro directed to his lymph&nbsp; nodes. What are the correct diagnoses codes for Dr. Schapiro&#39;s treatment?&nbsp;</strong></p>', 'C76.1, C77.0', 'C76.1, C77.2', 'C77.9, C76.2', 'C77.0, C76.1', '2022-07-07 07:02:29', '2022-07-07 07:02:29', 'ans_d'),
(1284, NULL, 36, 1, '<p><strong>Roger, a firefighter, was burned while fighting a forest fire. He is being treated in a burn unit, with burns&nbsp; to 30% of his total body surface area. The burns are reported as third degree to 25% of his body. The&nbsp; remaining 5% are first- and second-degree burns of the upper limb. How should you report the diagnoses&nbsp; codes?&nbsp;</strong></p>', 'T22.10XA, T22.20XA, X01.8XXA, T31.32', 'T24.20XA, X01.8XXA, T31.33', 'T22.30XA, X01.8XXA, T31.32', 'T22.20XA, T22.10XA, X01.8XXA, T31.32', '2022-07-07 07:03:37', '2023-09-20 04:26:20', 'ans_c'),
(1285, NULL, 36, 1, '<p><strong>Rosemary, a 52-year-old female, returned to her physician for treatment of glaucoma and problems with&nbsp; peripheral angiopathy of her feet due to diabetes. She has had problems controlling her diabetes and is&nbsp; insulin dependent. Which diagnosis codes best describe this patient&#39;s condition?&nbsp;</strong></p>', 'E10.39, E10.51, I79.8, H42', 'E10.51, E10.39, I79.8', 'E10.39, E10.51, I79.8', 'E10.39, E10.51, H42, I79.8', '2022-07-07 07:04:14', '2022-09-26 12:05:35', 'ans_d'),
(1286, NULL, 36, 1, '<p><strong>Karen, 26-year-old healthy female, suffered a cardiac arrest with administration of anesthetic during&nbsp; delivery. What are the correct diagnoses codes?&nbsp;</strong></p>', 'O74.2, I46.9', 'I46.9, O74', 'I46.9, O74.2', 'O74.2, I45', '2022-07-07 07:05:22', '2022-09-26 12:06:34', 'ans_a'),
(1287, NULL, 36, 1, '<p><strong>A patient is being treated for an infection from a deep laceration of the head that occurred five weeks&nbsp; ago. The injury occ urred during a motor vehicle accident. What codes would you use to report this problem?&nbsp;</strong></p>', 'V89.2XXS, S01.90XS, B94.9', 'L94.6, S01.90XS, V89.2XXS', 'B94.9, S01.90XS, V89.2XXS', 'V89.2XXS, T79.8XXA, L94.6', '2022-07-07 07:06:03', '2022-07-07 07:06:03', 'ans_c'),
(1288, NULL, 36, 1, '<p><strong>Thomas was seen in his primary care physician&#39;s office for a chronic smoker&#39;s cough. Thomas currently&nbsp; smokes five packs of cigarettes per day but is trying to quit smoking. Dr. Smith notes a chest x-ray reveals&nbsp; abnormal changes in his left lower lobe and designates &quot;rule out lung cancer&quot; as a working diagnosis. How&nbsp; should Dr. Smith report the diagnoses for this visit?&nbsp;</strong></p>', 'J41.0, F17.200, R91.8', 'R05.9, F17.200, R91.8', 'D49.1, J41.0, F17.200, R91.8', 'D49.1, F17.200, R91.8', '2022-07-07 07:06:38', '2023-05-26 04:34:29', 'ans_a'),
(1289, NULL, 36, 1, '<p><strong>&nbsp;Today, Dr. Arnold is treating Harry for a sprained ankle and foot. Harry injured himself when he fell off a&nbsp; sidewalk curb at a local restaurant. Harry has HIV and is stable on his current medications. How would Dr.&nbsp; Arnold report the diagnoses for this visit?&nbsp;</strong></p>', 'B20, S93.409A, W10.1XXA, Y92.29', 'S93.409A, B20, W10.1XXA, Y92.29', 'S68.029A, B20, W10.1XXA, Y92.9', 'W10.1XXA, Y92.29, B20, S93.409A', '2022-07-07 07:08:16', '2022-07-07 07:08:16', 'ans_b'),
(1290, NULL, 36, 1, '<p><strong>Dr. Nancy prescribed Ibuprofen for Ben&#39;s back pain. He took this medication as prescribed for two weeks.&nbsp; He started to have stomach pains and followed up with his doctor. Dr. Nancy noted &quot;gastritis due to the&nbsp; medication&quot; during the follow-up visit. What code(s) would be correct for the follow-up visit?</strong></p>', 'K29.70', 'T39.311A, K29.71', 'K29.71', 'K29.70, T39.315A', '2022-07-07 07:08:57', '2022-07-07 07:08:57', 'ans_d'),
(1291, NULL, 36, 1, '<p><strong>Sherri presents for her regularly scheduled chemotherapy and radiation treatment. She is being treated&nbsp; for cancer in situ of the bladder wall. How would you list the diagnoses codes for this visit?&nbsp;</strong></p>', 'D09.0, Z51.0, Z51.11', 'C67.9, Z51.11', 'Z51.0, Z51.11, D09.0', 'D09.0, Z51.11', '2022-07-07 07:09:49', '2022-07-07 07:09:49', 'ans_c'),
(1292, NULL, 36, 1, '<p><strong>Today, Daisy, a 72-year-old patient presents with chest pain due to an anterior wall myocardial infarction&nbsp; that was treated 12 weeks ago. She started to have chest pain while gardening and complains of a painful&nbsp; rash on her right leg due to contact with poison ivy. How would the doctor list the diagnoses codes for this&nbsp; encounter?</strong></p>', 'I25.2. L25.5', 'I25.2, R07.9, L25.5', 'I21.09, L25.5', 'I21.09, R07.9, L25.5', '2022-07-07 07:15:36', '2023-09-18 06:11:24', 'ans_a'),
(1293, NULL, 20, 1, '<p><strong>Stand-alone CPT codes have a full description; indented codes are listed under related stand-alone codes.&nbsp; An indented code includes the portion of the stand-alone code description, which precedes the semicolon.&nbsp; The semicolon is used in the CPT book to save space. Words following the semicolon can specify which of the&nbsp; following?&nbsp;</strong></p>', 'Extent of the service, modifiers, specific anatomic site .', 'Extent of the service, specific anatomic site, unlisted services', 'Extent of the service, specific anatomic site, alternative procedure', 'Unlisted services, alternative procedures, specific anatomic site', '2022-07-07 07:16:20', '2022-09-12 08:03:06', 'ans_c'),
(1294, NULL, 8, 1, '<p><strong>Physical status modifiers are appended to codes listed in which major section of the CPT book?&nbsp;</strong></p>', 'Evaluation and Management', 'Anesthesia', 'Surgery', 'Medicine', '2022-07-07 07:16:58', '2022-09-26 11:54:20', 'ans_b'),
(1295, NULL, 38, 1, '<p><strong>The term &quot;intraservice time&quot; has been measured in studies and is predictive of the work associated to&nbsp; E/M services. lntra service times are defined as face-to-face time for office and other outpatient visits and as&nbsp; unit/floor time for hospital and other inpatient visits. What is included in the intraservice time for an office&nbsp; and other outpatient visits?&nbsp;&nbsp;</strong></p>', 'Time in which the physician obtains a history, performs an examination, provides patient counseling', 'Time in which the physician establishes/reviews the patient\'s chart and communicates with other  professionals regarding the patient\'s family', 'Postoperative discussions, working with physical therapy departments, and counseling', 'Counseling/coordinating care that dominates more than 50% of the time with a patient', '2022-07-07 07:17:43', '2022-09-26 11:52:04', 'ans_a'),
(1296, NULL, 34, 1, '<p><strong>Panel tests in the Pathology and Laboratory section of the CPT book include all the codes listed with the&nbsp; panel description. When a panel is performed and additional pathology/laboratory tests are completed how&nbsp; should those additional tests be reported? </strong></p>', 'All tests are bundled when performed with a panel', 'Reporting additional tests is up-coding and could flag an audit that always leads to financial penalties.', 'Both a and b', 'The additional test should be reported separately in addition to the panel code', '2022-07-07 07:19:05', '2022-09-26 11:52:49', 'ans_d'),
(1297, NULL, 36, 1, '<p><strong>Moderate conscious sedation is included or &quot;bundled&quot; in codes listed in&nbsp;&nbsp;</strong></p>', 'Appendix G', 'Appendix L', 'Appendix M', 'Appendix K', '2022-07-07 07:19:45', '2022-07-07 07:19:45', 'ans_a'),
(1298, NULL, 36, 1, '<p><strong>What is used for skeletal traction is:&nbsp;&nbsp;</strong></p>', 'Wire and pin', 'Screw', 'Clamp', 'All of the above', '2022-07-07 07:29:57', '2022-07-07 07:29:57', 'ans_d'),
(1299, NULL, 36, 1, '<p><strong>Use both _____ and _____ when locating and assigning a diagnosis code.&nbsp;</strong></p>', 'Alphabetic Index and Appendix C', 'ICD-10-CM code book and Dictionary', 'Alphabetic Index and Tabular List', 'Tabular List and Index to Procedures', '2022-07-07 07:31:37', '2022-08-02 07:12:10', 'ans_c'),
(1300, NULL, 36, 1, '<p><strong>When a patient has a condition that is both acute and chronic and there are separate entries for both, how&nbsp; is it reported?&nbsp;</strong></p>', 'Code only the acute code', 'Code both sequencing the chronic first', 'Code both sequencing the acute first', 'Code only the chronic code', '2022-07-07 07:32:33', '2023-09-18 06:00:41', 'ans_c'),
(1301, NULL, 36, 1, '<p><strong>A patient with chronic back and neck pain developed a drug dependency on oxycodone (opoid). After&nbsp; being taken off the drug, he was seen in the clinic for withdrawal symptoms. What ICD-10-CM codes are reported?&nbsp;</strong></p>', 'F11.10, F19.939', 'F19.939, F11.10', 'F19.939, F11.20', 'F11.20, F19.939', '2022-07-07 07:34:00', '2022-07-07 07:34:00', 'ans_c'),
(1302, NULL, 36, 1, '<p><strong>A patient with metastatic bone cancer (primary site unknown) presents to the oncologist&rsquo;s office for a&nbsp; chemotherapy treatment. On examination, the oncologist finds the patient to be severely dehydrated and&nbsp; cancels the chemotherapy. The patient will receive intravenous hydration in the office and reschedule the&nbsp; chemotherapy treatment. What ICD-10-CM codes are reported?&nbsp;</strong></p>', 'C41.9, E86.0, C80.1', 'E86.0, C79.51, C80.1', 'C79.51, E86.0', 'E86.0, C80.1, C79.51', '2022-07-07 07:34:47', '2022-07-07 07:34:47', 'ans_b'),
(1303, NULL, 36, 1, '<p><strong>&nbsp;22-year-old developed gas gangrene (gas bacillus infection) and went into septic shock after a surgical&nbsp; procedure. What ICD-10-CM codes should be reported?&nbsp;</strong></p>', 'R65.20, T81.12XA, A48.0', 'R65.21, A48.0', 'R65.21, R65.20', 'A48.0, T81.12XA,  R65.21', '2022-07-07 07:36:07', '2023-05-19 09:07:41', 'ans_d'),
(1304, NULL, 36, 1, '<p><strong>A patient with hypertensive heart disease is now experiencing accelerated hypertension due to papillary&nbsp; muscle dysfunction. What ICD-10-CM code(s) should be reported?&nbsp;</strong></p>', 'I11.9', 'I11.9, I51.89', 'I10, I51.89', 'I13.10, I51.89', '2022-07-07 07:36:43', '2022-07-07 07:36:43', 'ans_a'),
(1305, NULL, 36, 1, '<p><strong>A three-year-old is brought to the burn unit after pulling a pot of hot soup off the stove spilling onto to her&nbsp; body. She sustained 18% second degree burns on her legs and 20% third degree burns on her chest and arms. Total body surface area burned is 38%. What ICD-10-CM codes should be reported for the burns?</strong></p>', 'T24.209A, T22.30XA, T24.209A,  T31.33', 'T21.31XA, T22.30XA, T24.209A,  T31.33', 'T21.31XA, T22.30XA, T24.209A, T31.32', 'T24.209A, T22.30XA, T24.209A', '2022-07-07 07:37:24', '2022-07-07 07:37:24', 'ans_c'),
(1306, NULL, 36, 1, '<p><strong>&nbsp;Newborn twin girls delivered at 27 weeks, weighing 850 grams for twin A and 900 grams for twin B. Both were diagnosed with extreme immaturity. What ICD-10-CM codes should be reported for both&nbsp; twins?&nbsp;</strong></p>', 'P07.03, Z38.30', 'Z38.30, P07.03, P07.26', 'P07.03, P07.26, Z38.30', 'Z38.30, P07.26', '2022-07-07 07:37:56', '2022-07-07 07:37:56', 'ans_b'),
(1307, NULL, 36, 1, '<p><strong>Baby boy is born by cesarean section in the hospital. The mother has a history of diabetes mellitus, which&nbsp; complicated the management of her pregnancy. In addition, the mother abused cocaine throughout her&nbsp; pregnancy. The newborn was monitored for drug withdrawal, however no symptoms were noted and the&nbsp; toxicology report came back negative. ABO incompatibility was documented, but the Coomb&#39;s test was&nbsp; negative. What ICD-10-CM codes should be reported for the newborn&rsquo;s record?&nbsp;</strong></p>', 'O24.913, E11.9, O99.343, F14.10. V30.01', 'Z38.01, Z05.8', 'Z38.01, P70.0, Z05.8', 'P96.1, P55.1, Z38.01', '2022-07-07 07:38:53', '2022-07-07 07:38:53', 'ans_b'),
(1308, NULL, 36, 1, '<p><strong>The diagnostic statement indicates respiratory failure due to administering incorrect medication. Valium&nbsp; was administered instead of Xanax. What ICD-10-CM codes should be reported?&nbsp;</strong></p>', 'T42.4X2A, J96.90', 'J96.90, T42.4X1A', 'T42.4X1A, J96.90', 'T42.4X1D, J96.90', '2022-07-07 07:39:44', '2022-07-07 07:39:44', 'ans_c'),
(1309, NULL, 36, 1, '<p><strong>year‐old had a history of adenocarcinoma of the cervix on a conization in March 20XX&nbsp; who has been followed with twice‐yearly endocervical curettages and Pap smears that were&nbsp; all negative for two years, per the recommendation of a GYN oncologist. Her Pap smear&nbsp; results from the last visit noted atypical glandular cells. In light of this, she underwent a&nbsp; colposcopy and the biopsy of the normal‐appearing cervix on colposcopy was benign. The&nbsp; endocervical curettage was benign endocervical glands, and the endometrial sampling was&nbsp; benign endometrium. In light of the fact that she had had previous atypical glandular cells&nbsp; that led to diagnosis of adenocarcinoma and the concerns that this may have recurred, she&nbsp; had been recommended for a cone biopsy and fractional dilatation and curettage, which she&nbsp; is undergoing today. What ICD‐10‐CM code(s) should be reported?&nbsp;</strong></p>', 'R87.619, C53.9', 'C55', 'R87.619, Z85.41', 'Z12.4, Z85.41', '2022-07-07 07:41:00', '2022-09-26 12:00:24', 'ans_c'),
(1310, NULL, 36, 1, '<p><strong>Patient comes into see her primary care physician for a productive cough and shortness of&nbsp; breath. The physician takes a chest X‐ray which indicates the patient has double pneumonia.&nbsp; Select the ICD‐10‐CM code(s) for this visit.&nbsp;</strong></p>', 'J18.9, R05, R06.2', 'R05, R06.2, J18.9', 'J18.9', 'J15.9', '2022-07-07 07:41:41', '2022-07-07 07:41:41', 'ans_c'),
(1311, NULL, 36, 1, '<p><strong>What is the correct way to code a patient having bradycardia due to Demerol that was&nbsp; correctly prescribed and properly administered?&nbsp;</strong></p>', 'T40.2X1A, R00.1', 'T40.2X3A, R00.1', 'R00.1, T40.2X5A', 'R00.1, T40.2X2A', '2022-07-07 07:42:21', '2022-07-07 07:42:21', 'ans_c'),
(1312, NULL, 36, 1, '<p><strong>A patient that has cirrhosis of the liver just had an endoscopy performed showing&nbsp; hemorrhagic esophageal varices. The ICD‐10‐CM codes are reported: </strong></p>', 'I85.01, K74.69', 'I85.11, K74.60', 'K74.60, I85.11', 'I85.00, K74.69', '2022-07-07 07:42:58', '2022-07-07 07:42:58', 'ans_c'),
(1313, NULL, 36, 1, '<p><strong>55‐year‐old‐patient had a fracture of his left knee cap six months ago. The fracture has&nbsp; healed but he still has staggering gait in which he will be going to physical therapy. What&nbsp; ICD‐10‐CM codes are reported?&nbsp;</strong></p>', 'S82.002A, R26.81', 'R26.0, S82.002A', 'S82.092S, R26.0', 'R26.0, S82.002S', '2022-07-07 07:43:37', '2022-07-07 07:43:37', 'ans_d'),
(1314, NULL, 36, 1, '<p><strong>If a ST elevation myocardial infarction (STEMI) converts to a non ST elevation myocardial&nbsp; infarction (NSTEMI) due to thrombolytic therapy, how is it reported, according to ICD‐10‐CM&nbsp; guidelines?&nbsp;&nbsp;</strong></p>', 'As unspecified AMI', 'As a subendocardial AMI', 'As STEMI', 'As a NSTEMI', '2022-07-07 07:44:14', '2022-07-07 07:44:14', 'ans_c'),
(1315, NULL, 36, 1, '<p><strong>Patient is going back to the OR for a re‐exploration L5‐S1 laminectomy for a presumed&nbsp; cerebrospinal fluid leak following a decompression procedure. A small partial laminectomy&nbsp; was slightly extended, however revealed no real evidence of leak. Valsalva maneuver was&nbsp; performed several times, no evidence of leak. There was a hematoma, which was drained.&nbsp; What ICD‐10‐CM code(s) should be reported by the physician?&nbsp;</strong></p>', 'G96.0', 'G97.51', 'G96.8', 'G96.0, T81.4XXA', '2022-07-07 07:44:50', '2022-07-07 07:44:50', 'ans_b'),
(1316, NULL, 36, 1, '<p><strong>A patient that has hypertensive heart disease with congestive heart failure is coded:</strong></p>', 'I11.0, I50.9', 'I13.0', 'I13.0, I11.0, I50.9', 'I50.9, I11.0', '2022-07-07 07:45:28', '2022-07-07 07:45:28', 'ans_a'),
(1317, NULL, 38, 1, '<p>Bill, a retired U.S. Air Force pilot, was on observation status 12 hours to assess the outcome of<br />\r\na fall from the back of a pickup truck into a gravel pit. The physician discharged Bill from<br />\r\nobservation that same day after determining that no further monitoring of his condition was<br />\r\nnecessary. The physician provided a comprehensive history and examination and indicated that<br />\r\nthe medical decision making was of a low complexity.</p>', '99235, Z04.9, W18.30XA', '99234, Z04.3, W17.2XXA', '99239, Z04.3, W18.30XA', '99234, 99217, Z04.3, W17.2XXA', '2022-07-14 05:38:41', '2023-04-14 08:24:48', 'ans_b'),
(1318, NULL, 38, 1, '<p>Dr. Martin admits a 65-year-old patient to the hospital with acute pericarditisfollowing a severe<br />\r\nviral infection. The patient has complained of retrosternal,sharp, intermittent pain of 2 days&amp;#39; duration<br />\r\nthat is reduced by sitting up and leaning forward, accompanied by tachypnea. The physician<br />\r\ncompletes a comprehensive history and physical examination. The physician ordered an<br />\r\nelectrocardiogram, x-rays, and routine laboratory workup. The physician considers the multiple<br />\r\ndiagnoses of pericarditisfollowing infection, unstable angina, dissecting aneurysm, pulmonary<br />\r\ninfarction, or esophageal disease, indicating a high level of medical decision making complexity.</p>', '99236, R07.2, R06.82', '99223, I30.0, I20.0, I72.9, I26.99, K22.9', '99245, I30.0, I20.0, I72.9, I26.99, K22.9', '99223, R07.2, R06.82', '2022-07-14 05:39:36', '2022-07-14 05:39:36', 'ans_d'),
(1319, NULL, 38, 1, '<p><strong>A gynecologist admits&nbsp;a&nbsp;35 year old female established patient&nbsp;with dysfunctional uterine bleeding&nbsp; (DUB), after seeing her in the clinic that day (MDM-High complaxity on office visit). History and Examination was&nbsp;medically appropriate during the history and physical visit. &nbsp;The prolonged hemorrhaging has resulted in a&nbsp;very thin and friable endometrial lining. The physician orders the patient to be started on intravenous&nbsp; Premarin and orders a full laboratory workup. The medical decision making is of moderate complexity.</strong></p>', '99215, 99222, Z87.42, Z80.49', '99222, N92.0, Z87.42, Z80.49', '99215, 99222, N89.8, Z87.42, Z80.49', '99222, N91.5, Z80.49', '2022-07-20 04:48:32', '2023-04-14 08:32:40', 'ans_b'),
(1320, NULL, 38, 1, '<p><strong>&nbsp;Dr. David admits a patient with an 8-day history of a low-grade fever, tachycardia, tachypnea, and basal&nbsp; consolidation of the lung and limited pleural effusion on the left side. An extensive past, family, and social&nbsp; history is taken as part of a comprehensive history. Bowel sounds are feeble. The pulse is rapid and thready.&nbsp; The comprehensive examination further indicates a jaundiced appearance with distention of the abdomen. There is a bluish discoloration of the flanks. The physician orders laboratory tests and radiographic studies,&nbsp; including an abdominalsonogram as he considers the extensive diagnostic options and the medical decision&nbsp; making complexity is high for this patient.&nbsp;</strong></p>', '99233, R50.9, R00.0, R06.82, J91.8, R19.15', '99233, R50.9, I47.1, R06.82, J18.9, J91.8', '99223, R50.9, R00.0, R06.82, J13', '99223, R50.9, R00.0, R06.82, J91.8, R19.15', '2022-07-20 04:49:07', '2023-04-14 08:33:18', 'ans_d'),
(1321, NULL, 38, 1, '<p><strong>Dr. Stephanopolis makes subsequent hospital visits to Salanda Ortez, who has been in the hospital for&nbsp; primary viral pneumonia. She was experiencing severe dyspnea, rales, fever, muscle aches, and chest pain.&nbsp; The chest radiography showed patchy bilateral infiltrates and basilar streaking. Sputum microbiology was positive for a secondary bacterial pneumonia. The physician conducted an interval history focused on the&nbsp; patient&#39;s current problems and continued to do a problem-focused physical examination. The medical&nbsp; decision making was straightforward, and the patient was given intravenous antibiotic to address the&nbsp; bacterial pneumonia.&nbsp;</strong></p>', '99231, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99231, J15.8', '99221, R06.00, R09.89, R50.9, M79.1, R07.9, R91.8, R89.9', '99234, J15.8', '2022-07-20 04:49:49', '2022-07-20 04:49:49', 'ans_b'),
(1322, NULL, 38, 1, '<p>A 57-year-old male was sent by his family physician to a urologist for an office consultation. The patient has had bright red blood in his urine sporadically for the past 3 weeks. The urologist obtains a medically appropriate history from the patient and continues with physical examination. The urologist recommends a cystoscopy to be scheduled for the following week and discusses the procedure and risks with the patient. The physician spent a total time of 35&nbsp;mins with the patient. Report the CPT code(s) for the service.</p>', '99243-57', '99243-57, 52000', '99243', '99203', '2022-07-20 04:50:37', '2023-10-09 02:22:20', 'ans_d'),
(1323, NULL, 38, 1, '<p><strong>A neurological consultation in the emergency department of the local hospital is requested for a 25- year-old male with suspected closed head trauma. The patient had a loss of consciousness(LOC) this morning&nbsp;after receiving a blow to the head in a high school basketball game. He presents to the emergency&nbsp;department with a headache, dizziness, and confusion. During the history, the girlfriend&nbsp;relates that the patient has been very irritable and confused since the incident. Physical examination reveals&nbsp;the patient to be unsteady and exhibit difficulty in concentration when stating monthsin reverse. The pupils&nbsp;dilate unequally. The physician continues with the physical examination involving an extensive review of&nbsp;</strong><strong>neurological function. The neurologist orders a stat CT and MRI. The radiological exam shows a subdural hematoma and the physician made a decision of evacuation of hematoma by craniotomy.</strong></p>', '99285', '99253', '99245', '99255', '2022-07-20 04:51:22', '2023-10-05 02:39:11', 'ans_c'),
(1324, NULL, 38, 1, '<p><strong>An obstetrician is requested to provide an office consultation to a 23-year-old female with first- trimester bleeding. The patient presents with a history of brownish discharge and occasional pinkish discharge. During the history, the patient relates that she has had suprapubic pain in the past week and&nbsp;cramping. She has felt nausea and has vomited on three occasions. On one occasion, the nausea was accompanied by dizziness and vertigo. The physician conducts a physical examination focused on the&nbsp;patient&#39;s chief complaint. The uterus is found to be soft and involuted. There is cervical motion tenderness and significant abdominal tenderness on palpation. A left pelvic mass is palpated in the left quadrant. The&nbsp;physician orders a pelvic ultrasound, a complete CBC, and differential. The physician spent 45 minutes with the patient.&nbsp;</strong></p>', '99255', '99244', '99245', '99235', '2022-07-20 04:51:53', '2023-10-05 02:57:22', 'ans_b'),
(1325, NULL, 38, 1, '<p><strong>A 56-year-old established male patient presents to his family physician for a neck cyst checkup at the outpatient clinic. The physician conducts a detailed history and physical examination, and the checkup takes 35 minutes.&nbsp;</strong></p>', '99214', '99403', '99386', '99396', '2022-07-20 04:52:27', '2022-08-04 11:54:25', 'ans_a'),
(1326, NULL, 38, 1, '<p><strong>Karra Hendricks, a 37-year-old female, is an established patient who presents to the office with pain in&nbsp;the RLQ with fever. The physician takes a medically appropriate&nbsp;history and examination. The patient was asked to start Meftal and ciplox for 3 days.&nbsp;The physician orders ultrasound of the abdomen locally targeted to the painfull area and ordered CBC if pain does not decreas after 3 days and&nbsp;and was asked to return to office after 3 days with the reports, if required.</strong></p>', '99203', '99213', '99214', '99221', '2022-07-20 04:52:57', '2023-10-05 03:09:20', 'ans_c'),
(1327, NULL, 38, 1, '<p><strong>Garry, a 4-year-old male, was brought to the emergency department by his mother, where Dr. Black, the&nbsp; emergency department physician, examined the child. Dr. Black has not provided service to this child in the&nbsp;past. During the history, the mother stated that the child has had a temperature of 101&ordm; F for&nbsp;the past 24 hours, has been very fussy, and has been pulling on his left ear. The physician examined the child&nbsp;during and diagnosed otitis media, for which he prescribed a 10-day course of amoxicillin.&nbsp;</strong></p>', '99222', '99241', '99283', '99284', '2022-07-20 04:53:24', '2023-10-05 03:16:40', 'ans_c'),
(1328, NULL, 38, 1, '<p><strong>Dr. Marks provided the first month of care planning oversight for home care of a 64-year-old male&nbsp;patient with advanced pancreatic cancer. He developed a plan that included home oxygen, intravenous&nbsp;diuretics, and pain control management by means of intravenous morphine. The time spent in the low intensity oversight for the month was 45 minutes.</strong></p>', '99378', '99374', '99375', '99380', '2022-07-20 04:53:52', '2023-10-05 03:48:10', 'ans_c'),
(1329, NULL, 38, 1, '<p><strong>A 61-year-old patient was diagnosed last year with obstructive sleep apnea. It has been two years from&nbsp;her last visit. A new doctor in the same specialty group will be examining her. The physician performs a&nbsp;medically appropriate history &amp; examination. Physican reviewed previously performed lab results and chest X ray and ordered a sleep study for the problem, also he prescribed Acetazolamide. The&nbsp; level of service for the encounter is:</strong></p>', '99221', '99205', '99214', '99215', '2022-07-20 04:54:22', '2023-10-04 01:48:02', 'ans_c'),
(1330, NULL, 38, 1, '<p><strong>Patient comes in to the ED with chest pain and severe shortness of breath. The ED physician&nbsp;performs a medically appropriate history and&nbsp;examination. Physician&nbsp;ordered for Chest X-ray and Echo,&nbsp;the report confirms 5% EF and EKG confirms&nbsp;Acute MI of enterior wall. ED physician started some IV medications. ED Physician transfers the patient to IP and handed over to cardiologist next day.&nbsp;What CPT code should&nbsp; be reported for ED physician?</strong></p>', '99223', '99222', '99285', '99284', '2022-07-20 04:54:52', '2023-05-31 00:28:36', 'ans_c'),
(1331, NULL, 38, 1, '<p><strong>Dr. X requests an endocrinologist to take over treatment for his patient with a new diagnosis of Type 1&nbsp;diabetes mellitus. The endocrinologist sees the patient on day 2 of a hospital admission. He performs a&nbsp;medically appropriate history and exam. He evaluates the patient&#39;s newly diagnosed type 1 diabetes and orders&nbsp;blood glucose levels to continue to be monitored TID. He prescribes Humulin for the patient on second day which she will&nbsp;start receiving during the hospital admission, the endocrinologist performs a moderate MDM and his observations indicate that the patient&#39;s glucose levels are still&nbsp; erratic and adjusts the insulin dosage.&nbsp;</strong></p>\r\n\r\n<p><strong>What CPT code should be reported by the endocrinologist for these two days?</strong></p>', '99231, 99232', '99233, 99232', '99243, 99242', '99254, 99252', '2022-07-20 04:55:23', '2023-10-05 04:43:18', 'ans_a'),
(1332, NULL, 38, 1, '<p><strong>A 15 year old boy is a new&nbsp;patient scheduled for his&nbsp;yearly physical with pediatrician.&nbsp;</strong></p>\r\n\r\n<p><strong>During his examination for the physical he discovers lesions on his&nbsp;legs and arms. The physician performs a&nbsp;medically appropriate History and Physical exam and additional documentation on the lesions providing a&nbsp;moderate complexity medical decision making. What CPT code(s) is/are reported for this visit?&nbsp;&nbsp;</strong></p>', '99394, 99214-25', '99394-25, 99214', '99384, 99204-25', '99213-25', '2022-07-20 04:56:15', '2023-10-05 04:45:08', 'ans_c'),
(1333, NULL, 24, 1, '<p><strong>A Medicare patient is seen by the nurse for a pneumonia vaccination. The physician reviews the chart&nbsp; and signs off on the nurse&#39;s note. What procedure and diagnosis codes should be used?</strong></p>', '90471, 90670', 'G0009, 90670', '99211-25, G0008, 90656', 'G0008, 90656', '2022-07-20 04:56:51', '2022-08-03 10:00:47', 'ans_b'),
(1334, NULL, 38, 1, '<p><strong>Primary Care Provider: Bryan (Internal Medicine)</strong></p>\r\n\r\n<p><strong>Physician Service Provided and Documented by: Oram (Internal Medicine)</strong></p>\r\n\r\n<p><strong>Patient: Ramsy&nbsp;</strong></p>\r\n\r\n<p><strong>DOS: 1/2/2011&nbsp;</strong></p>\r\n\r\n<p><strong>Patient is a 26 year old female new to our group practice. She has symptoms indicative of gastritis with&nbsp;increasing abdominal bloating. I have been contracted as a locum tenum to substitute for Dr. Bryan while&nbsp;he is on vacation for two weeks. What CPT code should be reported?&nbsp;</strong></p>', '99211', '99212-Q6', '99202', '99202-Q6', '2022-07-20 04:57:21', '2023-10-05 04:50:04', 'ans_d'),
(1335, NULL, 38, 1, '<p><strong>A 16-year-old female has just moved to the area from out of state. She has numerous problems and is&nbsp;seen for evaluation and management. The physician documents a medically appropriate history and physical. He reviews complex and detailed medical records from&nbsp;her previous physicians and completes treatment plan.&nbsp;After the visit the physician spends an additional time in&nbsp;a prolonged discussion with the patient&#39;s parents. Physician spent a total time 40 minutes during the visit. He personally initiates the care&nbsp;plan with the local health agency and a dietician.&nbsp;</strong></p>\r\n\r\n<p><strong>What is the correct CPT Code(s) for this visit?</strong></p>', '99204, 99358', '99204', '99203', '99203, 99358', '2022-07-20 04:57:51', '2023-10-05 05:04:41', 'ans_c'),
(1336, NULL, 38, 1, '<p><strong>A patient returns to the physician&#39;s office to see the nurse for a urine dip stick. The patient finished a&nbsp; course of antibiotics for UTI and physician wants to check his urine to make sure the infection is gone. The&nbsp; patient states he still see blood in his urine and frequent urination. The nurse performs a U/A dip and&nbsp;microscopic exam and the test comes back positive. The patient is given another prescription for the UTI.&nbsp;The physician documents the findings and sign off on the nurse&#39;s note.</strong></p>\r\n\r\n<p><strong>What E/M and diagnosis codes should be used?&nbsp;</strong></p>', '99212, 81002', '99211, 81002', '99212, 81000', '99211, 81000', '2022-07-20 04:58:28', '2023-10-06 02:05:14', 'ans_d'),
(1337, NULL, 38, 1, '<p><strong>Patient presents to the physician&rsquo;s office for the first time in 2.5 years with coughing. The physician&nbsp; performs medically appropriate history &amp; exam. Physician ordered chest X-ray AP &amp; Lat view.&nbsp;After reviewing the results of X-ray he assesses&nbsp;the patient with cough-variant asthma with acute exacerbation and GERD. He asked patient to revisit after 2 days.&nbsp;</strong></p>\r\n\r\n<p><strong>What are the appropriate E/M&nbsp;code(s) for this service?&nbsp;</strong></p>', '99203', '99213', '99214', '99215', '2022-07-20 04:58:53', '2023-10-06 02:35:44', 'ans_b'),
(1338, NULL, 38, 1, '<p><strong>How much time of complex chronic care management must be performed and documented to code&nbsp; 99487, and 99489x2?</strong></p>', '90 minutes', '120 Minutes', '150 minutes', '60 minutes', '2022-07-20 04:59:30', '2023-10-06 02:38:30', 'ans_b'),
(1339, NULL, 24, 1, '<p><strong>A patient that is allergic to peanuts is coming to the allergist&#39;s office for his allergy injection. The patient brings his own supply of the allergy serum and gives it to the nurse. 2 injections are provided by&nbsp;nurse What CPT code is reported?&nbsp;</strong></p>', '95120', '95115', '95117', '95144', '2022-07-20 05:00:08', '2023-10-06 02:41:45', 'ans_c'),
(1340, NULL, 28, 1, '<p><strong>A 65-year-old female has had several episode of tightness in the chest. Her physician ordered a PTCA&nbsp; of the RCA and left anterior descending coronary artery. The procedure revealed atherosclerosis in the&nbsp; native vessels. It was determined a stent would be required in RCA and atherectomy in LAD to keep the&nbsp; arteries open. The stent was inserted during the procedure. What CPT and diagnosis codes are reported? </strong></p>', '92928-LD', '92920-LD, 92929-59', '92924-LD, 92928-RC', '92920-LD, 92928-59', '2022-07-20 05:01:08', '2022-08-03 10:02:08', 'ans_c'),
(1341, NULL, 24, 1, '<p><strong>The physician evaluates a 28-year-old established patient to determine if the patient&#39;s hemodialysis&nbsp; access is functioning properly. The access flow study was performed via duplex scan and found to be within&nbsp; normal range at 0.40. What Code(s) should the physician report for the services?</strong></p>', '90937, 36861', '93990', '90935, 36860', '90940', '2022-07-20 05:01:44', '2022-08-03 10:02:29', 'ans_b'),
(1342, NULL, 24, 1, '<p><strong>An ear, nose and throat (ENT) specialist conducts cochlear function studies on a new patient who is&nbsp; being examined for hearing loss. Electrocochleography determines the patient has a central perforation of&nbsp; tympanic membrane. Which CPT codes would be used to report the encounter?&nbsp;</strong></p>', '92601', '92603', '92584', '92652', '2022-07-20 05:02:12', '2022-08-03 10:02:45', 'ans_c'),
(1343, NULL, 38, 1, '<p><strong>A physician assistant counsels a mother about the importance of a vaccinations and administers the&nbsp; DTaP by intramuscular route, MMRV live immunization by subcutaneous route and Hib, (PRP-OMP&nbsp;conjugate) by intramuscular route to a three-year-old new patient during a well &ndash;baby check. What are the&nbsp;CPT codes for this encounter?&nbsp;</strong></p>', '99382-25, 90700, 90707, 90647, 90460 x 3, 90461 x 4', '99382-25, 90700, 90710, 90647, 90460 x 3, 90461 x 5', '99392-25, 90700, 90707, 90472 x 3', '99213-25, 90707, 90721, 90460, 90461 x2', '2022-07-20 05:02:44', '2023-10-09 01:07:46', 'ans_b'),
(1344, NULL, 24, 1, '<p><strong>A patient presents to the oncology office for her scheduled chemotherapy. She receives a total of 7&nbsp; intralesional injections in Kaposi sarcoma of lymphatic node.&nbsp;</strong></p>', '96406', '96405', '96405x7', '96406x7', '2022-07-20 05:03:19', '2022-08-03 10:03:01', 'ans_b'),
(1345, NULL, 24, 1, '<p><strong>An ophthalmologist conducts an extended visual field examination with automated threshold&nbsp; perimetry. The patient and requesting physician receive the interpretation and report on the same date of&nbsp; service. What code should be reported for the procedure?</strong></p>', '92100', '0198T', '99212', '92083', '2022-07-20 05:03:49', '2022-08-03 10:03:22', 'ans_d'),
(1346, NULL, 24, 1, '<p><strong>A patient is referred to the hospital radiology clinic for numbness and tingling in the both arms. The&nbsp; physician suspects it is related to thoracic outlet syndrome. The radiologist performs a Doppler analog&nbsp; waveform analysis by plethysmography and a flow velocity signal of the arteries of both arms. A duplex&nbsp; scan of both arms is also performed.&nbsp;</strong></p>\r\n\r\n<p><strong>What procedure codes should be used to report the professional services for this encounter?</strong></p>', '93922-TC, 93930-26', '92922-52-TC', '93922-26, 93930-26', '93922-52-26, 93931-26', '2022-07-20 05:12:05', '2022-08-03 10:04:50', 'ans_c'),
(1347, NULL, 24, 1, '<p><strong>IV hydration codes 96360-96361 report&nbsp;</strong></p>', 'IV hydration administered to keep an IV line open.', 'Infusion of drug or other substances.', 'Infusion of pre-packaged fluid and electrolytes', 'Infusion of chemotherapy or other therapeutic agents.', '2022-07-20 05:12:42', '2022-08-31 09:32:58', 'ans_c'),
(1348, NULL, 24, 1, '<p><strong>Eight year old bobby is seen by his urologist for ESRD related services on September 4, 10, 15 and 28,&nbsp; 2018. The provider evaluates Bobby&#39;s nutritional intake, assesses his growth and development and&nbsp; counsels with Bobby&#39;s parents answering their questions and providing care instructions. What is the&nbsp; correct CPT code for this encounter?&nbsp;</strong></p>', '90954', '90952', '90955', '90956', '2022-07-20 05:17:35', '2022-08-03 10:06:15', 'ans_a'),
(1349, NULL, 38, 1, '<p><strong>Dr. Lyon was called to the critical care burn unit to see a 50-year-old patient who suffered third-degree&nbsp;burns to 30% of her body. Dr. Lyon spent two hours and 40 minutes with this patient, her family, and&nbsp;coordinating care with other specialists. He made several phone calls from the unit on her behalf and&nbsp;consulted with the nursing staff. During this time, Dr. Lyon provided ventilator management and gastric&nbsp;intubation. What codes correctly capture Dr. Lyon&#39;s services?</strong></p>', '43752, 94656, 99291x1, 99292x3', '99291x2, 99292x2', '99291, 99292x3', '43753, 94656-51, 99291x1, 99292x3', '2022-07-20 05:18:19', '2023-10-09 01:11:37', 'ans_c'),
(1350, NULL, 38, 1, '<p><strong>Edna, an 80-year-old patient, had a stroke with late effect hemiplegia to her right dominant side. She&nbsp;was transferred from the hospital to a nursing facility. Dr. George, an internist, is called to see Edna and&nbsp;provides a multi-system examination, comprehensive history, and reviews an extensive amount of data. She&nbsp;documents the high risk of complications due to extensive medications and management of multiple&nbsp;systemic diseases. Dr. George talks with the multidisciplinary rehabilitation team regarding Edna&#39;s physical&nbsp;activities; including a plan for physical therapy. What are the correct codes for Dr. George&#39;s visit?</strong></p>', '99306, I69.951', '99306, G81.91', '99305, G81.93', '99306, I69.953', '2022-07-20 05:18:55', '2023-10-09 01:24:31', 'ans_a'),
(1351, NULL, 38, 1, '<p><strong>Harry moved back to the area after being out-of-state for six years. He returns as a patient to Dr. Oram, his&nbsp;previous internist. Dr. Oram&nbsp;sees Harry in the office for an evaluation of his asthma. Dr. Oram documents a&nbsp;medically appropriate history &amp; physical examination and trained on some breathing exersices. Several hours after Harry left&nbsp; the office he returns because he is having difficulty breathing and has hives after using his new inhaler. Dr.&nbsp;Oram admits Harry to the hospital. He dictates a medically appropriate history &amp; examination, and high&nbsp;decision making in the admission report and spent 80 mins with the patient to evaluate and mage the condition. Additionally, Dr. Oram instructs his staff to fax a copy of his office&nbsp;note to include in the hospital record for admission. What code(s) correctly capture Dr. Oram&#39;s service?&nbsp;</strong></p>', '99203', '99203, 99223', '99223', '99203-25, 99223', '2022-07-20 05:19:51', '2023-10-09 01:33:56', 'ans_c'),
(1352, NULL, 38, 1, '<p><strong>A healthy 22-year-old female is seen for her annual examination. She is new to this clinic and this&nbsp;physician. She is taking no medication, has no family history of systemic disease, and states that she is&nbsp;smoking but trying to stop. During her annual exam she asks the physician to look at a mole on her upper&nbsp;right arm that has changed in appearance. The physician works up the mole, taking an additional clinically appropriate&nbsp;history &amp; examination. The&nbsp;physician instructs her to watch the mole carefully and report any further changes. What code(s) correctly&nbsp;capture this encounter?&nbsp;</strong></p>', '99285', '99385-25, 99202', '99385, 99202-25', '99203', '2022-07-20 05:20:39', '2023-10-09 01:37:37', 'ans_c'),
(1353, NULL, 38, 1, '<p><strong>Two weeks ago Mrs. Randy, a 62-year-old insulin dependent diabetic, trimmed her toenails and cut the&nbsp;skin around her right great toe. She tried to keep the wound clean and applied over-the-counter antibiotic&nbsp;cream for several days before the pain and inflammation was too severe to wear shoes. Today, Dr. French&nbsp; admitted Mrs. Randy to the hospital. Dr. French requested a consult from Dr. Wells, a surgeon, regarding&nbsp;possible amputation of the toe. Dr. Wells saw Mrs. Randy and provided a medically appropriate history &amp; examination. Her documentation included the request for&nbsp;consult and a written statement back to Dr. French. After the toe was amputated, Mrs. Randy healed without&nbsp; further complications and was discharged by Dr. French. It took Dr. French more than an hour to complete&nbsp;the discharge visit. What code(s) correctly capture the discharge?</strong></p>', '99254-25, 28820', '99239', '99239 X 2', '99223', '2022-07-20 05:21:35', '2023-10-09 01:41:25', 'ans_b'),
(1354, NULL, 38, 1, '<p><strong>Donald&#39;s family requested a consultation for a second opinion with Dr. Polson, an oncologist. The family&nbsp;completed extensive research on the Internet and looked for an opinion regarding a new type of lung cancer&nbsp;treatment. Donald&#39;s current physician has recommended a surgical and chemotherapy treatment approach&nbsp;to the metastasis of the lung. Dr. Polson has not seen Donald in the past and evaluates him for throat and&nbsp;bilateral lung lesions. Dr. Polson documented a medically appropriate&nbsp;examination &amp; history, and&nbsp;reviewed extensive management options, extensive data and the risk of complications and mortality.&nbsp; Dr. Polson spends 90 minutes face-to- face with the patient, then an additional 45 minutes with the patient&nbsp; and his family explaining their options. What codes correctly capture Dr. Polson&#39;s services?</strong></p>', '99205, 99417x4', '99215, 99417x4', '99215, 99417x4-25', '99205-25, 99417', '2022-07-20 05:22:24', '2023-10-09 01:43:57', 'ans_a'),
(1355, NULL, 38, 1, '<p><strong>Lilly, a 36-year-old female, made an appointment to talk with her physician about prevention of sexually&nbsp; transmitted diseases including HIV. She saw the same physician three months ago for a complete physical.&nbsp;She is asymptomatic at this time but has engaged in some high-risk behavior. During this visit, Lilly discussed&nbsp; diagnostic and laboratory test results, family issues, substance abuse, and sexual practices. The visit lasted 30&nbsp;minutes. What code correctly captures this encounter?&nbsp;</strong></p>', 'This service is bundled with the next office visit', '99395', '99078', '99402', '2022-07-20 05:23:07', '2023-10-09 02:03:13', 'ans_d'),
(1356, NULL, 38, 1, '<p><strong>Dr. Parrish, a pediatrician, continues to follow Rachel, who is not critically ill but requires intensive&nbsp; cardiac and respiratory monitoring, frequent checks of her vital signs, nutritional adjustments, and oxygen&nbsp; monitoring. Rachel is 32-days-old with a current weight of 3,200 grams. Dr. Parrish saw Rachel three&nbsp;separate times on Tuesday. What code correctly captures Tuesday&#39;s services?&nbsp;</strong></p>', '99471', '99477', '99480 X 3', '99480', '2022-07-20 05:23:49', '2023-10-09 02:28:47', 'ans_d'),
(1357, NULL, 38, 1, '<p><strong>Pediatric critical care patient transport includes:&nbsp;</strong></p>', 'Chest x-rays', 'Cardiac output measurement', 'Insertion of a biventricular pacing device.', 'None of the above', '2022-07-20 05:25:12', '2022-07-20 05:25:12', 'ans_d'),
(1358, NULL, 38, 1, '<p><strong>A 25-year-old female presented to a physician&#39;s office complaining of persistent abdominal pain. This&nbsp; patient is new to this practice and this physician. The physician took a medically appropriate history and examination. Medical decision-making was of moderate complexity. The physician spent&nbsp;approximately 50 minutes with the patient. The physician spent 15 of those minutes counseling the patient&nbsp;on dietary changes. What code correctly captures this encounter?&nbsp;</strong></p>', '99205', '99214', '99204', '99215', '2022-07-20 05:26:42', '2023-10-09 04:01:40', 'ans_c'),
(1359, NULL, 38, 1, '<p><strong>Subjective: Six-year-old girl twisted her arm on the play ground. She is seen in the ED complaining of&nbsp; pain in her wrist.&nbsp;</strong></p>\r\n\r\n<p><strong>Objective: Vital Signs: stable. Wrist: Significant tenderness laterally. X-ray is normal Assessment: Wrist sprain&nbsp;</strong></p>\r\n\r\n<p><strong>Plan: Over the counter Anaprox. give twice daily with cold&nbsp;packs for next 3 days. Recheck if no improvement.&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What is the E/M code for this visit?&nbsp;</strong></p>', '99221', '99284', '99241', '99281', '2022-07-20 05:27:25', '2023-10-09 04:02:38', 'ans_d'),
(1360, NULL, 38, 1, '<p><strong>An infant is born six weeks premature in rural Arizona and the pediatrician in attendance intubates the&nbsp; child and administers surfactant in the ET tube while waiting in the ER for the air ambulance. During the 45 minute wait, he continues to bag the critically ill patient on 100 percent oxygen while monitoring VS,&nbsp; ECG, pulse oximetry and temperature. The infant is in a warming unit and an umbilical vein line was placed for fluids and in case of emergent need for medications. What CPT(s) should be coded?</strong></p>', '99291, 31500, 36510, 94610-51', '99291, 31500, 36510, 94610', '99471', '99471, 94610, 36510', '2022-07-20 05:28:02', '2023-10-09 04:06:53', 'ans_b');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1361, NULL, 38, 1, '<p><strong>Mr. Trumph loses his yacht in a poker game and experiences a sudden onset of chest pain which radiates&nbsp; down his left arm. The paramedics are called to the casino he owns in Atlantic City to stabilize him and&nbsp; transport him to the hospital. Dr. H. Art is in the ER to direct the activities of the paramedics. He spends 30 minutes in two-way communication directing the care of Mr. Trumph. When EMS reached the&nbsp; hospital Emergency Department, Mr. Trumph is in full arrest with torsades de pointes (ventricular tachycardia). Dr. H. Art spends another hour stabilizing the patient and performing CPR. What are the appropriate procedure codes for this encounter?&nbsp;</strong></p>', '99288, 99291, 92950', '99291, 99292', '99288, 99291', '99291, 92950, 92960', '2022-07-20 05:28:51', '2022-07-20 05:28:51', 'ans_a'),
(1362, NULL, 38, 1, '<p><strong>Patient comes in today at four months of age for a checkup. She is growing and developing well. Her&nbsp; mother is concerned because she seems to cry a lot when lying down but when she is picked up she is&nbsp; fine. She is on breast milk but her mother has returned to work and is using a breast pump, but hasn&rsquo;t&nbsp; seemed to produce enough milk.&nbsp;</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAM: Weight 12 lbs 11 oz, Height 25in., OFC 41.5 cm. HEENT: Eye: Red reflex normal.&nbsp; Right eardrum is minimally pink, left eardrum is normal. Nose: slight mucous Throat with slight thrush on&nbsp; the inside of the cheeks and on the tongue. LUNGS: clear. HEART: w/o murmur. ABDOMEN: soft. Hip&nbsp; exam normal. GENITALIA normal although her mother says there was a diaper rash earlier in the week. ASSESSMENT&nbsp;</strong></p>\r\n\r\n<p><strong>Four month old well check&nbsp;</strong></p>\r\n\r\n<p><strong>Cold&nbsp;</strong></p>\r\n\r\n<p><strong>Mild thrush&nbsp;</strong></p>\r\n\r\n<p><strong>Diaper rash&nbsp;</strong></p>\r\n\r\n<p><strong>PLAN:&nbsp;</strong></p>\r\n\r\n<p><strong>Okay to advance to baby foods&nbsp;</strong></p>\r\n\r\n<p><strong>Okay to supplement with Similac&nbsp;</strong></p>\r\n\r\n<p><strong>Nystatin suspension for the thrush and creams for the diaper rash if it recurs&nbsp;</strong></p>\r\n\r\n<p><strong>Mother will bring child back after the cold symptoms resolve for her DPT, HIB and polio&nbsp;</strong></p>\r\n\r\n<p><strong>What E/M code(s) is/are reported? </strong></p>', '99212', '99391', '99391, 99212-25', '99213', '2022-07-20 05:30:08', '2023-06-15 00:49:10', 'ans_d'),
(1363, NULL, 38, 1, '<p><strong>28-year-old female patient is returning to her physician&rsquo;s office with complaints of RLQ pain and&nbsp; heartburn with a temperature of 100.2. The physician performs a detailed history, detailed exam and&nbsp; determines the patient has mild appendicitis. The physician prescribes antibiotics to treat the appendicitis&nbsp; in hopes of avoiding an appendectomy. What are the correct CPT&reg; codes for this encounter?&nbsp;</strong></p>', '99214', '99202', '99213', '99203', '2022-07-20 05:30:38', '2022-07-20 05:30:38', 'ans_a'),
(1364, NULL, 38, 1, '<p><strong>Dr. Inez discharges Mr. Blancos from the pulmonary service after a bout of pneumococcal pneumonia. She spends 45 minutes at the bedside explaining to Mr. Blancos and his wife the medications and IPPB&nbsp; therapy she ordered. Mr. Blancos is a resident of the Shady Valley Nursing Home due to his advanced&nbsp; Alzheimer&rsquo;s disease and will return to the nursing home after discharge. On the same day Dr. Inez re admits Mr. Blancos to the nursing facility. She obtains a medically appropriate history &amp; physical examination and spent 30 minutes with the patient to get patient admit. What is/are the appropriate&nbsp; evaluation and management code(s) for this visit?</strong></p>', '99238, 99304', '99238', '99239', '99239, 99304', '2022-07-20 05:31:12', '2023-10-10 00:09:50', 'ans_d'),
(1365, NULL, 38, 1, '<p><strong>37-year-old female is seen in the clinic for follow-up of lower extremity swelling. </strong></p>\r\n\r\n<p><strong>HPI: Patient is here today for follow-up of bilateral lower extremity swelling. The swelling responded to&nbsp;hydrochlorothiazide.&nbsp;</strong></p>\r\n\r\n<p><strong>DATA REVIEW: I reviewed her lab and echocardiogram. The patient does have moderate pulmonary&nbsp;hypertension.&nbsp;</strong></p>\r\n\r\n<p><strong>Exam: Patient is in no acute distress.&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>ASSESSMENT:&nbsp;</strong></p>\r\n\r\n<p><strong>1. Bilateral lower extremity swelling. This has resolved with diuretics, it may be secondary to problem #2.&nbsp;</strong></p>\r\n\r\n<p><strong>2. Pulmonary hypertension: Etiology is not clear at this time, will work up and possibly refer to a&nbsp; pulmonologist.&nbsp;</strong></p>\r\n\r\n<p><strong>PLAN: Will evaluate the pulmonary hypertension. Patient will be scheduled for a sleep study</strong></p>', '99213', '99212', '99214', '99215', '2022-07-20 05:31:47', '2023-10-13 00:11:02', 'ans_a'),
(1366, NULL, 38, 1, '<p><strong>45-year-old established, female patient is seen today at her doctor&rsquo;s office. She is complaining of severe&nbsp; dizziness and feels like the room is spinning. She has had palpitations on and off for the past 12 months.&nbsp; For the ROS, she reports chest tightness and dyspnea but denies nausea, edema, or arm pain. She drinks&nbsp; two cups of coffee per day. Her sister has WPW (Wolff-Parkinson-White) syndrome. An extended exam&nbsp;&nbsp;</strong></p>\r\n\r\n<p><strong>of five organ systems are performed. This is a new problem. An EKG is ordered and labs are drawn, and&nbsp; the physician documents a moderate complexity MDM. What CPT&reg; code should be reported for this&nbsp; visit?&nbsp;</strong></p>', '99214', '99203', '99215', '99204', '2022-07-20 05:32:33', '2022-07-20 05:32:33', 'ans_a'),
(1367, NULL, 38, 1, '<p><strong>33 year-old male was admitted to the hospital on 12/17/XX from the ER, following a motor vehicle&nbsp; accident. His spleen was severely damaged and a splenectomy was performed. The patient is being&nbsp; discharged from the hospital on 12/20/XX. During his hospitalization the patient experienced pain and&nbsp; shortness of breath, but with an antibiotic regimen of Levaquin, he improved. The attending physician&nbsp; performed a final examination and reviewed the chest X-ray revealing possible infiltrates and a CT of the&nbsp; abdomen ruled out any abscess. He was given a prescription of Zosyn. The patient was told to follow up&nbsp; with his PCP or return to the ER for any pain or bleeding. The physician spent 20 minutes on the date of&nbsp; discharge. What CPT&reg; code is reported for the 12/20 visit?&nbsp;</strong></p>', '99221', '99231', '99238', '99283', '2022-07-20 05:33:07', '2022-07-20 05:33:07', 'ans_c'),
(1368, NULL, 38, 1, '<p><strong>60-year-old woman is seeking help to quit smoking. She makes an appointment to see Dr. Lung for an&nbsp; initial visit. The patient has a constant cough due to smoking and some shortness of breath. No night&nbsp; sweats, weight loss, night fever, CP, headache, or dizziness. She has tried patches and nicotine gum,&nbsp; which has not helped. Patient has been smoking for 40 years and smokes 2 packs per day. She has a&nbsp; family history of emphysema. A limited three system exam was performed. Dr Lung discussed in detail&nbsp; the pros and cons of medications used to quit smoking. Counseling and education was done for 20&nbsp; minutes of the 30 minute visit. Prescriptions for Chantrix and Tetracylcine were given. The patient to follow up in 1 month. A chest X-ray and cardiac work up was ordered. Select the appropriate CPT code(s) for this visit.</strong></p>', '99202', '99203', '99203, 99354', '99214, 99354', '2022-07-20 05:33:37', '2022-07-20 05:33:37', 'ans_b'),
(1369, NULL, 38, 1, '<p><strong>5-year-old is brought in to see an allergist for generalized urticaria. The family just recently visited a&nbsp; family member that had a cat and dog. The mother wants to know if her son is allergic to cats and dogs.&nbsp; The child&rsquo;s skin was scratched with two different allergens. The physician waited 15 minutes to check the&nbsp; results. There was a flare up reaction to the cat allergen, but there was no flare up to the dog allergen. The&nbsp; physician included the test interpretation and report in the record.&nbsp;</strong></p>', '95024 x 2', '95027 x 2', '95004 x 2', '95018 x 2', '2022-07-20 05:34:10', '2022-07-20 05:34:10', 'ans_c'),
(1370, NULL, 38, 1, '<p><strong>A patient with hypertensive end stage renal failure, stage V, and secondary hyperparathyroidism is&nbsp;evaluated by the physician and receives peritoneal dialysis. The physician evaluates the patient once&nbsp; before dialysis begins. What CPT&nbsp;code need to be reported?&nbsp;</strong></p>', '90935', '90937', '90945', '90947', '2022-07-20 05:34:43', '2023-10-11 23:32:04', 'ans_c'),
(1371, NULL, 38, 1, '<p><strong>Dr. Todd, a primary care physician, examines Keith for a cough producing phlegm, a low grade fever,&nbsp; and a headache. Keith has been a patient of Dr. Todd&#39;s for several years. Keith had knee surgery by an&nbsp; orthopedic surgeon less than a week ago. He was checked by his orthopedic surgeon one day ago and is&nbsp; healing well from the procedure. His surgeon suggested that he see his primary care physician regarding his&nbsp; other symptoms. Dr. Todd documents an expanded problem-focused history and examination, decision making of low complexity, with a diagnosis of recurrent bronchitis.&nbsp;</strong></p>\r\n\r\n<p><strong>What code captures Dr. Todd&#39;s service?&nbsp;</strong></p>', '99213-24', '99214', '99213-59', '99213', '2022-07-20 05:35:16', '2023-06-21 09:20:55', 'ans_a'),
(1372, NULL, 38, 1, '<p><strong>Mr. Fisher was referred by his internist to a surgeon&#39;s office for a consultation regarding hemorrhoids.&nbsp; The surgeon noted the request for consult in his medical record and sent a letter back to the referring&nbsp; physician. The surgeon completed a detailed history, detailed examination, and low decision-making. The&nbsp; surgeon recommended medical treatment and prescribed two different ointments and an oral medication.&nbsp;</strong><strong>He suggested re-evaluation if the hemorrhoids caused Mr. Fisher problems in the future or if he continued to&nbsp; have active symptoms. What code correctly captures the surgeon&#39;s services?&nbsp;</strong></p>', '99243', '99241', '99203', '99214', '2022-07-20 05:35:56', '2022-07-20 05:35:56', 'ans_a'),
(1373, NULL, 38, 1, '<p><strong>42-year-old patient presented to the urgent care center with complaints of slight dizziness. He had&nbsp; received services at the clinic about 2 years ago. The patient related this episode happened once&nbsp; previously &nbsp; and his 51-year-old brother has a pacemaker. A chest X-ray with 2 views and an EKG with&nbsp; rhythm strip were ordered (equipment owned by the urgent care center). The physician detected no&nbsp; obvious abnormalities, but the patient was advised to see a cardiologist within the next 2 - 3 days. The&nbsp;</strong></p>\r\n\r\n<p><strong>physician interpreted and provided a report for the rhythm strip and Chest X-ray. What CPT&reg; codes are&nbsp; reported for the physician employed by the urgent care center who performed a Level 3 office visit in addition to the ancillary services?&nbsp;</strong></p>', '99213-25, 71046, 93040', '99213-25, 71020-26, 93042', '99283-25, 71010-26, 93010', '99203-25, 71010, 93000', '2022-07-20 05:36:35', '2022-07-20 05:36:35', 'ans_a'),
(1374, NULL, 38, 1, '<p><strong>&nbsp;55-year-old male has had several episodes of tightness in the chest. His physician ordered a PTCA&nbsp; (percutaneous transluminal coronary angioplasty) of the left anterior descending coronary artery. The&nbsp; procedure revealed atherosclerosis in the native vessel. It was determined a stent would be required to&nbsp; keep the artery open. The stent was inserted during the procedure.</strong></p>', '92928-LD', '92920-LD', '92920-LD, 92928', '92920-LD, 92928-59', '2022-07-20 05:37:07', '2022-07-20 05:37:07', 'ans_a'),
(1375, NULL, 38, 1, '<p><strong>A pregnant female is Rh negative and at 28 weeks gestation. The child&rsquo;s father is Rh positive. The&nbsp; mother is given an injection of a high-titer Rho (D) immune globulin, 300 mcg, IM. What CPT&reg;&nbsp; codes are reported?&nbsp;</strong></p>', '90384, 96372', '90386, 96372', '90384, 90471', '90386, 90471', '2022-07-20 05:37:41', '2022-07-20 05:37:41', 'ans_a'),
(1376, NULL, 24, 1, '<p><strong>A cardiologist pediatrician sends a four‐week‐old baby to an outpatient facility to have an&nbsp; echocardiogram. The baby has been having rapid breathing. He is sedated and a probe is&nbsp; placed on the chest wall and images are taken through the chest wall. A report is generated&nbsp; and sent to the pediatrician. The interpretation of the report by the pediatrician reveals the&nbsp; baby has an atrial septal defect. Choose the CPT&reg; code the cardiologist pediatrician should&nbsp; report.&nbsp;</strong></p>', '93303', '93315‐26', '93303‐26', '93315', '2022-07-20 05:38:36', '2022-08-04 11:47:02', 'ans_c'),
(1377, NULL, 24, 1, '<p><strong>10‐year‐old patient had a recent placement of a chochlear implant. She and her family see&nbsp; an audiologist to check the pressure and determine the strength of the magnet. The&nbsp; transmitter, microphone and cable are connected to the external speech processor and&nbsp; maximum loudness levels are determined under programming computer control. Which&nbsp; CPT&reg; code should be used?&nbsp;</strong></p>', '92601', '92603', '92604', '92562', '2022-07-20 05:39:04', '2022-08-03 06:25:54', 'ans_b'),
(1378, NULL, 24, 1, '<p><strong>Patient with hemiparesis on the dominant side due to having a CVA lives at home alone and&nbsp; has a therapist at his home site to evaluate meal preparation. The therapist observes the&nbsp; patient&rsquo;s functional level of performing kitchen management activities within safe limits.&nbsp; The therapist then teaches meal preparation using one handed techniques along with&nbsp; adaptive equipment to handle different kitchen appliances. The total time spent on this visit&nbsp; was 45 minutes. Report the CPT&reg; and ICD‐10‐CM codes for this encounter.</strong></p>', '97530 x 3, I67.89, G81.91', '97535 x 3, G81.90, I69.959', '97530 x 3, I69.959, I67.89', '97535 x 3, I69.959', '2022-07-20 05:39:36', '2022-08-03 10:07:40', 'ans_d'),
(1379, NULL, 38, 1, '<p><strong>Two‐year‐old is brought to the ER by EMS for near drowning. EMS had gotten a pulse. The&nbsp; ER physician performs endotracheal intubation, blood gas, and a central venous catheter&nbsp; placement. The ER physician documents a total time of 25&nbsp;minutes on this critical infant in&nbsp; which the physician already subtracted the time for the other billable services. Select the&nbsp; E/M service and procedures to report for the ER physician?</strong></p>', '99291‐25, 36555, 31500', '99291‐25, 36556, 31500, 82803', '99285‐25, 36556, 31500', '99475‐25, 36556', '2022-07-20 05:40:11', '2023-09-01 04:35:23', 'ans_c'),
(1380, NULL, 38, 1, '<p><strong>2‐year‐old is coming in with his mom to see the pediatrician for fever, sore throat, and&nbsp; pulling of the ears. The physician performs a brief history along with a problem pertinent&nbsp; review of systems. A limited exam was performed on the ears, nose and throat and&nbsp; respiratory systems. A strep culture was taken from pharynx and came back positive, diagnosed as Pharynitis. Another diagnosis was also&nbsp;made of the infant having acute otitis media with effusion in both ears. The medical decision&nbsp; making was of moderate complexity with the giving of a prescription. What CPT&reg; and ICD‐ 10‐CM codes should be reported?&nbsp;</strong></p>', '99212, J02.9, H66.93', '99213, J02.0 H65.93', '99212, J02.0 H65.193', '99213, J02.0 H65.193', '2022-07-20 05:40:43', '2023-09-27 04:35:57', 'ans_d'),
(1381, NULL, 38, 1, '<p><strong>Patient is here to follow up on her atrial fibrillation. Her primary care physician is not in the&nbsp; office. She will be seen by the partner physician that is also in the same practice. No new&nbsp; problems. A problem focused history is performed. An expanded problem focused physical&nbsp; exam is documented with the following, Blood pressure is 110/64. Pulse is regular at 72.&nbsp; Temp is 98.6F Chest is clear. Cardiac normal sinus rhythm. Medical making decision is&nbsp; straightforward. Diagnosis: Atrial fibrillation, currently stable. What CPT&reg; code is reported&nbsp; for this service?&nbsp;</strong></p>', '99214', '99202', '99212', '99213', '2022-07-20 05:41:25', '2023-05-26 04:03:24', 'ans_c'),
(1382, NULL, 38, 1, '<p><strong>Documentation of a new patient in a doctor&rsquo;s office setting supports the medically appropriate History &amp; examination. The medical making decision&nbsp;making is of moderate complexity. Which E/M service supports this documentation?&nbsp;</strong></p>', '99205', '99204', '99215', '99203', '2022-07-20 05:41:57', '2023-10-04 02:56:56', 'ans_b'),
(1383, NULL, 24, 1, '<p><strong>A patient that has multiple sclerosis has been seeing a therapist for four visits. Today&rsquo;s visit&nbsp; the therapist will be performing a comprehensive reevaluation to determine the extent of&nbsp; progress in parameters and if the patient is reaching his goals for common impairments&nbsp; associated with this neurologic condition, which includes performing body movements, muscle strength. What CPT&nbsp;and&nbsp; ICD‐10‐CM codes should be reported?&nbsp;</strong></p>', '97168, Z51.89, G35', '97166, Z56.89, G35', '97161, G35', '97164, Z51.89, G35', '2022-07-20 05:42:44', '2023-10-06 00:12:35', 'ans_d'),
(1384, NULL, 38, 1, '<p><strong>A new patient is having a cardiovascular stress test done in his cardiologist&rsquo;s office. Before&nbsp; the test is started the physician documents a comprehensive history and exam and&nbsp; moderate complexity medical decision making. The physician will be supervising and&nbsp; interpreting the stress on the patient&rsquo;s heart during the test. What procedure code should&nbsp; be documented for this encounter?&nbsp;</strong></p>', '93015‐26, 99204‐25', '93016, 93018, 99204‐25', '93015, 99204‐25', '93018‐26, 99204‐25', '2022-07-20 05:43:37', '2022-07-20 05:43:37', 'ans_c'),
(1385, NULL, 24, 1, '<p><strong>A cancer patient is coming in to have a chemotherapy infusion. The physician notes the&nbsp; patient is dehydrated and will first administer a hydration infusion. The infusion time was 1&nbsp; hour and 30 minutes. Select the code(s) that should be reported for this encounter? </strong></p>', '96360', '96360, 96361', '96365, 96366', '96422', '2022-07-20 05:44:16', '2022-07-22 06:14:07', 'ans_a'),
(1386, NULL, 38, 1, '<p><strong>A patient came in to the ER with wheezing and a rapid heart rate. The ER physician&nbsp;documents a medically appropriate history &amp; exam. The patient has been given three nebulizer treatments. The ER&nbsp;physician has decided to place him in observation care for the acute asthma exacerbation.&nbsp;The ER physician will continue examining the patient and will order additional treatments&nbsp;until the wheezing subsides. Total time spent 65 minutes with the patient. Select the appropriate code(s) for this visit.</strong></p>', '99284, 99221', '99222', '99283', '99223', '2022-07-20 05:45:05', '2023-05-31 00:43:19', 'ans_b'),
(1387, NULL, 38, 1, '<p><strong>A patient was admitted yesterday to the hospital for possible gallstones. The following day&nbsp; the physician who admitted the patient performed a detailed history, a detailed exam and a&nbsp; medical decision making of low complexity. The physician tells her the test results have&nbsp; come back positive for gallstones and is recommending having a cholecystectomy. What&nbsp; code should be reported for this evaluation and management service?&nbsp;</strong></p>', '99253', '99221', '99233', '99234', '2022-07-20 05:45:36', '2022-07-20 05:45:36', 'ans_c'),
(1388, NULL, 38, 1, '<p><strong>50‐year‐old patient is coming to see her primary care physician for hypertension. The&nbsp; patient also discusses with her physician that the OBGYN office had just told her that her&nbsp; Pap smear came back with an abnormal reading and is worried since her aunt had passed&nbsp; away with cervical cancer. The physician spent 40 minutes face‐to‐face time with the&nbsp; patient, and 25 minutes of that time is giving counseling on the awareness, other screening&nbsp; procedures and treatment if it turns out to be cervical cancer. What code(s) should be used&nbsp; for this visit? </strong></p>', '99215', '99213, 99358', '99214, 99354', '99213', '2022-07-20 05:46:11', '2022-07-20 05:46:11', 'ans_a'),
(1389, NULL, 24, 1, '<p><strong>A patient who is a singer has been hoarse for a few months following an upper respiratory&nbsp; infection. She is in a voice laboratory to have a laryngeal function study performed by an&nbsp; otolaryngologist. She starts off with the acoustic testing first. Before she moves on to the&nbsp; aerodynamic testing she complains of throat pain and is rescheduled to come back to have&nbsp; the other test performed. What CPT&reg; code is reported?&nbsp;</strong></p>', '92520', '92700', '92520‐52', '92614‐52', '2022-07-20 05:46:49', '2022-08-03 10:08:18', 'ans_c'),
(1390, NULL, 38, 1, '<p><strong>An established patient had a comprehensive exam in which she has been diagnosed with&nbsp; dry eye syndrome in both eyes. The ophthalmologist measures the cornea for placement of&nbsp; the soft contact lens for treatment of this syndrome. What codes are reported by the&nbsp; ophthalmologist?&nbsp;</strong></p>', '92014‐25, 92071‐50', '99214‐25, 92072‐50', '92014‐25, 92325‐50', '92014‐25, 92310‐50', '2022-07-20 05:47:20', '2022-07-20 05:47:20', 'ans_a'),
(1391, NULL, 38, 1, '<p><strong>Patient was in the ER complaining of constipation with nausea and vomiting when taking&nbsp; Zovirax for his herpes zoster and Percocet for pain. His primary care physician came to the&nbsp; ER and admitted him to the hospital for intravenous therapy and management of this&nbsp; problem. His physician documented a detailed history, comprehensive examination and a&nbsp; medical decision making of moderate complexity. Which E/M service is reported?</strong></p>', '99285', '99284', '99221', '99222', '2022-07-20 05:48:02', '2023-09-23 01:12:01', 'ans_d'),
(1392, NULL, 38, 1, '<p><strong>20‐day‐old infant was seen in the ER by the neonatologist admitting the baby to NICU for&nbsp; cyanosis and rapid breathing. The neonatologist performed intubation, ventilation&nbsp; management and a complete echocardiogram in the NICU and provided a report for the&nbsp; echocardiography which did indicate congenital heart disease. Select the correct codes for&nbsp; the physician service.&nbsp;</strong></p>', '99468‐25, 93303‐26', '99471‐25, 31500, 94002, 93303‐26', '99460‐25, 31500, 94002, 93303‐26', '99291‐25, 93303‐26', '2022-07-20 05:48:41', '2022-07-20 05:48:41', 'ans_a'),
(1393, NULL, 24, 1, '<p><strong>A patient with chronic renal failure is in the hospital being evaluated by his endocrinologist&nbsp; after just placing a catheter into the peritoneal cavity for dialysis. The physician is evaluating&nbsp; the dwell time and running fluid out of the cavity to make sure the volume of dialysate and&nbsp; the concentration of electrolytes and glucose are correctly prescribed for this patient. What&nbsp; code should be reported for this service?&nbsp;</strong></p>', '90935', '90937', '90947', '90945', '2022-07-20 05:49:10', '2022-08-03 06:25:08', 'ans_d'),
(1394, NULL, 38, 1, '<p><strong>80‐year‐old patient is returning to the gynecologist&rsquo;s office for pessary cleaning. Patient&nbsp; offers no complaints. The nurse removes and cleans the pessary, vagina is swabbed with&nbsp;betadine, and pessory replaced. For F/U in 4 months. What CPT&reg; and ICD‐10‐CM codes are&nbsp; reported for this service?&nbsp;</strong></p>', '99203, Z46.89', '99211, Z46.89', '99202, Z46.9', '99205', '2022-07-20 05:50:09', '2023-05-26 04:03:47', 'ans_b'),
(1395, NULL, 38, 1, '<p><strong>A new patient in a physician&rsquo;s office, Documentation supports for Brief History of present illness, Extended Review of the system and personal history of previous cardiac surgery with detailed examination and MDM of moderate complexity. Which level of E/M code supports this documentation?</strong></p>', '99203', '99202', '99204', '99214', '2022-08-03 08:46:29', '2022-08-03 08:46:29', 'ans_c'),
(1396, NULL, 38, 1, '<p><strong>A 37 yrs old female is brought to the Emergency Department due to snake bite. The ED physician performed medically appropriate history &amp; examination. The ED physician started anti venom IV drugs and decided to place her in Observation status.&nbsp;The ED physician will continue examining the patient and will order additional treatments until the patient recovers. What CPT code should be reported for this service?</strong></p>', '99221', '99222', '99283', '99284', '2022-08-03 08:56:30', '2023-05-31 00:48:43', 'ans_b'),
(1397, NULL, 38, 1, '<p><strong>A 55 yr old male is being discharged today from the hospital, Dr Yun-zin admitted the patient for severe abdominal pain in the morning. &nbsp; CT of abdomen and pelvis shows ulcerative colitis. He has given follow up medications with diet counselling.&nbsp; Total time spent with the patient during discharge is 40 minutes. What CPT code should be reported?</strong></p>', '99239', '99234', '99221, 99239', '99221, 99234', '2022-08-03 08:57:37', '2023-10-26 01:15:45', 'ans_a'),
(1398, NULL, 38, 1, '<p><strong>Dr James performs a follow-up consultation for a 68 yr old female in his office for low back pain radiating towards the right leg. Today the patient is feeling stable with the medications compared with the previous consultation visit that was done by the same physician two weeks ago.&nbsp; For today&rsquo;s service documentation supports problem-focused history, EPF exam and MDM of low complexity. What CPT code should be reported for Dr James?</strong></p>', '99242', '99212', '99213', '99241', '2022-08-03 08:59:08', '2022-08-03 08:59:08', 'ans_c'),
(1399, NULL, 38, 1, '<p><strong>A 2 yr old boy is brought to the ER due to syncope. The ER physician performs Endotracheal intubation, blood gas and central venous catheter placement. The ER physician documents a total time of critical care is one hour 45 minutes. He has subtracted the other billable service&rsquo;s time. How would you report this service?</strong></p>', '99291 – 25, 99292 x 2, 36555, 31500, 82803', '99291- 25, 36555, 31500, 82803', '99475 - 25, 36555, 31500, 82803', '99291–25, 99292 x 2, 36555, 31500', '2022-08-03 09:00:18', '2022-08-03 09:00:18', 'ans_d'),
(1400, NULL, 38, 1, '<p><strong>A 16 yr old child is here for an annual physical exam. As per previous Immunization record Hep B vaccine was given 12 months ago by a different physician belonging to the same group. Documentation supports four elements of HPI, complete ROS and three elements of PFSH. Detailed examination and MDM of moderate complexity. There is no abnormality noted during the visit, how would you report this service?</strong></p>', '99394', '99384', '99214-25, 99394', '99214', '2022-08-03 09:01:26', '2023-05-31 00:08:09', 'ans_a'),
(1401, NULL, 38, 1, '<p><strong>An 18 days old critically ill baby girl is seen in the Emergency Department by the neonatologist due to Bradypnea and cyanosis later he admitted the patient into the NICU and provided critical care service. The same physician performs the intubation and ventilator management in the NICU. An echocardiogram is performed, results show the congenital septal defect. How would you report this service?</strong></p>', '99468 - 25, 93303 – 26', '99468 – 25, 31500, 94002, 93303 - 26', '99477 – 25,  31500, 94002, 93303 – 26', '99291 – 25, 93303 – 26', '2022-08-03 09:10:14', '2022-08-03 09:10:14', 'ans_a'),
(1402, NULL, 38, 1, '<p><strong>A 49 yrs old female, an established patient coming to meet the physician in his office with severe right lower quadrant pain.&nbsp; The physician performs an EPF History, detailed examination and MDM of moderate complexity. After the evaluation physician spends an additional 45 min with the patient in answering her queries. How would you report this service?</strong></p>', '99213, 99356', '99214, 99354', '99213, 99354', '99214, 99356', '2022-08-03 09:11:09', '2022-08-03 09:11:09', 'ans_b'),
(1403, NULL, 38, 1, '<p><strong>A 28 yrs old patient presents with right ankle pain and swelling following a fall from the ladder. The injury occurred today morning around 9am. He applied ice but there is a huge swelling at the inner side of the ankle. In the Emergency Department physician performs a six system ROS.&nbsp; The patient is a chain smoker, married recently and no personal history of previous injuries. The physician performed a seven system exam. MDM of moderate complexity. An X-ray is ordered, which shows a bimalleolar fracture. The ED physician performs moderate conscious sedation with ketamine for 30 minutes. The fracture is reduced by the orthopaedic surgeon following consultation with the ED physician. Code the service performed by the ED physician?</strong></p>', '99284 - 25, 99152, 99153', '99283 - 25, 99156, 99157', '99283 - 25, 99152, 99153', '99284 - 25, 99156, 99157', '2022-08-03 09:12:19', '2022-08-03 09:12:19', 'ans_d'),
(1404, NULL, 38, 1, '<p><strong>Mr John, an 82 yrs old-established patient is being seen today for chest pain and palpitation in the physician&rsquo;s office. The PCP decided to send the patient with a request letter to get the second opinion from Cardiologist Dr Greg. This was the first time Dr Greg had seen Mr John in hospital outpatient settings, Dr. Greg documented Detailed History, comprehensive Examination and MDM of moderate complexity. Prescribed a few medications for his condition and he sent a report back to the primary care physician. How would you report Dr Greg&#39;s visit?</strong></p>', '99244', '99214', '99243', '99203', '2022-08-03 09:13:49', '2022-11-02 03:37:48', 'ans_a'),
(1405, NULL, 38, 1, '<p><strong>Mrs. Larry made a telephone call to the physician office at 10.28 am to talk to a physician about her 12 months old child who is suffering from a cold, cough with mild sputum. The last visit with the physician was 8 days back for the immunization. Physician&rsquo;s office staff attended the call and connected the call to the physician at 10.30 am and the call was completed at 10.39 am. The physician has prescribed a few medications and asked the patient&#39;s mother to come after one week if the condition has not improved. How would you report the service?</strong></p>', '99442', '99441', 'Service is invalid since the patient’s mother has initiated the call, not by the physician.', 'Telephone Call duration would be Included in the next office visit.', '2022-08-03 09:15:21', '2022-08-03 09:15:21', 'ans_b'),
(1406, NULL, 39, 1, '<p>Patient presented to the hospital for SOB, due to complication transferred to acute care hospital. What is the appropriate discharge disposition assignment?</p>', '02-Acute Care hospital', '06-Home health', '62-Rehability facility', '65-Psychiatric facility', '2022-08-22 09:16:43', '2022-08-22 09:16:43', 'ans_a'),
(1407, NULL, 39, 1, '<p>Patient admitted to the vaginal delivery for gestational diabetes. After vaginal Delivery, patient got second degree laceration on perineum muscle. What is the appropriate POA assignment for Gestational diabetes and second-degree laceration repair for this condition?</p>', 'Gestational Diabetes -POA-Y and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-N and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-W and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-U and Second-degree laceration -POA-Y', '2022-08-22 09:17:27', '2022-08-22 09:17:27', 'ans_a'),
(1408, NULL, 39, 1, '<p>What is the correct CPT code assignment for percutaneous cryoablation for renal tumor for the left kidney?</p>', '50593', '50543', '50592', 'None of the above.', '2022-08-22 09:18:08', '2022-08-22 09:18:08', 'ans_a'),
(1409, NULL, 39, 1, '<p>What is the correct ICD-10 CM code assignment for unspecified gastritis without bleeding?</p>', 'K29.50', 'K29.00', 'K29.20', 'K29.70', '2022-08-22 09:18:46', '2022-08-22 09:18:46', 'ans_d'),
(1410, NULL, 39, 1, '<p>3 weeks of delivery, vaginal discharge, and foul smell was found and confirmed to have a sepsis specified as MRSA Puerperal sepsis. How would you report this service?</p>', 'O85, B95.62', 'O85, B95.61', 'O85, B95.3', 'O85, B96.20', '2022-08-22 09:19:21', '2022-08-22 09:19:21', 'ans_a'),
(1411, NULL, 39, 1, '<p>What is the correct ICD-10 CM Code assignment for Upper respiratory infection due to possible Rhino virus and Dehydration?</p>', 'J06.9, E86.0', 'J06.9, B97.35', 'J06.9, B97.7', 'J06.9, B99.9', '2022-08-22 09:20:02', '2022-08-22 09:20:02', 'ans_a'),
(1412, NULL, 39, 1, '<p>Mr. Jones admitted to the hospital with cellulitis of left axilla and clinical features of sepsis and also found to have an additional diagnosis of PNA and UTI.What is the appropriate ICD-10 CM code assignment for this scenario?</p>', 'A41.9, L03.112, J18.9 and N39.0', 'L03.112, J18.9, A41.9 and N39.0', 'J18.9, L03.112, A41.9 and N39.0', 'N39.0, J18.9, L03.112 and J18.9', '2022-08-22 09:20:44', '2022-08-22 09:20:44', 'ans_a'),
(1413, NULL, 39, 1, '<p>Mrs. Carolyn Vincent, 86 yrs old woman admitted to the hospital with the dehydration, attending physician confirming that dehydration was treated as primarily and underwent endocrinologist stated as hyponatremia treated with IV Fluids. What is the appropriate PDX assignment for this scenario?</p>', 'Dehydration', 'Hyponatremia', 'Dehydration or Hyponatremia', 'Abnormal lab value', '2022-08-22 09:21:21', '2022-08-22 09:21:21', 'ans_a'),
(1414, NULL, 39, 1, '<p>What is the correct code assignment of HTN with CHF and Hyperlipidemia?</p>', 'I11.0, I50.9 & E78.5', 'I50.9, I11.9 &E78.5', 'I11.0, I50.32 &E78.2', 'None of the above', '2022-08-22 09:22:08', '2022-08-22 09:22:08', 'ans_a'),
(1415, NULL, 39, 1, '<p>Mr.James Willington presented to the hospital with sigmoid biopsy , after the procedures completed patient noted to have heavy bleeding, physician tried to control the bleeding it not been happen, so planned Total sigmoidectomy and performed .In this case what is the appropriate root operation for this case?</p>', 'Resection, Destruction', 'Excision, Resection', 'Excision, detachment', 'Resection, Extraction', '2022-08-22 09:22:56', '2022-08-22 09:22:56', 'ans_b'),
(1416, NULL, 39, 1, '<p>Mr. Burks Dean admitted to the hospital for vaginal delivery. Patient got complication, decided and performed vacuum assisted delivery and newborn baby got birth trauma. Neonatal baby noted to have cerebral hemorrhage.<br />\r\nWhat is the appropriate POA assignment for cerebral hemorrhage?</p>', 'Cerebral hemorrhage =Y-Present on admission', 'Cerebral hemorrhage =N -Not Present on admission', 'Cerebral hemorrhage =U-Unknown', 'Cerebral hemorrhage =W -Clinical Undetermined', '2022-08-22 09:23:43', '2022-08-22 09:23:43', 'ans_a'),
(1417, NULL, 39, 1, '<p>Patient admitted to the St. Mary hospital for planned Laparoscopic cholecystectomy. What is the appropriate CPT code assignment for this case?</p>', '47562', '47600', '47605', '47563', '2022-08-22 09:24:33', '2022-08-22 09:24:33', 'ans_a'),
(1418, NULL, 39, 1, '<p>Patient presented to the hospital with SOB, patient developed Complication and transferred to the Veterans administration hospital. What is the correct disposition assignment for this report?</p>', 'Transferred to Federal hospital', 'Transferred to acute care hospital', 'Discharged to home health', 'None of the above', '2022-08-22 09:25:07', '2022-08-22 09:25:07', 'ans_a'),
(1419, NULL, 39, 1, '<p>Neonatal baby born via vaginal delivery, mother was diabetic, baby underwent Glucose monitoring shows negative and GBS +VE mom and underwent vaccination in current encounter. What is the appropriate diagnosis codes for this report?</p>', 'Z38.00, Z05.41, Z23', 'Z38.00, Z05.43, Z23', 'Z38.00, Z05.42, Z23', 'Z38.00, Z05.2, Z23', '2022-08-22 09:25:55', '2022-11-15 16:50:10', 'ans_b'),
(1420, NULL, 39, 1, '<p>Newborn presented with congenital microcephaly on admission and what is the appropriate POA assignment for this report?</p>', 'Y', 'N', 'W', 'U', '2022-08-22 09:26:22', '2022-08-22 09:26:22', 'ans_a'),
(1421, NULL, 39, 1, '<p>Patient admitted to the hospital with Initial MI. Now admitted hospital again after 3 weeks for initial MI<br />\r\nWhat is the appropriate PDX selection for this case?</p>', 'Code the I122 Category set of codes for Subsequent Type-2 MI', 'Code the I21 Category set of codes for Subsequent Type-2 MI', 'Code the I21.7 Category set of codes for Subsequent Type-2 MI', 'Code the I25.2 Category for set of codes for Subsequent Type-2 MI', '2022-08-22 09:27:22', '2022-10-29 13:20:04', 'ans_b'),
(1422, NULL, 39, 1, '<p>Patient presented to the hospital for chest pain and SOB, noted to have diaphoretic, elevated troponin &amp; Creatinine and BNP shows 12000.Chest x-ray shows cardiomegaly. Treated with IV Fluids. What are all diagnosis you will assign based on the documentation?</p>', 'CHF, NSTEMI and AKI', 'CHF, STEMI and AKI', 'CHF and STEMI', 'CHF, NSTEMI and ATN', '2022-08-22 09:28:09', '2022-08-22 09:28:09', 'ans_a'),
(1423, NULL, 39, 1, '<p>Clinical Indicator&rsquo;s: Patient presented to the hospital with sepsis and PNA, developed hypotension.<br />\r\nVasopressin administration was done, not controlled, For which condition you will raise query for?</p>', 'Query for Septicemia', 'Query for Severe Sepsis', 'Query for Systemic inflammatory response syndrome with non-infectious process.', 'Query for Septic Shock.', '2022-08-22 09:29:02', '2022-08-22 09:29:02', 'ans_d'),
(1424, NULL, 39, 1, '<p>Patient admitted to the hospital for anemia and found to have CKD unspecified &amp; hypertensive urgency in this case which one you will assign as PDX?</p>', 'D63.1, N18.9, I16.0', 'N18.9, D63.1, I16.0', 'I16.0, N18.9, D63.1', 'None of the Above', '2022-08-22 09:29:43', '2022-08-22 09:29:43', 'ans_b'),
(1425, NULL, 39, 1, '<p>An 11 yrs. old boy presented to the hospital with unilateral Tonsillectomy. What modifier you will assign for this case?</p>', '42821-50', '42820-51', '42825-59', '42825-52', '2022-08-22 09:30:48', '2022-08-22 09:30:48', 'ans_d'),
(1426, NULL, 39, 1, '<p>Patient admitted to the hospital with Colon mass. Physician performed the polypectomy in the sigmoid colon and biopsy at the descending colon. What modifier will append for this scenario.</p>', 'XU', 'XE', 'XP', 'XS', '2022-08-22 09:31:34', '2022-08-22 09:31:34', 'ans_d'),
(1427, NULL, 39, 1, '<p>What is the appropriate code assignment for traumatic subarachnoid hemorrhage without LOC with cerebral edema underwent clot evacuation in the subarachnoid space. What is the appropriate ICD-10 CM and PCS code assignment?</p>', 'S06.5X0A, S06.1X0A, 00C53ZZ', 'S06.6X0A, S06.1X0A, 00C53ZZ', 'S06.812A, S06.1X0A, 00C50ZZ', 'None of the above', '2022-08-22 09:32:17', '2022-08-22 09:32:17', 'ans_b'),
(1428, NULL, 39, 1, '<p>Mr. Ketuncky came to the hospital for dysphagia and SOB. Swallow study was performed shows normal. Chest x-ray ordered and revealed PNA.Clindamycin IV administration was done. In this case, for what diagnosis you will raise the query for?</p>', 'Query for Infectious pneumonia', 'Query for COVID-19 Pneumonia', 'Query for Aspiration pneumonia', 'Query for Septic shock', '2022-08-22 09:32:55', '2022-08-22 09:32:55', 'ans_c'),
(1429, NULL, 39, 1, '<p>Mrs. Zella admitted to the IP Hospital with following conditions, please choose the below option, which options you will choose for physician query.</p>', 'Acute Diastolic CHF, Respiratory failure, streptococcus pneumonia', 'Acute Diastolic CHF, chronic respiratory failure, viral pneumonia', 'Either A or B', 'None of the above.', '2022-08-22 09:33:41', '2022-08-22 09:33:41', 'ans_a'),
