(1432, NULL, 39, 1, '<p>Patient presented to the hospital with PNA, after admission noted to have UTI due to indwelling catheter, what is the correct PDX selection for this case?</p>', 'T83.512A, N39.0, J18.9', 'T83.511A, J18.9, N39.0', 'J18.9, T83.511A, N39.0', 'T83.714A', '2022-08-22 09:35:29', '2022-08-22 09:35:29', 'ans_c'),
(1433, NULL, 39, 1, '<p>Patient admitted for vaginal delivery for pre-existing hypertension with 39 weeks of gestation, delivered a baby boy via normal vaginal delivery. Please select the diagnosis as per the sequencing direction.</p>', 'O10.93, Z3A.39, Z37.0', 'O10.92, Z3A.39, Z37.0', 'O10.913, Z3A.39, Z37.0', 'Z3A.39, O10.93, Z37.0', '2022-08-22 09:37:19', '2022-08-22 09:37:19', 'ans_b'),
(1434, NULL, 39, 1, '<p>A 65 yrs old male having 45 yrs with a PMH of tobacco dependence, currently no active of smoking coming for evaluation of cancer. What is the correct code assignment in this case?</p>', 'F17.200', 'F17.210', 'Z87.891', 'Z77.222, Z05.86', '2022-08-22 09:38:12', '2022-08-22 09:38:12', 'ans_c'),
