(1438, NULL, 39, 1, '<p>Patient have febrile with a temperature of 102.7, heart rate of 98, Laboratory results showed a white blood cell count of 13,500 with 12% bands, hyperlactatemia, and altered mental status. In this scenario, what type of query you will be place for this chart?</p>', 'Based on the indicators, are you agree with coding of sepsis?', 'Blood cultures pending. Antibiotics ordered with fluid bolus, based on these clinical indicators, the patient’s condition should be further specified as?', 'Either A or B', 'None of the Above', '2022-08-22 09:44:49', '2022-08-22 09:44:49', 'ans_b'),
(1439, NULL, 39, 1, '<p>An 55 yrs. old diabetic patient has non-proliferative diabetic retinopathy right &ndash;(Moderate) greater than left side-(Mild)with chronic pancreatitis. How would you code this scenario?</p>', 'E11.3991, E11.3212, K86.1', 'E11.3311, E11.3212, K86.1', 'E11.37, K86.1', 'E11.352, E11.355 and K86.1', '2022-08-22 09:45:34', '2022-11-19 15:19:08', 'ans_b'),
(1440, NULL, 39, 1, '<p>How would follow the chart flow process in IP coding, Please choose the correct option and sequence accordingly?</p>', 'Charge Coded, Service, registration, and diagnostic coding', 'Registration, diagnostic coding, services and charge coded', 'Diagnostic coding, registration, service and Charge coded', 'Registration, service, charge coded and diagnostic Coding', '2022-08-22 09:46:19', '2022-08-22 09:46:19', 'ans_d'),
(1441, NULL, 39, 1, '<p>Patient admitted for planned cholecystectomy, general anesthesia administered, patient developed hypotension, and physician terminated the procedure after administration of anesthesia. What is the appropriate CPT modifier you will assign in this case?</p>', '73', '74', '59', '79', '2022-08-22 09:47:28', '2022-08-22 09:47:28', 'ans_b'),
(1442, NULL, 39, 1, '<p>In DRG 637, Diabetes W/MCC, in below options which MCC affects the selection of MS-DRG?</p>', 'Encephalopathy', 'Acute Respiratory failure', 'Crohn’s disease', 'Chronic bacteremia', '2022-08-22 09:48:02', '2022-08-22 09:48:02', 'ans_b'),
(1443, NULL, 39, 1, '<p>Patient admitted to the hospital for infection, Came in previous visit for PICC line placement, current visit fever was came, and blood culture was taken shows bacteremia. In this case, what type of query will be placed for this scenario?</p>', 'Query for Sepsis', 'Query for bacteremia due to CVC Catheter', 'Query for Sepsis due to catheter', 'All of the above', '2022-08-22 09:48:45', '2022-08-22 09:48:45', 'ans_b'),
(1444, NULL, 39, 1, '<p>What is the correct code assignment for acute diastolic CHF with hypertension?</p>', 'I11.0, I50.32', 'I11.0, I50.21', 'I13.0, I50.23, I50.31', 'I11.0, I50.31', '2022-08-22 09:49:29', '2022-08-22 09:49:29', 'ans_d'),
(1445, NULL, 39, 1, '<p>In IP Hospital, Coding professional working in system, due to some urgent work he unlocked the system and went outside. Manager came to the table, looks unlocked, he locked the system. Under what violation it affects?</p>', 'Physical', 'Technical', 'Administrative', 'Organized', '2022-08-22 09:50:07', '2022-08-22 09:50:07', 'ans_a'),
(1446, NULL, 39, 1, '<p>In hospital, manager asking the operative report to send via mail to get some data. Coder taken the report and send the data via mail to the wrong person. Under What violation it will come out?</p>', 'Transmission', 'Technical', 'Administrative', 'Organized', '2022-08-22 09:50:51', '2022-08-22 09:50:51', 'ans_b'),
(1447, NULL, 39, 1, '<p>Patient presented with 20 years of smoking tobacco. Physician performed smoking cessation counseling. What is the ICD 10 CM code for this? - Tobacco/ Nicotine dependence</p>', 'F11.20', 'F17.210', 'F11.21', 'F12.220', '2022-08-22 09:51:32', '2022-12-11 11:58:40', 'ans_b'),
(1448, NULL, 39, 1, '<p>Outpatient E/M Services was performed by the physician, he wrote established patient as new patient in the report, Coder seen and requested the physician reason for writing. Physician responded as that is my practice of mine and known level of care. How does coder reports in this case?</p>', 'Compliance team', 'reports to Manager on this issue', 'Complaining the Senior doctor, insulting his knowledge in front of all patients', 'Begging to the doctor to change the patient status with pulling his legs in front of him.', '2022-08-22 09:52:13', '2022-08-22 09:52:13', 'ans_a'),
(1449, NULL, 39, 1, '<p>Patient presented to the hospital with abdominal pain and general consult was done.EGD and colonoscopy performed shows gastritis and divericulitis.After scopy evaluation it shows abdominal distention and shows ascites , paracentesis was performed. In this case, which PPX you will assign?</p>', 'Paracentesis', 'Colonoscopy', 'EGD', 'EGD and colonoscopy', '2022-08-22 09:52:47', '2022-08-22 09:52:47', 'ans_d'),
(1450, NULL, 39, 1, '<p>Patient presented to the hospital with one complaint. Header states procedure was performed right, and body of the report states it is performed on the left. In this case, How coder will deals this case?</p>', 'Code according to the operative report', 'Query the provider for laterality', 'Ask manager for further clarification', 'Go and ask physician directly how to code this case.', '2022-08-22 09:53:30', '2022-08-22 09:53:30', 'ans_b'),
(1451, NULL, 39, 1, '<p>Patient admitted with fluid overload due to missed dialysis and found to have HTN with ESRD and underwent hemodialysis for 5 hrs, How you deals this case?</p>', 'E87.70, I12.0, N18.6, 5A1D80Z', 'I12.0, N18.6,5A1D90Z', 'E87.70, I12.0, N18.6,5A1D70Z,Z99.2', 'E87.70,5A1D70Z', '2022-08-22 09:54:11', '2022-08-22 09:54:11', 'ans_c'),
(1452, NULL, 39, 1, '<p>Mr. George Washington admitted to the hospital with STEMI. Cardiac Cath shows CAD and Anterolateral ST Myocardial infarction and transferred to another hospital for CABG. Physician performed the CABG*3 from left internal mammary artery to the left anterior descending artery and aorta to two coronary arteries with Cardiopulmonary bypass and harvested saphenous vein from the left lower leg using endoscopic vein harvest. How would you report these services?</p>', '02100Z9, 021109W, 06BQ4ZZ, 5A1221Z, I25.10, I21.09', '02100Z9, 021109W, 5A1221Z', '02100Z9, 021109W,006B40ZZ,5A1221Z', '02100Z9,021109W,06BQ4ZZ ,5A1221Z, I21.09,I25.10', '2022-08-22 09:55:06', '2022-12-05 09:54:40', 'ans_d'),
(1453, NULL, 39, 1, '<p>Patient presents for creation of an AV graft in the right arm. The brachial artery and the basilic vein are dissected. Basilic vein was cannulated, a nonautogenous AV graft is utilized, and a stent is advanced inside the AV graft which is deployed inside the basilic vein thus creating a sutureless venous anastomosis. Balloon angioplasty of the stent was performed, and a tunnel was created for the graft. Contrast was injected under cinefluoroscopy and a fistulogram and venogram were performed of the right upper extremity. The graft was completed successfully.<br />\r\nA pseudoaneurysm and a segment of the graft were dissected from the left upper extremity. Patient tolerated the procedure well. How would you report this services?</p>', '36830,76936', '37205,75960', '36832', '36818', '2022-08-22 09:55:55', '2022-08-22 09:55:55', 'ans_a'),
(1454, NULL, 39, 1, '<p>Acute Suppurative otitis media in(ASOM) AD coded as _____</p>', 'H66.002', 'H66.001', 'H66.23', 'H66.43', '2022-08-22 09:57:05', '2022-10-29 13:29:20', 'ans_b');
