(1455, NULL, 39, 1, '<p>Patient presented to the hospital with ESRD underwent kidney transplant transferring kidney from twins. How would you code transferring kidney from identical twins in this case?</p>', '0TY10Z1-Identical twins-Syngeneic', '0TY10Z0-Identical twins-Allogenic', '0TY10Z2-Identical twins-Zooplastic', 'None of the above', '2022-08-22 09:57:44', '2022-08-22 09:57:44', 'ans_a'),
(1456, NULL, 39, 1, '<p>Patient presented to the hospital for general surgery after administration of anesthesia, during postoperatively patient developed acute respiratory failure. In which case which options you will choose?</p>', 'Acute Respiratory failure', 'Post-operative Respiratory failure', 'Respiratory failure due to anesthesia', 'Query the provider regarding respiratory failure due to post procedural surgery.', '2022-08-22 09:58:24', '2022-08-22 09:58:24', 'ans_a'),
(1457, NULL, 39, 1, '<p>Mr. Kennedy presented to the hospital with second stage pressure ulcer that were present on admission but healed at the time of discharge. How would assign the codes?</p>', 'Code the site and stage of Pressure ulcer', 'Query the provider', 'No code is required', 'Code the unspecified stage of pressure ulcer', '2022-08-22 09:59:02', '2022-11-15 06:16:34', 'ans_a'),
(1458, NULL, 39, 1, '<p>Patient presented to the hospital with Blepharoplasty for right upper eyelid and left upper eyelid in this case. What is correct modifier for Eyelid in CPT Coding?</p>', '15822-E1 and 15822-E3', '15822-50', '15822-E2 and 15822-E4', 'All of the above', '2022-08-22 09:59:40', '2022-11-15 07:40:03', 'ans_b'),
(1459, NULL, 39, 1, '<p>Patient presented to the hospital with CAD and underwent CABG in two arteries from aorta to coronary arteries and saphenous vein harvested from right side and Cardiopulmonary bypass was instituted. Which one is the appropriate Primary PCS for this case?</p>', '021109W', '02100Z9', '5A1221Z', '06BP4ZZ', '2022-08-22 10:00:37', '2022-08-22 10:00:37', 'ans_a'),
(1460, NULL, 39, 1, '<p>Patient admitted to the Outpatient hospital with planned cholecystectomy for the complaint of chronic mild cholecystitis and sent the gall bladder to the pathology. Pathology report shows acute on chronic cholecystitis. How would you code the services?</p>', 'Code only Chronic cholecystitis-K81.1 and disagree with pathology report.', 'Code Acute on chronic Cholecystitis -K81.2, Agree with pathology report', 'Either A or B', 'None of the above.', '2022-08-22 10:01:36', '2022-08-22 10:01:36', 'ans_a'),
(1461, NULL, 39, 1, '<p>A bronchoscopy is performed, bronchoalveolar lavage (BAL), bronchial washings and cytology brushings were obtained in the right upper lobe bronchus;<br />\r\nendobronchial biopsies and transbronchial biopsies from the right upper lobe; and bronchoalveolar lavage samples were obtained from the left lower lobe. Should the BAL and brushings be separately coded?</p>', '0BB48ZX, 0B948ZX, 0BBC8ZX and 0B9B8ZX', '0BBC8ZX and 0B988ZX', '0B9M8ZZ', '0BB48ZX and 0B948ZX', '2022-08-22 10:04:29', '2022-08-22 10:04:29', 'ans_a'),
(1462, NULL, 39, 1, '<p>Which of the following is a out of numeric sequence code in CPT Code book.</p>', '11005 is not to be reported with 76942', '10005, Fine needle aspiration biopsy including ultrasonic guidance, first lesion Don’t report 10005-10006 at the conjunction with 76942', '12005 is not to be reported with 76942, which is a resequenced code', 'None of the above.', '2022-08-22 10:05:29', '2022-08-22 10:05:29', 'ans_b'),
(1463, NULL, 39, 1, '<p>Patient presented to the hospital with head injury and also noted have scalp and hand laceration, found to have a TBI was ruled out. What is the appropriate PDX assignment for this case?</p>', 'Head injury', 'Hand laceration or scalp laceration', 'Observation for other conditions ruled out', 'All the above', '2022-08-22 10:06:17', '2022-08-22 10:06:17', 'ans_a'),
(1464, NULL, 39, 1, '<p>Mr. White working as chef doing chopping the vegetables at hotel using knife got scalp laceration of 5.0 cm and hand laceration of 1.0 cm, laceration was repaired at superficial level. In this case, how would you report the services?</p>', '12002, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9 and Y99.0', '12001, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9 and Y99.0', '12001, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9', 'S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9', '2022-08-22 10:06:56', '2022-08-22 10:06:56', 'ans_a'),
(1465, NULL, 39, 1, '<p>What is the correct code assignment for paraganglioma?</p>', 'D44.1', 'D49.0', 'D44.7', 'D62', '2022-08-22 10:07:57', '2022-08-22 10:07:57', 'ans_c'),
