(1467, NULL, 39, 1, '<p>Patient admitted to the hospital with STEMI and Respiratory failure and PTCA for two vessels with drug eluting stent placement. What is the appropriate the PDX and PPX for this scenario?</p>', 'STEMI, 027035Z', 'Respiratory failure ,02703DZ', 'STEMI or Respiratory failure, 027035Z', 'All of the Above', '2022-08-22 10:17:26', '2022-08-22 10:17:26', 'ans_a'),
(1468, NULL, 39, 1, '<p>Patient admitted to the hospital with gastric ulcer. After admission, patient developed bleeding is present. What is the POA indicator for this report?</p>', 'N', 'U', 'Y', 'W', '2022-08-22 10:18:11', '2022-08-22 10:18:11', 'ans_a'),
