(1487, NULL, 39, 1, '<p>Patient admitted to the hospital with IP admission, after two days of admission patient was getting discharged. Under what payment system it is get reimbursed?</p>', 'OPPS', 'IPPS', 'MS-DRG', 'Outpatient rehab center', '2022-08-22 10:31:34', '2022-08-22 10:31:34', 'ans_c'),
