(1489, NULL, 39, 1, '<p>Patient presented to the hospital with SOB and leg edema and noted to have CHF. Echocardiography shows 35% of ejection fraction treated with IV diuretics and IV fluids documented as acute CHF exacerbation. How would you code this scenario?</p>', 'Query the provider for the acuity of CHF requested by ED provider', 'Query the provider as diastolic CHF treated during admission to the attending provider', 'Code the congestive heart failure, unspecified', 'Query the provider as systolic CHF treated during admission to the attending provider.', '2022-08-22 10:32:51', '2022-08-22 10:32:51', 'ans_d'),
(1490, NULL, 39, 1, '<p>Patient presented to the hospital for PNA treating with antibiotics and also have respiratory failure, O2 saturation was very less treating with BIPAP, in this case, for what condition we need to raise the query for?</p>', 'Query for pneumonia', 'Query for acuity of Respiratory failure, to specify acute or chronic or acute on chronic.', 'Query for Both.', 'None of the above.', '2022-08-22 10:34:04', '2022-08-22 10:34:04', 'ans_b'),
