(1494, NULL, 39, 1, '<p>Coder speaking the patient information discussed with physician through phone call and patient data was discussed via phone listened by doctor&rsquo;s wife, in this case code how to proceed with?</p>', 'Terminate the physician from hospital', 'Blocking phone and emails immediately.', 'Investigate the status to make sure to protect the data in upcoming days', 'Z38.00-E', '2022-08-23 03:13:08', '2022-08-23 03:13:08', 'ans_c'),
