(1496, NULL, 39, 1, '<p>Patient was kept observation in ED for chest pain which is worsened and transferred to another hospital for further treatment.What is the correct disposition assignment for this case?</p>', 'IP-Acute hospital', 'Home health', 'Hospice care', 'Psychiatric facility', '2022-08-23 03:37:43', '2022-08-23 03:37:43', 'ans_a'),
(1497, NULL, 39, 1, '<p>Patient presented to the hospital to ED for CHF, got fractured in ED, moving to IP admission. What is the correct POA assignment for this condition in IP admission?</p>', 'Y- for CHF and N for Fracture', 'Y for Fracture and CHF', 'N for CHF and Y for Fracture', 'U for CHF and fracture', '2022-08-23 03:38:31', '2022-08-23 03:38:31', 'ans_b'),
(1498, NULL, 39, 1, '<p>Patient presented to the hospital with planned chemotherapy for 5 th cycle for lung cancer and noted to have anemia, neutropenia and thrombocytopenia on recurrent admission condition also. In this case, how would you follow this?</p>', 'Code the Pancytopenia due to chemotherapy', 'Code the anemia, neutropenia and thrombocytopenia', 'Query the provider as pancytopenia due to chemotherapy', 'All of the above.', '2022-08-23 03:39:55', '2022-08-23 03:39:55', 'ans_c'),
(1499, NULL, 39, 1, '<p>Please provide the hierarchy of coding the below medicine procedure</p>', 'Injection, infusion and IV push', 'Infusion, IV push and Injection', 'Hydration, injection and IV push', 'IV Push, hydration and IV chemo', '2022-08-23 03:42:10', '2022-08-23 03:42:10', 'ans_b'),
(1500, NULL, 39, 1, '<p>Lithotripsy and stent placement was performed at the right ureter. What is the correct CPT code assignment for this case?</p>', '52352-RT', '52356-RT', '52354-RT', '52402-RT', '2022-08-23 03:43:05', '2022-08-23 03:43:05', 'ans_b'),
(1501, NULL, 39, 1, '<p>Vaccination was performed under what goal?</p>', 'IV goal', 'IM goal', 'Oral goal', 'All of the above.', '2022-08-23 03:43:45', '2022-08-23 03:43:45', 'ans_b'),
(1502, NULL, 40, 1, '<p>Sepsis due to the presence of an indwelling urinary catheter with a positive blood culture<br />\r\nreflected in the progress notes as Methillian Susceptible&nbsp;Staphylococcus aureus sepsis. What codes should be<br />\r\nassigned?</p>', 'T83.511A, A41.01', 'T83.511A, A41.9', 'T83.510A, R78.81', 'T81.44XA, A41.01', '2022-08-24 03:16:46', '2022-10-29 13:23:17', 'ans_a'),
(1503, NULL, 40, 1, '<p>A laparoscopic tubal ligation is completed. What is the correct CPT code assignment?</p>', '49320, 58662', '58670', '58671', '49320', '2022-08-24 03:17:28', '2022-08-24 03:17:28', 'ans_b'),
(1504, NULL, 40, 1, '<p>Normal twin delivery at 30 weeks. Both babies were delivered vaginally and were<br />\r\nliveborn. What conditions should have codes assigned?</p>', 'O80, Z3A.30, Z37.0', 'O30.003, O60.14X0, Z3A.30, Z37.2', 'O60.14X1, O60.14X2 O30.003, Z3A.30, Z37.2', 'O80, O30.009, Z3A.30, Z37.2', '2022-08-24 03:18:06', '2022-08-24 03:18:06', 'ans_c'),
(1505, NULL, 40, 1, '<p>A patient with acute respiratory failure, hypertension, and congestive heart failure is<br />\r\nadmitted for intubation and ventilation. The patient&rsquo;s heart failure is stable on current<br />\r\nmedications. What are the correct diagnosis codes and sequencing?</p>', 'J96.00, I11.0, I50.9', 'I50.9, J96.00, I10', 'J96.20, I10, I50.9', 'I50.9, J96.20, I11.0', '2022-08-24 03:18:46', '2022-08-24 03:18:46', 'ans_a'),
(1506, NULL, 40, 1, '<p>Documentation from the nursing or other allied health professionals&rsquo; notes can be used<br />\r\nto provide specificity for code assignment for which of the following diagnoses?</p>', 'Body mass index (BMI)', 'Malnutrition', 'Aspiration pneumonia', 'Fatigue', '2022-08-24 03:20:54', '2022-08-24 03:20:54', 'ans_a'),
(1507, NULL, 40, 1, '<p>A laparoscopic cholecystectomy was performed. What is the correct ICD-10-PCS code?</p>', '0FB40ZZ', '0FT40ZZ', '0FT44ZZ', '0FB44ZZ', '2022-08-24 03:21:22', '2022-08-24 03:21:22', 'ans_c'),
(1508, NULL, 40, 1, '<p>The patient is admitted for chest pain and is found to have an acute inferior myocardial<br />\r\ninfarction with coronary artery disease and atrial fibrillation. After the atrial fibrillation was<br />\r\ncontrolled and the patient was stabilized, the patient underwent a CABG &times;2 from aorta to<br />\r\nthe right anterior descending and right obtuse, using the left greater saphenous vein that<br />\r\nwas harvested via an open approach. Cardiopulmonary bypass was utilized. The appropriate<br />\r\nsequencing and ICD codes for the hospitalization would be:</p>', 'R07.9, I21.3, I48.91, I22.9, 02100AW, 5A1221Z', 'I21.19, I48.91, I22.9, 02100AW', 'I21.19, I25.10, I48.91, 021109W, 5A1221Z', 'I22.1, I48.91, I21.19, 021109W', '2022-08-24 03:25:27', '2022-10-29 13:25:04', 'ans_c'),
(1509, NULL, 40, 1, '<p>Medically unlikely edits are used to identify:</p>', 'Pairs of procedure codes that should not be billed together', 'Maximum units of service for a HCPCS code', 'Diagnoses that do not meet medical necessity', 'Procedure and gender discrepancies', '2022-08-24 03:26:09', '2022-08-24 03:26:09', 'ans_b'),
(1510, NULL, 40, 1, '<p>Diagnostic-related groups (DRGs) and ambulatory patient classifications (APCs) are similar<br />\r\nin that they are both:</p>', 'Determined by HCPCS codes', 'Focused on hospital outpatients', 'Focused on hospital inpatients', 'Prospective payment systems', '2022-08-24 03:29:03', '2022-08-24 03:29:03', 'ans_d'),
(1511, NULL, 40, 1, '<p>When a patient is transferred from an acute-care facility to a skilled nursing facility, what<br />\r\nabstracted data element can impact the DRG assignment?</p>', 'Admission source', 'Patient’s blood type', 'Discharge disposition', 'Patient’s age', '2022-08-24 03:29:48', '2022-08-24 03:29:48', 'ans_c'),
(1512, NULL, 40, 1, '<p>For a patient with a principal diagnosis of septicemia, reporting which of the following<br />\r\nprocedures will have the greatest impact on the MS-DRG?</p>', 'Excision of left main bronchus, percutaneous endoscopic approach, diagnostic (0BB74ZX)', 'Excision of toe nail, external approach (0HBRXZZ)', 'Extraction of perineum skin, external approach (0HD9XZZ)', 'Respiratory ventilation, greater than 96 consecutive hours (5A1955Z)', '2022-08-24 03:31:23', '2022-08-24 03:31:23', 'ans_d'),
(1513, NULL, 40, 1, '<p>To accurately report wound closures with CPT codes, in addition to knowing the site and<br />\r\nlength of the closure, what other information is necessary?</p>', 'If anesthesia was used and what kind', 'The repair type: simple, intermediate, or complex', 'The supplies that were used', 'If exploration of tendons or blood vessels occurred', '2022-08-24 03:32:19', '2022-08-24 03:32:19', 'ans_b'),
(1514, NULL, 40, 1, '<p>On day two of admission, an inpatient progress note states there is a stage three<br />\r\npressure ulcer of the sacrum that requires debridement. The coding professional composes<br />\r\na query to determine if this condition was present on admission (POA) by asking the<br />\r\nphysician if the pressure ulcer listed in the progress note of day two was present on<br />\r\nadmission&mdash;yes or no? Is that an acceptable query? Why or why not?</p>', 'No. Yes/no queries are not acceptable in any circumstances.', 'No. Yes/no queries require clinical indicators.', 'Yes/no queries may be used to established POA status.', 'Yes/no queries are the preferred query format for all queries.', '2022-08-24 03:33:28', '2022-08-24 03:33:28', 'ans_c'),
(1515, NULL, 40, 1, '<p>While admitted for an exacerbation of COPD, a patient developed swelling in the lower<br />\r\nlegs and had increasing shortness of breath despite the COPD treatment. An<br />\r\nechocardiogram was performed that showed an ejection fraction of 33 percent. A urinalysis<br />\r\nshowed albuminuria. Breathing treatments continued with the addition of Lasix to the<br />\r\nmedication regime. In the final diagnostic statement, the physician mentions only the COPD<br />\r\nexacerbation. What is the query opportunity for this record?</p>', 'Coronary artery disease', 'Acute congestive heart failure', 'Pleural effusion', 'Atrial fibrillation', '2022-08-24 03:34:21', '2022-08-24 03:34:21', 'ans_b'),
(1516, NULL, 40, 1, '<p>Generally, data quality is defined as:</p>', 'Ensuring the greatest amount of data possible is obtained from the health record', 'Ensuring the accuracy and completeness of an organization’s data', 'Ensuring accuracy of the data collected for the case-mix index', 'Ensuring the data for external reporting is optimiz', '2022-08-24 03:35:06', '2022-08-24 03:35:06', 'ans_b'),
(1517, NULL, 40, 1, '<p>A 75-year-old patient is admitted for a complex, ventral hernia repair. While in the<br />\r\nhospital, the patient slips and falls, suffering a left hip fracture. Will the hip fracture be<br />\r\nidentified as part of the facility&rsquo;s patient safety indicators (PSI)? Why or why not?</p>', 'No, the hip fracture is the principal diagnosis and will not be part of the PSI', 'Yes, the hip fracture is the principal diagnosis and would still be part of the PSI', 'No, the hip fracture is a secondary diagnosis and therefore, will not be part of the PSI', 'Yes, the hip fracture is a secondary diagnosis and will be part of the PSI', '2022-08-24 03:46:07', '2022-08-24 03:46:07', 'ans_d'),
(1518, NULL, 40, 1, '<p>Code sets that are mandated under HIPAA include all of the following except:</p>', 'National Drug Codes (NDC)', 'International Classification of Diseases, Tenth Revision, Clinical Modification and International Classification of Disease, Tenth Revision, Procedure Coding System (ICD-10-CM and ICD-10-PCS)', 'Current Procedural Terminology (CPT)', 'Hierarchical Condition Category (HCC)', '2022-08-24 09:29:48', '2022-12-12 10:19:27', 'ans_d'),
(1519, NULL, 40, 1, '<p>Code sets that are mandated under HIPAA include all of the following except:</p>', 'National Drug Codes (NDC)', 'International Classification of Diseases, Tenth Revision, Clinical Modification and International Classification of Disease, Tenth Revision, Procedure Coding System (ICD-10-CM and ICD-10-PCS)', 'Current Procedural Terminology (CPT)', 'Hierarchical Condition Category (HCC)', '2022-08-24 09:30:32', '2022-08-24 09:30:32', 'ans_d'),
(1520, NULL, 40, 1, '<p>A patient has a principal diagnosis of pneumonia (J18.9) (MS-DRG 195). Which of the<br />\r\nfollowing may legitimately change the coding of the pneumonia in accordance with the<br />\r\nUHDDS and relevant clinical documentation?</p>', 'Sputum culture reflects growth of normal flora', 'Patient has a high fever', 'Patient is found to have dysphagia with aspiration', 'Patient has nonproductive cough', '2022-08-24 09:31:23', '2022-08-24 09:31:23', 'ans_c'),
(1521, NULL, 40, 1, '<p>A patient was admitted to an acute-care facility with a temperature of 102 and atrial<br />\r\nfibrillation. A chest x-ray reveals pneumonia with subsequent documentation by the<br />\r\nphysician of pneumonia in the progress notes and discharge summary. The patient was<br />\r\ntreated with oral antiarrhythmic medications and IV antibiotics. What is the correct code<br />\r\nsequence?</p>', 'J18.9, I48.91', 'I48.91, J18.9', 'It does not matter which is used as the principal diagnosis', 'Not enough information is present. Query the physician.', '2022-08-24 09:32:41', '2022-08-24 09:32:41', 'ans_a'),
(1522, NULL, 40, 1, '<p>A laparoscopic tubal ligation with Falope ring is completed. What is the correct CPT<br />\r\ncode assignm</p>', '58662', '58670', '58671', '49321', '2022-08-24 09:33:16', '2022-08-24 09:33:16', 'ans_c'),
(1523, NULL, 40, 1, '<p>A maternity patient is admitted in labor at 43 weeks. She has a spontaneous delivery<br />\r\nwith vacuum extraction to facilitate the baby&rsquo;s delivery. Which of the following would be<br />\r\nthe principal diagnosis?</p>', 'O48.0', 'O48.1', 'O80', 'O66.5', '2022-08-24 09:33:51', '2022-08-24 09:33:51', 'ans_b'),
(1524, NULL, 40, 1, '<p>If a patient is admitted with pneumococcal pneumonia and severe pneumococcal sepsis,<br />\r\nthe coding professional should:</p>', 'Assign codes for sepsis and pneumonia', 'Assign codes for sepsis, pneumonia, and severe sepsis', 'Assign only a code for pneumococcal pneumonia', 'Review the chart to determine if septic shock could be coded first', '2022-08-24 09:34:39', '2022-08-24 09:34:39', 'ans_b'),
(1525, NULL, 40, 1, '<p>A patient presents to the outpatient surgical area for a cystoscopy with multiple<br />\r\nbiopsies of the bladder. The patient&rsquo;s presenting symptom is hematuria. What is the correct<br />\r\nfacility code assignment for this procedure?</p>', '52000', '52000-22', '52204', '52204, 52204-22', '2022-08-24 09:35:23', '2022-08-24 09:35:23', 'ans_c'),
(1526, NULL, 40, 1, '<p>A patient has blepharoplasty of the left upper eyelid. What modifier should be used with<br />\r\nthe procedure?</p>', 'LT', 'TA', 'E1', 'F2', '2022-08-24 09:36:19', '2022-08-24 09:36:19', 'ans_c'),
(1527, NULL, 40, 1, '<p>A patient was admitted with pneumonia. Sputum cultures on day three of admission<br />\r\nindicate a Klebsiella pneumonia. What is the POA status for the Klebsiella pneumonia and<br />\r\nwhy?</p>', 'Y, because the pneumonia was present on admission, even though the organism was not verified until days later', 'N, because the type of pneumonia was not verified until after admission', 'U, because the coding professional must query the physician for POA status in this case', 'W, because the physician cannot tell if the reason for the pneumonia at the time of admission was the Klebsiella or not', '2022-08-24 09:37:23', '2022-08-24 09:37:23', 'ans_a'),
(1528, NULL, 40, 1, '<p>If the principal diagnosis is an initial anterior wall myocardial infarction, which<br />\r\nprocedure will result in the highest MS-DRG assignment?</p>', 'Mechanical ventilator', 'Insertion central venous catheter', 'Right heart cardiac catheterization', 'Transbronchial lung biopsy via bronchoscopy', '2022-08-24 09:38:02', '2022-08-24 09:38:02', 'ans_d'),
(1529, NULL, 40, 1, '<p>The abstracting of this data element has an impact on the DRG reimbursement.</p>', 'Date of service', 'Discharge disposition', 'Admission source', 'Medical record number', '2022-08-24 09:38:58', '2022-08-24 09:38:58', 'ans_b'),
(1530, NULL, 40, 1, '<p>Dr. Jones is the attending physician for a patient admitted with aspiration of a ballpoint<br />\r\npen cap. Dr. Westwood is the provider who performed a direct laryngoscopy with foreign<br />\r\nbody removal on the patient the afternoon of admission. Monitoring of the patient&rsquo;s<br />\r\nrespiratory status continued for 36 hours after the procedure as severe swelling of the<br />\r\nlarynx was noted during the laryngoscopy. On the morning of discharge, the patient was<br />\r\nnoted to have acute, suppurative otitis media of the right ear and Dr. Phillips performed a<br />\r\nmyringotomy with tube insertion under general anesthesia with assistance from Dr.<br />\r\nJohannsen, the resident.&nbsp;Upon discharge, which physician will be assigned to the principal procedure that was<br />\r\nperformed?</p>', 'Dr. Jones', 'Dr. Westwood', 'Dr. Johannsen', 'Dr. Phillips', '2022-08-24 09:39:57', '2022-08-24 09:39:57', 'ans_b'),
(1531, NULL, 40, 1, '<p>A&nbsp;patient is admitted with an acute inferior myocardial infarction and discharged alive.<br />\r\nWhich condition would increase the MS-DRG weight?</p>', 'Respiratory failure', 'Atrial fibrillation', 'Hypertension', 'History of myocardial infarction', '2022-08-24 09:40:49', '2022-08-24 09:40:49', 'ans_a'),
(1532, NULL, 40, 1, '<p>Documentation in the health record reveals that a patient is admitted with an acute<br />\r\nexacerbation of COPD (MS-DRG 192). Which of the following could potentially result in a<br />\r\nhigher weighted MS-DRG if documented as an associated diagnosis at the time of<br />\r\nadmission?</p>', 'Angina and treated with nitroglycerin prn', 'Atrial fibrillation and underwent a cardioversion', 'Respiratory failure treated with intubation and mechanical ventilation for 23 hours', 'Anemia and was given a blood transfusion', '2022-08-24 09:41:43', '2022-08-24 09:41:43', 'ans_c'),
(1533, NULL, 40, 1, '<p>A female patient is diagnosed with congestive heart failure. Which of the following will<br />\r\nincrease the MS-DRG weight if present on admission?</p>', 'Atrial fibrillation', 'Stage III pressure ulcer of coccyx', 'Blood loss anemia', 'Coronary artery disease', '2022-08-24 09:42:44', '2022-08-24 09:42:44', 'ans_b'),
(1534, NULL, 40, 1, '<p>A 7-year-old patient was admitted to the emergency department for treatment of<br />\r\nshortness of breath. The patient is given epinephrine and nebulizer treatments. The<br />\r\nshortness of breath and wheezing are unabated following treatment. What diagnosis should<br />\r\nbe suspected?</p>', 'Acute bronchitis', 'Acute bronchitis with chronic obstructive pulmonary disease', 'Asthma with status asthmaticus', 'Chronic obstructive asthma', '2022-08-24 09:43:20', '2022-11-17 13:28:59', 'ans_c'),
(1535, NULL, 40, 1, '<p>FNA and core biopsies are done on the same breast lesion, in the same session, on the<br />\r\nsame day, both performed with fluoroscopic guidance. What codes would be assigned?</p>', '19100, 10007-59', '10007 ×2, 19100 ×2, 77002', '10007, 10008, 19100 ×2', '19100, 10007-59, 77002', '2022-08-24 09:44:32', '2022-08-24 09:44:32', 'ans_a'),
(1536, NULL, 40, 1, '<p>A&nbsp;patient is admitted post&ndash;back surgery with uncontrolled pain and leakage at the<br />\r\nsurgical site. Vitals show a fever of 101 with some tachycardia noted as well. The attending<br />\r\nphysician documents inflammation, with an infectious disease consultant documenting<br />\r\nStaphylococcus aureus infection based on the lab culture. How should the coding<br />\r\nprofessional resolve the discrepancy between the diagnoses documented?</p>', 'Code the inflammation since that is what the attending physician documented', 'Code the infection since the consultant was specific regarding the type of infection', 'Code the infection based on the lab culture results', 'Query the attending physician to clarify the conflicting documentation', '2022-08-24 09:45:24', '2022-08-24 09:45:24', 'ans_d'),
(1537, NULL, 40, 1, '<p>When a compliant query remains unanswered, what is the next step for the coding<br />\r\nprofessional?</p>', 'Ask the HIM director to place the physician on suspension until the query is answered.', 'Alert the CEO that the query is outstanding, requesting a fine until the query is answered.', 'Refer to the internal escalation policy and follow the process outlined therein.', 'Report the physician to the peer review committee for disciplinary measures.', '2022-08-24 09:46:24', '2022-08-24 09:46:24', 'ans_c'),
(1538, NULL, 40, 1, '<p>A&nbsp;completed and signed operative report needs clarification of the size of the skin<br />\r\nlesions that were removed. What process is used for that clarification?</p>', 'Amendment', 'Addendum', 'Update', 'Revision', '2022-08-24 09:50:49', '2022-11-17 13:18:06', 'ans_a'),
(1539, NULL, 40, 1, '<p>Which of the following statements best describes how the retention of records should<br />\r\nbe determined?</p>', 'Unless state law requires longer periods of time, specific patient health information should be retained for HIPAA-established minimum time periods.', 'AHIMA has published specific guidelines for retention of health information and these guidelines should be followed for records retention.', 'The Joint Commission has developed standards for retention of health information that must be followed to maintain accreditation and these standards should be adhered to with regard to time frames.', 'Health records should be retained according to their use in a healthcare entity and the state and federal laws do not apply to the retention of this health information.', '2022-08-24 09:54:40', '2022-08-24 09:54:40', 'ans_a'),
(1540, NULL, 40, 1, '<p>Which patient-specific UHDDS items also have the potential to have an impact on MSDRG<br />\r\nassignment?</p>', 'Race and residence', 'Residence and sex', 'Sex and discharge disposition', 'Discharge disposition and race', '2022-08-24 09:55:32', '2022-08-24 09:55:32', 'ans_c'),
(1541, NULL, 40, 1, '<p>A&nbsp;patient was admitted for evaluation of chest pain. CAD was discovered upon<br />\r\ncompletion of a left heart cath done with evaluation of the left heart, multiple coronary<br />\r\narteries, and aortography with low osmolar contrast. A non-drug eluting stent was required<br />\r\nin the left anterior descending artery to alleviate the blockage. Prior to discharge the patient<br />\r\nfell out of bed and suffered a left greater trochanter hip fracture. Open reduction, internal<br />\r\nfixation was performed. Two days after the ORIF, the patient began running a fever and had<br />\r\nchills. A post-op infection was diagnosed and a PICC line was inserted into the superior vena<br />\r\ncava for administration of IV antibiotics over the next several weeks. Which of the following<br />\r\nwould be the principal procedure for this patient&rsquo;s stay?</p>', '02HV33Z', '4A023N7', '0QS704Z', '02703DZ', '2022-08-24 09:56:18', '2022-10-29 13:28:07', 'ans_d'),
(1542, NULL, 40, 1, '<p>A 59-year-old female patient presents with acquired hallux rigidus. Hallux rigidus repair<br />\r\nis performed with resection of the joint with implant in the first left toe proximal phalanx.<br />\r\nWhat codes would be assigned?</p>', 'M20.12, 28290-LT', 'M20.22, 28291-TA', 'M20.31, 28291-T5', 'M20.12, 28291-TA', '2022-08-24 09:57:04', '2022-08-24 09:57:04', 'ans_b'),
(1543, NULL, 40, 1, '<p>A&nbsp;patient is admitted for removal of the gallbladder due to chronic cholecystitis. While<br />\r\nperforming a common bile duct exploration, a non-obstructive calculus was found and<br />\r\nremoved as well. Assign the correct coding sequence for a total laparoscopic<br />\r\ncholecystectomy with percutaneous endoscopic removal of common bile duct stones</p>', '0FC90ZZ, Extirpation of matter from common bile duct, open approach 0FB40ZZ, Excision of gallbladder, open approach', '0FB40ZZ, Excision of gallbladder, open approach', '0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach 0FT40ZZ, Resection of gallbladder, open approach', '0FT44ZZ, Resection of gallbladder, percutaneous endoscopic approach and 0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach', '2022-08-24 10:01:51', '2022-08-24 10:01:51', 'ans_d'),
(1544, NULL, 40, 1, '<p>A patient with COPD is admitted with an acute exacerbation of chronic systolic heart<br />\r\nfailure. On day three of the admission, the provider documents the patient now is<br />\r\nexperiencing an acute exacerbation of his COPD. What is the POA indicator for the COPD<br />\r\nexacerbation?</p>', 'Y', 'N', 'U', 'W', '2022-08-24 10:03:30', '2022-08-24 10:03:30', 'ans_b'),
(1545, NULL, 40, 1, '<p>A Medicare patient admitted as an inpatient with acute abdominal pain is found to have<br />\r\nappendicitis and has an appendectomy. The patient has a length of stay of two days.<br />\r\nReimbursement will be paid under which classification system?</p>', 'MS-DRG', 'APG', 'RBRVS', 'APC', '2022-08-24 10:04:20', '2022-08-24 10:04:20', 'ans_a'),
(1546, NULL, 40, 1, '<p>Medicare severity diagnostic-related groups (MS-DRGs) and ambulatory patient<br />\r\nclassifications (APCs) are dissimilar in that:</p>', 'There is only one MS-DRG per inpatient discharge but one or more APCs per outpatient visit', 'There are many MS-DRGs per inpatient discharge but only one APC per outpatient visit', 'There are more possible MS-DRGs for inpatients than there are APCs for outpatients', 'There are up to three MS-DRGs per each inpatient discharge but there are up to seven APCs per outpatient visit', '2022-08-24 10:06:26', '2022-08-24 10:06:26', 'ans_a'),
(1547, NULL, 40, 1, '<p>Which of the following services are paid under the outpatient prospective payment<br />\r\nsystem (OPPS)?</p>', 'Ambulance services', 'Same-day surgeries', 'Physician fees', 'Inpatient procedures', '2022-08-24 10:08:31', '2022-08-24 10:08:31', 'ans_b'),
(1548, NULL, 40, 1, '<p>Which abstracted data elements can cause a potential increase in an MS-DRG<br />\r\nassignment and corresponding increase in reimbursement?</p>', 'Race and payer', 'Complications and comorbidities', 'Ethnicity and age', 'Discharge date and disposition', '2022-08-24 10:09:18', '2022-08-24 10:09:18', 'ans_b'),
(1549, NULL, 40, 1, '<p>A patient is admitted with lethargy, congestive heart failure, and pleural effusion. The<br />\r\npatient underwent treatment with diuretics for the CHF, which has cleared. The pleural<br />\r\neffusion required a thoracentesis to determine the cause. At the time of discharge, the<br />\r\neffusion was decreased but not resolved. The correct coding assignment for this case would be:</p>', 'Congestive heart failure', 'Pleural effusion', 'Congestive heart failure and pleural effusion', 'Lethargy, congestive heart failure, and pleural effusion', '2022-08-24 10:10:43', '2022-08-24 10:10:43', 'ans_c'),
(1550, NULL, 40, 1, '<p>A patient was admitted with pneumonia. A sputum culture was able to identify<br />\r\nMycoplasma pneumoniae, which the consulting pulmonologist documented as the cause of<br />\r\nthe pneumonia. The patient was also diagnosed with an E. coli UTI. In the final diagnosis<br />\r\nstatement, the attending physician documents E. coli pneumonia and UTI. How will the<br />\r\ncoding professional code the pneumonia?</p>', 'Assign the code based on the final diagnostic statement', 'Assign the pneumonia code based on the consultant’s documentation', 'Assign the pneumonia code based on the sputum result', 'Query the attending provider to clarify the pneumonia organism', '2022-08-24 10:12:11', '2022-08-24 10:12:11', 'ans_d'),
(1551, NULL, 40, 1, '<p>A patient&rsquo;s discharge summary does not contain a diagnosis that is documented by the<br />\r\nanesthesiologist in a preoperative evaluation and that would impact MS-DRG assignment.<br />\r\nThe coding professional finds no evidence that the diagnosis contradicts documentation<br />\r\nfrom the attending physician. The coding professional should:</p>', 'Code only from the discharge diagnoses', 'Code the diagnosis reflected on the anesthesia preoperative evaluation', 'Code the most severe symptom', 'Query the attending physician regarding the clinical significance of that diagnosis', '2022-08-24 10:13:59', '2022-12-09 07:16:48', 'ans_d'),
(1552, NULL, 40, 1, '<p>When an inpatient has had multiple tests to evaluate an abnormal finding but no<br />\r\ndefinitive diagnosis has been documented, the coding professional should:</p>', 'Assign a code for the abnormal finding without confirming with the physician', 'Not assign any code for the abnormal finding', 'Assign a diagnosis code based on the coding professional’s judgment', 'Query the physician regarding whether a diagnosis should be assigned or not', '2022-08-24 10:33:29', '2022-08-24 10:33:29', 'ans_d'),
(1553, NULL, 40, 1, '<p>What is assigned to CPT codes to indicate whether a service or procedure will be<br />\r\nseparately reimbursed under the OPPS?</p>', 'Ambulatory payment classifications', 'Payment status indicators', 'Payment modifiers', 'Diagnosis-related groups', '2022-08-25 09:33:58', '2022-08-25 09:33:58', 'ans_b'),
(1554, NULL, 40, 1, '<p>Under which of the following circumstances does a healthcare entity lose a potential<br />\r\nincrease in reimbursement when a hospital-acquired condition (HAC) is coded without a<br />\r\nPOA indicator of &ldquo;Y&rdquo;?</p>', 'When the HAC is the only CC/MCC on the account', 'When the HAC is listed as the principal diagnosis', 'When the HAC is coded along with a surgical procedure', 'When the HAC is the only diagnosis listed', '2022-08-25 09:35:11', '2022-08-25 09:35:11', 'ans_a'),
(1555, NULL, 40, 1, '<p>A coding professional is working from his work queue and gets assigned the outpatient<br />\r\nsurgery record of the hospital administrator. Is this an ethical issue? Why or why not?</p>', 'Yes, only the coding supervisor should code the record of the administrator', 'Yes, the coding professional should never work on a chart of another hospital employee', 'No, the coding professional can code the record as normal and look at previous encounters', 'No, the coding professional can assign codes for the encounter without an ethical concern', '2022-08-25 09:36:05', '2022-08-25 09:36:05', 'ans_d'),
(1556, NULL, 40, 1, '<p>A condition that is established after study to be chiefly responsible for the admission is<br />\r\nthe:</p>', 'Reason for visit', 'Principal procedure', 'A complication of outpatient care', 'Principal diagnosis', '2022-08-25 09:38:38', '2022-08-25 09:38:38', 'ans_d'),
(1557, NULL, 40, 1, '<p>Admitted to the vaginal delivery for gestational diabetes. After vaginal</p>\r\n\r\n<p>Delivery, patient got second degree laceration on perineum muscle. What is the<br />\r\nappropriate POA assignment for Gestational diabetes and second-degree<br />\r\nlaceration repair for this condition?</p>', 'Gestational Diabetes -POA-Y and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-N and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-W and Second-degree laceration -POA-N', 'Gestational Diabetes -POA-U and Second-degree laceration -POA-Y', '2022-08-25 09:39:41', '2022-08-25 09:39:41', 'ans_a'),
(1558, NULL, 40, 1, '<p>What is the correct ICD-10 CM code assignment for unspecified gastritis<br />\r\nwithout bleeding?</p>', 'K29.50', 'K29.00', 'K29.20', 'K29.70', '2022-08-25 09:40:53', '2022-08-25 09:40:53', 'ans_d'),
(1559, NULL, 40, 1, '<p>What is the correct ICD-10 CM Code assignment for Upper respiratory<br />\r\ninfection due to possible Rhino virus and Dehydration?</p>', 'J06.9, E86.0', 'J06.9, B97.35', 'J06.9, B97.7', 'J06.9, B99.9', '2022-08-25 09:41:32', '2022-08-25 09:41:32', 'ans_a'),
(1560, NULL, 40, 1, '<p>Jones admitted to the hospital with cellulitis of left axilla and clinical<br />\r\nfeatures of sepsis and also found to have an additional diagnosis of PNA and<br />\r\nUTI.What is the appropriate ICD-10 CM code assignment for this scenario?</p>', 'A41.9, L03.112, J18.9 and N39.0', 'L03.112, J18.9, A41.9 and N39.0', 'J18.9, L03.112, A41.9 and N39.0', 'N39.0, J18.9, L03.112 and J18.9', '2022-08-25 09:42:43', '2022-08-25 09:42:43', 'ans_a'),
(1561, NULL, 40, 1, '<p>Mrs. Carolyn Vincent, 86 yrs old woman admitted to the hospital with the<br />\r\ndehydration, attending physician confirming that dehydration was treated as<br />\r\nprimarily and underwent endocrinologist stated as hyponatremia treated with IV<br />\r\nFluids. What is the appropriate PDX assignment for this scenario?</p>', 'Dehydration', 'Hyponatremia', 'Dehydration or Hyponatremia', 'Abnormal lab value', '2022-08-25 09:43:44', '2022-08-25 09:43:44', 'ans_a'),
(1562, NULL, 40, 1, '<p>Mr. Burks Dean admitted to the hospital for vaginal delivery. Patient got<br />\r\ncomplication, decided and performed vacuum assisted delivery and newborn<br />\r\nbaby got birth trauma. Neonatal baby noted to have cerebral hemorrhage.<br />\r\nWhat is the appropriate POA assignment for cerebral hemorrhage?</p>', 'Cerebral hemorrhage =Y-Present on admission', 'Cerebral hemorrhage =N -Not Present on admission', 'Cerebral hemorrhage =U-Unknown', 'Cerebral hemorrhage =W -Clinical Undetermined', '2022-08-25 09:45:01', '2022-08-25 09:45:01', 'ans_a'),
(1563, NULL, 40, 1, '<p>Patient admitted to the St. Mary hospital for planned Laparoscopic<br />\r\ncholecystectomy. What is the appropriate CPT code assignment for this case?</p>', '47562', '47600', '47605', '47563', '2022-08-25 09:45:45', '2022-08-25 09:45:45', 'ans_a'),
(1564, NULL, 40, 1, '<p>Patient presented to the hospital with SOB, patient developed Complication<br />\r\nand transferred to the Veterans administration hospital. What is the correct<br />\r\ndisposition assignment for this report?</p>', 'Transferred to Federal hospital', 'Transferred to acute care hospital', 'Discharged to home health', 'None of the above', '2022-08-25 09:46:56', '2022-11-02 17:14:59', 'ans_a'),
(1565, NULL, 40, 1, '<p>Neonatal baby born via vaginal delivery, mother was diabetic, baby<br />\r\nunderwent Glucose monitoring shows negative and GBS +VE mom and<br />\r\nunderwent vaccination in current encounter. What is the appropriate diagnosis<br />\r\ncodes for this report?</p>', 'Z38.00, Z05.41, Z23', 'Z38.00, Z05.43, Z23', 'Z38.00, Z05.42, Z23', 'Z38.00, Z05.2, Z23', '2022-08-25 09:47:44', '2022-11-15 11:28:33', 'ans_b'),
(1566, NULL, 40, 1, '<p>Patient admitted to the hospital with Type-2 Subsequent MI in previous visit<br />\r\nAdmitted for initial type -2 MI. What is the appropriate PDX selection for this<br />\r\ncase?</p>', 'Code the I122 Category set of codes for Subsequent Type-2 MI', 'Code the I21 Category set of codes for Subsequent Type-2 MI', 'Code the I21.7 Category set of codes for Subsequent Type-2 MI', 'Code the I25.2 Category for set of codes for Subsequent Type-2 MI', '2022-08-25 09:48:42', '2022-08-25 09:48:42', 'ans_b'),
(1567, NULL, 40, 1, '<p>Patient presented to the hospital for chest pain and SOB, noted to have<br />\r\ndiaphoretic, elevated troponin &amp; Creatinine and BNP shows 12000.Chest x-ray<br />\r\nshows cardiomegaly. Treated with IV Fluids. What are all diagnosis you will assign<br />\r\nbased on the documentation?</p>', 'CHF, NSTEMI and AKI', 'CHF, STEMI and AKI', 'CHF and STEMI', 'CHF, NSTEMI and ATN', '2022-08-25 09:50:23', '2022-08-25 09:50:23', 'ans_a'),
(1568, NULL, 40, 1, '<p>Clinical Indicator&rsquo;s:<br />\r\nPatient presented to the hospital with sepsis and PNA, developed hypotension.<br />\r\nVasopressin administration was done, not controlled, For which condition you will<br />\r\nraise query for?</p>', 'Query for Septicemia', 'Query for Severe Sepsis', 'Query for Systemic inflammatory response syndrome with non-infectious process.', 'Query for Septic Shock', '2022-08-25 10:09:36', '2022-08-25 10:09:36', 'ans_d'),
(1569, NULL, 40, 1, '<p>An 11 yrs. old boy presented to the hospital with unilateral Tonsillectomy.<br />\r\nWhat modifier you will assign for this case?</p>', '42821-50', '42820-51', '42825-59', '42825-52', '2022-08-25 10:10:42', '2022-08-25 10:10:42', 'ans_d'),
(1570, NULL, 40, 1, '<p>Patient admitted to the hospital with Colon mass. Physician performed the<br />\r\npolypectomy in the sigmoid colon and biopsy at the descending colon. What<br />\r\nmodifier will append for this scenario.</p>', 'XU', 'XE', 'XP', 'XS', '2022-08-25 10:11:22', '2022-08-25 10:11:22', 'ans_d'),
(1571, NULL, 40, 1, '<p>What is the appropriate code assignment for traumatic subarachnoid<br />\r\nhemorrhage without LOC with cerebral edema underwent clot evacuation in the<br />\r\nsubarachnoid space. What is the appropriate ICD-10 CM and PCS code<br />\r\nassignment?</p>', 'S06.5X0A, S06.1X0A, 00C53ZZ', 'S06.6X0A, S06.1X0A, 00C53ZZ', 'S06.812A, S06.1X0A, 00C50ZZ', 'None of the above', '2022-08-25 10:12:07', '2022-08-25 10:12:07', 'ans_b'),
(1572, NULL, 40, 1, '<p>Mr. Ketuncky came to the hospital for dysphagia and SOB.<br />\r\nSwallow study was performed shows normal. Chest x-ray ordered and revealed<br />\r\nPNA.Clindamycin IV administration was done. In this case, for what diagnosis you<br />\r\nwill raise the query for?</p>', 'Query for Infectious pneumonia', 'Query for COVID-19 Pneumonia', 'Query for Aspiration pneumonia', 'Query for Septic shock', '2022-08-25 10:12:44', '2022-08-25 10:12:44', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1573, NULL, 40, 1, '<p>Mrs. Zella admitted to the IP Hospital with following conditions, please choose<br />\r\nthe below option, which options you will choose for physician query.</p>', 'Acute Diastolic CHF, Respiratory failure, streptococcus pneumonia', 'Acute Diastolic CHF, chronic respiratory failure, viral pneumonia', 'Either A or B', 'None of the above', '2022-08-25 10:13:23', '2022-08-25 10:13:23', 'ans_a'),
(1574, NULL, 40, 1, '<p>Patient presented to the hospital with Skin tags removal of 25 lesions, how<br />\r\nwould you assign the correct CPT code for this scenario?</p>', '11200', '17110', '11200, 11201', '10060', '2022-08-25 10:13:53', '2022-08-25 10:13:53', 'ans_c'),
(1575, NULL, 40, 1, '<p>Patient admitted for vaginal delivery for pre-existing hypertension with 39<br />\r\nweeks of gestation, delivered a baby boy via normal vaginal delivery.<br />\r\nPlease select the diagnosis as per the sequencing direction.</p>', 'O10.93, Z3A.39, Z37.0', 'O10.92, Z3A.39, Z37.0', 'O10.913, Z3A.39, Z37.0', 'Z3A.39, O10.93, Z37.0', '2022-08-25 10:15:15', '2022-08-25 10:15:15', 'ans_b'),
(1576, NULL, 40, 1, '<p>A 65 yrs old male having 45 yrs with a PMH of tobacco dependence, currently<br />\r\nno active of smoking coming for evaluation of cancer. What is the correct code<br />\r\nassignment in this case?</p>', 'F17.200', 'F17.210', 'Z87.891', 'Z77.222, Z05.86', '2022-08-25 10:17:07', '2022-08-25 10:17:07', 'ans_c'),
(1577, NULL, 40, 1, '<p>Patient presented to the hospital with SOB, noted to have PMH of chronic<br />\r\nrespiratory failure, O2 therapy provided and nebulization is given. For what<br />\r\ncondition possibly query for?</p>', 'Asthma', 'COPD', 'Respiratory failure', 'All of the above', '2022-08-25 10:18:10', '2022-08-25 10:18:10', 'ans_b'),
(1578, NULL, 40, 1, '<p>Which of the following option in which major co-morbidity affecting the DRG?</p>', 'Anoxic Encephalopathy', 'Coma', 'COPD Exacerbation', 'Seizure', '2022-08-25 10:18:53', '2022-08-25 10:18:53', 'ans_b'),
(1579, NULL, 40, 1, '<p>An 55 yrs. old diabetic patient has non-proliferative diabetic retinopathy right<br />\r\n&ndash;(Moderate) greater than left side-(Mild)with chronic pancreatitis. How would<br />\r\nyou code this scenario?</p>', 'E11.3991, E11.3212, K86.1', 'E11.3311, E11.3212, K86.1', 'E11.37, K86.1', 'E11.352, E11.355 and K86.1', '2022-08-25 10:19:28', '2022-11-19 15:19:18', 'ans_b'),
(1580, NULL, 40, 1, '<p>How would follow the chart flow process in IP coding, Please choose the<br />\r\ncorrect option and sequence accordingly?</p>', 'Charge Coded, Service, registration, and diagnostic coding', 'Registration, diagnostic coding, services and charge coded', 'Diagnostic coding, registration, service and Charge coded', 'Registration, service, charge coded and diagnostic Coding', '2022-08-25 10:20:19', '2022-08-25 10:20:19', 'ans_d'),
(1581, NULL, 40, 1, '<p>Patient admitted for planned cholecystectomy, general anesthesia<br />\r\nadministered, patient developed hypotension, and physician terminated the<br />\r\nprocedure after administration of anesthesia. What is the appropriate CPT<br />\r\nmodifier you will assign in this case?</p>', '73', '74', '59', '79', '2022-08-25 10:20:47', '2022-08-25 10:20:47', 'ans_b'),
(1582, NULL, 40, 1, '<p>In DRG 637, Diabetes W/MCC, in below options which MCC affects the<br />\r\nselection of MS-DRG?</p>', 'Encephalopathy', 'Acute Respiratory failure', 'Crohn’s disease', 'Chronic bacteremia', '2022-08-25 10:22:09', '2022-08-25 10:22:09', 'ans_b'),
(1583, NULL, 40, 1, '<p>Patient underwent preventive medicine counselling for behavioral change<br />\r\ninterventions, individual services for which diagnosis?</p>', 'F11.20', 'F17.210', 'F11.21', 'F12.220', '2022-08-25 10:22:40', '2022-08-25 10:22:40', 'ans_b'),
(1584, NULL, 40, 1, '<p>Patient presented to the hospital with abdominal pain and general consult<br />\r\nwas done.EGD and colonoscopy performed shows gastritis and divericulitis.After<br />\r\nscopy evaluation it shows abdominal distention and shows ascites , paracentesis<br />\r\nwas performed. In this case, which PPX you will assign?</p>', 'Paracentesis', 'Colonoscopy', 'EGD', 'EGD and colonoscopy', '2022-08-25 10:23:11', '2022-08-25 10:23:11', 'ans_d'),
(1585, NULL, 40, 1, '<p>Patient presented to the hospital with one complaint. Header states<br />\r\nprocedure was performed right, and body of the report states it is performed on<br />\r\nthe left. In this case, How coder will deals this case?</p>', 'Code according to the operative report', 'Query the provider for laterality', 'Ask manager for further clarification', 'Go and ask physician directly how to code this case', '2022-08-25 10:23:51', '2022-08-25 10:23:51', 'ans_b'),
(1586, NULL, 40, 1, '<p>Patient presents for creation of an AV graft in the right arm. The brachial<br />\r\nartery and the basilic vein are dissected. Basilic vein was cannulated, a<br />\r\nnonautogenous AV graft is utilized, and a stent is advanced inside the AV graft<br />\r\nwhich is deployed inside the basilic vein thus creating a sutureless venous<br />\r\nanastomosis. Balloon angioplasty of the stent was performed, and a tunnel was<br />\r\ncreated for the graft. Contrast was injected under cinefluoroscopy and a<br />\r\nfistulogram and venogram were performed of the right upper extremity. The graft<br />\r\nwas completed successfully.<br />\r\nA pseudoaneurysm and a segment of the graft were dissected from the left upper<br />\r\nextremity. Patient tolerated the procedure well. How would you report this<br />\r\nservices?</p>', '36830,76936', '37205,75960', '36832', '36818', '2022-08-25 10:24:35', '2022-08-25 10:24:35', 'ans_a'),
(1587, NULL, 40, 1, '<p>Acute Suppurative otitis media in(ASOM) AD coded as _____</p>', 'H66.002', 'H66.001', 'H66.23', 'H66.43', '2022-08-25 10:25:33', '2022-11-02 04:08:04', 'ans_b'),
(1588, NULL, 40, 1, '<p>Patient presented to the hospital with ESRD underwent kidney transplant<br />\r\ntransferring kidney from twins. How would you code transferring kidney from<br />\r\nidentical twins in this case?</p>', '0TY10Z1-Identical twins-Syngeneic', '0TY10Z0-Identical twins-Allogenic', '0TY10Z2-Identical twins-Zooplastic', 'None of the above', '2022-08-25 10:26:05', '2022-08-25 10:26:05', 'ans_a'),
(1589, NULL, 40, 1, '<p>Patient presented to the hospital with Blepharoplasty for right upper eyelid<br />\r\nand left upper eyelid in this case. What is correct modifier for Eyelid in CPT<br />\r\nCoding?</p>', '15822-E1 and 15822-E3', '15822-50', '15822-E2 and 15822-E4', 'All of the above', '2022-08-25 10:27:08', '2022-10-19 07:02:38', 'ans_b'),
(1590, NULL, 40, 1, '<p>Patient presented to the hospital with CAD and underwent CABG in two<br />\r\narteries from aorta to coronary arteries and saphenous vein harvested from right<br />\r\nside and Cardiopulmonary bypass was instituted. Which one is the appropriate<br />\r\nPrimary PCS for this case?</p>', '021109W', '02100Z9', '5A1221Z', '06BP4ZZ', '2022-08-25 10:28:23', '2022-08-25 10:28:23', 'ans_a'),
(1591, NULL, 40, 1, '<p>Which of the following is a out of numeric sequence code in CPT Code book.</p>', '11005 is not to be reported with 76942', '10005, Fine needle aspiration biopsy including ultrasonic guidance, first lesion Don’t report 10005-10006 at the conjunction with 76942', '12005 is not to be reported with 76942, which is a resequenced code', 'None of the above.', '2022-08-25 10:29:00', '2022-08-25 10:29:00', 'ans_b'),
(1592, NULL, 40, 1, '<p>Patient presented to the hospital with head injury and also noted have scalp<br />\r\nand hand laceration, found to have a TBI was ruled out. What is the appropriate<br />\r\nPDX assignment for this case?</p>', 'Head injury', 'Hand laceration or scalp laceration', 'Observation for other conditions ruled out', 'All the above', '2022-08-25 10:29:38', '2022-08-25 10:29:38', 'ans_a'),
(1593, NULL, 40, 1, '<p>White working as chef doing chopping the vegetables at hotel using knife<br />\r\ngot scalp laceration of 5.0 cm and hand laceration of 1.0 cm, laceration was<br />\r\nrepaired at superficial level. In this case, how would you report the services?</p>', '12002, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9 and Y99.0', '12001, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9 and Y99.0', '12001, S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9', 'S01.01XA, S61.412A, W26.0XXA, Y92.000, Y93.G9', '2022-08-25 10:30:53', '2022-08-25 10:30:53', 'ans_a'),
(1594, NULL, 40, 1, '<p>What is the correct CPT code assignment for Carpal tunnel for median nerve<br />\r\nrelease?</p>', '64721-50', '64722', '64726', '64719', '2022-08-25 10:32:12', '2022-08-25 10:32:12', 'ans_a'),
(1595, NULL, 40, 1, '<p>In reimbursement coding, CPT codes are paid under which payment system in<br />\r\nreimbursement methodology?</p>', 'IPPS-Inpatient prospective payment system', 'APC-Ambulatory payment classification', 'OPPS-Outpatient prospective payment system', 'Hospital outpatient billing.', '2022-08-25 10:33:26', '2022-08-25 10:33:26', 'ans_b'),
(1596, NULL, 40, 1, '<p>When using the code book 2020. ICD-10 CM, Diabetes mellitus, physician does<br />\r\nnot mentioned type of Diabetes in the report. How would you report the type as<br />\r\nper the ICD-10 CM guidelines?</p>', 'Type-2 Diabetes Mellitus', 'Type-1 Diabetes Mellitus', 'Secondary DM', 'Other diabetes', '2022-08-25 10:34:17', '2022-08-25 10:34:17', 'ans_a'),
(1597, NULL, 40, 1, '<p>What is the correct CPT code assignment for injection of left paravertebral<br />\r\njoints at lumbar -two levels?</p>', '64490', '64490,64491', '64490,64492', '64493-LT,64494-LT', '2022-08-25 10:35:04', '2022-08-25 10:35:04', 'ans_d'),
(1598, NULL, 40, 1, '<p>Patient presented to the hospital with abdominal pain, nausea and vomiting<br />\r\nwith diarrhea. Final impression states crohn&rsquo;s disease and hyperlipidemia?</p>', 'K50.90, E78.5', 'R10.9, R11.2 & R19.7', 'K50.90', 'E78.5, R10.9,R11.2 & R19.7', '2022-08-25 10:35:36', '2022-08-25 10:35:36', 'ans_a'),
(1599, NULL, 40, 1, '<p>presented to the hospital with cachexia, nutritionist documented as<br />\r\n35% of muscle wasting, weight loss and validated as severe protein calorie<br />\r\nmalnutrition.</p>', 'Query the attending provider for malnutrition', 'Code the severe malnutrition', 'Query the nutritionist for BMI', 'Code malnutrition unspecified as per the report.', '2022-08-25 10:36:07', '2022-08-25 10:36:07', 'ans_a'),
(1600, NULL, 40, 1, '<p>What does the correct code assignment for HCPCS modifier F7 and F8 as per<br />\r\nthe CPT Code handbook?</p>', 'Right Hand fourth digit -F7 and Right hand fifth digit -F8.', 'Left hand first digit-F1 and Left hand second digit -F2.', 'Right hand third digit -F7 and right hand fourth digit -F8.', 'None of the above', '2022-08-25 10:36:40', '2022-08-25 10:36:40', 'ans_c'),
(1601, NULL, 40, 1, '<p>Patient admitted to the hospital with IP admission, after two days of<br />\r\nadmission patient was getting discharged. Under what payment system it is get<br />\r\nreimbursed?</p>', 'OPPS', 'IPPS', 'MS-DRG', 'Outpatient rehab center', '2022-08-25 10:37:32', '2022-08-25 10:37:32', 'ans_c'),
(1602, NULL, 40, 1, '<p>Patient has hypertensive urgency. As per the UHDDS guidelines, you will<br />\r\ncode this diagnosis as?</p>', 'Secondary diagnosis -SDX', 'Co-morbidity', 'Co-morbidity and Complication-1 st option you have to choose, if not available choose A option', 'Complication only', '2022-08-25 10:38:15', '2022-08-25 10:38:15', 'ans_a'),
(1603, NULL, 41, 1, '<p><strong>A 12-year-old boy was seen in an ambulatory surgical center for pain in his right arm. The x-ray showed fracture of ulna. </strong></p>\r\n\r\n<p><strong>Patient underwent closed reduction of fracture right proximal ulna and an elbow-to-finger cast was applied. </strong></p>\r\n\r\n<p><strong>What diagnostic and procedure codes should be assigned? </strong></p>\r\n\r\n<p><strong>S52.101AUnspecified fracture of upper end of right radius, initial encounter for closed fracture </strong></p>\r\n\r\n<p><strong>S52.101B Unspecified fracture of upper end of right radius, initial encounter for open fracture</strong></p>\r\n\r\n<p><strong>S52.001A Unspecified fracture of upper end of right ulna, initial encounter for closed fracture</strong></p>\r\n\r\n<p><strong>S52.001B Unspecified fracture of upper end of right ulna, initial encounter for open fracture</strong></p>\r\n\r\n<p><strong>0PSH0ZZ Reposition right radius, open approach</strong></p>\r\n\r\n<p><strong>0PSK0ZZ Reposition right ulna, open approach</strong></p>\r\n\r\n<p><strong>24670 Closed treatment of ulnar fracture, proximal end (eg, olecranon or coronoid process(es)); without manipulation</strong></p>\r\n\r\n<p><strong>24675 Closed treatment of ulnar fracture, proximal end (eg, olecranon or coronoid process(es)); with manipulation</strong></p>\r\n\r\n<p><strong>25560 Closed treatment of radial and ulnar shaft fractures; without manipulation</strong></p>\r\n\r\n<p><strong>29075 Application, cast; elbow to finger (short arm)</strong></p>', 'S52.101A, S52.001A, 0PSK0ZZ', 'S52.101B, S52.001B, 0PSH0ZZ', 'S52.101B, S52.001B, 25560, 29075', 'S52.001A, 24675', '2022-09-19 05:56:05', '2022-09-19 05:56:05', 'ans_d'),
(1604, NULL, 41, 1, '<p><strong>A 75-year-old male patient was admitted from a nursing home with dehydration and dysphagia due to a previous stroke. During hospitalization, the patient was rehydrated and transferred back to the nursing home. What codes should be assigned?</strong></p>', 'E86.0, I69.390, R13.19', 'E86.1, I69.391, R13.10', 'E86.9, I69.390, R13.19', 'E86.0, I69.391, R13.10', '2022-09-19 05:57:09', '2022-09-19 05:57:09', 'ans_d'),
(1605, NULL, 41, 1, '<p><strong>Sepsis due to the presence of an indwelling urinary catheter with a positive blood culture reflected in the progress notes as Staphylococcus aureus sepsis. What codes should be assigned?</strong></p>', 'T83.511A, A41.01', 'T83.511A, A41.9', 'T83.510A, R78.81', 'T81.44XA, A41.01', '2022-09-19 06:01:40', '2022-09-19 06:01:40', 'ans_a'),
(1606, NULL, 41, 1, '<p><strong>A laparoscopic tubal ligation is completed. What is the correct CPT code assignment?</strong></p>\r\n\r\n<p><strong>49320 Laparoscopy, abdomen, peritoneum, and omentum, diagnostic, with or without collection of specimen(s) by brushing or washing (separate procedure)</strong></p>\r\n\r\n<p><strong>58662 Laparoscopy, surgical; with fulguration or excision of lesions of the ovary, pelvic viscera, or peritoneal surface by any method</strong></p>\r\n\r\n<p><strong>58670 Laparoscopy, surgical; with fulguration of oviducts (with or without transection)</strong></p>\r\n\r\n<p><strong>58671 Laparoscopy, surgical; with occlusion of oviducts by device (eg, band, clip, or Falope ring)</strong></p>', '49320, 58662', '58670', '58671', '49320', '2022-09-19 06:02:44', '2022-09-19 06:02:44', 'ans_b'),
(1607, NULL, 41, 1, '<p><strong>A patient is admitted to an acute-care facility with chest pain. The patient was awakened from sleep by the pain. This was the patient&rsquo;s first experience with chest pain. The patient was given two nitroglycerin tablets in the emergency department. The chest pain was not relieved, resulting in the diagnosis of new onset unstable angina. Serial creatine phosphokinase was normal. Following a left cardiac catheterization with fluoroscopic angiogram of multiple coronary arteries with low osmolar contrast, the patient is found to have arteriosclerotic coronary artery disease. What ICD-10-CM and PCS codes should be assigned?</strong></p>', 'I25.10, 4A023N7, B2111ZZ', 'I25.110, 4A023N7, B211Y10', 'I25.110, 4A023N7, B2111ZZ', 'I25.110, 4A023N6, B2111ZZ', '2022-09-19 06:03:33', '2022-09-19 06:03:33', 'ans_c'),
(1608, NULL, 41, 1, '<p><strong>Normal twin delivery at 30 weeks. Both babies were delivered vaginally and were liveborn. What conditions should have codes assigned?</strong></p>\r\n\r\n<p><strong>O30.003Twin pregnancy, unspecified number of placenta and unspecified number of amniotic sacs, third trimester</strong></p>\r\n\r\n<p><strong>O30.009Twin pregnancy, unspecified number of placenta and unspecified number of amniotic sacs, unspecified trimester</strong></p>\r\n\r\n<p><strong>O60.14X0Preterm labor third trimester with preterm delivery third trimester, not applicable or unspecified</strong></p>\r\n\r\n<p><strong>O60.14X1Preterm labor third trimester with preterm delivery third trimester, fetus 1</strong></p>\r\n\r\n<p><strong>O60.14X2Preterm labor third trimester with preterm delivery third trimester, fetus 2</strong></p>\r\n\r\n<p><strong>O80Encounter for full-term uncomplicated delivery</strong></p>\r\n\r\n<p><strong>Z3A.3030 weeks gestation of pregnancy</strong></p>\r\n\r\n<p><strong>Z37.0Single live birth</strong></p>\r\n\r\n<p><strong>Z37.2Twins, both liveborn</strong></p>', 'O80, Z3A.30, Z37.0', 'O30.003, O60.14X0, Z3A.30, Z37.2', 'O60.14X1, O60.14X2 O30.003, Z3A.30, Z37.2', 'O80, O30.009, Z3A.30, Z37.2', '2022-09-19 06:05:24', '2022-09-19 06:05:24', 'ans_c'),
(1609, NULL, 41, 1, '<p><strong>A patient is admitted with metastatic carcinoma from breast to liver with previous bilateral mastectomy and no reoccurrence at the primary site. In the progress note of day three, the physician indicates that patient now has pneumonia and begins treatment with an antibiotic that will be continued on discharge. What is the proper coding and sequencing of this admission?</strong></p>', 'C78.6, Z85.3, Z90.13', 'C78.7, J18.9, Z85.3, Z90.13', 'J18.9, C78.7, Z90.13', 'C78.7, Z85.3, Z90.10', '2022-09-19 06:06:27', '2022-09-19 06:06:27', 'ans_b'),
(1610, NULL, 41, 1, '<p><strong>Patient admitted with syncope due to taking Valium in combination with an over-the-counter antihistamine, taken as directed on the package but without consulting a healthcare provider. What are the correct codes and sequencing for this admission?</strong></p>', 'R55, T42.4X1A, T45.0X1A', 'T42.4X1A, T45.0X1A, R55', 'T45.0X1A, T42.4X1A', 'R55, T42.4X6A, T45.0X5A', '2022-09-19 06:07:55', '2022-09-19 06:07:55', 'ans_b'),
(1611, NULL, 41, 1, '<p><strong>A 50-year-old woman with a diagnosis of metastatic ovarian cancer to the pleura has an outpatient thoracoscopic pleurodesis performed. What is the correct coding and sequencing?</strong></p>', 'C56.9, C78.2, 32650', 'C78.2, C56.9, 32650', 'C78.2, C56.9, 32661', 'C56.9, C78.2, 32609', '2022-09-19 06:08:51', '2022-09-19 06:08:51', 'ans_b'),
(1612, NULL, 41, 1, '<p><strong>A patient with acute respiratory failure, hypertension, and congestive heart failure is admitted for intubation and ventilation. The patient&rsquo;s heart failure is stable on current medications. What are the correct diagnosis codes and sequencing?</strong></p>\r\n\r\n<p><strong>I10 Essential hypertension</strong></p>\r\n\r\n<p><strong>I11.0 Hypertensive heart with heart failure</strong></p>\r\n\r\n<p><strong>I50.9 Heart failure, unspecified</strong></p>\r\n\r\n<p><strong>J96.00 Acute respiratory failure, unspecified whether with hypoxia or hypercapnia</strong></p>\r\n\r\n<p><strong>J96.20 Acute and chronic respiratory failure, unspecified whether with hypoxia or hypercapnia</strong></p>', 'J96.00, I11.0, I50.9', 'I50.9, J96.00, I10', 'J96.20, I10, I50.9', 'I50.9, J96.20, I11.0', '2022-09-19 06:11:11', '2022-09-19 06:11:11', 'ans_a'),
(1613, NULL, 41, 1, '<p><strong>A 34-year-old woman delivered a live-born, term baby boy (39 weeks) with macrosomia. She had a hemorrhage following a low forceps delivery with episiotomy but prior to expulsion of the placenta. What are the appropriate codes and sequencing for this record?</strong></p>', 'O67.8, O36.63X0, Z37.0, 10D07Z3, 0W8NXZZ', 'Z37.0, O67.9, O36.63X1, Z3A.39, 10D07Z3, 0W8NXZZ', 'O36.80X0, O67.9, Z37.0, Z3A.39, 0W8NXZZ, 10D07Z3', 'O67.9, O36.63X0, Z37.0, Z3A.39, 10D07Z3, 0W8NXZZ', '2022-09-19 06:12:03', '2022-09-19 06:12:03', 'ans_d'),
(1614, NULL, 41, 1, '<p><strong>A 64-year-old female was discharged with the final diagnosis of acute renal failure and hypertension. What coding guideline applies?</strong></p>', 'Use combination code of hypertension and chronic renal failure.', 'Use separate codes for hypertension and chronic renal failure', 'Use separate codes for hypertension and acute renal failure.', 'Use combination code for hypertension and acute renal failure.', '2022-09-19 06:13:20', '2022-09-19 06:13:20', 'ans_c'),
(1615, NULL, 41, 1, '<p><strong>&nbsp;A patient was discharged from observation following an outpatient surgery with the following diagnoses: posterior subcapsular, mature, incipient, senile cataract right eye, diabetes mellitus, hypertension, with treatment for mild acute renal failure. Which codes are correct?</strong></p>\r\n\r\n<p><strong>E11.36 Type 2 diabetes mellitus with diabetic cataract</strong></p>\r\n\r\n<p><strong>E11.29 Type 2 diabetes mellitus with other diabetic kidney complication</strong></p>\r\n\r\n<p><strong>E11.9 Type 2 diabetes mellitus without complications</strong></p>\r\n\r\n<p><strong>H25.9 Unspecified age-related cataract</strong></p>\r\n\r\n<p><strong>H25.21 Age-related cataract, morgagnian type, right eye</strong></p>\r\n\r\n<p><strong>H25.041 Posterior subcapsular polar age-related cataract, right eye</strong></p>\r\n\r\n<p><strong>I10 Essential hypertension</strong></p>\r\n\r\n<p><strong>I12.9 Hypertensive chronic kidney disease with stage 1 through stage 4, or unspecified chronic kidney disease</strong></p>\r\n\r\n<p><strong>N17.9 Acute kidney failure, unspecified</strong></p>', 'H25.21, E11.29, I12.9, N17.9', 'E11.36, H25.041, I10, N17.9', 'H25.9, E11.29, I12.9, N17.9', 'H25.041, E11.9, I12.9', '2022-09-19 06:14:57', '2022-09-19 06:14:57', 'ans_b'),
(1616, NULL, 41, 1, '<p><strong>Current Procedural Terminology (CPT) defines a separate procedure as which of the following?</strong></p>', 'Procedure considered an integral part of a more major service', 'Procedure that requires provision of anesthesia', 'Procedure that requires an add-on code', 'A surgical procedure performed in conjunction with an E/M visit', '2022-09-19 06:15:53', '2022-09-19 06:15:53', 'ans_a'),
(1617, NULL, 41, 1, '<p><strong>Documentation from the nursing or other allied health professionals&rsquo; notes can be used to provide specificity for code assignment for which of the following diagnoses?</strong></p>', 'Body mass index (BMI)', 'Malnutrition', 'Aspiration pneumonia', 'Fatigue', '2022-09-19 06:16:56', '2022-09-19 06:16:56', 'ans_a'),
(1618, NULL, 41, 1, '<p><strong>A 30-year-old patient was seen in the emergency department for recurrent seizures. The patient also had tic douloureux. What codes should be assigned?</strong></p>', 'R56.9, G50.0', 'G40.909, G50.0', 'R56.9, G50.8', 'G40.919, F95.9', '2022-09-19 06:17:34', '2022-09-19 06:17:34', 'ans_b'),
(1619, NULL, 41, 1, '<p><strong>A laparoscopic cholecystectomy was performed. What is the correct ICD-10-PCS code?</strong></p>\r\n\r\n<p><strong>0FB40ZZ Excision of gallbladder, open approach</strong></p>\r\n\r\n<p><strong>0FB44ZZ Excision of gallbladder, percutaneous endoscopic approach</strong></p>\r\n\r\n<p><strong>0FT40ZZ Resection of gallbladder, open approach</strong></p>\r\n\r\n<p><strong>0FT44ZZ Resection of gallbladder, percutaneous endoscopic approach</strong></p>', '0FB40ZZ', '0FT40ZZ', '0FT44ZZ', '0FB44ZZ', '2022-09-19 06:18:42', '2022-09-19 06:18:42', 'ans_c'),
(1620, NULL, 41, 1, '<p><strong>A 59-year-old man who works in construction is diagnosed with basal cell carcinoma of the eyelid. An excision of basal cell carcinoma of the left upper eyelid was performed with an excised diameter of 1.9 cm and single layer closure. What codes and modifiers should be assigned?</strong></p>', 'C44.121, 11622-E2', 'C44.1191, 11642-E1', 'C44.1191, 11640-E1', 'C44.121, 11642-E2', '2022-09-19 06:19:26', '2022-09-19 06:19:26', 'ans_b'),
(1621, NULL, 41, 1, '<p><strong>Carcinoma of multiple overlapping sites of the bladder. Diagnostic cystoscopy and transurethral fulguration of bladder lesions over the dome and posterior wall (1.9 cm) were completed. A biopsy was taken of a lesion in the lateral wall. What modifier should be added to the biopsy procedure code?</strong></p>', '50, Bilateral procedure', '51, Multiple procedures', '59, Distinct procedural service', '99, Multiple modifiers', '2022-09-19 06:20:05', '2022-09-19 06:20:05', 'ans_c'),
(1622, NULL, 41, 1, '<p><strong>A bronchoscopy with multiple biopsies of the left bronchus was completed and revealed adenocarcinoma. What, if any, modifier should be added to the procedure code billed by the facility?</strong></p>', '59, Distinct procedural service', '51, Multiple procedures', '76, Repeat procedure or service by same physician', 'No modifiers should be reported', '2022-09-19 06:20:47', '2022-09-19 06:20:47', 'ans_d'),
(1623, NULL, 41, 1, '<p><strong>A patient is admitted with fever and urinary burning. Urosepsis is suspected. The discharge diagnosis is Escherichia coli, urinary tract infection; sepsis ruled out. Which of the following represents the diagnoses to report for this encounter and the appropriate sequencing of the codes for those conditions?</strong></p>', 'Fever, urinary burning, urosepsis', 'Fever, urinary burning, sepsis', 'Escherichia coli sepsis', 'Urinary tract infection, Escherichia coli', '2022-09-19 06:21:40', '2022-09-19 06:21:40', 'ans_d'),
(1624, NULL, 41, 1, '<p><strong>A patient was admitted to the emergency department for abdominal pain with diarrhea and was diagnosed with infectious gastroenteritis. In addition to gastroenteritis, the final diagnostic statement included angina and chronic obstructive pulmonary disease. List the diagnoses that would be coded and their correct sequence.</strong></p>', 'Abdominal pain, infectious gastroenteritis, chronic obstructive pulmonary disease, angina', 'Infectious gastroenteritis, chronic obstructive pulmonary disease, angina', 'Gastroenteritis, abdominal pain, angina', 'Diarrhea, chronic obstructive pulmonary disease, angina', '2022-09-19 06:22:41', '2022-09-19 06:22:41', 'ans_b'),
(1625, NULL, 41, 1, '<p><strong>A patient was admitted to the endoscopy unit for a screening colonoscopy. During the colonoscopy, polyps of the colon were found and a polypectomy was performed. What diagnostic codes should be used and how should they be sequenced?</strong></p>\r\n\r\n<p><strong>Z12.11 Encounter for screening for malignant neoplasm of colon</strong></p>\r\n\r\n<p><strong>D12.6 Benign neoplasm of colon, unspecified</strong></p>\r\n\r\n<p><strong>Z86.010 Personal history of colonic polyps</strong></p>', 'Z12.11, Z86.010', 'D12.6, Z12.11, Z86.010', 'Z12.11, D12.6', 'D12.6, Z12.11', '2022-09-19 06:23:54', '2022-09-19 06:23:54', 'ans_c'),
(1626, NULL, 41, 1, '<p><strong>A 30-year-old patient with acquired immunodeficiency syndrome (AIDS), asymptomatic at this time, is admitted for repair of inguinal hernia. The procedure performed was a right indirect inguinal herniorrhaphy via open approach. What are the correct codes and sequencing for this scenario?</strong></p>', 'B20, K40.90, 0YQ5XZZ', 'K40.90, B20, 0YQ50ZZ', 'Z21, K40.90, 0YQ5XZZ', 'K40.90, Z21, 0YQ50ZZ', '2022-09-19 06:24:39', '2022-09-19 06:24:39', 'ans_b'),
(1627, NULL, 41, 1, '<p><strong>The patient is admitted for chest pain and is found to have an acute inferior myocardial infarction with coronary artery disease and atrial fibrillation. After the atrial fibrillation was controlled and the patient was stabilized, the patient underwent a CABG &times;2 from aorta to the right anterior descending and right obtuse, using the left greater saphenous vein that was harvested via an open approach. Cardiopulmonary bypass was utilized. The appropriate sequencing and ICD codes for the hospitalization would be:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>I25.10 Atherosclerotic heart disease of native coronary artery without angina pectoris</strong></p>\r\n\r\n<p><strong>I21.19 ST elevation (STEMI) myocardial infarction involving other coronary artery of inferior wall</strong></p>\r\n\r\n<p><strong>I22.1 Subsequent ST elevation (STEMI) myocardial infarction of inferior wall</strong></p>\r\n\r\n<p><strong>I21.3 ST elevation (STEMI) myocardial infarction, of unspecified site</strong></p>\r\n\r\n<p><strong>I22.9 Subsequent ST elevation (STEMI) myocardial infarction of unspecified site</strong></p>\r\n\r\n<p><strong>I48.91 Unspecified atrial fibrillation</strong></p>\r\n\r\n<p><strong>R07.9 Chest pain, unspecified</strong></p>\r\n\r\n<p><strong>02100AW Bypass coronary artery, one artery from aorta with autologous arterial tissue, open approach</strong></p>\r\n\r\n<p><strong>021109W Bypass coronary artery, two arteries from aorta with autologous venous tissue, open approach</strong></p>\r\n\r\n<p><strong>06BQ0ZZ Excision of left saphenous vein, open approach</strong></p>\r\n\r\n<p><strong>5A1221Z Performance of cardiac output, continuous</strong></p>\r\n\r\n<p>&nbsp;</p>', 'R07.9, I21.3, I48.91, I22.9, 02100AW, 5A1221Z', 'I21.19, I48.91, I22.9, 02100AW', 'I21.19, I25.10, I48.91, 021109W, 06BQ0ZZ, 5A1221Z', 'I22.1, I48.91, I21.19, 021109W', '2022-09-19 06:26:15', '2022-09-19 06:26:15', 'ans_c'),
(1628, NULL, 41, 1, '<p><strong>Twin newborns are born prematurely at 32 weeks via cesarean section. The birth weight of the first twin was 1,002g. The second twin was stillborn. The first twin was admitted to the nursery from the delivery room. The first twin was also treated for jaundice due to ABO incompatibility. What codes should be assigned and what is the proper sequencing?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Z38.31, P07.14, P07.35, P55.1', 'Z38.01, P07.35, P07.14, P55.8', 'P05.04, P07.35, Z38.31, P55.1', 'Z38.31, P07.14, P07.33, P55.1', '2022-09-19 06:26:59', '2022-09-19 06:26:59', 'ans_a'),
(1629, NULL, 41, 1, '<p><strong>A patient is admitted with hemoptysis. A bronchoscopy with transbronchial biopsy of the lower lobe was undertaken that revealed squamous cell carcinoma of the right lung. Which conditions should be identified as present on admission?</strong></p>\r\n\r\n<p><strong>C34.30 Malignant neoplasm of lower lobe, unspecified bronchus or lung</strong></p>\r\n\r\n<p><strong>C34.31 Malignant neoplasm of lower lobe, right bronchus or lung</strong></p>\r\n\r\n<p><strong>P26.9 Unspecified pulmonary hemorrhage originating in the perinatal period</strong></p>\r\n\r\n<p><strong>R04.2 Hemoptysis</strong></p>', 'C34.31, R04.2', 'R04.2', 'C34.31', 'C34.30, P26.9, R04.2', '2022-09-19 06:45:23', '2022-09-19 06:45:23', 'ans_c'),
(1630, NULL, 41, 1, '<p><strong>A condition is considered present on admission when it is:</strong></p>', 'The principal diagnosis', 'In accordance with medical staff bylaws', 'A condition that occurs prior to an inpatient admission', 'Present within three days after admission', '2022-09-19 06:46:33', '2022-09-19 06:46:33', 'ans_c'),
(1631, NULL, 41, 1, '<p><strong>A newborn is diagnosed with meconium aspiration at birth. What is the appropriate POA indicator for the meconium aspiration?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-19 06:47:10', '2022-09-19 06:47:10', 'ans_a'),
(1632, NULL, 41, 1, '<p><strong>A woman is admitted to the hospital for an exacerbation of COPD and mentions a lump she has noticed in her right breast. On the fourth day of her hospital stay, a biopsy is done of the breast lump and a diagnosis of ductal carcinoma is made. What is the POA assignment for the carcinoma?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-19 06:47:57', '2022-09-19 06:47:57', 'ans_a'),
(1633, NULL, 41, 1, '<p><strong>The use of the outpatient code editor (OCE) is designed to:</strong></p>', 'Correct documentation of home health visits', 'Facilitate reporting of adverse drug events', 'Reduce the use of computer-assisted coding', 'Identify incomplete or incorrect claims', '2022-09-19 06:48:38', '2022-09-19 06:48:38', 'ans_d'),
(1634, NULL, 41, 1, '<p><strong>Medicare&rsquo;s identification of medically necessary services is outlined in:</strong></p>', 'Program transmittals', 'Claims processing manual', 'Local coverage determinations', 'National Correct Coding Initiative', '2022-09-19 06:49:22', '2022-09-19 06:49:22', 'ans_c'),
(1635, NULL, 41, 1, '<p><strong>Medically unlikely edits are used to identify:</strong></p>', 'Pairs of procedure codes that should not be billed together', 'Maximum units of service for a HCPCS code', 'Diagnoses that do not meet medical necessity', 'Procedure and gender discrepancies', '2022-09-19 06:50:09', '2022-09-19 06:50:09', 'ans_b'),
(1636, NULL, 41, 1, '<p><strong>National Correct Coding Initiative (NCCI) Edits are released how often?</strong></p>', 'Monthly', 'Quarterly', 'Semi-annually', 'Annually', '2022-09-19 06:50:50', '2022-09-19 06:50:50', 'ans_b'),
(1637, NULL, 41, 1, '<p><strong>In 2000, the Centres for Medicare and Medicaid Services (CMS) issued the final rule on the outpatient prospective payment system (OPPS). The final rule:</strong></p>', 'Identified the payment structure for long-term care', 'Divided outpatient services into fixed payment groups', 'Created less opportunity for health information management professionals', 'Facilitated greater use of ICD-9-CM procedure codes', '2022-09-19 06:51:45', '2022-09-19 06:51:45', 'ans_b'),
(1638, NULL, 41, 1, '<p><strong>Diagnostic-related groups (DRGs) and ambulatory patient classifications (APCs) are similar in that they are both:</strong></p>', 'Determined by HCPCS codes', 'Focused on hospital outpatients', 'Focused on hospital inpatients', 'Prospective payment systems', '2022-09-19 06:52:28', '2022-09-19 06:52:28', 'ans_d'),
(1639, NULL, 41, 1, '<p><strong>Medicare exerts control of provider reimbursement through adjustment of this component of the resource-based relative value scale (RBRVS).</strong></p>', 'Conversion factor', 'Geographic adjustment', 'Relative value unit', 'Practice expense', '2022-09-19 06:53:13', '2022-09-19 06:53:13', 'ans_a'),
(1640, NULL, 41, 1, '<p><strong>The process of collecting data elements from a source document is known as:</strong></p>', 'Extracting', 'Mining', 'Abstracting', 'Drilling', '2022-09-19 06:53:53', '2022-09-19 06:53:53', 'ans_c'),
(1641, NULL, 41, 1, '<p><strong>What piece of claims data from Hospital A alerts a payer that the patient was transferred to Hospital B?</strong></p>', 'Admission source', 'Admit diagnosis', 'Discharge disposition', 'Discharge diagnosis', '2022-09-19 06:54:42', '2022-09-19 06:54:42', 'ans_c'),
(1642, NULL, 41, 1, '<p><strong>What admission source code would be used when a patient is admitted to the facility from home?</strong></p>', '1', '2', '6', 'F', '2022-09-19 07:16:47', '2022-09-19 07:16:47', 'ans_a'),
(1643, NULL, 41, 1, '<p><strong>A terminally ill patient under hospice care is admitted to Hospital A for palliative care. What is the correct admission source code for the admission to Hospital A?</strong></p>', '1', '2', '6', 'F', '2022-09-19 07:18:01', '2022-09-19 07:18:01', 'ans_d'),
(1644, NULL, 41, 1, '<p><strong>When a patient is transferred from an acute-care facility to a skilled nursing facility, what abstracted data element can impact the DRG assignment?</strong></p>', 'Admission source', 'Patient’s blood type', 'Discharge disposition', 'Patient’s age', '2022-09-19 07:21:58', '2022-09-19 07:21:58', 'ans_c'),
(1645, NULL, 41, 1, '<p><strong>For a patient with a principal diagnosis of septicemia, reporting which of the following procedures will have the greatest impact on the MS-DRG?</strong></p>', 'Excision of left main bronchus, percutaneous endoscopic approach, diagnostic (0BB74ZX)', 'Excision of toe nail, external approach (0HBRXZZ)', 'Extraction of perineum skin, external approach (0HD9XZZ)', 'Respiratory ventilation, greater than 96 consecutive hours (5A1955Z)', '2022-09-19 07:23:56', '2022-09-19 07:23:56', 'ans_d'),
(1646, NULL, 41, 1, '<p><strong>Which of the following is considered a complication or comorbidity?</strong></p>', 'Hypokalemia', 'Dehydration', 'Hypernatremia', 'Fluid overload', '2022-09-19 07:25:13', '2022-09-19 07:25:13', 'ans_c'),
(1647, NULL, 41, 1, '<p>A patient is admitted for a cerebral infarction. Residual effects at discharge include aphasia and dysphagia. The patient developed acute diastolic congestive heart failure while admitted and was treated with Lasix in addition to being given Betapace for his long-standing hypertension</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Which condition is considered a major complication comorbidity?</strong></p>', 'Cerebral infarction', 'Acute diastolic congestive heart failure', 'Hypertension', 'Dysphagia', '2022-09-19 07:26:04', '2023-03-21 08:37:42', 'ans_b'),
(1648, NULL, 41, 1, '<p>A patient is admitted for a cerebral infarction. Residual effects at discharge include aphasia and dysphagia. The patient developed acute diastolic congestive heart failure while admitted and was treated with Lasix in addition to being given Betapace for his long-standing hypertension</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Which condition meets the definition of comorbidity?</strong></p>', 'Cerebral infarction', 'Acute diastolic congestive heart failure', 'Hypertension', 'Dysphagia', '2022-09-19 07:27:27', '2023-03-21 08:37:59', 'ans_c'),
(1649, NULL, 41, 1, '<p><strong>A patient was admitted from the emergency department because of chest pain. Following blood work, it was determined that the patient had elevated CK-MB enzymes. The EKG shows nonspecific ST changes. What type of diagnosis might this indicate?</strong></p>', 'Unstable angina', 'Myocardial infarction', 'Congestive heart failure', 'Mitral valve stenosis', '2022-09-19 07:28:45', '2022-09-19 07:28:45', 'ans_b'),
(1650, NULL, 41, 1, '<p><strong>A patient is admitted to the psychiatric unit of an acute-care facility. Almost every day for the past month, the patient has experienced loss of interest in most or all activities, which is a change from her prior level of functioning. She has also gained 15 lbs., has difficulty falling asleep, feels fatigued, and has difficulty making decisions. What potential diagnosis most closely fits the patient&rsquo;s overall symptoms?</strong></p>', 'Insomnia', 'Major depression', 'Reye’s syndrome', 'Bipolar disorder', '2022-09-19 07:29:36', '2022-09-19 07:29:36', 'ans_b'),
(1651, NULL, 41, 1, '<p><strong>A patient is admitted to the hospital complaining of abdominal pain. Following evaluation, it was determined that the patient had an obstruction of the left colon due to adhesions from a prior abdominal surgery. The patient underwent laparotomy with lysis of adhesions. What conditions and procedures should be coded?</strong></p>', 'Abdominal pain, abdominal adhesions, abdominal obstruction, laparotomy, lysis of adhesions', 'Abdominal adhesions, abdominal obstruction, postoperative complications of the digestive system, laparotomy, lysis of adhesions', 'Abdominal adhesions with obstruction, lysis of adhesions', 'Abdominal adhesions, abdominal obstruction, postoperative complications of the digestive system, lysis of adhesions', '2022-09-19 07:33:07', '2022-09-19 07:33:07', 'ans_c'),
(1652, NULL, 41, 1, '<p><strong>When coding a cardiac catheterization in CPT, in addition to the approach and the side of the heart into which the catheter was inserted, what else needs to be determined?</strong></p>', 'The type of anesthesia used', 'If additional procedures were performed', 'The duration of the procedure', 'Documentation that stents were considered', '2022-09-19 07:35:02', '2022-12-12 09:21:59', 'ans_b'),
(1653, NULL, 41, 1, '<p><strong>A female patient is admitted for a second-degree cystocele. A repair is performed. Which report provides the documentation necessary to accurately code the repair?</strong></p>', 'History and physical', 'Discharge summary', 'Consultation', 'Operative report', '2022-09-19 07:35:54', '2022-09-19 07:35:54', 'ans_d'),
(1654, NULL, 41, 1, '<p><strong>To accurately report wound closures with CPT codes, in addition to knowing the site and length of the closure, what other information is necessary?</strong></p>', 'If anesthesia was used and what kind', 'The repair type: simple, intermediate, or complex', 'The supplies that were used', 'If exploration of tendons or blood vessels occurred', '2022-09-19 07:36:44', '2022-09-19 07:36:44', 'ans_b'),
(1655, NULL, 41, 1, '<p><strong>A 64-year-old female is admitted to the hospital with nausea, vomiting, and edema. Lab values indicate the patient has dehydration. The patient takes Lisinopril as prescribed along with Levothyroxine for hypothyroidism. On the discharge summary, the final diagnoses of acute renal failure, hypothyroidism, and dehydration are documented. What discrepancy should a coding professional note in this documentation?</strong></p>', 'There is not enough detail in the documentation to assign the dehydration.', 'There is no explanation for the patient’s vomiting.', 'There is no correlating diagnosis for the Lisinopril.', 'The nausea, vomiting, and edema are indicative of chronic renal failure not acute.', '2022-09-19 07:37:39', '2022-09-19 07:37:39', 'ans_c'),
(1656, NULL, 41, 1, '<p><strong>A patient comes in with right upper quadrant pain, nausea, and vomiting. An x-ray confirms inflammation in the gallbladder. The patient has been dealing with episodes like this for the past six months. The final diagnosis in the discharge statement is appendicitis. What discrepancy is noted in this record?</strong></p>', 'The condition indicated is acute appendicitis', 'There is no discrepancy, code the appendicitis', 'The condition indicated is chronic appendicitis', 'The condition indicated is acute on chronic cholecystitis', '2022-09-19 07:38:58', '2022-09-19 07:38:58', 'ans_d'),
(1657, NULL, 41, 1, '<p><strong>Refer to question 55. What should be done to correct the discrepancy?</strong></p>', 'Since the patient came in with pain, it is appropriate to assign the code for acute appendicitis', 'A query should be issued to determine the diagnosis as it seems appendicitis is incorrect', 'A clinical documentation improvement specialist should be contacted to verify the diagnosis', 'There is no discrepancy, code the appendicitis', '2022-09-19 07:39:58', '2022-09-19 07:39:58', 'ans_b'),
(1658, NULL, 41, 1, '<p><strong>A resident physician continually documents &ldquo;CHF&rdquo; without further clarification in patients&rsquo; medical records. What is the most likely rationale for this documentation practice?</strong></p>', 'No problem exists with this documentation as CHF without further clarification is acceptable', 'The resident is not qualified to make a more definitive determination of the type of CHF.', 'The resident lacks knowledge regarding the need for further clarification.', 'There is not enough information to determine the type of CHF.', '2022-09-19 07:40:46', '2022-09-19 07:40:46', 'ans_c'),
(1659, NULL, 41, 1, '<p><strong>A patient is scheduled for elective surgery for cataract removal of the left eye. The operative report indicates the surgery on the right eye is performed with the use of phacoemulsification and intraocular lens insertion. What discrepancy is noted in this documentation?</strong></p>', 'The use of irrigation and aspiration is not mentioned', 'No mention of implantation of intraocular lens', 'No indication if general anesthesia was used', 'Laterality is not in agreement', '2022-09-19 07:42:00', '2022-09-19 07:42:00', 'ans_d'),
(1660, NULL, 41, 1, '<p><strong>On day two of admission, an inpatient progress note states there is a stage three pressure ulcer of the sacrum that requires debridement. The coding professional composes a query to determine if this condition was present on admission (POA) by asking the physician if the pressure ulcer listed in the progress note of day two was present on admission&mdash;yes or no? Is that an acceptable query? Why or why not?</strong></p>', 'No. Yes/no queries are not acceptable in any circumstances.', 'No. Yes/no queries require clinical indicators.', 'Yes. Yes/no queries may be used to established POA status.', 'Yes. Yes/no queries are the preferred query format for all queries.', '2022-09-19 07:45:07', '2022-09-19 07:45:07', 'ans_c'),
(1661, NULL, 41, 1, '<p><strong>Multiple choice queries must supply how many choices in order to be compliant?</strong></p>', '3', '4', '5', 'No specific number', '2022-09-19 07:45:53', '2022-09-19 07:45:53', 'ans_d'),
(1662, NULL, 41, 1, '<p><strong>Compliant queries include which of the following?</strong></p>', 'Comparison of reimbursement amounts', 'Relevant clinical indicators', 'Potential impact on quality scores', 'Impact on physician licensure', '2022-09-19 07:46:43', '2022-09-19 07:46:43', 'ans_b'),
(1663, NULL, 38, 1, '<p><strong>A 37 yrs old female is brought to the Emergency Department due to snake bite. The ED physician performed medically appropriate history &amp; examination. The ED physician started anti venom IV drugs and decided to place her in Observation status.&nbsp;The ED physician will continue examining the patient and will order additional treatments until the patient recovers. What CPT code should be reported for this service?</strong></p>', '99222', '99221', '99283', '99284', '2022-09-19 07:54:10', '2023-05-31 00:50:50', 'ans_a'),
(1664, NULL, 38, 1, '<p>What element drives an evaluation and management (E/M) visit?</p>', 'The chief complaint in the patient’s own words of why he or she is in the practice for that date of service.', 'The presenting problem(s) being discussed with the physician for that patient during the visit.', 'The examination performed on the patient.', 'The history of the patient taken during the visit.', '2022-09-19 07:59:44', '2022-09-19 07:59:44', 'ans_b'),
(1665, NULL, 38, 1, '<p>What is the key difference between 1995 and 1997 guidelines?</p>', 'The history', 'The examination', 'The medical decision making', 'All of the above', '2022-09-19 08:02:51', '2022-09-19 08:02:51', 'ans_b'),
(1666, NULL, 38, 1, '<p>What are the key components that should be included in the physician&#39;s documentation of a patient&#39;s encounter?</p>', 'Reason for the encounter and relevant history, physical examination findings and prior diagnostic test results', 'Assessment, clinical impression or diagnosis', 'Medical plan of care', 'All of the above', '2022-09-19 08:03:46', '2022-09-19 08:03:46', 'ans_d'),
(1667, NULL, 38, 1, '<p>There are four components to an evaluation and management visit. Which one should drive the visit?</p>', 'Chief complaint', 'History', 'Examination', 'Medical decision making', '2022-09-19 08:06:12', '2022-09-19 08:06:12', 'ans_a'),
(1668, NULL, 41, 1, '<p><strong>Examine the following query and determine if it is compliant and why:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Dr. Reynolds, is it possible that this patient has acute, postoperative blood loss anemia based on the drop in hemoglobin and hematocrit that occurred after surgery as noted in the lab report? Yes or no?</strong></p>', 'Yes, because the query provides clinical indicators for the additional diagnosis.', 'Yes, because the physician has the option to choose yes or no.', 'No, because the query is leading and inappropriately includes the term “possible” in the question.', 'No, because yes and no queries are not acceptable.', '2022-09-19 08:59:28', '2022-09-19 08:59:28', 'ans_c'),
(1669, NULL, 41, 1, '<p><strong>Which of the following make a query compliant?</strong></p>', 'Keeping the question vague so the physician has an opportunity to use his discretion when responding', 'Explaining why the requested diagnosis is necessary to achieve a higher reimbursement', 'Addressing the impact the query has on quality indicators', 'Providing a concise presentation of facts and clinical indicators', '2022-09-19 09:00:19', '2022-09-19 09:00:19', 'ans_d'),
(1670, NULL, 41, 1, '<p><strong>A patient was admitted with heart failure within one week of a heart transplant. Due to the timing, the coding professional thought the heart failure may indicate a transplant rejection. What action(s) should the coding staff take?</strong></p>', 'Query the physician.', 'Assign the codes for the transplant rejection and the heart failure.', 'Assign only the code for the transplant rejection.', 'Assign only the code for heart failure.', '2022-09-19 09:01:02', '2022-09-19 09:01:02', 'ans_a'),
(1671, NULL, 41, 1, '<p><strong>A patient had a normal pregnancy and delivery with loose nuchal cord. Delivery, with birth of liveborn male infant, was accomplished with an episiotomy and repair. The delivery room record states &ldquo;no evidence of fetal problem.&rdquo; What is the query opportunity for this record?</strong></p>', 'Age of the patient', 'Weeks of gestation/trimester', 'If there was adequate prenatal care', 'If the pregnancy was high-risk', '2022-09-19 09:02:03', '2022-09-19 09:02:03', 'ans_b'),
(1672, NULL, 41, 1, '<p><strong>A toddler comes into the hospital admitted from the ER with the following: shortness of breath, wheezing, runny nose, and positive RSV test. The final diagnosis was viral infection upon discharge three days later. What condition should the coding professional query for in this scenario?</strong></p>', 'Acute bronchiolitis', 'Acute bronchitis', 'Croup', 'Laryngitis', '2022-09-19 09:02:53', '2022-09-19 09:02:53', 'ans_a'),
(1673, NULL, 41, 1, '<p><strong>While admitted for an exacerbation of COPD, a patient developed swelling in the lower legs and had increasing shortness of breath despite the COPD treatment. An echocardiogram was performed that showed an ejection fraction of 33 percent. A urinalysis showed albuminuria. Breathing treatments continued with the addition of Lasix to the medication regime. In the final diagnostic statement, the physician mentions only the COPD exacerbation. What is the query opportunity for this record?</strong></p>', 'Coronary artery disease', 'Acute congestive heart failure', 'Pleural effusion', 'Atrial fibrillation', '2022-09-19 09:03:42', '2022-09-19 09:03:42', 'ans_b');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1674, NULL, 41, 1, '<p><strong>Which of the following condition combinations would benefit from a query?</strong></p>', 'Hypertension and ESRD', 'Diabetes and polyneuropathy', 'CHF and hypertension', 'ESRD and diabetes', '2022-09-19 09:04:27', '2022-09-19 09:04:27', 'ans_c'),
(1675, NULL, 41, 1, '<p><strong>A patient was admitted with chest pain and shortness of breath. Preliminary lab work indicated non elevated troponin with LBBB noted on EKG. Patient developed a fever and chills. X-ray finding demonstrated an infiltrate in the left lung. Sputum culture identified Klebsiella. The patient slowly improved after antibiotics were administered. Final discharge diagnosis listed as chest pain and patient was sent home on Piperacillin/tazobactam. For which diagnosis does a query opportunity exist for the principal diagnosis?</strong></p>', 'Gram-negative pneumonia', 'Aspiration pneumonia', 'Myocardial infarction', 'Non-cardiac chest pain', '2022-09-19 09:05:12', '2022-09-19 09:05:12', 'ans_a'),
(1676, NULL, 41, 1, '<p><strong>Authentication of health record entries means to:</strong></p>', 'Create facsimiles of documents', 'Prove authorship of documents', 'Develop documents', 'Use a rubber stamp on documents', '2022-09-19 09:06:06', '2022-09-19 09:06:06', 'ans_b'),
(1677, NULL, 41, 1, '<p><strong>The requirements for documentation and record completion (documents such as history and physicals, discharge summaries, and consultations) as well as penalties for nonadherence must be specified in:</strong></p>', 'Hospital rules and regulations', 'Payer guidelines', 'Medical staff by laws', 'Nursing staff policies', '2022-09-19 09:07:04', '2022-09-19 09:07:04', 'ans_c'),
(1678, NULL, 41, 1, '<p><strong>Generally, data quality is defined as:</strong></p>', 'Ensuring the greatest amount of data possible is obtained from the health record', 'Ensuring the accuracy and completeness of an organisation’s data', 'Ensuring accuracy of the data collected for the case-mix index', 'Ensuring the data for external reporting is optimised', '2022-09-19 09:08:17', '2022-09-19 09:08:17', 'ans_b'),
(1679, NULL, 41, 1, '<p><strong>The Joint Commission considers management that supports decision making to be important for safety and quality. What kind of management supports decision making?</strong></p>', 'Resource management', 'Risk management', 'Information management', 'Case management', '2022-09-19 09:09:26', '2022-09-19 09:09:26', 'ans_c'),
(1680, NULL, 41, 1, '<p><strong>According to Medicare requirements, a history and physical must:</strong></p>', 'Be coded based on the uniform hospital discharge proposal', 'Include the patient’s weight, height, body mass index, and year of birth', 'Be completed for each patient no more than 30 days before or 24 hours after admission or registration, but prior to surgery', 'Discuss the educational plans for the patient including diet, exercise, and plans for smoking cessation', '2022-09-19 09:10:34', '2022-09-19 09:10:34', 'ans_c'),
(1681, NULL, 41, 1, '<p><strong>Medicare reimbursement depends on all of the following, except:</strong></p>', 'The correct designation of the principal diagnosis', 'The number of codes that are assigned', 'The presence or absence of additional codes that represent complications, comorbidities, or major complications/comorbidities', 'Procedures performed', '2022-09-19 09:12:08', '2022-09-19 09:12:08', 'ans_b'),
(1682, NULL, 41, 1, '<p><strong>A coding professional reviews a health record and determines that a code Medicare has designated as &ldquo;unacceptable principal diagnosis&rdquo; is the correct code to assign. What should the coding professional do?</strong></p>', 'Assign another code from the history and physical as the principal diagnosis', 'Assign the code even though the insurer may not pay the claim', 'Use a comorbidity as the principal diagnosis', 'Assign a code from the outpatient visit prior to admission', '2022-09-19 09:14:11', '2022-09-19 09:14:11', 'ans_b'),
(1683, NULL, 41, 1, '<p><strong>A payer&rsquo;s policy does not cover tetanus injections when provided as a preventive service but will cover them when provided as a postinjury service. If the injection is provided in the emergency department, what part of the claim will need to be modified to indicate the injection was a postinjury service rather than a preventive service?</strong></p>', 'Diagnosis code', 'Procedure code', 'Revenue code', 'Disposition code', '2022-09-19 09:15:25', '2022-09-19 09:15:25', 'ans_c'),
(1684, NULL, 41, 1, '<p><strong>Which of the following is found on the hospital-acquired condition list?</strong></p>', 'Stage 4 pressure ulcer of the coccyx', 'Foreign body of the skin', 'Urinary tract infection', 'Diabetes', '2022-09-19 09:16:14', '2022-09-19 09:16:14', 'ans_a'),
(1685, NULL, 41, 1, '<p><strong>A 75-year-old patient is admitted for a complex, ventral hernia repair. While in the hospital, the patient slips and falls, suffering a left hip fracture. Will the hip fracture be identified as part of the facility&rsquo;s patient safety indicators (PSI)? Why or why not?</strong></p>', 'No, the hip fracture is the principal diagnosis and will not be part of the PSI', 'Yes, the hip fracture is the principal diagnosis and would still be part of the PSI', 'No, the hip fracture is a secondary diagnosis and therefore, will not be part of the PSI', 'Yes, the hip fracture is a secondary diagnosis and will be part of the PSI', '2022-09-19 09:17:34', '2022-09-19 09:17:34', 'ans_d'),
(1686, NULL, 41, 1, '<p><strong>A patient is admitted for treatment of hemophilia with a blood transfusion. The patient had an ABO incompatibility reaction to the transfusion and was taken to the ICU for monitoring and IV saline. The admission is complicated by the development of a pneumonia and the patient&rsquo;s ongoing medical conditions of hypothyroidism and hyperlipidemia, both of which required medication during hospitalization. Breathing treatments continued for the pneumonia and no further transfusions were given. Which condition in this scenario reflects a hospital-acquired condition?</strong></p>', 'Haemophilia', 'Pneumonia', 'ABO incompatibility', 'Hypothyroidism', '2022-09-19 09:18:31', '2022-09-19 09:18:31', 'ans_c'),
(1687, NULL, 41, 1, '<p><strong>An urgent care facility located near a national park treats a significant number of patients with snake bites. Patients receive treatment with antivenom. On occasion, a patient must later be admitted to the hospital. Can the urgent care facility provide the hospital with a list of names of patients treated with snake antivenom?</strong></p>', 'Only the names of patients who are admitted to the hospital for continuation of care could be provided.', 'A full list of names could be provided.', 'No information can be obtained under any circumstances.', 'A list of patients may be available after consultation with the medical director.', '2022-09-19 09:20:21', '2022-09-19 09:20:21', 'ans_a'),
(1688, NULL, 41, 1, '<p><strong>The patient was admitted for breast carcinoma in the right breast at two o&rsquo;clock. This was removed via lumpectomy. An axillary lymph node dissection, performed along with the lumpectomy, identified one of seven lymph nodes positive for carcinoma. One of the patient&rsquo;s neighbours, who works at the hospital, called the coding department to get the patient&rsquo;s diagnosis because she is a cancer survivor herself. The coding professional should:</strong></p>', 'Discuss the case with the coworker', 'Report the incident to hospital security', 'Give the caller false information', 'Explain that discussing the case would violate the patient’s right to privacy', '2022-09-19 09:21:58', '2022-09-19 09:21:58', 'ans_d'),
(1689, NULL, 41, 1, '<p><strong>&nbsp;The billing department has requested that copies of patients&rsquo; final coding summaries with associated code meanings for Medicare be printed remotely in the admission department. Currently, they only request the summaries when there is an unspecified procedure. On previous visits to the admission department, the coding supervisor has found the coding summaries were left on a table near the patient entrance. Of the actions presented here, what would be the best action for the coding supervisor to take?</strong></p>', 'Comply with the request.', 'Refuse to undertake this without further explanation.', 'Ignore the request.', 'Explain to the billing department supervisor that leaving the coding summary in public view violates the patient’s right to privacy.', '2022-09-19 09:27:27', '2022-09-19 09:27:27', 'ans_d'),
(1690, NULL, 41, 1, '<p><strong>Code sets that are mandated under HIPAA include all of the following except:</strong></p>', 'National Drug Codes (NDC)', 'International Classification of Diseases, Tenth Revision, Clinical Modification and International Classification of Disease, Tenth Revision, Procedure Coding System (ICD-10-CM and ICD-10-PCS)', 'Current Procedural Terminology (CPT)', 'Hierarchical Condition Category (HCC)', '2022-09-19 09:28:38', '2022-09-19 09:28:38', 'ans_d'),
(1691, NULL, 41, 1, '<p><strong>The electronic transactions and code sets standards are found under which part of HIPAA?</strong></p>', 'Administrative Simplification', 'Privacy Rule', 'Security Rule', 'Health Information Technology for Economic and Clinical Health Act', '2022-09-19 09:29:37', '2022-09-19 09:29:37', 'ans_a'),
(1692, NULL, 41, 1, '<p><strong>Determining employee access to patient information should be based on what HIPAA principle?</strong></p>', 'Medically necessary', 'Minimum necessary', 'Nondisclosure', 'Workforce', '2022-09-19 09:30:47', '2022-09-19 09:30:47', 'ans_b'),
(1693, NULL, 41, 1, '<p><strong>A facility&rsquo;s coding policy states that inpatients who undergo open reduction and internal fixation of a fractured femur should be routinely coded with blood loss anemia when there is intraoperative blood loss of 500 cc or more documented in the operative report and the patient has low haemoglobin. Is this correct or incorrect and why?</strong></p>', 'It is correct to code blood loss anemia because the policy requires it.', 'It is correct because the clinical signs are documented in the record.', 'It is incorrect because the patient must also have a blood transfusion in order for blood loss anemia to be coded.', 'It is incorrect because the physician did not document the blood loss anemia in the progress notes.', '2022-09-19 09:31:48', '2022-09-19 09:31:48', 'ans_d'),
(1694, NULL, 41, 1, '<p><strong>AHIMA&rsquo;s Standards of Ethical Coding apply to which of the following groups?</strong></p>', 'Certified coding professionals', 'Coding managers', 'HIM/coding students', 'All of the above', '2022-09-19 09:33:03', '2022-09-19 09:33:03', 'ans_d'),
(1695, NULL, 41, 1, '<p><strong>At work one day, Mary, who is an outpatient coding professional, overheard another outpatient coding professional mention that whenever she has a chart to code with a procedure that she is unfamiliar with, she assigns an unlisted CPT code. This allows her to keep up her productivity numbers rather than taking time to research the procedure. What is Mary&rsquo;s ethical responsibility upon learning this information?</strong></p>', 'None, as she is an outpatient coding professional and the Code of Ethics applies only to inpatient coding professionals', 'None, because it is within coding guidelines to assign an unlisted CPT procedure code', 'Report this to her coding manager as the Code of Ethics requires coding professionals to take steps to correct unethical behaviour of colleagues.', 'Report this to the facility’s risk manager in order to prevent claim denials.', '2022-09-19 09:34:01', '2022-09-19 09:34:01', 'ans_c'),
(1696, NULL, 41, 1, '<p><strong>A facility recently implemented a computer-assisted coding (CAC) program to assist their coding staff. Since that time, the coding manager has found that one coding professional, who previously struggled to meet productivity, is now leading the coding staff in productivity. A review shows that he is accepting all CAC suggested codes without validation. Is there an ethical issue here?</strong></p>', 'Yes, the coding professional is required to utilise CAC as a tool, but not without validating the code choices.', 'Yes, CAC codes can be assigned only after a coding professional has independently arrived at the same codes by using a code book.', 'No, CAC codes are populated based on provider documentation and do not require validation.', 'No, CAC programs are built by coding professionals, so the auto-suggested codes can automatically be assigned.', '2022-09-19 09:34:54', '2022-09-19 09:34:54', 'ans_a'),
(1697, NULL, 41, 1, '<p><strong>A retired coding professional has let her CCS credential lapse. However, she is interested in doing some part-time work for a local hospital that only hires credentialed coding professionals. When interviewed, she is asked about her credential and answers that &ldquo;I have been credentialed as a CCS.&rdquo; Is there an ethical issue with this statement?</strong></p>', 'No, because it is truthful.', 'Yes, because the statement does not clearly express that the credential is no longer in effect.', 'No, because the responsibility for additional information is on the interviewer.', 'Yes, because the statement is untruthful.', '2022-09-19 09:35:45', '2022-09-19 09:35:45', 'ans_b'),
(1698, NULL, 41, 1, '<p><strong>Coding professionals at a physician group practice often collaborate on finding the appropriate diagnosis and procedure codes. They do not have access to an encoder, and the books they use are four years old. When they are uncertain about the code selection, they query the physicians. Based on this information, is there anything unethical going on?</strong></p>', 'Yes; coding professionals should not be collaborating to arrive at diagnosis and procedure codes.', 'Yes; it is necessary for coding professionals to have access to an encoder to assign codes.', 'Yes; coding professionals should have current books in order to assign appropriate codes.', 'Yes; coding professionals should not be querying in a physician office to assign codes.', '2022-09-19 09:36:33', '2022-09-19 09:36:33', 'ans_c'),
(1699, NULL, 41, 1, '<p><strong>A patient has a principal diagnosis of pneumonia (J18.9) (MS-DRG 195). Which of the following may legitimately change the coding of the pneumonia in accordance with the UHDDS and relevant clinical documentation?</strong></p>', 'Sputum culture reflects growth of normal flora', 'Patient has a high fever', 'Patient is found to have dysphagia with aspiration', 'Patient has nonproductive cough', '2022-09-19 09:37:15', '2022-09-19 09:37:15', 'ans_c'),
(1700, NULL, 41, 1, '<p><strong>A patient was admitted to an acute-care facility with a temperature of 102 and atrial fibrillation. A chest x-ray reveals pneumonia with subsequent documentation by the physician of pneumonia in the progress notes and discharge summary. The patient was treated with oral antiarrhythmic medications and IV antibiotics. What is the correct code sequence?</strong></p>', 'J18.9, I48.91', 'I48.91, J18.9', 'It does not matter which is used as the principal diagnosis.', 'Not enough information is present. Query the physician.', '2022-09-19 09:38:26', '2022-09-19 09:38:26', 'ans_a'),
(1701, NULL, 41, 1, '<p><strong>The UHDDS definition of principal diagnosis does not apply to the coding of outpatient encounters because:</strong></p>', 'Assigning codes for signs and symptoms is more relevant for outpatient encounters', 'Usually there are multiple reasons for the encounter', 'Short duration of the evaluation does not allow enough time to make an “after study” determination', 'A preadmission work-up is not available', '2022-09-19 09:39:20', '2022-09-19 09:39:20', 'ans_c'),
(1702, NULL, 41, 1, '<p><strong>A patient is admitted for pneumonia. Additionally, the physician has documented the patient has a history of hypertension and diabetes, which require medication (Lisinopril and insulin) while in the hospital, along with a history of migraines and repeated, recent falls. Which of the following diagnoses does not meet the UHDDS definition of additional diagnoses?</strong></p>', 'I10', 'Z79.4', 'R29.6', 'G43.909', '2022-09-19 09:40:14', '2022-09-19 09:40:14', 'ans_d'),
(1703, NULL, 41, 1, '<p><strong>In what setting does the UHDDS definition of principal diagnosis not apply?</strong></p>', 'Hospice', 'Provider office', 'Psychiatric hospital', 'Home health', '2022-09-19 09:41:34', '2022-09-19 09:41:34', 'ans_b'),
(1704, NULL, 42, 1, '<p><strong>The patient is seen in the pain clinic for chronic neoplasm-related pain that was known to be caused by the metastatic bone carcinoma of the vertebra that has spread from carcinoma of the left main bronchus of the lung. How should this be coded?</strong></p>', 'C34.02, Malignant neoplasm of left main bronchus', 'G89.3, Neoplasm related pain (acute) (chronic)', 'G89.3, Neoplasm related pain (acute) (chronic); C79.51, Secondary malignant neoplasm of bone; C34.02, Malignant neoplasm of left main bronchus', 'C79.51, Secondary malignant neoplasm of bone; G89.3, Neoplasm related pain (acute) (chronic)', '2022-09-20 03:33:48', '2022-09-20 03:33:48', 'ans_c'),
(1705, NULL, 42, 1, '<p><strong>A child is seen in the emergency department for second- and third-degree burns of the left lower leg and second- and third-degree burns of the lower back, for a total of 16 percent of body surface area burned, 9 percent of which are third-degree burns. What is the correct code assignment?</strong></p>', 'T24.301A, T21.34XA, T31.10', 'T24.302D, T21.34XD, T31.10', 'T24.302A, T21.34XA, T31.10', 'T24.301D, T21.34XD, T31.10', '2022-09-20 03:34:34', '2022-09-20 03:34:34', 'ans_c'),
(1706, NULL, 42, 1, '<p><strong>A patient underwent excision of a malignant lesion of the skin of the chest that measured 1.0 cm, and there was a 0.2-cm margin on both sides. Based on the 2022 CPT codes, which code would be used for the procedure?</strong></p>', '11401, Excision, benign lesion including margins, except skin tag (unless listed elsewhere), trunk, arms or legs; excised diameter 0.6 to 1.0 cm', '11601, Excision, malignant lesion including margins, trunk, arms, or legs; excised diameter 0.6 to 1.0 cm', '11602, Excision, malignant lesion including margins, trunk, arms, or legs; excised diameter 1.1 to 2.0 cm', '11402, Excision, benign lesion including margins, except skin tag (unless listed elsewhere), trunk, arms or legs; excised diameter 1.1 to 2.0 cm', '2022-09-20 03:35:24', '2022-09-20 03:35:24', 'ans_c'),
(1707, NULL, 42, 1, '<p><strong>A laparoscopic tubal ligation with Falope ring is completed. What is the correct CPT code assignment?</strong></p>\r\n\r\n<p><strong>49321 Laparoscopy, surgical; with biopsy (single or multiple)</strong></p>\r\n\r\n<p><strong>58662 Laparoscopy, surgical; with fulguration or excision of lesions of the ovary, pelvic viscera, or peritoneal surface by any method</strong></p>\r\n\r\n<p><strong>58670 Laparoscopy, surgical; with fulguration of oviducts (with or without transection)</strong></p>\r\n\r\n<p><strong>58671 Laparoscopy, surgical; with occlusion of oviducts by device (eg, band, clip, or Falope ring)</strong></p>', '58662', '58670', '58671', '49321', '2022-09-20 03:36:33', '2022-09-20 03:36:33', 'ans_c'),
(1708, NULL, 42, 1, '<p><strong>A patient is admitted to the hospital for pain due to displacement of pacemaker electrode. The patient also has hypothyroidism due to partial thyroidectomy seven years ago and a breast cyst. Using a guide wire, the pacemaker electrode was relocated and Synthroid was given during hospitalization. The codes (excluding External Cause codes) that should be assigned are:</strong></p>\r\n\r\n<p><strong>T82.110A Breakdown (mechanical) of cardiac electrode, initial encounter</strong></p>\r\n\r\n<p><strong>T82.110D Breakdown (mechanical) of cardiac electrode, subsequent encounter</strong></p>\r\n\r\n<p><strong>T82.120A Displacement of cardiac electrode, initial encounter</strong></p>\r\n\r\n<p><strong>T82.120S Displacement of cardiac electrode, sequela</strong></p>\r\n\r\n<p><strong>N60.09 Solitary cyst of unspecified breast</strong></p>\r\n\r\n<p><strong>E89.0 Postsurgical hypothyroidism</strong></p>\r\n\r\n<p><strong>02WA3MZ Revision of cardiac lead in heart, percutaneous approach</strong></p>\r\n\r\n<p><strong>02WA4MZ Revision of cardiac lead in heart, percutaneous endoscopic approach</strong></p>\r\n\r\n<p><strong>02WA0MZ Revision of cardiac lead in heart, open approach</strong></p>', 'T82.110A, E89.0, 02WA3MZ', 'T82.110D, E89.0, N60.09, 02WA4MZ', 'T82.120A, E89.0, 02WA3MZ', 'T82.120S, E89.0, N60.09, 02WA0MZ', '2022-09-20 03:38:19', '2022-09-20 03:38:19', 'ans_c'),
(1709, NULL, 42, 1, '<p><strong>A maternity patient is admitted in labor at 43 weeks. She has a spontaneous delivery with vacuum extraction to facilitate the baby&rsquo;s delivery. Which of the following would be the principal diagnosis?</strong></p>\r\n\r\n<p><strong>O80 Encounter for full-term uncomplicated delivery</strong></p>\r\n\r\n<p><strong>O48.0 Post-term pregnancy</strong></p>\r\n\r\n<p><strong>O48.1 Prolonged pregnancy</strong></p>\r\n\r\n<p><strong>O66.5 Attempted application of vacuum extractor and forceps</strong></p>', 'O48.0', 'O48.1', 'O80', 'O66.5', '2022-09-20 03:39:27', '2022-09-20 03:39:27', 'ans_b'),
(1710, NULL, 42, 1, '<p><strong>A patient is admitted to the hospital due to a fracture of the right hip and is scheduled for an open reduction with internal fixation. The patient developed cardiac arrhythmia that results in an inability to do the planned surgery. What is the principal diagnosis?</strong></p>', 'Status post fracture', 'Cardiac arrhythmia', 'Right hip fracture', 'Cancelled procedure', '2022-09-20 03:40:18', '2022-09-20 03:40:18', 'ans_c'),
(1711, NULL, 42, 1, '<p><strong>A 45-year-old man with known AIDS is admitted to the hospital for treatment of HIV-related Pneumocystis carinii pneumonia. What is the principal diagnosis code?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'B20', 'J18.9', 'B59', 'Any of the above', '2022-09-20 03:41:02', '2022-09-20 03:41:02', 'ans_a'),
(1712, NULL, 42, 1, '<p><strong>Patient admitted with hemorrhage due to placenta previa with twin pregnancy. This patient had two prior (cesarean section) deliveries. Emergency C-section was performed due to the hemorrhage. The appropriate principal diagnosis would be:</strong></p>', 'Prior cesarean sections', 'Placenta previa without hemorrhage', 'Twin gestation', 'Placenta previa with hemorrhage', '2022-09-20 03:42:00', '2022-09-20 03:42:00', 'ans_d'),
(1713, NULL, 42, 1, '<p><strong>A patient presents to a facility with a history of prostate cancer and mental confusion on admission. The patient completed radiation therapy for prostatic carcinoma three years ago and is status post a radical resection of the prostate. A CT scan of the brain reveals metastatic carcinoma of the brain. The correct coding and sequencing of this patient&rsquo;s record is:</strong></p>', 'Metastatic carcinoma of the brain, carcinoma of the prostate, mental confusion', 'Mental confusion, history of carcinoma of the prostate, metastatic carcinoma of the brain', 'Metastatic carcinoma of the brain, history of carcinoma of the prostate', 'Carcinoma of the prostate, metastatic carcinoma to the brain', '2022-09-20 03:43:35', '2022-09-20 03:43:35', 'ans_c'),
(1714, NULL, 42, 1, '<p><strong>A patient with GERD presents to a facility for upper endoscopy submucosal injection of material near the lower esophageal sphincter. The correct coding and sequencing of this patient&rsquo;s record is:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>K20.90 Esophagitis, unspecified, without bleeding</strong></p>\r\n\r\n<p><strong>K21.00 Gastro-esophageal disease with esophagitis, without bleeding</strong></p>\r\n\r\n<p><strong>K21.9 Gastro-esophageal disease without esophagitis</strong></p>\r\n\r\n<p><strong>43235 Esophagogastroduodenoscopy, flexible, transoral; diagnostic, including collection of specimen(s) by brushing or washing, when performed (separate procedure)</strong></p>\r\n\r\n<p><strong>43236 with directed submucosal injection(s), any substance</strong></p>\r\n\r\n<p><strong>43257 with delivery of thermal energy to the muscle of lower esophageal sphincter and/or gastric cardia, for treatment of gastroesophageal reflux disease</strong></p>\r\n\r\n<p><strong>43270 with ablation of tumor(s), polyp(s), or other lesion(s) (includes pre- and post- dilation and guide wire passage, when performed.</strong></p>\r\n\r\n<p><strong>-58Staged or related procedure or service by the same physician or other qualified health care professional during the postoperative period</strong></p>\r\n\r\n<p><strong>-59Distinct procedural service</strong></p>', 'K20.90, 43257', 'K21.00, 43235, 43236', 'K21.9, 43236', 'K21.9, K20.90, 43270-58, 43236-59', '2022-09-20 03:45:12', '2022-09-20 03:45:12', 'ans_c'),
(1715, NULL, 42, 1, '<p><strong>According to CPT, an endoscopy that is undertaken to the level of the midtransverse colon would be coded as a:</strong></p>', 'Proctosigmoidoscopy', 'Sigmoidoscopy', 'Colonoscopy', 'Proctoscopy', '2022-09-20 03:45:55', '2022-09-20 03:45:55', 'ans_c'),
(1716, NULL, 42, 1, '<p><strong>If a patient is admitted with pneumococcal pneumonia and severe pneumococcal sepsis, the coding professional should:</strong></p>', 'Assign codes for sepsis and pneumonia', 'Assign codes for sepsis, pneumonia, and severe sepsis', 'Assign only a code for pneumococcal pneumonia', 'Review the chart to determine if septic shock could be coded first', '2022-09-20 03:46:31', '2022-09-20 03:46:31', 'ans_b'),
(1717, NULL, 42, 1, '<p><strong>&nbsp;A female patient with terminal carcinoma of the breast, metastatic to the liver, brain, and intrahepatic and extrahepatic bile ducts, was admitted with dehydration. Patient was rehydrated with IVs and discharged, with no treatment given to the cancer. What are the codes assigned?</strong></p>', 'E86.0, C50.919, C78.7, C79.31, C78.89', 'C50.919, E86.0, C78.7, C79.31', 'C50.919, E86.9, C78.7, C79.31', 'E86.9, C50.919, C78.7, C79.31, C78.89', '2022-09-20 03:47:13', '2022-09-20 03:47:13', 'ans_a'),
(1718, NULL, 42, 1, '<p><strong>A 45-year-old patient is admitted with insulin-dependent diabetes. The type of diabetes is not specified in the health record. How should this be coded?</strong></p>', 'E11.9, Z79.4', 'E11.8, Z79.4', 'E10.9, Z79.4', 'Query the provider for the type of diabetes', '2022-09-20 03:47:56', '2022-09-20 03:47:56', 'ans_a'),
(1719, NULL, 42, 1, '<p><strong>A patient was admitted to the hospital with unstable angina and congestive heart failure. The unstable angina is treated with nitrates, and intravenous Lasix is given to manage the heart failure. What is the appropriate coding action?</strong></p>', 'Assign only the code for the congestive heart failure.', 'Assign the codes for the unstable angina and congestive heart failure, sequence either first.', 'Query the physician about which diagnoses to code.', 'Assign only the code for the unstable angina.', '2022-09-20 03:48:46', '2022-09-20 03:48:46', 'ans_b'),
(1720, NULL, 42, 1, '<p><strong>A patient presents to the outpatient surgical area for a cystoscopy with multiple biopsies of the bladder. The patient&rsquo;s presenting symptom is hematuria. What is the correct facility code assignment for this procedure?</strong><strong>52000</strong></p>\r\n\r\n<p><strong>52000 Cystourethroscopy (separate procedure)</strong></p>\r\n\r\n<p><strong>52204 Cystourethroscopy with biopsy(s)</strong></p>\r\n\r\n<p><strong>22 Increased procedural services</strong></p>', '52000', '52000-22', '52204', '52204, 52204-22', '2022-09-20 03:49:57', '2022-09-20 03:49:57', 'ans_c'),
(1721, NULL, 42, 1, '<p><strong>A patient has blepharoplasty of the left upper eyelid. What modifier should be used with the procedure?</strong></p>', 'LT', 'TA', 'E1', 'F2', '2022-09-20 03:50:56', '2022-09-20 03:50:56', 'ans_c'),
(1722, NULL, 42, 1, '<p><strong>Facilities may use X modifiers in place of which modifier?</strong></p>', '25', '27', '52', '59', '2022-09-20 03:51:35', '2022-09-20 03:51:35', 'ans_d'),
(1723, NULL, 42, 1, '<p><strong>A sigmoidectomy takes the physician more time than originally planned. The reason was extensive lysis of adhesions, which took over two hours. What modifier can the physician use to indicate this procedure required increased time?</strong></p>', '22', '26', '52', '59', '2022-09-20 03:52:13', '2022-09-20 03:52:13', 'ans_a'),
(1724, NULL, 42, 1, '<p><strong>A patient is admitted to the hospital with shortness of breath and congestive heart failure and subsequently develops respiratory failure. The patient undergoes intubation with ventilator management. The correct sequencing of the diagnoses in this case would be:</strong></p>', 'Congestive heart failure and respiratory failure', 'Respiratory failure', 'Respiratory failure and congestive heart failure', 'Shortness of breath, congestive heart failure, and respiratory failure', '2022-09-20 03:53:34', '2022-09-20 03:53:34', 'ans_a'),
(1725, NULL, 42, 1, '<p><strong>A patient was admitted with end stage renal disease (ESRD) following kidney transplant. The patient undergoes dialysis during admission. The patient&rsquo;s angina and chronic obstructive pulmonary disease are managed with medication while admitted. The diagnoses would be sequenced as:</strong></p>', 'Status post kidney transplant; ESRD, chronic obstructive pulmonary disease; angina', 'ESRD; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'Angina; ESRD, status post kidney transplant; chronic obstructive pulmonary disease', 'Chronic obstructive pulmonary disease; ESRD; status post kidney transplant; angina', '2022-09-20 03:56:05', '2022-09-20 03:56:05', 'ans_b'),
(1726, NULL, 42, 1, '<p><strong>This patient was admitted for chemotherapy due to a primary hepatocellular carcinoma of the transplanted liver. What codes are assigned?</strong></p>', 'C80.2, T86.49, Z51.11, C22.0', 'C22.0, C80.2, Z51.11, T86.49', 'Z51.11, T86.49, C80.2, C22.0', 'T86.49, C80.2, C22.0, Z51.11', '2022-09-20 04:00:27', '2022-09-20 04:00:27', 'ans_c'),
(1727, NULL, 42, 1, '<p><strong>A patient comes to the ER with chest pain and shortness of breath. An EKG was performed, and the patient&rsquo;s history of COPD was noted. Unstable angina was diagnosed as the chest pain came on while the patient was at rest and did not resolve with nitroglycerin. The patient was admitted for a left heart catheterization, coronary arteriography using two catheters, and left ventricular angiography. The patient was found to have arteriosclerotic heart disease. The patient has no history of cardiac surgery. The appropriate sequencing of ICD-10-CM and CPT codes would be:</strong></p>\r\n\r\n<p><strong>I20.0 Unstable angina</strong></p>\r\n\r\n<p><strong>I20.9 Angina pectoris, unspecified</strong></p>\r\n\r\n<p><strong>I25.10 Atherosclerotic heart disease of native coronary artery without angina pectoris</strong></p>\r\n\r\n<p><strong>I25.110 Atherosclerotic heart disease of native coronary artery with unstable angina pectoris</strong></p>\r\n\r\n<p><strong>I25.119 Atherosclerotic heart disease of native coronary artery with unspecified angina pectoris</strong></p>\r\n\r\n<p><strong>J44.9 Chronic obstructive pulmonary disease</strong></p>\r\n\r\n<p><strong>R06.02 Shortness of breath</strong></p>\r\n\r\n<p><strong>R07.9 Chest pain, unspecified</strong></p>\r\n\r\n<p><strong>93452 Left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed</strong></p>\r\n\r\n<p><strong>93453 Combined right and left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed</strong></p>\r\n\r\n<p><strong>93454 Catheter placement in coronary artery(s) for coronary angiography, including intraprocedural injection(s) for coronary angiography, imaging supervision and interpretation;</strong></p>\r\n\r\n<p><strong>93458 with left heart catheterization including intraprocedural injection(s) for left ventriculography, when performed</strong></p>', 'R07.9, R06.02, I25.119, 93452, 93458', 'J44.9, I20.0, I25.110, 93454, 93453', 'I20.9, J44.9, 93453', 'I25.110, J44.9, 93458', '2022-09-20 04:04:38', '2022-09-20 04:04:38', 'ans_d'),
(1728, NULL, 42, 1, '<p><strong>An obstetric patient is admitted with vaginal spotting and fever. She is found to have been treated for a miscarriage (spontaneous abortion), which was resolved two weeks prior to this admission. She is treated with aspiration dilation and curettage and products of conception are found. She is found to be septic. Which of the following is the correct sequencing of the diagnoses for this case?</strong></p>', 'A41.9, O03.37', 'O26.859, R50.9', 'R50.9, O26.859', 'O03.37, A41.9', '2022-09-20 04:05:20', '2022-09-20 04:05:20', 'ans_d'),
(1729, NULL, 42, 1, '<p><strong>&nbsp;A patient was admitted with pneumonia. Sputum cultures on day three of admission indicate a Klebsiella pneumonia. What is the POA status for the Klebsiella pneumonia and why?</strong></p>', 'Y, because the pneumonia was present on admission, even though the organism was not verified until days later', 'N, because the type of pneumonia was not verified until after admission', 'U, because the coding professional must query the physician for POA status in this case', 'W, because the physician cannot tell if the reason for the pneumonia at the time of admission was the Klebsiella or not', '2022-09-20 04:06:12', '2022-09-20 04:06:12', 'ans_a'),
(1730, NULL, 42, 1, '<p><strong>A patient has a hernia repair done as an outpatient. In recovery, the patient develops tachycardia and shortness of breath, is diagnosed with postoperative atrial fibrillation, and is subsequently admitted. What is the POA indicator for the postoperative atrial fibrillation?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-20 04:10:48', '2022-09-20 04:10:48', 'ans_a'),
(1731, NULL, 42, 1, '<p><strong>A patient is admitted with acute gastritis. On the second day of admission, the patient has hematemesis. The patient is also being treated for long-standing hypertension and diabetes, along with recently diagnosed hypothyroidism. Which of the patient&rsquo;s diagnoses will have a POA indicator of N?</strong></p>', 'Diabetes', 'Hypothyroidism', 'Hypertension', 'Acute gastritis', '2022-09-20 04:11:29', '2022-09-20 04:11:29', 'ans_d'),
(1732, NULL, 42, 1, '<p><strong>Which type of conditions are always considered present on admission?</strong></p>', 'Obstetrical', 'Congenital', 'Those with an acute exacerbation', 'Those that represent an injury', '2022-09-20 04:12:08', '2022-09-20 04:12:08', 'ans_b'),
(1733, NULL, 42, 1, '<p><strong>A patient is admitted for seizures. What is the appropriate POA for the external cause code of W06.XXXA assigned because the patient fell out of bed during a seizure in the emergency department?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-20 04:12:43', '2022-09-20 04:12:43', 'ans_a'),
(1734, NULL, 42, 1, '<p><strong>The outpatient code editor (OCE) has all of the following types of edits except:</strong></p>', 'Sex and procedure edits', 'Valid diagnosis code edits', 'Invalid revenue code edits', 'Diagnosis and age edits', '2022-09-20 04:13:45', '2022-09-20 04:13:45', 'ans_b'),
(1735, NULL, 42, 1, '<p><strong>Determining medical necessity for outpatient services includes all the following except:</strong></p>', 'Local coverage determinations (LCDs)', 'National coverage determinations (NCDs)', 'Diagnoses linked to procedures by claims-processing software tests ensuring that the procedure is cross-referenced, or linked, correctly to an acceptable diagnosis code for that service', 'Requiring new HCPCS codes be developed to replace codes in the CPT code book', '2022-09-20 04:14:29', '2022-09-20 04:14:29', 'ans_d'),
(1736, NULL, 42, 1, '<p><strong>The National Correct Coding Initiative (NCCI) Edits apply to services billed by:</strong></p>', 'The same provider, for same beneficiary, on same date of service', 'All providers, for the same beneficiary, on the same date of service', 'The same provider, for the same beneficiary, for all dates of service related to the encounter', 'All providers, for the same beneficiary, for all dates of service related to the encounter', '2022-09-20 04:15:12', '2022-09-20 04:15:12', 'ans_a'),
(1737, NULL, 42, 1, '<p><strong>If the principal diagnosis is an initial anterior wall myocardial infarction, which procedure will result in the highest MS-DRG assignment?</strong></p>', 'Mechanical ventilator', 'Insertion central venous catheter', 'Right heart cardiac catheterization', 'Transbronchial lung biopsy via bronchoscopy', '2022-09-20 04:18:59', '2022-09-20 04:18:59', 'ans_d'),
(1738, NULL, 42, 1, '<p><strong>Medicare payment to healthcare providers for services rendered is made under the:</strong></p>', 'Outpatient Prospective Payment System', 'Resource-based Relative Value Scale', 'Ambulatory Payment Classification', 'Conditions of Participation', '2022-09-20 04:21:11', '2022-09-20 04:21:11', 'ans_b'),
(1739, NULL, 42, 1, '<p><strong>Inpatient procedures are coded with:</strong></p>', 'HCPCS', 'CPT', 'ICD-10-PCS', 'ICD-O', '2022-09-20 04:23:48', '2022-09-20 04:23:48', 'ans_c'),
(1740, NULL, 42, 1, '<p><strong>Under the Inpatient Prospective Payment System (IPPS), what can be used to measure the cost of care for inpatients?</strong></p>', 'MS-DRG assignment', 'RBRVS', 'Case-mix index', 'SOI-ROM', '2022-09-20 04:42:33', '2022-09-20 04:42:33', 'ans_c'),
(1741, NULL, 42, 1, '<p><strong>The abstracting of this data element has an impact on the DRG reimbursement.</strong></p>', 'Date of service', 'Discharge disposition', 'Admission source', 'Medical record number', '2022-09-20 04:44:54', '2022-09-20 04:44:54', 'ans_b'),
(1742, NULL, 42, 1, '<p><strong>Which of the following is a data element that coding professionals typically are tasked with abstracting?</strong></p>', 'Blood type', 'Date of admission', 'Sex', 'Date of surgery', '2022-09-20 04:45:40', '2022-09-20 04:45:40', 'ans_d'),
(1743, NULL, 42, 1, '<p><strong>Dr. Jones is the attending physician for a patient admitted with aspiration of a ballpoint pen cap. Dr. Westwood is the provider who performed a direct laryngoscopy with foreign body removal on the patient the afternoon of admission. Monitoring of the patient&rsquo;s respiratory status continued for 36 hours after the procedure as severe swelling of the larynx was noted during the laryngoscopy. On the morning of discharge, the patient was noted to have acute, suppurative otitis media of the right ear and Dr. Phillips performed a myringotomy with tube insertion under general anaesthesia with assistance from Dr. Johannsen, the resident.</strong></p>\r\n\r\n<p><strong>Upon discharge, which physician will be assigned to the principal procedure that was performed?</strong></p>', 'Dr. Jones', 'Dr. Westwood', 'Dr. Johannsen', 'Dr. Phillips', '2022-09-20 04:46:38', '2022-09-20 04:46:38', 'ans_b'),
(1744, NULL, 42, 1, '<p><strong>When a patient leaves an acute inpatient prospective payment system (IPPS) facility against medical advice, and is then admitted into a different IPPS facility on the same day, the initial facility should categorise this as a(n):</strong></p>', 'Discharge', 'Transfer', 'Readmission', 'Outlier', '2022-09-20 04:47:26', '2022-09-20 04:47:26', 'ans_b'),
(1745, NULL, 42, 1, '<p><strong>A patient is admitted with an acute inferior myocardial infarction and discharged alive. Which condition would increase the MS-DRG weight?</strong></p>', 'Respiratory failure', 'Atrial fibrillation', 'Hypertension', 'History of myocardial infarction', '2022-09-20 04:48:23', '2022-09-20 04:48:23', 'ans_a'),
(1746, NULL, 42, 1, '<p><strong>Documentation in the health record reveals that a patient is admitted with an acute exacerbation of COPD (MS-DRG 192). Which of the following could potentially result in a higher weighted MS-DRG if documented as an associated diagnosis at the time of admission?</strong></p>', 'Angina and treated with nitroglycerin prn', 'Atrial fibrillation and underwent a cardioversion', 'Respiratory failure treated with intubation and mechanical ventilation for 23 hours', 'Anaemia and was given a blood transfusion', '2022-09-20 04:49:51', '2022-09-20 04:49:51', 'ans_c'),
(1747, NULL, 42, 1, '<p><strong>A female patient is diagnosed with congestive heart failure. Which of the following will increase the MS-DRG weight if present on admission?</strong></p>', 'Atrial fibrillation', 'Stage III pressure ulcer of coccyx', 'Blood loss anemia', 'Coronary artery disease', '2022-09-20 04:50:32', '2022-09-20 04:50:32', 'ans_b'),
(1748, NULL, 42, 1, '<p><strong>Major complications and comorbidities (MCCs) are determined to require the greatest degree of resources with a payment group and also reflect the greatest _____.</strong></p>', 'ROM', 'ROI', 'SOI', 'SNF', '2022-09-20 04:51:24', '2022-09-20 04:51:24', 'ans_c'),
(1749, NULL, 42, 1, '<p><strong>Which of the following diagnoses qualifies as MCC?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Coronary artery disease', 'Aortic stenosis', 'Type 2 myocardial infarction', 'Unspecified atrial fibrillation', '2022-09-20 04:52:25', '2022-09-20 04:52:25', 'ans_c'),
(1750, NULL, 42, 1, '<p><strong>A 7-year-old patient was admitted to the emergency department for treatment of shortness of breath. The patient is given epinephrine and nebulizer treatments. The shortness of breath and wheezing are unabated following treatment. What diagnosis should be suspected?</strong></p>', 'Acute bronchitis', 'Acute bronchitis with chronic obstructive pulmonary disease', 'Asthma with status asthmaticus', 'Chronic obstructive asthma', '2022-09-20 04:53:11', '2022-09-20 04:53:11', 'ans_c'),
(1751, NULL, 42, 1, '<p><strong>A 23-year-old female is admitted for shock following treatment of an ectopic pregnancy. This encounter would be coded as:</strong></p>', 'O03.81, Spontaneous abortion complicated by shock', 'O08.3, Complication following ectopic and molar pregnancies', 'R57.9, Shock NOS', 'T81.10XA, Postoperative shock', '2022-09-20 04:53:58', '2022-09-20 04:53:58', 'ans_b'),
(1752, NULL, 42, 1, '<p><strong>&nbsp;A patient is discharged with a diagnosis of acute pulmonary edema due to congestive heart failure. What condition(s) should be coded?</strong></p>', 'Acute pulmonary edema', 'Congestive heart failure', 'Acute pulmonary edema and congestive heart failure', 'Unable to determine based on the information provided', '2022-09-20 04:54:43', '2022-09-20 04:54:43', 'ans_b'),
(1753, NULL, 42, 1, '<p><strong>A 65-year-old male patient is being assessed for possible colon cancer and treated in the special procedure unit of the hospital. He undergoes a colonoscopy with biopsy of a suspicious area in the transverse colon using the cold biopsy forceps. In addition, a colonic ultrasound is performed, with transmural biopsy of an area of the mesentery adjacent to the transverse colon. Assign the appropriate CPT codes.</strong></p>', '45384, 45342', '45380, 45391', '45384, 45392', '45380, 45392', '2022-09-20 04:55:27', '2022-09-20 04:55:27', 'ans_d'),
(1754, NULL, 42, 1, '<p><strong>FNA and core biopsies are done on the same breast lesion, in the same session, on the same day, both performed with fluoroscopic guidance. What codes would be assigned?</strong></p>', '19100, 10007-59', '10007 ×2, 19100 ×2, 77002', '10007, 10008, 19100 ×2', '19100, 10007-59, 77002', '2022-09-20 04:56:07', '2022-09-20 04:56:07', 'ans_a'),
(1755, NULL, 42, 1, '<p><strong>The physician removes all of the right thyroid lobe without isthmusectomy. The physician exposes the thyroid via a transverse cervical incision in the skin line. The platysmas are divided and the strap muscles separated in the midline. The thyroid lobe to be excised is isolated and superior and inferior thyroid vessels serving that lobe are ligated. Parathyroid glands are preserved. The thyroid gland is divided in the midline of the isthmus over the anterior trachea. The thyroid lobe is resected. The platysmas and skin are closed. What code should be assigned?</strong></p>', '0GTH4ZZ', '0GTL0ZZ', '0GTH0ZZ', '0GTL4ZZ', '2022-09-20 05:00:20', '2022-09-20 05:00:20', 'ans_c'),
(1756, NULL, 42, 1, '<p><strong>The physician inserts a speculum into the vagina to view the cervix. The cervix was dilated. The endometrial lining of the uterus is scraped on all sides for therapeutic purposes. What code should be assigned?</strong></p>', '0UDB7ZX', '0UDB7ZZ', '0UDB8ZZ', '0U5B7ZZ', '2022-09-20 05:01:55', '2022-09-20 05:01:55', 'ans_b'),
(1757, NULL, 42, 1, '<p><strong>A 28-year-old male with a history of IV heroin dependence is admitted for pneumonia. A pulmonologist is consulted to assist with the patient&rsquo;s treatment and an antibiotic for Pneumocystis carinii pneumonia is administered. Low potassium is treated as well. The final diagnoses were coded as: B20, B59, E87.6, and F11.21. What is the discrepancy noted between the coding and the documentation?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'The “history of” code reflects abuse rather than dependence', 'The correct code for the pneumonia should be J18.9', 'The assignment of B20 has no supportive documentation', 'The hypokalemia should not be coded as that is integral to the pneumonia', '2022-09-20 05:03:25', '2022-09-20 05:03:25', 'ans_c'),
(1758, NULL, 42, 1, '<p><strong>A patient is admitted post&ndash;back surgery with uncontrolled pain and leakage at the surgical site. Vitals show a fever of 101 with some tachycardia noted as well. The attending physician documents inflammation, with an infectious disease consultant documenting Staphylococcus aureus infection based on the lab culture. How should the coding professional resolve the discrepancy between the diagnoses documented?</strong></p>', 'Code the inflammation since that is what the attending physician documented', 'Code the infection since the consultant was specific regarding the type of infection', 'Code the infection based on the lab culture results', 'Query the attending physician to clarify the conflicting documentation', '2022-09-20 05:04:15', '2022-09-20 05:04:15', 'ans_d'),
(1759, NULL, 42, 1, '<p><strong>A coding professional has noted that a particular nurse practitioner is sending orders for outpatient testing with the diagnosis listed as &ldquo;possible&rdquo; or &ldquo;rule out&rdquo; without any accompanying signs or symptoms or abnormal findings suggestive of the possible diagnosis. What action should the coding professional take?</strong></p>', 'Nothing, code the diagnosis as if it exists since this is an outpatient', 'Use an observation code for the encounter', 'Ask for outpatient CDI specialist to educate the NP on the guidelines for outpatient coding which do not permit the use of “possible” or “rule out” diagnoses', 'Report the nurse practitioner to quality management and billing as this practice is causing billing delays and increase in the discharge not final billed metric', '2022-09-20 05:05:01', '2022-09-20 05:05:01', 'ans_c'),
(1760, NULL, 42, 1, '<p><strong>An operative report indicates the physician performed metatarsal surgery but all other information in the health record points to need for metacarpal surgery. What step should the coding professional take upon this discovery?</strong></p>', 'Code the metatarsal surgery as that is what is documented in the operative report', 'Code the metacarpal surgery since the op report was clearly an error', 'Query the physician to determine which body area the surgery involved', 'Suspend the chart and contact the coding supervisor as to which procedure to code', '2022-09-20 05:05:48', '2022-09-20 05:05:48', 'ans_c'),
(1761, NULL, 42, 1, '<p><strong>A patient is seen in the ED with leg edema and headache. The patient denies shortness of breath, chest pain, and chills. The patient has a chest x-ray, CT of the head, and lab work. A doppler scan was done to evaluate for a DVT, which was negative. Final diagnoses in the ED were swelling of leg, migraine, and chest pain. What is the discrepancy in this documentation?</strong></p>', 'Swelling is not documented outside the final diagnosis', 'There was no chest pain by patient report', 'Possible DVT should have been listed as final diagnosis', 'No testing was provided to assess migraine', '2022-09-20 05:06:40', '2022-09-20 05:06:40', 'ans_b'),
(1762, NULL, 42, 1, '<p><strong>The most challenging type of provider query is issued for:</strong></p>', 'Determining cause and effect', 'Establishing clinical validation', 'Resolving documentation conflict', 'Clarifying acuity or specificity', '2022-09-20 05:07:32', '2022-09-20 05:07:32', 'ans_b'),
(1763, NULL, 42, 1, '<p><strong>When creating a compliant query to clarify conflicting information from the surgeon and the attending physician, to whom should the query be directed?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Surgeon', 'Attending physician', 'Medical staff director', 'Medical records committee chairperson', '2022-09-20 05:08:15', '2022-09-20 05:08:15', 'ans_b'),
(1764, NULL, 42, 1, '<p><strong>When a compliant query remains unanswered, what is the next step for the coding professional?</strong></p>', 'Ask the HIM director to place the physician on suspension until the query is answered.', 'Alert the CEO that the query is outstanding, requesting a fine until the query is answered.', 'Refer to the internal escalation policy and follow the process outlined therein.', 'Report the physician to the peer review committee for disciplinary measures.', '2022-09-20 05:09:04', '2022-09-20 05:09:04', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1765, NULL, 42, 1, '<p><strong>When creating compliant queries coding professionals should:</strong></p>', 'Query once without further follow up', 'Query multiple times until the desired diagnosis is provided', 'Query once with additional follow up if necessary', 'Query unlimited times until every discrepancy is resolved', '2022-09-20 05:09:54', '2022-09-20 05:09:54', 'ans_c'),
(1766, NULL, 42, 1, '<p><strong>Verbal queries:</strong></p>', 'Are not permissible in any circumstance', 'Must have a written response in the health record for coding purposes', 'Have different rules or criteria than written queries', 'Are not required to be documented as long as the healthcare provider responds verbally', '2022-09-20 05:11:04', '2022-09-20 05:11:04', 'ans_b'),
(1767, NULL, 42, 1, '<p><strong>A patient is admitted with a high temperature, lethargy, hypotension, tachycardia, oliguria, and elevated WBC. The patient also has more than 100,000 organisms of Escherichia coli per cc of urine. The attending physician documents &ldquo;urosepsis.&rdquo; What is the next step for the coding professional?</strong></p>', 'Code sepsis as the principal with a secondary diagnosis of urinary tract infection due to E. coli.', 'Code urinary tract infection with sepsis as a secondary diagnosis.', 'Query the physician to determine if the patient is being treated for sepsis, highlighting the clinical signs and symptoms.', 'Ask the physician whether the patient had septic shock so that this may be used as the principal diagnosis.', '2022-09-20 05:12:35', '2022-09-20 05:12:35', 'ans_c'),
(1768, NULL, 42, 1, '<p><strong>A patient has findings suggestive of chronic obstructive pulmonary disease (COPD) on chest x-ray. The attending physician mentions the x-ray finding in one progress note but no medication, treatment, or further evaluation is provided. The coding professional should:</strong></p>', 'Query the attending physician regarding the x-ray finding', 'Code the condition because the documentation reflects it', 'Question the radiologist regarding whether to code this condition', 'Use a code from abnormal findings to reflect the condition', '2022-09-20 05:14:52', '2022-09-20 05:14:52', 'ans_a'),
(1769, NULL, 42, 1, '<p><strong>&nbsp;If a patient undergoes an inpatient procedure and the final summary diagnosis is different from the diagnosis on the pathology report, the coding professional should:</strong></p>', 'Code only from the discharge diagnoses', 'Code the diagnosis reflected on the pathology report', 'Code the most severe symptom', 'Query the attending physician as to the final diagnosis', '2022-09-20 05:16:00', '2022-09-20 05:16:00', 'ans_d'),
(1770, NULL, 42, 1, '<p><strong>A 56-year-old woman is admitted to an acute-care facility from a skilled nursing facility. The patient has multiple sclerosis and hypertension. During the course of hospitalization, a decubitus ulcer is found and debrided at the bedside by a physician. There is no typed operative report and no pathology report. The coding professional should:</strong></p>', 'Use an excisional debridement code as these charts are rarely reviewed to verify the excisional debridement.', 'Code with a non-excisional debridement procedure code', 'Query the healthcare provider who performed the procedure to determine if the debridement was excisional.', 'Eliminate the procedure code all together.', '2022-09-20 05:17:59', '2022-09-20 05:17:59', 'ans_c'),
(1771, NULL, 42, 1, '<p><strong>Patient presents with lower left quadrant abdominal pain with normal white cell count. X-ray showed sigmoid diverticulitis. Patient underwent a resection of sigmoid colon with anastomosis, developing a postoperative ileus after surgery. Nausea abated after resolution of the ileus. What is the query opportunity for this case?</strong></p>', 'Was the diverticulitis perforated?', 'Was the nausea postoperative?', 'Was there an associated abscess with the diverticulitis?', 'Was the postoperative ileus a complication?', '2022-09-20 05:19:35', '2022-09-20 05:19:35', 'ans_d'),
(1772, NULL, 42, 1, '<p><strong>A 64-year-old female is admitted to the hospital with nausea, vomiting, and edema. The patient has a history of diabetes and takes Metformin and Lisinopril as prescribed. Blood sugar and blood pressure are monitored while admitted. On the discharge summary, the final diagnoses of acute renal failure and diabetes are documented. What is the query opportunity for this record?</strong></p>', 'Is the acute renal failure linked to the diabetes?', 'Does the patient have hypertension?', 'Does the patient have chronic renal failure?', 'Is the diabetes out of control?', '2022-09-20 05:21:01', '2022-09-20 05:21:01', 'ans_b'),
(1773, NULL, 42, 1, '<p><strong>Most hospitals require a medical record to be completed within:</strong></p>', '5 days', '10 days', '7 days', '30 days', '2022-09-20 05:21:50', '2022-09-20 05:21:50', 'ans_d'),
(1774, NULL, 42, 1, '<p><strong>To correct an entry in a paper-based medical record, the provider should:</strong></p>', 'Draw a single line through the error, add a note explaining the error, initial and date, add the correct information in chronological order', 'Draw a double line through the error, initial and date, add the reason for the correction', 'Draw a single line through the error, and add the correct information in chronological order', 'Draw several lines through the error, obliterate the documentation as much as possible, initial and date, add the correct information in chronological order', '2022-09-20 05:23:52', '2022-09-20 05:23:52', 'ans_a'),
(1775, NULL, 42, 1, '<p><strong>After a patient is discharged from the hospital, the medical record must be reviewed for:</strong></p>', 'Inclusion of all incident reports', 'Certain basic reports (for example, history and physical, discharge summary)', 'Voided prescription pads', 'Personal case notes from all mental health providers', '2022-09-20 05:24:44', '2022-09-20 05:24:44', 'ans_b'),
(1776, NULL, 42, 1, '<p><strong>&nbsp;A completed and signed operative report needs clarification of the size of the skin lesions that were removed. What process is used for that clarification?</strong></p>', 'Amendment', 'Addendum', 'Update', 'Revision', '2022-09-20 05:28:35', '2022-09-20 05:28:35', 'ans_a'),
(1777, NULL, 42, 1, '<p><strong>The information in the table represents all the CPT/HCPCS codes and associated information pertinent to a patient&rsquo;s encounter for care. From the information provided, how many APCs would impact this patient&rsquo;s total reimbursement?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\"><strong>Billing Number</strong></th>\r\n			<th scope=\"col\"><strong>Status Indicator*</strong></th>\r\n			<th scope=\"col\"><strong>CPT/HCPCS.</strong></th>\r\n			<th scope=\"col\"><strong>APC</strong></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>V</td>\r\n			<td>99285-25</td>\r\n			<td>05025</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>T</td>\r\n			<td>25500</td>\r\n			<td>05111</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>X</td>\r\n			<td>72050</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>S</td>\r\n			<td>72128</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>N</td>\r\n			<td>70450</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>*Status Indicators.</strong></p>\r\n\r\n<p><strong>N&mdash;No additional payment, payment included in line items with APCs for incidental service</strong></p>\r\n\r\n<p><strong>S&mdash; Significant Procedure, Not Discounted when Multiple</strong></p>\r\n\r\n<p><strong>T&mdash;Significant Procedure, Multiple Reduction Applies</strong></p>\r\n\r\n<p><strong>V&mdash;Medical visit to clinic or emergency department</strong></p>\r\n\r\n<p><strong>X&mdash;Ancillary Services</strong></p>', '1', '5', '4', 'Unable to determine', '2022-09-20 05:29:59', '2022-11-19 08:11:24', 'ans_c'),
(1778, NULL, 42, 1, '<p><strong>What percentage will the facility be paid for procedure code 25500?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use the information in the following table to answer questions.</strong></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\"><strong>Billing Number</strong></th>\r\n			<th scope=\"col\"><strong>Status Indicator*</strong></th>\r\n			<th scope=\"col\"><strong>CPT/HCPCS.</strong></th>\r\n			<th scope=\"col\"><strong>APC</strong></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>V</td>\r\n			<td>99285-25</td>\r\n			<td>05025</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>T</td>\r\n			<td>25500</td>\r\n			<td>05111</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>X</td>\r\n			<td>72050</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>S</td>\r\n			<td>72128</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>N</td>\r\n			<td>70450</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>*Status Indicators.</strong></p>\r\n\r\n<p><strong>N&mdash;No additional payment, payment included in line items with APCs for incidental service</strong></p>\r\n\r\n<p><strong>S&mdash; Significant Procedure, Not Discounted when Multiple</strong></p>\r\n\r\n<p><strong>T&mdash;Significant Procedure, Multiple Reduction Applies</strong></p>\r\n\r\n<p><strong>V&mdash;Medical visit to clinic or emergency department</strong></p>\r\n\r\n<p><strong>X&mdash;Ancillary Services</strong></p>', '50%', '75%', '0%', '100%', '2022-09-20 05:30:42', '2022-11-19 08:12:21', 'ans_d'),
(1779, NULL, 42, 1, '<p><strong>&nbsp;If another status T procedure were performed, how much would the facility receive for the second status T procedure?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Use the information in the following table to answer questions.</strong></p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<thead>\r\n		<tr>\r\n			<th scope=\"col\"><strong>Billing Number</strong></th>\r\n			<th scope=\"col\"><strong>Status Indicator*</strong></th>\r\n			<th scope=\"col\"><strong>CPT/HCPCS.</strong></th>\r\n			<th scope=\"col\"><strong>APC</strong></th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>V</td>\r\n			<td>99285-25</td>\r\n			<td>05025</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>T</td>\r\n			<td>25500</td>\r\n			<td>05111</td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>X</td>\r\n			<td>72050</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>S</td>\r\n			<td>72128</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n		<tr>\r\n			<td><strong>989323</strong></td>\r\n			<td>N</td>\r\n			<td>70450</td>\r\n			<td><strong>05522</strong></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>*Status Indicators.</strong></p>\r\n\r\n<p><strong>N&mdash;No additional payment, payment included in line items with APCs for incidental service</strong></p>\r\n\r\n<p><strong>S&mdash; Significant Procedure, Not Discounted when Multiple</strong></p>\r\n\r\n<p><strong>T&mdash;Significant Procedure, Multiple Reduction Applies</strong></p>\r\n\r\n<p><strong>V&mdash;Medical visit to clinic or emergency department</strong></p>\r\n\r\n<p><strong>X&mdash;Ancillary Services</strong></p>', '50%', '75%', '0%', '100%', '2022-09-20 05:31:37', '2022-11-19 08:12:56', 'ans_a'),
(1780, NULL, 42, 1, '<p><strong>&nbsp;Which of the following would be considered a hospital-acquired condition when the POA indicator is N?</strong></p>', 'DVT following a gastric procedure', 'Diabetes with neuropathy', 'Catheter-associated urinary tract infection', 'Foreign body in the thumb', '2022-09-20 05:32:52', '2022-09-20 05:32:52', 'ans_c'),
(1781, NULL, 42, 1, '<p><strong>A patient is admitted with abdominal pain and is found to have a perforation due to large intestine diverticulitis. A colectomy is performed. Following the procedure, there was fever, and elevated white count with peritonitis suspected. An x-ray shows a metallic object in the area of the previous surgery. A return to the OR with reopening of the wound shows that a piece of a surgical blade had broken off and been left in the wound. Which of the following diagnoses is a hospital-acquired condition and will bear the POA indicator of N?</strong></p>', 'R50.9', 'K57.20', 'D72.829', 'T81.590A', '2022-09-20 05:33:41', '2022-09-20 05:33:41', 'ans_d'),
(1782, NULL, 42, 1, '<p><strong>When a POA indicator for a HAC that is the only CC/MCC condition on the record is listed as N, what happens to the reimbursement for that account?</strong></p>', 'Nothing, the reimbursement is not impacted as this is an internal quality monitoring code', 'The reimbursement increases, since the condition was not present on admission and more resources were needed to care for the patient', 'The reimbursement is not eligible for increase, since the condition was not present on admission and should have been prevented using best practices', 'The reimbursement is placed on hold until the physician clarifies why the patient did not have the condition on admission', '2022-09-20 05:34:52', '2022-09-20 05:34:52', 'ans_c'),
(1783, NULL, 42, 1, '<p><strong>Which of the following conditions is on the hospital-acquired condition list?</strong></p>', 'Diabetic foot ulcer', 'Stage 2 coccyx pressure ulcer', 'Calf ulcer, left leg, with muscle necrosis', 'Right elbow pressure ulcer, stage 4', '2022-09-20 05:36:12', '2022-09-20 05:36:12', 'ans_d'),
(1784, NULL, 42, 1, '<p><strong>Which of the following statements best describes how the retention of records should be determined?</strong></p>', 'Unless state law requires longer periods of time, specific patient health information should be retained for HIPAA-established minimum time periods.', 'AHIMA has published specific guidelines for retention of health information and these guidelines should be followed for records retention.', 'The Joint Commission has developed standards for retention of health information that must be followed to maintain accreditation and these standards should be adhered to with regard to time frames.', 'Health records should be retained according to their use in a healthcare entity and the state and federal laws do not apply to the retention of this health information.', '2022-09-20 05:38:14', '2022-09-20 05:38:14', 'ans_a'),
(1785, NULL, 42, 1, '<p><strong>The form that must be completed in order to permit a specific disclosure of protected health information is called a(n):</strong></p>', 'Authorization', 'Consent', 'Access', 'Redisclosure', '2022-09-20 05:39:25', '2022-09-20 05:39:25', 'ans_a'),
(1786, NULL, 42, 1, '<p><strong>The minimum necessary requirement would apply in which of the following scenarios?</strong></p>', 'When disclosure is to the secretary of HHS for investigation', 'When disclosure is required by law', 'When disclosure is for payment', 'When disclosure is made to the personal representative of the individual', '2022-09-20 05:40:15', '2022-09-20 05:40:15', 'ans_c'),
(1787, NULL, 42, 1, '<p><strong>What is the term used when protected health information has been disclosed inappropriately?</strong></p>', 'Exposure', 'Breach', 'Violation', 'Infraction', '2022-09-20 05:42:20', '2022-09-20 05:42:20', 'ans_b'),
(1788, NULL, 42, 1, '<p><strong>What is the term used for applying the HIPAA Privacy Rule over state rule(s) that are less strict?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Exception', 'Preemption', 'Exclusion', 'Predominance', '2022-09-20 05:43:45', '2022-09-20 05:43:45', 'ans_b'),
(1789, NULL, 42, 1, '<p><strong>A contract coding professional works for a hospital and, in the course of daily work, routinely accesses protected patient health information. Under HIPAA, what should be in place to permit access and protect patient privacy?</strong></p>', 'AHIMA credential', 'Business associate agreement', 'Vendor license', 'Patient authorization', '2022-09-20 05:44:59', '2022-09-20 05:44:59', 'ans_b'),
(1790, NULL, 42, 1, '<p><strong>Based on the AHIMA Code of Ethics, which of the following is not considered an ethical activity?</strong></p>', 'Coding audits', 'Using health records for educational purposes within the department', 'Reviewing the history and physical of a coworker when not part of work assignment', 'Completion of code assignment', '2022-09-20 05:46:27', '2022-09-20 05:46:27', 'ans_c'),
(1791, NULL, 42, 1, '<p><strong>After consulting with a physician, a coding supervisor has issued an internal policy stating that all bedside debridement be coded as excisional. Is this an ethical practice for a coding professional to follow? Why or why not?</strong></p>', 'Yes, physician guidance provided basis for the policy.', 'Yes, coding professionals must follow internal policies of the facilities where they are employed.', 'No, coding supervisors cannot make internal policies without approval of administration.', 'No, internal policies cannot conflict with requirements provided in coding guidelines, conventions, and so on.', '2022-09-20 05:47:14', '2022-09-20 05:47:14', 'ans_d'),
(1792, NULL, 42, 1, '<p><strong>It is unethical for a coding professional to query:</strong></p>', 'Retrospectively', 'When the response will impact reimbursement', 'Based on information in a previous encounter', 'Multiple times on the same patient record', '2022-09-20 05:48:09', '2022-09-20 05:48:09', 'ans_c'),
(1793, NULL, 42, 1, '<p><strong>A patient came in for surgery and developed a postoperative infection. The patient had multiple comorbid conditions, which provided several CC and MCC conditions that were captured in coding. However, the coding professional left off the post-op infection code knowing it would impact the physician&rsquo;s quality of care score. Is this acceptable, ethical practice? Why or why not?</strong></p>', 'Yes; since it will not impact reimbursement, there is no issue.', 'Yes; coding professionals have discretion in which codes to assign on every case.', 'No; the coding of the post-op infection would have impacted reimbursement.', 'No; coding professionals cannot intentionally omit codes in order to affect quality scores.', '2022-09-20 05:49:37', '2022-09-20 05:49:37', 'ans_d'),
(1794, NULL, 42, 1, '<p><strong>Which of the following is an ethical way to handle an internal coding policy that conflicts with coding guidelines?</strong></p>', 'Report the concern through the organization’s compliance hotline', 'Talk with fellow coding professionals to develop your own plan', 'Ignore the internal policy and follow coding guidelines', 'Wait six months to see if the policy gets changed and then report your concern', '2022-09-20 05:50:57', '2022-09-20 05:50:57', 'ans_a'),
(1795, NULL, 42, 1, '<p><strong>In addition to credentialed coding professionals, AHIMA&rsquo;s Standards of Ethical Coding apply to which of the following groups?</strong></p>', 'Non credentialed coding professionals and students', 'Students and attorneys', 'Attorneys and auditors', 'Case managers and non credentialed coding professionals', '2022-09-20 05:52:09', '2022-09-20 05:52:09', 'ans_a'),
(1796, NULL, 42, 1, '<p><strong>A diabetic patient was admitted for treatment of a pressure ulcer. The patient also has a history of diabetic neuropathy and retinopathy. The patient is blind and additional nursing care and extended time with the patient was required. Which conditions should be coded at discharge?</strong></p>', 'Pressure ulcer, history of neurologic condition, history of retinal condition, diabetes', 'Pressure ulcer, diabetic neuropathy and diabetic retinopathy, and blindness', 'Pressure ulcer, diabetic neuropathy', 'Pressure ulcer, diabetic retinopathy, and blindness', '2022-09-20 05:53:36', '2022-09-20 05:53:36', 'ans_b'),
(1797, NULL, 42, 1, '<p><strong>A patient admitted with shoulder pain has an inpatient discharge with principal diagnosis of either peptic ulcer or cholecystitis documented on the history and physical. Both are equally treated and well documented. A coding professional should:</strong></p>', 'Code based on the circumstances of admission and if both are equally treated, code either as principal', 'Use a code from the abnormal findings category', 'Code to the most severe symptom only', 'Code shoulder pain followed by both peptic ulcer, cholecystitis', '2022-09-20 05:56:49', '2022-09-20 05:56:49', 'ans_a'),
(1798, NULL, 42, 1, '<p><strong>&nbsp;During an admission for congestive heart failure (CHF), a chest x-ray was done to evaluate the severity of the CHF. An asymptomatic hernia was also found for which no treatment or evaluation was done. What is the reason that the hernia should not be coded?</strong></p>', 'The patient’s primary condition of interest is the CHF.', 'The hernia is an incidental finding and does not meet the UHDDS requirements.', 'The patient is asymptomatic.', 'The condition does not impact the reimbursement.', '2022-09-20 05:57:33', '2022-09-20 05:57:33', 'ans_b'),
(1799, NULL, 42, 1, '<p><strong>According to the UHDDS, section III, the definition of other diagnoses is all conditions that:</strong></p>', 'Coexist at the time of admission, that develop subsequently, or that affect the treatment received or the length of stay', 'Receive evaluation and are documented by the physician', 'Receive clinical evaluation, therapeutic treatment, further evaluation, extend the length of stay, increase nursing monitoring/care', 'Are considered to be essential by the physicians involved and are reflected in the record', '2022-09-20 05:58:20', '2022-09-20 05:58:20', 'ans_a'),
(1800, NULL, 42, 1, '<p><strong>Which patient-specific UHDDS items also have the potential to have an impact on MS-DRG assignment?</strong></p>', 'Race and residence', 'Residence and sex', 'Sex and discharge disposition', 'Discharge disposition and race', '2022-09-20 05:59:00', '2022-09-20 05:59:00', 'ans_c'),
(1801, NULL, 42, 1, '<p><strong>A 55-year-old male was transferred to a nursing home for continuing care because of ventilator dependence following complications of cardiac bypass surgery. He was readmitted three weeks later due to ventilator associated pneumonia (VAP) due to Pseudomonas aeruginosa. How should the readmission be coded?</strong></p>', 'T88.9XXA, J18.9, B96.5', 'J16.8', 'J95.851, B96.5', 'J15.1, J95.851', '2022-09-20 09:20:59', '2022-09-20 09:20:59', 'ans_c'),
(1802, NULL, 43, 1, '<p><strong>Assign code(s) for the following diagnosis: Congestive heart failure due to hypertension.</strong></p>\r\n\r\n<p><strong>I10 Essential (primary) hypertension</strong></p>\r\n\r\n<p><strong>I11.0 Hypertensive heart disease with heart failure</strong></p>\r\n\r\n<p><strong>I50.9 Heart failure, unspecified</strong></p>\r\n\r\n<p><strong>I50.23 Acute on chronic systolic (congestive) heart failure</strong></p>', 'I10, I50.9', 'I11.0', 'I50.23, I10', 'I11.0, I50.9', '2022-09-20 09:22:44', '2022-09-20 09:22:44', 'ans_d'),
(1803, NULL, 43, 1, '<p><strong>A patient is seen for evaluation of a right orbital roof fracture. How should this be coded?</strong></p>\r\n\r\n<p><strong>S02.121A Fracture of orbital roof, right side, initial encounter for closed fracture</strong></p>\r\n\r\n<p><strong>S02.31XA Fracture of orbital floor, right side, initial encounter for closed fracture</strong></p>\r\n\r\n<p><strong>S02.92XA Unspecified fracture of facial bones, initial encounter for closed fracture</strong></p>\r\n\r\n<p><strong>S02.91XA Unspecified fracture of skull, initial encounter for closed fracture</strong></p>', 'S02.121A', 'S02.31XA', 'S02.92XA', 'S02.91XA', '2022-09-20 09:23:50', '2022-09-20 09:23:50', 'ans_a'),
(1804, NULL, 43, 1, '<p><strong>Patient presents in the ER with thrombosis of a loop PTFE hemodialysis fistula without mechanical complications. The physician performed a percutaneous thrombectomy of the left brachial vein. Assign a facility code for this outpatient procedure.</strong></p>\r\n\r\n<p><strong>05CA3ZZ Extirpation of matter from left brachial vein, percutaneous approach</strong></p>\r\n\r\n<p><strong>36904 Percutaneous transluminal mechanical thrombectomy and/or infusion for thrombolysis, dialysis circuit, any method, including all imaging and radiological supervision and interpretation, diagnostic angiography, fluoroscopic guidance, catheter placement(s), and intraprocedural pharmacological thrombolytic injection(s)</strong></p>\r\n\r\n<p><strong>36832 Revision, open, arteriovenous fistula; without thrombectomy, autogenous or nonautogenous dialysis graft (separate procedure)</strong></p>\r\n\r\n<p><strong>37184 Primary percutaneous transluminal mechanical thrombectomy, noncoronary, arterial or arterial bypass graft, including fluoroscopic guidance and intraprocedural pharmacological thrombolytic injection(s); initial vessel</strong></p>\r\n\r\n<p>&nbsp;</p>', '05CA3ZZ', '36904', '37184', '36832', '2022-09-20 09:24:49', '2022-09-20 09:24:49', 'ans_b'),
(1805, NULL, 43, 1, '<p><strong>Patient admitted for thoracoscopic repair of right diaphragmatic hernia. Assign the ICD-10-PCS procedure code for this surgery.</strong></p>\r\n\r\n<p><strong>0BQT4ZZ Repair diaphragm, percutaneous endoscopic approach</strong></p>\r\n\r\n<p><strong>0BQT3ZZ Repair diaphragm, percutaneous approach</strong></p>\r\n\r\n<p><strong>0WQF4ZZ Repair abdominal wall, percutaneous endoscopic approach</strong></p>\r\n\r\n<p><strong>0BQT0ZZ Repair diaphragm, open approach</strong></p>', '0BQT4ZZ', '0BQT3ZZ', '0WQF4ZZ', '0BQT0ZZ', '2022-09-20 09:25:47', '2022-09-20 09:25:47', 'ans_a'),
(1806, NULL, 43, 1, '<p><strong>A 45-year-old female patient comes in requesting an HIV test. The patient reports multiple male sexual partners recently. The patient undergoes HIV screening due to high-risk heterosexual behavior. What code(s) should be assigned?</strong></p>', 'Z72.52, Z11.3', 'Z11.4, Z72.51', 'Z72.51, Z11.4', 'Z11.3, Z72.52', '2022-09-20 09:27:53', '2022-09-20 09:27:53', 'ans_b'),
(1807, NULL, 43, 1, '<p><strong>A 23-year-old female is admitted for vaginal bleeding following a miscarriage two weeks prior to this admission. She is afebrile at this time and is treated with an aspiration dilation and curettage. Products of conception are found. Which of the following should be the principal diagnosis?</strong></p>', 'O03.1, Delayed or excessive hemorrhage following incomplete spontaneous abortion', 'O08.1, Delayed or excessive hemorrhage following ectopic and molar pregnancy', 'O03.6, Delayed or excessive hemorrhage following complete or unspecified spontaneous abortion', 'O07.1, Delayed or excessive hemorrhage following failed attempted termination of pregnancy', '2022-09-20 09:31:38', '2022-09-20 09:31:38', 'ans_a'),
(1808, NULL, 43, 1, '<p><strong>A patient presents to the emergency department with a fractured arm secondary to a fall precipitated by syncope and ataxia. The patient undergoes a closed reduction of the fracture in the emergency department and is then admitted for work up for metastatic carcinoma secondary to ataxia and syncope in a patient with recent history of lung cancer. The patient&rsquo;s work-up confirms recurrent lung carcinoma metastatic to the brain.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The principal diagnosis should be:</strong></p>', 'Fractured arm', 'Syncope', 'Metastatic carcinoma of the brain', 'Carcinoma of the lung', '2022-09-21 03:28:36', '2022-09-21 03:28:36', 'ans_c'),
(1809, NULL, 43, 1, '<p><strong>A female patient with hematochezia presented to the hospital outpatient surgery department for a colonoscopy but the procedure was not performed due to elevated blood pressure. What is the first-listed diagnosis for this encounter?</strong></p>', 'Elevated blood pressure', 'Hematochezia', 'Procedure not performed due to contraindication', 'Procedure not performed for other reason', '2022-09-21 03:29:25', '2022-09-21 03:29:25', 'ans_b'),
(1810, NULL, 43, 1, '<p><strong>A patient was admitted for evaluation of chest pain. CAD was discovered upon completion of a left heart cath done with evaluation of the left heart, multiple coronary arteries, and aortography with low osmolar contrast. A non-drug eluting stent was required in the left anterior descending artery to alleviate the blockage. Prior to discharge the patient fell out of bed and suffered a left greater trochanter hip fracture. Open reduction, internal fixation was performed. Two days after the ORIF, the patient began running a fever and had chills. A post-op infection was diagnosed and a PICC line was inserted into the superior vena cava for administration of IV antibiotics over the next several weeks. Which of the following would be the principal procedure for this patient&rsquo;s stay?</strong></p>', '02HV33Z', '4A023N7', '0QS704Z', '02703DZ', '2022-09-21 03:30:03', '2022-09-21 03:30:03', 'ans_d'),
(1811, NULL, 43, 1, '<p><strong>A 55-year-old patient with AIDS is admitted after being struck by a car while walking in a parking lot. She has a comminuted, right femoral shaft fracture, a contusion of both hands, and a right elbow abrasion. The principal diagnosis should be the:</strong></p>', 'AIDS', 'Fractured femur', 'Abrasion elbow', 'Contusion hand', '2022-09-21 03:31:20', '2022-09-21 03:31:20', 'ans_b'),
(1812, NULL, 43, 1, '<p><strong>A patient takes Coumadin as prescribed and correctly administered. However, the patient develops hematuria secondary to the Coumadin use. The correct coding assignment for this case would be:</strong></p>', 'Poisoning due to Coumadin', 'Unspecified adverse reaction to Coumadin', 'Hematuria, poisoning due to Coumadin', 'Hematuria, adverse reaction to Coumadin', '2022-09-21 03:33:08', '2022-09-21 03:33:08', 'ans_d'),
(1813, NULL, 43, 1, '<p><strong>A patient with human immunodeficiency virus (HIV) with methicillin susceptible pneumonia due to Staphylococcus aureus was discharged from the acute-care setting. The physician documented that the pneumonia was HIV related. How should this be coded?</strong></p>\r\n\r\n<p><strong>B20Human immunodeficiency virus [HIV] disease</strong></p>\r\n\r\n<p><strong>J15.20 Pneumonia due to staphylococcus, unspecified</strong></p>\r\n\r\n<p><strong>J15.211 Pneumonia due to methicillin susceptible Staphylococcus aureus</strong></p>\r\n\r\n<p><strong>J15.212 Pneumonia due to methicillin resistant Staphylococcus aureus</strong></p>\r\n\r\n<p><strong>J17 Pneumonia in diseases classified elsewhere</strong></p>', 'B20, J17', 'J15.20, B20', 'B20, J15.211', 'J15.212, B20', '2022-09-21 03:34:16', '2022-09-21 03:34:16', 'ans_c'),
(1814, NULL, 43, 1, '<p><strong>A patient has a diabetic ulcer of the right foot. How should this patient&rsquo;s record be coded?</strong></p>\r\n\r\n<p><strong>E11.40 Type 2 diabetes mellitus with diabetic neuropathy, unspecified</strong></p>\r\n\r\n<p><strong>E11.621 Type 2 diabetes mellitus with foot ulcer</strong></p>\r\n\r\n<p><strong>E11.69 Type 2 diabetes mellitus with other specified complication</strong></p>\r\n\r\n<p><strong>L97.409 Non-pressure chronic ulcer of unspecified heel and midfoot with unspecified severity</strong></p>\r\n\r\n<p><strong>L97.419 Non-pressure chronic ulcer of right heel and midfoot with unspecified severity</strong></p>', 'E11.40, L97.419', 'E11.40, L97.409', 'E11.69, L97.419', 'E11.621, L97.419', '2022-09-21 03:35:27', '2022-09-21 03:35:27', 'ans_d'),
(1815, NULL, 43, 1, '<p><strong>Acute peptic ulcer with perforation and hemorrhage resulting in acute blood loss anemia. What codes should be assigned?</strong></p>\r\n\r\n<p><strong>K27.0 Acute peptic ulcer, site unspecified, with hemorrhage</strong></p>\r\n\r\n<p><strong>K27.1 Acute peptic ulcer, site unspecified, with perforation</strong></p>\r\n\r\n<p><strong>K27.2 Acute peptic ulcer, site unspecified, with both hemorrhage and perforation</strong></p>\r\n\r\n<p><strong>D50.0 Iron deficiency anemia secondary to blood loss (chronic)</strong></p>\r\n\r\n<p><strong>D62 Acute posthemorrhagic anemia</strong></p>', 'K27.1, D50.0', 'K27.0, D62', 'K27.0, D50.0', 'K27.2, D62', '2022-09-21 03:36:29', '2022-09-21 03:36:29', 'ans_d'),
(1816, NULL, 43, 1, '<p><strong>A patient is admitted as an inpatient and discharged with chest pain. After evaluation, it is suspected the patient&rsquo;s right upper quadrant pain may have been related to gastroesophageal reflux disease (GERD). The final diagnosis was &ldquo;Rule out GERD.&rdquo; The correct code assignment would be:</strong></p>', 'Z03.89, Encounter for observation for other suspected diseases and conditions ruled out', 'R10.11, Right upper quadrant pain', 'K21.9, Gastroesophageal reflux disease without esophagitis', 'R07.9, Chest pain, unspecified', '2022-09-21 03:37:17', '2022-09-21 03:37:17', 'ans_c'),
(1817, NULL, 43, 1, '<p><strong>&nbsp;If a patient undergoes an open biopsy for a frozen section immediately before the definitive surgery, how should this be coded according to ICD-10-PCS guidelines?</strong></p>', 'Definitive surgery only', 'Open biopsy only', 'Exploratory surgery', 'Open biopsy and definitive surgery', '2022-09-21 03:39:12', '2022-09-21 03:39:12', 'ans_d'),
(1818, NULL, 43, 1, '<p><strong>The physician performed a bilateral myringotomy under general anaesthesia for insertion of ventilating tubes on a 4-year-old male. This is due to chronic otitis media. What are the correct CPT code and modifier assignment for this procedure?</strong></p>\r\n\r\n<p><strong>69421 Myringotomy including aspiration and/or Eustachian tube inflation requiring general&nbsp; &nbsp; anaesthesia</strong></p>\r\n\r\n<p><strong>&nbsp;69436 Tympanostomy (requiring insertion of ventilating tube), general anaesthesia</strong></p>\r\n\r\n<p><strong>&nbsp;50 Bilateral procedure</strong></p>\r\n\r\n<p><strong>&nbsp;51 Multiple procedures</strong></p>\r\n\r\n<p><strong>&nbsp;RT Right side</strong></p>\r\n\r\n<p><strong>&nbsp;LT Left side</strong></p>', '69421-RT, LT', '69421-LT', '69436-51', '69436-50', '2022-09-21 04:02:57', '2022-09-21 04:02:57', 'ans_d'),
(1819, NULL, 43, 1, '<p><strong>A 59-year-old female patient presents with acquired hallux rigidus. Hallux rigidus repair is performed with resection of the joint with implant in the first left toe proximal phalanx. What codes would be assigned?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'M20.12, 28290-LT', 'M20.22, 28291-TA', 'M20.31, 28291-T5', 'M20.12, 28291-TA', '2022-09-21 04:03:37', '2022-09-21 04:03:37', 'ans_b'),
(1820, NULL, 43, 1, '<p><strong>In outpatient surgery, a PTCA is completed with insertion of a drug-eluting stent in the left circumflex artery and a non-drug-eluting stent inserted into the left anterior descending artery of this 56-year-old female. Assign the correct CPT code(s) and modifier(s) for this procedure.</strong></p>\r\n\r\n<p><strong>92920 Percutaneous transluminal coronary angioplasty; single major coronary artery or branch</strong></p>\r\n\r\n<p><strong>+9292 1each additional branch of a major coronary artery (List separately in additional to code for primary procedure.)</strong></p>\r\n\r\n<p><strong>92928 Percutaneous transcatheter placement of intracoronary stent(s), with coronary angioplasty when performed; single major coronary artery or branch</strong></p>\r\n\r\n<p><strong>+9292 9each additional branch of a major coronary artery (List separately in addition to code for primary procedure.)</strong></p>\r\n\r\n<p><strong>&nbsp;LC Left circumflex coronary artery</strong></p>\r\n\r\n<p><strong>LD Left anterior descending coronary artery</strong></p>', '92921, 92920', '92928-LC, 92928-LD', '92920-LC, 92921-LD, 92928-LC, 92929-LD', '92921-LD, 92929-LD', '2022-09-21 04:04:58', '2022-09-21 04:04:58', 'ans_b'),
(1821, NULL, 43, 1, '<p><strong>Itching due to drug reaction to an antihistamine, properly taken. What are the appropriate codes and sequencing for this scenario?</strong></p>\r\n\r\n<p><strong>L29.9 Pruritus, unspecified</strong></p>\r\n\r\n<p><strong>R89.2 Abnormal level of other drugs, medicaments and biological substances in specimens from other organs, systems and tissues</strong></p>\r\n\r\n<p><strong>T50.905 AAdverse effect of unspecified drugs, medicaments and biological substances, initial encounter</strong></p>\r\n\r\n<p><strong>T45.0X1 APoisoning by antiallergic and antiemetic drugs, accidental (unintentional), initial encounter</strong></p>\r\n\r\n<p><strong>T45.0X5 AAdverse effect of antiallergic and antiemetic drugs, initial encounter</strong></p>', 'R89.2, T45.0X1A', 'R89.2, T45.0X5A', 'T50.905A, T45.0X1A', 'L29.9, T45.0X5A', '2022-09-21 04:06:04', '2022-09-21 04:06:04', 'ans_d'),
(1822, NULL, 43, 1, '<p><strong>A patient is admitted with abdominal pain. The discharge summary states &ldquo;pancreatitis vs. noncalculus cholecystitis&rdquo; as the final diagnoses. Both diagnoses are equally treated. Based on coding guidelines, what is the correct sequencing for these diagnoses?</strong></p>', 'Sequence either the pancreatitis or noncalculus cholecystitis first', 'Pancreatitis; noncalculus cholecystitis; abdominal pain', 'Noncalculus cholecystitis; pancreatitis', 'Sequence the abdominal pain first, followed by pancreatitis and noncalculus cholecystitis as secondary diagnoses', '2022-09-21 04:30:38', '2022-09-21 04:30:38', 'ans_a'),
(1823, NULL, 43, 1, '<p><strong>The &ldquo;code, if applicable, any causal condition first&rdquo; note in the ICD-10-CM Tabular List indicates that this code may be assigned when the causal condition is unknown or not applicable. When the causal condition is known, the code for that condition may be reported as which type of diagnosis?</strong></p>', 'Comorbidity', 'Manifestation', 'Principal', 'Qualified', '2022-09-21 04:31:35', '2022-09-21 04:31:35', 'ans_c'),
(1824, NULL, 43, 1, '<p><strong>A 70-year-old patient was admitted with pneumonia. The history and physical documented that the patient has a history of diabetes, hypertension, and migraine headache about 10 years ago without recurrence. The patient was administered IV antibiotics, metformin, and Altace during the hospitalisation. What is the appropriate reporting and sequencing of these diagnoses?</strong></p>', 'Diabetes, pneumonia, hypertension, and migraine headaches', 'Pneumonia, diabetes, hypertension, and history of migraine headaches', 'Pneumonia, diabetes, and hypertension', 'Hypertension, diabetes, and pneumonia', '2022-09-21 04:32:27', '2022-09-21 04:32:27', 'ans_c'),
(1825, NULL, 43, 1, '<p><strong>A patient is admitted for removal of the gallbladder due to chronic cholecystitis. While performing a common bile duct exploration, a non-obstructive calculus was found and removed as well. Assign the correct coding sequence for a total laparoscopic cholecystectomy with percutaneous endoscopic removal of common bile duct stones.</strong></p>', '0FC90ZZ, Extirpation of matter from common bile duct, open approach 0FB40ZZ, Excision of gallbladder, open approach', '0FB40ZZ, Excision of gallbladder, open approach', '0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach 0FT40ZZ, Resection of gallbladder, open approach', '0FT44ZZ, Resection of gallbladder, percutaneous endoscopic approach and 0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach', '2022-09-21 04:33:19', '2022-09-21 04:33:19', 'ans_d'),
(1826, NULL, 43, 1, '<p><strong>A patient is admitted with hypotension due to dobutamine taken and prescribed correctly. How should this be coded and sequenced?</strong></p>', 'T44.5X5A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter I95.1, Orthostatic hypotension', 'I95.2, Hypotension due to drugs  T44.5X5A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter', 'T44.5X1A, Poisoning by predominantly beta-adrenoreceptor agonists, initial encounter I95.89, Other hypotension', 'T44.5X1A, Poisoning by predominantly beta-adrenoreceptor agonists, initial encounter I95.81, Postprocedural hypotension', '2022-09-21 04:34:22', '2022-09-21 04:34:22', 'ans_b'),
(1827, NULL, 43, 1, '<p><strong>A female patient is diagnosed with congestive heart failure and also has a stage IV pressure ulcer. Which of the following POA indicators must be present so that the ulcer will be classified as an MCC for this admission?</strong></p>', 'N', 'Y', 'W', 'U', '2022-09-21 04:35:03', '2022-09-21 04:35:03', 'ans_b'),
(1828, NULL, 43, 1, '<p><strong>An inpatient undergoes a procedure and has a postoperative complication during the hospitalization. The insurance company will not pay for the entire amount requested. Which POA indicator is likely part of the reason for the reduced reimbursement?</strong></p>', 'N', 'Y', 'W', 'U', '2022-09-21 04:59:53', '2022-09-21 04:59:53', 'ans_a'),
(1829, NULL, 43, 1, '<p><strong>A patient with COPD is admitted with an acute exacerbation of chronic systolic heart failure. On day three of the admission, the provider documents the patient now is experiencing an acute exacerbation of his COPD. What is the POA indicator for the COPD exacerbation?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-21 05:00:31', '2022-09-21 05:00:31', 'ans_b'),
(1830, NULL, 43, 1, '<p><strong>A patient was admitted with hyperglycemia, uncontrolled thirst, constant hunger, and weight gain. Testing indicates that the patient has Type 2 diabetes which is noted in the discharge summary. What is the POA indicator for the diabetes?</strong></p>', 'Y', 'N', 'U', 'W', '2022-09-21 05:01:14', '2022-09-21 05:01:14', 'ans_a'),
(1831, NULL, 43, 1, '<p><strong>Which of the following is not a function of the outpatient code editor (OCE)?</strong></p>', 'Editing the data on the claim for accuracy', 'Specifying the action the FI should take when specific edits occur', 'Assigning APCs to the claim (for hospital outpatient services)', 'Determining payment-related conditions that require direct reference to ICD-10-CM codes', '2022-09-21 05:02:03', '2022-09-21 05:02:03', 'ans_d'),
(1832, NULL, 43, 1, '<p><strong>A patient has a laparoscopic appendectomy and this line item is showing on the bill:</strong></p>\r\n\r\n<p><strong>CPT CODE</strong></p>\r\n\r\n<p><strong>CPT DESCRIPTION</strong></p>\r\n\r\n<p><strong>UNITS OF SERIVCE</strong></p>\r\n\r\n<p><strong>44970</strong></p>\r\n\r\n<p><strong>Laparoscopic Appendectomy 2</strong></p>\r\n\r\n<p><strong>What edit would you expect based on this information?</strong></p>', 'Medically Unlikely Edit', 'Return to Provider Edit', 'Medical Necessity Edit', 'Procedure to Procedure Edit', '2022-09-21 05:08:05', '2022-09-21 05:08:05', 'ans_a'),
(1833, NULL, 43, 1, '<p><strong>A patient comes into the hospital with chest pain, shortness of breath, and a history of COPD. An MRI, chest x-ray, troponin, and CKMB are ordered. A coding professional might expect a medical necessity edit to be triggered for which test?</strong></p>', 'Troponin', 'Chest x-ray', 'MRI', 'CKMB', '2022-09-21 05:10:24', '2022-09-21 05:10:24', 'ans_c'),
(1834, NULL, 43, 1, '<p><strong>A coding professional assigns both 47562 and 47600 on the same patient&rsquo;s record. What edit should be triggered?</strong></p>', 'Medical necessity', 'Medically unlikely', 'Sex/procedure edit', 'Diagnosis/age edit', '2022-09-21 05:11:45', '2022-09-21 05:11:45', 'ans_b'),
(1835, NULL, 43, 1, '<p><strong>A Medicare patient admitted as an inpatient with acute abdominal pain is found to have appendicitis and has an appendectomy. The patient has a length of stay of two days. Reimbursement will be paid under which classification system?</strong></p>', 'MS-DRG', 'APG', 'RBRVS', 'APC', '2022-09-21 05:19:11', '2022-09-21 05:19:11', 'ans_a'),
(1836, NULL, 43, 1, '<p><strong>Medicare severity diagnostic-related groups (MS-DRGs) and ambulatory patient classifications (APCs) are dissimilar in that:</strong></p>', 'There is only one MS-DRG per inpatient discharge but one or more APCs per outpatient visit', 'There are many MS-DRGs per inpatient discharge but only one APC per outpatient visit', 'There are more possible MS-DRGs for inpatients than there are APCs for outpatients', 'There are up to three MS-DRGs per each inpatient discharge but there are up to seven APCs per outpatient visit', '2022-09-21 05:23:34', '2022-09-21 05:23:34', 'ans_a'),
(1837, NULL, 43, 1, '<p><strong>Which of the following services are paid under the outpatient prospective payment system (OPPS)?</strong></p>', 'Ambulance services', 'Same-day surgeries', 'Physician fees', 'Inpatient procedures', '2022-09-21 05:24:28', '2022-09-21 05:24:28', 'ans_b'),
(1838, NULL, 43, 1, '<p><strong>A terminally ill patient under hospice care is admitted to Hospital A for palliative care. Two days later, the hospital must be evacuated due to an approaching hurricane and patients are transferred out. The terminally ill patient is transferred to another acute-care facility, Hospital B. What is the correct admission source code for the admission to Hospital B?</strong></p>', '1', '4', '6', 'F', '2022-09-21 05:25:52', '2022-09-21 05:25:52', 'ans_b'),
(1839, NULL, 43, 1, '<p><strong>When a patient has had an outpatient cataract removal, and then requires admission, what is the appropriate admission source code that would be used?</strong></p>', '2', '4', '7', 'E', '2022-09-21 05:26:31', '2022-09-21 05:26:31', 'ans_d'),
(1840, NULL, 43, 1, '<p><strong>Elements of inpatient procedures that are typically abstracted by coding professionals include which of the following?</strong></p>', 'Procedure date and provider who performs procedure', 'Provider who performs procedure and anaesthetist', 'Provider who performs procedure and any assistants', 'Procedure date and CPT code', '2022-09-21 05:27:22', '2022-09-21 05:27:22', 'ans_a'),
(1841, NULL, 43, 1, '<p><strong>&nbsp;Which abstracted data elements can cause a potential increase in an MS-DRG assignment and corresponding increase in reimbursement?</strong></p>', 'Race and payer', 'Complications and comorbidities', 'Ethnicity and age', 'Discharge date and disposition', '2022-09-21 05:31:42', '2022-09-21 05:31:42', 'ans_b'),
(1842, NULL, 43, 1, '<p><strong>Which of the following data elements would a coding professional likely be responsible to abstract from a patient&rsquo;s record?</strong></p>', 'Comorbidity', 'Race', 'Ethnicity', 'Admission date', '2022-09-21 05:33:06', '2022-09-21 05:33:06', 'ans_a'),
(1843, NULL, 43, 1, '<p><strong>What factors of the APR-DRG system allow for capturing the extent of the patient&rsquo;s conditions and expected loss of life while an inpatient?</strong></p>', 'Severity of illness and risk of mortality', 'Severity of diagnosis and risk of morbidity', 'Complications and comorbidities', 'Hospital-acquired conditions and present on admission', '2022-09-21 05:34:22', '2022-09-21 05:34:22', 'ans_a'),
(1844, NULL, 43, 1, '<p><strong>Which of the following diabetic conditions is considered an MCC?</strong></p>', 'Type II diabetes without complication', 'Type I diabetes without complication', 'Type I diabetes with ketoacidosis', 'Type II diabetes with polyneuropathy', '2022-09-21 05:35:10', '2022-09-21 05:35:10', 'ans_c'),
(1845, NULL, 43, 1, '<p><strong>Which of the following heart failure codes is considered an MCC?</strong></p>', 'I50.9', 'I50.43', 'I50.32', 'I50.20', '2022-09-21 05:35:56', '2022-09-21 05:35:56', 'ans_b'),
(1846, NULL, 43, 1, '<p><strong>Which of the following injuries would you expect to see with an MCC designation?</strong></p>', 'Dislocation of jaw', 'Laceration with foreign body of the neck', 'Four-part humeral fracture of surgical neck', 'Blister of the right eyelid and periocular area', '2022-09-21 05:36:47', '2022-09-21 05:36:47', 'ans_c'),
(1847, NULL, 43, 1, '<p><strong>A psychiatrist documents that a patient has wide mood swings ranging from excessive happiness to loss of energy and crying. What condition could be suggested by the psychiatrist&rsquo;s documentation?</strong></p>', 'Bipolar disorder', 'Major depression', 'Anxiety', 'Psychosis', '2022-09-21 05:42:08', '2022-09-21 05:42:08', 'ans_a'),
(1848, NULL, 43, 1, '<p><strong>A patient record has documentation of esophageal varices. Which condition, if related, would affect coding?</strong></p>', 'Arthritis', 'Liver disease', 'Chronic obstructive pulmonary disease', 'Erythema', '2022-09-21 05:43:33', '2022-09-21 05:43:33', 'ans_b'),
(1849, NULL, 43, 1, '<p><strong>A patient is admitted with lethargy, congestive heart failure, and pleural effusion. The patient underwent treatment with diuretics for the CHF, which has cleared. The pleural effusion required a thoracentesis to determine the cause. At the time of discharge, the effusion was decreased but not resolved. The correct coding assignment for this case would be:</strong></p>', 'Congestive heart failure', 'Pleural effusion', 'Congestive heart failure and pleural effusion', 'Lethargy, congestive heart failure, and pleural effusion', '2022-09-21 05:46:12', '2022-09-21 05:46:12', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(1850, NULL, 43, 1, '<p><strong>A 78-year-old patient is admitted with shortness of breath and a chest x-ray reveals infiltrates in the lung with pleural effusion. The patient also has a history of hypertension with left ventricular hypertrophy. The patient is given Lasix and the shortness of breath is relieved. From the information given, what is the probable principal diagnosis?</strong></p>', 'Pneumonia', 'Congestive heart failure', 'Pleural effusion', 'Chronic obstructive pulmonary disease', '2022-09-21 05:47:00', '2022-09-21 05:47:00', 'ans_b'),
(1851, NULL, 43, 1, '<p><strong>A patient was admitted directly from his primary physician&rsquo;s office due to suspected avian influenza. The admitting physician documentation indicated suspected avian influenza, along with signs and symptoms of avian influenza. The patient left against medical advice (AMA) before confirmatory lab tests could be drawn to identify the virus. The principal diagnosis should be coded from category:</strong></p>', 'J09, Influenza due to certain identified influenza viruses', 'J10, Influenza due to other identified influenza virus', 'J11, Influenza due to unidentified influenza virus', 'J12, Viral pneumonia, not elsewhere classified', '2022-09-21 05:52:53', '2022-09-21 05:52:53', 'ans_c'),
(1852, NULL, 43, 1, '<p><strong>In CPT, if a patient has two lacerations of the arm that are repaired; one 1.6 cm and the other 3.5 cm. What additional information does the coding professional need to assign the correct repair code?</strong></p>', 'Specific location on the arm of each laceration', 'If tissue adhesive was utilized', 'The type of repair that was performed for each laceration', 'If anesthesia was necessary for the procedure', '2022-09-21 05:53:41', '2022-09-21 05:53:41', 'ans_c'),
(1853, NULL, 43, 1, '<p><strong>The patient had an esophagoscopy to control a GI bleed. The coding professional would expect to see the following documentation in the chart for the diagnosis since upper gastrointestinal bleeding manifests as:</strong></p>', 'Hematemesis', 'Occult bleeding', 'Melena', 'Hematochezia', '2022-09-21 05:54:50', '2022-09-21 05:54:50', 'ans_a'),
(1854, NULL, 43, 1, '<p><strong>A patient was admitted with pneumonia. A sputum culture was able to identify Mycoplasma pneumoniae, which the consulting pulmonologist documented as the cause of the pneumonia. The patient was also diagnosed with an E. coli UTI. In the final diagnosis statement, the attending physician documents E. coli pneumonia and UTI. How will the coding professional code the pneumonia?</strong></p>', 'Assign the code based on the final diagnostic statement', 'Assign the pneumonia code based on the consultant’s documentation', 'Assign the pneumonia code based on the sputum result', 'Query the attending provider to clarify the pneumonia organism', '2022-09-21 05:55:47', '2022-09-21 05:55:47', 'ans_d'),
(1855, NULL, 43, 1, '<p><strong>A patient was admitted with pneumonia. A sputum culture was able to identify Mycoplasma pneumoniae, which the consulting pulmonologist documented as the cause of the pneumonia. The patient was also diagnosed with an E. coli UTI. In the final diagnosis statement, the attending physician documents E. coli pneumonia and UTI. How will the coding professional code the pneumonia?</strong></p>', 'Assign the code based on the final diagnostic statement', 'Assign the pneumonia code based on the consultant’s documentation', 'Assign the pneumonia code based on the sputum result', 'Query the attending provider to clarify the pneumonia organism', '2022-09-21 05:56:43', '2022-09-21 05:56:43', 'ans_d'),
(1856, NULL, 43, 1, '<p><strong>A short-stay procedure H&amp;P indicates a patient is coming for a left nephroureteral catheter exchange. The interventional radiologist performs the procedure and states that using the existing access, he places a guide wire into the kidney and removed the catheter. With the same access, over the guide wire the new nephroureteral catheter is inserted into the right kidney and ureter. What needs to be clarified in this scenario?</strong></p>', 'Was the approach open or closed', 'Was laterality the left or right', 'Was this done percutaneously', 'Was this procedure done under anesthesia', '2022-09-21 05:58:24', '2022-09-21 05:58:24', 'ans_b'),
(1857, NULL, 43, 1, '<p><strong>A patient has presented for back surgery with a diagnosis of lumbar stenosis. Documentation notes the patient has leg pain, tingling, and cramping as a result of the stenosis. In the patient&rsquo;s final diagnosis, the surgeon notes only lumbar stenosis. What other diagnosis appears to be missing from this statement based on the information provided?</strong></p>', 'Neurogenic claudication', 'Neuropathy', 'Degenerative disc', 'Spondylosis', '2022-09-21 05:59:40', '2022-09-21 05:59:40', 'ans_a'),
(1858, NULL, 43, 1, '<p><strong>When a patient is admitted and a discrepancy is noted in the documentation while the patient is still on the unit, who is responsible for obtaining clarity on the information?</strong></p>', 'The charge nurse', 'The clinical documentation specialist', 'The coding professional', 'The case manager', '2022-09-21 06:00:30', '2022-09-21 06:00:30', 'ans_b'),
(1859, NULL, 43, 1, '<p><strong>The following information was captured for a patient&rsquo;s ER visit: pulse 75, respirations 18, blood pressure 138/78, PERRLA, weight 267, height 60&Prime;, BMI 52. The patient complained of back pain after a fall. After no fractures were identified upon x-ray, the patient was discharged with a diagnosis of low back sprain as the only diagnosis. What diagnosis appears to be omitted in this scenario?</strong></p>', 'Hypertension based on the elevated blood pressure reading', 'Tachycardia based on the rapid pulse rate', 'Morbid obesity based on the height, weight, and BMI', 'Diplopia based on the PERRLA', '2022-09-21 06:28:49', '2022-09-21 06:28:49', 'ans_c'),
(1860, NULL, 43, 1, '<p><strong>A patient has documentation on the discharge summary of urosepsis. The coding staff queries the attending physician about the condition and is provided further information that the patient has septicemia. This is in alignment with the laboratory tests and medication given, but the diagnosis of septicemia was not documented by the physician. How should the physician be requested to document the septicemia?</strong></p>', 'A brand-new history and physical should be dictated to replace the one in the record.', 'An addendum to the chart should be written.', 'The new information should be squeezed in between lines within the progress notes of the last day.', 'The query sheet will be sufficient to document this information.', '2022-09-21 06:29:34', '2022-09-21 06:29:34', 'ans_b'),
(1861, NULL, 43, 1, '<p><strong>A patient was admitted with Type 1 diabetes with proliferative diabetic retinopathy to have surgery for traction retinal detachment for macular edema. Which of the following questions would make a compliant query for this patient?</strong></p>', 'Was the procedure performed on the left or right eye or bilateral eyes?', 'Is retinopathy a complication?', 'Will you document use of insulin for this patient?', 'Is there a comorbid condition that can be documented to increase the reimbursement?', '2022-09-21 06:30:35', '2022-09-21 06:30:35', 'ans_a'),
(1862, NULL, 43, 1, '<p><strong>Compliant multiple-choice queries:</strong></p>', 'Must contain every possible option for the provider to choose from', 'Can provide a new diagnosis with supporting clinical indicators', 'Should provide a minimum of three options', 'Are the preferred query format for establishing POA status', '2022-09-21 06:31:24', '2022-09-21 06:31:24', 'ans_b'),
(1863, NULL, 43, 1, '<p><strong>Which of the following is a noncompliant query format?</strong></p>', 'Yes/no', 'Open-ended', 'Leading', 'Multiple choice', '2022-09-21 06:32:03', '2022-09-21 06:32:03', 'ans_c'),
(1864, NULL, 43, 1, '<p><strong>Identify if the following query is compliant and the appropriate rationale.</strong></p>\r\n\r\n<p><strong>Dr. Jones, you state the patient has CHF in your discharge summary. Can you please indicate which type of the CHF the patient has?</strong></p>\r\n\r\n<p><strong>_____ Acute on chronic</strong></p>\r\n\r\n<p><strong>_____ Other</strong></p>', 'Yes, this is compliant query as it is in multiple choice format and the requirement is to provide at least two choices.', 'No, this is not a compliant query as it should have been an open-ended query format to allow the physician to identify the type of CHF.', 'No, this is not a compliant query as this is leading the physician. More reasonable choices should have been provided.', 'Yes, a multiple-choice query format is acceptable and referencing the diagnosed CHF makes this a compliant query.', '2022-09-21 06:33:00', '2022-09-21 06:33:00', 'ans_c'),
(1865, NULL, 43, 1, '<p><strong>An obstretic patient with a cephalic presentation and anticipating a vaginal delivery failed to progress after a trial of oxytocin. Measurement of the fetal head was performed, and the patient was immediately taken to surgery for a cesarean section. What condition should the coding professional suspect and query the physician about?</strong></p>', 'Twin pregnancy', 'Early delivery', 'Eclampsia', 'Cephalopelvic disproportion', '2022-09-21 06:33:48', '2022-09-21 06:33:48', 'ans_d'),
(1866, NULL, 43, 1, '<p><strong>A 45-year-old woman underwent a carotid bypass and experienced a significant drop in blood pressure during the surgery. The documentation suggested the patient may have had a myocardial infarction. In accordance with coding guidelines, what should the coding professional do?</strong></p>', 'Code complication of surgery NOS.', 'Query the physician to determine if the patient had hypotension.', 'Query the physician to determine if there was a complication of surgery.', 'Code preoperative shock.', '2022-09-21 06:48:00', '2022-09-21 06:48:00', 'ans_c'),
(1867, NULL, 43, 1, '<p><strong>A patient&rsquo;s discharge summary does not contain a diagnosis that is documented by the anesthesiologist in a preoperative evaluation and that would impact MS-DRG assignment. The coding professional finds no evidence that the diagnosis contradicts documentation from the attending physician. The coding professional should:</strong></p>', 'Code only from the discharge diagnoses', 'Code the diagnosis reflected on the anesthesia preoperative evaluation', 'Code the most severe symptom', 'Query the attending physician regarding the clinical significance of that diagnosis', '2022-09-21 06:48:49', '2022-12-09 07:16:35', 'ans_d'),
(1868, NULL, 43, 1, '<p><strong>When an inpatient has had multiple tests to evaluate an abnormal finding but no definitive diagnosis has been documented, the coding professional should:</strong></p>', 'Assign a code for the abnormal finding without confirming with the physician', 'Not assign any code for the abnormal finding', 'Assign a diagnosis code based on the coding professional’s judgement', 'Query the physician regarding whether a diagnosis should be assigned or not', '2022-09-21 06:49:54', '2022-09-21 06:49:54', 'ans_d'),
(1869, NULL, 43, 1, '<p><strong>A patient is admitted with Kaposi&rsquo;s sarcoma of the lung and a history of IV drug dependence is noted. Antiretroviral therapy is initiated for treatment with some alleviation of the patient&rsquo;s shortness of breath. Upon discharge, the only diagnosis listed was Kaposi&rsquo;s sarcoma of the lung. What other diagnosis might the coding professional expect to see with this condition and what action should be taken?</strong></p>', 'CHF, add the code based on the “code also” note in the Tabular for the sarcoma', 'HIV, add the code based on the “add additional code” note in the Tabular for the sarcoma', 'CHF, query the physician based on the patient’s shortness of breath and the “code first” note in the Tabular for the sarcoma', 'HIV, query the physician based on the previous drug dependence and the “code first” note in the Tabular for the sarcoma', '2022-09-21 06:50:51', '2022-09-21 06:50:51', 'ans_d'),
(1870, NULL, 43, 1, '<p><strong>A patient is admitted to the hospital with a high fever, chills, tachycardia, and a respiration rate of 26. Lactic acidosis is noted in the labs. Pneumonia is diagnosed and the patient admitted to ICU where antibiotics are given along with Levophed to help maintain the patient&rsquo;s blood pressure which was in the extremely low range. The patient&rsquo;s breathing was erratic and mechanical ventilation was initiated. With a final diagnosis of pneumonia, what is the query opportunity for this record?</strong></p>', 'Is this aspiration pneumonia?', 'Is this septic shock?', 'Is this Staphylococcus aureus pneumonia?', 'Is this sepsis?', '2022-09-21 06:51:35', '2022-09-21 06:51:35', 'ans_b'),
(1871, NULL, 43, 1, '<p><strong>Two areas of documentation in the health record that are significant areas of focus of accrediting agencies are:</strong></p>', 'Incident reports notation in the medical record and attorney’s notes', 'Past medical reports and social worker’s notes', 'Timeliness and legibility of medical documents', 'Patient documentation and pastoral counseling', '2022-09-21 07:37:22', '2022-09-21 07:37:22', 'ans_c'),
(1872, NULL, 43, 1, '<p><strong>In facilities where electronic signatures are used for residents and attending physicians:</strong></p>', 'Attending signature is all that is needed', 'Resident signature is all that is needed', 'Resident should cosign after the attending signs the documentation', 'Attending should cosign after the resident signs the documentation', '2022-09-21 08:03:14', '2022-09-21 08:03:14', 'ans_d'),
(1873, NULL, 43, 1, '<p><strong>A patient undergoes an open reduction and internal fixation of a fractured femur. The record is coded with blood loss anemia because of a policy that specifies that this should be done when there is intraoperative blood loss of 500 cc or more documented in the operative report and the patient has low hemoglobin. Is this an ethical practice?</strong></p>', 'It is ethical to code blood loss anemia because the policy requires it.', 'It is ethical because the clinical signs are documented in the record.', 'It is unethical because the patient must also have a blood transfusion in order for blood loss anemia to be coded.', 'It is unethical because the physician did not document the blood loss anemia in the progress notes.', '2022-09-21 08:06:02', '2022-09-21 08:06:02', 'ans_d'),
(1874, NULL, 43, 1, '<p><strong>The information in the table represents the APCs and associated data for all the CPT codes assigned for a patient&rsquo;s encounter. From the information provided, what would be the total reimbursement for this patient?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width:500px\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Billing No&nbsp;</td>\r\n			<td>Status Indicator</td>\r\n			<td>CPT/HCPCS</td>\r\n			<td>APC</td>\r\n			<td>Reimbursement</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>10060</td>\r\n			<td>0006</td>\r\n			<td>$500</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>64605</td>\r\n			<td>0220</td>\r\n			<td>$1000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>X</td>\r\n			<td>71045</td>\r\n			<td>0260</td>\r\n			<td>$50</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>S</td>\r\n			<td>38230</td>\r\n			<td>0112</td>\r\n			<td>$2000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>', '$3,550', '$3,000', '$3,050', '$3,300', '2022-09-21 08:06:44', '2022-11-21 09:30:57', 'ans_d'),
(1875, NULL, 43, 1, '<p><strong>What percentage will the facility be paid for procedure code 10060?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Billing No&nbsp;</td>\r\n			<td>Status Indicator</td>\r\n			<td>CPT/HCPCS</td>\r\n			<td>APC</td>\r\n			<td>Reimbursement</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>10060</td>\r\n			<td>0006</td>\r\n			<td>$500</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>64605</td>\r\n			<td>0220</td>\r\n			<td>$1000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>X</td>\r\n			<td>71045</td>\r\n			<td>0260</td>\r\n			<td>$50</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>S</td>\r\n			<td>38230</td>\r\n			<td>0112</td>\r\n			<td>$2000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '50%', '75%', '0%', '100%', '2022-09-21 08:07:39', '2022-11-21 09:31:16', 'ans_a'),
(1876, NULL, 43, 1, '<p><strong>If another status S procedure were performed, how much would the facility receive for the second status S procedure?</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Billing No&nbsp;</td>\r\n			<td>Status Indicator</td>\r\n			<td>CPT/HCPCS</td>\r\n			<td>APC</td>\r\n			<td>Reimbursement</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>10060</td>\r\n			<td>0006</td>\r\n			<td>$500</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>T</td>\r\n			<td>64605</td>\r\n			<td>0220</td>\r\n			<td>$1000</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>X</td>\r\n			<td>71045</td>\r\n			<td>0260</td>\r\n			<td>$50</td>\r\n		</tr>\r\n		<tr>\r\n			<td>989323</td>\r\n			<td>S</td>\r\n			<td>38230</td>\r\n			<td>0112</td>\r\n			<td>$2000</td>\r\n		</tr>\r\n	</tbody>\r\n</table>', '50%', '75%', '0%', '100%', '2022-09-21 08:08:51', '2022-11-21 09:31:37', 'ans_d'),
(1877, NULL, 43, 1, '<p><strong>What is assigned to CPT codes to indicate whether a service or procedure will be separately reimbursed under the OPPS?</strong></p>', 'Ambulatory payment classifications', 'Payment status indicators', 'Payment modifiers', 'Diagnosis-related groups', '2022-09-21 08:09:31', '2022-09-21 08:09:31', 'ans_b'),
(1878, NULL, 43, 1, '<p><strong>The conditions that Medicare put on the hospital-acquired conditions list are:</strong></p>', 'Low volume', 'Preventable', 'High risk', 'Surgical', '2022-09-21 08:10:21', '2022-09-21 08:10:21', 'ans_b'),
(1879, NULL, 43, 1, '<p><strong>Under which of the following circumstances does a healthcare entity lose a potential increase in reimbursement when a hospital-acquired condition (HAC) is coded without a POA indicator of &ldquo;Y&rdquo;?</strong></p>', 'When the HAC is the only CC/MCC on the account', 'When the HAC is listed as the principal diagnosis', 'When the HAC is coded along with a surgical procedure', 'When the HAC is the only diagnosis listed', '2022-09-21 08:11:57', '2022-09-21 08:11:57', 'ans_a'),
(1880, NULL, 43, 1, '<p><strong>Hospital-acquired conditions and the present on admission indicator are used to identify:</strong></p>', 'Safety issues', 'Quality issues', 'Risk issues', 'Documentation issues', '2022-09-21 08:12:38', '2022-09-21 08:12:38', 'ans_b'),
(1881, NULL, 43, 1, '<p><strong>Under HIPAA every organization must have:</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Privacy and Security Officers', 'Security and Compliance Officers', 'Compliance and Safety Officers', 'Safety and Privacy Officers', '2022-09-21 08:13:19', '2022-09-21 08:13:19', 'ans_a'),
(1882, NULL, 43, 1, '<p><strong>A routine computer back-up procedure is an example of a security program that ensures data loss does not occur. This type of control is:</strong></p>', 'Computer', 'Validity', 'Responsive', 'Preventive', '2022-09-21 08:14:19', '2022-09-21 08:14:19', 'ans_d'),
(1883, NULL, 43, 1, '<p><strong>The patient was admitted for prostate carcinoma. This was treated with radiation. A member of the medical staff who was not associated with the patient&rsquo;s care requests to see the patient&rsquo;s health record. What should the coding professional do?</strong></p>', 'Provide the record to the physician.', 'Report the incident to hospital security.', 'Ask the physician to come back when the supervisor gets back.', 'Explain that providing the record would violate the privacy policy.', '2022-09-21 08:18:42', '2022-09-21 08:18:42', 'ans_d'),
(1884, NULL, 43, 1, '<p><strong>In most circumstances, the person who authorizes release of medical information is:</strong></p>', 'Chief executive officer', 'Patient', 'Physician', 'Nurse', '2022-09-21 08:19:24', '2022-09-21 08:19:24', 'ans_b'),
(1885, NULL, 43, 1, '<p><strong>The combination of username and password is known what type of authentication?</strong></p>', 'Context-based', 'User-based', 'Single-factor', 'Two-factor', '2022-09-21 08:20:37', '2022-09-21 08:20:37', 'ans_c'),
(1886, NULL, 43, 1, '<p><strong>Which of the following are categories of standards under the HIPAA Security Rule?</strong></p>', 'Administrative, technical, and physical', 'Technical, physical, and governance', 'Physical, governance, and administrative', 'Governance, administrative, and technical', '2022-09-21 08:21:52', '2022-09-21 08:21:52', 'ans_a'),
(1887, NULL, 43, 1, '<p><strong>According to the AHIMA Standards of Ethical Coding, coding professionals are expected to protect the confidentiality of the health record, accessing protected health information only for performance of their duties including coding-related activities. Which of the following is not considered a coding-related activity?</strong></p>', 'Coding quality evaluation', 'Review of records assigned each day', 'Risk analysis of medical record documentation', 'Completion of abstracting', '2022-09-21 08:22:44', '2022-09-21 08:22:44', 'ans_c'),
(1888, NULL, 43, 1, '<p><strong>A patient is admitted with vaginal bleeding. One of the concurrent coding analysts reviewing information in the chart has determined that there may be an additional procedure code but there is no operative report to provide definitive information. Coding the additional procedure as the documentation stands now would be considered an ethical practice if:</strong></p>', 'The vice president of finance approves adding the code now', 'The billing department wants this; it can be done', 'Under no circumstances could this be done', 'The coding supervisor approves coding the procedure', '2022-09-21 09:06:29', '2022-09-21 09:06:29', 'ans_c'),
(1889, NULL, 43, 1, '<p><strong>A coding professional is working from his work queue and gets assigned the outpatient surgery record of the hospital administrator. Is this an ethical issue? Why or why not?</strong></p>', 'Yes, only the coding supervisor should code the record of the administrator', 'Yes, the coding professional should never work on a chart of another hospital employee', 'No, the coding professional can code the record as normal and look at previous encounters', 'No, the coding professional can assign codes for the encounter without an ethical concern', '2022-09-21 09:07:16', '2022-09-21 09:07:16', 'ans_d'),
(1890, NULL, 43, 1, '<p><strong>An RHIT, who plans to sit for her RHIA certification in six months, wants to apply for the open director of medical records position at her organization. The job description states that the applicant must have an RHIA credential. Ethically, can the RHIT apply for the position?</strong></p>', 'Yes, as long as she lists her RHIT credential on the application.', 'No, she does not have the required credential and should not apply.', 'No, if she lists the RHIA credential she will be lying.', 'Yes, since she plans to get the RHIA credential she can list it and apply.', '2022-09-21 09:08:08', '2022-09-21 09:08:08', 'ans_a'),
(1891, NULL, 43, 1, '<p><strong>A coding supervisor performs an internal audit on the coding staff. The overall accuracy results are 85 percent and the expectation is 95 percent. She decides to eliminate the worst records from the audit in order to bolster the score which then becomes 93 percent and will make her look better to her boss. Is this ethically okay for her to do?</strong></p>', 'Yes, internal audit criteria are determined by the coding supervisor and can be changed by her.', 'Yes, if her boss approves of the elimination of the records, then it fine and there is no ethical issue.', 'No, only the HIM Director can make changes to the audit including the number of records reviewed.', 'No, the audit criteria should not be altered to provide a better score or improve the supervisor’s status.', '2022-09-21 09:08:55', '2022-09-21 09:08:55', 'ans_d'),
(1892, NULL, 43, 1, '<p><strong>AHIMA&rsquo;s Standards of Ethical Coding apply to which of the following setting(s)?</strong></p>', 'Acute inpatient', 'Outpatient', 'Provider offices', 'All settings', '2022-09-21 09:09:42', '2022-09-21 09:09:42', 'ans_d'),
(1893, NULL, 43, 1, '<p><strong>An inpatient is discharged with a diagnosis of &ldquo;either irritable bowel or pancreatitis.&rdquo; Which condition would be the principal diagnosis?</strong></p>', 'Code both and sequence according to the circumstances of the admission', 'Pancreatitis', 'Irritable bowel syndrome', 'Observation for suspected gastrointestinal condition', '2022-09-21 09:10:33', '2022-09-21 09:10:33', 'ans_a'),
(1894, NULL, 43, 1, '<p><strong>According to the UHDDS, the definition of a secondary diagnosis is a condition that:</strong></p>', 'Is recorded in the patient record', 'Receives evaluation and is documented by the physician', 'Receives clinical evaluation, therapeutic treatment, further evaluation, extends the length of stay, increases nursing monitoring and care', 'Is considered to be essential by the physicians involved and is reflected in the record', '2022-09-21 09:11:16', '2022-09-21 09:11:16', 'ans_c'),
(1895, NULL, 43, 1, '<p><strong>The best answer to describe how the UHDDS defines a comorbidity is a diagnosis that:</strong></p>', 'Affects the payment rate', 'Occurs after admission', 'Is not documented', 'Preexists before admission', '2022-09-21 09:15:40', '2022-09-21 09:15:40', 'ans_d'),
(1896, NULL, 43, 1, '<p><strong>A condition that is established after study to be chiefly responsible for the admission is the:</strong></p>', 'Reason for visit', 'Principal procedure', 'A complication of outpatient care', 'Principal diagnosis', '2022-09-21 09:16:29', '2022-09-21 09:16:29', 'ans_d'),
(1897, NULL, 43, 1, '<p><strong>The UHDDS definition of principal procedure indicates that the principal procedure can be assigned for which of the following?</strong></p>', 'Addressing complications', 'Exploration', 'Diagnostic', 'Clinical evaluation', '2022-09-21 09:17:07', '2022-09-21 09:17:07', 'ans_a'),
(1898, NULL, 52, 1, '<p><strong>Which one of the following is an infection that occurs in the respiratory system?</strong></p>', 'Meningitis', 'Endocarditis', 'Tuberculosis', 'Diverticulosis', '2022-10-26 09:10:33', '2022-11-14 06:44:05', 'ans_c'),
(1899, NULL, 52, 1, '<ol>\r\n	<li>\r\n	<p><strong>The documentation states:</strong></p>\r\n	</li>\r\n</ol>\r\n\r\n<p><strong>He was then sterilely prepped and draped along the flank and abdomen in the usual sterile fashion. I first made a skin in tip of the twelfth rib, extending medially along the banger&#39;s lines of the skin. This was approximately 3.5 cm in length. O incision was carried sharply, electrocautery was used to gain access through the external oblique, internal oblique, and abdominis musculature and fascia.</strong></p>\r\n\r\n<p><strong>What surgical approach was used for this procedure?</strong></p>', 'Open', 'Percutaneous', 'Laparoscopic', 'Cannot determine based on the documentation', '2022-10-26 09:11:11', '2022-11-14 06:44:34', 'ans_a'),
(1900, NULL, 52, 1, '<p><strong>Urticaria is commonly called:</strong></p>', 'Bruises', 'Hair loss', 'Hives', 'Scarring', '2022-10-26 09:12:04', '2022-11-14 06:44:46', 'ans_c'),
(1901, NULL, 52, 1, '<p><strong>Patient is diagnosed with dacryocystitis, which is the inflammation of?</strong></p>', 'Lacrimal sac', 'Cornea', 'Fingernail', 'Eardrum', '2022-10-26 09:12:42', '2022-11-14 06:44:59', 'ans_a'),
(1902, NULL, 52, 1, '<p><strong>What is the function of a pacemaker?</strong></p>', 'Uses electrical impulses to control the heart rhythm', 'Removes plaque buildup in the coronary arteries', 'Delivers shocks to the heart only when it stops beating', 'Replaces the heart', '2022-10-26 09:13:28', '2022-11-14 06:45:12', 'ans_a'),
(1903, NULL, 52, 1, '<p><strong>Where is a Warthin&#39;s tumor found?</strong></p>', 'Salivary gland', 'Bone', 'Ovary', 'Back of eye', '2022-10-26 09:14:09', '2022-11-14 06:45:28', 'ans_a'),
(1904, NULL, 52, 1, '<p><strong>The _____ drain(s) urine from the renal pelvis to the urinary bladder.</strong></p>', 'Urethra', 'Medulla', 'Ureters', 'Glomerulus', '2022-10-26 09:14:52', '2022-11-14 06:45:42', 'ans_c'),
(1905, NULL, 52, 1, '<p><strong>Which of the following is NOT an integumentary system structure?</strong></p>', 'Lymph node', 'Toenail', 'Hair follicle', 'Skin', '2022-10-26 09:15:33', '2022-11-14 06:45:57', 'ans_a'),
(1906, NULL, 52, 1, '<p><strong>Which place of service code is submitted on the claim for a service that is performed in an outpatient surgical floor?</strong></p>', '24', '22', '11', '21', '2022-10-26 09:16:10', '2022-11-14 06:47:32', 'ans_b'),
(1907, NULL, 52, 1, '<p><strong>Which one of the following is a commercial or private payer?</strong></p>', 'Veterans Health Administration (VHA)', 'Blue Cross Blue Shield', 'Medicare', 'Medicaid', '2022-10-26 09:16:52', '2022-11-14 06:48:05', 'ans_b'),
(1908, NULL, 52, 1, '<p><strong>Which one of the following scenarios is considered abuse?</strong></p>', 'Unintentionally billing for unnecessary medical services', 'Knowingly billing for services at a higher level of complexity than services provided or documented in the file', 'Falsifying records for services not furnished, supplies not provided, or both, including to show delivery of such lems', 'Intentional unbundling of codes to manipulate coding to maximise payment', '2022-10-26 09:17:50', '2022-11-14 06:48:19', 'ans_a'),
(1909, NULL, 53, 1, '<p><strong>According to CPT coding guidelines for radiology code range 76881-76886, which codes are reported for spectral and color doppler with evaluations of the extremities?</strong></p>', '76881, 76882', '73560-73565', '73700-78702', '93925-93931,93970, 93971', '2022-10-26 09:18:35', '2022-11-14 06:48:40', 'ans_d'),
(1910, NULL, 53, 1, '<p><strong>The CPT8 code book provides full descriptions of medical procedures, although some descriptions require the use of a semicolon to distinguish among closely related procedures.What is the full description of CPT&reg; code 69644?</strong></p>', 'Without ossicular chain reconstruction with intact or reconstructed canal wall, with ossicular chain reconstruction', 'Tympanoplasty with mastoidectomy (including canaloplasty, middle ear surgery, tympanic membrane repair): without ossicular chain reconstruction with intact or reconstructed canal wall, with ossicular chain reconstruction', 'Tympanoplasty with mastoidectomy (including canaloplasty, middle ear surgery, tympanic membrane repair): with intact or reconstruction wall, with ossicular chain reconstruction', 'With intact or reconstructed canal wall, with ossicular chain reconstruction', '2022-10-26 09:19:47', '2023-02-28 05:46:31', 'ans_c'),
(1911, NULL, 53, 1, '<p><strong>According to parenthetical instructions in the on the right and left lower eyelids (15820</strong></p>', '50', '59', 'RT,LT', 'E2,E4', '2022-10-26 09:20:47', '2022-11-14 06:49:11', 'ans_a'),
(1912, NULL, 53, 1, '<p><strong>Which statement regarding lesion excision is TRUE?</strong></p>', 'Lesion excision codes include removal of a lesion, with margins and simple (non layered) closure when performed.', 'Lesion excision codes include removal of a lesion, with margins, and intermediate closure when performed', 'Lesion excision codes include removal of a lesion, wito margins, and complex closure when performed.', 'Lesion excision codes are selected by measuring the greatest clinical diameter of a lesion excluding the margin excision.', '2022-10-26 09:21:32', '2022-11-14 06:49:23', 'ans_a'),
(1913, NULL, 53, 1, '<p><strong>Which of the following is an example of a case in which a diabetes‐related&nbsp; problem exists and the code for diabetes is never sequenced first?</strong></p>', 'If the patient is being treated for secondary diabetes', 'If the patient has ar underdose of insulin due to an Insulin pump malfunction', 'If the patient it being treated for type 2 diabetes', 'If the patient has hyperglycemia that is not responding to medication', '2022-10-26 09:22:15', '2023-07-24 23:42:17', 'ans_b'),
(1914, NULL, 53, 1, '<p><strong>According to CPT&reg; guidelines, which scenario best represents the correct use of modifier 78?</strong></p>', 'Patient had an open inguinal hernia repair two weeks ago. He is in the doctor\'s office because the surgical wound is bleeding. The physician cleans the wound and applies wound adhesive to reclose a small opening.', 'The patient has an abscess under the diaphragm from an appendectomy. He is returned to the OR for the same physician who performed the appendectomy to drain the abscess.', 'Patient had an appendectomy three days ago. In the hospital the patient developed a fever and receiving an IV antibiotic for treatment of fever.', 'A patient returning to the ED in the same day for the same ED physician to perform an extensive anterior packing for hemostasis', '2022-10-26 09:22:56', '2022-11-14 06:49:54', 'ans_b'),
(1915, NULL, 53, 1, '<p><strong>According to the Application of Cast and Strapping CPT &amp; guidelines, what is reported when an orthopaedic provider performs initial fracture care treatment for a closed scaphoid fracture of the wrist, applies a short arm cast and the patient will be returning for subsequent fracture care?</strong></p>', '25622', '29075', '25622, 29075', '29075-22', '2022-10-26 09:23:35', '2022-11-14 06:50:09', 'ans_a'),
(1916, NULL, 53, 1, '<p><strong>A few days after a bad coughing spell, the patient developed dyspnea that is occurring episodically throughout the day and night. The physician suspects he has viral pneumonia and orders a chest X-ray. What ICD-10-CM coding is reported?</strong></p>', 'J12.9', 'J18 9', 'J129, R06 00', 'R06.00', '2022-10-26 09:24:14', '2022-11-14 06:50:23', 'ans_d'),
(1917, NULL, 53, 1, '<p><strong>A patient is diagnosed with diabetic polyneuropathy. Using ICD-10-CM coding guidelines, what ICD-10-CM coding is reported?</strong></p>', 'E10.9, G629', 'E10.42', 'E11.42', 'E11.9, G62.9', '2022-10-26 09:24:52', '2022-11-14 06:50:37', 'ans_c'),
(1918, NULL, 53, 1, '<p><strong>Which diagnosis codes are reported for a patient who has hypertension and acute renal failure?</strong></p>', 'I12.9, N18.9', 'I12.9, N179', 'I10, N17.9', 'I10, N19', '2022-10-26 09:25:30', '2022-11-14 06:50:51', 'ans_c'),
(1919, NULL, 53, 1, '<p><strong>A patient is diagnosed with sepsis and associated acute respiratory failure. What ICD-10-CM code selection is reported?</strong></p>', 'A41.9', 'A41 9, R65 20, J96 00', 'A41.9, R65.21, J96.00', 'A41.9, J96.00', '2022-10-26 09:26:18', '2022-11-14 06:51:17', 'ans_b'),
(1920, NULL, 53, 1, '<p><strong>A 44-year-old female patient with chest pains had a CT of her chest that identified a mass in her left lower lung. The has ovarian cancer with metastases to the liver. The radiologist suspects the cancer has spread to her fungus. The physician performed an outpatient bronchoscopic biopsy and the pathology report documents the mass as a tumor of uncertain behaviour. What ICD-10-CM codes are reported for this patient?</strong></p>', 'C78.02, C22.9, C79.62', 'R91.8, C56.9, C78.7', 'D38.1, C56.9, C78.7', 'C56.9, C78.7, C78.02', '2022-10-26 09:27:00', '2022-11-14 06:51:28', 'ans_c'),
(1921, NULL, 53, 1, '<p><strong>A 30-year-old patient with a scalp defect is having plastic surgery to insert tissue expanders. The provider inserts the implants crosses&nbsp; the skin, and increases the volume of the expanders by injecting saline solution. Tissue is expanded until a satisfactory aesthetic outcome is obtained to repair the scalp defect. What CPT&reg; code is reported?</strong></p>', '11960', '15777', '19357', '11970', '2022-10-26 09:28:37', '2022-11-14 06:51:40', 'ans_a'),
(1922, NULL, 53, 1, '<p><strong>A patient came into the ED after she smashed her big toe under the bedroom door. There Is a hematoma in th4e toe, for which the physician incises and uses cauterization to burn through the nail to drain and evacuate the hematoma. What CPT code is reported for the procedure?</strong></p>', '10140', '10160', '11740', '11730', '2022-10-26 09:29:33', '2022-11-14 06:52:03', 'ans_a'),
(1923, NULL, 53, 1, '<p><strong>A 30-year-old comes in with a puncture wound in her left thigh. Further examination of the wound reveals she has a wound. Local anaesthetic is performed. Using an 11-blade scalpel, a 1 cm incision is made on the left thigh to the subcutaneous layer. The wound is explored, and tweezers are used to remove a wooden foreign body. What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '27372,S71.142S', '10120, S71.142A', '27372, S81.842A', '10120,S81.842S', '2022-10-26 09:30:33', '2022-11-14 06:52:19', 'ans_b'),
(1924, NULL, 53, 1, '<p><strong>During a self-breast exam, Julie felt small hard nodules in her right and left breasts. She was examined and the physician diagnosed simple breast cysts and recommended aspiration. Using ultrasound guidance, a sterile needle is inserted into the cyst of the right breast and fluid is withdrawn from the left breast and the same procedure is performed. What CPT&reg; codes are reported for this procedure?</strong></p>', '19000 x 2', '19000, 19001, 76942', '19000, 19001-51', '19000. 19001-51,76942', '2022-10-26 09:31:14', '2022-11-14 06:52:31', 'ans_b'),
(1925, NULL, 53, 1, '<p><strong>A physician performs excisional debridement for a patient with multiple wounds. A wound on the lower back measures 12 sqcm and involves the fascia for the debridement. A wound on the left shoulder measures 8 sqcm and one on the left lower leg measures 16 sqcm. Involves subcutaneous tissue for the debridement. What CPT&reg; codes are reported?</strong></p>', '11043,11046', '11043, 11042-59, 11045', '11043, 11042-59, 11042-59', '11042,11045', '2022-10-26 09:31:57', '2023-02-17 08:29:39', 'ans_b'),
(1926, NULL, 53, 1, '<p><strong>A surgeon performed Mohs micrographic surgery on a lesion on the lower leg. This required one stage with six tissue blocks. A direct skin flap was used to cover the defect. What CPT&reg; codes are reported for the Mohs surgery and the repair?</strong></p>', '17313, 17314, 17315, 15570', '17313, 17315, 15572', '17313,17314, 15572', '17311, 17312, 15570', '2022-10-26 09:32:36', '2022-11-14 06:53:07', 'ans_b'),
(1927, NULL, 53, 1, '<p><strong>Which CPT&reg; code is reported for a knee arthrocentesis without ultrasound guidance?</strong></p>', '20611', '20610', '27369', '20615', '2022-10-26 09:33:21', '2022-11-14 06:53:21', 'ans_b'),
(1928, NULL, 53, 1, '<p><strong>A 62-year-old patient has an arthritic elbow. The surgeon will perform an arthroplasty. The joint is repaired using membrane graft tissue, fascia lata, from the outer side of the thigh. It is used as a fat pad to separate the joint surfaces of the elbow to relieve pain. What CPT&reg; code is reported?</strong></p>', '24370', '24365', '24360', '24361', '2022-10-26 09:34:23', '2022-11-14 06:53:34', 'ans_c'),
(1929, NULL, 53, 1, '<p><strong>A 45-year-old has a dislocated patella in the left knee after a car accident. She was taken to the hospital by EMS for surgical treatment. The surgery suite, the patient is placed under general anaesthesia. After being prepped and draped, the surgeon makes an incision above the knee joint in front of the patella. Dissection is carried through soft tissue and reaches the patella in an attempt to reduce dislocation. When the patella is exposed, it is severely damaged due to cartilage breakdown. The tendon is dissected and using the entire patella is freed and removed. The tendon sheath is closed with sutures. What procedure code is reported for this surgery?</strong></p>', '27556-LT', '27552-LT', '27566-LT', '27562-LT', '2022-10-26 09:35:21', '2022-11-14 06:53:45', 'ans_c'),
(1930, NULL, 53, 1, '<p><strong>A 60-year-old male is revising a prior total disc arthroplasty due to complications. Using an anterior approach, the L3-L4 disc spar was exposed. The previously placed disc is removed, and the new placement of the artificial disc is inserted at L3-L4. The area w inspected and there was no compression of any nerve roots. Same procedure was performed on L5-S1 level. Peritoneum was the allowed to return to normal anatomic position and entire area was copiously irrigated. The wound was closed in a layered fashion. What CPT&reg; coding is reported?</strong></p>', '0163Tx2', '22857, 0163T', '22862, 0165T', '22857x2', '2022-10-26 09:36:06', '2022-11-14 06:53:57', 'ans_c'),
(1931, NULL, 53, 1, '<p><strong>A patient was brought to the operating room to repair a meniscal tear. An arthroscope is Inserted into the trocar to examine the knee. Tibial plateau was in good condition. The posterior horn of the medial meniscus showed a complex tear. Using basket forceps and a full radius resector, the tear is debrided back to a healthy peripheral rim. The lateral meniscus was intact without evidence of tears. What CPT&reg; code is reported for the repair?</strong></p>', '29880', '29881', '27405', '27403', '2022-10-26 09:36:47', '2022-11-14 06:54:18', 'ans_b'),
(1932, NULL, 53, 1, '<p><strong>Patient has a 5 cm tumor in the left lower quadrant abdominal wall. A horizontal skin Incision is made directly over the tumor in the patient&#39;s left lower quadrant and dissection was carried down through the dermis and subcutaneous tissue. The tumor is located and completely excised using electrocautery. The specimen is sent immediately to pathology to rule out cancer. What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '22903, R19.04', '22903,D49.2', '22901, C76.2', '22901,D49.2', '2022-10-26 09:37:34', '2022-11-14 06:54:31', 'ans_b'),
(1933, NULL, 53, 1, '<p><strong>A patient with empyema requires a Schede thoracoplasty. What CPT&reg; code is reported for this procedure?</strong></p>', '32906', '32999', '32905', '32900', '2022-10-26 09:38:12', '2022-11-14 06:54:45', 'ans_c'),
(1934, NULL, 53, 1, '<p><strong>The ENT physician performed removal of multiple nasal polyps in both the right and left nares in the office. What CPT&reg; coding is reported?</strong></p>', '30110-50', '30115', '30115-50', '30110', '2022-10-26 09:39:05', '2022-11-14 06:54:56', 'ans_a'),
(1935, NULL, 53, 1, '<p><strong>A 35-year-old patient has lung cancer of the left upper lung. Patient is scheduled for a video-assisted thoracoscopic surgery (VATS) to remove the segment of the lung containing the turnor. Under general anesthesia, he was placed in left lateral decubitus position and a thoracoscope was inserted through a port. Additional operating instruments are inserted through additional trocars placed in the chest cavity to remove a segment of left upper lung. The port sites were closed and chest tube was inserted to drain the wound and re-expand the lung. What CPT&reg; code is reported?</strong></p>', '32666', '32662', '32671', '32669', '2022-10-26 09:39:46', '2022-11-14 06:55:08', 'ans_d'),
(1936, NULL, 53, 1, '<p><strong>A 65-year-old with lymphoma is having an insertion of a central venous catheter via the right subclavian vein. The catheter is inserted just below the right clavicle. Under fluoroscopic visualisation the catheter tip was placed in the superior vena cava above the right atrium. Dissection of the deltopectoral area was performed with cautery down to the pectoralis fascia and blunt digital dissection to create a pocket at the fascial level. The central venous catheter was then tunnelled from the insertion site to the pocket and attached a port, which was placed in the pocket. The incision site was then closed.What central venous access procedure code is reported?</strong></p>', '36556', '36561', '36558', '36569', '2022-10-26 09:40:30', '2023-02-17 07:39:38', 'ans_b'),
(1937, NULL, 53, 1, '<p><strong>A 2-year-old male presents with a single ventricular septal defect (VSD) and is in current heart failure. The decision is made to use a patch for the closure. Under general anesthesia, the skin incision is made via median sternotomy. Cardiopulmonary bypass is initiat Under epicardial guidance, the muscular VSD is located. The guidewire is placed transmyocardially through the VSD. A patch is ther delivered over guidance to close the VSD. After successful closure, the guldewire is removed, and the site is repaired. A chest tube placed in the sternum. What is the correct code for this procedure?</strong></p>', '33647', '33645', '33681', '93675', '2022-10-26 09:41:13', '2022-11-14 06:55:43', 'ans_c'),
(1938, NULL, 53, 1, '<p><strong>A patient had recent angiogram demonstrating diffuse, high-grade left superficial femoral artery (SFA) stenosis as well as separate severe stenosis in the tibioperoneal trunk. A right femoral access is made and a contralateral sheath placed. A wire is able to cross both vessel stenoses and is placed into the posterior tibial artery. An atherectomy is performed of the diffuse SFA segment and then a smaller atherectomy and placement of stent is placed and used in the tibioperoneal trunk. A stent placement is also performed in the mid SFA due to acute occlusion at the atherectomy site. Completion lower extremity angiography is performed demonstrating restoration of flow. Which CPT&reg; codes are reported?</strong></p>', '37225, 37229', '37226,37230', '37227.37231', '37227,37229', '2022-10-26 09:42:18', '2022-11-14 06:55:56', 'ans_c'),
(1939, NULL, 53, 1, '<p><strong>A 36-year-old patient has an ulcer with a single perforation in the small intestine The physician performs an enterorrhaphy. What CPT&reg; code Is reported?</strong></p>', '44615', '44620', '44603', '44602', '2022-10-26 09:43:07', '2022-11-14 06:56:41', 'ans_d'),
(1940, NULL, 53, 1, '<p><strong>17-year-old female has her tonsils and adenoids removed due to chronic infection What CPT&reg; code is reported?</strong></p>', '42831', '42826', '42821', '42820', '2022-10-26 09:43:54', '2022-11-14 06:56:55', 'ans_c'),
(1941, NULL, 53, 1, '<p><strong>A 60-year-old man presents for a sigmoidoscopy. The physician inserts a flexible scope into the patient&#39;s rectum and determines that the rectum is clear of polyps. The scope Is advanced to the sigmoid colon and examined. A total of three polyps are found in the sigmoid colon. Polyps are removed using the snare technique. The flexible scope is withdrawn. What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '45346, K62.1', '45309, K621', '45338, K63.5', '45308, K63.5', '2022-10-26 09:44:38', '2022-11-14 06:57:07', 'ans_c'),
