(1943, NULL, 53, 1, '<p><strong>A patient who has colon adenocarcinoma undergoes a laparoscopic partial colectomy. The surgeon removes the proximal colon and terminal ileum and reconnects the cut ends of the distal ileum and remaining colon. What procedure and diagnosis codes are reported?</strong></p>', '44140, C18.9', '44205, C18.9', '44204, C18.2', '44160, C18.2', '2022-10-26 09:46:00', '2022-11-14 07:11:33', 'ans_b'),
(1944, NULL, 53, 1, '<p><strong>A 35-year-old has cholelithiasis and is in the operating suite for a cholecystectomy. An incision is star and carried down to the gallbladder. The liver and gallbladder are exposed. Gallbladder is grasped and withdrawn o duct and artery are delineated, clipped on the gallbladder side, and incised Guided transhepatic cholanglography r intraluminal defector or obstruction. Cystic duct triply clipped and transected. Gallbladder resected from the liver The incision is closed with layered sutures. What CPT&reg; codes are reported for the procedure performed?</strong></p>', '47000, 74300-26', '47605, 74300-26', '47562, 74300-26', '47563, 74300-26', '2022-10-26 09:46:46', '2022-11-14 07:11:45', 'ans_b'),
