(1955, NULL, 53, 1, '<p><strong>The cpt code book provides full description of medical procedure with same description requiring the use of a semicolon () to distinguish among closely related procedures.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What is the full description of cpt code 35860</strong></p>', 'Exploration for postoperative haemorrhage, thrombosis or infection extremity', 'Exploration for postoperative haemorrhage, thrombosis or infection excluding extremity', 'Exploration for postoperative haemorrhage, thrombosis or infection, neck chest abdomen and/or extremity', 'Exploration for postoperative haemorrhage, thrombosis or infection, neck and/or extremity', '2022-10-26 09:56:36', '2022-11-14 08:05:54', 'ans_a'),
(1957, NULL, 53, 1, '<p><strong>Which statement regarding lesion excision is true.</strong></p>', 'Lesion excision codes include removal of a lession with margins and intermediate closure when performed', 'Lesion excision codes include removal of a lession with margins and complex closure when performed', 'Lesion excision codes include removal of a lession with margins and single (non layered) closure when performed', 'Lesion excision codes are selected by measuring the greatest clinical diameter of a lession excluding the margins required to complete the excision', '2022-10-26 09:58:08', '2022-11-14 08:06:18', 'ans_c'),
