(1964, NULL, 54, 1, '<p><strong>A patient present to the urgent care facility with multiple burns acquired while burning debris in his backyard. After examination the physician determines the patient third degree burns of the left and right posterior thighs (10%). He also has second degree burns of the anterior portion of the right side of his chest wall (8%) and upper back (6%) TBSA is 24% with third degree burns totalling 10%.</strong></p>\r\n\r\n<p><strong>What ICD-10 codes are reported according to ICD-10 coding guidelines.&nbsp;</strong></p>', 'T24.311A, T24.312A, T21.21XA, T2123XA, T31.31', 'T24.311A, T24.312A,T21.21XA, T2123XA, T31.21', 'T21.21XA, T21.23XA, T24.311A,T24.312A, T31.21', 'T24.711A, T24712A, T21.61XA, T31.63XA, T32.21', '2022-10-26 10:13:36', '2022-11-14 08:08:37', 'ans_b'),
