(1966, NULL, 54, 1, '<p><strong>A 78 years old male who has been followed for multiple problems was referred recently to Dr. Peter for an Intating Crusted Intermittent problem with his left nipple areolar area physical exam revealed a superficial imitated resection on the nipple on the areolar area. Dr. Peter recommended an incisional biopsy to rule out paget disease. Patient exist to the procedure.</strong></p>\r\n\r\n<p><strong>A marking pen was used to delineate and ellptical shaved incision with the end.&nbsp;</strong></p>\r\n\r\n<p><strong>Based in the center of the nipple on the areolar area margin. 1% Xylocarx was used to inflitate the skin and subcutaneous tissue and biopsy was performed using elliptical shaped incision and it include a quadrant of the nipple and a section of the areola blidder control with suture ligatures of four polysorb the skin incision was closed with interrupted five nylon sutures and a dry sterilise dressing followed. The biopsy was went send to pathology.</strong></p>\r\n\r\n<p><strong>What CPT and ICD-10 codes are reported?</strong></p>', '11400, D49.2', '11400, D48.5', '11106, D48.5', '11106, D49.2', '2022-10-26 10:15:18', '2022-11-14 08:10:09', 'ans_c'),
(1967, NULL, 54, 1, '<p><strong>A 52 year old with chronic right Trochateric Bursitis is scheduled to receive an injection at the pain clinic. Under CT guidance a 22 godge spinal needle is introduced into the Trochanteric Bursa and a total volume of 8CC of normal saline and 40 mg of kemalog is injected. The interpretation of the radiology report in the medical record.</strong></p>\r\n\r\n<p><strong>What CPT code is reported for the surgical procedure?</strong></p>', '20610 -RT, 77012-26', '20611-RT', '20611-RT, 77012-26', '27062-RT', '2022-10-26 10:15:56', '2022-11-14 08:10:22', 'ans_a'),
