(1969, NULL, 54, 1, '<p><strong>A 53 years old male arrived at the ER Due to severe ocular trauma to the right eye. He was at work on a metal drilling machine and a metallic item penetrates his right eyeball. A foreign body is in the posterior segment of the eye and corneal laceration with multiple posterior perforated sights were noted. He is brought back to the surgical suit. The surgeon removed the metallic foriegn body using large retinal forceps. The laceration of the cornea is sutured and the provider also performed a pars plana lensectomy.</strong></p>\r\n\r\n<p><strong>What is the CPT and ICD-10 codes are reported?</strong></p>', '65235-RT, 65852-51-RT, 65280-51-RT, S05.31XA, W310XXA', '65265-RT, 66852-51-RT, 65275-51-RT, S05.31XA, W31.XXA', '65265-RT, 66852-51-RT, 65280-51-RT, S05.51XA, W31.1XXA', '65235-RT, 66852-51-RT, 65275-51-RT, S05.51XA, W31.1XXA', '2022-10-26 10:17:24', '2022-11-14 08:10:48', 'ans_c'),
