(1981, NULL, 54, 1, '<p><strong>A patient has a stage 3 sacral decubitus pressure ulcer. The dermatologist uses a 10-blade scalpel, making an oval-shaped incision around the ulcerated region and</strong></p>\r\n\r\n<p><strong>removing the necrotic tissue. The area is irrigated and closed with sutures. What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '15934, L89.323', '15931, L89.153', '15934, L89.153', '15931, L89.323', '2022-10-31 05:31:44', '2022-11-14 08:14:00', 'ans_b'),
(1982, NULL, 54, 1, '<p><strong>A patient with commercial insurance is here for an annual diabetic foot check. She does have diabetic shoes. She denies cigarette use or tobacco use. On examination,</strong></p>\r\n\r\n<p><strong>she has elongated mycotic appearing thickened 1 through 5 toenails for both feet. Evidence of fungal toenails. We discussed diabetic foot care. No foot ulceration is</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>seen. DP and PT pulses are palpable. Toenails 1-5 bilaterally debrided manually and with electric grinder. I will see her back for follow-up in 10-12 weeks.</strong></p>\r\n\r\n<p><strong>IMPRESSION:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. Fungal toenails bilaterally</strong></p>\r\n\r\n<p><strong>2. Diabetes mellitus</strong></p>\r\n\r\n<p><strong>3. Toenails causing pain</strong></p>\r\n\r\n<p>&nbsp;</p>', '11720, B35.1, E11.9', '60127, B35.1, E11.9', '11720, B35.1, E11.9', '11721, B35.1, E11.621', '2022-10-31 05:35:07', '2023-03-11 08:33:59', 'ans_d'),
