(1985, NULL, 54, 1, '<p><strong>A patient saw the dermatologist last week for a lesion on her right arm and one on her left leg. The dermatologist diagnosed both as basal cell carcinoma. She returned</strong></p>\r\n\r\n<p><strong>today for removal of the lesions.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The right arm lesion was measured as 1.0 cm in diameter with 0.5 cm margins and excised.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The lesion on the left leg was 2.0 cm in diameter with 0.2 cm margins and excised.</strong></p>\r\n\r\n<p>&nbsp;</p>', '11603, 11602-51', '11402, 11400-51', '11602, 11600-51', '11403, 11402-51', '2022-10-31 05:39:51', '2022-11-14 08:15:06', 'ans_a'),
(1986, NULL, 54, 1, '<p><strong>A patient presents to the emergency room with severe knee pain after falling off a skateboard. Radiological findings reveal a chipped patella with retention of bone fragments and</strong></p>\r\n\r\n<p><strong>embedded gravel. The ER physician states the patient has a type | open fracture of the right patella. The physician extends the open wound under anesthesia, debriding, irrigating, and</strong></p>\r\n\r\n<p><strong>removing the gravel down to the bone until clean bone and tissue remain.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '11044, S82.001A, V00.131A, Y93.51, Y99.8', '11012, S82.001B, V00.131A, Y93.51, Y99.8', '11012, S82.001A, V00.131A, Y93.51, Y99.8', '11011, S82.001B, V00.131A, Y93.51, Y99.8', '2022-10-31 05:41:09', '2022-11-14 08:15:41', 'ans_b'),
(1987, NULL, 54, 1, '<p><strong>A patient&#39;s left eye is damaged beyond repair due to a work injury. The provider fabricates a prosthesis from silicone materials and makes modifications to restore the</strong></p>\r\n\r\n<p><strong>patient&#39;s cosmetic appearance. What CPT&reg; code is reported?</strong></p>\r\n\r\n<p>&nbsp;</p>', '21088', '21077', '21080', '21086', '2022-10-31 05:43:22', '2022-11-14 08:15:52', 'ans_b'),
(1988, NULL, 54, 1, '<p><strong>Which code is reported for a knee injection with contrast for an arthrography?</strong></p>', '20610', '29999', '20611', '27369', '2022-10-31 05:45:48', '2022-11-14 08:16:10', 'ans_d'),
(1989, NULL, 54, 1, '<p><strong>A 30-year-old has a recurrent dislocated right patella. He is in the hospital outpatient orthopedic center to have the patella reconstructed. The patient is placed under</strong></p>\r\n\r\n<p><strong>general anesthesia. An incision is made above the knee joint and extended to the tibial tuberosity. The dissection goes down through the soft tissue to gain access to the</strong></p>\r\n\r\n<p><strong>patellar tendon. The patellar tendon along with a thin piece of bone from the tibial tuberosity is resected. Then the tendon is reattached and anchored into the inner</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>aspect of the tibia with staples. This tightens the tendon and improves stability of the knee. The incision is closed with Steri-Strips. The patient had no complications and</strong></p>\r\n\r\n<p><strong>was released after recovery. What is the correct CPT code?</strong></p>', '27558-RT', '27422-RT', '27562-RT', '27420-RT', '2022-10-31 05:47:12', '2022-11-14 08:16:26', 'ans_d'),
(1990, NULL, 54, 1, '<p><strong>A 60-year-old male suffering from degenerative disc disease at the L3-L4 and L5-S1 levels was placed under general anesthesia. Using an anterior approach, the L3-L4</strong></p>\r\n\r\n<p><strong>disc space was exposed. Using blunt dissection the disc space was cleaned. The disc space was then sized and trialed. Excellent placement and insertion of the artificial</strong></p>\r\n\r\n<p><strong>disc at L3-L4 was noted. The area was inspected and there was no compression of any nerve roots. Same procedure was performed on L5-S1 level. Peritoneum was then</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>allowed to return to normal anatomic position and entire area was copiously irrigated. The wound was closed in a layered fashion. The patient tolerated the discectomy</strong></p>\r\n\r\n<p><strong>and arthroplasty well and was returned to recovery in good condition. What CPT&reg; coding is reported for this procedure?</strong></p>', '22861, 0165T', '22857 x2', '0163T x 2', '22857, 0163T', '2022-10-31 05:48:09', '2022-11-14 08:16:38', 'ans_d'),
(1991, NULL, 54, 1, '<p><strong>A patient presents with a broken pin in the right ankle. The patient is taken to the surgical suite and placed in the supine position. After local anesthesia, the patient&#39;s</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>right ankle is prepped and draped. A 1 cm incision is made and dissection is carried just under the skin, removing the broken pin. The wounds are thoroughly irrigated</strong></p>\r\n\r\n<p><strong>with antibiotic-containing saline. Skin is closed with adhesive strips.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Which CPT&nbsp;and diagnosis codes are reported for this procedure?</strong></p>', '20680, T84.9XXA', '20670, T84.418A', '20680, T84.418A', '20670, T84.69XA', '2022-10-31 05:49:01', '2023-10-26 05:12:15', 'ans_b'),
(1992, NULL, 54, 1, '<p><strong>2-year-old Charlie fell awkwardly off of the living room couch at home and would not move his right arm after the fall. X-rays at the emergency room revealed a shaft</strong></p>\r\n\r\n<p><strong>fracture. of both the radius and ulna of his right arm. Fracture care treatment was provided, and the provider did not need to perform manipulation. What CPT&reg; code is</strong></p>\r\n\r\n<p><strong>reported?</strong></p>', '25600-RT', '25565-RT', '25574-RT', '25560-RT', '2022-10-31 05:49:58', '2022-11-14 08:17:03', 'ans_d'),
(1993, NULL, 54, 1, '<p><strong>The patient is brought to the ED with an obstructed airway. The provider immediately makes an incision through the cricothyroid membrane and inserts a tracheostomy</strong></p>\r\n\r\n<p><strong>tube to assist the patient&#39;s breathing. What CPT &reg; code is reported for this scenario?</strong></p>', '31610', '31605', '31603', '31600', '2022-10-31 05:50:58', '2022-11-14 08:17:24', 'ans_b'),
(1994, NULL, 54, 1, '<p><strong>A patient with empyema requires an extrapleural thoracoplasty with closure of bronchopleural fistula.</strong></p>\r\n\r\n<p><strong>What CPT &rdquo; code is reported for this procedure?</strong></p>', '32999', '32900', '32906', '32905', '2022-10-31 05:51:59', '2022-11-14 08:17:39', 'ans_c'),
(1995, NULL, 54, 1, '<p><strong>A catheter was placed into the abdominal aorta via the right common femoral artery access. The catheter was used to selectively catheterize only the right renal artery. Selective right renal angiography was then performed, demonstrating a widely patent right renal artery. What is proper CPT&reg; coding?&nbsp;</strong></p>', '36251', '36253, 75625', '36245', '36252, 75625', '2022-10-31 05:54:51', '2022-11-14 08:17:53', 'ans_a'),
(1996, NULL, 54, 1, '<p><strong>A patient has lung cancer in his right middle and inferior lobes and is in the OR for a bilobectomy. A thoracotomy is performed, and a rib spreader is used to access the right lung. Removal of the total right middle and inferior lobe with the mass is performed. The incision is closed with staples and the patient is transferred to the surgical intensive care unit for observation. What CPT code is reported?</strong></p>', '32480', '32670', '32482', '32662', '2022-10-31 05:56:00', '2022-11-14 08:18:05', 'ans_c'),
(1997, NULL, 54, 1, '<p><strong>A lymphangiogram of the left side is performed on a patient with early onset of endocervical cancer. The provider makes a small incision over the ducts and injects contrast. Imaging is performed to view the vessels of the lymphatic system. The provider performs the injection, as well as the radiologic supervision and interpretation. What CPT&reg; codes are reported?</strong></p>', '38792-LT, 75807-LT', '38792-50, 75807-50', '38790-50, 75805-50', '38790-LT, 75805-LT', '2022-10-31 06:09:45', '2022-11-14 08:18:16', 'ans_d'),
(1998, NULL, 54, 1, '<p><strong>A 16-year-old needs a peripherally inserted venous access catheter for cancer treatment. The patient was placed in the supine position. Following the administration of light anesthesia, the right arm was prepped and draped in the usual fashion. Next, 50 cc of 1 percent Lidocaine with bicarb was infused in the skin and subcutaneous tissue and the basilic vein was punctured. Using Seldinger technique, the subclavian vein was cannulated on the first attempt. A 3-wire passed easily under fluoroscopic guidance to the subclavian vein. The wound was closed with a 3-0 Vicryl. Benzoin and Steri-Strips were applied. Sponge and needle count correct. The patient was awakened from light anesthesia and taken to the recovery room in stable condition. Which CPT&reg; coding is reported?&nbsp;</strong></p>', '36569, 77001', '36570', '36573', '36571, 77001', '2022-10-31 06:11:06', '2022-11-14 08:18:29', 'ans_c'),
(1999, NULL, 54, 1, '<p><strong>A patient arrives at the ED with a painful sunburn with blisters on her back. She reports passing out from standing up. The provider performs a detailed history, expanded problem focused exam, and medical decision making of low complexity. What ED E/M visit is reported?&nbsp;</strong></p>', '99284', '99281', '99282', '99283', '2022-10-31 06:12:19', '2022-11-14 08:20:38', 'ans_c'),
(2000, NULL, 54, 1, '<p><strong>A patient is seen in the ED and then admitted to observation by the ED provider. According to the Initial Observation CPT&reg; guidelines, what is reported?&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Only a code from 99221-99223', 'A code from 99281-99285 and a code from 99218-99220', 'A code from 99202-99205 and a code from 99218-99220', 'Only a code from 99218-99220', '2022-10-31 06:13:33', '2023-05-31 04:55:10', 'ans_a'),
(2001, NULL, 54, 1, '<p><strong>A 4-year-old, critically ill child is admitted to the PICU from the ED with respiratory failure due to an exacerbation of asthma not manageable in the ER. The PICU provider starts continuous bronchodilator therapy and pharmacologic support with cardiovascular monitoring and possible mechanical ventilation support. After treatment is initiated, the provider documents a comprehensive history and exam and orders are written. What is the E/M code for this encounter?&nbsp;</strong></p>', '99285', '99475', '99471', '99291', '2022-10-31 06:19:41', '2022-11-14 08:21:46', 'ans_b'),
(2002, NULL, 54, 1, '<p><strong>An OB/GYN performs a cesarean section for possible fetal distress. A pediatrician is asked to attend the delivery. The baby was suctioned and cried and had a final Apgar of 9. The pediatrician also performed a newborn physical exam and met with the family. The services were documented in the medical record. How does the pediatrician report the services?&nbsp;&nbsp;</strong></p>', '99464, 99460', '99465', '99464', '99465, 99460', '2022-10-31 06:20:40', '2022-11-14 08:22:02', 'ans_a'),
(2003, NULL, 54, 1, '<p><strong>The ED physician places a patient in observation care in the morning hours(4am) for severe shortness of breath and chest pain. The ED physician performs a medically appropriate history &amp; examination. Physician spent a total 80 minutes with the patient. The patient&#39;s symptoms are gone by the afternoon(3pm) and he is discharged that afternoon from observation care.&nbsp;</strong></p>\r\n\r\n<p><strong>What CPT code is reported?&nbsp;</strong></p>', '99222', '99221', '99235', '99283', '2022-10-31 06:21:39', '2023-06-22 02:18:42', 'ans_c'),
(2004, NULL, 54, 1, '<p><strong>A patient has not been seen in the physician&rsquo;s office in one year. Patient comes in today with a fever and a painful sore throat. The physician suspects strep throat and</strong></p>\r\n\r\n<p><strong>performs a medically appropriate history and exam. A strep test is performed by the physician in the office. The quick strep test result is positive for strep throat and</strong></p>\r\n\r\n<p><strong>documented as a final diagnosis. Prescription is given.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What are the CPT&reg; and ICD-10-CM codes for this service?</strong></p>', '99212-25, 87880, R50.9', '99212-25, 87880, J02.0, R50.9', '99213-25, 87880, J02.0, R50.9', '99213-25, 87880, J02.0', '2022-10-31 06:23:08', '2022-11-14 08:22:49', 'ans_d'),
(2005, NULL, 54, 1, '<p><strong>The patient presents for a follow-up echocardiogram. Echocardiography, transthoracic, real-time with image documentation with M-mode recording is performed. What is the correct CPT&reg; code for the test the physician ordered?&nbsp;</strong></p>', '93308', '93306', '93307', '93304', '2022-10-31 06:24:03', '2022-11-14 08:23:02', 'ans_a'),
(2006, NULL, 54, 1, '<p><strong>A 7-year-old male with a heart murmur and fatigue since birth has a transesophageal echocardiography (TEE). Doppler echocardiography is also performed with color flow, pulse wave, and continuous wave. Pulmonary valve stenosis is diagnosed. What CPT&nbsp;codes are reported?</strong></p>', '93315, 93325', '93318, 93325', '93318, 93320', '93315, 93320', '2022-10-31 08:01:31', '2023-10-11 23:24:34', 'ans_d'),
(2007, NULL, 54, 1, '<p><strong>A 70-year-old female who has a history of COPD comes into the ER with sudden shortness of breath and dizziness. She has a continuous aerosol treatment for 1 hour and</strong></p>\r\n\r\n<p><strong>45 minutes. The final diagnosis is COPD with acute exacerbation. What CPT &reg; and ICD-10-CM codes are reported?</strong></p>', '94644, 94645, J44.1', '94644, 94645-51, J44.0', '94640 x 2, J44.1', '94640, 94640-76, J44.9', '2022-10-31 08:03:33', '2022-11-14 08:23:52', 'ans_a'),
(2008, NULL, 55, 1, '<p><strong>A patient is referred to the hospital radiology clinic for numbness and tingling in the left arm. The physician suspects it is related to thoracic outlet syndrome. The</strong></p>\r\n\r\n<p><strong>radiologist performs a bidirectional Doppler waveform analysis and a volume plethysmography at two levels in the left arm. A duplex scan of left arm is also performed.</strong></p>\r\n\r\n<p><strong>What procedure codes are reported for the professional services for this encounter?</strong></p>', '93922-52-26, 93931-26', '93922-26, 93925-TC', '93922-52-TC, 93930-50-TC', '93922-TC, 93930-26', '2022-10-31 08:04:38', '2022-11-14 09:01:51', 'ans_a'),
(2009, NULL, 55, 1, '<p><strong>A 56-year-old male is having two bladder masses removed via cystoscopy. What anesthesia code is reported?</strong></p>', '00914', '00870', '00912', '00860', '2022-10-31 08:14:57', '2022-11-14 09:02:27', 'ans_c'),
(2010, NULL, 55, 1, '<p><strong>A 45-year-old patient with multiple sclerosis receives continuous IV infusion therapy of a therapeutic medication for 1 hour and 15 minutes. What is the correct way to</strong></p>\r\n\r\n<p><strong>report the infusion?</strong></p>', '96369, 96370', '96369', '96365', '96365, 96366', '2022-10-31 08:16:51', '2022-11-14 09:04:05', 'ans_c'),
(2011, NULL, 55, 1, '<p><strong>The neurologist spends 15 minutes one on one preparing the patient and placing needles for acupuncture with electrical stimulation. She leaves the needles in place for</strong></p>\r\n\r\n<p><strong>20 minutes. She returns, removes the needles and repeats the procedure, again spending 15 minutes one on one, placing the needles, leaving the needles in place for 20</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>minutes, and then removing the needles. What CPT &reg; coding is reported according to acupuncture CPT &reg; guidelines?</strong></p>', '97813, 97814', '97810 x 2', '97813 x2', '97810, 97811', '2022-10-31 08:17:56', '2022-11-14 09:04:22', 'ans_a'),
(2012, NULL, 55, 1, '<p><strong>A CRNA Is personally performing a case without supervision of an anesthesiologist. What modifier is reported for the CRNA services?</strong></p>', 'QY', 'Qx', 'QS', 'Qz', '2022-10-31 08:18:52', '2022-11-14 09:04:55', 'ans_d'),
(2013, NULL, 55, 1, '<p><strong>An 18 year old involved in a motorcycle accident presents to the OR with a compound fracture of the left lower third of the femur. The bone is exposed through a wound</strong></p>\r\n\r\n<p><strong>in the skin. After induction of general endotracheal anesthesia, the surgeon debrides the skin and bone and extends the open wound to expose the bone further. The bone</strong></p>\r\n\r\n<p><strong>is debrided, aligned, and secured with plates and screws. After extensive irrigation with antibiotics, the wound is closed. What anesthesia code is reported?</strong></p>', '01230', '01360', '01220', '01340', '2022-10-31 08:22:00', '2022-11-14 09:05:39', 'ans_b'),
(2014, NULL, 55, 1, '<p><strong>A 57-year-old woman with a physical status of 3 received general endotracheal anesthesia for a panniculectomy. The anesthesiologist personally performed the entire</strong></p>\r\n\r\n<p><strong>anesthesia service. What CPT&reg; coding is reported for the anesthesia?</strong></p>', '00802-AA-P3', '00800-P3, 99140-P3', '00802, 99140-AA-P3', '00800-AA-P3', '2022-10-31 08:23:16', '2022-11-14 09:06:31', 'ans_a'),
(2015, NULL, 55, 1, '<p><strong>Preoperative Diagnosis: Bilateral groin hidradenitis and buttock abscess</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Postoperative Diagnosis: Bilateral groin hidradenitis and buttock abscess</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Name of Operation: Excisional skin of bilateral groin hidradenitis. Incision and drainage of buttock abscess</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Description of Procedure: Antibiotic prophylaxis: The patient was on antibiotics in the emergency department and received vancomycin and piperacillin/tazobactam. Deep</strong></p>\r\n\r\n<p><strong>vein thrombosis prophylaxis: Bilateral sequential compression devices. The patient was brought to the operating room and general anesthesia was administered. She was</strong></p>\r\n\r\n<p><strong>placed into the prone position. The buttock area was prepped and draped in sterile fashion. Abscess was drained with cruciate incisions. Purulence was there and</strong></p>\r\n\r\n<p><strong>adequately drained. This area was then packed with iodoform gauze and dressed.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The patient was subsequently rolled into the supine position. Next, excised the skin and soft tissue of the hidradenitis regions of the in the bilateral groins. The patient</strong></p>\r\n\r\n<p><strong>had numerous areas of abscess accumulation in both areas. The raw surfaces of these areas after excision had a simple repair and were dressed with wet-to-dry gauze</strong></p>\r\n\r\n<p><strong>dressings. The patient was subsequently awakened, extubated, transferred to a stretcher, and taken to recovery in stable condition. She tolerated the procedure well.</strong></p>\r\n\r\n<p><strong>There were no complications.</strong></p>', '11463-50, 10061-59', '11462-50, 10061-59', '11462, 10060-59', '11463, 10060-59', '2022-10-31 08:24:41', '2022-11-14 09:07:24', 'ans_b'),
(2016, NULL, 55, 1, '<p><strong>PRE-OP DIAGNOSIS: unstable RIGHT bimalleolar fracture dislocation</strong></p>\r\n\r\n<p><strong>POST-OP DIAGNOSIS: same</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PROCEDURE(S) PERFORMED: RIGHT ankle external fixation</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Anesthesia: General</strong></p>\r\n\r\n<p><strong>Estimated Blood Loss: 15 ml</strong></p>\r\n\r\n<p><strong>Findings: as below</strong></p>\r\n\r\n<p><strong>Specimens: none</strong></p>\r\n\r\n<p><strong>Complications: none</strong></p>\r\n\r\n<p><strong>Inherent Occurrences : None</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>INDICATIONS: 57-year-old female status post fall downstairs with right bimalleolar fracture dislocation status post failed attempted reduction in the emergency</strong></p>\r\n\r\n<p><strong>department. I reviewed this with her and her daughter and discussed treatment options both operative and non-operative and recommended operative reduction and</strong></p>\r\n\r\n<p><strong>fixation with external fixture to temporizing stabilize her ankle with delayed internal fixation. I discussed the risks of the procedure as well as the postop rehabilitation in</strong></p>\r\n\r\n<p><strong>detail answered all their questions and they wished to proceed.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PROCEDURE: Patient identified preoperatively her upper extremities marked by myself preoperative Ancef was given she is brought to the operating room where after</strong></p>\r\n\r\n<p><strong>induction anesthesia she was placed supine on the operating room table with a bump under operative hip and upper are thigh tourniquet was placed. She was then</strong></p>\r\n\r\n<p><strong>prepped and draped in usual standard sterile fashion with ChloraPrep. After surgical time-out I utilized fluoroscopy to localize for the tibial half pins. I made skin incisions</strong></p>\r\n\r\n<p><strong>bluntly dissected to the tibia and placed 2 Schanz pins into the tibia bicortically. I confirmed their position fluoroscopically. I then under fluoroscopic guidance placed 1</strong></p>\r\n\r\n<p><strong>medial lateral trans calcaneal pin. Once this was complete, I assembled the external fixator reduced the ankle into an anatomic position and tightened all the connections.</strong></p>\r\n\r\n<p><strong>X-ray showed an excellent reduction of the fracture with the pins in appropriate position. Pin sites were dressed with Xeroform and a dry sterile compressive dressing and</strong></p>\r\n\r\n<p><strong>she was woken from anesthesia and taken the PACU in stable condition the tourniquet was not used.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>&nbsp;</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Postoperatively she will receive 24 hours of Ancef pin care to start postoperative day 2 or prior to discharge if tomorrow. She has follow-up in 1 week for skin check. If</strong></p>\r\n\r\n<p><strong>she is still in-house later this week, we can proceed with ORIF if the skin and soft tissues allow. Lovenox for DVT prophylaxis.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Signed by XXXXX, MD at 06/01/20XX 12:38PM</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What CPT&reg; coding is reported?</strong></p>', '27823', '27808', '27818', '27810', '2022-10-31 08:25:43', '2022-11-14 09:07:42', 'ans_d'),
(2017, NULL, 55, 1, '<p><strong>Preoperative Diagnosis: Acute MI, severe left main arteriosclerotic coronary artery disease</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Postoperative Diagnosis: Acute MI, severe left main arteriosclerotic coronary artery disease</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Procedure Performed: Placement of an IABP through the ascending aorta</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Description of Procedure: The patient is prepped and draped in the usual sterile fashion. Access is obtained through incision of the aorta. The aorta is opened and a graft</strong></p>\r\n\r\n<p><strong>is sewn to the aortotomy. A guidewire passes into the descending aorta, a balloon catheter is threaded into the graft, the guidewire is removed, and the balloon is placed</strong></p>\r\n\r\n<p><strong>in the aortic arch and aorta. The balloon pump had good waveform. The balloon pump catheter is secured to his skin after local anesthesia of 2 cc of 1% Xylocaine was</strong></p>\r\n\r\n<p><strong>used to numb the area. The balloon pump was secured with a 0 silk suture. Sterile dressing is placed. The patient tolerated the procedure. There were no complications.</strong></p>\r\n\r\n<p><strong>What code is reported for this procedure?</strong></p>', '33973', '33977', '33967', '33975', '2022-10-31 08:27:07', '2022-11-14 09:07:59', 'ans_a'),
(2018, NULL, 55, 1, '<p><strong>CC: Sore throat and fever</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>HPI: Mother brought in 2-year-old child today for complaint of sore throat and fever starting two days ago. Mother gives the history and states she has given Children&rsquo;s</strong></p>\r\n\r\n<p><strong>Motrin for the pain and fever which has helped reduced fever from 101&deg;.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ROS: No nausea and vomiting or diarrhea. No headaches or rash.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PE: General appearance: Well-nourished and hydrated. Temperature: 99.1</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TM: normal. Nose: nasal discharge seen. Pharynx/Oropharynx: abnormal tonsils are enlarged and erythematous with white spots on the back of the throat. Lymph</strong></p>\r\n\r\n<p><strong>nodes: swollen lymph glands. Lungs: respiratory movements were normal. Clear to auscultation. There are no wheezes, rales, rhonchi.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Orders: Quick strep test performed in the office today: positive.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Assessment: Strep throat</strong></p>\r\n\r\n<p><strong>Prescription medication for Azithromycin 12 mg/kg once daily given for the next five days.</strong></p>\r\n\r\n<p><strong>Return in five days for follow-up.</strong></p>\r\n\r\n<p><strong>What E/M code is reported?</strong></p>', '99212', '99213', '99214', '99215', '2022-10-31 08:28:34', '2023-10-03 00:15:26', 'ans_c'),
(2019, NULL, 56, 1, '<p><strong>CC: Sore throat and fever</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>HPI: Mother brought in 2-year-old child today for complaint of sore throat and fever starting two days ago. Mother gives the history and states she has given Children&rsquo;s</strong></p>\r\n\r\n<p><strong>Motrin for the pain and fever which has helped reduced fever from 101&deg;.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ROS: No nausea and vomiting or diarrhea. No headaches or rash.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PE: General appearance: Well-nourished and hydrated. Temperature: 99.1</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TM: normal. Nose: nasal discharge seen. Pharynx/Oropharynx: abnormal tonsils are enlarged and erythematous with white spots on the back of the throat. Lymph</strong></p>\r\n\r\n<p><strong>nodes: swollen lymph glands. Lungs: respiratory movements were normal. Clear to auscultation. There are no wheezes, rales, rhonchi.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Orders: Quick strep test performed in the office today: positive.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Assessment: Strep throat</strong></p>\r\n\r\n<p><strong>Prescription medication for Azithromycin 12 mg/kg once daily given for the next five days.</strong></p>\r\n\r\n<p><strong>Return in five days for follow-up.</strong></p>\r\n\r\n<p><strong>What E/M code is reported?</strong></p>', '99212', '99213', '99214', '99215', '2022-10-31 08:28:44', '2023-10-03 00:15:36', 'ans_c'),
(2020, NULL, 57, 1, '<p><strong>CC: Sore throat and fever</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>HPI: Mother brought in 2-year-old child today for complaint of sore throat and fever starting two days ago. Mother gives the history and states she has given Children&rsquo;s</strong></p>\r\n\r\n<p><strong>Motrin for the pain and fever which has helped reduced fever from 101&deg;.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ROS: No nausea and vomiting or diarrhea. No headaches or rash.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PE: General appearance: Well-nourished and hydrated. Temperature: 99.1</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>TM: normal. Nose: nasal discharge seen. Pharynx/Oropharynx: abnormal tonsils are enlarged and erythematous with white spots on the back of the throat. Lymph</strong></p>\r\n\r\n<p><strong>nodes: swollen lymph glands. Lungs: respiratory movements were normal. Clear to auscultation. There are no wheezes, rales, rhonchi.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Orders: Quick strep test performed in the office today: positive.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Assessment: Strep throat</strong></p>\r\n\r\n<p><strong>Prescription medication for Azithromycin 12 mg/kg once daily given for the next five days.</strong></p>\r\n\r\n<p><strong>Return in five days for follow-up.</strong></p>\r\n\r\n<p><strong>What E/M code is reported?</strong></p>', '99212', '99213', '99214', '99215', '2022-10-31 08:28:52', '2023-10-03 00:15:50', 'ans_c'),
(2021, NULL, 55, 1, '<p><strong>LOCATION: Pain in dorsal, left.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>QUALITY: Patient describes pain as aching.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SEVERITY: Maximum severity is moderate; currently symptoms are moderate.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>RELIEVED BY: Patient&#39;s condition relieved by elevation.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Patient denies clavicle pain, shoulder pain, elbow pain. Patient states wrist pain is present. Patient denies hand pain. Patient denies finger pain. Distal neuro c/o, proximal</strong></p>\r\n\r\n<p><strong>injury, distal injury.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PAST MEDICAL HISTORY: Hypertension</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>SOCIAL HISTORY: Widow. Lives in an apartment.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>REVIEW OF SYSTEMS</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CONSTITUTIONAL: No fever.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CARDIOVASCULAR: No chest pain.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>RESPIRATORY: No SOB.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>MUSCULOSKELETAL: No neck pain.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>NEUROLOGIC: No dizziness.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PHYSICAL EXAM</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>CONSTITUTIONAL: Patient is afebrile. Vital signs reviewed. Alert and oriented x 3.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>HEAD: Atraumatic. Normocephalic.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>EYES: Eyes are normal to inspection; pupils equal, round, and reactive to light; no discharge from eyes; extraocular muscles intact; sclerae are normal; conjunctivae are</strong></p>\r\n\r\n<p><strong>normal.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>ENT: No nasal deformity, no active bleeding from nares, no stridor, no trismus, mucus membranes moist, no drooling, able to handle secretions, no erythema, no</strong></p>\r\n\r\n<p><strong>swelling.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>NECK: Assessment includes: No meningeal signs. Normal ROM.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>RESPIRATORY CHEST: No respiratory distress.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>UPPER EXTREMITY: Wrist evaluation shows left wrist to have no hematoma, no erythema, no warmth; radial pulse intact; capillary refill less than 2 seconds; distal motor</strong></p>\r\n\r\n<p><strong>intact; distal sensory intact. Ecchymosis noted, volar, dorsal. Swelling noted, volar, dorsal. Tenderness to palpation, of radius, of ulna, of scaphoid. Active range of</strong></p>\r\n\r\n<p><strong>motion: Limited. Passive range of motion: Limited. Hand evaluation shows no deformity, no ecchymosis, no erythema, no swelling, no hematoma, no tenderness to</strong></p>\r\n\r\n<p><strong>palpation, full range of motion, radial pulse intact, ulnar pulse intact, capillary refill less.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>X-Ray ordered/reviewed: Fracture of the left radius. No dislocation.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>FRACTURE CARE: Decision for major surgery procedure performed by ED Physician. Closed treatment of Colles wrist fracture without manipulation completed. Short arm</strong></p>\r\n\r\n<p><strong>splint applied. Post cast neurovascular check. Capillary refill normal, distal sensation is intact, distal motor function is normal. Patient tolerated procedure well.</strong></p>\r\n\r\n<p><strong>DIAGNOSIS: Colles fracture, closed.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PLAN: Discharge patient with fracture care instructions. Prescription of acetaminophen with codeine. To follow-up with orthopedic doctor for healing of fracture.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>What CPT&reg; codes are reported?</strong></p>', '99283-25, 25605-54', '99284-57, 25600-54', '99284-25, 29125-54', '99283-57, 29125-54', '2022-10-31 08:30:37', '2022-11-14 09:09:58', 'ans_b'),
(2022, NULL, 55, 1, '<p><strong>Myringotomy is also called:</strong></p>', 'Thymectomy', 'Turbinotomy', 'Tracheotomy', 'Tympanotomy', '2022-11-01 05:50:21', '2022-11-14 09:10:16', 'ans_d'),
(2023, NULL, 55, 1, '<p><strong>A patient has been diagnosed with meningitis. What is meningitis?</strong></p>', 'Infection of the ventricles of the heart', 'Inflammation surrounding the brain and spinal cord', 'Swelling of the brain', 'Enlargement of the lymph nodes in the neck', '2022-11-01 05:51:05', '2022-11-14 09:10:35', 'ans_b'),
(2024, NULL, 55, 1, '<p><strong>A thoracoscopy is performed. What is this type of procedure?</strong></p>', 'An instrument that measures changes in gas volume and pressure during respiration', 'Examination of the pleural cavity through an endoscope.', 'Examination of the colon and stomach through an endoscope.', 'Biopsy of the lung through an endoscope.', '2022-11-01 05:52:03', '2022-11-14 09:10:50', 'ans_b'),
(2025, NULL, 55, 1, '<p><strong>The patient is diagnosed with trichomycosis. The patient has?</strong></p>', 'Diffuse red skin', 'Skin tumor', 'Inflammation of the nail and nail bed', 'Fungal infection of the hair', '2022-11-01 05:52:57', '2022-11-14 09:11:03', 'ans_d'),
(2026, NULL, 55, 1, '<p><strong>According to the ICD-10-CM coding guidelines, which medical condition does NOT have a causal relationship with Hypertension.</strong></p>', 'Chronic kidney disease (N18)', 'Heart disease (151.4-I51.7, 151.89, 151.9)', 'Acute kidney failure (N17)', 'Congestive heart failure (I50.-)', '2022-11-01 05:53:37', '2022-11-14 09:11:29', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(2027, NULL, 55, 1, '<p><strong>According to CPT&reg; coding guidelines for radiology code range 76881-76886, which codes are reported for spectral and color Doppler evaluations of the extremities?</strong></p>', '73700-73702', '76881, 76882', '93925-93931, 93970, 93971', '73560-73565', '2022-11-01 05:54:11', '2022-11-14 09:11:42', 'ans_c'),
(2028, NULL, 55, 1, '<p><strong>According to CPT&reg; Medicine guidelines which is NOT reported as imaging guidance?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'Computed tomography', 'Fluoroscopy', 'Radar signals', 'Magnetic resonance imaging', '2022-11-01 05:54:55', '2022-11-14 09:11:55', 'ans_c'),
(2029, NULL, 55, 1, '<p><strong>A surgeon performs a percutaneous balloon angioplasty and atherectomy in the femoral/popliteal artery. According to the endovascular revascularization CPT&reg;@</strong></p>\r\n\r\n<p><strong>guidelines, what is reported?</strong></p>', '37227', '37224', '37225', '37224, 37225', '2022-11-01 05:55:33', '2022-11-14 09:12:11', 'ans_c'),
(2030, NULL, 55, 1, '<p><strong>According to CPT&reg; coding guidelines, which scenario best represents modifier 24?</strong></p>', 'Patient had hernia surgery two days ago and returns to the operating room to incise and drain a post-operative abscess.', 'Patient had an appendectomy two weeks ago. Patient returns to see the physician who performed the appendectomy complaining of a swollen right foot. The physician examines the swollen right foot providing an E/M service, which is unrelated', 'Patient is coming back to have stitches removed from his hand within the postoperative 10-day global period of the repair.', 'New patient is seen in the physician’s office for effusion on the left knee. Physician examines the patient and performs a minor surgical procedure, aspirating fluid from the left knee.', '2022-11-01 05:57:46', '2022-11-14 09:12:24', 'ans_b'),
(2031, NULL, 55, 1, '<p><strong>A patient has stage 5 chronic kidney disease and requires chronic dialysis. According to the ICD-10-CM instructional notes in the Tabular List for codes in category N18, how is this reported?</strong></p>', 'N18.5, Z99.2', 'N18.6, Z99.2', 'N18.5', 'N18.6', '2022-11-01 05:59:20', '2022-11-14 09:12:36', 'ans_b'),
(2032, NULL, 55, 1, '<p><strong>According to the Application of Cast and Strapping CPT&nbsp;guidelines, what is reported when an orthopedic provider performs initial fracture care treatment for a closed scaphoid fracture of the wrist, applies a short arm cast, and the patient will be returning for subsequent fracture care?</strong></p>', '29075-22', '25622, 29075', '29075', '25622', '2022-11-01 06:00:14', '2023-02-13 06:09:10', 'ans_d'),
(2033, NULL, 55, 1, '<p><strong>The surgeon prepares a pedicle flap from the arm and transfers it to the recipient defect site on the forehead. What CPT&reg; code is reported?</strong></p>', '15574', '15610', '15572', '15620', '2022-11-01 06:00:47', '2022-11-14 09:13:07', 'ans_a'),
(2034, NULL, 55, 1, '<p><strong>A 55-year-old has a 1.0 cm squamous cell carcinoma on her neck. She is seeing her dermatologist to have it destroyed using cryosurgery. What CPT&reg; code is reported?</strong></p>', '17000', '17106', '17250', '17271', '2022-11-01 06:01:29', '2022-11-14 09:13:34', 'ans_d'),
(2035, NULL, 55, 1, '<p><strong>A patient saw the dermatologist last week for a lesion on her right arm and one on her left leg. The dermatologist diagnosed both as basal cell carcinoma. She returned</strong></p>\r\n\r\n<p><strong>today for removal of the lesions.</strong></p>\r\n\r\n<p><strong>The right arm lesion was measured as 1.0 cm in diameter with 0.5 cm margins and excised.</strong></p>\r\n\r\n<p><strong>The lesion on the left leg was 2.0 cm in diameter with 0.2 cm margins and excised.</strong></p>\r\n\r\n<p><strong>What CPT&reg; codes would you report for the lesion removals?</strong></p>', '11602, 11600-51', '11603, 11602-51', '11402, 1400-51', '11403, 1402-51', '2022-11-01 06:02:34', '2022-11-14 09:14:08', 'ans_b'),
(2036, NULL, 55, 1, '<p><strong>A patient has bilateral upper eyelid myogenic ptosis. After the patient is appropriately prepped and anesthetized, the surgeon then excises the excess skin and closes the</strong></p>\r\n\r\n<p><strong>wound with sutures. What CPT&reg; and ICD-10-CM codes are reported for this surgery?</strong></p>', '15822, HO2.421, HO2.422', '15822-50, H02.423', '15820-50, H02.421, H02.422', '15820, HO2.423', '2022-11-01 06:03:32', '2022-11-14 09:14:20', 'ans_b'),
(2037, NULL, 55, 1, '<p><strong>A patient has a stage 3 sacral decubitus pressure ulcer. The dermatologist uses a 10-blade scalpel, making an oval-shaped incision around the ulcerated region and</strong></p>\r\n\r\n<p><strong>removing the necrotic tissue. The area is irrigated and closed with sutures. What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '15931, L89.323', '15934, L89.323', '15931, L89.153', '15934, L89.153', '2022-11-01 06:04:14', '2022-11-14 09:14:33', 'ans_c'),
(2038, NULL, 55, 1, '<p><strong>A patient presents to the emergency room with severe knee pain after falling off a skateboard. Radiological findings reveal a chipped patella with retention of bone fragments and embedded gravel. The ER physician states the patient has a type | open fracture of the right patella. The physician extends the open wound under anaesthesia, debriding, irrigating, and removing the gravel down to the bone until clean bone and tissue remain.</strong></p>\r\n\r\n<p><strong>What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '11012, S82.001A, VO0.131A, Y93.51, Y99.8', '11012, S82.001B, VO0.131A, Y93.51, Y99.8', '11011, S82.001B, V00.131A, Y93.51, Y99.8', '11044, S82.001A, V00.131A, Y93.51, Y99.8', '2022-11-01 06:05:09', '2022-11-14 09:14:45', 'ans_b'),
(2039, NULL, 55, 1, '<p><strong>A 67-year-old patient has osteomyelitis of the shoulder blade and is in surgery to remove the sequestered section of dead infected fragment bone from surrounding bone.</strong></p>\r\n\r\n<p><strong>What CPT&nbsp;code is reported?</strong></p>', '23180', '23170', '23182', '23172', '2022-11-01 06:06:01', '2022-11-14 09:14:56', 'ans_d'),
(2040, NULL, 55, 1, '<p><strong>A patient&#39;s left eye is damaged beyond repair due to a work injury. The provider fabricates a prosthesis from silicone materials and makes modifications to restore the patient&#39;s cosmetic appearance. What CPT&reg; code is reported?</strong></p>', '21080', '21088', '21077', '21086', '2022-11-01 06:06:48', '2022-11-14 09:15:09', 'ans_c'),
(2041, NULL, 55, 1, '<p><strong>A 30-year-old has a recurrent dislocated right patella. He is in the hospital outpatient orthopedic center to have the patella reconstructed. The patient is placed under</strong></p>\r\n\r\n<p><strong>general anesthesia. An incision is made above the knee joint and extended to the tibial tuberosity. The dissection goes down through the soft tissue to gain access to the</strong></p>\r\n\r\n<p><strong>patellar tendon. The patellar tendon along with a thin piece of bone from the tibial tuberosity is resected. Then the tendon is reattached and anchored into the inner aspect of the tibia with staples. This tightens the tendon and improves stability of the knee. The incision is closed with Steri-Strips. The patient had no complications and</strong></p>\r\n\r\n<p><strong>was released after recovery. What is the correct CPT code?</strong></p>', '27558-RT', '27562-RT', '27422-RT', '27420-RT', '2022-11-01 06:07:34', '2022-11-14 09:15:24', 'ans_d'),
(2042, NULL, 55, 1, '<p><strong>2-year-old Charlie fell awkwardly off of the living room couch at home and would not move his right arm after the fall. X-rays at the emergency room revealed a shaft</strong></p>\r\n\r\n<p><strong>fracture of both the radius and ulna of his right arm. Fracture care treatment was provided, and the provider did not need to perform manipulation. What CPT&reg; code is</strong></p>\r\n\r\n<p><strong>reported?</strong></p>', '25560-RT', '25600-RT', '25565-RT', '25574-RT', '2022-11-01 06:08:19', '2023-02-25 06:57:51', 'ans_a'),
(2043, NULL, 55, 1, '<p><strong>11-year-old Jeff has a painful felon abscess of the deep tissues of the palmar surface of his right thumb. The provider makes an incision on one side of the nail and then</strong></p>\r\n\r\n<p><strong>across the fingertip parallel to the end of the nail. He identifies the area of abscess and drains it. A drainage tube is inserted. What CPT&reg;@ and ICD-10-CM codes are</strong></p>\r\n\r\n<p><strong>reported?</strong></p>', '26011-F5, L03.011', '10061-F5, L03.011', '10140-F5, L02.511', '26010-F5, L02.511', '2022-11-01 06:17:10', '2022-11-14 09:15:51', 'ans_a'),
(2044, NULL, 55, 1, '<p><strong>A patient presents with a broken pin in the right ankle. The patient is taken to the surgical suite and placed in the supine position. After local anaesthesia, the patient&rsquo;s</strong></p>\r\n\r\n<p><strong>right ankle is prepped and draped. A 1 cm incision is made and dissection is carried upto the bone, removing the broken pin. The wounds are thoroughly irrigated</strong></p>\r\n\r\n<p><strong>with antibiotic-containing saline. Skin is closed with adhesive strips.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Which CPT&reg; and diagnosis codes are reported for this procedure?</strong></p>', '20680, T84.9XXA', '20670, T84.69XA', '20670, T84.418A', '20680, T84.418A', '2022-11-01 06:17:55', '2023-10-26 05:13:03', 'ans_d'),
(2045, NULL, 55, 1, '<p><strong>The patient is brought to the ED with an obstructed airway. The provider immediately makes an incision through the cricothyroid membrane and inserts a tracheostomy</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>tube to assist the patient&rsquo;s breathing. What CPT &reg; code is reported for this scenario?</strong></p>', '31603', '31610', '31600', '31605', '2022-11-01 06:18:46', '2022-11-14 09:16:29', 'ans_d'),
(2046, NULL, 55, 1, '<p><strong>A patient with empyema requires an extrapleural thoracoplasty with closure of bronchopleural fistula.</strong></p>\r\n\r\n<p><strong>What CPT code is reported for this procedure?</strong></p>', '32906', '32905', '32999', '32900', '2022-11-01 06:19:16', '2022-11-14 09:16:44', 'ans_a'),
(2047, NULL, 55, 1, '<p><strong>A 9-year-old male was seen this morning in his pediatrician&rsquo;s office for control of a nosebleed with limited anterior packing in the left and right nares. What is the CPT&reg;</strong></p>\r\n\r\n<p><strong>coding for the procedure performed?</strong></p>', '30901-50', '30903, 30903-51', '30903-50', '30901, 30901-59', '2022-11-01 06:19:56', '2022-11-14 09:17:05', 'ans_a'),
(2048, NULL, 55, 1, '<p><strong>A catheter was placed into the abdominal aorta via the right common femoral artery access. The catheter was used to selectively catheterize only the right renal artery.</strong></p>\r\n\r\n<p><strong>Selective right renal angiography was then performed, demonstrating a widely patent right renal artery.</strong></p>\r\n\r\n<p><strong>What is proper CPT&reg; coding?</strong></p>', '36251', '36252, 75625', '36253, 75625', '36245', '2022-11-01 06:20:28', '2022-11-14 09:17:18', 'ans_a'),
(2049, NULL, 55, 1, '<p><strong>A patient diagnosed with four pleural tumors on the left and right lungs is in the outpatient operating room to have them ablated. Under magnetic resonance imaging</strong></p>\r\n\r\n<p><strong>guidance, the cryoprobe is positioned and the physician uses cold gas to freeze the tumors, destroying all of them. What is the CPT coding for ablation of the lung tumors?</strong></p>', '32998 x 4', '32994-50', '32998-50', '32994 x 4', '2022-11-01 06:21:14', '2022-11-14 09:17:32', 'ans_b'),
(2050, NULL, 55, 1, '<p><strong>Ms. Barnes is an established patient and saw her primary care physician two weeks ago. She calls her physician on the phone and wants to know if she can take another</strong></p>\r\n\r\n<p><strong>medication that will not conflict with her blood pressure medication. Her physician discusses the pros and cons of taking the other medication and suggests another type</strong></p>\r\n\r\n<p><strong>of medication that can be taken along with her blood pressure meds. The total time spent on the phone is 12 minutes. How is this reported?</strong></p>', '99441', '99447', '99442', '99446', '2022-11-01 06:21:56', '2023-06-29 02:24:09', 'ans_c'),
(2051, NULL, 55, 1, '<p><strong>A patient is seen in her physician&rsquo;s office for her scheduled monthly vitamin B12 injection. The RN administers 1000mcg vitamin B12 IM in her left upper arm under the</strong></p>\r\n\r\n<p><strong>physician&#39;s supervision. The patient supplied the medication. How is this scheduled injection visit reported?</strong></p>', '99212-25, 90460, J3420', '99212-25, 96373', '99211-25, 96372, J3420', '99211-25, 90471, J3420', '2022-11-01 06:22:33', '2023-02-28 09:07:30', 'ans_c'),
(2052, NULL, 55, 1, '<p><strong>A 20-year-old female is being seen for the first time by a primary care physician to have a yearly physical. During the examination for the physical, the provider discovers lesions on her legs and arms. The physician performs a complete physical and additional separate documentation for the treatment of the lesions providing a focused history and an exam of the bilateral upper and lower extremities. The provider decides they are low risk and will continue to watch them. What CPT&nbsp;coding is reported for this visit?</strong></p>', '99385, 99202-25', '99202', '99385-25, 99202', '99385', '2022-11-01 06:23:33', '2023-10-09 01:37:28', 'ans_a'),
(2053, NULL, 55, 1, '<p><strong>A 15-year-old female just moved to the area and is living in a campground with her parents. She has several medical conditions and the parents are unable to take her to</strong></p>\r\n\r\n<p><strong>a physician&#39;s office. A physician sees the patient in the campground and documents a comprehensive history and physical. Medical decision making is moderate</strong></p>\r\n\r\n<p><strong>complexity. After the visit, the physician spends an additional 25 minutes in a prolonged discussion with the patient&rsquo;s parents; he reviews complex and detailed medical</strong></p>\r\n\r\n<p><strong>records from her previous physicians and completes a comprehensive treatment plan. A care plan with the local health agency and a dietician is initiated. What E/M</strong></p>\r\n\r\n<p><strong>coding is reported for this visit?</strong></p>', '99203, 99354', '99344, 99354', '99344', '99205, 99354', '2022-11-01 06:26:13', '2023-02-25 06:55:53', 'ans_c'),
(2054, NULL, 55, 1, '<p><strong>The patient is a 37-year-old female who presents for follow-up of lower extremity swelling. She has a history of dyslipidemia and chronic pain. The patient has had</strong></p>\r\n\r\n<p><strong>bilateral LE swelling. She states that the swelling has responded well to hydrochlorothiazide. Her latest ECG was reviewed and she does have moderate pulmonary hypertension. I was able to speak with her cardiologist during her visit and we have decided it would be in her best interest to determine the cause of the pulmonary hypertension. I will order a sleep study prior to referring to a pulmonologist.</strong></p>\r\n\r\n<p><strong>Bilateral lower extremity swelling has resolved.</strong></p>\r\n\r\n<p><strong>Unknown etiology for pulmonary hypertension. Patient has referral and order for sleep study. Patient to return after study to discuss findings.</strong></p>\r\n\r\n<p><strong>What CPT&nbsp;code is reported?</strong></p>', '99214', '99213', '99203', '99204', '2022-11-01 06:27:02', '2023-10-03 00:16:21', 'ans_a'),
(2055, NULL, 55, 1, '<p><strong>An ophthalmologist conducts scanning computerized ophthalmic diagnostic imaging of the anterior segments of both eyes with interpretation and report. What CPT&reg;</strong></p>\r\n\r\n<p><strong>code is reported for the procedure?</strong></p>', '92133', '92133-50', '92132', '92132-50', '2022-11-01 06:27:56', '2022-11-14 09:21:10', 'ans_c'),
(2056, NULL, 55, 1, '<p><strong>The patient presents for a follow-up echocardiogram. Echocardiography, transthoracic, real-time with image documentation with M-mode recording is performed. What is</strong></p>\r\n\r\n<p><strong>the correct CPT&reg; code for the test the physician ordered?</strong></p>', '93304', '93308', '93306', '93307', '2022-11-01 06:28:28', '2022-11-14 09:21:23', 'ans_b'),
(2057, NULL, 55, 1, '<p><strong>A patient with supraventricular tachycardia has a comprehensive electrophysiologic study (EPS) with ablation for slow AV pathway and 3-D mapping. What CPT&reg; coding</strong></p>\r\n\r\n<p><strong>is reported?</strong></p>', '93654, 93613', '93653, 93613', '93654', '93653', '2022-11-01 06:29:03', '2023-02-21 08:43:03', 'ans_d'),
(2058, NULL, 55, 1, '<p><strong>A 5-year-old is brought to the emergency department for treatment of an open fracture of the left distal radius. Due to the nature of the injury and the anxiety of the</strong></p>\r\n\r\n<p><strong>patient, it was decided to place the patient under sedation to properly evaluate and treat the injury. The ED physician provided moderate conscious sedation with assistance of a nurse to monitor the patient&#39;s vitals and the ED physician sets the fracture. The patient was under sedation for 45 minutes. What CPT&reg; codes does the ED</strong></p>\r\n\r\n<p><strong>physician report for the moderate sedation?</strong></p>', '99152, 99153-51 x 2', '99156, 99157 x2', '99152, 99153 x2', '99156, 99157-51 x 2', '2022-11-01 06:29:46', '2023-02-27 09:47:07', 'ans_c'),
(2059, NULL, 55, 1, '<p><strong>A 7-year-old male with a heart murmur and fatigue since birth has a transesophageal echocardiography (TEE). Doppler echocardiography is also performed with color flow velocity mapping. Pulmonary valve stenosis is diagnosed. What CPT&nbsp;codes are reported?</strong></p>', '93318, 93320', '93315, 93325', '93315, 93325, 93320', '93315, 93320', '2022-11-01 06:30:41', '2023-10-11 23:26:34', 'ans_b'),
(2060, NULL, 56, 1, '<p><strong>A 6-year-old male with a heart murmur and fatigue since birth has a transesophageal echocardiography (TEE).&nbsp;Pulmonary valve stenosis is diagnosed. What CPT&nbsp;codes are reported?</strong></p>', '93318, 93320', '93315', '93315, 93320', '93318, 93325', '2022-11-01 06:31:33', '2023-10-11 23:27:42', 'ans_b'),
(2061, NULL, 56, 1, '<p><strong>A 5-year-old child returns to her pediatrician for a comprehensive routine well-child visit exam. The pediatrician does not counsel the mother about the vaccinations and administers the DTaP by intramuscular route, MMR (live) immunization subcutaneous route, and varicella by subcutaneous route. What CPT &reg; codes are reported for this encounter?</strong></p>', '99215-25, 90700, 90710, 90460 x 3', '99393-25, 90700, 90707, 90716, 90471, 90472 x 2', '99393-25, 90700, 90710, 90716, 90460 x 3, 90461 x 4', '99393-25, 90715, 90707, 90716, 90471 x 3', '2022-11-01 06:32:15', '2022-11-14 09:23:45', 'ans_b'),
(2062, NULL, 56, 1, '<p><strong>A CRNA is personally performing a case without supervision of an anesthesiologist. What modifier is reported for the CRNA services?</strong></p>', 'QZ', 'QY', 'QX', 'QS', '2022-11-01 06:32:51', '2022-11-14 09:24:15', 'ans_a'),
(2063, NULL, 56, 1, '<p><strong>A patient presents to the labor and delivery department for a planned cesarean section for triplets. She is at 37 weeks gestation. She is given a continuous epidural for</strong></p>\r\n\r\n<p><strong>the delivery.</strong></p>\r\n\r\n<p><strong>What anesthesia coding is reported?</strong></p>', '01961', '01967, 01968', '01967', '01958', '2022-11-01 06:34:32', '2022-11-14 09:24:31', 'ans_a'),
(2064, NULL, 56, 1, '<p><strong>A 40-year-old woman with progressive sensory neural hearing loss in the right ear since the age of 13 has not gained benefit from her hearing aid. She has normal hearing in the left ear. A cochlear implant is placed in the right ear. What anesthesia CPT@ and ICD-10-CM codes are reported?</strong></p>', '00120, H90.41', '00126, H90.41', '00300, H90.72', '00210, H90.72', '2022-11-01 06:35:05', '2022-11-14 09:24:44', 'ans_a'),
(2065, NULL, 56, 1, '<p><strong>An 18 year old involved in a motorcycle accident presents to the OR with a compound fracture of the left lower third of the femur. The bone is exposed through a wound</strong></p>\r\n\r\n<p><strong>in the skin. After induction of general endotracheal anesthesia, the surgeon debrides the skin and bone and extends the open wound to expose the bone further. The bone</strong></p>\r\n\r\n<p><strong>is debrided, aligned, and secured with plates and screws. After extensive irrigation with antibiotics, the wound is closed. What anesthesia code is reported?</strong></p>', '01230', '01340', '01220', '01360', '2022-11-01 06:35:38', '2022-11-14 09:25:02', 'ans_d'),
(2066, NULL, 56, 1, '<p><strong>Office Visit</strong></p>\r\n\r\n<p><strong>Chief Complaint: Prior to arrival, the patient sustained a laceration to the chin while playing at the park. The patient complains of mild pain. No loss of consciousness or</strong></p>\r\n\r\n<p><strong>neck pain. All systems otherwise negative.</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAM: Appearance: Alert. No acute distress. Attentive. The patient makes eye contact. Eyes: Pupils equal, round, reactive to light. EOM intact. ENT: No</strong></p>\r\n\r\n<p><strong>dental injury. Normal external inspection.</strong></p>\r\n\r\n<p><strong>LACERATION REPAIR: Wound depth/shape - linear 3.5 cm length. Anesthesia provided using 1% lidocaine with epi. Prepped with Betadine. Wound irrigated with normal</strong></p>\r\n\r\n<p><strong>saline. Closure of superficial layer with 6-0 (3 sutures). Protect wound and keep wound area clean. You may wash wounds briefly, then dry. Apply Neosporin twice daily.</strong></p>\r\n\r\n<p><strong>Sutures should be removed in seven days.</strong></p>\r\n\r\n<p><strong>What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '12013, S01.82XA, Y92.830', '12001, S01.81XA, Y92.830', '12020, S01.91XA, Y92.830', '12013, S01.81XA, Y92.830', '2022-11-01 06:36:49', '2022-11-14 09:25:16', 'ans_d'),
(2067, NULL, 56, 1, '<p><strong>Operative Report</strong></p>\r\n\r\n<p><strong>PRE-OP DIAGNOSIS: unstable RIGHT bimalleolar fracture dislocation</strong></p>\r\n\r\n<p><strong>POST-OP DIAGNOSIS: same</strong></p>\r\n\r\n<p><strong>PROCEDURE(S) PERFORMED: RIGHT ankle external fixation</strong></p>\r\n\r\n<p><strong>Anesthesia: General</strong></p>\r\n\r\n<p><strong>Estimated Blood Loss: 15 ml</strong></p>\r\n\r\n<p><strong>Findings: as below</strong></p>\r\n\r\n<p><strong>Specimens: none</strong></p>\r\n\r\n<p><strong>Complications: none</strong></p>\r\n\r\n<p><strong>Inherent Occurrences : None</strong></p>\r\n\r\n<p><strong>INDICATIONS: 57-year-old female status post fall downstairs with right bimalleolar fracture dislocation status post failed attempted reduction in the emergency</strong></p>\r\n\r\n<p><strong>department. I reviewed this with her and her daughter and discussed treatment options both operative and non-operative and recommended operative reduction and</strong></p>\r\n\r\n<p><strong>fixation with external fixture to temporizing stabilize her ankle with delayed internal fixation. I discussed the risks of the procedure as well as the postop rehabilitation in</strong></p>\r\n\r\n<p><strong>detail answered all their questions and they wished to proceed.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>PROCEDURE: Patient identified preoperatively her upper extremities marked by myself preoperative Ancef was given she is brought to the operating room where after</strong></p>\r\n\r\n<p><strong>induction anesthesia she was placed supine on the operating room table with a bump under operative hip and upper are thigh tourniquet was placed. She was then</strong></p>\r\n\r\n<p><strong>prepped and draped in usual standard sterile fashion with ChloraPrep. After surgical time-out I utilized fluoroscopy to localize for the tibial half pins. I made skin incisions</strong></p>\r\n\r\n<p><strong>bluntly dissected to the tibia and placed 2 Schanz pins into the tibia bicortically. I confirmed their position fluoroscopically. I then under fluoroscopic guidance placed 1</strong></p>\r\n\r\n<p><strong>medial lateral trans calcaneal pin. Once this was complete, I assembled the external fixator reduced the ankle into an anatomic position and tightened all the connections.</strong></p>\r\n\r\n<p><strong>X-ray showed an excellent reduction of the fracture with the pins in appropriate position. Pin sites were dressed with Xeroform and a dry sterile compressive dressing and</strong></p>\r\n\r\n<p><strong>she was woken from anesthesia and taken the PACU in stable condition the tourniquet was not used.</strong></p>\r\n\r\n<p><strong>Postoperatively she will receive 24 hours of Ancef pin care to start postoperative day 2 or prior to discharge if tomorrow. She has follow-up in 1 week for skin check. If</strong></p>\r\n\r\n<p><strong>she is still in-house later this week, we can proceed with ORIF if the skin and soft tissues allow. Lovenox for DVT prophylaxis.</strong></p>\r\n\r\n<p><strong>Signed by XXXXX, MD at 06/01/20XX 12:38PM</strong></p>\r\n\r\n<p><strong>What CPT&reg; coding is reported?</strong></p>', '27823', '27808', '27818', '27810', '2022-11-01 06:38:44', '2022-11-14 09:25:30', 'ans_d'),
(2068, NULL, 56, 1, '<p><strong>Operative Report</strong></p>\r\n\r\n<p><strong>Patient: 64-year-old male</strong></p>\r\n\r\n<p><strong>Procedure: INSERTION VENOUS ACCESS DEVICE</strong></p>\r\n\r\n<p><strong>PREOPERATIVE DIAGNOSIS: Metastatic pancreatic cancer</strong></p>\r\n\r\n<p><strong>POSTOPERATIVE DIAGNOSIS AND FINDINGS: same</strong></p>\r\n\r\n<p><strong>PROCEDURE: Left subclavian 8 French PowerPort placement with fluoroscopic guidance</strong></p>\r\n\r\n<p><strong>ANESTHESIA: MAC</strong></p>\r\n\r\n<p><strong>EBL: Minimal</strong></p>\r\n\r\n<p><strong>SPECIMEN: none</strong></p>\r\n\r\n<p><strong>DESCRIPTION:</strong></p>\r\n\r\n<p><strong>In supine position prepped &amp; draped usual sterile manner. Half percent Marcaine with epinephrine infiltrated locally. Left subclavian vein accessed with 18-gauge needle,</strong></p>\r\n\r\n<p><strong>guidewire inserted under fluoroscopic guidance into the superior vena cava. Subcutaneous pocket created with electrocautery. Vein dilator and sheath introduced, dilator</strong></p>\r\n\r\n<p><strong>and guidewire removed. Port inserted to 20 cm depth; position of tip confirmed in superior vena cava with fluoroscopic guidance. Venous blood easily aspirated;</strong></p>\r\n\r\n<p><strong>heparinized saline flushed. Good hemostasis noted, skin closed with 3-0 Vicryl deep dermal and 5-0 Vicryl subcuticular.</strong></p>\r\n\r\n<p><strong>Tolerated well, stable to recovery area.</strong></p>\r\n\r\n<p><strong>XXX, M.D.</strong></p>\r\n\r\n<p><strong>What CPT&reg; coding is reported for this procedure?</strong></p>', '36561', '36571', '36570', '36563', '2022-11-01 06:40:53', '2023-03-24 10:57:23', 'ans_a'),
(2069, NULL, 56, 1, '<p><strong>Emergency Department Visit</strong></p>\r\n\r\n<p><strong>A 48 yrs old male visit to ED with the complaint of Neck Pain. Patients&#39; condition relieved by elevation. Patient denies clavicle pain, shoulder pain, elbow pain. Patient states wrist pain is present. Patient denies hand pain. Patient denies finger pain. Distal neuro c/o, proximal</strong></p>\r\n\r\n<p><strong>injury, distal injury.</strong></p>\r\n\r\n<p><strong>PAST MEDICAL HISTORY: Hypertension</strong></p>\r\n\r\n<p><strong>SOCIAL HISTORY: Widow. Lives in an apartment.</strong></p>\r\n\r\n<p><strong>REVIEW OF SYSTEMS</strong></p>\r\n\r\n<p><strong>CONSTITUTIONAL: No fever.</strong></p>\r\n\r\n<p><strong>CARDIOVASCULAR: No chest pain.</strong></p>\r\n\r\n<p><strong>RESPIRATORY: No SOB.</strong></p>\r\n\r\n<p><strong>MUSCULOSKELETAL: No neck pain.</strong></p>\r\n\r\n<p><strong>NEUROLOGIC: No dizziness.</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAM</strong></p>\r\n\r\n<p><strong>CONSTITUTIONAL: Patient is afebrile. Vital signs reviewed. Alert and oriented x 3.</strong></p>\r\n\r\n<p><strong>HEAD: Atraumatic. Normocephalic.</strong></p>\r\n\r\n<p><strong>EYES: Eyes are normal to inspection; pupils equal, round, and reactive to light; no discharge from eyes; extraocular muscles intact; sclerae are normal; conjunctivae are</strong></p>\r\n\r\n<p><strong>normal.</strong></p>\r\n\r\n<p><strong>ENT: No nasal deformity, no active bleeding from nares, no stridor, no trismus, mucus membranes moist, no drooling, able to handle secretions, no erythema, no</strong></p>\r\n\r\n<p><strong>swelling.</strong></p>\r\n\r\n<p><strong>NECK: Assessment includes: No meningeal signs. Normal ROM.</strong></p>\r\n\r\n<p><strong>RESPIRATORY CHEST: No respiratory distress.</strong></p>\r\n\r\n<p><strong>UPPER EXTREMITY: Wrist evaluation shows left wrist to have no hematoma, no erythema, no warmth; radial pulse intact; capillary refill less than 2 seconds; distal motor</strong></p>\r\n\r\n<p><strong>intact; distal sensory intact. Ecchymosis noted, volar, dorsal. Swelling noted, volar, dorsal. Tenderness to palpation, of radius, of ulna, of scaphoid. Active range of</strong></p>\r\n\r\n<p><strong>motion: Limited. Passive range of motion: Limited. Hand evaluation shows no deformity, no ecchymosis, no erythema, no swelling, no hematoma, no tenderness to</strong></p>\r\n\r\n<p><strong>palpation, full range of motion, radial pulse intact, ulnar pulse intact, capillary refill less.</strong></p>\r\n\r\n<p><strong>X-Ray ordered/reviewed: Fracture of the left radius. No dislocation.</strong></p>\r\n\r\n<p><strong>FRACTURE CARE: Decision for major surgery procedure performed by ED Physician. Closed treatment of Colles wrist fracture without manipulation completed. Short arm</strong></p>\r\n\r\n<p><strong>splint applied. Post cast neurovascular check. Capillary refill normal, distal sensation is intact, distal motor function is normal. Patient tolerated procedure well.</strong></p>\r\n\r\n<p><strong>DIAGNOSIS: Colles fracture, closed.</strong></p>\r\n\r\n<p><strong>PLAN: Discharge patient with fracture care instructions. Prescription of acetaminophen with codeine. To follow-up with orthopedic doctor for healing of fracture.</strong></p>\r\n\r\n<p><strong>What CPT&reg; codes are reported?</strong></p>', '99284-57, 25600-54', '99283-57, 29125-54', '99283-25, 25605-54', '99284-25, 29125-54', '2022-11-01 06:43:39', '2022-11-14 09:25:53', 'ans_a'),
(2070, NULL, 56, 1, '<p><strong>A 16-year-old needs a peripherally inserted venous access catheter for cancer treatment. The patient was placed in the supine position. Following the administration of light anesthesia, the right arm was prepped and draped in the usual fashion. Next, 50 cc of 1 percent Lidocaine with bicarb was infused in the skin and subcutaneous</strong></p>\r\n\r\n<p><strong>tissue and the basilic vein was punctured. Using Seldinger technique, the subclavian vein was cannulated on the first attempt. A J-wire passed easily under fluoroscopic guidance to the subclavian vein. The wound was closed with a 3-0 Vicryl. Benzoin and Steri-Strips were applied. Sponge and needle count correct. The patient was awakened from light anesthesia and taken to the recovery room in stable condition. Which CPT&reg; coding is reported?</strong></p>', '36570', '36571, 77001', '36573', '36569, 77001', '2022-11-01 06:45:37', '2022-11-14 09:26:10', 'ans_c'),
(2071, NULL, 56, 1, '<p><strong>Which one of the following is an infection that occurs in the respiratory system?</strong></p>', 'Meningitis', 'Endocarditis', 'Tuberculosis', 'Diverticulosis', '2022-11-01 06:48:52', '2022-11-14 09:26:25', 'ans_c'),
(2072, NULL, 56, 1, '<p><strong>Which body organ is NOT part of the digestive system?</strong></p>', 'Pancreas', 'Stomach', 'Kidney', 'Gallbladder', '2022-11-01 09:39:31', '2022-11-14 09:26:41', 'ans_c'),
(2073, NULL, 56, 1, '<p><strong>Which bone is located in the lower extremity?</strong></p>', 'Radius', 'Femur', 'Humerus', 'UIna', '2022-11-01 09:40:02', '2022-11-14 09:26:53', 'ans_b'),
(2074, NULL, 56, 1, '<p><strong>A colposcopy is a surgical technique for repairing what organ system?</strong></p>', 'Musculoskeletal', 'Pulmonary', 'Female genital', 'Cardiovascular', '2022-11-01 09:40:59', '2022-11-14 09:27:23', 'ans_c'),
(2075, NULL, 56, 1, '<p><strong>What is the purpose of venous valves?</strong></p>', 'To provide a pump assist to circulation', 'To slow the heart rate in patients with hypertension', 'To prevent the backflow of blood', 'To release hormones into the bloodstream', '2022-11-01 09:41:43', '2022-11-14 09:27:35', 'ans_c'),
(2076, NULL, 56, 1, '<p><strong>Jeffry comes into the emergency department (ED) with shortness of breath. An ECG is performed. The final diagnosis at discharge is impending myocardial</strong></p>\r\n\r\n<p><strong>infarction. According to ICD-10-CM guidelines, how is this reported?</strong></p>', 'R06.02', 'I21.3, R06.02', 'I20.0, R06.02', 'I20.0', '2022-11-01 09:44:50', '2023-06-07 01:01:58', 'ans_d'),
(2077, NULL, 56, 1, '<p><strong>&nbsp;John had an upper respiratory viral illness with severe coughing a month ago. The symptoms of the viral illness have been resolved for over two weeks. A few days after</strong></p>\r\n\r\n<p><strong>a bad coughing spell, he developed dyspnea occurring episodically throughout the day and night. The physician determines that the patient probably has viral pneumonia</strong></p>\r\n\r\n<p><strong>and he orders a chest X-ray. What is the ICD-10-CM code for this condition?</strong></p>\r\n\r\n<p>&nbsp;</p>', 'J12.9', 'J12.9, R06.00', 'J18.9', 'R06.00', '2022-11-01 09:45:50', '2022-11-14 09:28:28', 'ans_d'),
(2078, NULL, 56, 1, '<p><strong>Which diagnosis codes are reported for hypertension and acute renal failure?</strong></p>', 'I12.9, N18.9', 'I10, N17.9', 'I10, N19', 'I12.9, N17.9', '2022-11-01 09:46:22', '2022-11-14 09:28:42', 'ans_b'),
(2079, NULL, 56, 1, '<p><strong>42-year-old male present to his PCP due to passing frequent, small amounts of urine. The physician diagnosed him with urinary tract infection and prescribed ciprofloxacin 500 mg po q12h for 10 days. Two weeks later he presented to the physician with symptoms and tests showed he still had a urinary tract infection. On questioning, this patient only took the Cipro once a day and was saving pills for the next time he needed an antibiotic due to financial problems. He was given implicit instructions on how important it is to take what is prescribed. Report the correct diagnosis coding for this office visit.</strong></p>', 'T36.8X6D, N39.0', 'N39.0, T36.8X6A, Z91.120', 'N39.0, Z91.120', 'Z91.120, T36.8X6D', '2022-11-01 09:46:56', '2023-02-15 09:00:26', 'ans_b'),
(2080, NULL, 56, 1, '<p><strong>William patient presents to the urgent care facility with multiple burns acquired while burning debris in his backyard. After examination the physician determines the patient</strong></p>\r\n\r\n<p><strong>has third-degree burns of the left and right posterior thighs, (10%). He also has second-degree burns of the anterior portion of the right side of his chest wall (8%) and</strong></p>\r\n\r\n<p><strong>upper back (6%). TBSA is 24% with third-degree burns totaling 10%. What ICD-10-CM codes are reported according to 1CD-10-CM coding guidelines?</strong></p>', 'T21.21XA, T21.23XA, T24.311A, T24.312A, T31.21', 'T24.711A, T24.712A, T21.61XA, T31.63XA, T32.21', 'T24.311A, T24.312A, T21.21XA, T21.23XA, T31.21', 'T24.311A, T24.312A, T21.21XA, T21.23XA, T31.31', '2022-11-02 07:44:34', '2022-11-14 09:29:10', 'ans_c'),
(2081, NULL, 56, 1, '<p><strong>A 38 yrs old patient needs a stent replaced in his pancreatic duct. The physician performs an endoscopic retrograde cholangiopancreatography using a flexible fiber optic endoscope to remove and replace the stent in the pancreatic duct. What CPT code is reported?</strong></p>', '43276', '43274', '43264', '43275', '2022-11-02 07:45:03', '2022-11-14 09:29:33', 'ans_a'),
(2082, NULL, 56, 1, '<p><strong>The provider performs an adenotonsillectomy on a 20-month-old with a history of sleep disordered breathing. Which is the CPT coding reported?</strong></p>', '42825, 42830', '42825, 42835', '42821', '42820', '2022-11-02 07:46:00', '2022-11-14 09:47:41', 'ans_d'),
(2083, NULL, 56, 1, '<p><strong>A 38-year-old patient has symptoms of dysphagia and reflux and arrives for a flexible esophagoscopy. The gastroenterologist introduces a flexible scope through the mouth to examine the esophagus where he observes a stricture. He then introduces and performs 20 mm balloon dilation. What CPT&nbsp; code is reported for this procedure?</strong></p>', '43450', '43220', '43249', '43195', '2022-11-02 07:46:29', '2022-11-14 09:47:54', 'ans_b'),
(2084, NULL, 56, 1, '<p><strong>A patient had surgery for the repair of abdominal injuries after a car accident. A planned return was scheduled for two days after the initial surgery for a peritoneal lavage. The surgeon performs an exploratory surgery through the previous midline incision. He finds some gross infection and other inflammatory changes, but no leakage from the repairs. He performs peritoneal lavage, washing out the abdominal cavity with antibiotic solution. The fascia and skin are then reclosed. What is the correct CPT coding for the procedure performed?</strong></p>', '49084-54', '49084-78', '49084-76', '49084-58', '2022-11-02 07:47:05', '2022-11-14 09:48:07', 'ans_d'),
(2085, NULL, 56, 1, '<p><strong>A Medicare patient has a screening colonoscopy. The patient&rsquo;s mother has a history of colon cancer. What CPT and ICD-10-CM codes are reported for this encounter?</strong></p>', 'G0121, Z80.0, Z12.11', '45378, Z12.11, Z80.0', '45378, Z80.0, Z12.11', 'G0105, Z12.11, Z80.0', '2022-11-02 07:48:50', '2022-11-14 09:48:20', 'ans_d'),
(2086, NULL, 56, 1, '<p><strong>35-year-old has cholelithiasis and is in the operating suite for a cholecystectomy. An incision is started in the right upper abdomen and carried down to the gallbladder. The liver and gallbladder are exposed. Gallbladder is grasped and withdrawn over the liver. Cystic duct and artery are delineated, clipped on the gallbladder side and incised. Guided transhepatic cholangiography reveals no intraluminal defector or obstruction. Cystic duct triply clipped and transected. Gallbladder resected from the liver bed and removed. The incision is closed with layered sutures. What CPT&nbsp; codes are reported for the procedure performed?</strong></p>', '47000, 74300-26', '47563, 74300-26', '47562, 74300-26', '47605, 74300-26', '2022-11-02 07:49:42', '2022-11-14 09:48:35', 'ans_d'),
(2087, NULL, 56, 1, '<p><strong>A patient that delivered her third child vaginally has a history of having a previous caesarean delivery for the second child. What CPT code is reported for only the</strong></p>\r\n\r\n<p><strong>delivery of the third child?</strong></p>\r\n\r\n<p>&nbsp;</p>', '59620', '59612', '59514', '59409', '2022-11-02 09:50:01', '2022-11-14 09:48:49', 'ans_b'),
(2088, NULL, 56, 1, '<p><strong>A patient presents for a biopsy of her left ovary via open surgery through an abdominal approach. What CPT code is reported?</strong></p>', '58925', '58920', '58900', '49321', '2022-11-02 09:50:33', '2022-11-14 09:49:02', 'ans_c'),
(2089, NULL, 56, 1, '<p><strong>A patient is diagnosed with two bladder lesions. The physician performs a cystourethroscopy with fulguration and biopsy on a 0.3 cm bladder lesion and 0.4 cm bladder lesion. What CPT coding is reported?</strong></p>', '52224, 52204', '52224 x 2, 52204 x 2', '52224', '52224 x2', '2022-11-02 09:51:05', '2022-11-14 09:49:20', 'ans_c'),
(2090, NULL, 56, 1, '<p><strong>A 6-month-old patient has an undescended left testicle. Patient is placed under general anaesthesia. An inguinal incision is made, and attention is directed to the testicle on the left side. The testicle is not in the scrotum. The testicle is found in the inguinal canal. The spermatic cord is mobilised, and the testicle is then delivered into the operative field and examined. A sub Dartos pouch is created and the testicle is pexed at 3, 6, and 9 o&#39;clock positions with a 5-0 Prolene. The incision is closed with layered sutures. What CPT code is reported?</strong></p>', '54640-LT', '54692-LT', '54650-LT', '54690-LT', '2022-11-02 09:52:26', '2022-11-14 09:49:33', 'ans_a'),
(2091, NULL, 56, 1, '<p><strong>&nbsp;A pregnant patient is 12-weeks pregnant and presents to her obstetrician with bleeding. An examination and ultrasound confirm that she had a missed abortion. A cannula is placed in the endocervical canal and passes into the uterus. A suction machine is activated, evacuating products of conception.What CPT&reg; and ICD-10-CM codes are reported?</strong></p>', '59812, O03.1', '59820, O02.1', '59821, O02.1', '59851, O07.1', '2022-11-02 09:53:02', '2022-11-14 09:49:47', 'ans_b'),
(2092, NULL, 56, 1, '<p><strong>A 20-year-old male is diagnosed with a right renal mass that is compressing the liver. Patient is placed under general anesthesia and in a prone position. A periumbilical incision is made and a trocar inserted. A laparoscope is inserted and advanced to the operative site. The right kidney is removed, along with the right ureter. What CPT code is reported for this procedure?</strong></p>', '50220-RT', '50546-RT', '50543-RT', '50548-RT', '2022-11-02 09:53:37', '2022-11-14 09:50:00', 'ans_d'),
(2093, NULL, 56, 1, '<p><strong>A patient presents with the XOMED Audiant Bone Conductor, which requires replacement. This electromagnetic bone conduction hearing device was removed via a postauricular and replaced with a new electromagnetic conduction hearing device. The wound was irrigated and repaired with sutures. What is the correct procedural code?</strong></p>', '69710', '69717', '69714', '69711', '2022-11-02 09:54:11', '2022-11-14 09:50:23', 'ans_a'),
(2094, NULL, 56, 1, '<p><strong>A neurosurgeon placed a catheter in the lumbar spine after a craniotomy to drain cerebrospinal fluid. What CPT&reg; code is reported?</strong></p>', '62272', '62273', '62320', '62270', '2022-11-02 09:54:42', '2022-11-14 09:50:55', 'ans_a'),
(2095, NULL, 56, 1, '<p><strong>A lesion is getting larger on the helix of the left ear for this 29-year-old male. Decision is made to remove the lesion. The surgeon removes a portion of the ear with the</strong></p>\r\n\r\n<p><strong>lesion and repairs the wound with a single layer closure. How is the procedure reported?</strong></p>', '69110, 12011-51', '69110', '69145', '69145, 12011-51', '2022-11-02 09:55:23', '2023-07-26 00:02:47', 'ans_b'),
(2096, NULL, 56, 1, '<p><strong>Ms. Anjela has chronic abdominal pain and the decision is made for her to receive intrathecal pain therapy. Dr. W surgically implants a drug-filled nonprogrammable pump within the abdomen that releases a measured dose of pain medication through a catheter at programmed intervals. What coding is reported?</strong></p>', '62367', '62350', '62361', '62360', '2022-11-02 09:56:03', '2022-11-14 09:51:28', 'ans_c'),
(2097, NULL, 56, 1, '<p><strong>A 30-year-old sustained a left-hand injury and left-foot injury at work damaging his sensory nerves. A surgeon repairs the nerve in his left hand and the nerve in his left</strong></p>\r\n\r\n<p><strong>foot. What CPT coding is reported?</strong></p>', '64834, 64837', '64834, 64837-51', '64834 x 2', '64837 x 2', '2022-11-02 09:57:28', '2022-11-14 09:51:42', 'ans_a'),
(2098, NULL, 56, 1, '<p><strong>A 38-year-old male presents to the OR for a partial corpectomy on two lumbar vertebrae. Two surgeons are performing the surgery. One surgeon performs the transperitoneal approach, excises the damaged portion of the vertebrae, and then removes the discs above and below the vertebrae, inserting bolts in both areas. The second surgeon inserts a bone graft into the vertebral gap, closing the gap and inserting a metal plate. Both surgeons work together, each as a primary surgeon. How does each surgeon report their portion of the surgery?</strong></p>', '63090-62, 63091-62', '63087-80, 63088-80', '63087-62, 63088-62', '63090-66, 63091-66', '2022-11-02 10:02:41', '2023-02-21 08:45:32', 'ans_a'),
(2099, NULL, 56, 1, '<p><strong>In this procedure, the provider uses ultrasound guidance to insert a fine needle through a pregnant patient&rsquo;s abdomen and into the uterus to obtain fluid from the amniotic sac surrounding the fetus. Imaging supervision and interpretation is done by the provider and placed in the medical record. What radiology code is reported fo this service?</strong></p>', '76942', '76946', '76941', '76948', '2022-11-02 10:04:32', '2023-02-25 06:52:11', 'ans_b'),
(2100, NULL, 56, 1, '<p><strong>A 46 year old is in the outpatient radiology center to have a PET with CT for acquired attenuation correction and anatomic correlation of his chest for lung cancer. What</strong></p>\r\n\r\n<p><strong>radiology code is reported?</strong></p>', '78814', '78811', '78815', '78812', '2022-11-02 10:05:18', '2022-11-14 09:52:42', 'ans_a'),
(2101, NULL, 56, 1, '<p><strong>A core needle biopsy of an intra-abdominal mass is performed under CT guidance. How is this reported?</strong></p>', '10009', '10009, 77012', '49180, 77012', '49180, 74150', '2022-11-02 10:06:51', '2022-11-14 09:52:56', 'ans_c'),
(2102, NULL, 56, 1, '<p><strong>A pregnant patient is diagnosed with a weakened cervix and is being monitored for suspected preterm labor. She is in her third trimester. The obstetrician performs a</strong></p>\r\n\r\n<p><strong>transvaginal ultrasound and a Biophysical Profile with Non-stress test to verify the well-being of the fetus. What CPT and ICD-10-CM codes are reported?</strong></p>', '76818, O60.03', '76818, 76817, O34.43', '76818, 76815, O60.03', '76819, 59025, 76815, O34.43', '2022-11-02 10:07:33', '2022-11-14 09:53:10', 'ans_b'),
(2103, NULL, 56, 1, '<p><strong>CT images were taken of the abdomen and pelvis with administration of oral contrast only. What is the correct radiology coding according to CPT&reg; Radiology Guidelines?</strong></p>\r\n\r\n<p>&nbsp;</p>', '74177', '74176', '74150, 72192', '74160, 72193', '2022-11-02 10:08:08', '2023-02-15 08:56:53', 'ans_b'),
(2104, NULL, 56, 1, '<p><strong>The procedure is performed at an outpatient radiology department. From a left femoral access, the catheter is placed in the abdominal aorta and is then selectively placed</strong></p>\r\n\r\n<p><strong>in the celiac trunk and manipulated up into the common hepatic artery for an abdominal angiography. Dye is injected, and imaging is obtained. The provider performs the</strong></p>\r\n\r\n<p><strong>supervision and interpretation. What CPT&reg; codes are reported?</strong></p>\r\n\r\n<p>&nbsp;</p>', '36245, 75716-26', '36246, 75726-26', '36245, 75741-26', '36247, 75716-26', '2022-11-02 10:09:01', '2022-11-14 09:53:43', 'ans_b'),
(2105, NULL, 56, 1, '<p><strong>A provider orders a sweat chloride test on a patient that has Addison&rsquo;s disease. The lab analyst performs the test which measures the chloride in the collected sweat.</strong></p>\r\n\r\n<p><strong>Which CPT&reg; code is reported?</strong></p>', '82436', '89230', '82438', '82435', '2022-11-02 10:09:34', '2022-11-14 09:54:07', 'ans_c'),
(2106, NULL, 56, 1, '<p><strong>&nbsp;Lab results of a urine test of total proteins reveals abnormally high levels of ketones in a diabetic patient. Based on the results, the physician takes a blood sample from</strong></p>\r\n\r\n<p><strong>the patient by finger stick and a drop of blood was placed on the reagent strip to test for glucose levels. The ordering physician compared the reagent strip to a colour</strong></p>\r\n\r\n<p><strong>Chart. What code is reported?</strong></p>', '82951', '82962', '82948', '82947', '2022-11-02 10:10:22', '2022-11-14 09:55:07', 'ans_c'),
(2107, NULL, 56, 1, '<p><strong>A physician is performing a yearly exam on a male patient and orders a comprehensive panel and a phosphate (phosphorus inorganic) test to be performed in an outside</strong></p>\r\n\r\n<p><strong>lab. How does the lab report these services?</strong></p>', '80053, 84100', '80069', '80053, 80069', '80053', '2022-11-02 10:13:37', '2022-11-14 09:55:21', 'ans_a'),
(2108, NULL, 56, 1, '<p><strong>A pathologic gross and microscopic examination is performed on a single bone marrow biopsy. The specimen also requires a decalcification process. The decalcification</strong></p>\r\n\r\n<p><strong>process is performed on four blocks of the same specimen. What CPT&reg; codes are reported?</strong></p>', '88305, 88311', '88307 x 4, 88311 x4', '88305 x 4, 88311 x 4', '88307, 88311', '2022-11-02 10:14:17', '2022-11-14 09:55:53', 'ans_a'),
(2109, NULL, 57, 1, '<p><strong>A 45-year-old male patient presents to his urologist to discuss a vasectomy. He was accompanied by his wife who reported that they currently do not have any plans for</strong></p>\r\n\r\n<p><strong>children. The urologist discussed the option of cryopreservation to store his sperm/semen prior to the vasectomy. Preserving samples may allow the couple to have children without undergoing an invasive re-attachment procedure. The couple discussed this option and decided to preserve the husband&rsquo;s sperm with a banking facility. The husband&#39;s specimen is transported to the cryopreservation banking facility, and his sperm will undergo cryopreservation and be stored at this facility for at least one year.</strong></p>\r\n\r\n<p><strong>What CPT code is reported?</strong></p>', '89259', '89343', '89259, 89343', '89343x2', '2022-11-02 10:15:07', '2023-10-04 00:33:06', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(2110, NULL, 57, 1, '<p><strong>A patient presents to the office with dysuria and slight nausea. The physician thinks she has an UTI. The physician performs a non-automated urinalysis with microscopy,</strong></p>\r\n\r\n<p><strong>which reads negative. The final diagnosis is a ruled out UTI.</strong></p>\r\n\r\n<p><strong>The appropriate procedure and diagnosis coding for this encounter is:</strong></p>', '81002, N39.0', '81002, N39.0, R30.0, R11.0', '81007, R30.0, R11.0', '81000, R30.0, R11.0', '2022-11-02 10:16:02', '2022-11-14 09:57:16', 'ans_d'),
(2111, NULL, 57, 1, '<p><strong>What is the HCPCS Level II code for a long arm fiberglass cast for a 24-year-old patient?</strong></p>', 'Q4006', 'Q4005', 'Q4008', 'Q4012', '2022-11-02 10:16:56', '2023-02-13 08:22:46', 'ans_a'),
(2112, NULL, 57, 1, '<p>Mrs. Strong is in a skilled nursing facility and is having shortness of breath and chest pain. The doctor at the facility arranges for her to be transported by advanced life support emergency transport from the skilled nursing facility to the hospital. Doctor provided information to the patient&#39;s family about the mental treatment of the p[atient to be provided. How is this coded?</p>', 'A0427-HS-QM', 'A0429-QN-HS', 'A0428-QN-SH', 'A0427-QN-SH', '2022-11-02 10:17:39', '2023-08-01 01:09:55', 'ans_a'),
(2113, NULL, 57, 1, '<p><strong>A patient presents to the office for an injection of ceftriaxone sodium for a UTI. The nurse reviews the physician&#39;s order and administers 250 mg of ceftriaxone sodium. The route of administration is IM. Which codes report the treatment?</strong></p>\r\n\r\n<p>&nbsp;</p>', '90473, 10696', '96372, J0695 x 5', '96365, 10698 x 250', '96372, J0696', '2022-11-02 10:18:31', '2022-11-14 09:57:53', 'ans_d'),
(2114, NULL, 57, 1, '<p><strong>HIPAA provides which service?</strong></p>', 'Governs physician self-referral for Medicare patients', 'Prevents identity theft', 'Protects patients against fraud and abuse', 'Protects the privacy of individually identifiable health information', '2022-11-02 10:19:26', '2022-11-14 09:58:04', 'ans_d'),
(2115, NULL, 57, 1, '<p><strong>A(n)______ is a digital version of a patient&rsquo;s medical chart.</strong></p>', 'Health information technology', 'Information technology record', 'Electronic health record', 'Fax', '2022-11-02 10:19:58', '2022-11-14 09:58:17', 'ans_c'),
(2116, NULL, 57, 1, '<p><strong>What entity offers compliance program guidance to form the basis of a voluntary compliance program for a provider practice?</strong></p>', 'Centers for Medicare & Medicaid Services (CMS)', 'Office of Inspector General (OIG)', 'Office for Civil Rights (OCR)', 'American Medical Association (AMA)', '2022-11-02 10:20:37', '2022-11-14 09:58:29', 'ans_a'),
(2117, NULL, 57, 1, '<p><strong>A 45-year-old female has chronic obstruction of the bile ducts. An open surgery via incision is made over the right upper quadrant. The gallbladder and liver bed were</strong></p>\r\n\r\n<p><strong>inspected with normal findings except that the common bile duct is dilated with an apparent obstruction. The bile duct is dissected from its attachments at both the gallbladder and the intestine. A loop of small bowel was brought up to the gallbladder fossa and was tacked to the surface of the gallbladder. A cholecystotomy was performed and bile returned from the gallbladder.</strong></p>\r\n\r\n<p><strong>An enterotomy was made in the jejunum, and a two-layer anastomosis was performed. The patient tolerated the procedure without difficulty. What CPT&reg; code is</strong></p>\r\n\r\n<p><strong>reported for this surgery?</strong></p>', '47570', '47720', '47800', '44130', '2022-11-02 10:21:24', '2022-11-14 09:58:41', 'ans_b'),
(2118, NULL, 57, 1, '<p><strong>PREOPERATIVE AND POSTOPERATIVE DIAGNOSIS: Grade 1 endometrial cancer.</strong></p>\r\n\r\n<p><strong>PROCEDURE: Radical hysterectomy and pelvic lymph node sampling.</strong></p>\r\n\r\n<p><strong>ANESTHESIA: General.</strong></p>\r\n\r\n<p><strong>ESTIMATED BLOOD LOSS: 400 mL.</strong></p>\r\n\r\n<p><strong>COMPLICATIONS: None.</strong></p>\r\n\r\n<p><strong>SPECIMENS: Submitted to the laboratory labeled as pelvic washings, uterus, tubes, ovaries, and pelvic lymph nodes.</strong></p>\r\n\r\n<p><strong>FLUIDS ADMINISTERED: 2 L crystalloid.</strong></p>\r\n\r\n<p><strong>DESCRIPTION OF PROCEDURE: Patient was placed under general anesthesia. She was converted to a frog-leg position perineum and prepped in a sterile fashion. A transurethral Foley catheter was then placed. A midline vertical incision was made from the umbilicus to the symphysis, and the abdomen was entered. The peritoneum over the left and right paracolic gutter, surface of the spleen, liver, and left and right hemidiaphragm were normal. The gallbladder did not contain stones. The small bowel was examined from the ligament of Treitz to the ileocecal valve and was normal. There was no paraaortic adenopathy. The omentum was normal, both kidneys were palpable. Examination of the pelvis and perineum revealed normal peritoneum in all 4 quadrants. The uterus was well-suspended; it was normal in size. There was no obvious tumor. Both adnexa were normal. The Bookwalter&reg; retractor was placed. Bowel was packed into the abdomen. Washings were collected using normal saline.</strong></p>\r\n\r\n<p><strong>The uterus was grasped with Kocher clamps. The right round ligament was transected with electrocautery. The retroperitoneal space were opened and fully developed. We saw no adenopathy. The ureter was visualized. The ovarian vessels were isolated, cross-clamped, transected, and ligated x 2 with 0 Vicryl&reg;. Similarly the left round ligament was transected with electrocautery, the retroperitoneal space was opened and fully developed with no adenopathy. Bladder flap was then taken down sharply with electrocautery. The uterine arteries, the uterosacral ligaments, and the cardinal ligaments were crossclamped with curved Heaney clamps, and pedicles were formed and ligated with 0 Vicryl&reg;. The uterus was removed, the vagina was closed with interrupted sutures of 0 Vicryl&reg;. We then performed lymph node sampling on the left followed by the right, all lymphatic tissue was removed from the bifurcation of the external and internal iliac artery down to the circumflex iliac vein and inferiorly to the obturator nerve. The uterus was inspected. It appeared the volume of the tumor occupying the endometrial surface was approximately 40%, with less than 50% myometrial invasion. The abdomen was irrigated and the fascia was closed with a running nonlocking suture of #1 PDS. The subcutaneous tissues were reapproximated with 2-0 Vicryl&reg;. The skin was closed using staples. The patient tolerated the procedure well and left the suite in good condition. What CPT codes are reported?</strong></p>', '58210, 38770', '58548, 38770', '58210', '58200', '2022-11-02 10:22:47', '2023-02-15 08:57:35', 'ans_c'),
(2119, NULL, 57, 1, '<p><strong>Preoperative Diagnosis: Chronic otitis media in the right ear</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Postoperative Diagnosis: Chronic otitis media in the right ear</strong></p>\r\n\r\n<p><strong>Procedure: Eustachian tube inflation</strong></p>\r\n\r\n<p><strong>Anaesthesia: General</strong></p>\r\n\r\n<p><strong>Blood Loss: Minimal</strong></p>\r\n\r\n<p><strong>Findings: Serous mucoid fluid</strong></p>\r\n\r\n<p><strong>Complications: None</strong></p>\r\n\r\n<p><strong>Indications: The patient is a 2-year-old who presented to the office with chronic otitis media refractory to medical management. The treatment will be eustachian tube inflation to remove the fluid. Risks, benefits, and alternatives were reviewed with the family, which include general anesthetic, bleeding, infection, tympanic membrane perforation, routine tubes, and need for additional surgery. The family understood these risks and signed the appropriate consent form.</strong></p>\r\n\r\n<p><strong>Procedure in Detail:</strong></p>\r\n\r\n<p><strong>After the patient was properly identified, he was brought into the operating room and placed supine. The patient was prepped and draped in the usual fashion. General anesthesia was administered via inhalation mask, and after adequate sedation was achieved, a medium-sized speculum was placed in the right ear and cerumen was removed atraumatically using instrument with operative microscope. The tube is dilated, an incision is made to the tympanum and thick mucoid fluid was suctioned. The patient was awakened after having tolerated the procedure well and taken to the recovery room in stable condition.</strong></p>\r\n\r\n<p><strong>What is the correct CPT code to report for this surgical procedure?</strong></p>', '69433-RT', '69420-RT', '69421-RT', '69436-RT', '2022-11-02 10:24:10', '2022-11-14 09:59:07', 'ans_c'),
(2120, NULL, 57, 1, '<p><strong>Type of Exam: Bilateral lower extremity venous ultrasound.</strong></p>\r\n\r\n<p><strong>Indication for Exam:</strong></p>\r\n\r\n<p><strong>Mrs. Walters is complaining of bilateral leg swelling.</strong></p>\r\n\r\n<p><strong>Exam: Duplex and color Doppler interrogation of bilateral lower extremity deep venous system was performed. Compressibility, augmentation, and color flow as well as Doppler flow was demonstrated within the common femoral, superficial femoral, proximal femoral, greater saphenous, and popliteal veins bilaterally. The paired peroneal and posterior tibial calf veins are patent bilaterally.</strong></p>\r\n\r\n<p><strong>What is the CPT code for this encounter?</strong></p>', '76882', '76882-50', '93970-50', '93970', '2022-11-02 10:25:09', '2022-11-14 09:59:24', 'ans_d'),
(2121, NULL, 57, 1, '<p><strong>Patient is a 52-year-old gentleman sent to me by his primary care physician for a consultation for possible poly-inflammatory arthropathy. He reports morning stiffness lasting 30 minutes on his right and left hands without any obvious correlation. Swelling and pain in both hands.</strong></p>\r\n\r\n<p><strong>He is on Azulfidine 1000 mg gam and 1500 mg ghs, Naprosyn 500 mg bid, lisinopril and quinine sulfate. He is off the Pravachol because he was having some right hip area muscle pain that improved with its resolution.</strong></p>\r\n\r\n<p><strong>Physical Examination: Revealed a stocky, middle-aged gentleman. Blood pressure: 140/80 mm Hg. Pulse: 90 beats/min. Weight: 295 Ib. Skin: The skin was notable for four scab-like lesions with slight loss of skin x4 a few millimeters in size on top of his scalp. No other lesion noted. Lymph nodes: Were negative in the head and neck. Chest: Lung clear. Heart: Revealed regular rate and rhythm. Abdomen: Nontender. No masses. No hepatosplenomegaly. Musculoskeletal: Some thickening at the first, second, third, and fifth PIPs of both hands but no tenderness. He had decent hand grip formation and strength in both hands. His other joints and soft tissue areas were</strong></p>\r\n\r\n<p><strong>unremarkable.</strong></p>\r\n\r\n<p><strong>Impression: Patient has poly-inflammatory arthropathy.</strong></p>\r\n\r\n<p><strong>Overall time spent with patient 60 minutes. More than half that time was counseling patient in going over other more significant products that could be used to treat his condition. He is scheduled for a complete blood count and comprehensive metabolic panel for medication and disease monitoring. He is currently off the Pravachol because it did improve his hip pain. Hip pain is returning and will restart the Pravachol. Letter sent to his primary care physician on his lab work and my findings.</strong></p>\r\n\r\n<p><strong>What E/M code is reported?</strong></p>', '99244, 99356', '99244, 99415', '99244, 99417', '99244', '2022-11-02 10:26:17', '2022-11-14 09:59:37', 'ans_d'),
