(2186, NULL, 48, 1, '<p>The mediastinum is:</p>', 'A small endocrine organ behind the heart.', 'A location in the chest, bounded by the sternum, diaphragm, and lungs', 'Both the heart and lungs', 'A part of the lymphatic system', '2022-11-03 07:08:58', '2022-11-03 07:08:58', 'ans_b'),
(2187, NULL, 48, 1, '<p>According to ICD-10-CM coding guidelines when is a poisoning code (T36-T50) NOT reported as a primary code?</p>', 'Accidental poisoning', 'Adverse effects', 'Assault poisoning', 'Intentional poisoning', '2022-11-03 07:09:31', '2022-11-03 07:09:31', 'ans_b'),
(2188, NULL, 48, 1, '<p>When a patient is asymptomatic and tests positive for COVID is code UO7.1 COVID-19 reported?</p>', 'No, report code Z01.84 Encounter for antibody response examination.', 'No, report code Z11.52 Encounter for screening for COVID-19.', 'No, report code Z20.822 Contact with and (suspected) exposure to COVID-19.', 'Yes, report U07.1 COVID-19 because the patient has tested positive and is considered to have the infection.', '2022-11-03 07:10:07', '2022-11-03 07:10:07', 'ans_d'),
(2189, NULL, 48, 1, '<p>A patient is seen in the ED and then admitted to observation by the ED provider. According to the Initial Observation CPT&reg; guidelines, what is reported?&nbsp;</p>', 'Only a code from 99221-99223', 'A code from 99281-99285 and a code from 99201-99205', 'A code from 99202-99205 and a code from 99218-99220', 'Only a code from 99281-99285', '2022-11-03 07:10:46', '2023-05-31 23:36:10', 'ans_a'),
(2190, NULL, 48, 1, '<p>A CRNA Is personally performing a case without supervision of an anaesthesiologist. What modifier is reported for the CRNA services?</p>', 'QY', 'QX', 'QS', 'QZ', '2022-11-03 07:11:28', '2022-11-03 07:11:28', 'ans_d'),
(2191, NULL, 48, 1, '<p>The patient is diagnosed with Trichomycosis. The patient has?</p>', 'Diffuse red skin', 'Skin tumour', 'Inflammation of the nail and nail bed', 'Fungal infection of the hair', '2022-11-03 07:12:12', '2022-11-03 07:12:12', 'ans_d'),
(2192, NULL, 57, 1, '<p><strong>Which approach is used to perform an upper gastrointestinal endoscopy?</strong></p>', 'Transvenous', 'Intra-arterial', 'Intraosseous', 'Transoral', '2022-11-03 07:14:10', '2022-11-14 09:59:51', 'ans_d'),
(2193, NULL, 57, 1, '<p><strong>According to CPT&reg; coding guidelines, which scenario best represents modifier 24?</strong></p>', 'Patient had hernia surgery two days ago and returns to the operating room to incise and drain a post-operative abscess.', 'Patient is coming back to have stitches removed from his hand within the postoperative 10-day global period of the repair.', 'New patient is seen in the physician\'s office for effusion on the left knee. Physician examines the patient and performs a minor surgical procedure, aspirating fluid from the left knee.', 'Patient had an appendectomy two weeks ago. Patient returns to see the physician who performed the appendectomy complaining of a swollen right foot. The physician examines the swollen right foot', '2022-11-03 07:15:19', '2022-11-14 10:00:06', 'ans_d'),
(2194, NULL, 57, 1, '<p><strong>Which statement regarding lesion excision is TRUE?</strong></p>', 'Lesion excision codes include removal of a lesion, with margins, and simple (nonlayered) closure when performed.', 'Lesion excision codes include removal of a lesion, with margins, and complex closure when performed.', 'Lesion excision codes are selected by measuring the greatest clinical diameter of a lesion excluding the margins required to complete the excision.', 'Lesion excision codes include removal of a lesion, with margins, and intermediate closure when performed.', '2022-11-03 07:15:55', '2022-11-14 10:00:21', 'ans_a'),
(2195, NULL, 57, 1, '<p><strong>&nbsp;According to the Application of Cast and Strapping CPT&reg; guidelines, what is reported when an orthopedic provider performs initial fracture care treatment for a closed</strong></p>\r\n\r\n<p><strong>scaphoid fracture of the wrist, applies a short arm cast, and the patient will be returning for subsequent fracture care?</strong></p>', '29075', '25622', '25622, 29075', '29075-22', '2022-11-03 07:16:31', '2022-11-14 10:00:39', 'ans_b'),
(2196, NULL, 57, 1, '<p><strong>Mrs. Woods received sutures for a serious abdominal wound in another state while on vacation. She is back home, and skin has grown over the sutures, requiring a</strong></p>\r\n\r\n<p><strong>complex suture removal under general anaesthesia. What CPT&reg; code is reported?</strong></p>', '15850', '16020', '15851', '15852', '2022-11-03 07:17:01', '2022-11-14 10:00:54', 'ans_c'),
(2197, NULL, 57, 1, '<p><strong>A 22-year-old male is in the ED for multiple lacerations. The size of the wounds and closures are the following:</strong></p>\r\n\r\n<p><strong>Left Leg - 5 cm wound closed with a single layer closure</strong></p>\r\n\r\n<p><strong>Chest - 5 cm wound closed with a layered closure of subcutaneous and superficial fascia tissue</strong></p>\r\n\r\n<p><strong>What CPT&reg; coding is reported?</strong></p>', '12004', '12002, 12002-59', '12032, 12002-59', '12034', '2022-11-03 07:17:34', '2022-11-14 10:01:08', 'ans_c'),
(2198, NULL, 57, 1, '<p><strong>A patient with type 1 diabetes has gangrene that started in his left hand and is spreading up the forearm, requiring an amputation of the forearm. The patient is in the</strong></p>\r\n\r\n<p><strong>operating room, and an electronic saw is used to cut around the radius and ulna, just below the elbow, in a circular motion, removing that part of the limb. The bone end</strong></p>\r\n\r\n<p><strong>is covered with compressive dressing. Which procedure and diagnosis codes are reported?</strong></p>', '25907, E10.9, I96', '25905, E10.52', '25900, E10.52, I96', '25920, E10.52', '2022-11-03 07:18:12', '2023-09-06 01:08:17', 'ans_b'),
(2199, NULL, 57, 1, '<p><strong>Physician has obtained informed consent for trigger point injections on a patient that has chronic pain syndrome. The injections are given to the right cervical paraspinal</strong></p>\r\n\r\n<p><strong>muscle and right levator muscle. Physician injected three trigger points with equal parts 1 cc 0.5% Marcaine, 1 cc 1% lidocaine and 1 cc Betamethasone. What CPT&reg;</strong></p>\r\n\r\n<p><strong>coding is reported?</strong></p>', '20552 x3', '20552', '20553', '20610', '2022-11-03 07:18:41', '2022-11-14 10:01:34', 'ans_b'),
(2200, NULL, 57, 1, '<p><strong>A 59-year-old male presented with DJD and spondylolisthesis at L3 -L4. The patient is placed prone on the operating table and, after induction of general anesthesia, the lower back was sterilely prepped and draped. One incision was made over L2 -L5. This was confirmed with a probe under fluoroscopy. Laminectomies were done bilaterally at L3 and L4 with fasciectomies to relieve pressure to the nerve roots. Allograft was packed in the gutters from L2 -L5 for arthrodesis. Pedicle screws were placed at L2, L3, and L4. The construct was copiously irrigated and muscle; fascia and skin were closed in layers. Select the appropriate procedure codes for this scenario.</strong></p>', '63030-50, 63035-50, 22612, 22614 x 3, 22842', '63005, 22612, 22614, 22842', '63047-50, 63048-50, 22612, 22614 x 3, 22842', '63047, 63048, 22612, 22614 x 3, 22842', '2022-11-03 07:19:35', '2022-11-14 10:01:48', 'ans_d'),
(2201, NULL, 57, 1, '<p><strong>&nbsp;During the course of a hospital admission, Dr. Miller requests an orthopedist to take over the care of his patient with a new diagnosis of osteoporosis. The orthopedist sees the patient</strong></p>\r\n\r\n<p><strong>on day 3 of admission. He performs an expanded problem focused history and problem focused exam. He evaluates the patient&#39;s newly diagnosed osteoporosis. He orders a bone</strong></p>\r\n\r\n<p><strong>density study and prescribes Boniva for the patient. Medical decision making is moderate.</strong></p>\r\n\r\n<p><strong>What CPT code is reported by the orthopedist?</strong></p>', '99233', '99221', '99253', '99232', '2022-11-03 07:20:13', '2022-11-14 10:02:06', 'ans_d'),
(2202, NULL, 57, 1, '<p><strong>&nbsp;&nbsp;Mr. Ponds presents to his ophthalmologist&rsquo;s office for continued management of his retinopathy. His eyes are dilated, and photographs are taken of the inside of his eyes.Then, a fluorescein dye is injected into a vein in his elbow, and additional images are taken of the fundus of his eyes as the dye moves through her blood vessels. The angiography is performed with multiframe imaging on both the left and right eyes. Following the fluorescent dye, indocyanine-green is injected, which provides better images of the tiny vessels in the choroid at the back of the eye, and again multiple images are taken. What is the correct coding for this service?</strong></p>', '92235, 92240', '92242-50', '92242', '92235-50, 92240-50', '2022-11-03 07:21:05', '2022-11-14 10:02:18', 'ans_c'),
(2203, NULL, 57, 1, '<p><strong>Inpatient Hospital</strong></p>\r\n\r\n<p><strong>Date of Service: October 5, 20XX</strong></p>\r\n\r\n<p><strong>MR # XXX</strong></p>\r\n\r\n<p><strong>Cardiology - Dr. XXX</strong></p>\r\n\r\n<p><strong>Chief Complaint: The patient is a woman with a history of chronic atrial fibrillation.</strong></p>\r\n\r\n<p><strong>History: Second day in the hospital for chronic fibrillation. She reports no significant symptoms for cardiac arrhythmias today. The patient denies chest pain, respirator</strong></p>\r\n\r\n<p><strong>neurological complaints. All other symptoms were reviewed and negative. The patient is not smoking.</strong></p>\r\n\r\n<p><strong>Coumadin Therapy: Patient has her INRs followed as an outpatient.</strong></p>\r\n\r\n<p><strong>EXAM: She is healthy appearing and obese.</strong></p>\r\n\r\n<p><strong>Eyes: Conjunctivae and sclerae clear.</strong></p>\r\n\r\n<p><strong>Neck: Supple with no carotid bruits.</strong></p>\r\n\r\n<p><strong>Lungs: Clear, normal respiratory effort.</strong></p>\r\n\r\n<p><strong>Cardiac: S1, S2 within normal limits.</strong></p>\r\n\r\n<p><strong>Abdomen: No abdominal masses.</strong></p>\r\n\r\n<p><strong>Extremities: No clubbing, edema. Carotids, femorals, dorsalis pedis, and posterior tibial pulses are 2+ bilaterally with no bruits.</strong></p>\r\n\r\n<p><strong>Psychological: Oriented to time, place and person.</strong></p>\r\n\r\n<p><strong>Assessment: Chronic Atrial Fibrillation</strong></p>\r\n\r\n<p><strong>Plan: Cardizem IV has helped control the initial ventricular rate when admitted. Ordered an EKG. Will check on patient tomorrow. If all is normal will discharge.</strong></p>\r\n\r\n<p><strong>What E/M and ICD-10-CM codes are reported?</strong></p>', '99232, 148.20', '99222, 148.20', '99221, 1481.9', '99231, 148.19', '2022-11-03 07:24:20', '2022-11-14 10:02:33', 'ans_a'),
(2204, NULL, 57, 1, '<p><strong>A 45-year-old patient has symptomatic external haemorrhoids in three columns. In the lithotomy position the perianal tissue is anaesthetised with Marcaine 0.25% with</strong></p>\r\n\r\n<p><strong>epinephrine. The haemorrhoids are grasped and elliptically excised.</strong></p>\r\n\r\n<p><strong>What CPT coding is reported?</strong></p>', '46945', '46250', '46946', '46250, 46260', '2022-11-03 07:24:58', '2022-11-14 10:02:50', 'ans_b'),
(2205, NULL, 57, 1, '<p><strong>&nbsp;&nbsp;Patient presents to her plastic surgeon&rsquo;s office stating that she desires to have Botox injected for hyperhidrosis for her hands. The physician maps out the areas of</strong></p>\r\n\r\n<p><strong>excessive sweating and then paints the prepared areas with an iodine solution and waits for it to dry. The sites are marked in a grid pattern approximately 2 cm apart to</strong></p>\r\n\r\n<p><strong>ensure uninterrupted coverage of the entire treatment area. The physician administers the intradermal injections to distribute 30 units of onabotulinum toxin type A</strong></p>\r\n\r\n<p><strong>evenly among the injection sites in both hands. The physician monitors for pain as well as skin surface reaction throughout the process. What is the CPT&reg; coding for this</strong></p>\r\n\r\n<p><strong>procedure?</strong></p>', '64999, J0585 x 30', '64653, J0585 x 30', '64650, 10585 x 30', '64653-50, J0585 x 30', '2022-11-03 07:25:48', '2022-11-14 10:03:02', 'ans_a'),
(2206, NULL, 57, 1, '<p><strong>&nbsp;&nbsp;A 45-year-old male presents to the OR for a partial corpectomy on two lumbar vertebrae. Two surgeons are performing the surgery. One surgeon performs the transperitoneal approach, excises the damaged portion of the vertebrae, and then removes the discs above and below the vertebrae, inserting bolts in both areas. The second surgeon inserts a bone graft into the vertebral gap, closing the gap and inserting a metal plate. Both surgeons work together, each as a primary surgeon. How does each surgeon report their portion of the surgery?</strong></p>', '63087-80, 63088-80', '63087-62, 63088-62', '63090-62, 63091-62', '63090-66, 63091-66', '2022-11-03 07:26:20', '2022-11-14 10:03:20', 'ans_c'),
(2207, NULL, 57, 1, '<p><strong>A 4-year-old with leukemia is taken to the outpatient surgical center and undergoes the placement of Infuse-A-Port for chemotherapy. Fluoroscopic guidance is used to</strong></p>\r\n\r\n<p><strong>help the physician with the placement of the port. What CPT&reg; coding is reported?</strong></p>\r\n\r\n<p>&nbsp;</p>', '36560, 77002', '36561, 77001', '36561, 77002', '36560, 77001', '2022-11-03 09:45:18', '2022-11-14 10:03:32', 'ans_d'),
(2208, NULL, 57, 1, '<p><strong>A patient presents to the office with dysuria and slight nausea. The physician thinks she has an UTI. The physician performs a non-automated urinalysis with microscopy,</strong></p>\r\n\r\n<p><strong>which reads negative. The final diagnosis is a ruled out UTI.</strong></p>\r\n\r\n<p><strong>81007, R30.0, R11.0The appropriate procedure and diagnosis coding for this encounter is:</strong></p>', '81007, R30.0, R11.0', '81002, N39.0', '81000, R30.0, R11.0', '81002, N39.0, R30.0, R11.0', '2022-11-03 09:46:03', '2022-11-14 10:03:45', 'ans_c'),
(2209, NULL, 57, 1, '<p><strong>Mrs. Maria has been on Coumadin long term for her deep vein thrombosis. A prothrombin time lab test is performed to monitor her Coumadin level. What CPT&reg; and ICD-</strong></p>\r\n\r\n<p><strong>10-CM codes are reported for the lab work to monitor her Coumadin level?</strong></p>', '85610, Z51.81, Z79.01, 182.409', '85730, 182.409', '85610, 182.409', '85730, 251.81, Z79.01, 182.409', '2022-11-03 09:46:39', '2022-11-14 10:03:57', 'ans_a'),
(2210, NULL, 57, 1, '<p><strong>Code for the supply of an implantable dual chamber non rate-responsive pacemaker.</strong></p>', 'C2619', 'C1786', 'C1785', 'C2620', '2022-11-03 09:47:10', '2022-11-14 10:04:11', 'ans_a'),
(2211, NULL, 57, 1, '<p><strong>&nbsp;A 34-year-old patient has gastrointestinal bleeding. The physician performs a gastric intubation and aspiration. What CPT&reg; code is reported?</strong></p>', '43753', '49440', '44500', '43754', '2022-11-03 09:47:52', '2022-11-14 10:04:24', 'ans_a'),
(2212, NULL, 57, 1, '<p><strong>A 45-year-old patient has symptomatic external hemorrhoids in three columns. In the lithotomy position the perianal tissue is anesthetized with Marcaine 0.25% with</strong></p>\r\n\r\n<p><strong>epinephrine. The hemorrhoids are grasped and elliptically excised. What CPT coding is reported?</strong></p>', '46250', '46946', '46250, 46260', '46945', '2022-11-03 09:48:27', '2022-11-14 10:04:38', 'ans_a'),
(2213, NULL, 57, 1, '<p><strong>Patient presents to her plastic surgeon&rsquo;s office stating that she desires to have Botox injected for hyperhidrosis for her hands. The physician maps out the areas of</strong></p>\r\n\r\n<p><strong>excessive sweating and then paints the prepared areas with an iodine solution and waits for it to dry. The sites are marked in a grid pattern approximately 2 cm apart to</strong></p>\r\n\r\n<p><strong>ensure uninterrupted coverage of the entire treatment area. The physician administers the intradermal injections to distribute 30 units of onabotulinum toxin type A</strong></p>\r\n\r\n<p><strong>evenly among the injection sites in both hands. The physician monitors for pain as well as skin surface reaction throughout the process. What is the CPT&reg; coding for this</strong></p>\r\n\r\n<p><strong>procedure?</strong></p>', '64653-50, J0585 x 30', '64999, J0585 x 30', '64653, J0585 x 30', '64650, J0585 x 30', '2022-11-03 09:49:01', '2022-11-14 10:04:54', 'ans_b'),
(2214, NULL, 57, 1, '<p><strong>A 4-year-old with leukemia is taken to the outpatient surgical center and undergoes the placement of Infuse-A-Port for chemotherapy. Fluoroscopic guidance is used to</strong></p>\r\n\r\n<p><strong>help the physician with the placement of the port. What CPT&reg; coding is reported?</strong></p>', '36561, 77002', '36560, 77002', '36560, 77001', '36561, 77001', '2022-11-03 09:49:35', '2022-11-14 10:05:08', 'ans_c'),
(2215, NULL, 57, 1, '<p><strong>A physician provides two hours of mental health crisis intervention for a patient who has been unable to cope with a death of her twin sister What HCPCS Level II code is</strong></p>\r\n\r\n<p><strong>reported for this service?</strong></p>', 'S9484', 'S9485', 'S9485 x 2', 'S9484 x 2', '2022-11-03 09:50:40', '2022-11-14 10:05:30', 'ans_d');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(2216, NULL, 57, 1, '<p>An oncologist performs a bone marrow aspiration and a bone marrow biopsy on the right posterior llac spine. The procedures were performed during the same encounter. Select the appropriate coding.</p>', '38221', '38222', '38220', '38221, 38220', '2022-11-04 04:45:25', '2022-11-14 10:05:47', 'ans_b'),
(2217, NULL, 57, 1, '<p>An ethmoidectomy is performed. Diseased tissue is surgically removed from the anterior and posterior ethmoid sinuses by an intranasal surgical approach. A curette is used to remove the diseased tissue. What CPT&reg; code is reported for the procedure?</p>', '31255', '31201', '31205', '31200', '2022-11-04 04:45:56', '2022-11-14 10:06:05', 'ans_b'),
(2218, NULL, 57, 1, '<p>The patient is brought to the ED with an obstructed airway. The provider immediately makes an incision through the cricothyroid membrane and inserts a tracheostomy tube to assist the patient&rsquo; breathing. What CPT &reg; code is reported for this scenario?</p>', '31605', '31603', '31600', '31601', '2022-11-04 04:46:25', '2022-11-14 10:06:26', 'ans_a'),
(2219, NULL, 57, 1, '<p>37-year-old has adenoma of the liver. The tumor is invading the diaphragm. Electrocautery is used to remove part of the diaphragm and repaired primarily with two running 0-Prolenesutures. What CPT&reg; code is reported?</p>', '39540', '39560', '39561', '39545', '2022-11-04 04:46:59', '2022-11-14 10:06:40', 'ans_b'),
(2220, NULL, 57, 1, '<p>Alymphangiogram is performed for identification of a sentinel node in a patient with early onset of a malignant mastocytoma. Code the condition as well as the injection procedure with lymphatic nuclear medicine and imaging. What are the correct CPT and ICD-10-CM codes?</p>', '38790, 78195, C96.29', '38792, 78195, C96.29', '38500, 38900, 76842, C47.09', '38792, 76842, C85.80', '2022-11-04 04:49:03', '2022-11-14 10:06:54', 'ans_b'),
(2221, NULL, 57, 1, '<p>Patient has lung cancer in hs lower right lobe. Patient is in the operating suite to have a video-assisted thoracoscopic surgery (VATS). A 10 mm zero-degree thoracoscope was inserted in the right pleural cavity through a port site placed in the sixth intercostal space on the midaxillaryine. Two additional port sites were placed in the fifth intercostal space on the posterior and anterior midaxillary line. Removal ofthe total right lower lobe with the mass is performed thorascopically. Inspection of the lung revealed normal pulmonary parenchyma. After closing the port sites and inserting a chest tube, the patient was extubated and was transferred to the surgical intensive care unit for observation. What CPT&reg; coding is reported?</p>', '32671', '32663, 32601-51', '32480', '32663', '2022-11-04 04:49:36', '2022-11-14 10:07:08', 'ans_d'),
(2222, NULL, 57, 1, '<p>Malissa, 51 year old female presents for Mediastinoscopy for mediastinal mass. Biopsy of the mass shows cancer. Provide the correct CPT and ICD-10 codes.</p>', '39401, C38.3', '39401 x 4, C38.2', '39402, C38.3', '39402 x 4, C38.3', '2022-11-04 04:50:12', '2022-11-14 10:07:21', 'ans_a'),
(2223, NULL, 57, 1, '<p>Patient has lung cancer in his right middle and inferior lobes and is in the OR for a bilobectomy. A thoracotomy is performed, and a rib spreader is used to access the right lung, Removal of the total right middle and inferior lobe with the mass is performed. The incision is closed with staples and the patient is transferred to the surgical intensive care unit for observation. What CPT&reg; code is reported?</p>', '32670', '32482', '32662', '32480', '2022-11-04 04:50:48', '2022-11-14 10:07:38', 'ans_b'),
(2224, NULL, 57, 1, '<p><strong>Operative Report:</strong></p>\r\n\r\n<p>Preoperative Diagnosis: Lesion in the false vocal cord</p>\r\n\r\n<p>Postoperative Diagnosis: Lesion in the false vocal cord</p>\r\n\r\n<p>Procedure: Direct laryngoscopy with lesion biopsy</p>\r\n\r\n<p>Anesthesia: General endotracheal tube anesthetic</p>\r\n\r\n<p>Indications for Procedure: This is a 45-year-old male with a history of tobacco abuse who has chronic hoarseness and who was found on rigid laryngoscopy to have a lesion involving both vocal cords. The decision was made to perform a biopsy in order to obtain a diagnosis.</p>\r\n\r\n<p>Technical Procedure: After informed consent was obtained and the operative site identified, the patient was taken to the operating room and placed on the table in the supine position. General endotracheal tube anesthesia was induced, and attention turned to the oral cavity. A tooth protector was placed and the shoulder roll applied. The patient was draped in the usualsterile fashion. A time out was taken, and then the inferior commissure laryngoscope used to visualize the vallecula, the right and left pyriform sinus, the post cricoid sinus, the false vocal cord, and the true vocal cord. Biopsy forceps were used to obtain biopsies of the polypoid lesions on the right and left, and these were sent separately to Pathology for a demonstration. Once this was completed, the area was suctioned out, and the laryngoscope and tooth guard removed. The patient was awakened, extubated, and transferred to PACU in stable condition. Select the procedure code for this service:</p>', '31535', '31512', '31530', '31510', '2022-11-04 04:51:25', '2022-11-14 10:08:01', 'ans_a'),
(2225, NULL, 57, 1, '<p>Garry, 22-year-old male needs a peripherally inserted venous access catheter for cancer treatment. The patient was placed in the supine position. Following the administration of light anesthesia, the right arm was prepped and draped in the usual fashion. Next, 50 cc of 1 percent Lidocaine with bicarb was infused in the skin and subcutaneous tissue and the basilic vein was punctured. CPT&reg; coding is reported? Using Seldinger technique, the subclavian vein was cannulated on the first attempt. A J-wire passed easily under fluoroscopic guidance to the subclavian vein. The wound was closed with a 3-OVieryl. Benzoin and Steri-Strips were applied. Sponge and needle count correct. The patient was awakened from light anesthesia and taken to the recovery room in stable condition.</p>', '36573', '36571, 77001', '36570', '36569, 77001', '2022-11-04 04:52:03', '2022-11-14 10:08:30', 'ans_a'),
(2226, NULL, 57, 1, '<p>Mr Anderson is complaining of flashes and floaters in his&nbsp;right eye. Ophthalmologist performs an initial extended ophthalmoscopy on right&nbsp;eye and identifies retinal tear. Physician performed Retinal drawing, interpretation and report. Provide correct CPT code for this visit.</p>', '92018', '92202', '92201', '92060', '2022-11-04 04:52:36', '2022-11-14 10:08:44', 'ans_c'),
(2227, NULL, 57, 1, '<p>John seen by his physician&nbsp;two times during a dialysis procedure to declot the access cannula during the hemodialysis process. Declotting of canulla has been done. Provide CPT code for the service provided by physician.</p>', '90936', '90935, 36861', '90937, 36860', '36860', '2022-11-04 04:53:13', '2022-11-14 10:08:58', 'ans_c'),
(2228, NULL, 57, 1, '<p>James Hose who is suffering from emphysema admitted to the&nbsp;ER with complaint of shortness of breath. A nebulizer treatment is administered in ER and same&nbsp;treatment repeated after three hours later. Provide CPT code for this visit</p>', '94640, 94640-76', '94644, 94644-76', '94644', '94640', '2022-11-04 04:53:44', '2022-11-14 10:09:15', 'ans_a'),
(2229, NULL, 57, 1, '<p>A 65-year-old comes into the ED with atrial fibrillation. Two paddles are placed on the patient&rsquo;s chest and a direct current of 120 | of synchronized shock was delivered but atrial fibrillation appeared to persist after a few sinus beats. Therefore, a 200 J of synchronized biphasic shock was delivered, and this time sinus rhythm was restored and persisted. How is this procedure reported?</p>', '92970', '92961', '92953', '92960', '2022-11-04 04:54:18', '2022-11-14 10:10:47', 'ans_d'),
(2230, NULL, 57, 1, '<p>A 41-year-old is seen for somatic dysfunction in multiple body areas. Osteopathic manipulative treatment is performed to the following regions: cervical, thoracic, mbar, sacrum, pelvis, both legs and abdominal/visceral. What CPT&reg; coding is reported?</p>', '98928 x8', '98928 x7', '98929 x9', '98928', '2022-11-04 04:55:03', '2022-11-14 10:10:59', 'ans_d'),
(2231, NULL, 57, 1, '<p>The patient presents for an echocardiogram. The indication for the procedure is intermittent episodes of shortness of breath. Echocardiography, transthoracic, real-time with image documentation with M-mode recording, complete is performed. What is the correct CPT&reg; code for the physician-ordered test?</p>', '93307', '93312', '93350', '93306', '2022-11-04 04:55:49', '2022-11-14 10:11:13', 'ans_a'),
(2232, NULL, 57, 1, '<p>Dr. Barker sees Mrs. Ross today in the nursing facility for follow up on the status of her chronic conditions. An expanded problem focused history is obtained, a detailed exam performed, and medical decision making is moderate. The status of her COPD is stable, and bronchodilator therapy will continue. Her last HgcbA1C is within normal range and there are no changes for diabetes management. She&#39;s doing well the antidepressant started last week for her depression. Dr. Barker will see her again next week. What E/M code is reported?</p>', '99308', '99304', '99309', '99305', '2022-11-04 04:56:23', '2023-10-12 00:42:47', 'ans_a'),
(2233, NULL, 57, 1, '<p>Bob was on a cruise in Mexico when he developed nausea, vomiting, and diarrhea. The ship doctor examined Bob in his cabin. A detailed history was obtained and an expanded problem focused exam was performed. Medical decision making was moderate. The doctor advised Bob to hydrate and to avoid alcohol and rich/spicy food for 48 hours. What E/M code is reported?</p>', '99344', '99342', '99350', '99347', '2022-11-04 04:57:17', '2023-09-22 00:36:19', 'ans_b'),
(2234, NULL, 57, 1, '<p>Sara has a follow-up appointment with her physician for depression. She has seen no improvement since the last visit. The physician performs a medically appropriate history and exam and gives the patient a prescription for Celexa. The total time spent on the encounter the day of the visit is 25 minutes. What E/M code is reported?</p>', '99203', '99214', '99202', '99213', '2022-11-04 04:57:52', '2022-11-14 10:18:30', 'ans_d'),
(2235, NULL, 57, 1, '<p>A patient comes in with borderline obesity to Dr Marry&#39;s office. She performs a medically appropriate history and exam. She spends 34&nbsp;minutes discussing the risk associated with obesity. She prescribes diet and exercise. What established patient office evaluation and management code is reported?</p>', '99213', '99214', '99215', '99212', '2022-11-04 04:58:21', '2023-02-28 09:10:20', 'ans_b'),
(2236, NULL, 57, 1, '<p>A surgical hysteroscopy with tubal occlusion by placement of permanent implants is performed. What is the anesthesia code reported by the anesthesiologist?</p>', '00950', '00952', '00940', '00851', '2022-11-04 04:58:55', '2022-11-14 10:19:16', 'ans_b'),
(2237, NULL, 57, 1, '<p>75:year-old patient is brought emergently to operating room for craniotomy for the evacuation of a hematoma, What CPT codes are reported for the anaesthesiologists services?</p>', '00215-AA, 99140', '00211-AA, 99100, 99140', '00210-AA 99100, 99140', '00211-AA, 99100', '2022-11-04 05:02:20', '2022-11-14 10:19:32', 'ans_b'),
(2238, NULL, 57, 1, '<p>A.7-year-old female in good physical health is having an appendectomy. The anesthesiologist begins to prepare this patient for surgery at 10:30 am, The surgery begins at 10:45 am and ends at 12:00 pm. The anesthesiologist releases the patient to the PACU nurses at 12:15 pm. What is the anesthesia time and anesthesia code are reported?</p>', '1 hour, 15 minutes; 00790', '1 hour, 30 minutes; 00840', '1 hour, 45 minutes; 00840', '2.hours, 15 minutes; 00790', '2022-11-04 05:03:15', '2022-11-14 10:19:48', 'ans_c'),
(2242, NULL, 61, 1, '<p>If a patient undergoes a biopsy immediately before the definitive surgery for a frozen section, how should this be coded with ICD-10-PCS codes?</p>', 'The approach to the definitive surgery', 'Suture method', 'Exploratory surgery', 'Open biopsy and definitive surgery', '2022-12-13 09:09:58', '2022-12-13 09:09:58', 'ans_d'),
(2243, NULL, 61, 1, '<p>A patient is admitted with hypotension due to dobutamine taken and prescribed correctly. How should this be coded?</p>', 'I95.1, Orthostatic hypotension T44.5X5A, Adverse effects of dobutamine', 'I95.2, Hypotension due to drugs T44.5X5A, Adverse effects of dobutamine', 'I95.89, Other hypotension T44.995A, Adverse effects of dobutamine', 'I95.81, Postprocedural hypotension T44.995A, Adverse effects of dobutamine', '2022-12-13 09:10:42', '2022-12-13 09:10:42', 'ans_b'),
(2244, NULL, 61, 1, '<p>In outpatient surgery, a PTCA is completed with insertion of a drug-eluting stent in the left circumflex artery and a non-drug-eluting stent inserted into the left anterior descending artery of this 56-year-old female. Assign the correct CPT code(s) for this procedure.<br />\r\n<br />\r\n92920 Percutaneous transluminal coronary angioplasty; single major coronary artery or branch<br />\r\n+92921 Each additional branch of a major coronary artery (List separately in additional to code for primary procedure.)<br />\r\n92928 Percutaneous transcatheter placement of intracoronary stent(s), with coronary angioplasty when performed; single major coronary artery or branch<br />\r\n+92929 Each additional branch of a major coronary artery (List separately in addition to code for primary procedure.)<br />\r\nG0290 Transcatheter placement of a drug eluting intracoronary stent(s), percutaneous, with or without other therapeutic intervention, any method; single vessel<br />\r\nG0291 Transcatheter placement of a drug eluting intracoronary stent(s), percutaneous, with or without other therapeutic intervention, any method; each additional vessel<br />\r\n&minus;LC Left circumflex coronary artery<br />\r\n&minus;LD Left anterior descending coronary artery</p>', '92921, 92920', '92920-LC, 92921-LD', 'G0291-LC', 'G0290-LC', '2022-12-13 09:11:42', '2022-12-13 09:11:42', 'ans_b'),
(2245, NULL, 61, 1, '<p>A patient is treated for esophageal varices with hemorrhage due to cirrhosis. The diagnostic codes that would be assigned are:<br />\r\n<br />\r\nI85.01 Esophageal varices with bleeding<br />\r\nI85.11 Secondary esophageal varices with bleeding<br />\r\nK74.60 Unspecified cirrhosis of liver</p>', 'I85.01, K74.60', 'I85.10, K74.60', 'K74.60, I85.01', 'K74.60, I85.11', '2022-12-13 09:12:18', '2022-12-13 09:12:18', 'ans_d'),
(2246, NULL, 61, 1, '<p>An example of breast reconstruction is:</p>', 'Total reconstruction', 'Insertion of drains', 'Removal of lymph nodes', 'Mammography', '2022-12-13 09:13:05', '2022-12-13 09:13:05', 'ans_a'),
(2247, NULL, 61, 1, '<p>Assign the correct CPT code for a 50-year-old female patient admitted to outpatient surgery department for laparoscopic surgical repair of a recurrent, incarcerated incisional hernia with mesh insertion.<br />\r\n<br />\r\n49561 Repair initial incisional or ventral hernia; incarcerated or strangulated<br />\r\n49565 Repair recurrent incisional or ventral hernia, reducible<br />\r\n49566 Repair recurrent incisional or ventral hernia; incarcerated or strangulated<br />\r\n49657 Laparoscopy, surgical, repair, recurrent incisional hernia (includes mesh insertion, when performed); incarcerated or strangulated</p>', '49561', '49565', '49566', '49657', '2022-12-13 09:13:45', '2022-12-13 09:13:45', 'ans_d'),
(2248, NULL, 61, 1, '<p>When coding &quot;arthrocentesis,&quot; the code assignment is determined by:</p>', 'Contrast used', 'Size of the joint', 'Approach', 'Description of the closure', '2022-12-13 09:14:20', '2022-12-13 09:14:20', 'ans_b'),
(2249, NULL, 61, 1, '<p>A patient is admitted to the hospital for pain due to displacement of pacemaker electrode. The patient also has hypothyroidism due to partial thyroidectomy seven years ago and a breast cyst. The pacemaker electrode was relocated and Synthroid was given during hospitalization. The diagnostic codes (excluding External Cause codes) that should be assigned are:<br />\r\n<br />\r\nT82.110A Breakdown (mechanical) of cardiac electrode, initial encounter<br />\r\nT82.110D Breakdown (mechanical) of cardiac electrode, subsequent encounter<br />\r\nT82.120A Displacement of cardiac electrode, initial encounter<br />\r\nT82.120S Displacement of cardiac electrode, sequela<br />\r\nN60.09 Solitary cyst of breast<br />\r\nE89.0 Postsurgical hypothyroidism</p>', 'T82.110A, E89.0', 'T82.110D, E89.0, N60.09', 'T82.120A, E89.0', 'T82.120S, E89.0, N60.09', '2022-12-13 09:15:06', '2022-12-13 09:15:06', 'ans_c'),
(2250, NULL, 61, 1, '<p>Inpatient procedures are coded with:</p>', 'HCPCS', 'CPT', 'CD-10-PCS', 'ICD-O', '2022-12-13 09:15:38', '2022-12-13 09:15:38', 'ans_c'),
(2251, NULL, 61, 1, '<p>Patient with renal tumors received percutaneous cryotherapy ablation of three tumors on the right kidney in the same operative episode at Memorial Hospital. Assign a CPT code for this procedure.<br />\r\n<br />\r\n50250 Ablation, open, 1 or more renal mass lesion(s), cryosurgical, including intraoperative ultrasoundguidance and monitoring, if performed<br />\r\n50590 Lithotripsy, extracorporeal shock wave<br />\r\n50592 Ablation, 1 or more renal tumor(s), percutaneous, unilateral, radiofrequency<br />\r\n50593 Ablation, renal tumor(s), unilateral, percutaneous, cryotherapy</p>', '50250', '50590', '50592', '50593', '2022-12-13 09:16:06', '2022-12-13 09:16:06', 'ans_d'),
(2252, NULL, 61, 1, '<p>If a patient has an excision of a malignant lesion of the skin, the CPT code is determined by the body area from which the excision occurs and the:</p>', 'Length of the lesion as described in the pathology report', 'Dimension of the specimen submitted as described in the pathology report', 'Width times the length of the lesion as described in the operative report', 'Diameter of the lesion as well as the margins excised as described in the operative report', '2022-12-13 09:16:44', '2022-12-13 09:16:44', 'ans_d'),
(2253, NULL, 61, 1, '<p>A patient has a diabetic ulcer of the right foot. How should this patient&#39;s record be coded?<br />\r\n<br />\r\nE11.40 Type 2 diabetes mellitus with diabetic neuropathy, unspecified<br />\r\nE10.40 Type 1 diabetes mellitus with diabetic neuropathy, unspecified<br />\r\nE11.621 Type 2 diabetes mellitus with foot ulcer<br />\r\nE10.621 Type 1 diabetes mellitus with foot ulcer<br />\r\nE11.69 Type 2 diabetes mellitus with other specified complication<br />\r\nE10.69 Type 1 diabetes mellitus with other specified complication<br />\r\nL97.409 Non-pressure chronic ulcer of unspecified heel and midfoot with unspecified severity<br />\r\nL97.419 Non-pressure chronic ulcer of right heel and midfoot with unspecified severity</p>', 'E11.40, L97.419', 'E11.40, L97.409', 'E11.69, L97.419', 'E11.621, L97.419', '2022-12-13 09:17:33', '2022-12-13 09:17:33', 'ans_d'),
(2254, NULL, 61, 1, '<p>Assign the code(s) for mammographic guidance for bilateral breast needle localization for a lesion placement with fine needle aspiration.<br />\r\n<br />\r\n10022 Fine needle aspiration, with imaging guidance<br />\r\n19081 Biopsy, breast, with placement of localization device(s) (eg, clip, metallic pellet) when performed, and imaging of the biopsy specimen, percutaneous; first lesion including stereotactic guidance<br />\r\n19082 Biopsy, breast with placement of breast localization device(s) (eg, clip, metallic pellet), when performed, percutaneous; each additional lesion, including stereotactic guidance (List separately in addition to code for primary procedure.)</p>', '19082', '10022', '19081, 19082', '19081', '2022-12-13 09:18:11', '2022-12-13 09:18:11', 'ans_c'),
(2255, NULL, 61, 1, '<p>A 55-year-old male was transferred to a nursing home for continuing care because of ventilator dependence following complications of cardiac bypass surgery. He was readmitted three weeks later due to ventilator associated pneumonia (VAP) due to Pseudomonas aeruginosa. How should this be coded?<br />\r\n&nbsp;</p>', 'T88.9XXA, J18.9, B96.5', 'J16.8', 'J95.851, B96.5', 'J15.1, J95.851', '2022-12-13 09:18:41', '2022-12-13 09:18:41', 'ans_c'),
(2256, NULL, 61, 1, '<p>A patient is admitted for chest pain. The patient was stabilized and discharged. In a subsequent admission, the patient was admitted as an outpatient for a left heart catheterization, coronary arteriography using two catheters and left ventricular angiography. The patient was found to have arteriosclerotic heart disease. The patient has no history of cardiac surgery. The appropriate sequencing of ICD-10-CM and CPT codes for the outpatient catheterization would be:<br />\r\n<br />\r\nI20.0 Unstable angina<br />\r\nI20.9 Angina pectoris, unspecified<br />\r\nI25.10 Atherosclerotic heart disease of native coronary artery without angina pectoris<br />\r\nR07.9 Chest pain, unspecified<br />\r\n93452 Left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed<br />\r\n93453 Combined right and left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed<br />\r\n93454 Catheter placement in coronary artery(s) for coronary angiography, including intraprocedural injection(s) for coronary angiography, imaging supervision and interpretation;<br />\r\n93458 With left heart catheterization including intraprocedural injection(s) for left ventriculography, when performed</p>', 'R07.9, 93452', 'I20.0, 93454', 'I25.10, 93453', 'I25.10, 93458', '2022-12-13 09:19:25', '2022-12-13 09:19:25', 'ans_d'),
(2257, NULL, 61, 1, '<p>When coding benign neoplasm of the skin, the section noted above directs the coder to:<br />\r\n<br />\r\nD23- Other benign neoplasms of skin<br />\r\nIncludes:<br />\r\n--Benign neoplasm of hair follicles<br />\r\n--Benign neoplasm of sebaceous glands<br />\r\n--Benign neoplasm of sweat glands<br />\r\nExcludes 1:<br />\r\n--Benign lipomatous neoplasms of skin (D17.0-D17.3)<br />\r\n--Melanocytic nevi (D22.-)</p>', 'Use category D23 for benign neoplasm of sweat glands', 'Use category D23 for melanocytic nevi', 'Use category D23 for benign lipomatous neoplasms of skin', 'Use category D23 for malignant neoplasm of the skin', '2022-12-13 09:20:08', '2022-12-13 09:20:08', 'ans_a'),
(2258, NULL, 61, 1, '<p>A patient is admitted with acute respiratory failure, hypertension, and congestive heart failure. The patient was intubated upon admission to the hospital. What are the correct diagnosis codes and sequencing?<br />\r\n<br />\r\nI10 Essential hypertension<br />\r\nI50.9 Heart failure, unspecified<br />\r\nJ96.00 Acute respiratory failure, unspecified whether with hypoxia or hypercapnia<br />\r\nJ96.20 Acute and chronic respiratory failure, unspecified whether with hypoxia or hypercapnia</p>', 'J96.00, I10, I50.9', 'I50.9, J96.00, I10', 'J96.20, I10, I50.9', 'I50.9, J96.20, I10', '2022-12-13 09:20:44', '2022-12-13 09:20:44', 'ans_a'),
(2259, NULL, 61, 1, '<p>Itching due to drug reaction to an antihistamine. What codes should be assigned?<br />\r\n<br />\r\nL29.9 Pruritus, unspecified<br />\r\nR89.2 Abnormal level of other drugs, medicaments and biological substances in specimens from other organs, systems and tissues<br />\r\nT50.905A Adverse effect of unspecified drugs, medicaments and biological substances, initial encounter<br />\r\nT45.0X1A Poisoning by antiallergic and antiemetic drugs, accidental (unintentional), initial encounter<br />\r\nT45.0X5A Adverse effect of antiallergic and antiemetic drugs, initial encounter</p>', 'R89.2, T45.0X1A', 'R89.2, T45.0X5A', 'T50.905A, T45.0X1A', 'L29.9, T45.0X5A', '2022-12-13 09:21:22', '2022-12-13 09:21:22', 'ans_d'),
(2260, NULL, 61, 1, '<p>Assign code(s) for the following diagnosis: Congestive heart failure due to hypertension.<br />\r\n<br />\r\nI10 Essential (primary) hypertension<br />\r\nI11.9 Hypertensive heart disease without heart failure<br />\r\nI11.0 Hypertensive heart disease with heart failure<br />\r\nI50.9 Heart failure, unspecified<br />\r\nI50.1 Left ventricular failure<br />\r\nI50.20 Unspecified systolic (congestive) heart failure<br />\r\nI50.21 Acute systolic (congestive) heart failure<br />\r\nI50.22 Chronic systolic (congestive) heart failure<br />\r\nI50.23 Acute on chronic systolic (congestive) heart failure</p>', 'I10, I50.9', 'I11.0', 'I50.23, I10', 'I11.0, I50.9', '2022-12-13 09:21:58', '2022-12-13 09:21:58', 'ans_d'),
(2261, NULL, 61, 1, '<p>A patient was treated in the emergency department with lacerations of the neck and underwent a repair of two (2) wounds of the neck (2.0 cm and 1.4 cm) with layered closure. What are the diagnosis (excluding external cause codes) and procedure codes assigned?<br />\r\n<br />\r\nS11.91XA Laceration without foreign body of unspecified part of neck, initial encounter<br />\r\nS11.92XA Laceration with foreign body of unspecified part of neck, initial encounter<br />\r\n0HQ4XZZ Repair neck skin, external approach<br />\r\n12041 Repair, intermediate, wounds of neck, hands, feet and/or external genitalia; 2. 5 cm or less<br />\r\n12042 Repair, intermediate, wounds of neck, hands, feet, and/or external genitalia; 2.6 cm to 7.5 cm</p>', 'S11.91XA, 0HQ4XZZ', 'S11.92XA, 0HQ4XZZ', 'S11.92XA, 12041', 'S11.91XA, 12042', '2022-12-13 09:22:35', '2022-12-13 09:22:35', 'ans_d'),
(2262, NULL, 61, 1, '<p>A 77-year-old patient has hypertensive heart disease with congestive heart failure and stage 5 renal disease. What codes would be assigned?</p>', 'I11.0, Hypertensive heart disease with heart failure', 'I13.2, Hypertensive heart and chronic kidney disease with heart failure and with stage 5 chronic kidney disease, or end stage renal disease; N18.5 Chronic kidney disease, stage 5; I50.9 Heart failure, unspecified', 'I50.9, Heart failure, unspecified', 'N18.6, End stage renal disease', '2022-12-13 09:23:21', '2022-12-13 09:23:21', 'ans_b'),
(2263, NULL, 61, 1, '<p>A patient has squamous cell carcinoma of the knee. What code should be assigned for this diagnosis?<br />\r\n<br />\r\nC49.20 Malignant neoplasm of connective and soft tissue of unspecified lower limb, including hip<br />\r\nC43.70 Malignant melanoma of unspecified lower limb, including hip<br />\r\nC44.701 Unspecified malignant neoplasm of skin of unspecified lower limb, including hip<br />\r\nC44.711 Basal cell carcinoma of skin of unspecified lower limb, including hip<br />\r\nC44.721 Squamous cell carcinoma of skin of unspecified lower limb, including hip<br />\r\nC76.50 Malignant neoplasm of unspecified lower limb</p>', 'C49.20', 'C43.70', 'C44.721', 'C76.50', '2022-12-13 09:23:52', '2022-12-13 09:23:52', 'ans_c'),
(2264, NULL, 61, 1, '<p>In CPT, if a patient has two lacerations of the arm that are repaired with simple closures, the coder would assign:</p>', 'Two CPT codes expressing each laceration repair', 'One CPT code for the largest laceration', 'One CPT code, adding the lengths of the lacerations together', 'One CPT code for the most complex closure', '2022-12-13 09:24:24', '2022-12-13 09:24:24', 'ans_c'),
(2265, NULL, 61, 1, '<p>Assign the correct code for a total laparoscopic cholecystectomy with percutaneous removal of common bile duct stones.</p>', '0DTJ4ZZ, Resection of appendix, percutaneous endoscopic approach and 0FC90ZZ, Removal, common bile duct stones, open', '0FB40ZZ, Excision, gallbladder, open approach', '0FT40ZZ, Resection, gallbladder, open approach', '0FT44ZZ, Resection, gallbladder, Resection of gallbladder, percutaneous endoscopic approach and 0FC94ZZ, Removal, common bile duct stones, laparoscopic', '2022-12-13 09:25:21', '2022-12-13 09:25:21', 'ans_d'),
(2266, NULL, 61, 1, '<p>Patient presents in the ER with thrombosis of a loop PTFE hemodialysis fistula without mechanical complications. The physician performed a percutaneous thrombectomy of the left brachial vein. Assign a facility code for this outpatient procedure.<br />\r\n<br />\r\n05CA3ZZ Extirpation of matter from left brachial vein, percutaneous approach<br />\r\n36831 Thrombectomy, open, arteriovenous brachial fistula<br />\r\n36832 Revision, open, arteriovenous fistula; without thrombectomy, autogenous or nonautogenous dialysis graft (separate procedure)<br />\r\n37184 Primary percutaneous transluminal mechanical thrombectomy, noncoronary, arterial or arterial bypass graft, including fluoroscopic guidance and intraprocedural pharmacological thrombolytic injection(s); initial vessel</p>', '05CA3ZZ', '36831', '37184', '36832', '2022-12-13 09:28:24', '2022-12-13 09:28:24', 'ans_b'),
(2267, NULL, 61, 1, '<p>The patient was monitored under general anesthesia for keratoplasty including excision of diseased cornea. A controlled depth-setting blade was used to cut partially into the recipient&#39;s cornea in a manner to allow the lamellar graft to fit. Which CPT code should be assigned?<br />\r\n<br />\r\n65710 Keratoplasty (corneal transplant); anterior lamellar<br />\r\n65730 Keratoplasty (corneal transplant); penetrating (except in aphakia or pseudophakia)<br />\r\n65750 Keratoplasty (corneal transplant); penetrating (in aphakia)<br />\r\n65755 Keratoplasty (corneal transplant); penetrating (in pseudophakia)</p>', '65710', '65730', '65750', '65755', '2022-12-13 09:29:01', '2022-12-13 09:29:01', 'ans_a'),
(2268, NULL, 61, 1, '<p>Assign the code(s) for diagnostic left and right cardiac catheterization, left and right coronary arteriogram with low osmolar contrast and fluoroscopic guidance.<br />\r\n<br />\r\n4A023N6 Measurement of cardiac sampling and pressure, right heart, percutaneous approach<br />\r\n4A023N7 Measurement of cardiac sampling and pressure, left heart, percutaneous approach<br />\r\n4A023N8 Measurement of cardiac sampling and pressure, bilateral, percutaneous approach<br />\r\nB2141ZZ Fluoroscopy of right heart using low osmolar contrast<br />\r\nB2151ZZ Fluoroscopy of left heart using low osmolar contrast<br />\r\nB2161ZZ Fluoroscopy of right and left heart using low osmolar contrast<br />\r\nB2111ZZ Fluoroscopy of Multiple Coronary Arteries using Low Osmolar Contrast</p>', '4A023N6, 4A023N7', '4A023N8, B2111ZZ', '4A023N6', '4A023N7', '2022-12-13 09:29:47', '2022-12-13 09:29:47', 'ans_b'),
(2269, NULL, 61, 1, '<p>A laparoscopic tubal ligation is completed. What is the correct CPT code assignment?<br />\r\n<br />\r\n49320 Laparoscopy, abdomen, peritoneum, and omentum, diagnostic, with or without collection of specimen(s) by brushing or washing (separate procedure)<br />\r\n58662 Laparoscopy, surgical; with fulguration or excision of lesions of the ovary, pelvic viscera, or peritoneal surface by any method<br />\r\n58670 Laparoscopy, surgical; with fulguration of oviducts (with or without transection)<br />\r\n58671 Laparoscopy, surgical; with occlusion of oviducts by device (eg, band, clip, or Falope ring)</p>', '49320, 58662', '58670', '58671', '49320', '2022-12-13 09:31:15', '2022-12-13 09:31:15', 'ans_b'),
(2270, NULL, 61, 1, '<p>A patient was admitted to the emergency department with chest pain and was diagnosed with aborted myocardial infarction with acute myocardial ischemia. There was no prior cardiac surgery. The cardiac enzymes were normal. The appropriate coding of the diagnosis for this case is:</p>', 'I21.3, ST elevation (STEMI) myocardial infarction of unspecified site', '25.10, Atherosclerotic heart disease of native coronary artery without angina pectoris', 'I24.8, Other forms of acute ischemic heart disease', 'I24.0, Acute coronary thrombosis not resulting in myocardial infarction', '2022-12-13 09:31:52', '2022-12-13 09:31:52', 'ans_d'),
(2271, NULL, 61, 1, '<p>Mechanical ventilation codes require consideration of which of the following?</p>', 'The time when a tracheal tube is inserted', 'The replacement of an endotracheal tube', 'The start time of endotracheal tube insertion followed by mechanical ventilation', 'Mechanical ventilation during surgery', '2022-12-13 09:33:40', '2022-12-13 09:33:40', 'ans_c'),
(2272, NULL, 61, 1, '<p>If a patient is admitted with pneumococcal pneumonia and severe pneumococcal sepsis, the coder should:</p>', 'Assign a code for only the sepsis and pneumonia', 'Assign a code for the sepsis, pneumonia, and severe sepsis', 'Assign only a code for pneumococcal pneumonia', 'Review the chart to determine if septic shock could be used first', '2022-12-13 09:34:29', '2022-12-13 09:34:29', 'ans_b'),
(2273, NULL, 61, 1, '<p>Acute peptic ulcer with perforation and hemorrhage and resulting blood loss anemia. What codes should be assigned?<br />\r\n<br />\r\nK27.0 Acute peptic ulcer, site unspecified, with hemorrhage<br />\r\nK27.1 Acute peptic ulcer, site unspecified, with perforation<br />\r\nK27.2 Acute peptic ulcer, site unspecified, with both hemorrhage and perforation<br />\r\nD50.0 Iron deficiency anemia secondary to blood loss (chronic)<br />\r\nD62 Acute posthemorrhagic anemia</p>', 'K27.1, D62', 'K27.0, D62', 'K27.0, D50.0', 'K27.2, D50.0', '2022-12-13 09:35:07', '2022-12-13 09:35:07', 'ans_d'),
(2274, NULL, 61, 1, '<p>A patient underwent an excision of a malignant lesion of the chest that measured 1.0 cm and there was a 0.2 cm margin on both sides. Based on the 2017 CPT codes, which code would be used for the procedure?</p>', '11401, Excision benign lesion of trunk; excised diameter 0.6 cm to 1.0 cm', '11601, Excision malignant lesion of trunk; excised diameter 0.6 cm to 1.0 cm', '11602, Excision malignant lesion of trunk; excised diameter 1.1 cm to 2.0 cm', '11402, Excision benign lesion of trunk; excised diameter 1.1 cm to 2.0 cm', '2022-12-13 09:38:02', '2022-12-13 09:38:02', 'ans_c'),
(2275, NULL, 61, 1, '<p>A laparoscopic tubal ligation with Falope ring is completed. What is the correct CPT code assignment?<br />\r\n<br />\r\n49321 Laparoscopy, surgical; with biopsy (single or multiple)<br />\r\n58662 Laparoscopy, surgical; with fulguration or excision of lesions of the ovary, pelvic viscera, or peritoneal surface by any method<br />\r\n58670 Laparoscopy, surgical; with fulguration of oviducts (with or without transection)<br />\r\n58671 Laparoscopy, surgical; with occlusion of oviducts by device (eg, band, clip, or Falope ring)</p>', '49321, 58662', '58670', '58671', '49321', '2022-12-13 09:39:10', '2022-12-13 09:39:10', 'ans_c'),
(2276, NULL, 61, 1, '<p>A laparoscopic cholecystectomy was performed. What is the correct ICD-10-PCS code?<br />\r\n<br />\r\n0FB40ZZ Excision of gallbladder, open approach<br />\r\n0FB44ZZ Excision of gallbladder, percutaneous endoscopic approach<br />\r\n0FT40ZZ Resection of gallbladder, open approach<br />\r\n0FT44ZZ Resection of gallbladder, percutaneous endoscopic approach</p>', '0FB40ZZ', '0FT40ZZ', '0FT44ZZ', '0FB44ZZ', '2022-12-13 09:40:17', '2022-12-13 09:40:17', 'ans_c'),
(2277, NULL, 61, 1, '<p>Assign the code(s) for chemotherapy for 3 hours&#39; infusion.<br />\r\n<br />\r\n96401 Chemotherapy administration, subcutaneous or intramuscular; non-hormonal anti-neoplastic<br />\r\n96413 Chemotherapy administration, intravenous infusion technique; up to 1 hour, single or initial substance/drug<br />\r\n+96415 Chemotherapy administration, intravenous infusion technique; each additional hour (List separately in addition to code for primary procedure.)<br />\r\n&minus;51 Multiple procedures</p>', '96413, 96415, 96415', '96413, 96415-51', '96413, 96413, 96413', '96401', '2022-12-13 09:40:56', '2022-12-13 09:40:56', 'ans_a'),
(2278, NULL, 61, 1, '<p>A patient is admitted with lethargy, congestive heart failure, and pleural effusion. The patient underwent treatment with diuretics for the CHF, which has cleared. The pleural effusion required a thoracentesis to determine the cause. At the time of discharge, the effusion was decreased but not resolved. The correct coding assignment for this case would be:</p>', 'Congestive heart failure', 'Pleural effusion', 'Congestive heart failure and pleural effusion', 'Lethargy, congestive heart failure, and pleural effusion', '2022-12-13 09:41:29', '2022-12-13 09:41:29', 'ans_c'),
(2279, NULL, 61, 1, '<p>Assign the correct code for a total open cholecystectomy with intraoperative cholangiogram. The cholangiogram was done with plain radiography with low osmolar contrast.</p>', '0DTJ4ZZ, Resection appendix, percutaneous endoscopic approach and 0FC94ZZ, Removal, common bile duct stones, laparoscopic', '0DBJ0ZZ, Excision, appendix, open approach', '0FB40ZZ, Excision, gallbladder, open approach', '0FT40ZZ, Resection, gallbladder, open approach and BF031ZZ, Intraoperative cholangiogram, plain radiography of gallbladder and bile ducts using low osmolar contrast', '2022-12-13 09:42:09', '2022-12-13 09:42:09', 'ans_d'),
(2280, NULL, 61, 1, '<p>A patient was admitted to the emergency department for abdominal pain with diarrhea and was diagnosed with infectious gastroenteritis. The patient also had angina and chronic obstructive pulmonary disease. List the diagnoses that would be coded in the order of sequence.</p>', 'Abdominal pain, infectious gastroenteritis, chronic obstructive pulmonary disease, angina', 'Infectious gastroenteritis, chronic obstructive pulmonary disease, angina', 'Gastroenteritis, abdominal pain, angina', 'Diarrhea, chronic obstructive pulmonary disease, angina', '2022-12-13 09:43:09', '2022-12-13 09:43:09', 'ans_b'),
(2281, NULL, 61, 1, '<p>Patient admitted for laparoscopic repair of right diaphragmatic hernia. Assign the ICD-10-PCS procedure code for this surgery.<br />\r\n<br />\r\n0BQR4ZZ Repair right diaphragm, percutaneous endoscopic approach<br />\r\n0BQR0ZZ Repair right diaphragm, open approach<br />\r\n0BQS4ZZ Repair left diaphragm, percutaneous endoscopic approach<br />\r\n0BQS0ZZ Repair left diaphragm, open approach</p>', '0BQR4ZZ', '0BQR0ZZ', '0BQS4ZZ', '0BQS0ZZ', '2022-12-13 09:43:38', '2022-12-13 09:43:38', 'ans_a'),
(2282, NULL, 61, 1, '<p>When trying to determine if documentation is present to substantiate status asthmaticus, the coder should review the record for what terms and phrases?</p>', 'Intractable pneumonia', 'Refractory asthma and severe, intractable wheezing', 'Airway obstruction relieved by bronchodilators', 'Limited but pronounced wheezing', '2022-12-13 09:44:13', '2022-12-13 09:44:13', 'ans_b'),
(2283, NULL, 61, 1, '<p>A patient was admitted with end stage renal disease (ESRD) following kidney transplant. The patient also had angina and chronic obstructive pulmonary disease. The diagnoses would be sequenced as:</p>', 'Kidney failure; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'End-stage renal disease; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'Chronic kidney disease, stage 5; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'Acute kidney failure; status post kidney transplant; chronic obstructive pulmonary disease; angina', '2022-12-13 09:45:03', '2022-12-13 09:45:03', 'ans_b'),
(2284, NULL, 61, 1, '<p>The root operation of resection applies to which of the following?<br />\r\n&nbsp;</p>', 'Removal of the entire body part and removal of an entire lobe of the liver', 'Partial incidental appendectomy and the closure portion of a procedure', 'Blunt, digital, manual, or mechanical lysis of adhesions', 'Partial cholecystectomy', '2022-12-13 09:47:30', '2022-12-13 09:47:30', 'ans_a'),
(2285, NULL, 61, 1, '<p>A patient has nausea and vomiting with abdominal pain due to acute cholecystitis. The physician documents the following on the discharge summary: acute cholecystitis, nausea, vomiting, and abdominal pain. The correct diagnosis code(s) are:</p>', 'Acute cholecystitis, nausea, vomiting, and abdominal pain', 'Acute cholecystitis, nausea, vomiting', 'Acute cholecystitis, nausea', 'Acute cholecystitis', '2022-12-13 09:48:24', '2022-12-13 09:48:24', 'ans_d'),
(2286, NULL, 61, 1, '<p>A patient was given heparin during hospitalization for a deep vein thrombophlebitis of the right lower extremity. The patient had back pain and the nurse was not answering the bell, so he decided to take two aspirin. The interaction between the aspirin and heparin caused a subcutaneous hemorrhage of the thigh of the right lower extremity. How should the interaction between aspirin and heparin be coded?</p>', 'Poisoning codes for aspirin and heparin, and subcutaneous hemorrhage of the thigh of the right lower extremity as secondary conditions', 'Poisoning codes for aspirin and heparin, and subcutaneous hemorrhage of the thigh of the right lower extremity as principal', 'Adverse effects of drugs for aspirin and heparin, and subcutaneous hemorrhage of the thigh of the right lower extremity as secondary conditions', 'Adverse effects of drugs for aspirin and heparin as secondary diagnoses, and subcutaneous hemorrhage of the thigh of the right lower extremity as principal', '2022-12-13 09:51:19', '2022-12-13 09:51:19', 'ans_a'),
(2287, NULL, 61, 1, '<p>Assign the code(s) for bronchoscopy with bilateral transbronchial biopsy for each lobe of each lung.<br />\r\n<br />\r\n31628 Bronchoscopy, rigid or flexible, including fluoroscopic guidance, when performed; with transbronchial lung biopsy(s), single lobe<br />\r\n31629 Bronchoscopy, rigid or flexible, including fluoroscopic guidance, when performed; with transbronchial needle aspiration biopsy(s), trachea, main stem and/or lobar bronchus(i)<br />\r\n31632 Bronchoscopy, rigid or flexible, including fluoroscopic guidance, when performed; with transbronchial lung biopsy(s), each additional lobe<br />\r\n&minus;50 Bilateral procedure</p>', '31628', '31628-50', '31628, 31632', '31629', '2022-12-13 09:52:05', '2022-12-13 09:52:05', 'ans_c'),
(2288, NULL, 61, 1, '<p>A patient is seen for evaluation of a right orbital roof fracture. How should this be coded?<br />\r\n<br />\r\nS02.19XA Other fracture of base of skull, initial encounter for closed fracture<br />\r\nS02.31XA Fracture of orbital floor, right side, initial encounter for closed fracture<br />\r\nS02.92XA Unspecified fracture of facial bones, initial encounter for closed fracture<br />\r\nS02.91XA Unspecified fracture of skull, initial encounter for closed fracture</p>', 'S02.19XA', 'S02.31XA', 'S02.92XA', 'S02.91XA', '2022-12-13 09:53:10', '2022-12-13 09:53:10', 'ans_a'),
(2289, NULL, 61, 1, '<p>Assign the best answer to complete the following sentence. The CPT codes for treatment of fractures:</p>', 'Use the terminology \"manipulation\" rather than \"reduction\" of fracture', 'Include internal fixation in all codes', 'Do not include application of cast', 'Do not differentiate between open and closed treatment; CPT only specifies the site of the fracture', '2022-12-13 09:54:20', '2022-12-13 09:54:20', 'ans_a'),
(2290, NULL, 61, 1, '<p>A patient had a normal pregnancy and delivery at 39 weeks gestation with loose nuchal cord around neck. Delivery was accompanied by an episiotomy with repair with birth of liveborn male infant. Delivery room record states &quot;no evidence of fetal problem.&quot; What diagnosis and procedure codes should be assigned?<br />\r\n<br />\r\nO80 Encounter for full-term uncomplicated delivery<br />\r\nO69.81X0 Labor and delivery complicated by cord around neck, without compression, not applicable or unspecified<br />\r\nZ3A.39 39 weeks gestation of pregnancy<br />\r\nZ37.0 Single live birth<br />\r\n10E0XZZ Delivery of products of conception, external approach<br />\r\n0W8NXZZ Division of female perineum, external approach<br />\r\n0WQNXZZ Repair female perineum, external approach</p>', 'O80, Z3A.39, Z37.0, 0W8NXZZ, 0WQNXZZ', 'O69.81X0, Z3A.39, Z37.0, 10E0XZZ, 0W8NXZZ', 'O69.81X0, 0W8NXZZ, 0WQNXZZ', 'O69.81X0, Z3A.39, Z37.0, 10E0XZZ, 0WQNXZZ', '2022-12-13 09:56:28', '2022-12-13 09:56:28', 'ans_b'),
(2291, NULL, 61, 1, '<p>A patient is admitted because of congestive heart failure (CHF). During the treatment of the CHF, the patient was also found to have elevated liver function tests. The physician worked up the elevated liver function tests but was not able to determine a diagnosis. The following diagnoses should be assigned:</p>', 'Congestive heart failure with liver disease', 'Abnormal liver function tests', 'Congestive heart failure and abnormal liver function tests', 'Congestive heart failure', '2022-12-13 09:57:40', '2022-12-13 09:57:40', 'ans_c'),
(2292, NULL, 61, 1, '<p>Physician performed a myringotomy under general anesthesia for insertion of bilateral ventilating tubes on a 4-year-old male. This is due to chronic otitis media. What is the correct CPT code assignment and what modifier should be appended (if applicable) to this procedure code?<br />\r\n<br />\r\n69421 Myringotomy including aspiration and/or eustachian tube inflation requiring general anesthesia<br />\r\n69436 Tympanostomy (requiring insertion of ventilating tube), general anesthesia<br />\r\n&minus;50 Bilateral procedure<br />\r\n&minus;51 Multiple procedures<br />\r\n&minus;RT Right side<br />\r\n&minus;LT Left side</p>', '69421-RT', '69421-LT', '69436-51', '69436-50', '2022-12-13 09:58:23', '2022-12-13 09:58:23', 'ans_d'),
(2293, NULL, 61, 1, '<p>A patient presents to a facility for upper endoscopy implant of material into the muscle of the lower esophageal sphincter. The correct coding and sequencing of this patient&#39;s record is:<br />\r\n<br />\r\n43235 Upper gastrointestinal endoscopy including esophagus, stomach, and either the duodenum and/or jejunum as appropriate; diagnostic, with or without collection of specimen(s) by brushing or washing (separate procedure)<br />\r\n43236 with directed submucosal injection(s), any substance<br />\r\n43257 with delivery of thermal energy to the muscle of lower esophageal sphincter and/or gastric cardia, for treatment of gastroesophageal reflux disease<br />\r\n43270 with ablation of tumor(s), polyp(s), or other lesion(s) (includes pre- and post- dilation and guide wire passage, when performed.<br />\r\n&minus;59 Distinct procedure service<br />\r\n&nbsp;</p>', '43257', '43235, 43236', '43236', '43270-58, 43236-59', '2022-12-13 09:59:22', '2022-12-13 09:59:22', 'ans_c'),
(2294, NULL, 61, 1, '<p>A patient is readmitted two weeks after a laminectomy for spinal stenosis with a headache and documentation that the headache is due to a tear in the dura accidently that occurred during the prior laminectomy surgery. The patient is taken to the operating room for repair of the dura. The diagnosis code(s) assigned for this admission would be:</p>', 'M48.06, Spinal stenosis, lumbar region', 'G97.41, Accidental puncture or laceration of dura during a procedure', 'G97.1, Other reaction to spinal and lumbar puncture', 'S34.109A, Unspecified injury to unspecified level of lumbar spinal cord, initial encounter', '2022-12-13 10:00:02', '2022-12-13 10:00:02', 'ans_b'),
(2295, NULL, 61, 1, '<p>A virtual screening colonoscopy would be coded as:<br />\r\n<br />\r\n45378 Colonoscopy, flexible, proximal to splenic flexure; diagnostic, with or without collectionof specimen(s) by brushing or washing, with or without colon decompression (separateprocedure)<br />\r\n45391 Colonoscopy, flexible, proximal to splenic flexure; with endoscopic ultrasound examination<br />\r\n74263 Computed tomographic (CT) colonography, screening including image postprocessing<br />\r\n76376 3D rendering with interpretation and reporting of computed tomography, magnetic resonance imaging, ultrasound, or other tomographic modality with image post-processing under concurrent supervision; not requiring image postprocessing on an independent workstation</p>', '74263', '45391', '45378', '76376', '2022-12-13 10:00:56', '2022-12-13 10:00:56', 'ans_a'),
(2296, NULL, 61, 1, '<p>A patient takes Coumadin as prescribed, and correctly administered. However, the patient develops hematuria secondary to the Coumadin use. The correct coding assignment for this case would be:</p>', 'Poisoning due to Coumadin', 'Unspecified adverse reaction to Coumadin', 'Hematuria, poisoning due to Coumadin', 'Hematuria, adverse reaction to Coumadin', '2022-12-13 10:01:33', '2022-12-13 10:01:33', 'ans_d'),
(2297, NULL, 61, 1, '<p>A patient was seen for first- and second-degree burns of the upper thigh. How should this be coded?<br />\r\n<br />\r\nT24.099A Burn of unspecified degree of multiple sites of unspecified lower limb, exceptankle and foot, initial encounter<br />\r\nT24.019A Burn of unspecified degree of unspecified thigh, initial encounter<br />\r\nT24.119A Burn of first degree of unspecified thigh, initial encounter<br />\r\nT24.219A Burn of second degree of unspecified thigh, initial encounter</p>', 'T24.099A', 'T24.019A', 'T24.119A, T24.219A', 'T24.219A', '2022-12-13 10:02:13', '2022-12-13 10:02:13', 'ans_d'),
(2298, NULL, 61, 1, '<p>According to CPT, a repair of a laceration that includes retention sutures would be considered what type of closure?</p>', 'Simple', 'Intermediate', 'Not specified', 'Complex', '2022-12-13 10:02:51', '2022-12-13 10:02:51', 'ans_d'),
(2299, NULL, 61, 1, '<p>In outpatient surgery, a patient undergoes a direct laryngoscopy with operating microscope. What code should be assigned?<br />\r\n<br />\r\n31515 Laryngoscopy direct, with or without tracheoscopy; for aspiration<br />\r\n31520 Laryngoscopy direct, with or without tracheoscopy; diagnostic newborn<br />\r\n31525 Laryngoscopy direct, with or without tracheoscopy; diagnostic except newborn<br />\r\n31526 Laryngoscopy direct, with or without tracheoscopy; diagnostic, with operating microscope or telescope</p>', '31515', '31520', '31525', '31526', '2022-12-13 10:10:32', '2022-12-13 10:10:32', 'ans_d');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(2300, NULL, 61, 1, '<p>Assign the code for dilation and curettage for retained products of conception abortion at 11 weeks&#39; gestation.<br />\r\n<br />\r\n10A07ZW Abortion of products of conception, laminaria, via natural or artificial opening<br />\r\n10A07ZZ Abortion of products of conception, via natural or artificial opening<br />\r\n10D17ZZ Extraction of products of conception, retained, via natural or artificial opening<br />\r\n10D27ZZ Extraction of products of conception, ectopic, via natural or artificial opening</p>', '10D17ZZ', '10A07ZZ', '10A07ZW', '10D27ZZ', '2022-12-13 10:14:50', '2022-12-13 10:14:50', 'ans_a'),
(2301, NULL, 61, 1, '<p>When coding a documented ventilator associated pneumonia (VAP), what codes should be assigned?</p>', 'The pneumonia is coded first.', 'The complication of surgery is coded first.', 'The specific code for ventilator associated pneumonia is coded first and the organism is coded as a secondary code if known.', 'An additional code for the type of pneumonia, that is, lobar or pneumonia NOS, is coded.', '2022-12-13 10:15:36', '2022-12-13 10:15:36', 'ans_c'),
(2302, NULL, 61, 1, '<p>A 12-year-old boy was seen in an ambulatory surgical center for pain in his right arm. The x-ray showed fracture of ulna. Patient underwent closed reduction of fracture right proximal ulna. What diagnostic and procedure codes should be assigned?<br />\r\n<br />\r\nS52.101A Unspecified fracture of upper end of right radius, initial encounter for closed fracture<br />\r\nS52.101B Unspecified fracture of upper end of right radius, initial encounter for open fracture<br />\r\nS52.001A Unspecified fracture of upper end of right ulna, initial encounter for closed fracture<br />\r\nS52.001B Unspecified fracture of upper end of right ulna, initial encounter for open fracture<br />\r\n0PSH0ZZ Reposition right radius, open approach<br />\r\n0PSK0ZZ Reposition right ulna, open approach<br />\r\n24670 Closed treatment of ulnar fracture, proximal end (eg, olecranon or coronoid process(es) ); without manipulation<br />\r\n24675 Closed treatment of ulnar fracture, proximal end (eg, olecranon or coronoid process(es) ); with manipulation<br />\r\n25560 Closed treatment of radial and ulnar shaft fractures; without manipulation</p>', 'S52.101A, S52.001A, 0PSK0ZZ', 'S52.101B, S52.001B, 0PSH0ZZ', 'S52.101B, S52.001B, 25560', 'S52.001A, 24675', '2022-12-13 10:16:48', '2022-12-13 10:16:48', 'ans_d'),
(2303, NULL, 61, 1, '<p>Removal of two (2) skin tags on chest (0.3 cm and 0.5 cm). What is the correct CPT code(s) assignment?<br />\r\n<br />\r\n11200 Removal of skin tags, multiple fibrocutaneous tags, any area; up to and including 15 lesions<br />\r\n11201 Removal of skin tags, multiple fibrocutaneous tags, any area; each additional 10 lesions, or part thereof (List separately in additional to code for primary procedure.)<br />\r\n11305 Shaving of epidermal or dermal lesion, single lesion, scalp neck, hands, feet, genitalia; lesion diameter 0.5 cm or less</p>', '11200, 11201', '11305, 11305', '11305', '11200', '2022-12-13 10:18:04', '2022-12-13 10:18:04', 'ans_d'),
(2304, NULL, 61, 1, '<p>A patient with human immunodeficiency virus (HIV) with methicillin susceptible pneumonia due to Staphylococcus aureus was discharged from the acute-care setting. How should this be coded?<br />\r\n<br />\r\nB20 Human immunodeficiency virus [HIV] disease<br />\r\nJ15.20 Pneumonia due to other staphylococcus<br />\r\nJ15.211 Pneumonia due to methicillin susceptible Staphylococcus aureus<br />\r\nJ15.212 Pneumonia due to methicillin resistant Staphylococcus aureus<br />\r\nJ17 Pneumonia in diseases classified elsewhere</p>', 'B20, J17', 'B20, J15.20', 'B20, J15.211', 'B20, J15.212', '2022-12-13 10:18:42', '2022-12-13 10:18:42', 'ans_c'),
(2305, NULL, 61, 1, '<p>Assign the code(s) for extraction of extracapsular cataract with simultaneous intraocular lens insertion in the right eye.<br />\r\n<br />\r\n66982 Extracapsular cataract removal with insertion of intraocular lens prosthesis (1-stage procedure), manual or mechanical technique (eg, irrigation and aspiration or phacoemulsification), complex requiring devices or techniques not generally used in routine cataract surgery (eg, iris expansion device, suture support for intraocular lens, or primary posterior capsulorhexis), or performed on patients in the amblyogenic developmental stage<br />\r\n66983 Intracapsular cataract extraction with insertion of intraocular lens prosthesis (1-stage procedure)<br />\r\n66984 Extracapsular cataract removal with insertion of intraocular lens prosthesis (1-stage procedure), manual or mechanical technique (eg, irrigation and aspiration or phacoemulsification)<br />\r\n&minus;51 Multiple procedures<br />\r\n&minus;RT Right side</p>', '66982-RT', '66983-RT', '66984-RT', '66984-51', '2022-12-13 10:19:36', '2022-12-13 10:19:36', 'ans_c'),
(2306, NULL, 61, 1, '<p>Normal twin delivery at 30 weeks. Both babies were delivered vaginally and were liveborn. What conditions should have codes assigned?<br />\r\n<br />\r\nO30.003 Twin pregnancy, unspecified number of placenta and unspecified number of amniotic sacs, third trimester<br />\r\nO30.009 Twin pregnancy, unspecified number of placenta and unspecified number of amniotic sacs, unknown trimester<br />\r\nO60.14X0 Preterm labor third trimester with preterm delivery third trimester, not applicable or unspecified<br />\r\nO80 Encounter for full-term uncomplicated delivery<br />\r\nZ3A.30 30 weeks gestation of pregnancy<br />\r\nZ37.0 Single live birth<br />\r\nZ37.2 Twins, both liveborn</p>', 'O80, Z3A.30, Z37.0', 'O30.003, Z3A.30, Z37.2', 'O60.14X0, O30.003, Z3A.30, Z37.2', 'O80, O30.009, Z3A.30, Z37.2', '2022-12-13 10:20:18', '2022-12-13 10:20:18', 'ans_c'),
(2307, NULL, 61, 1, '<p>A patient undergoes a colposcopy with endometrial biopsy. Which of the following is correct?</p>', 'The colposcopy and endometrial biopsy are represented by a combination code.', 'Two codes would be used with modifier -59 appended.', 'Two codes would be used in accordance with 2015 CPT code revisions.', 'Only one code is used and it does not state that it includes endometrial biopsy specifically.', '2022-12-13 10:20:56', '2022-12-13 10:20:56', 'ans_c'),
(2308, NULL, 61, 1, '<p>Gastrointestinal bleeding manifests as:</p>', 'Hematemesis which indicates acute upper gastrointestinal hemorrhage', 'Petechia', 'Vomiting', 'Constipation which indicates upper or lower gastrointestinal hemorrhage', '2022-12-13 10:21:30', '2022-12-13 10:21:30', 'ans_a'),
(2309, NULL, 61, 1, '<p>Which of the following is not part of a facility coding compliance plan?<br />\r\n&nbsp;</p>', 'Regular internal audits', 'Audits performed by objective external reviewers', 'Coding audits performed by payers', 'Sharing and discussing results with coding staff', '2022-12-13 10:22:00', '2022-12-13 10:22:00', 'ans_c'),
(2310, NULL, 61, 1, '<p>A patient presents to the outpatient surgical area for a cystoscopy with multiple biopsies of the bladder. The patient&#39;s presenting symptom is hematuria. What is the correct code assignment for this procedure?<br />\r\n<br />\r\n52000 Cystourethroscopy (separate procedure)<br />\r\n52204 Cystourethroscopy with biopsy(s)<br />\r\n&minus;22 Increased procedural services<br />\r\n&nbsp;</p>', '52000', '52000-22', '52204', '52204-22', '2022-12-13 10:22:32', '2022-12-13 10:22:32', 'ans_c'),
(2311, NULL, 61, 1, '<p>Name the types of pacemaker devices that each have a unique ICD-10-PCS code.</p>', 'Dual chamber rate responsive', 'Single chamber rate responsive, and dual chamber', 'Multiple chamber', 'Multiple chamber rate responsive', '2022-12-13 10:23:06', '2022-12-13 10:23:06', 'ans_b'),
(2312, NULL, 61, 1, '<p>A patient is admitted to the hospital due to a fracture of the right hip and is scheduled for an open reduction with internal fixation. The patient developed cardiac arrhythmia which results in an inability to do the planned surgery. Assign a code for the principal diagnosis.</p>', 'Status post fracture', 'Cardiac arrhythmia', 'Right hip fracture', 'Admission for possible fracture', '2022-12-13 10:23:36', '2022-12-13 10:23:36', 'ans_c'),
(2313, NULL, 61, 1, '<p>A patient is admitted with an acute exacerbation of COPD with stage 5 hypertensive kidney disease. What is the correct diagnostic code assignment?<br />\r\n<br />\r\nI12.0 Hypertensive chronic kidney disease with stage 5 or end-stage renal disease<br />\r\nI12.9 Hypertensive chronic kidney disease, stage 1 through stage 4, or unspecified with chronic kidney disease<br />\r\nJ44.1 Chronic obstructive pulmonary disease with exacerbation<br />\r\nJ44.9 Chronic obstructive pulmonary disease, unspecified<br />\r\nN18.5 Chronic kidney disease, stage 5</p>', 'J44.9, I12.0', 'J44.1, I12.9', 'J44.9, I12.0', 'J44.1, I12.0, N18.5', '2022-12-13 10:24:10', '2022-12-13 10:24:10', 'ans_d'),
(2314, NULL, 61, 1, '<p>A patient was admitted to the endoscopy unit for a screening colonoscopy. During the colonoscopy, polyps of the colon were found and a polypectomy was performed. What diagnostic codes should be used and how should they be sequenced?<br />\r\n<br />\r\nZ12.11 Encounter for screening for malignant neoplasm of colon<br />\r\nD12.6 Benign neoplasm of colon, unspecified</p>', 'Z12.11', 'D12.6', 'Z12.11, D12.6', 'D12.6, Z12.11', '2022-12-13 10:24:42', '2022-12-13 10:24:42', 'ans_c'),
(2315, NULL, 61, 1, '<p>With regard to the implementation of ICD-10-CM, all of the following are correct except:</p>', 'ICD-10-CM was developed by NCHS', 'ICD-10-CM and ICD-10-PCS will be fully implemented beginning October 1, 2016', 'ICD-10 is already being used in the United States for death certificate coding', 'The process of adoption of ICD-10-CM is specified in HIPAA', '2022-12-13 10:25:18', '2022-12-13 10:25:18', 'ans_b'),
(2316, NULL, 61, 1, '<p>A patient is admitted to the hospital with shortness of breath and congestive heart failure and subsequently develops respiratory failure. The patient undergoes intubation with ventilator management. The correct sequencing of the diagnoses in this case would be:</p>', 'Congestive heart failure and respiratory failure', 'Respiratory failure', 'Respiratory failure and congestive heart failure', 'Shortness of breath, congestive heart failure, and respiratory failure', '2022-12-13 10:25:47', '2022-12-13 10:25:47', 'ans_a'),
(2317, NULL, 61, 1, '<p>If a patient is admitted with a substance-related psychosis, what is coded?</p>', 'The psychosis is coded first and the drug or alcohol dependence is coded second.', 'The drug or alcohol dependence is coded first.', 'The drug or alcohol dependence is not coded.', 'The psychosis is not coded.', '2022-12-13 10:26:24', '2022-12-13 10:26:24', 'ans_a'),
(2318, NULL, 61, 1, '<p>A 65-year-old patient is admitted with pain and loosening of a left total hip prosthesis. The acetabular component has loosened and become painful. The patient was admitted for open removal and replacement of the acetabular component of the left hip prosthesis. What is the appropriate code(s) for the admission?<br />\r\n<br />\r\nT84.031A Mechanical loosening of internal left hip prosthetic joint, initial encounter<br />\r\nT84.031D Mechanical loosening of internal left hip prosthetic joint, subsequent encounter<br />\r\nT84.030A Mechanical loosening of internal right hip prosthetic joint, initial encounter<br />\r\nT84.50XA Infection and inflammatory reaction due to unspecified internal joint prosthesis, initial encounter<br />\r\nZ96.642 Presence of left artificial hip joint<br />\r\n0SP90JZ Removal of synthetic substitute from right hip joint, open approach<br />\r\n0SPB0JZ Removal of synthetic substitute from left hip joint, open approach<br />\r\n0SUA0BZ Supplement right hip joint, acetabular surface with resurfacing device, open approach<br />\r\n0SUR0BZ Supplement right hip joint, femoral surface with resurfacing device, open approach<br />\r\n0SUA0BZ Supplement, right hip joint, acetabular surface with resurfacing device, open approach<br />\r\n0SRA0JZ Replacement of right hip joint, acetabular surface with synthetic substitute, open approach<br />\r\n0SRE0JZ Replacement of left hip joint, acetabular surface with synthetic substitute, open approach</p>', 'T84.031A, 0SPB0JZ, 0SRE0JZ', 'T84.50XA, 0SUR0BZ', 'T84.031D, Z96.642, 0SP90JZ', 'T84.50XA, Z96.642 0SUR0BZ, 0SUA0BZ', '2022-12-13 10:27:03', '2022-12-13 10:27:03', 'ans_a'),
(2319, NULL, 61, 1, '<p>Assign the code(s) for chest X-ray, complete.<br />\r\n<br />\r\n71010 Radiologic examination, chest; single view, frontal<br />\r\n71020 Radiologic examination, chest, 2 views, frontal and lateral<br />\r\n71030 Radiologic examination, chest, complete, minimum 4 views<br />\r\n71035 Radiologic examination, chest, special views (eg, lateral decubitus, Bucky studies)</p>', '71020', '71030', '71010, 71035', '71035', '2022-12-13 10:27:44', '2022-12-13 10:27:44', 'ans_b'),
(2320, NULL, 61, 1, '<p>A maternity patient is admitted in labor at 43 weeks. She has a normal delivery with vacuum extraction to facilitate the baby&#39;s delivery. Which of the following would be the principal diagnosis?<br />\r\n<br />\r\nO80 Encounter for full-term uncomplicated delivery<br />\r\nO48.0 Post-term pregnancy<br />\r\nO48.1 Prolonged pregnancy<br />\r\nO66.5 Attempted application of vacuum extractor and forceps</p>', 'O48.0', 'O48.1', 'O80', 'O66.5', '2022-12-13 10:28:10', '2022-12-13 10:28:10', 'ans_b'),
(2321, NULL, 61, 1, '<p>A patient was discharged from the same-day-surgery unit with the following diagnoses: posterior subcapsular mature incipient senile cataract right eye, diabetes mellitus, hypertension, and was treated for mild acute renal failure. Which codes are correct?<br />\r\n<br />\r\nE11.36 Type 2 diabetes mellitus without complications<br />\r\nE11.29 Type 2 diabetes mellitus with other diabetic kidney complication<br />\r\nH25.9 Unspecified age-related cataract<br />\r\nH25.21 Age-related cataract, morgagnian type, right eye<br />\r\nH25.041 Posterior subcapsular polar age-related cataract, right eye<br />\r\nI10 Essential hypertension<br />\r\nI12.9 Hypertensive chronic kidney disease with stage 1 through stage 4, or unspecified chronic kidney disease<br />\r\nN17.9 Acute kidney failure, unspecified</p>', 'H25.21, E11.29, I12.9, N17.9', 'H25.041, E11.36, I10, N17.9', 'H25.9, E11.29, I12.9, N17.9', 'H25.041, E11.9, I12.9', '2022-12-13 10:28:44', '2022-12-13 10:28:44', 'ans_b'),
(2322, NULL, 61, 1, '<p>Suicide attempt with overdose of Percocet. How should this be coded?<br />\r\n<br />\r\nF11.10 Opioid abuse, uncomplicated<br />\r\nT40.2X1A Poisoning by other opioids, accidental (unintentional), initial encounter<br />\r\nT40.2X2A Poisoning by other opioids, intentional self-harm, initial encounter<br />\r\nT40.2X3A Poisoning by other opioids, assault, initial encounter<br />\r\nT40.2X4A Poisoning by other opioids, undetermined, initial encounter<br />\r\nT40.2X5A Adverse effect of other opioids, initial encounter</p>', 'F11.10, T40.2X2A', 'T40.2X2A', 'F11.10, T40.2X5A', 'T40.2X5A', '2022-12-13 10:29:17', '2022-12-13 10:29:17', 'ans_b'),
(2323, NULL, 61, 1, '<p>In CPT, unlisted codes are reported only if:</p>', 'There is not a current CPT category I code available', 'There is not a current CPT category III code available', 'There is not a current CPT category II code available', 'There is not a HCPCS Level II code or a current CPT level III code', '2022-12-13 10:29:48', '2022-12-13 10:29:48', 'ans_d'),
(2324, NULL, 61, 1, '<p>Carcinoma of multiple overlapping sites of the bladder. Diagnostic cystoscopy and transurethral fulguration of bladder lesions (1.9 cm, 6.0 cm) are undertaken. The appropriate CPT code(s) would be:<br />\r\n<br />\r\n52000 Cystourethroscopy (separate procedure)<br />\r\n52224 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) or treatment of minor (less than 0.5 cm) lesion(s) with or without biopsy<br />\r\n52234 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of small bladder tumor(s) (0.5 cm to 2.0 cm)<br />\r\n52235 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of medium bladder tumor(s) (2.0 cm to 5.0 cm)<br />\r\n52240 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of large bladder tumor(s)</p>', '52234, 52240', '52235', '52240', '52000, 52234', '2022-12-13 10:30:19', '2022-12-13 10:30:19', 'ans_c'),
(2325, NULL, 61, 1, '<p>Assign the correct code for an open total cholecystectomy with exploration of common bile duct and removal of common bile duct stone.</p>', '0FT40ZZ, Resection gallbladder, open approach and 0FC90ZZ, Removal, common bile duct stone, open', '0FT44ZZ, Resection gallbladder, laparoscopic approach and 0FC90ZZ, Removal, common bile duct stone, open', '0FQ40ZZ, Repair gallbladder, open approach', '0FC90ZZ, Removal, common bile duct stone, open approach', '2022-12-13 10:30:54', '2022-12-13 10:30:54', 'ans_a'),
(2326, NULL, 61, 1, '<p>A 45-year-old female with chronic ulcerative enterocolitis and steroid induced osteoporosis due to long-term steroid therapy. What codes should be assigned?<br />\r\n<br />\r\nK50.00 Crohn&#39;s disease of small intestine without complications<br />\r\nK51.00 Ulcerative pancolitis without complications<br />\r\nM81.0 Age-related osteoporosis without current pathological fracture<br />\r\nM81.8 Other osteoporosis without current pathological fracture<br />\r\nT38.0X5A Adverse effects of glucocorticoids and synthetic analogues, initial encounter<br />\r\nZ79.52 Long term (current) use of systemic steroids<br />\r\nZ79.899 Other long term (current) drug therapy</p>', 'K51.00, M81.8, T38.0X5A, Z79.52', 'K50.00, M81.0, T38.0X5A, Z79.52', 'K51.00, M81.0, T38.0X5A, Z79.899', 'K50.00, M81.8, T38.0X5A, Z79.52', '2022-12-13 10:31:27', '2022-12-13 10:31:27', 'ans_a'),
(2327, NULL, 61, 1, '<p>A patient was diagnosed with L4-5 lumbar neuropathy and discogenic pain. The patient underwent a percutaneous intradiscal electrothermal annuloplasty (IDET) in the radiology suite. What ICD-10-PCS code should be used?</p>', '0S520ZZ, Destruction, lumbar vertebral disc, open approach', '015B0ZZ, Destruction, lumbar nerve, open approach', '0S523ZZ, Destruction, lumbar vertebral disc, percutaneous', '0SB20ZZ, Excision, lumbar vertebral disc, open approach', '2022-12-13 10:31:59', '2022-12-13 10:31:59', 'ans_c'),
(2328, NULL, 61, 1, '<p>When coding benign lipomatous neoplasms of skin, the section noted above directs the coder to:<br />\r\n<br />\r\nD23- Other benign neoplasms of skin<br />\r\nIncludes: Benign neoplasm of hair follicles<br />\r\n--Benign neoplasm of sebaceous glands<br />\r\n--Benign neoplasm of sweat glands<br />\r\nExcludes 1:<br />\r\n--Benign lipomatous neoplasms of skin (D17.0-D17.3)<br />\r\n--Melanocytic nevi (D22.-)</p>', 'Use category D23', 'Use a code from D17.0-D17.3', 'Use code E88.2', 'Use category D22', '2022-12-13 10:32:35', '2022-12-13 10:32:35', 'ans_b'),
(2329, NULL, 61, 1, '<p>Assign the code(s) for endoscopic sinusotomy with bilateral anterior ethmoidectomy.<br />\r\n<br />\r\n31231 Nasal endoscopy, diagnostic, unilateral or bilateral (separate procedure)<br />\r\n31254 Nasal/sinus endoscopy, surgical; with ethmoidectomy, partial (anterior)<br />\r\n&minus;50 Bilateral procedure</p>', '31254', '31254-50', '31254, 31254', '31231', '2022-12-13 10:33:03', '2022-12-13 10:33:03', 'ans_b'),
(2330, NULL, 61, 1, '<p>A 75-year-old female was admitted for acute myocardial infarction and underwent a diagnostic cardiac catheterization. Following the catheterization, the patient developed a thrombophlebitis documented as due to the catheter in the common femoral artery. The thrombophlebitis would be coded as:</p>', 'T81.718A, Complication of other artery following a procedure, not elsewhere classified, initial encounter', 'I97.51, Accidental puncture and laceration of a circulatory system organ or structure during a circulatory system procedure', 'I72.4, Aneurysm of artery of lower extremity', 'I97.52, Accidental puncture and laceration of a circulatory system organ or structure during other procedure', '2022-12-13 10:33:58', '2022-12-13 10:33:58', 'ans_a'),
(2331, NULL, 61, 1, '<p>An inpatient is discharged with a diagnosis of &quot;either irritable bowel or pancreatitis.&quot; Which condition would be the principal diagnosis?<br />\r\n&nbsp;</p>', 'Code both and sequence according to the circumstances of the admission', 'Pancreatitis', 'Irritable bowel syndrome', 'Observation for suspected gastrointestinal condition', '2022-12-13 10:34:27', '2022-12-13 10:34:27', 'ans_a'),
(2332, NULL, 61, 1, '<p>Assign the code(s) for bilateral epidural lumbar injection of steroids:<br />\r\n<br />\r\n62282 Injection/infusion of neurolytic substance (eg, alcohol, phenol, iced saline solutions, with or without other therapeutic substance; epidural, lumbar, sacral [caudal])<br />\r\n62311 Injection(s), of diagnostic or therapeutic substance(s) (including anesthetic,antispasmodic, opioid, steroid, other solution), not including neurolytic substances,including needle or catheter placement, includes contrast for localization whenperformed, epidural or subarachnoid; lumbar or sacral (caudal)<br />\r\n&minus;50 Bilateral procedure</p>', '62282', '62311', '62311, 62311', '62311-50', '2022-12-13 10:34:59', '2022-12-13 10:34:59', 'ans_b'),
(2333, NULL, 62, 1, '<p>This patient was admitted for chemotherapy due to a primary hepatocellular carcinoma of the transplanted liver. What codes are assigned?</p>', 'Z51.11, C22.0', 'Z51.11, C22.0, C80.2', 'Z51.11, T86.49, C80.2, C22.0', 'T86.49, C80.2, C22.0', '2022-12-14 05:57:58', '2022-12-14 05:57:58', 'ans_c'),
(2334, NULL, 62, 1, '<p>A 7-year-old patient was admitted to the emergency department for treatment of shortness of breath. The patient is given epinephrine and nebulizer treatments. The shortness of breath and wheezing are unabated following treatment. What diagnosis should be suspected?</p>', 'Acute bronchitis', 'Acute bronchitis with chronic obstructive pulmonary disease', 'Asthma with status asthmaticus', 'Chronic obstructive asthma', '2022-12-14 05:59:21', '2022-12-14 05:59:21', 'ans_c'),
(2335, NULL, 62, 1, '<p>A patient is admitted with a high temperature, lethargy, hypotension, tachycardia, oliguria, and elevated WBC. The patient also has more than 100,000 organisms of Escherichia coli per cc of urine. The attending physician documents &quot;urosepsis.&quot; What is the next step for the coder?</p>', 'Code sepsis as the principal with a secondary diagnosis of urinary tract infection due to E. coli.', 'Code urinary tract infection with sepsis as a secondary diagnosis', 'Query the physician to determine if the patient is being treated for sepsis, highlighting the clinical signs and symptoms.', 'Ask the physician whether the patient had septic shock so that this may be used as the principal diagnosis.', '2022-12-14 06:00:20', '2022-12-14 06:00:20', 'ans_c'),
(2336, NULL, 62, 1, '<p>During a coronary artery bypass surgery, the patient underwent saphenous bypass grafts; from the aorta to the left anterior descending branch of the left main coronary artery, and the left posterior descending of the left main coronary artery. The patient also underwent a repositioning of the mammary artery to the right coronary artery. Choose the best description for this procedure.</p>', 'Three aortocoronary grafts', 'Two aortocoronary grafts and one mammary-coronary graft', 'Two aortocoronary grafts and two saphenous bypass grafts', 'Three aortocoronary grafts and one mammary-coronary graft', '2022-12-14 06:01:00', '2022-12-14 06:01:00', 'ans_b'),
(2337, NULL, 62, 1, '<p>According to CPT, an endoscopy that is undertaken to the level of the midtransverse colon would be coded as a:</p>', 'Proctosigmoidoscopy', 'Sigmoidoscopy', 'Colonoscopy', 'Proctoscopy', '2022-12-14 06:01:40', '2022-12-14 06:01:40', 'ans_c'),
(2338, NULL, 62, 1, '<p>Infusion of Herceptin, a monoclonal antibody used for treatment of breast cancer in patients carrying a certain mutation of the HER2 gene, is classified as:</p>', 'Chemotherapy', 'Radiotherapy', 'Molecular Targets', 'Immunotherapy', '2022-12-14 06:02:09', '2022-12-14 06:02:09', 'ans_c'),
(2339, NULL, 62, 1, '<p>A patient has findings suggestive of chronic obstructive pulmonary disease (COPD) on chest x-ray. The attending physician mentions the x-ray finding in one progress note but no medication, treatment, or further evaluation is provided. The coder should</p>', 'Query the attending physician regarding the x-ray finding', 'Code the condition because the documentation reflects it', 'Question the radiologist regarding whether to code this condition', 'Use a code from abnormal findings to reflect the condition', '2022-12-14 06:02:44', '2022-12-14 06:02:44', 'ans_a'),
(2340, NULL, 62, 1, '<p>If a patient undergoes an inpatient procedure and the final summary diagnosis is different from the diagnosis on the pathology report, the coder should:</p>', 'Code only from the discharge diagnoses', 'Code the diagnosis reflected on the pathology report', 'Code the most severe symptom', 'Query the attending physician as to the final diagnosis', '2022-12-14 06:03:18', '2022-12-14 06:03:18', 'ans_d'),
(2341, NULL, 62, 1, '<p>A 56-year-old woman is admitted to an acute-care facility from a skilled nursing facility. The patient has multiple sclerosis and hypertension. During the course of hospitalization, a decubitus ulcer is found and debrided at the bedside by a physician. There is no typed operative report and no pathology report. The coder should:</p>', 'Use an excisional debridement code as these charts are rarely reviewed to verify the excisional debridement', 'Code with a nonexcisional debridement procedure code', 'Query the healthcare provider who performed the procedure to determine if the debridement was excisional', 'Eliminate the procedure code all together', '2022-12-14 06:04:08', '2022-12-14 06:04:08', 'ans_c'),
(2342, NULL, 62, 1, '<p>A 23-year-old female is admitted for shock following treatment of a miscarriage. The pathology report from the previous admission reveals that the patient had no decidua or products of conception in the tissue removed. This encounter would be coded as:</p>', 'O03.81, Spontaneous abortion complicated by shock', 'O08.9, Complication following abortion and ectopic and molar pregnancies', 'R57.9, Shock NOS', 'T81.10XA, Postoperative shock', '2022-12-14 06:04:49', '2022-12-14 06:04:49', 'ans_b'),
(2343, NULL, 62, 1, '<p>Most hospitals require a medical record is completed within:</p>', '5 days', '10 days', '7 days', '30 days', '2022-12-14 06:15:41', '2022-12-14 06:15:41', 'ans_d'),
(2344, NULL, 62, 1, '<p>To correct an entry in the medical record, the provider should:</p>', 'Draw a single line through the error, add a note explaining the error, initial and date, add the correct information in chronological order', 'Draw a double line through the error, initial and date, add the reason for the correction', 'Draw a single line through the error, and add the correct information in chronological order', 'Draw several lines through the error, obliterate the documentation as much as possible, initial and date, add the correct information in chronological order', '2022-12-14 06:16:20', '2022-12-14 06:16:20', 'ans_a'),
(2345, NULL, 62, 1, '<p>After a patient is discharged from the hospital, the medical record must be reviewed for:</p>', 'Inclusion of all incident reports', 'Certain basic reports (for example, history and physical, discharge summary, etc.)', 'Voided prescription pads', 'Personal case notes from all mental health providers', '2022-12-14 06:17:13', '2022-12-14 06:17:13', 'ans_b'),
(2346, NULL, 62, 1, '<p>A patient is discharged with a diagnosis of acute pulmonary edema due to congestive heart failure. What condition(s) should be coded?</p>', 'Acute pulmonary edema', 'Congestive heart failure', 'Acute pulmonary edema and congestive heart failure', 'Unable to determine based on the information provided', '2022-12-14 06:17:58', '2022-12-14 06:17:58', 'ans_b'),
(2347, NULL, 62, 1, '<p>A 65-year-old patient is admitted with pain and loosening of a left total hip prosthesis. The acetabular component has loosened and become painful. The patient was admitted for open removal and replacement of the acetabular component of the left hip prosthesis. What is the appropriate code(s) for the admission?<br />\r\n<br />\r\nT84.031A Mechanical loosening of internal left hip prosthetic joint, initial encounter<br />\r\nT84.031D Mechanical loosening of internal left hip prosthetic joint, subsequent encounter<br />\r\nT84.030A Mechanical loosening of internal right hip prosthetic joint, initial encounter<br />\r\nT84.50XA Infection and inflammatory reaction due to unspecified internal joint prosthesis, initial encounter<br />\r\nZ96.642 Presence of left artificial hip joint<br />\r\n0SP90JZ Removal of synthetic substitute from right hip joint, open approach<br />\r\n0SPB0JZ Removal of synthetic substitute from left hip joint, open approach<br />\r\n0SUA0BZ Supplement right hip joint, acetabular surface with resurfacing device, open approach<br />\r\n0SUR0BZ Supplement right hip joint, femoral surface with resurfacing device, open approach<br />\r\n0SRA0JZ Replacement of right hip joint, acetabular surface with synthetic substitute, open approach<br />\r\n0SRE0JZ Replacement of left hip joint, acetabular surface with synthetic substitute, open approach</p>', 'T84.031A, 0SPB0JZ, 0SRE0JZ', 'T84.50XA, 0SUR0BZ', 'T84.031D, Z96.642, 0SP90JZ', 'T84.50XA, Z96.642 0SUR0BZ, 0SUA0BZ', '2022-12-14 06:18:48', '2022-12-14 06:18:48', 'ans_a'),
(2348, NULL, 62, 1, '<p>A maternity patient is admitted in labor at 43 weeks. She has a normal delivery with vacuum extraction to facilitate the baby&#39;s delivery. Which of the following would be the principal diagnosis?<br />\r\n<br />\r\nO80 Encounter for full-term uncomplicated delivery<br />\r\nO48.0 Post-term pregnancy<br />\r\nO48.1 Prolonged pregnancy<br />\r\nO66.5 Attempted application of vacuum extractor and forceps</p>', 'O48.0', 'O48.1', 'O80', 'O66.5', '2022-12-14 06:19:32', '2022-12-14 06:19:32', 'ans_b'),
(2349, NULL, 62, 1, '<p>With regard to the implementation of ICD-10-CM, all of the following are correct except:</p>', 'ICD-10-CM was developed by NCHS', 'ICD-10-CM and ICD-10-PCS was fully implemented on October 1, 2016', 'ICD-10 is already being used in the United States for death certificate coding', 'The process of adoption of ICD-10-CM is specified in HIPAA', '2022-12-14 06:20:36', '2022-12-14 06:20:36', 'ans_b'),
(2350, NULL, 62, 1, '<p>A 75-year-old female was admitted for acute myocardial infarction and underwent a diagnostic cardiac catheterization. Following the catheterization, the patient developed a thrombophlebitis documented as due to the catheter in the common femoral artery. The thrombophlebitis would be coded as:</p>', 'T81.718A, Complication of other artery following a procedure, not elsewhere classified, initial encounter', 'I97.51, Accidental puncture and laceration of a circulatory system organ or structure during a circulatory system procedure', 'I72.4, Aneurysm of artery of lower extremity', 'I97.52, Accidental puncture and laceration of a circulatory system organ or structure during other procedure', '2022-12-14 06:21:23', '2022-12-14 06:21:23', 'ans_a'),
(2351, NULL, 62, 1, '<p>A patient was admitted to the emergency department with chest pain and was diagnosed with aborted myocardial infarction with acute myocardial ischemia. There was no prior cardiac surgery. The cardiac enzymes were normal. The appropriate coding of the diagnosis for this case is:</p>', 'I21.3, ST elevation (STEMI) myocardial infarction of unspecified site', 'I25.10, Atherosclerotic heart disease of native coronary artery without angina pectoris', 'I24.8, Other forms of acute ischemic heart disease', 'I24.0, Acute coronary thrombosis not resulting in myocardial infarction', '2022-12-14 06:22:08', '2022-12-14 06:22:08', 'ans_d'),
(2352, NULL, 62, 1, '<p>A patient has nausea and vomiting with abdominal pain due to acute cholecystitis. The physician documents the following on the discharge summary: acute cholecystitis, nausea, vomiting, and abdominal pain. The correct diagnosis code(s) are:</p>', 'Acute cholecystitis, nausea, vomiting, and abdominal pain', 'Acute cholecystitis, nausea, vomiting', 'Acute cholecystitis, nausea', 'Acute cholecystitis', '2022-12-14 06:22:46', '2022-12-14 06:22:46', 'ans_d'),
(2353, NULL, 62, 1, '<p>A patient is admitted because of congestive heart failure (CHF). During the treatment of the CHF, the patient was also found to have elevated liver function tests. The physician worked up the elevated liver function tests but was not able to determine a diagnosis. The following diagnoses should be assigned:</p>', 'Congestive heart failure with liver disease', 'Abnormal liver function tests', 'Congestive heart failure and abnormal liver function tests', 'Congestive heart failure', '2022-12-14 06:23:18', '2022-12-14 06:23:18', 'ans_c'),
(2354, NULL, 62, 1, '<p>A patient is admitted with hypotension due to dobutamine taken and prescribed correctly. How should this be coded?</p>', 'I95.1, Orthostatic hypotension T44.5X5A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter', 'I95.2, Hypotension due to drugs T44.5X5A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter', 'I95.89, Other hypotension T44.995A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter', 'I95.81, Postprocedural hypotension T44.995A, Adverse effect of predominantly beta-adrenoreceptor agonists, initial encounter', '2022-12-14 06:24:00', '2022-12-14 06:24:00', 'ans_b'),
(2355, NULL, 62, 1, '<p>A patient is readmitted two weeks after a laminectomy for spinal stenosis with a headache and documentation that the headache is due to a tear in the dura accidently that occurred during the prior laminectomy surgery. The patient is taken to the operating room for repair of the dura. The diagnosis code(s) assigned for this admission would be:</p>', 'M48.061, Spinal stenosis, lumbar region, without neurogenic claudication', 'G97.41, Accidental puncture or laceration of dura during a procedure', 'G97.1, Other reaction to spinal and lumbar puncture', 'S34.109A, Unspecified injury to unspecified level of lumbar spinal cord, initial encounter', '2022-12-14 06:24:40', '2022-12-14 06:24:40', 'ans_b'),
(2356, NULL, 62, 1, '<p>A patient is admitted to the hospital with shortness of breath and congestive heart failure and subsequently develops respiratory failure. The patient undergoes intubation with ventilator management. The correct sequencing of the diagnoses in this case would be:</p>', 'Congestive heart failure and respiratory failure', 'Respiratory failure', 'Respiratory failure and congestive heart failure', 'Shortness of breath, congestive heart failure, and respiratory failure', '2022-12-14 06:28:33', '2022-12-14 06:28:33', 'ans_a'),
(2357, NULL, 62, 1, '<p>If a patient is admitted with pneumococcal pneumonia and severe pneumococcal sepsis, the coder should:</p>', 'Assign a code for only the sepsis and pneumonia', 'Assign a code for the sepsis, pneumonia, and severe sepsis', 'Assign only a code for pneumococcal pneumonia', 'Review the chart to determine if septic shock could be used first', '2022-12-14 06:30:02', '2022-12-14 06:30:02', 'ans_b'),
(2358, NULL, 62, 1, '<p>A patient was admitted with end stage renal disease (ESRD) following kidney transplant. The patient also had angina and chronic obstructive pulmonary disease. The diagnoses would be sequenced as:</p>', 'Kidney failure; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'End-stage renal disease; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'Chronic kidney disease, stage 5; status post kidney transplant; chronic obstructive pulmonary disease; angina', 'Acute kidney failure; status post kidney transplant; chronic obstructive pulmonary disease; angina', '2022-12-14 06:30:38', '2022-12-14 06:30:38', 'ans_b'),
(2359, NULL, 62, 1, '<p>A patient is admitted to the hospital due to a fracture of the right hip and is scheduled for an open reduction with internal fixation. The patient developed cardiac arrhythmia which results in an inability to do the planned surgery. Assign a code for the principal diagnosis.</p>', 'Status post fracture', 'Cardiac arrhythmia', 'Right hip fracture', 'Admission for possible fracture', '2022-12-14 06:31:11', '2022-12-14 06:31:11', 'ans_c'),
(2360, NULL, 62, 1, '<p>Which of the following is not part of a facility coding compliance plan?</p>', 'Regular internal audits', 'Audits performed by objective external reviewers', 'Coding audits performed by payers', 'Sharing and discussing results with coding staff', '2022-12-14 08:05:46', '2022-12-14 08:05:46', 'ans_c'),
(2361, NULL, 62, 1, '<p>A 30-year-old woman with a 6-year history of anorexia nervosa was seen in her physician&#39;s office because of significant weight loss over the past three months going from 82 pounds down to 53 pounds. She was admitted to the hospital to increase body weight and to be given nutrition counseling because of her severe malnutrition. How should this be coded?</p>', 'F50.00, Anorexia nervosa, unspecified', 'F50.00, Anorexia nervosa, unspecified E43, Unspecified severe protein-calorie malnutrition', 'F50.01, Anorexia nervosa, restricting type', 'E43, Unspecified severe protein-calorie malnutrition', '2022-12-14 08:06:48', '2022-12-14 08:06:48', 'ans_d'),
(2362, NULL, 62, 1, '<p>If a 55-year-old patient with AIDS admitted with traumatic comminuted fracture femur shaft, right leg, initial encounter. The coder should:</p>', 'Assign a code for only the AIDS', 'Assign a code for the AIDS and the fracture', 'Assign only a code for fracture', 'Review the chart to determine the cause of the injury', '2022-12-14 08:07:28', '2022-12-14 08:07:28', 'ans_b'),
(2363, NULL, 62, 1, '<p>The patient is seen in the pain clinic for chronic neoplasm-related pain that was known to be caused by the metastatic bone carcinoma of the vertebra that has spread from carcinoma of the left main bronchus of the lung. How should this be coded?</p>', 'C34.02, Malignant neoplasm of left main bronchus', 'G89.3, Neoplasm related pain (acute) (chronic)', 'G89.3, Neoplasm related pain (acute) (chronic); C79.51, Secondary malignant neoplasm of bone; C34.02, Malignant neoplasm of left main bronchus', 'G89.3, Neoplasm related pain (acute) (chronic); C79.51, Secondary malignant neoplasm of bone', '2022-12-14 08:08:07', '2022-12-14 08:08:07', 'ans_c'),
(2364, NULL, 62, 1, '<p>A 45-year-old man with known AIDS is admitted to the hospital for treatment of Pneumocystis carinii pneumonia. What is the principal diagnosis code?</p>', 'B20', 'J18.9', 'B59', 'Any of the above', '2022-12-14 08:08:45', '2022-12-14 08:08:45', 'ans_a'),
(2365, NULL, 62, 1, '<p>A patient is prescribed Diazepam and reports taking more than the prescribed amount. The patient is admitted to the hospital for complete work up. The final diagnosis is documented as Diazepam use and abuse. How should this be coded?</p>', 'F13.180', 'F13.188', 'F13.10', 'F13.11', '2022-12-14 08:09:18', '2022-12-14 08:09:18', 'ans_c'),
(2366, NULL, 62, 1, '<p>A female patient with terminal carcinoma of the breast, metastatic to the liver, brain, and intrahepatic and extrahepatic bile ducts, was admitted with dehydration. Patient rehydrated with IVs and discharged, with no treatment given to the cancer. What are the codes assigned?</p>', 'E86.0, C50.919, C78.7, C79.31, C78.89', 'E86.9, C50.919, C78.7, C79.31,', 'E86.0, C50.919, C79.31, C78.89', 'E86.9, C50.919, C78.7, C79.31, C78.89', '2022-12-14 08:09:52', '2022-12-14 08:09:52', 'ans_a'),
(2367, NULL, 62, 1, '<p>A child has second- and third-degree burns of the left lower leg and second- and third-degree burns of the lower back with a total of 16 percent total body surface area (TBSA), 9 percent third-degree. What is the correct code assignment?</p>', 'T24.301A, T21.34XA, T31.10', 'T24.302D, T21.34XD, T31.10', 'T24.302A, T21.34XA, T31.10', 'T24.301D, T21.34XD, T31.10', '2022-12-14 08:10:28', '2022-12-14 08:10:28', 'ans_c'),
(2368, NULL, 62, 1, '<p>The &quot;code, if applicable, any causal condition first&quot; note in the ICD-10-CM tabular lists indicates that this code may be assigned when the causal condition is unknown or not applicable. When the causal condition is known, the code for that condition may be reported as which type of diagnosis?</p>', 'Comorbidity', 'Manifestation', 'Principal', 'Qualified', '2022-12-14 08:11:05', '2022-12-14 08:11:05', 'ans_c'),
(2369, NULL, 62, 1, '<p>5-year-old patient admitted with Insulin dependent diabetes. The type of diabetes is not specified in the medical record. How should this be coded?</p>', 'E11.9, Z79.4', 'E11.8', 'E11.8, Z79.4', 'Z79.4, E11.8', '2022-12-14 08:11:38', '2022-12-14 08:11:38', 'ans_a'),
(2370, NULL, 62, 1, '<p>A 65-year-old man is admitted due to an acute myocardial infarction. The patient also has coronary artery disease. How should this be coded?</p>', 'CAD, AMI', 'AMI', 'AMI, CAD', 'Query the physician for the principal diagnosis', '2022-12-14 08:12:13', '2022-12-14 08:12:13', 'ans_c'),
(2371, NULL, 62, 1, '<p>A patient is admitted to the hospital during the postpartum period as a result of developing a thromboembolism or pulmonary blood clot leading to respiratory failure. What is the principal diagnosis?</p>', 'O88.23', 'J96.00', 'O88.03', 'O88.22', '2022-12-14 08:13:08', '2022-12-14 08:13:08', 'ans_a'),
(2372, NULL, 62, 1, '<p>Patient admitted with hemorrhage due to placenta previa with twin pregnancy. This patient had two prior (cesarean section) deliveries. Emergency C-section was performed due to the hemorrhage. The appropriate principal diagnosis would be:</p>', 'Prior cesarean sections', 'Placenta previa without hemorrhage', 'Twin gestation', 'Placenta previa with hemorrhage', '2022-12-14 08:14:17', '2022-12-14 08:14:17', 'ans_d'),
(2373, NULL, 62, 1, '<p>A 70-year-old patient was admitted with pneumonia. The history and physical documented that the patient has a history of diabetes, hypertension, and migraine headache about 10 years ago without recurrence. The patient was administered IV antibiotics, metformin, and Altace during the hospitalization. Which conditions would be reported at the time of discharge?</p>', 'Pneumonia, diabetes, hypertension, and migraine headaches', 'Pneumonia, diabetes, hypertension, and history of migraine headaches', 'Pneumonia, diabetes, and hypertension', 'Pneumonia', '2022-12-14 08:14:52', '2022-12-14 08:14:52', 'ans_c'),
(2374, NULL, 62, 1, '<p>A diabetic patient was admitted for a treatment of a pressure ulcer. The patient also has a history of diabetic neuropathy and retinopathy. The patient is blind and additional nursing care and extended time with the patient was required. Which conditions should be coded at discharge?</p>', 'Pressure ulcer, history of neurologic condition, history of retinal condition, diabetes', 'Pressure ulcer, diabetic neuropathy and diabetic retinopathy, and blindness', 'Pressure ulcer, diabetic neuropathy', 'Pressure ulcer, diabetic retinopathy, and blindness', '2022-12-14 08:15:30', '2022-12-14 08:15:30', 'ans_b'),
(2375, NULL, 62, 1, '<p>A patient has an inpatient discharge with principal diagnosis of either peptic ulcer or cholecystitis documented on the history and physical. Both are equally treated and well documented. A coder should:</p>', 'Code based on the circumstances of admission and if both are equally treated, code either as principal', 'Use a code from the Abnormal findings category', 'Code to the most severe symptom', 'Code shoulder pain, peptic ulcer, cholecystitis', '2022-12-14 08:16:12', '2022-12-14 08:16:12', 'ans_a'),
(2376, NULL, 62, 1, '<p>A 75-year-old woman is admitted to the hospital after tripping and falling at home. She underwent an open reduction with internal fixation of the femur. Which of the following would be important to capture in addition to diagnostic codes?</p>', 'External cause codes for Cause of Injury and Place of Occurrence', 'External cause codes for Cause of Injury, Place of Occurrence, Activity, and Status', 'External cause codes for Cause of Injury, Place of Occurrence, and Activity', 'External cause codes for Cause of Injury only', '2022-12-14 08:16:49', '2022-12-14 08:16:49', 'ans_b'),
(2377, NULL, 62, 1, '<p>In CPT, unlisted codes are reported only if:</p>', 'There is not a current CPT category I code available', 'There is not a current CPT category III code available', 'There is not a current CPT category II code available', 'There is not a HCPCS Level II code or a current CPT level III code', '2022-12-14 08:17:24', '2022-12-14 08:17:24', 'ans_d'),
(2378, NULL, 62, 1, '<p>A virtual screening colonoscopy would be coded as:<br />\r\n<br />\r\n45378 Colonoscopy, flexible; diagnostic, including collection of specimen(s) by brushing or washing, when performed (separate procedure)<br />\r\n45391 Colonoscopy, flexible; with endoscopic ultrasound examination limited to the rectum, sigmoid, descending, transverse, or ascending colon and cecum, and adjacent structures<br />\r\n74263 Computed tomographic (CT) colonography, screening including image postprocessing<br />\r\n76376 3D rendering with interpretation and reporting of computed tomography, magnetic resonance imaging, ultrasound, or other tomographic modality with image post-processing under concurrent supervision; not requiring image postprocessing on an independent workstation</p>', '74263', '45391', '45378', '76376', '2022-12-14 08:18:02', '2022-12-14 08:18:02', 'ans_a'),
(2379, NULL, 62, 1, '<p>A patient underwent an excision of a malignant lesion of the chest that measured 1.0 cm and there was a 0.2-cm margin on both sides. Based on the 2018 CPT codes, which code would be used for the procedure?</p>', '11401, Excision, benign lesion including margins, except skin tag (unless listed elsewhere), trunk, arms or legs; excised diameter 0.6 to 1.0 cm', '11601, Excision, malignant lesion including margins, trunk, arms, or legs; excised diameter 0.6 to 1.0 cm', '11602, Excision, malignant lesion including margins, trunk, arms, or legs; excised diameter 1.1 to 2.0 cm', '11402, Excision, benign lesion including margins, except skin tag (unless listed elsewhere), trunk, arms or legs; excised diameter 1.1 to 2.0 cm', '2022-12-14 08:18:37', '2022-12-14 08:18:37', 'ans_c'),
(2380, NULL, 62, 1, '<p>A patient was diagnosed with L4-5 lumbar neuropathy and discogenic pain. The patient underwent a percutaneous intradiscal electrothermal annuloplasty (IDET) in the radiology suite. What ICD-10-PCS code should be used?</p>', '0S520ZZ, Destruction, lumbar vertebral disc, open approach', '015B0ZZ, Destruction, lumbar nerve, open approach', '0S523ZZ, Destruction, lumbar vertebral disc, percutaneous approach', '0SB20ZZ, Excision, lumbar vertebral disc, open approach', '2022-12-14 08:19:24', '2022-12-14 08:19:24', 'ans_c'),
(2381, NULL, 62, 1, '<p>A laparoscopic tubal ligation with Falope ring is completed. What is the correct CPT code assignment?<br />\r\n<br />\r\n49321 Laparoscopy, surgical; with biopsy (single or multiple)<br />\r\n58662 Laparoscopy, surgical; with fulguration or excision of lesions of the ovary, pelvic viscera, or peritoneal surface by any method<br />\r\n58670 Laparoscopy, surgical; with fulguration of oviducts (with or without transection)<br />\r\n58671 Laparoscopy, surgical; with occlusion of oviducts by device (eg, band, clip, or Falope ring)</p>', '49321, 58662', '58670', '58671', '49321', '2022-12-14 08:58:29', '2022-12-14 08:58:29', 'ans_c'),
(2382, NULL, 62, 1, '<p>67-year-old patient presents with carcinoma of multiple overlapping sites of the bladder. Diagnostic cystoscopy and transurethral fulguration of bladder lesions (1.9 cm, 6.0 cm) are undertaken. The appropriate CPT code(s) would be:<br />\r\n<br />\r\n52000 Cystourethroscopy (separate procedure)<br />\r\n52224 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) or treatment of minor (less than 0.5 cm) lesion(s) with or without biopsy<br />\r\n52234 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of small bladder tumor(s) (0.5 cm to 2.0 cm)<br />\r\n52235 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of medium bladder tumor(s) (2.0 cm to 5.0 cm)<br />\r\n52240 Cystourethroscopy, with fulguration (including cryosurgery or laser surgery) and/or resection of large bladder tumor(s)</p>', '52234, 52240', '52235', '52240', '52000, 52234', '2022-12-14 08:59:10', '2022-12-14 08:59:10', 'ans_c'),
(2383, NULL, 62, 1, '<p>A patient presents to a facility for upper endoscopy implant of material into the muscle of the lower esophageal sphincter. The correct coding and sequencing of this patient&#39;s record is:<br />\r\n<br />\r\n43235 Esophagogastroduodenoscopy, flexible, transoral; diagnostic, including collection of specimen(s) by brushing or washing, when performed (separate procedure)<br />\r\n43236 with directed submucosal injection(s), any substance<br />\r\n43257 with delivery of thermal energy to the muscle of lower esophageal sphincter and/or gastric cardia, for treatment of gastroesophageal reflux disease<br />\r\n43270 with ablation of tumor(s), polyp(s), or other lesion(s) (includes pre- and post- dilation and guide wire passage, when performed.<br />\r\n-59 Distinct procedure service</p>', '43257', '43235, 43236', '43236', '43270-58, 43236-59', '2022-12-14 08:59:46', '2022-12-14 08:59:46', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(2384, NULL, 62, 1, '<p>A patient undergoes a colposcopy with endometrial biopsy. Which of the following is correct?</p>', 'The colposcopy and endometrial biopsy are represented by a combination code.', 'Two codes would be used with modifier -59 appended.', 'Two codes would be used in accordance with CPT code instructions.', 'Only one code is used and it does not state that it includes endometrial biopsy specifically.', '2022-12-14 09:00:19', '2022-12-14 09:00:19', 'ans_c'),
(2385, NULL, 62, 1, '<p>A patient presents to the outpatient surgical area for a cystoscopy with multiple biopsies of the bladder. The patient&#39;s presenting symptom is hematuria. What is the correct code assignment for this procedure?<br />\r\n<br />\r\n52000 Cystourethroscopy (separate procedure)<br />\r\n52204 Cystourethroscopy with biopsy(s)<br />\r\n&minus;22 Increased procedural services</p>', '52000', '52000-22', '52204', '52204-22', '2022-12-14 09:00:52', '2022-12-14 09:00:52', 'ans_c'),
(2386, NULL, 62, 1, '<p>If a patient has an excision of a malignant lesion of the skin, the CPT code is determined by the body area from which the excision occurs and the:</p>', 'Length of the lesion as described in the pathology report', 'Dimension of the specimen submitted as described in the pathology report', 'Width times the length of the lesion as described in the operative report', 'Diameter of the lesion as well as the margins excised as described in the operative report', '2022-12-14 09:01:59', '2022-12-14 09:01:59', 'ans_d'),
(2387, NULL, 62, 1, '<p>When coding &quot;arthrocentesis,&quot; the code assignment is determined by:</p>', 'Contrast used', 'Size of the joint', 'Approach', 'Description of the closure', '2022-12-14 09:02:36', '2022-12-14 09:02:36', 'ans_b'),
(2388, NULL, 62, 1, '<p>Assign the correct code for an open total cholecystectomy with exploration of common bile duct and removal of common bile duct stone.</p>', '0FT40ZZ, Resection gallbladder, open approach and 0FC90ZZ, Extirpation of matter from common bile duct, open approach', '0FT44ZZ, Resection of gallbladder, percutaneous endoscopic approach and 0FC90ZZ, Extirpation of matter from common bile duct, open approach', '0FQ40ZZ, Repair of gallbladder, open approach', '0FC90ZZ, Extirpation of matter from common bile duct, open approach', '2022-12-14 09:03:17', '2022-12-14 09:03:17', 'ans_a'),
(2389, NULL, 62, 1, '<p>Assign the correct code for a total laparoscopic cholecystectomy with percutaneous removal of common bile duct stones.</p>', '0DTJ4ZZ, Resection of appendix, percutaneous endoscopic approach and 0FC90ZZ, Extirpation of matter from common bile duct, open approach', '0FB40ZZ, Excision of gallbladder, open approach', '0FT40ZZ, Resection of gallbladder, open approach', '0FT44ZZ, Resection of gallbladder, percutaneous endoscopic approach and 0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach', '2022-12-14 09:04:10', '2022-12-14 09:04:10', 'ans_d'),
(2390, NULL, 62, 1, '<p>Assign the correct code for a total open cholecystectomy with intraoperative cholangiogram. The cholangiogram was done with plain radiography with low osmolar contrast.</p>', '0DTJ4ZZ, Resection appendix, percutaneous endoscopic approach and 0FC94ZZ, Extirpation of matter from common bile duct, percutaneous endoscopic approach', '0DBJ0ZZ, Excision, appendix, open approach', '0FB40ZZ, Excision, gallbladder, open approach', '0FT40ZZ, Resection, gallbladder, open approach and BF031ZZ, Plain radiography of gallbladder and bile ducts using low osmolar contrast', '2022-12-14 09:04:50', '2022-12-14 09:04:50', 'ans_d'),
(2391, NULL, 62, 1, '<p>The root operation of resection applies to which of the following?</p>', 'Removal of the entire body part and removal of an entire lobe of the liver', 'Partial incidental appendectomy and the closure portion of a procedure', 'Blunt, digital, manual, or mechanical lysis of adhesions', 'Partial cholecystectomy', '2022-12-14 09:07:41', '2022-12-14 09:07:41', 'ans_a'),
(2392, NULL, 62, 1, '<p>Inpatient procedures are coded with:</p>', 'HCPCS', 'CPT', 'ICD-10-PCS', 'ICD-O', '2022-12-14 09:08:37', '2022-12-14 09:08:37', 'ans_c'),
(2393, NULL, 62, 1, '<p>A patient is admitted to the hospital for pain due to displacement of pacemaker electrode. The patient also has hypothyroidism due to partial thyroidectomy seven years ago and a breast cyst. The pacemaker electrode was relocated and Synthroid was given during hospitalization. The diagnostic codes (excluding External Cause codes) that should be assigned are:<br />\r\n<br />\r\nT82.110A Breakdown (mechanical) of cardiac electrode, initial encounter<br />\r\nT82.110D Breakdown (mechanical) of cardiac electrode, subsequent encounter<br />\r\nT82.120A Displacement of cardiac electrode, initial encounter<br />\r\nT82.120S Displacement of cardiac electrode, sequela<br />\r\nN60.09 Solitary cyst of unspecified breast<br />\r\nE89.0 Postsurgical hypothyroidism</p>', 'T82.110A, E89.0', 'T82.110D, E89.0, N60.09', 'T82.120A, E89.0', 'T82.120S, E89.0, N60.09', '2022-12-14 09:09:25', '2022-12-14 09:09:25', 'ans_c'),
(2394, NULL, 62, 1, '<p>Assign the code(s) for mammographic guidance for bilateral breast needle localization for a lesion placement with biopsy.<br />\r\n<br />\r\n10022 Fine needle aspiration, with imaging guidance<br />\r\n19081 Biopsy, breast, with placement of breast localization device(s) (eg, clip, metallic pellet) when performed, and imaging of the biopsy specimen, when performed, percutaneous; first lesion including stereotactic guidance<br />\r\n19082 Biopsy, breast with placement of breast localization device(s) (eg, clip, metallic pellet), when performed, and imaging of biopsy specimen, when performed, percutaneous; each additional lesion, including stereotactic guidance (List separately in addition to code for primary procedure.)</p>', '19082', '10022', '19081, 19082', '19081', '2022-12-14 09:10:18', '2022-12-14 09:10:18', 'ans_c'),
(2395, NULL, 62, 1, '<p>During an outpatient visit, the attending physician did not define a problem at the conclusion of an emergency department (ED) visit. The coder should:</p>', 'Assign a code from the list of conditions in the history that occurred in the past', 'Assign a code for the reason for the last visit to the ED', 'Assign codes for abnormal laboratory findings', 'Assign a code for the chief complaint as the reason for the visit', '2022-12-14 09:10:54', '2022-12-14 09:10:54', 'ans_d'),
(2396, NULL, 62, 1, '<p>During an ambulatory surgery visit for excision of a malignant melanoma of the right forearm, the attending surgeon listed history of benign breast cyst, history of hypertension currently on Tenormin, and a current hammer toe. Which conditions are to be coded?</p>', 'Malignant melanoma of forearm, hypertension', 'Malignant melanoma of the right forearm, benign breast cyst, hypertension, and hammer toe', 'Malignant melanoma of the right forearm, benign breast cyst, and hypertension', 'Malignant melanoma of the right forearm, benign breast cyst', '2022-12-14 09:11:39', '2022-12-14 09:11:39', 'ans_a'),
(2397, NULL, 62, 1, '<p>During an inpatient hospitalization, a chest x-ray done to evaluate a chronic cough revealed an asymptomatic compression fracture of a lumbar vertebrae. No further evaluation was undertaken. The coder should:</p>', 'Not assign a code for an acute condition but assign a code for chronic compression fracture', 'Assign a code for pathologic lumbar compression fracture', 'Assign a code for acute traumatic vertebral fracture', 'Not assign a code for this condition', '2022-12-14 09:14:51', '2022-12-14 09:14:51', 'ans_d'),
(2398, NULL, 62, 1, '<p>From the information provided, how many APCs would impact this patient&#39;s total reimbursement?<br />\r\n<br />\r\nBilling Number Status Indicator CPT/HCPCS APC*<br />\r\n989323 V 99285-25 00616<br />\r\n989323 T 25500 00129<br />\r\n989323 X 72050 00261<br />\r\n989323 S 72128 08005<br />\r\n989323 N 70450 19937<br />\r\n* This is not the actual reimbursement for the designated APC.</p>', '1', '5', '4', 'Unable to determine', '2022-12-14 09:15:19', '2022-12-14 09:15:19', 'ans_c'),
(2399, NULL, 62, 1, '<p>What percentage will the facility be paid for procedure code 25500?<br />\r\n<br />\r\nBilling Number Status Indicator CPT/HCPCS APC*<br />\r\n989323 V 99285-25 00616<br />\r\n989323 T 25500 00129<br />\r\n989323 X 72050 00261<br />\r\n989323 S 72128 08005<br />\r\n989323 N 70450 19937<br />\r\n* This is not the actual reimbursement for the designated APC.</p>', '50%', '75%', '0%', '100%', '2022-12-14 09:16:05', '2022-12-14 09:16:05', 'ans_d'),
(2400, NULL, 62, 1, '<p>If another status T procedure were performed, how much would the facility receive for the second status T procedure?<br />\r\n<br />\r\nBilling Number Status Indicator CPT/HCPCS APC*<br />\r\n989323 V 99285-25 00616<br />\r\n989323 T 25500 00129<br />\r\n989323 X 72050 00261<br />\r\n989323 S 72128 08005<br />\r\n989323 N 70450 19937<br />\r\n* This is not the actual reimbursement for the designated APC.</p>', '50%', '75%', '0%', '100%', '2022-12-14 09:16:40', '2022-12-14 09:16:40', 'ans_a'),
(2401, NULL, 62, 1, '<p>This 18-year-old patient with an abnormal blood test underwent bone marrow aspiration from the sternum. The area was cleaned with antiseptic solution, and a local anesthetic was injected. The needle was inserted beneath the skin and rotated into the cortex and the sample taken. The needle was repositioned slightly, and a new syringe attached, and a second sample was obtained. These were sent to the laboratory for analysis. The results show acute lymphoblastic leukemia. What is the correct CPT code?</p>', '75810', '38220, 75810', '38220', '38129', '2022-12-14 09:17:28', '2022-12-14 09:17:28', 'ans_c'),
(2402, NULL, 62, 1, '<p>A 65-year-old male patient is being assessed for possible colon cancer and treated in the special procedure unit of the hospital. He undergoes a colonoscopy into the ascending colon with biopsy of a suspicious area in the transverse colon using the cold biopsy forceps. In addition, a colonic ultrasound of the area is performed, with transmural biopsy of an area of the mesentery adjacent to the transverse colon. Assign the appropriate CPT codes.</p>', '45384, 45342', '45380, 45391', '45384, 45392', '45380, 45392', '2022-12-14 09:18:39', '2022-12-14 09:18:39', 'ans_d'),
(2403, NULL, 62, 1, '<p>The patient is diagnosed with a recurrent thyroglossal duct cyst. The surgeon locates the cyst using palpation, and an incision is created. The cyst is then excised. What is the correct CPT code assignment for this service?</p>', '60200', '60210', '60280', '60281', '2022-12-14 09:19:13', '2022-12-14 09:19:13', 'ans_d'),
(2404, NULL, 62, 1, '<p>A patient is admitted for chest pain. The patient was stabilized and discharged. In a subsequent admission, the patient was admitted as an outpatient for a left heart catheterization, coronary arteriography using two catheters and left ventricular angiography. The patient was found to have arteriosclerotic heart disease. The patient has no history of cardiac surgery. The appropriate sequencing of ICD-10-CM and CPT codes for the outpatient catheterization would be:<br />\r\n<br />\r\nI20.0 Unstable angina<br />\r\nI20.9 Angina pectoris, unspecified<br />\r\nI25.10 Atherosclerotic heart disease of native coronary artery without angina pectoris<br />\r\nR07.9 Chest pain, unspecified<br />\r\n93452 Left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed<br />\r\n93453 Combined right and left heart catheterization including intraprocedural injection(s) for left ventriculography, imaging supervision and interpretation, when performed<br />\r\n93454 Catheter placement in coronary artery(s) for coronary angiography, including intraprocedural injection(s) for coronary angiography, imaging supervision and interpretation;<br />\r\n93458 with left heart catheterization including intraprocedural injection(s) for left ventriculography, when performed</p>', 'R07.9, 93452', 'I20.0, 93454', 'I25.10, 93453', 'I25.10, 93458', '2022-12-14 09:20:08', '2022-12-14 09:20:08', 'ans_d'),
(2405, NULL, 62, 1, '<p>Documentation in the record reveals that a patient is admitted with an acute exacerbation of COPD (MS-DRG 192). A higher-paying DRG may be appropriate if documentation is present in the record at the time the decision was made to admit the patient that confirms a diagnosis associated with which of the following:</p>', 'Angina was treated with nitroglycerin prn for chest pain', 'Atrial fibrillation and underwent a cardioversion while hospitalized', 'Blood gases of pO2 of 58, pCO2 of 55, pH of 7.32 upon admission and treated with intubation and mechanical ventilation for 23 hours', 'Anemia and was given a blood transfusion', '2022-12-14 09:21:36', '2022-12-14 09:21:36', 'ans_c'),
(2406, NULL, 62, 1, '<p>A female patient is diagnosed with congestive heart failure. Which of the following will increase the MS-DRG weight if present on admission?</p>', 'Atrial fibrillation', 'Stage III pressure ulcer', 'Blood loss anemia', 'Coronary artery disease', '2022-12-14 09:22:07', '2022-12-14 09:22:07', 'ans_b'),
(2407, NULL, 62, 1, '<p>If the principal diagnosis is an initial episode of an anterior wall myocardial infarction, which procedure will result in the highest DRG?</p>', 'Mechanical ventilator', 'Insertion central venous catheter', 'Right heart cardiac catheterization', 'Transbronchial lung biopsy', '2022-12-14 09:22:42', '2022-12-14 09:22:42', 'ans_d'),
(2408, NULL, 62, 1, '<p>A patient is admitted with spotting and fever. She is found to have been treated for a miscarriage (spontaneous abortion), which was resolved two weeks prior to this admission. She is treated with aspiration dilation and curettage and products of conception are found. She is found to be septic. Which of the following diagnoses should be principal diagnosis?</p>', 'Complications following abortion and ectopic or other pregnancy', 'Complications of spontaneous abortion with sepsis', 'Sepsis', 'Sepsis following incomplete spontaneous abortion', '2022-12-14 09:23:17', '2022-12-14 09:23:17', 'ans_d'),
(2409, NULL, 62, 1, '<p>A patient is admitted with an acute inferior myocardial infarction and discharged alive. Which condition would increase the MS-DRG weight?</p>', 'Respiratory failure', 'Atrial fibrillation', 'Hypertension', 'History of myocardial infarction', '2022-12-14 09:24:25', '2022-12-14 09:24:25', 'ans_a'),
(2410, NULL, 62, 1, '<p>During an admission for congestive heart failure (CHF), a chest x-ray was done to evaluate for the presence of CHF. An asymptomatic hernia was also found for which no treatment or evaluation was done. What is the reason that the hernia should not be coded?</p>', 'The patient\'s primary condition of interest is the CHF.', 'The hernia is an incidental finding and does not meet the UHDDS requirements.', 'The patient is asymptomatic.', 'The condition does not impact the reimbursement.', '2022-12-14 09:26:30', '2022-12-14 09:26:30', 'ans_b'),
(2411, NULL, 62, 1, '<p>When an inpatient has had multiple tests to evaluate an abnormal finding but no definitive diagnosis has been documented, the coder should:</p>', 'Assign a code for the abnormal finding without confirming with the physician', 'Assign codes for all of the abnormal results of the tests', 'Assign a diagnosis code based on the coder\'s judgment', 'Query the physician regarding whether a diagnosis should be assigned or not', '2022-12-14 09:27:37', '2022-12-14 09:27:37', 'ans_d'),
(2412, NULL, 62, 1, '<p>A patient presents to a facility with a history of prostate cancer and mental confusion on admission. The patient completed radiation therapy for prostatic carcinoma three years ago and is status post a radical resection of the prostate. A CT scan of the brain reveals metastatic carcinoma of the brain. The correct coding and sequencing of this patient&#39;s record is:</p>', 'Metastatic carcinoma of the brain, carcinoma of the prostate, mental confusion', 'Mental confusion, history of carcinoma of the prostate, admission for chemotherapy', 'Metastatic carcinoma of the brain, history of carcinoma of the prostate', 'Carcinoma of the prostate, metastatic carcinoma to the brain', '2022-12-14 09:29:30', '2022-12-14 09:29:30', 'ans_c'),
(2413, NULL, 62, 1, '<p>When a Medicare patient receives an injection of IM penicillin G benzathine, 100,000 units only, what is the appropriate code assignment?<br />\r\n<br />\r\n96372 Therapeutic, prophylactic or diagnostic injection (specify substance or drug); subcutaneous or intramuscular<br />\r\n96374 Therapeutic, prophylactic or diagnostic injection (specify substance or drug); intravenous push, single or initial substance/drug<br />\r\nJ0558 Injection, penicillin G benzathine, and penicillin G procaine 100,000 units<br />\r\nJ0561 Injection, penicillin G benzathine, 100,000 units</p>', '96372', 'J0558', '96374', '96372, J0561', '2022-12-14 09:30:04', '2022-12-14 09:30:04', 'ans_d'),
(2414, NULL, 62, 1, '<p>Determining medical necessity for outpatient services includes all the following except:</p>', 'Local coverage determinations (LCDs)', 'National coverage determinations (NCDs)', 'Diagnoses linked to procedures by claims-processing software tests ensuring that the procedure is cross-referenced, or linked, correctly to an acceptable diagnosis code for that service', 'Requiring new HCPCS codes be developed to replace codes in the CPT code book', '2022-12-14 09:30:56', '2022-12-14 09:30:56', 'ans_d'),
(2415, NULL, 62, 1, '<p>According to the UHDDS, section III, the definition of other diagnoses is all conditions that:</p>', 'Coexist at the time of admission, that develop subsequently, or that affect the treatment received or the length of stay', 'Receive evaluation and are documented by the physician', 'Receive clinical evaluation, therapeutic treatment, further evaluation, extend the length of stay, increase nursing monitoring/care', 'Are considered to be essential by the physicians involved and are reflected in the record', '2022-12-14 09:31:42', '2022-12-14 09:31:42', 'ans_a'),
(2416, NULL, 62, 1, '<p>If a patient has undergone an outpatient echocardiogram and the cardiologist concludes in the report that the patient has mitral regurgitation, the coder should:</p>', 'Assign a diagnostic code for mitral regurgitation', 'Query the physician about the diagnosis', 'Code an abnormal finding of the echocardiogram', 'No code can be assigned', '2022-12-14 09:32:18', '2022-12-14 09:32:18', 'ans_a'),
(2417, NULL, 62, 1, '<p>Coding professionals need to have surgical references in order to discriminate between:</p>', 'Correct and incorrect documentation based on Joint Commission requirements', 'Reportable and nonreportable procedures', 'Chemotherapeutic drugs', 'A comorbid condition and a complication that prolongs the length of stay', '2022-12-14 09:33:03', '2022-12-14 09:33:03', 'ans_b'),
(2418, NULL, 62, 1, '<p>The outpatient code editor (OCE) has all of the following types of edits except:</p>', 'Claim accuracy', 'Discharge date discrepancy', 'Assigning APCs to the claim', 'Age and sex edits', '2022-12-14 09:33:42', '2022-12-14 09:33:42', 'ans_b'),
(2419, NULL, 62, 1, '<p>The case-mix index for the information provided above is:<br />\r\n<br />\r\nMS-DRG MS-DRG Weight Number of Patients<br />\r\n<br />\r\nMS-DRG 193, Simple pneumonia and pleurisy age &gt;17 w/CC 3.0 10<br />\r\nMS-DRG 195, Simple pneumonia without MCC or CC 2.0 10<br />\r\nMS-DRG 192, Chronic obstructive pulmonary disease w/o CC 1.0 10</p>', '0.679', '0.89', '2.0', '0.75', '2022-12-14 09:34:16', '2022-12-14 09:34:16', 'ans_c'),
(2420, NULL, 62, 1, '<p>The information provided shows that:<br />\r\n<br />\r\nMS-DRG MS-DRG Weight Number of Patients<br />\r\nMS-DRG 193, Simple pneumonia and pleurisy age &gt;17 w/CC 3.0 10<br />\r\nMS-DRG 195, Simple pneumonia without MCC or CC 2.0 10<br />\r\nMS-DRG 192, Chronic obstructive pulmonary disease w/o CC 1.0 10</p>', 'The payment is higher for patients with pneumonia with CCs than without', 'There are more patients with pneumonia without MCCs than with MCCs', 'There is a large pediatric population at this hospital with pneumonia', 'There is inaccurate coding of pneumonia at this institution', '2022-12-14 09:35:12', '2022-12-14 09:35:12', 'ans_a'),
(2421, NULL, 62, 1, '<p>A nurse inadvertently recorded an incorrect vital sign in a patient electronic health record. The next day, a correction was made in the electronic health record. This resulted in the corrected vital sign being recorded at the time the correction was made due to the software. What would be the result of this correction?</p>', 'The vital signs would be listed in the correct sequence.', 'When a correction is made in an electronic health record, the incorrect data is deleted.', 'The quality of patient care would not be affected.', 'There was a distorted trend line of vital signs data.', '2022-12-14 09:35:57', '2022-12-14 09:35:57', 'ans_d'),
(2422, NULL, 62, 1, '<p>According to the UHDDS, in order to assign a code for another diagnosis, documentation must be present that:</p>', 'The condition is recorded in the patient record by a dietary clerk', 'The condition is present in the admission department data', 'The condition was clinically evaluated or therapeutically treated, extended the length of hospital stay, or increased nursing care or monitoring', 'The condition is considered to be essential by the family', '2022-12-14 09:36:44', '2022-12-14 09:36:44', 'ans_c'),
(2423, NULL, 62, 1, '<p>The quality of data is most directly tied to the:</p>', 'Conditions treated in surrounding healthcare settings', 'Surgical case review committee', 'Length of hospital stay', 'Use or application of the data', '2022-12-14 09:43:54', '2022-12-14 09:43:54', 'ans_d'),
(2424, NULL, 62, 1, '<p>Poor-quality data collection and reporting can affect:</p>', 'Patient care, documentation, revenue generation, outcomes evaluation, and public health reporting', 'Use of patient record for legal purposes', 'Patient care, communication, research activities, and public health reporting', 'All of the above', '2022-12-14 09:47:38', '2022-12-14 09:47:38', 'ans_d'),
(2425, NULL, 62, 1, '<p>The most succinct definition of where information comes from is:</p>', 'Shredded documents', 'Common blips of data', 'Processed data', 'Measurement of extremities', '2022-12-14 09:48:15', '2022-12-14 09:48:15', 'ans_c'),
(2426, NULL, 62, 1, '<p>The Joint Commission considers what kind of management to be important for safe, quality care?</p>', 'Resource management', 'Recycling management', 'Information management', 'Incremental management', '2022-12-14 09:48:52', '2022-12-14 09:48:52', 'ans_c'),
(2427, NULL, 62, 1, '<p>Based on the AHIMA Code of Ethics, which of the following is not considered an ethical activity?</p>', 'Coding audits', 'Educational purposes within the department', 'Reviewing the history and physical of a coworker when not part of work assignment', 'Completion of code assignment', '2022-12-14 09:49:29', '2022-12-14 09:49:29', 'ans_c'),
(2428, NULL, 62, 1, '<p>Retention policies for the health information department depend on organizational retention policies that must be in accordance with local, state, and federal laws and regulations. These policies vary from institution to institution. In many instances, healthcare institutions may retain health records longer than the law requires. Which of the following statements best describes how the retention of records should be determined?</p>', 'Unless state or federal law requires longer periods of time, specific patient health information should be retained for established minimum time periods.', 'AHIMA has published specific guidelines for retention of health information and these guidelines should be followed for records retention.', 'The Joint Commission has developed standards for retention of health information which must be followed to maintain accreditation and these standards should be adhered to according to these guidelines with regard to time frames.', 'Health records should be retained according to their use in a facility and the state and federal laws do not apply to the retention of this health information.', '2022-12-14 09:50:17', '2022-12-14 09:50:17', 'ans_a'),
(2429, NULL, 48, 1, '<p>Bone to Bone Connecton known as&nbsp;</p>', 'Cartilage', 'Muscle', 'Tendon', 'Ligament', '2023-03-07 11:47:42', '2023-03-09 07:42:48', 'ans_d'),
(2430, NULL, 48, 1, '<p>Muscle to Bone connector also known as&nbsp;</p>', 'Ligament', 'Tendon', 'Muscle', 'Cartilage', '2023-03-07 11:50:35', '2023-03-09 07:43:10', 'ans_b'),
(2431, NULL, 48, 1, '<p>Which is the uppper layer of skin&nbsp;</p>', 'Epidermis', 'Dermis', 'Subcutaneous', 'Muscle', '2023-03-07 11:51:33', '2023-03-07 11:51:33', 'ans_a'),
(2432, NULL, 63, 1, '<p><strong>Which statement is false regarding the instructions for use of the CPT codebook?</strong></p>', 'Special report should accompany the use of an unlisted procedure code', 'Main body of category I section consists of six section with each section divided into subsection and subcategories.', 'Instructions listed in parenthetical notes typically indicate that a code should not be reported with other code(s) and will prevent errors of highest probability but are not all inclusive.', 'Guidelines provide explanations for specific section application', '2023-03-28 08:02:59', '2023-03-28 08:02:59', 'ans_a'),
(2433, NULL, 63, 1, '<p><strong>The patient&#39;s managed care plan requires that physicians report patient management codes for pregnant patients. Which of the following pieces of information must be documented in the medical record in order to report 0501F Prenatal flow sheet documented in medical record by first prenatal visit (documentation includes at minimum blood pressure, weight, urine protein, uterine size, fetal heart tones, and estimated date of delivery). Report also: date of visit and, in a separate field, the date of the last menstrual period [LMP] (Note: If reporting 0501F Prenatal flow sheet, it is not necessary to report 0500F Initial prenatal care visit) (Prenatal)&nbsp;</strong></p>', 'Blood pressure, Weight, Uterine size, fetal heart tones, urine  protein and LMP', 'Blood pressure, weight, uterine size, fetal heart tones, urine protein, EDD, DOS, and LMP', 'Blood pressure, weight, uterize size, fetal heart tones, urine protein, LMP', 'Blood pressure, Weight, urine protein, uterine size, fetal heart tones, EDD, and DOS', '2023-03-28 08:04:28', '2023-03-28 08:04:28', 'ans_d'),
(2434, NULL, 63, 1, '<p><strong>&nbsp;An intermediate therapeutic radiology simulation-aided procedure (CPT code 77280-77290) is reported for the</strong></p>', 'Simulation of single treatment area of interest', 'Simulation of three separate treatment area of interest', 'Simulation of two treatment areas', 'Simulation of five separate treatment areas', '2023-03-28 08:05:23', '2023-03-28 08:05:23', 'ans_c'),
(2435, NULL, 63, 1, '<p><strong>The CPT manual provides full descriptions of medical procedures although some description requires use of a semicolon (;) to distinguish among closely related procedures.</strong></p>\r\n\r\n<p><strong>&nbsp;What is the full description of CPT code 35840</strong></p>', 'Exploration for postoperative hemorrhage, thrombosis or infection; abdomen', 'Exploration for postoperative hemorrhage, thrombosis or infection; excluding abdomen', 'Exploration for postoperative hemorrhage, thrombosis or infection; neck and or abdomen', 'Exploration for postoperative hemorrhage, thrombosis or infection; neck, chest abdomen, and or extremity', '2023-03-28 08:06:35', '2023-03-29 07:10:47', 'ans_a'),
(2436, NULL, 63, 1, '<p><strong>An established patient is seen today to discuss her diagnosis of gallstones. The physician reviews all the test results. He recommends the patient have laparoscopic cholecystectomy. He discusses the surgery with her and the possible complications. The patient agrees to the surgery and is schedule for the surgery next day. What code and modifier would be reported for these services.</strong></p>', '47562-57', '47579-59', '99212-25', '99212-57', '2023-03-28 08:07:12', '2023-05-26 04:04:08', 'ans_d'),
(2437, NULL, 63, 1, '<p><strong>Coding guidelines for assigning ICD 9 CM Codes for neoplasm, states that if documented which of the following should be referenced first to locate the correct code.</strong></p>', 'The neoplasm table in the Alphabetic index', 'The tabular list', 'The histological term in the Alphabetic Index', 'The histological term in the Tabular list', '2023-03-28 08:08:45', '2023-03-28 08:08:45', 'ans_c'),
(2438, NULL, 63, 1, '<p><strong>The patient&#39;s managed care plan requires that physicians counsel their patients about habits adverse to their health for data purposes. In this case, the patient is heavy smoker (more than one pack of cigarettes/day) and the physician provides advice on the benefits of quitting the habit during an encounter for a preventive medicine service which of the following codes is reported for the purposes of data collection</strong></p>', '4000F', '4001F', '40047F', '4011F', '2023-03-28 08:09:49', '2023-03-28 08:09:49', 'ans_a'),
(2439, NULL, 63, 1, '<p><strong>A patient suffering from idiopathic dystonia is seen today and receives the following Boulinum injections: three muscle injections in both upper extremities; seven muscles in the left leg and six muscles in the right leg, and seven injections in paraspinal muscles. What is the correct coding for these procedures</strong></p>', '64642x2, 64644 x2, 64646', '64644, 64645, 64643 x2, 64647', '64642, 64643, 64645, 64645', '64643, 64645, 64647', '2023-03-28 08:11:08', '2023-03-28 08:11:08', 'ans_b'),
(2440, NULL, 63, 1, '<p><strong>&nbsp;Which statement regarding lesion excision is true</strong></p>', 'Codes are selected by measuring the greatest clinical diameter of a lesion excluding the margin required to complete the excision', 'Excision is defined as full thicness removal of a lesion including marging and includes simple closure when performed', 'Excision is defined as partial thicness removal of a lesion, including margins and includes simple closure when performed', 'Excision is defined as full thickness removal of a lesion including margins and includes intermediate closure when performed', '2023-03-28 08:11:53', '2023-03-28 08:11:53', 'ans_b'),
(2441, NULL, 63, 1, '<p><strong>The Health Insurance portability and Accountability Act was enacted on August 21, 1996, which established and funded a health care Fraud and Abuse program to</strong></p>', 'Combat fraud and abuse committed against Medicare and Medicaid health programs', 'Require Medicare to be accountable to senior citizens and provide preventive health services', 'Combat fraud and abuse committed against all health plans, both public and private.', 'Identify health plans that were issuing erroneous payments on claims', '2023-03-28 08:12:37', '2023-03-28 08:12:37', 'ans_c'),
(2442, NULL, 63, 1, '<p><strong>The term eligible professional (EP) is associated with which of the following</strong></p>', 'EMTALA', 'PQRS', 'HIPPA', 'CHIPS', '2023-03-28 08:13:10', '2023-03-28 08:13:10', 'ans_b'),
(2443, NULL, 63, 1, '<p><strong>What form is used for billing physician services performed in an outpatient hospital facility</strong></p>', 'UB-04', 'CMS-1500', 'MS-DRG', 'ABN', '2023-03-28 08:13:48', '2023-03-28 08:13:48', 'ans_b'),
(2444, NULL, 63, 1, '<p><strong>The term medical necessity relates to __</strong></p>', 'The least radical procedure or service considered appropriate to effectively treat the patient\'s condition', 'Condition that require medical attention', 'Making sure required payment is met for procedure or service', 'Using the closest facility to perform a service or procedure', '2023-03-28 08:14:24', '2023-03-28 08:14:24', 'ans_b'),
(2445, NULL, 63, 1, '<p><strong>Which government agency offers compliance program guidance for physician practices</strong></p>', 'Center for Medicare and Medicaid services', 'American Medical Association', 'Office of the inspector general', 'Health insurance portability and accountability act', '2023-03-28 08:15:00', '2023-03-28 08:15:00', 'ans_c'),
(2446, NULL, 63, 1, '<p><strong>Which of the following fraud and abuse scenario is most commonly fraud</strong></p>', 'Under documentation by the physician leading to under coding by the coder', 'Requiring an ABN if the service is not counted medical necessity', 'Intentional violation of no rules', 'Following whichever set of guidelines 95 and 97 that lead to the highest paid code', '2023-03-28 08:15:41', '2023-03-28 08:15:41', 'ans_d'),
(2447, NULL, 63, 1, '<p><strong>HIPAA was created with which goal in mind</strong></p>', 'To identify providers who do not transmit claims electronically', 'To provide an incentive for providers who implement an electronic health record', 'To allow for standardized code set claims transmission', 'To provide an incentive for providers who maintain patient privacy', '2023-03-28 08:16:33', '2023-03-28 08:16:33', 'ans_d'),
(2448, NULL, 63, 1, '<p><strong>Which of the following condition is due to sudden abnormal discharge of cerberal neurons in the brain which may cause muscle groups to contract and relax in an alternating fashion</strong></p>', 'Meningitis', 'Parkinson\'s Disease', 'Concussion', 'Epilepsy', '2023-03-28 08:48:53', '2023-09-18 05:55:54', 'ans_d'),
(2449, NULL, 63, 1, '<p><strong>A patient is diagnosed with a cataract has;</strong></p>', 'Abnormally high intraocular pressure', 'Bleeding vessels on the retina', 'A lens that is no longer clear', 'Corneal neurovascularizaion', '2023-03-28 08:49:48', '2023-03-28 08:49:48', 'ans_c'),
(2450, NULL, 63, 1, '<p><strong>An endotracheal tube is placed inside the trachea to</strong></p>', 'Drain peritoneal fluid', 'Drain urine', 'Open airway to breathe', 'Feed the patient', '2023-03-28 08:50:23', '2023-03-28 08:50:23', 'ans_c'),
(2451, NULL, 63, 1, '<p><strong>What is being done when a surgeon performs a bilateral oopherctomy</strong></p>', 'A sling procedure for vaginal prolaplse', 'Removal of both ovaries', 'Removal of both fallopian tubes', 'Laparoscopic removal of the uterus', '2023-03-28 08:50:55', '2023-03-28 08:50:55', 'ans_b'),
(2452, NULL, 63, 1, '<p><strong>The digestive system include which of the following</strong></p>', 'Esophagus, Ilium, Stomach', 'Salivary glands, Pancreas, Liver', 'Mouth, Kidney, Gallbladder', 'Bladder, Colon, Peritoneum', '2023-03-28 08:51:31', '2023-03-28 08:51:31', 'ans_b'),
(2453, NULL, 63, 1, '<p><strong>Which of the following are considered to be the appendicular skeleton.</strong></p>', 'shoulder gridle, Pelvic gridle, extremities', 'Ribs, sterunum, vertebrae', 'Skull, ribs, sacrum', 'Sternum, vertabrae, sacrum', '2023-03-28 08:52:06', '2023-03-28 08:52:06', 'ans_a'),
(2454, NULL, 63, 1, '<p><strong>The function of spleen is to:</strong></p>', 'Maintain an appropriate volume of circulating blood', 'Filter and destroy red blood cells that are no longer efficient', 'Collect lymph from the rest of the body', 'enables cells to fight against pathogens in the immune system', '2023-03-28 08:52:41', '2023-03-28 08:52:41', 'ans_b'),
(2455, NULL, 63, 1, '<p><strong>The left ventricle pumps blood through out the entire body. Because of this left ventricle</strong></p>', 'weaker and smaller than right ventricle', 'Stronger and smaller than the right ventrcle', 'weaker and larger that right ventricle', 'Stronger and larger than the right ventricle', '2023-03-28 08:53:15', '2023-03-28 08:53:15', 'ans_d'),
(2456, NULL, 63, 1, '<p><strong>A projection is the path of the X-ray beam. If the projection is back to front it would be:</strong></p>', 'Lateral', 'Recumbent', 'Decubitus', 'Posteroanterior', '2023-03-28 08:53:48', '2023-03-28 08:53:48', 'ans_d'),
(2457, NULL, 63, 1, '<p><strong>The radiology term fluroscopy is described as</strong></p>', 'Technique using magnetism, radio waves and a computer to produce images', 'An X-ray procedure allowing the visualization of internal organs in motion', 'A scan using an X-ray beam rotating around the patient', 'Use of high frequency sound waves to image anatomic structures', '2023-03-28 08:54:22', '2023-03-28 08:54:22', 'ans_b'),
