(2755, NULL, 68, 1, '<p>Identify the true statement(s) with respect to Scheme Performance<br />\r\nDisclosures?<br />\r\nA) The data relating to funding performance of all mutual funds is available on<br />\r\nthe AMFI website.<br />\r\nB) SEBI has mandated disclosure of performance data by all the AMCs.</p>', 'Only A is true', 'Only B is true', 'Both A and B are true', 'Both A and B are false', '2023-04-27 08:56:02', '2023-04-27 08:56:02', 'ans_c'),
