(3009, NULL, 83, 1, '<p>Mary and John were married and had a child named Brenda born January 1.<br />\r\nMary and John divorced. Mary remarried to Harry and John remarried to Joan.<br />\r\nEach person has health insurance through their individual employers. Brenda is<br />\r\ncovered under each policy. Mary was born March 5, Harry is born November 2,<br />\r\nJohn is born January 3 and Joan is born in December 23. Whose insurance<br />\r\ncompany will you send the claim to first?</p>', 'Mary', 'John', 'Harry', 'Joan', '2023-05-12 02:16:51', '2023-05-12 02:16:51', 'ans_d'),
(3010, NULL, 83, 1, '<p>The process of editing or correcting the dropped claims and resending them<br />\r\nto the clearing house is called _____ ?</p>', 'Charge correction', 'Claim edits', 'Accounts receivable', 'Scrubbing', '2023-05-12 02:17:18', '2023-05-12 02:17:18', 'ans_b'),
(3011, NULL, 83, 1, '<p>The initial health care expenses each year, which you must pay before any<br />\r\nbenefit, will be paid by the medical plans ?</p>', 'Copay', 'Deductible', 'Coinsurance', 'Self Pay', '2023-05-12 02:17:44', '2023-05-12 02:17:44', 'ans_b'),
