(3014, NULL, 83, 1, '<p>Which of the below is not a type of POS:</p>', 'Nursing Facility', 'Hospice', 'Office', 'Road side', '2023-05-12 02:19:03', '2023-05-12 02:19:03', 'ans_d'),
