(3017, NULL, 84, 1, '<p>What is not Example of out of Pocket?</p>', 'Deductible', 'CMS', 'Coinsurance', 'Copay', '2023-05-12 03:05:45', '2023-05-12 03:05:45', 'ans_b'),
(3018, NULL, 84, 1, '<p>What is the meaning of 50 modifier</p>', 'Reduced Service', 'Dicscontinued Service', 'Bilateral', 'Multiple Surgery', '2023-05-12 03:06:14', '2023-05-12 03:06:14', 'ans_c'),
(3019, NULL, 84, 1, '<p>A patient calls in, upset about their bill. They say they&#39;ve been billed<br />\r\ntwice for the X-ray that they received last month. You review the patient&#39;s chart<br />\r\nand see that they have indeed been charged the same code twice, one with TC<br />\r\nand one with 26 modifiers. Why is this?</p>', 'It\'s a mistake and you should submit a corrected claim right away', 'One charge is the facility charge for the X-ray. The other charge is the reading of the X-ray', 'This is fraud and you should report it to your supervisor.', 'One charge is for the X-ray technician and one charge is for the X-ray film.', '2023-05-12 03:07:08', '2023-05-12 03:07:08', 'ans_b'),
(3020, NULL, 84, 1, '<p>A patient comes in for a follow up on their dressing. Three days<br />\r\nbefore the patient had an incision and drainage of a hematoma from their wrist,<br />\r\nwhich was paid by the insurance. The follow up visit was denied. Why?</p>', 'The follow up procedure should have a modifier 24 to be paid.', 'The diagnosis code was most likely wrong. It needs to reflect \"postoperative care\".', 'The procedure has a global period and covers all related services within 90 days, so this...', 'The provider needed a referral for the follow up visit since it was a different person applying dressing', '2023-05-12 03:09:28', '2023-05-12 03:09:28', 'ans_c'),
(3021, NULL, 84, 1, '<p>Mike came for provider to take a treatment for his left leg bone is<br />\r\nbroken but he did not signed an AOB then what will insurance do?</p>', 'Claim will be paid to provider', 'Claim will be paid to insurance.', 'Claim will be paid to patient', 'All of the above', '2023-05-12 03:10:05', '2023-05-12 03:10:05', 'ans_c'),
(3022, NULL, 84, 1, '<p>According to CMS, which form must be obtained and signed for<br />\r\nMedicare beneficiaries receiving non-covered services before those services are<br />\r\nrendered?</p>', 'CMS-1500', 'ABB', 'NBN', 'ABN', '2023-05-12 03:10:34', '2023-05-12 03:10:34', 'ans_d'),
(3023, NULL, 84, 1, '<p>Demographics include?</p>', 'Name, Address, phone number, and social security number and date of birth', 'Name, marital status, and number and hobbies', 'Address, first name only, and phone number and work phone', 'Name and address', '2023-05-12 03:11:06', '2023-05-12 03:11:06', 'ans_a');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(3024, NULL, 84, 1, '<p>In an HMO, securing ________ may be required before services are<br />\r\nprovided by a specialist</p>', 'Deductible', 'Referral', 'Copay', 'Coinsurance', '2023-05-12 03:11:49', '2023-05-12 03:11:49', 'ans_b'),
(3025, NULL, 84, 1, '<p>Unlike an HMO, a PPO permits its members to use out of networks<br />\r\nproviders, but at a higher cost.</p>', 'True', 'False', 'Both A & B', 'All of the above', '2023-05-12 03:12:22', '2023-05-12 03:12:22', 'ans_a'),
(3026, NULL, 84, 1, '<p>Coinsurance is calculated based on fixed amount</p>', 'False', 'True', 'Both A & B', 'All of the above', '2023-05-12 03:13:00', '2023-05-12 03:13:00', 'ans_a'),
(3027, NULL, 84, 1, '<p>Which of these would be a valid reasons for a claim to be denied?</p>', 'Service is not covered under insurance plan', 'One charge is the facility charge for the X-ray. The other charge is the reading of the X-ray', 'Insurance coverage start after service taken', 'All of the Above', '2023-05-12 03:13:41', '2023-05-12 03:13:41', 'ans_d'),
(3028, NULL, 84, 1, '<p>How do we verify the claim Status</p>', 'Place the call', 'Check from the web site', 'Refer to the EOB', 'All of the Above', '2023-05-12 03:14:13', '2023-05-12 03:14:13', 'ans_d'),
(3029, NULL, 84, 1, '<p>What all steps are included in Pre-Call Analysis</p>', 'Check the DOS, Billed Amount, balance Amount, Insurance Screen, Rejection or...', 'Check the Insurance Screen, Rejection or denial Posted, Notes, Eob', 'Check the DOS, Billed Amount, balance Amount, Notes, Eob, other accounts of the Patient', 'Check the DOS, balance Amount, Rejection or denial Posted, other accounts of the Patient', '2023-05-12 03:15:11', '2023-05-12 03:15:11', 'ans_a'),
(3030, NULL, 84, 1, '<p>What is the difference Between TAT and TFL.</p>', 'TAT is the time given by the Insurance to process the claim however TFL is the Time Given.', 'TAT is the time given to the Insurance to process the claim however TFL is the Time Given', 'TAT is the time for the Insurance company to pay the claim. However TFL is the time', 'None of the Above', '2023-05-12 03:15:49', '2023-05-12 03:15:49', 'ans_b'),
(3031, NULL, 84, 1, '<p>15 As per review A claim for DOS 02/01/2014 was electronically<br />\r\nsubmitted on 02/05/2014 to Aetna Insurance Company. What would you do.</p>', 'Place a call on 02/06/2014 to Insurance check the claim status', 'will check the web site to review the claim status on 02/06/2014', 'We will wait and allow some time to the insurance company for Processing', 'We will write email to Insurance company to get the status on immediate basis', '2023-05-12 03:16:25', '2023-05-12 03:16:25', 'ans_c'),
(3032, NULL, 84, 1, '<p>As per your screen claim was sent on Paper, we would not ask for<br />\r\nthe Electronic Payer Id.</p>', 'True', 'False', 'Both A & B', 'All of the above', '2023-05-12 03:16:52', '2023-05-12 03:16:52', 'ans_a'),
(3033, NULL, 84, 1, '<p>Representative refused to give the call reference number. What<br />\r\nwould you do.</p>', 'We will talk to her supervisor to check the information', 'We will update in the Notes \" No call Reference number Provided\"', 'We will check with the client', 'We can mention the any number in the notes', '2023-05-12 03:17:23', '2023-05-12 03:17:23', 'ans_b'),
(3034, NULL, 84, 1, '<p>As per Rep claim for DOS 09/25/2013 was received on 11/29/2013<br />\r\nand still in Process. Need to allow another 15 days. What would be your action?</p>', 'Will follow up after 15 days', 'Talk to Rep\'s supervisor and ask for the compensation for the payment', 'Will the reason for excess time taken and inform the client', 'Check the Rep Again for the date of Received, ask for the reason for excess time taken and inform the client', '2023-05-12 03:18:46', '2023-05-12 03:18:46', 'ans_d'),
(3035, NULL, 84, 1, '<p>If Claim is sent to TPA for repricing what should be the action of AR<br />\r\ncaller</p>', 'Will follow up after 15 days', 'Talk to Rep\'s supervisor and ask for the compensation for the payment', 'Will take the date from rep when the claim was sent to TPA,if more than 30 days then will taken', 'None of the above', '2023-05-12 03:20:38', '2023-05-12 03:20:38', 'ans_c'),
(3036, NULL, 84, 1, '<p>What all steps are included in Member not Eligible on DOS</p>', 'Cross verify in the system with DOS, whether patient is eligible or not', 'If patient is eligible on the DOS then ask to reprocess the claim, take new claim# and for how long', 'In case of no other insurance bill to patient with proper notes', 'All of the above', '2023-05-12 03:21:37', '2023-05-12 03:21:37', 'ans_d'),
(3037, NULL, 84, 1, '<p>Dr. Smith gave a service to patient name John but forgot to take an<br />\r\nauthorization from insurance. What can Dr Smith do?</p>', 'Will take Re-authorization', 'Write off the claim', 'File the complaint with state insurance commission', 'None of the above', '2023-05-12 03:22:10', '2023-05-12 03:22:10', 'ans_a'),
(3038, NULL, 84, 1, '<p>When Claims are not on File, we should confirm</p>', 'Mail address of claim', 'Fax number', 'Filing period', 'All the above', '2023-05-12 03:22:40', '2023-05-12 03:22:40', 'ans_d'),
(3039, NULL, 84, 1, '<p>Sandy is a new patient in the ABC hospital and has insurance with XYZ<br />\r\ncompany, he visited the hospital for his elbow injury, EMERGENCY facilities was<br />\r\nprovided to sandy to cure him right. So what will be the place of service ?</p>', '25', '24', '22', '23', '2023-05-12 03:23:02', '2023-05-12 03:23:02', 'ans_d'),
(3040, NULL, 84, 1, '<p>Bruce Wayne was admitted on 25/05/2021 as he had an Heart Attack and<br />\r\nwas operated in the emergency room, the claim was submitted but got denied due<br />\r\nto no pre-authorization, what needs to be done?</p>', 'BILL IT TO BRUCE', 'ASK TO REPROCESS (NO PRE-AUTH REQUIRED)', 'BILL IT TO HOSPITAL', 'NONE OF THE ABOVE', '2023-05-12 03:23:32', '2023-05-12 03:23:32', 'ans_b'),
(3041, NULL, 84, 1, '<p>Claim denied due to pre - existing condition. Waiting period should be<br />\r\ncalculated from ?</p>', 'Date of service', 'Effective date of policy', 'Date when the claim is send', 'Termination date of policy', '2023-05-12 03:24:09', '2023-05-12 03:24:09', 'ans_b'),
(3042, NULL, 84, 1, '<p>Joey had undergone a surgery for hand ligament on 02/03/2021 and global<br />\r\nsurgical period is 90 days. However he again visited to same doctor for this eye<br />\r\ncheck on 06/02/2021.Now insurance has denied claim for DOS</p>', 'Ask to reprocess', 'Bill claim to patient', 'Adjust the claim as contractual adjustment', 'None of the above', '2023-05-12 03:24:38', '2023-05-12 03:24:38', 'ans_a'),
(3043, NULL, 84, 1, '<p>A fixed dollar amount that a patient must pay before their insurance<br />\r\ncompany begins to pay for a covered medical service.</p>', 'co-payment.', 'co-insurance amount', 'Premium', 'deductible.', '2023-05-12 03:25:07', '2023-05-12 03:25:07', 'ans_d'),
(3044, NULL, 84, 1, '<p>Eden called the Aetna for DOS 03/28/2021 to ask about the claim status,<br />\r\nRep said that the claim was received on 03/31/2021 and was denied on<br />\r\n04/02/2021 saying that they&rsquo;re not the primary. Checked with the insurance<br />\r\ncompany and said that the primary is Cigna. So updated them as primary. When<br />\r\ncalled Cigna, they said that they&rsquo;re not primary but Aetna is. What will you do<br />\r\nthen?</p>', 'Convince Cigna Insurance that Aetna told them that they’re primary.', 'Bill the patient as it is an COB issue and patient needs to update the same', 'Callback Aetna and tell them that Cigna told that they’re not primary and Aetna need to represent', 'Check if patient holds any tertiary insurance. If yes, follow up with them. If no, Bill the patient', '2023-05-12 03:26:01', '2023-05-12 03:26:01', 'ans_b'),
(3045, NULL, 84, 1, '<p>Dr. Smith signs the contract with BCBS insurance. Dr. Smith is assigned<br />\r\n1000 Patient and is Paid $50 Per month for each patient, regardless of how many<br />\r\ntime patients are seen. What type of contract has Dr. Smith Signed with BCBS<br />\r\ninsurance?</p>', 'HMO', 'POS', 'Capitation', 'PPO', '2023-05-12 03:26:27', '2023-05-12 03:26:27', 'ans_c'),
(3046, NULL, 84, 1, '<p>An EOB shows total billed charges for CPT code 99214 in the amount of<br />\r\n$250.00. The allowed amount is shown to be $120.00. The patient&#39;s insurance is<br />\r\nan 80%-20% plan. Which of the following correctly reflects the patient&#39;s<br />\r\ncoinsurance amount for the above claim?</p>', '$154', '$24', '$20', '$26', '2023-05-12 03:27:10', '2023-05-12 03:27:10', 'ans_b'),
(3047, NULL, 84, 1, '<p>Mr. Josh comes to you with a sprained finger he sustained while working in a<br />\r\ncoal mine. Mr. Josh provides his &quot;&quot;workers compensation&quot;&quot; Insurance card from<br />\r\nwork and his Medicare card, which shows he has Medicare Part A and B.<br />\r\nReferring to the above scenario, to which one of the following do you send the<br />\r\nclaim for the outpatient services rendered by the provider?</p>', 'Cigna', 'Worker compensation', 'Medicare Part A', 'Medicare Part B', '2023-05-12 03:27:41', '2023-05-12 03:27:41', 'ans_b'),
(3048, NULL, 84, 1, '<p>What are Primary Care Providers also known as?</p>', 'Resources', 'Guardian', 'Gatekeepers', 'Insurance', '2023-05-12 03:28:19', '2023-05-12 03:28:19', 'ans_c'),
