(3161, NULL, 88, 1, '<p><strong>Manish went to the physician clinic for a history of colon cancer. During the colonoscopy examination the physician removed multiple colon polyps. Provide ICD codes in correct sequence-</strong></p>', 'Z85.038, K63.5', 'K63.5, Z85.038', 'Z12.11, K63.5', 'K63.5, Z12.11', '2023-08-03 02:53:47', '2023-08-03 02:53:47', 'ans_b'),
(3162, NULL, 88, 1, '<p><strong>Marry Patel, a 65 years old female has Alzheimer&rsquo;s disease without dementia or wandering. Provide correct Sequence of ICD codes.</strong></p>', 'G30.0, F02.81, Z91.83', 'G30.9, F02.80, Z91.83', 'G30.9', 'F02.80, G30.9, Z91.83', '2023-08-03 02:54:50', '2023-08-03 02:54:50', 'ans_c'),
(3163, NULL, 88, 1, '<p><strong>A patient with systemic inflammatory response syndrome (SIRS) not develop acute hepatic failure as a result. How is this reported?</strong></p>', 'R65.11, K72.00', 'R65.20, K72.00', 'K72.00, R65.11', 'R65.11', '2023-08-03 02:55:35', '2023-08-03 02:55:35', 'ans_d'),
(3164, NULL, 88, 1, '<p><strong>Mr John is suffering from tendonitis of the right shoulder prescribed naproxen by a physician. He feels dizziness and nausea after taking the correct dose of prescribed Meds. Provide correct ICD codes for the next day visit he makes to the physician office.</strong></p>', 'T39.315A, R42, R11.0', 'R42, R11.0, T39.315A', 'T39.314A, R42, R11.0', 'R42, R11.0, T39.314A', '2023-08-03 02:57:27', '2023-08-03 02:57:27', 'ans_b'),
(3165, NULL, 88, 1, '<p><strong>&nbsp;Physician make destruction of 12 benign lesions. What will be the correct CPT code for this scenario-</strong></p>', '17111x15', '17110, 17111', '17110', '17111', '2023-08-03 02:58:30', '2023-08-03 02:58:30', 'ans_c'),
(3166, NULL, 88, 1, '<p><strong>Dr Hackerman did a punch biopsy for a patient with a 2 mm neck lesion</strong></p>', '11102', '11104', '11103', '11105', '2023-08-03 02:59:13', '2023-08-03 02:59:13', 'ans_b'),
(3167, NULL, 88, 1, '<p><strong>Johnson went to visit the dermatologist office. Physician diagnosed both lesions as basal cell carcinoma. The right arm lesion 0.3 cm in diameter with 0.1 cm margins and excised. Another lesion on the left leg measures 1.2 cm in diameter with 0.2 cm margins and excised.</strong></p>', '11602, 11600-51', '11403, 11402-51', '11402, 11400-51', '11603, 11602-51', '2023-08-03 03:00:11', '2023-08-08 00:22:08', 'ans_a'),
(3168, NULL, 88, 1, '<p><strong>A patient who is under Global period of past procedure returns for a planned formation flap to repair a defect from the removal of a tumor on the forehead. The formation flap created at the trunk is removed and transferred to the recipient site of the forehead. The graft placed was tubed pedicle into the skin at the distal edge of the wound using 3-0 Vicryl sutures.</strong></p>', '15620-58', '15574-58', '13600-58', '15570-58', '2023-08-03 03:03:27', '2023-08-03 03:03:27', 'ans_b'),
(3169, NULL, 88, 1, '<p><strong>A Dermatologist finds two malignant lesions on Peter&#39;s scalp and Arm. Scalp lesion Measure 3.1 cm and arm lesion is 1.8 cm. Both lesions have been removed via cryosurgery (liquid nitrogen).</strong></p>', '17263, 17272-51', '17274, 17262-51', '17000, 17003', '17110x2', '2023-08-03 03:04:24', '2023-08-03 03:04:24', 'ans_b'),
(3170, NULL, 88, 1, '<p><strong>Martina Hingis has third-degree burns on her upper right thigh and upper arm . A debridement is performed on the right thigh and right upper arm, tbsa 10%.</strong></p>', '16030, 16035, 16036', '16035, 16036', '16035, 16036 x 4', '16030', '2023-08-03 03:05:18', '2023-08-03 03:05:18', 'ans_d'),
(3171, NULL, 88, 1, '<p><strong>Kim was brought in ED by her parents to repair lacerations on her face and her neck. A 3 cm laceration on her forehead is repaired with a simple repair (Single layer closure with nylon suture). A 2&nbsp;cm laceration on her chin and 3&nbsp;cm laceration on her neck also repaired with a simple repair. Provide Correct CPT codes for the procedure performed in ED.</strong></p>', '12014', '12013, 12002-59', '12013, 12011-59, 12001-59', '12002', '2023-08-03 03:06:08', '2023-09-06 04:32:43', 'ans_b'),
(3172, NULL, 88, 1, '<p><strong>Roselina has a stage 4 coccygeal pressure ulcer. Physician make an elliptical incision with a 12-blade scalpel. Ulcerated tissue around the sacrum region down to the bone was removed and repaired with a flap. The coccyx Was excised to allow draining of the presacral space. Provide correct CPT and ICD</strong></p>', '15922, L89.154', '15922, L98.426', '15920, L89.154', '15820, L98.416', '2023-08-03 03:07:07', '2023-08-03 03:07:07', 'ans_a'),
(3173, NULL, 88, 1, '<p><strong>James has type 1 diabetes developed diabetic ulcers on his left foot which were debrided and homografted last week. He is scheduled to return to the operating suite for epidermal autograft. A graft has been harvested from thigh measuring 135 cm. The skin graft was applied over the wound, measured 125 cm in dimension on his left foot. Provide CPT code for the visit</strong></p>', '15120-78, 15121-78', '15120-58, 15121-58', '15115-58, 15116-58', '15115-78, 15121-78', '2023-08-03 03:07:58', '2023-08-03 03:07:58', 'ans_c'),
(3174, NULL, 88, 1, '<p><strong>Mohs microscopic surgery has been performed to excise a melanoma from Right hand in two stages. First stage consist 5 tissue blocks and second stage contain 5 tissue blocks. How we need to report this encounter.</strong></p>', '17311, 17312, 17315 x2', '17311, 17312', '17311, 17312-51, 17315x2-51', '17313, 17314, 17314', '2023-08-03 03:08:47', '2023-08-06 02:12:24', 'ans_b'),
(3175, NULL, 88, 1, '<p><strong>A patient was diagnosed with a left 1st digit trigger finger at MCP joint flexor tendon. The pain management physician gave an injection at that point. What CPT coding is reported?</strong></p>', '20551', '20526', '20526-50', '20552', '2023-08-03 03:09:31', '2023-09-25 01:28:47', 'ans_a'),
(3176, NULL, 88, 1, '<p><strong>A 28-year-old male comes in with a right ring finger abscess. Physician lances the finger with a scalpel, and a big amount of clear fluid is drained as a felon. Patient is to return 7-10 days for follow-up. What CPT code is reported?</strong></p>', '26010-F8', '10060-F8', '10061-F8', '26011-F8', '2023-08-03 03:10:26', '2023-08-03 03:10:26', 'ans_d'),
(3177, NULL, 88, 1, '<p><strong>Which code is reported for a hip joint injection with contrast without anesthesia for an arthrography?</strong></p>', '27095', '27096', '20610', '27093', '2023-08-03 03:11:06', '2023-09-06 04:29:39', 'ans_d'),
(3178, NULL, 88, 1, '<p><strong>&nbsp;A small-bore needle is introduced into the chest and a sternal bone biopsy is performed. What CPT code is reported?</strong></p>', '20206', '20205', '20220', '25066', '2023-08-03 03:11:46', '2023-08-03 03:11:46', 'ans_c'),
(3179, NULL, 88, 1, '<p><strong>This 40-year-old male presents with tenosynovitis of the left hand in the OR. With a sterile approach to the left wrist, an incision is made dissecting down to the tendon sheath and an Incision to the extensor carpi radialis opens the tendon sheath, releasing the fibro-osseous tunnel along the ulnar border of the trapezium. Incisions are repaired in layers. What are the correct CPT and ICD-10-CM codes for this service?</strong></p>', '25001, M65.142', '25001, M65.842', '25000, M65.842', '25024, M65.142', '2023-08-03 03:15:57', '2023-08-03 03:15:57', 'ans_c'),
(3180, NULL, 88, 1, '<p><strong>A 70-year-old male is complaining of persistent pain in her right shoulder. Magnetic resonance imaging scan of her shoulder is consistent with a tear of the right rotator cuff. There is a history of an injury to the shoulder 3 days ago. Given these clinical findings the patient is taken to the operating room for surgery. A scope Is placed into the subacromial space and the rotator cuff tear is well visualized. Arthrex 5.0 bioabsorbable suture anchors with #2 Fiberwire are passed through the rotator cuff tendon in a simple fashion using anchors with excellent fixation into the humeral head. What are the CPT and ICD-10-CM codes?</strong></p>', '23412-RT, M75.101', '29827-RT, M75.101', '23412-RT, S46.001A', '29827-RT, S46.001A', '2023-08-03 03:18:32', '2023-08-03 03:18:32', 'ans_d'),
(3181, NULL, 88, 1, '<p><strong>Patient presents for excision of two lipomas in his right leg. After satisfactory local anesthesia, a longitudinal skin incision was made, and one lipoma in the subfascial tissue of the thigh, measuring 4 cm was sharply dissected from the surrounding muscle. The second lipoma in the subfascial tissue of the lower leg, measuring 2.5 cm, was also sharply dissected. After adequate hemostasis, the incisions were closed by using 3-0 Vicryl sutures, followed by staples for both incisions. What is CPT coding?</strong></p>', '27328 RT, 27619-51-RT', '27337-RT', '27634-RT', '27337-RT, 27618.51-RT', '2023-08-03 03:29:11', '2023-08-03 03:29:11', 'ans_a'),
(3182, NULL, 88, 1, '<p><strong>A 50-year-old male sustained an injury, a left ruptured Achilles tendon, when he tripped over another player and fell while playing touch football. The rupture is extensive and there is sufficient length of the tendon to repair. The repair did not require a tendon graft. It is incorporated at the rupture site and sutured into place. Which procedure code best describes this encounter?</strong></p>', '27665-LT', '27652-LT', '27654-RT', '27650-LT', '2023-08-03 04:11:24', '2023-08-06 02:13:50', 'ans_d'),
(3183, NULL, 88, 1, '<p><strong>&nbsp;A 70-year-old male has pathological fractures of the T6 and T7 spine due to senile osteoporosis. Vertebral augmentation is performed by advancing bone filler devices into the vertebral body anteriorly near the midline and depositing 1.75 ml of radiopaque bone cement on the right and left sides at the T6 level and 5.5 ml at the T7 level on the right and left sides, kyphoplasty was performed for pain. What CPT and diagnosis codes are reported?</strong></p>', '22510-50, 22512 x 2, 99143, M80.08XA', '22510, 22512, M80.9XXA, M81.0', '22513, 22515, M80.08XA', '22510, 22512, M80.08XA', '2023-08-03 04:12:16', '2023-08-03 04:12:16', 'ans_c'),
(3184, NULL, 88, 1, '<p><strong>An elderly female presents with increasing pain in her left dorsal foot. She has a ganglion cyst and a bunion that needs removal. The patient is brought to the operating room and placed under general anesthesia. An incision is made on the dorsal side of the foot. dissection carried down through the subcutaneous tissue, and a ganglion cyst is identified as gelatinous material. It is excised off the tendon and sent to pathology. Then, attention is given to the bunion at the level of the 1st metatarsal of the big toe. The joint capsule is removed exposing the first metatarsal head which is removed partially. Pins and wires are used to maintain the correct position. The wound Is irrigated and closed in layers. What CPT&nbsp; </strong></p>', '28111, 28090-51', '28100, 28092-51', '28122, 28090-51', '28045, 28092-51', '2023-08-03 04:13:34', '2023-09-05 02:47:40', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(3185, NULL, 89, 1, '<p><strong>An oncologist performs a bone marrow aspiration and plan for a bone marrow biopsy on the right posterior ilac spine. The biopsy procedure was planned for next week. Select the appropriate coding.</strong></p>', '38221', '38222', '38220', '38221, 38220', '2023-08-16 02:37:03', '2023-08-24 05:01:24', 'ans_c'),
(3186, NULL, 89, 1, '<p><strong>An ethmoidectomy is performed. Diseased tissue is surgically removed from the anterior and posterior ethmoid sinuses by an extranasal surgical approach. A curette is used to remove the diseased tissue. What CPT code is reported for the procedure?</strong></p>', '31255', '31201', '31205', '31200', '2023-08-16 02:37:47', '2023-08-24 05:01:40', 'ans_c'),
(3187, NULL, 89, 1, '<p><strong>The patient is brought to the ED with an obstructed airway. The provider immediately makes an incision through the transtracheal and inserts a tracheostomy tube to assist the patient&rsquo; breathing. What CPT&nbsp; code is reported for this scenario?</strong></p>', '31605', '31603', '31600', '31601', '2023-08-16 02:38:21', '2023-08-24 05:01:57', 'ans_b'),
(3188, NULL, 89, 1, '<p><strong>The 37-year-old has adenoma of the liver. The tumor is invading the diaphragm. Electrocautery is used to remove part of the diaphragm and repaired with muscle flap and two running 0-Prolene Sutures. What CPT code is reported?</strong></p>', '39540', '39560', '39561', '39545', '2023-08-16 02:39:13', '2023-08-24 05:02:39', 'ans_c'),
(3189, NULL, 89, 1, '<p><strong>A lymphangiogram is performed for identification of a sentinel node in a patient with early onset of a malignant mastocytoma. Code the condition as well as the radio dye injection procedure with lymphatic nuclear medicine and imaging. What are the correct CPT and ICD-10-CM codes?</strong></p>', '38790, 78195, C96.29', '38792, 78195, C96.29', '38500, 38900, 76842, C47.09', '38792, 76842, C85.80', '2023-08-16 02:40:12', '2023-08-24 05:02:45', 'ans_b'),
(3190, NULL, 89, 1, '<p><strong>Patient has lung cancer in his lower right lobe. Patient is in the operating suite to have a video-assisted thoracoscopic surgery (VATS). A 10 mm zero-degree thoracoscope was inserted in the right pleural cavity through a port site placed in the sixth intercostal space on the midaxillary line. Two additional port sites were placed in the fifth intercostal space on the posterior and anterior midaxillary line. Removal of the total two right lower lobes with the mass is performed thoracoscopically. Inspection of the lung revealed normal pulmonary parenchyma. After closing the port sites and inserting a chest tube, the patient was extubated and was transferred to the surgical intensive care unit for observation. What CPT coding is reported?</strong></p>', '32671', '32663, 32601-51', '32670', '32663', '2023-08-16 02:40:50', '2023-08-24 05:02:53', 'ans_c'),
(3191, NULL, 89, 1, '<p><strong>Malissa, 51 year old female presents for Mediastinoscopy for mediastinal mass. Biopsy of the lymph node shows mediastinal cancer. Provide the correct CPT and ICD-10 codes.</strong></p>', '39401, C38.3', '39401 x 4, C38.2', '39402, C38.3', '39402 x 4, C38.3', '2023-08-16 02:41:27', '2023-08-24 05:03:12', 'ans_c'),
(3192, NULL, 89, 1, '<p><strong>Patient has lung cancer in his right medial segment and is in the OR for removal of a segment. A thoracotomy is performed, and a rib spreader is used to access the right lung, Removal of the total right medial segment with the mass is performed. The incision is closed with staples and the patient is transferred to the surgical intensive care unit for observation. What CPT code is reported?</strong></p>', '32670', '32484', '32669', '32480', '2023-08-16 02:42:03', '2023-08-24 05:03:21', 'ans_b'),
(3193, NULL, 89, 1, '<p><strong>Operative Report:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Preoperative Diagnosis: Lesion in the false vocal cord</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Postoperative Diagnosis: Lesion in the false vocal cord</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Procedure: Direct laryngoscopy with lesion biopsy</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Anesthesia: General endotracheal tube anesthetic</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Indications for Procedure: This is a 45-year-old male with a history of tobacco abuse who has chronic hoarseness and who was found on rigid laryngoscopy to have a lesion involving both vocal cords. The decision was made to perform a biopsy in order to obtain a diagnosis.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Technical Procedure: After informed consent was obtained and the operative site identified, the patient was taken to the operating room and placed on the table in the supine position. General endotracheal tube anesthesia was induced, and attention turned to the oral cavity. A tooth protector was placed and the shoulder roll applied. The patient was draped in the usual sterile fashion. A time out was taken, and then the inferior commissure laryngoscope used to visualize the vallecula, the right and left pyriform sinus, the post cricoid sinus, the false vocal cord, and the true vocal cord. Biopsy forceps were used to excise the&nbsp; lesion and 2 biopsy samples were sent separately to Pathology for a demonstration. Once this was completed, the area was suctioned out, and the laryngoscope and tooth guard removed. The patient was awakened, extubated, and transferred to PACU in stable condition. Select the procedure code for this service:</strong></p>', '31512', '31535', '31530', '31510', '2023-08-16 02:42:42', '2023-09-03 00:19:49', 'ans_b'),
(3194, NULL, 89, 1, '<p><strong>Garry, a 4-year-old male needs a peripherally inserted venous access catheter for cancer treatment. The patient was placed in the supine position. Following the administration of light anesthesia, the right arm was prepped and draped in the usual fashion. Next, 50 cc of 1 percent Lidocaine with bicarb was infused in the skin and subcutaneous tissue and the basilic vein was punctured. CPT coding is reported? Using the Seldinger technique, the subclavian vein was cannulated on the first attempt. A J-wire passed easily under fluoroscopic guidance to the subclavian vein. The wound was closed with a 3-OVieryl. Benzoin and Steri-Strips were applied. Sponge and needle count correct. The patient was awakened from light anesthesia and taken to the recovery room in stable condition.</strong></p>', '36573', '36572, 77001', '36568, 77001', '36572', '2023-08-16 02:43:26', '2023-08-24 05:03:39', 'ans_d'),
(3195, NULL, 89, 1, '<p><strong>A 55 year old female patient is in the oncologist&rsquo;s office for chemotherapy. She complains of vomiting and diarrhea since this morning and is dehydrated. The chemotherapy is postponed until next week and she receives an infusion of 1,000 ml of normal saline for 2 hour 30 minutes. According to CPT guidelines and parenthetical statements, how is the hydration reported?</strong></p>', '96365, 96366', '96365', '96360', '96360, 96361', '2023-08-16 02:44:13', '2023-08-24 05:03:47', 'ans_d'),
(3196, NULL, 89, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: Excision of back lesion.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>INDICATIONS FOR SURGERY: The patient has an enlarging lesion on the upper mid back. FINDINGS AT SURGERY: There was a 5-cm, upper mid back lesion.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>OPERATIVE PROCEDURE: With the patient prone, the back was prepped and draped in the usual sterile fashion. The skin and underlying tissues were anesthetized with 30 mL of 1% lidocaine with epinephrine. Through a 5-cm transverse skin incision, the lesion was excised. Hemostasis was ensured. The incision was closed using 3-0 Vicryl for the single layer stitch with Steri-Strips for the skin. The patient was returned to the same-day surgery center in stable postoperative condition. All sponge, needle, and instrument counts were correct. Estimated blood loss is 0mL. PATHOLOGY REPORT LATER INDICATED: Follicular cyst, infundibular type, skin of back.</strong></p>', '11406, 12002', '11406', '11406, 12032', '11606', '2023-08-16 02:45:06', '2023-08-24 05:03:56', 'ans_b'),
(3197, NULL, 89, 1, '<p><strong>EMERGENCY DEPARTMENT REPORT</strong></p>\r\n\r\n<p><strong>CHIEF COMPLAINT: Nasal bridge laceration.</strong></p>\r\n\r\n<p><strong>SUBJECTIVE: The patient is a 74-year-old male who presents to the emergency department with a laceration to the bridge of his nose. He fell in the bathroom tonight. He recalls the incident. He just sort of lost his balance. He denies any vertigo. He denies any chest pain or shortness of breath. He denies any head pain or neck pain. There was no loss of consciousness. He slipped on a wet floor in the bathroom and lost his balance; that is how it happened. He has not had any blood from the nose or mouth. PAST MEDICAL HISTORY:</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>1. Parkinson&#39;s</strong></p>\r\n\r\n<p><strong>2. Back pain</strong></p>\r\n\r\n<p><strong>3. Constipation</strong></p>\r\n\r\n<p><strong>MEDICATIONS: See the patient record for a complete list of medications.</strong></p>\r\n\r\n<p><strong>ALLERGIES: NKDA.</strong></p>\r\n\r\n<p><strong>REVIEW OF SYSTEMS: Per HPI. Otherwise, negative.</strong></p>\r\n\r\n<p><strong>PHYSICAL EXAMINATION: The exam showed a 74-year-old male in no acute distress. Examination of the HEAD showed no obvious trauma other than the bridge of the nose, where there is approximately a 1.5- to 2-cm laceration. He had no bony tenderness under this. Pupils were equal, round, and reactive. EARS and NOSE:</strong></p>\r\n\r\n<p><strong>OROPHARYNX was unremarkable. NECK was soft and supple. HEART was regular.</strong></p>\r\n\r\n<p><strong>LUNGS were clear but slightly diminished in the bases.</strong></p>\r\n\r\n<p><strong>PROCEDURE: The wound was draped in a sterile fashion and anesthetized with 1% Xylocaine with sodium bicarbonate. It was cleansed with sterile saline and then repaired using interrupted 6- 0 Ethilon sutures in 2 layers (Dr. Barney Teller, first-year resident, assisted with the suturing). ASSESSMENT: Nasal bridge laceration,status post fall.</strong></p>\r\n\r\n<p><strong>Plan: Keep clean. Sutures out in 5 to 7 days. Watch for signs of infection.</strong></p>', '12051, S01.21XA, W18.49XA', '12011, S01.21XA, W18.49XA', '12011, S01.22XA, W18.30XA', '12011, 11000, S01.22XA, X58.XXXS', '2023-08-24 05:05:51', '2023-08-24 05:05:51', 'ans_a'),
(3198, NULL, 89, 1, '<p><strong>DIAGNOSIS: Inverted nipple with intraductal papilloma, left.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>OPERATION: Nipple exploration to remove papilloma duct, left.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>With the patient under general anesthesia, a circumareolar incision was made with sharp dissection and carried down into the breast tissue. The nipple complex was raised up using a small retractor. We gently dissected underneath to free up the nipple entirely. Once this was done, we had the nipple fully unfolded, and there was some evident intraductal papilloma. An area 3 &times; 4 cm was excised using electrocautery. Hemostasis was maintained with the electrocautery, and then the breast tissue deep to the nipple was reconstructed using sutures of 3-0 chromic. Subcutaneoustissue was closed using 3-0 chromic, and then the skin was closed using 4-0 Vicryl. Steri-Strips were applied. The patient tolerated the procedure well and was returned to the recovery area in stable condition. At the end of the procedure, all sponges and instruments were accounted for.</strong></p>', '19110-LT, D24.2', '11404-LT, N60.42', '19112, N60.49', '19120-LT, N60.42', '2023-08-24 05:06:41', '2023-08-24 05:06:41', 'ans_a'),
(3199, NULL, 89, 1, '<p><strong>This patient returns today for palliative care to her feet. Her toenails have become elongated and thickened, and she is unable to trim them on her own. She states that she has had no problems and no acute signs of any infection or otherwise to her feet. She returns today strictly for nail debridement to her feet. EXAMINATION: Her pedal pulses are palpable bilaterally. The nails are mycotic, 1 through 3 on the left, and 1 &amp; 2 on the right.</strong></p>\r\n\r\n<p><strong>ASSESSMENT: Onychomycosis, 1 through 3 on the left and 1 &amp; 2 on the right. PLAN: Mild debridement of mycotic nails &times;5. This patient is to return to the clinic in 3 to 4 months for follow up palliative care.</strong></p>', '11721 × 5, B48.8', '11720, B35.1', '11719, B35.1', '11721, B35.1', '2023-08-24 05:07:32', '2023-08-24 05:07:32', 'ans_b'),
(3200, NULL, 89, 1, '<p><strong>OPERATIVE REPORT</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>With the patient having had a wire localization performed by radiology,she was taken to the operating room and, under local anesthesia of the left breast, was prepped and draped in a sterile manner. A breast line incision was made through the entry point of the wire, and 2 core of tissues surrounding the 2 wires (approximately 1 &times; 2 cm) were removed using electrocautery for hemostasis. The specimens, including the wire, were then submitted to radiology, and the presence of the lesion within the specimen was confirmed. The wound was checked for hemostasis, and this was maintained with electrocautery. The breast tissue was reapproximated using 2-0 and 3-0 chromic. The skin was closed using 4-0 Vicryl in a subcuticular manner. Steri-Strips were applied.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>The patient tolerated the procedure well and was discharged from the operating room in stable condition. At the end of the procedure, all sponges and instruments were accounted for. Pathology report later indicated: Benign lesion.</strong></p>', '19125-LT, D49', '11400-LT, C50.919', '19125-LT, D24.2', '19125-LT, 19126-LT, D24.2', '2023-08-24 05:08:38', '2023-08-24 05:08:38', 'ans_d'),
(3201, NULL, 89, 1, '<p><strong>Patient is complaining of flashes and floaters in his right eye. Ophthalmologist performs an initial extended ophthalmoscopy on the right eye and identifies Macular Pucker. Physician performed optic nerve drawing, interpretation and report. Provide correct CPT code for this visit.</strong></p>', '92018', '92202', '92201', '92060', '2023-08-24 05:09:34', '2023-08-24 05:09:34', 'ans_b'),
(3202, NULL, 89, 1, '<p><strong>John was seen by his physician two times during a dialysis procedure to declot the access cannula during the hemodialysis process. Declotting of cannula has been done by balloon. Provide CPT code for the service provided by the physician.</strong></p>', '90936', '90937, 36860', '90937, 36861', '36860', '2023-08-24 05:10:29', '2023-08-24 05:10:29', 'ans_c'),
(3203, NULL, 89, 1, '<p><strong>James Jose who is suffering from emphysema admitted to the ER with a complaint of shortness of breath. A inhalation treatment with aerosol is administered in the ER for three hours. Provide CPT code for this visit.</strong></p>', '94640, 94640-76', '94644, 94645x2', '94644', '94640', '2023-08-24 05:11:25', '2023-09-18 01:38:01', 'ans_b'),
(3204, NULL, 89, 1, '<p><strong>A 65-year-old comes into the ED with atrial fibrillation. Temporary pacing wire placed on the patient&rsquo;s chest transcutaneously and a direct current of 120 J of synchronized shock was delivered but atrial fibrillation appeared to persist after a few sinus beats. Therefore, a 200 J of synchronized biphasic shock was delivered, and this time sinus rhythm was restored and persisted. How is this procedure reported?</strong></p>', '92970', '92961', '92953', '92960', '2023-08-24 23:28:37', '2023-08-24 23:28:37', 'ans_c'),
(3205, NULL, 89, 1, '<p><strong>A 41-year-old is seen for somatic dysfunction in multiple body areas. Osteopathic manipulative treatment is performed to the following regions: cervical, thoracic, lumbar, sacrum, pelvis and abdominal/visceral. What CPT coding is reported?</strong></p>', '98927', '98928 x7', '98929 x9', '98928', '2023-08-24 23:30:17', '2023-08-24 23:30:17', 'ans_a'),
(3206, NULL, 89, 1, '<p><strong>The patient presents for an echocardiogram. The indication for the procedure is intermittent episodes of shortness of breath. Echocardiography, transesophageal, real-time with image documentation with M-mode recording and a probe was placed with images and interpretation is performed. What is the correct CPT code for the physician-ordered test?</strong></p>', '93307', '93312', '93350', '93306', '2023-08-24 23:31:14', '2023-08-24 23:31:14', 'ans_b'),
(3207, NULL, 89, 1, '<p><strong>Mrs. Bisht has 20 actinic keratosis on the trunk of her body. A physician applies a photosensitizing drug to the patient&#39;s precancerous lesions. The physician asks the patient to come back later in the day following the application of the drug. When the patient returns later that day the physician then exposes the area to blue light. The photosensitizing drug in the lesion absorbs the light and produces an active form of oxygen that destroys abnormal cells. What CPT coding is reported for the procedure?</strong></p>', '96573 x20', '96567 x20', '96573', '96567', '2023-08-24 23:32:27', '2023-08-24 23:32:27', 'ans_c'),
(3208, NULL, 89, 1, '<p><strong>A patient was seen in the emergency department after falling off her bike in the local park. The patient suffered abrasions on her right lower leg, which needed to be debrided. Debridement Facility service was performed using high pressure water jet 16 sq cm. Silvadene application, wound assessment, and dressings were also applied. Report the CPT&nbsp; and ICD-10-CM codes for the service.</strong></p>', '97602, S80.811A, V18.0XXA, Y92.830', '97597, S81.801A, W17.89XA, Y92.830', '97602, S81,801A, W17.89XA, Y92.830', '97597, S80.811A, VI8.0XXA, Y92.830', '2023-08-24 23:33:40', '2023-09-18 01:48:30', 'ans_d'),
(3209, NULL, 89, 1, '<p><strong>A 31-year-old sees his treating physician and collaborative care management team for follow-up psychiatric collaborative care management for depression. The total time spent with the patient is 110 minutes. What EM coding is reported?</strong></p>', '99493, 99494', '99493', '99492', '99492, 99494', '2023-08-24 23:34:33', '2023-08-24 23:34:33', 'ans_a'),
(3210, NULL, 89, 1, '<p><strong>A 45 year old patient was admitted on 05/18/2023 at 8am and the provider visits him in the hospital and spends 20 minutes with the patient. Later that same day, he sees the patient and discharges him at 5pm, providing a detailed exam, spending another 25 minutes on the discharge. What is reported for the discharge services?</strong></p>', '99239', '99238', '99217', '99234', '2023-08-24 23:35:21', '2023-08-24 23:35:21', 'ans_d'),
(3211, NULL, 89, 1, '<p><strong>A 32-year-old male, visits his provider to discuss lab results that were ordered at his preventive visit last week. The physician spends 45 minutes going over the lab results, counseling on heart disease prevention, and implementing a diet plan and an exercise program.</strong></p>', '99403', '99386', '99402', '99411', '2023-08-24 23:36:28', '2023-08-24 23:36:28', 'ans_a'),
(3212, NULL, 89, 1, '<p><strong>According to the CPT guidelines for Initial Observation, when a patient is admitted to observation care and is discharged the following day, which E/M code range is reported for the patient being admitted in observation?</strong></p>', '99234.99236', '99221-99223', '99202-99205', '99231-99233', '2023-08-28 05:28:44', '2023-08-28 05:28:44', 'ans_b'),
(3213, NULL, 89, 1, '<p><strong>Dr. Paul sees Mrs. Dawn today in the nursing facility as a follow up visit after 48 months from her last visit on the status of her chronic conditions. A medically appropriate history and exam was performed, and medical decision making is moderate. The status of her COPD is stable, and bronchodilator therapy will continue. Her last HbA1C is within normal range and there are no changes for diabetes management. She&#39;s doing well. The antidepressant started last week for her depression. Dr. Paul will see her again next week. What E/M code is reported?</strong></p>', '99305', '99310', '99309', '99306', '2023-08-28 05:29:18', '2023-08-28 05:29:18', 'ans_a'),
(3214, NULL, 89, 1, '<p><strong>Robert was on a cruise in Mexico when he developed nausea, vomiting, and diarrhea 2 days ago and is now taking the medication as prescribed by ship doctor on that day but again developed the same symptoms. The ship doctor examined him as follow up this time in his cabin. A medically appropriate history and exam was performed. Medical decision making was moderate. The doctor gave him prescribed medications and&nbsp;advised Bob to hydrate and to avoid alcohol and rich/spicy food for 48 hours. Total What E/M code is reported?</strong></p>', '99343', '99342', '99347', '99349', '2023-08-28 05:29:47', '2023-09-27 03:53:50', 'ans_d'),
(3215, NULL, 89, 1, '<p><strong>Geeta has a follow-up appointment with her physician for depression. She has seen no improvement since the last visit. The physician performs a medically appropriate history and exam and gives the patient a prescription for Celexa. The total time spent on the encounter the day of the visit is 35 minutes. What E/M code is reported?</strong></p>', '99203', '99214', '99202', '99213', '2023-08-28 05:30:27', '2023-08-28 05:30:27', 'ans_b'),
(3216, NULL, 89, 1, '<p><strong>A patient comes in with borderline obesity to Dr Jane&#39;s office. She performs a medically appropriate history and exam. She spends 24 minutes discussing the risk associated with obesity. She prescribes diet and exercise. What established patient office evaluation and management code is reported?</strong></p>', '99213', '99214', '99215', '99212', '2023-08-28 05:31:10', '2023-08-28 05:31:10', 'ans_a'),
(3217, NULL, 89, 1, '<p><strong>The Pharynx is in which organ system?</strong></p>', 'Cardiovascular', 'Urinary', 'Respiratory', 'Digestive', '2023-08-28 05:31:38', '2023-08-28 05:31:38', 'ans_d'),
(3218, NULL, 89, 1, '<p><strong>Which structure below is not found in the mediastinum?</strong></p>', 'Pineal gland', 'Trachea', 'Thymus gland', 'Heart', '2023-08-28 05:32:17', '2023-08-28 05:32:17', 'ans_a'),
(3219, NULL, 89, 1, '<p><strong>Which is not a part of the Digestive system?</strong></p>', 'Stomach', 'Gallbladder', 'Pharynx', 'Spleen', '2023-08-28 05:32:50', '2023-08-28 05:32:50', 'ans_d'),
(3220, NULL, 89, 1, '<p><strong>Which of the following is not a part of the peripheral nervous system?</strong></p>', 'Cranial Nerves', 'Dura mater', 'Brachial plexus', 'Ganglia', '2023-08-28 05:33:28', '2023-08-28 05:33:28', 'ans_b'),
(3221, NULL, 89, 1, '<p><strong>Which is part of the female genitalia?</strong></p>', 'Bartholin’s glands', 'Epididymis', 'Cowper\'s glands', 'Prostate Gland', '2023-08-28 05:34:07', '2023-08-28 05:34:07', 'ans_a'),
(3222, NULL, 89, 1, '<p><strong>Which one is NOT a part of the Sensory Nervous system?</strong></p>', 'Ilium', 'Spinal Cord', 'Brain', 'Ciliary body', '2023-08-28 05:34:45', '2023-08-28 05:34:45', 'ans_a'),
(3223, NULL, 89, 1, '<p><strong>&quot;The right Greater trochanter bone area was prepped and draped in the usual sterile fashion. A transverse incision was marked over the Greater trochanter part of the bone based on imaging guidance. The skin area was infiltrated with local anesthetic. Local anesthesia was also applied to the skin area on the same site. A small stab incision was created here, and a jamshidi needle was used to obtain bone marrow aspirate sufficient for later use in the fusion, mixed with Bio Adapt demineralized bone matrix.&quot; Based on this documentation, where was the bone marrow aspirate harvested from?</strong></p>', 'Hip bone', 'Thigh bone', 'Arm bone', 'Cervical vertebra', '2023-08-28 05:36:25', '2023-08-28 05:36:25', 'ans_b'),
(3224, NULL, 89, 1, '<p><strong>The ______&nbsp; gland that secrete Mucous to keep the vaginal tissues moist and lubricated.</strong></p>', 'Bartholin’s glands', 'Endometrial glands', 'Mammary Glands', 'Ovaries', '2023-08-28 05:37:28', '2023-08-28 05:37:28', 'ans_a'),
(3225, NULL, 89, 1, '<p><strong>A surgical laparoscopy with tubal occlusion by placement of permanent implants is performed. What is the anesthesia code reported by the anesthesiologist?</strong></p>', '00950', '00952', '00940', '00851', '2023-08-28 05:38:07', '2023-08-28 05:38:07', 'ans_d'),
(3226, NULL, 89, 1, '<p><strong>Physical status modifiers for anesthesia coding are used to report:</strong></p>', 'The patient\'s age at the time of the anesthesia service', 'To assess the patient\'s risk during anesthesia', 'A patient’s response to the anesthesia', 'Patient’s gender', '2023-08-28 05:40:20', '2023-08-28 05:40:20', 'ans_b'),
(3227, NULL, 89, 1, '<p><strong>Patient receives monitored anesthesia by the anesthesiologist for a therapeutic cardiac catheterization with stent placement to the left anterior descending artery. Patient has a history of STEMI. The patient is physical status 4, Report the services of the anesthesiologist.</strong></p>', '01924-AA.G8-P4', '01925-AA-G9-P4', '01924-AA-QS-P4', '01925-AA-QS-P4', '2023-08-28 05:41:31', '2023-08-28 05:41:31', 'ans_b'),
(3228, NULL, 89, 1, '<p><strong>A 30 year old suffered an injury to his left knee in a work-related altercation when he was tripped by the suspect without falling. He is having a diagnostic arthroscopy. This identified a tear of his anterior cruciate ligament and a tear of his lateral meniscus. What anesthesia code is reported?</strong></p>', '01380', '01402', '01382', '01400', '2023-08-28 05:42:16', '2023-09-25 05:31:27', 'ans_c'),
(3229, NULL, 89, 1, '<p><strong>A 82 year-old patient is brought to the operating room in emergency for craniotomy for the subdural tap. What CPT codes are reported for the anesthesiologists services?</strong></p>', '00215-AA, 99140', '00211-AA, 99100, 99140', '00212-AA 99100, 99140', '00211-AA, 99100', '2023-08-28 05:43:32', '2023-08-28 05:43:32', 'ans_c'),
(3230, NULL, 89, 1, '<p><strong>A 7-year-old female in good physical health is having a Cholecystectomy. The anesthesiologist begins to prepare this patient for surgery at 9:45 am, The surgery begins at 10:10 am and ends at 10:55 pm. The anesthesiologist releases the patient to the PACU nurses at 11:15 pm. What is the anesthesia time and anesthesia code reported?</strong></p>', '1 hour, 30 minutes; 00790', '1 hour, 15 minutes; 00840', '1 hour, 45 minutes; 00840', '2 hours, 15 minutes; 00790', '2023-08-28 05:44:16', '2023-08-28 05:44:16', 'ans_a'),
(3231, NULL, 89, 1, '<p><strong>A 16-year-old was involved in a motorcycle accident and urgently taken to the operating room. Under general endotracheal anesthesia a vascular surgeon performed a repair of a laceration of the right femoral artery in the left thigh. Report the service of the anesthesiologist.</strong></p>', '01390', '01500', '01270', '01520', '2023-08-28 05:44:50', '2023-08-28 05:44:50', 'ans_c'),
(3232, NULL, 89, 1, '<p><strong>Mrs. Park age 65 is in poor health with diabetes and associated peripheral neuropathy. She is having a tibial artery bypass graft. The CRNA is performing the anesthesia without medical direction, The CRNA also places a percutaneous arterial line. What CPT coding is reported?</strong></p>', '01270-QZ, 36625', '01270-QZ, 36620', '01272-QY, 36625', '01500-QZ, 36620', '2023-08-28 05:45:28', '2023-08-28 05:45:28', 'ans_d'),
(3233, NULL, 89, 1, '<p><strong>A surgeon incises and drains a transrectal pelvic superficial abscess. What CPT code is reported for the procedure?</strong></p>', '45000', '46050', '46045', '45005', '2023-08-28 05:46:02', '2023-08-28 05:46:02', 'ans_a'),
(3234, NULL, 89, 1, '<p><strong>A 40-year-old female has an infected retroperitoneal abscess. The surgeon incises the abdomen and drains the abscess. What CPT code is reported?</strong></p>', '49040', '49082', '49060', '49020', '2023-08-28 05:46:34', '2023-08-28 05:46:34', 'ans_c'),
(3247, NULL, 90, 1, '<p><strong>What code would be used to code the destruction of a malignant lesion on the right arm measuring 1.6 cm using cryosurgery?</strong></p>', '17272', '11602', '17262', '11622', '2023-09-04 00:40:53', '2023-09-19 01:00:10', 'ans_c'),
(3248, NULL, 90, 1, '<p><strong>What code would be used to code the destruction of 8 benign lesion on the genitalia measuring&nbsp;using cryosurgery?</strong></p>', '17110', '17004', '17000, 17003x7', '17110', '2023-09-04 00:41:35', '2023-09-27 05:32:01', 'ans_d'),
(3249, NULL, 90, 1, '<p><strong>A patient who has ascending colon adenocarcinoma undergoes a laparoscopic partial colectomy. While the procedure started, due to some medical issues, the surgeon had to remove the trocars and a 5 cm incision was made deep to the peritoneum. The surgeon removes the proximal colon and terminal ileum and reconnects the cut ends of the distal ileum and remaining colon, What are the appropriate procedure and diagnosis codes?</strong></p>', '44204, C18.2', '44205, C18.9', '44160, C18.2', '44140, C18.9', '2023-09-04 00:42:18', '2023-09-04 00:42:18', 'ans_c'),
(3250, NULL, 90, 1, '<p><strong>A 52-year-old female has morbid obesity with a BMI of 54, She has decided to have a Roux-en-Y gastric bypass. The patient is brought to the operating room and placed in supine position. A 10 cm incision made into peritoneum. The stomach is mobilized and the proximal stomach is divided and stapled creating a small proximal pouch in continuity with the esophagus. A short limb of the proximal bowel of 150 cm is divided. It is brought up and anastomosed to the gastric pouch. The other end of the divided bowel is connected back into the distal small bowel to the short limb&rsquo;s gastric anastomosis to restore intestinal continuity. The instruments are removed. What are the procedure and diagnosis codes for this encounter?</strong></p>', '43847, E66.01, Z68.41', '43846, E66.01, Z68.43', '43644, E66.8, Z68.41', '43645, E66.01, Z68.41', '2023-09-06 00:39:07', '2023-09-27 03:52:31', 'ans_b'),
(3252, NULL, 90, 1, '<p><strong>What code(s) is used by the radiologist when performing a lesion excision of breast by preoperative placed of a needle localization wire of a single lesion?</strong></p>', '19281, 19125', '19125', '19281', '19296', '2023-09-06 00:45:49', '2023-09-06 00:45:49', 'ans_b'),
(3253, NULL, 90, 1, '<p><strong>A urologist performs a ligation of penile veins with the trocar and scope placed through the abdomen. Which CPT code is reported?</strong></p>', '58540', '55535', '55550', '55530', '2023-09-06 00:46:15', '2023-09-06 00:46:15', 'ans_c'),
(3255, NULL, 90, 1, '<p><strong>A 55-year-old male presents in the emergency department with acute urinary retention for 8 hours. The ED physician places a foley catheter with difficulty due to anatomic anomaly and empties 300 cc of urine.What CPT&nbsp; code is reported?</strong></p>', '51700', '51702', '51703', '51701', '2023-09-06 00:47:39', '2023-09-06 00:47:39', 'ans_c'),
(3256, NULL, 90, 1, '<p><strong>Patient returns for treatment for 7 extensive warts located on the left foot. In the last visit a decision was made to inject each wart with an antigen drug on a monthly basis until the warts have resolved. What CPT code is reported?</strong></p>', '11900', '11900 x 7', '11901', '17110 x 7', '2023-09-06 00:48:09', '2023-09-06 00:48:09', 'ans_a'),
(3257, NULL, 90, 1, '<p><strong>A surgeon is performing a renal lesion ablation with ultrasound guidance through 2 small abdominal incisions and a scope and trocar was placed. What CPT code is reported?</strong></p>', '50543', '50542, 76942', '50542', '50543, 76942', '2023-09-06 00:49:00', '2023-09-06 00:49:00', 'ans_c'),
(3258, NULL, 90, 1, '<p><strong>At 15 weeks of pregnancy Nancy started bleeding. An ultrasound revealed a snow-flake pattern. Diagnosis is a complete hydatidiform mole. The uterine evacuation &amp; curettage was done for hydatidiform mole. What is the CPT&nbsp; code for the procedure and the ICD-10-CM code for the diagnosis?</strong></p>', '58120, O02.0', '59841, O02.0', '59100, O01.0', '59870, O01.0', '2023-09-06 00:49:48', '2023-09-06 00:49:48', 'ans_d'),
(3259, NULL, 90, 1, '<p><strong>The dermatologist has performed Mohs micrographic surgery to excise a melanoma from the patient&#39;s head &amp; neck area. Three stages were performed. First stage had 9, the second stage had 8 tissue blocks. The third stage had 7 tissue blocks removed. The appropriate mapping and documentation was done on a separate operative report. What CPT codes are reported?</strong></p>', '17311, 17312x2, 17315-51', '17311, 17312, 17314, 17315x9', '17311, 17314x2, 17315x9', '17311, 17312x2, 17315x9', '2023-09-06 00:54:57', '2023-09-06 00:54:57', 'ans_d'),
(3260, NULL, 90, 1, '<p><strong>A 20-days-old baby has phimosis. The decision is made to treat this condition with circumcision. Anesthesia is injected. The foreskin is pulled away from the body of the penis. The unwanted foreskin is cut away by a scalpel. The skin edges created are sutured together. What CPT&nbsp; and ICD-10-CM codes are reported?</strong></p>', '54160, N47.1', '54150-52, N47.1', '54163, N47.2', '54161, N47.1', '2023-09-06 00:56:42', '2023-09-06 00:56:42', 'ans_a'),
(3261, NULL, 90, 1, '<p><strong>At 12 weeks of pregnancy, Lilly was already much bigger than with either of her other two pregnancies. When she started bleeding, she was directed to see her doctor. An ultrasound revealed a &ldquo;snowflake&rdquo; pattern with a diagnosis given for molar pregnancy. The next day she had an opening of the uterus for abortion and tubal ligation was also performed at the same time. What are the CPT and ICD-10-CM codes?</strong></p>', '59100, O01.0', '59100, 58611, O01.9', '59870, O02.0', '58120, O02.0', '2023-09-06 00:57:24', '2023-09-06 00:57:24', 'ans_b'),
(3262, NULL, 90, 1, '<p><strong>Which CPT codes describe the destruction using electrosurgery to the right leg on a patient diagnosed with 16 premalignant lesions and removal of 20 fibrocutaneous tags during the same session?</strong></p>', '17004, 11200, 11201', '17004x16, 11200x2', '17111, 11200, 11201', '17000, 17003 X 9, 11200', '2023-09-06 00:59:19', '2023-09-06 00:59:19', 'ans_a'),
(3263, NULL, 90, 1, '<p><strong>A 58-year-old lady is having worsening vulvar pressure and a mass that is protruding from her vagina. She had distal defects in the posterior compartment. The provider performs a colporrhaphy. The repair of the posterior vaginal wall was performed. The repairs of the vaginal tissues over the weakened spots to support the area return the bladder and rectum to their correct positions via vaginal approach. What CPT coding is reported?</strong></p>', '57240, 77550', '57210', '57250', '57260', '2023-09-06 04:29:11', '2023-09-06 04:29:11', 'ans_c'),
(3265, NULL, 90, 1, '<p><strong>What code(s) would be used to code an epidermal skin graft, both thighs to the abdomen, measuring 30 &times; 25 cm?</strong></p>', '15110 × 8', '15110, 15111-51x7', '15110, 15111 × 7', '15111, 15111-59x7', '2023-09-07 00:57:22', '2023-09-07 00:57:22', 'ans_c'),
(3266, NULL, 90, 1, '<p><strong>What code(s) would be used to code a dermal skin graft, both thighs to the abdomen, measuring 12 &times; 10 cm?</strong></p>', '15130 × 2', '15130, 15131-51', '15130, 15131-59', '15130, 15131', '2023-09-07 00:57:54', '2023-09-07 00:57:54', 'ans_d'),
(3269, NULL, 90, 1, '<p><strong>An 82 year old male had a percutaneous gastrostomy tube placed due to malnutrition. The gastrostomy catheter has become clogged. The physician removes the gastrostomy catheter and replaces it via a percutaneous approach and gastrostomy tract revision was done. How is this procedure reported?</strong></p>', '43752', '43761', '43762', '43763', '2023-09-07 00:59:47', '2023-09-07 00:59:47', 'ans_d'),
(3275, NULL, 90, 1, '<p><strong>A patient is seen at the doctor&#39;s office for nausea, vomiting, and abdominal pain. Labs come back indicating an increased WBC count. The physician determines the patient has an acute ruptured appendicitis with peritonitis. The physician schedules an OR and takes the patient to the operating room. An abdominal incision is made, and an appendectomy is performed. What CPT and ICD-10-CM codes should be reported?</strong></p>', '44950, K36', '44960, K37', '44960, K35.30', '44950, K35.80', '2023-09-07 01:03:46', '2023-09-07 01:03:46', 'ans_c'),
(3276, NULL, 90, 1, '<p><strong>What code would be used to code the destruction of a malignant lesion on the right arm measuring 1.6 cm using cryosurgery?</strong></p>', '17272', '17262', '11420', '11622', '2023-09-07 01:04:37', '2023-09-20 04:24:50', 'ans_b'),
(3278, NULL, 90, 1, '<p><strong>A patient pregnant with twins goes into labor at 36 weeks gestation. The first baby is delivered vaginally. The second baby&rsquo;s cord prolapse, and an emergency cesarean section was performed under general endotracheal anesthesia, The physician who delivered the twins did not perform the antepartum care and will provide the postpartum care. Both babies are well and healthy. What CPT coding is reported for the twin delivery?</strong></p>', '59515', '59510, 59409-51', '59514, 59409-51', '59515, 59409-51', '2023-09-07 01:06:22', '2023-09-07 01:06:22', 'ans_d'),
(3279, NULL, 90, 1, '<p><strong>A 55-year-old female has a non-palpable right breast mass. An ultrasound exam 2 days back showed that the mass is not a simple cyst. Fine needle aspiration biopsy of 2 lesions is performed. What procedure code(s) will be reported?</strong></p>', '10021, 10004, 76942', '10005, 10006', '10021, 10004', '10005x2, 76942', '2023-09-08 03:51:13', '2023-09-27 03:50:40', 'ans_c'),
(3280, NULL, 90, 1, '<p><strong>Operative Report:&nbsp;</strong></p>\r\n\r\n<p><strong>Preoperative Diagnosis: BPH&nbsp;</strong></p>\r\n\r\n<p><strong>Postoperative Diagnosis: BPH&nbsp;</strong></p>\r\n\r\n<p><strong>Procedure: Transurethral Aquablation of Prostate.&nbsp;</strong></p>\r\n\r\n<p><strong>Justification for Procedure: This 60-year-old gentleman had prior laser prostatectomy a year ago and now has scarring resulting in contracture of the bladder neck.&nbsp;</strong></p>\r\n\r\n<p><strong>Description of Procedure: After thorough Betadine prepping and draping and suitable general anesthesia, the cystourethroscope was inserted to view the bladder neck and urethra. Urethra was normal. A resectoscope was inserted to resect the prostate tissue using a high pressure waterjet. There was minimal bleeding. The scope was removed. A catheter was placed for removal of urine during the postoperative period. The patient tolerated the procedure well and was transferred to the recovery room in good condition.&nbsp;</strong></p>\r\n\r\n<p><strong>What procedure code is reported?</strong></p>', '0421T', '52630', '52899', '52647', '2023-09-08 03:51:41', '2023-09-08 03:51:41', 'ans_a'),
(3281, NULL, 90, 1, '<p><strong>A 3 year-old child with congenital hydrocephalus is seeing her neurologist for replacement of her programmable CSF shunt system. The neurologist removed and placed another new shunt system and adjusted the pressure setting to an acceptable cerebrospinal fluid flow level. What is the correct procedure code for this surgery?</strong></p>', '62252', '62225', '62258', '62230', '2023-09-08 03:52:12', '2023-09-08 03:52:12', 'ans_c'),
(3282, NULL, 90, 1, '<p><strong>The patient presents to the ED with multiple lacerations which require repair. The patient has a 2.4 cm laceration on the right hand, 2 cm laceration on the left hand, a 3.5 cm on the right cheek and a 2.8 cm laceration on the forehead. The deep lacerations on the arms require repair with layer closures. The lacerations on the patient&#39;s face require extensive debridement of glass particles and a single layer closure.</strong></p>', '12054', '12052, 12051-59', '12053, 12042-59', '12052, 12051-59, 12043-59, 12041-59', '2023-09-08 03:52:47', '2023-09-18 01:40:32', 'ans_c'),
(3283, NULL, 90, 1, '<p><strong>Patient was diagnosed with a choroid lesion of the eyes (OU). The ophthalmologist destroys the lesion via photodynamic therapy OU in the same session. What procedure code is reported?</strong></p>', '67221, 67225', '67220-50', '67221-OU', '67225-50', '2023-09-08 03:53:42', '2023-09-08 03:53:42', 'ans_a'),
(3284, NULL, 90, 1, '<p><strong>A patient has excess hormone production due to tumors in each adrenal gland, The endocrinologist makes a 5 mm incision infraumbilical and 5 mm in the left lower quadrant of the abdomen, insert trocars and scope and removes both adrenal glands. How is this reported?</strong></p>', '60540-50', '60650', '60650-50', '60540', '2023-09-08 03:54:11', '2023-09-08 03:54:11', 'ans_c'),
(3285, NULL, 90, 1, '<p><strong>A CT scan is performed on a 31-year-old revealing an intracerebral hematoma located in the left frontal lobe. A craniotomy is performed, and the hematoma is evacuated by a suction device.A cranial bone graft was placed subcutaneously. The area is irrigated making sure there is no longer a hemorrhage. What CPT code is</strong></p>', '61313, 61316', '61314, 61316', '61315, 61316', '61305, 61316', '2023-09-08 03:54:40', '2023-09-08 03:54:40', 'ans_a'),
(3286, NULL, 90, 1, '<p><strong>A Needle is passed into an infratentorial tumor. Aspiration of the initial samples reveals a soft necrotic tumor. This is sent for pathologic examination, which comes back as malignant. What CPT and ICD-10-CM codes are reported?</strong></p>', '61750, D33.0', '61751, D33.7', '61751, D33.2', '61750, D33.1', '2023-09-08 03:55:11', '2023-09-08 03:55:11', 'ans_d'),
(3287, NULL, 90, 1, '<p><strong>What CPT code is reported when the surgeon makes an incision in the infra xiphoid area to the esophagus, then an incision is made through the musculature of the esophagus, and a repair is performed using a fundic flap?</strong></p>', '43330', '43279', '43331', '32665', '2023-09-11 00:16:05', '2023-09-11 00:16:05', 'ans_a'),
(3289, NULL, 90, 1, '<p><strong>What code(s) would be used to code a dermal skin graft, both thighs to the abdomen, measuring 12 &times; 10 cm?</strong></p>', '15130 × 2', '15130, 15131-51', '15130, 15131-59', '15130, 15131', '2023-09-11 00:17:36', '2023-09-11 00:17:36', 'ans_d'),
(3290, NULL, 90, 1, '<p><strong>What code would be used to report a massive debridement of an open abdominal wound, including subcutaneous tissue?</strong></p>', '11000', '11010', '11042', '11043', '2023-09-11 00:18:14', '2023-09-11 00:18:14', 'ans_c'),
(3293, NULL, 90, 1, '<p><strong>A 21 year old patient is seen in the gastroenterologist&rsquo;s clinic for a diagnostic colonoscopy. While performing the service, the physician notes suspicious looking polyps and removes three of these using a snare technique to send to pathology for further testing. What is procedure coding?</strong></p>', '45385', '45384', '45378, 45364-51', '45378, 45380-51', '2023-09-11 00:20:33', '2023-09-11 00:20:33', 'ans_a'),
(3294, NULL, 90, 1, '<p><strong>A 35 year old patient is seen in the gastroenterologist&rsquo;s clinic for a screening colonoscopy. While performing the service, the physician notes suspicious looking polyps and removes three of these using a hot biopsy forceps to send to pathology for further testing. What should be correct coding?</strong></p>', '45384-Z12.11, K63.5', '45384-K63.5', '45378, 45384-51-Z12.11, K63.5', '45378-Z12.11, K63.5', '2023-09-11 00:21:37', '2023-09-11 00:21:37', 'ans_a'),
(3296, NULL, 90, 1, '<p><strong>A 55-year-old male is taken back to the operative room for a takedown of his colostomy and reversal of his small intestines after six months of bowel rest for his colitis. The patient is placed supine on the operating table and general endotracheal anesthesia is administered. His abdomen is prepped and draped in the usual sterile manner. An incision is made near the site of the colostomy stoma and dissected sharply from the abdominal wall. After the stoma is mobilized and taken down from the abdominal wall, it is resected and ileocolic anastomosis is performed connecting both bowel ends with staples. The abdominal incisions were closed in the usual fashion. Which CPT&nbsp; code is reported?</strong></p>', '44227', '44625', '44626', '44620', '2023-09-11 00:48:30', '2023-09-11 00:48:30', 'ans_b'),
(3300, NULL, 90, 1, '<p><strong>What code would be used to code the destruction of 18&nbsp;actinic keratoses on the right upper arm&nbsp;using cryosurgery?</strong></p>', '17000, 17003x17', '17000x18', '17111', '17004', '2023-09-11 00:51:24', '2023-09-27 05:34:48', 'ans_d'),
(3301, NULL, 90, 1, '<p><strong>A Needle is passed into an intracranial tumor with 2 burr holes made for the procedure. With CT guidance Excision of the two samples reveals a soft necrotic tumor. This is sent for pathologic examination, which comes back as malignant. What CPT code(s) are reported?</strong></p>', '61751, 70450', '61751x2', '61750, 70450', '61751x2', '2023-09-13 04:26:33', '2023-09-13 04:26:33', 'ans_a'),
(3302, NULL, 90, 1, '<p><strong>A.38-year-old female had a closed fracture of the L1 - L4 vertebrae 18 years ago and now has displacement of the L1-L3 intervertebral disc. The surgeon will decompress the spinal cord involving displaced segments of the lumbar spine. The surgeon performs the surgery by using a transpedicular approach, going through the pedicle on the side of the disc bulge to reach the herniated disc. The lamina and facet joint are removed along with disc fragments. What is the correct procedure code to report?</strong></p>', '63056, 63057x2', '63050', '63056, 63057', '63042, 63044x2', '2023-09-13 04:27:06', '2023-09-13 04:27:06', 'ans_c'),
(3303, NULL, 90, 1, '<p><strong>A 41-year-old suffering from lumbar spondylosis presents to an outpatient facility to receive facet joint injections. The injections are administered bilaterally in L2-L4 levels under fluoroscopic guidance. What are the correct CPT codes for this patient&#39;s encounter?</strong></p>', '64493-50, 64494x6', '64493-50, 64494x4', '64493-50, 64494x6, 77003', '64493-50, 64494x4, 77003', '2023-09-13 04:27:48', '2023-09-13 04:27:48', 'ans_b'),
(3304, NULL, 90, 1, '<p><strong>A 22 year old female with hypo-trophic breasts is experiencing back pain. She was seen with her parents requesting surgical treatment for this problem. A few weeks later she received surgery to increase breast size with the silicon pads to overcome this problem. What are the correct CPT codes for this scenario?</strong></p>', '19318', '19301', '19325', '19316', '2023-09-13 04:28:16', '2023-09-13 04:28:16', 'ans_c'),
(3305, NULL, 90, 1, '<p><strong>A 46-year-old suffering from lumbar spondylosis presents to an outpatient facility for nerve demolition. The chemicals for neurolysis are administered to facet joints bilaterally in L1-L5 levels under fluoroscopic guidance. What are the correct CPT codes for this patient&#39;s encounter?</strong></p>', '64635-50, 64636x8', '64635-50, 64635x6', '64630-50x4, 77003', '64635-50x4, 77003', '2023-09-13 04:28:52', '2023-09-22 00:29:06', 'ans_a'),
(3306, NULL, 90, 1, '<p><strong>A patient is diagnosed with a cyst in the spinal cord at the cervicothoracic region. The physician aspirates fluid percutaneously via needle from the cyst using fluoroscopic guidance. This fluid sample was sent for further investigations.</strong></p>', '62267, 77003, G96.11', '62268, 77003, G96.11', '62268, 77003, G96.191', '62267, 77003, G96.191', '2023-09-14 02:39:02', '2023-09-28 04:26:55', 'ans_c'),
(3307, NULL, 90, 1, '<p><strong>Preoperative Diagnosis: Chronic otitis media with effusion AU.</strong></p>\r\n\r\n<p><strong>Postoperative Diagnosis: Chronic otitis media with effusion AU.</strong></p>\r\n\r\n<p><strong>PROCEDURE: Tympanostomy with ventilation tube placement, 7 mm vent tubes</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Details of the procedure: A 2 year-old female was taken to the OR and prepped and draped in a sterile manner. Local anesthesia was used by the surgeon. An incision was then manufactured in the anterior inferior quadrant of the right tympanic membrane utilizing the tympanostomy knife. The patient had significant debris within the middle ear. It was evacuated with #5 Frazier tip suction, A 7 mm vent tube was then placed within the tympanic membrane using an automated tube delivery system with iontophoresis without difficulty or complications. Cortispor in drops along with the sterile cotton ball were applied. The same procedure was performed on the left tympanic membrane without difficulty or complications. The patient was sent to the recovery room in satisfactory condition. What CPT and ICD-10-CM codes are reported?</strong></p>', '69433-50, H65.493', '69436-50, H65.493', '69436, H65.491, H65.492', '0583T-50, H65.493', '2023-09-14 02:39:39', '2023-09-14 02:39:39', 'ans_d'),
(3308, NULL, 90, 1, '<p><strong>A 32-year-old male with basal cell cancer, a morphea type of the Scalp that had been left untreated, undergoes a wide excision 5 x 4 sq cm at the vertex. A V-Y plasty flap is done to allow the wound edges to come together without tension and to preserve the hairline. The scalp was undetermined and wound edges were well approximated. The deeper layer was closed with 2-0 monocryl and 2-0 prolene was used for the skin.</strong></p>', '11622, 14020-51, 12032-51', '14020', '14021', '11622', '2023-09-14 02:40:17', '2023-09-18 23:54:08', 'ans_c'),
(3309, NULL, 90, 1, '<p><strong>A patient has a history of right complete mastectomy due to cancer, 10 years ago. A screening mammogram is performed on the left breast to analyze lesions using computer-aided detection. What CPT coding is reported for this service?</strong></p>', '77053.LT, 77063', '77066-52', '77067-52', '77065-LT', '2023-09-14 02:41:15', '2023-09-14 02:41:15', 'ans_c');
INSERT INTO `questions` (`id`, `course_id`, `course_topic_id`, `quizType`, `question`, `ans_a`, `ans_b`, `ans_c`, `ans_d`, `created_at`, `updated_at`, `correct_ans`) VALUES
(3310, NULL, 90, 1, '<p><strong>A surgeon performs a unilateral radical mastectomy including pectoral muscles with IM and axillary lymph nodes on a breast cancer patient. At the same time, she places a permanent tissue expander beneath the skin and chest muscle. Through a small injection port under the skin, saline is injected into the expander over a period of two months to gradually fill it to the desired size while stretching the overlying tissue.</strong></p>', '19307, 19357-51', '19301, 19340-51', '19306, 19364-51', '19306, 19357-51', '2023-09-14 02:41:58', '2023-09-14 02:41:58', 'ans_d'),
(3311, NULL, 90, 1, '<p><strong>An ultrasound of a transplanted kidney is performed with a duplex Doppler. How is this coded?</strong></p>', '76700', '76775', '76776', '76705', '2023-09-14 02:42:34', '2023-09-14 02:42:34', 'ans_c'),
(3312, NULL, 92, 1, '<p><strong>The cardiologist believes Mrs. Jolly sat at risk for heart failure. A cardiac MRI without contrast followed by contrast material and an adenosine injection for stress imaging is ordered. The MRI results will determine if there is any narrowing or blockage in the heart. What CPT code Is reported?</strong></p>', '75561', '75557', '75563', '75559', '2023-09-22 00:52:41', '2023-09-22 00:52:41', 'ans_c'),
(3313, NULL, 92, 1, '<p><strong>A 30-year-old male has been complaining of chronic headaches. A brain imaging positron emission tomography scan to evaluate perfusion is performed. The scan shows an enhancing abnormality in the region of the frontal lobe. A diagnostic of malignant neoplasm of the frontal lobe of the brain is documented. What CPT and ICD-10-CM codes are reported?</strong></p>', '70450, C71.1, R51.9', '78610, C71.1, R51.9', '78608, C71.1', '78609, C71.1', '2023-09-22 00:53:16', '2023-09-22 00:53:16', 'ans_d'),
(3314, NULL, 92, 1, '<p><strong>A patient has disc herniation at cervical C5-C6 and thoracic T2-T3. The radiologist performs a myelography of the cervical region only to detect further cord impingements. What CPT coding is reported?</strong></p>', '72240-26', '72270-26, 72270-26', '72240-26, 72255-26', '72270-26', '2023-09-22 00:53:48', '2023-09-22 00:53:48', 'ans_a'),
(3315, NULL, 92, 1, '<p><strong>A 50-year-old male on examination has a couple thyroid nodules without clinical symptoms of hyperthyroidism. Blood thyroid function tests indicate euthyroidism. The physician images the thyroid gland by intravenously administering radioiodine and measures the absorbed amount. Multiple images are acquired from different angles and document the patient&#39;s position. The vascular flow around the nodules was looked at to determine benign from malignant flow characteristics. What radiology code is reported?</strong></p>', '78013', '78014', '78012', '78015', '2023-09-22 00:54:19', '2023-09-22 00:54:19', 'ans_b'),
(3316, NULL, 92, 1, '<p><strong>A patient in her 2nd trimester with a triplet pregnancy Is seen in the obstetrician&rsquo;s office for an obstetrical ultrasound that is assessing the fetuses and mother transabdominally. What CPT coding reports the ultrasound?</strong></p>', '76805, 76810 x2', '76815 x3', '76815', '76811, 76812 x2', '2023-09-22 00:55:07', '2023-09-22 00:55:07', 'ans_a'),
(3317, NULL, 92, 1, '<p><strong>Patient who may have blockage in the right leg is undergoing an angiogram in which the left femoral artery is cannulated with a catheter and advanced into the aorta and then into the right axillary artery. Contrast medium is injected. What CPT codes are reported for the professional component?</strong></p>', '36216, 75710-26', '36246, 75710-26', '36216, 75716-26', '36286, 75716-26', '2023-09-22 00:55:43', '2023-09-22 00:55:43', 'ans_a'),
(3318, NULL, 92, 1, '<p><strong>An independent radiologist who is not employed by the facility performs the injection and radiology supervision and interpretation for Right Elbow Arthrography. What is the correct coding?</strong></p>', '24220-26, RT, 73085-26, RT', '20606, 73115-26', '24220-RT, 73085-26-RT', '20550, 73115-26-TC', '2023-09-22 00:56:18', '2023-10-04 01:04:15', 'ans_c'),
(3319, NULL, 92, 1, '<p><strong>A 21 year-old male seen in the emergency department sustained an injury several hours ago to his right ankle as he fell down on ground while playing soccer in the garden. Ankle X-rays were taken in AP, lateral and transverse positions to rule out a fracture. The interpretation of the X-rays revealed there was no fracture. He is diagnosed with a sprained ankle. What CPT and diagnosis codes are reported?</strong></p>', '73600-26-RT, S93.401A, W18.39, Y92.830, Y93.66, Y99.8', '73610-26-RT, S93.401A, W18.39, Y92.830, Y93.66, Y99.8', '73600-26-50, S99.911A, W18.39, Y92.830, Y93.66, Y99.8', '73610-26-RT, S82.891A, W18.39, Y92.830, Y93.66, Y99.8', '2023-09-22 00:56:55', '2023-09-22 00:56:55', 'ans_b'),
(3320, NULL, 92, 1, '<p><strong>An endocrinologist orders an ACTH stimulation testing for 21 hydroxylase deficiency. The lab tests for cortisol and 17 hydroxyprogesterone deficiency are performed two times each. How is this reported?</strong></p>', '80406', '80400', '82533 x 2, 84143 x2', '80402', '2023-09-22 00:57:27', '2023-09-22 00:57:27', 'ans_d'),
(3321, NULL, 92, 1, '<p><strong>A lab performs creatine kinase total to aid in diagnosis of acute myocardial infarction. How is this reported?</strong></p>', '82565', '82552', '82550', '82550, 82552', '2023-09-22 00:57:56', '2023-09-22 00:57:56', 'ans_c'),
(3322, NULL, 92, 1, '<p><strong>Provider orders coagulation time activated test to diagnose coagulation factor deficiency associated with a patient with liver disease. The test is positive for clotting formation. What lab code is reported?</strong></p>', '85670', '85210', '85347', '85610', '2023-09-22 00:58:26', '2023-09-22 00:58:26', 'ans_c'),
(3323, NULL, 92, 1, '<p><strong>A female patient presents with complaints of fatigue, headache, and muscle weakness. The provider suspects Zika virus. A serum sample from the patient is obtained and tested for Zika. The test is positive. What lab test is reported?</strong></p>', '86788', '86789', '86794', '86790', '2023-09-22 00:58:57', '2023-09-22 00:58:57', 'ans_c'),
(3324, NULL, 92, 1, '<p>A 55-year-old female has a biopsy for suspected cancer of the right bicep muscle. The tumor specimen&nbsp;was sent to the pathologist for evaluation and determination. Manual staining of the specimen identified as Hypodiploid&nbsp;based on morphometric analysis. How is this pathology test reported?</p>', '88360', '88358 x2', '88358', '88360 x2', '2023-09-22 00:59:29', '2023-10-03 01:06:02', 'ans_c'),
(3325, NULL, 92, 1, '<p><strong>A 45-year-old female has a biopsy for suspected breast cancer. Two specimens were sent to the pathologist for evaluation and determination. Manual staining of each specimen identified each tissue as ER/PR positive and Her-2/neu was negative based on manual morphometric analysis. Based on the patient&#39;s history and pathology results, she is diagnosed with invasive ductal carcinoma. How is this pathology test reported?</strong></p>', '88360', '88358 x2', '88358', '88360 x2', '2023-09-22 01:00:00', '2023-10-04 01:01:21', 'ans_d'),
(3326, NULL, 92, 1, '<p><strong>A 35 years old female patient presents to the office with a pain sensation while urinating and slight nausea. The physician performs an automated qualitative urinalysis, which reads negative for having UTI. What is the appropriate coding for this encounter?</strong></p>', '81003, N39.0, R30.0, R11.0', '81005, R30.9, R11.0', '81005, R30.0, R11.0', '81002, R30.0, R11.0', '2023-09-22 01:00:48', '2023-09-22 01:00:48', 'ans_b'),
(3327, NULL, 92, 1, '<p><strong>A 38-year-old female patient presents to the office with dysuria and slight nausea. The physician thinks she has an UTI. The physician performs an automated urinalysis without microscopy, which reads negative for having UTI. What is the appropriate coding for this encounter?</strong></p>', '81001, N39.0, R30.0, R11.0', '81001, R30.0, R11.0', '81003, R30.0, R11.0', '81002, N39.0, R30.0, R11.0', '2023-09-22 01:01:53', '2023-09-22 01:01:53', 'ans_c'),
(3328, NULL, 92, 1, '<p><strong>A 55-year-old male has a history of myeloid leukemia and is no longer on treatment. He is in the outpatient facility for a bone marrow aspiration. A 15-gauge needle is used to perform the aspiration on the right posterior iliac crest. The following specimens were reviewed for pathology: (1) Peripheral smear bone marrow aspirate and (2) Group lll stain. What CPT and ICD-10-CM codes</strong></p>', '85097, 88313, Z85.6', '85060, 88313, C92.90', '85097, 88312, C92.90', '85097, 88319, C92.20', '2023-09-22 01:08:54', '2023-09-22 01:08:54', 'ans_d'),
(3329, NULL, 92, 1, '<p><strong>A 55-year-old male has a history of myeloid leukemia and is no longer on treatment. He is in the outpatient facility for a bone marrow aspiration. A 15-gauge needle is used to perform the aspiration on the right posterior iliac crest. The following specimens were reviewed for pathology: (1) Peripheral smear bone marrow aspirate and (2) Group lll stain. What CPT and ICD-10-CM codes</strong></p>', '85097, 88313, Z85.6', '85060, 88313, C92.90', '85097, 88312, C92.90', '85097, 88319, C92.20', '2023-09-22 01:09:33', '2023-09-22 01:09:33', 'ans_d'),
(3330, NULL, 92, 1, '<p><strong>A 65-year-old male has a history of myeloid leukemia and is currently on surveillance. He is in the outpatient facility for a bone marrow aspiration. A 15-guage needle is used to perform the aspiration on the right posterior iliac crest. The following specimens were reviewed for pathology: (1) Peripheral smear bone marrow aspirate and (2) iron and trichrome stain. What CPT and ICD-10-CM codes</strong></p>', '85060, 88313 X2, Z85.6', '85097, 88313 X2, C92.90', '85097, 88312, C92.90', '85060, 88312, Z85.6', '2023-09-22 01:10:19', '2023-09-22 01:10:19', 'ans_b'),
(3331, NULL, 92, 1, '<p><strong>A 25-year-old female with a family history of breast cancer is tested for BRCA2 on the same day, The test includes full sequence analysis to determine her risk of developing cancer. Testing revealed she is BRCA1 positive. How is this testing reported?</strong></p>', '81162, 81164', '81165, 81166, 81216, 81167', '81165, 81216', '81163', '2023-09-28 23:39:21', '2023-09-28 23:39:21', 'ans_d'),
(3332, NULL, 92, 1, '<p><strong>A patient was diagnosed with shoulder and upper back pain. The pain management physician gave 2 trigger point injections on each of the trapezius muscles and 2 injections on each of the deltoid muscles. What CPT coding is reported?</strong></p>', '20552x2', '20553', '20552', '20550', '2023-09-28 23:40:10', '2023-10-04 01:02:49', 'ans_b'),
(3333, NULL, 92, 1, '<p><strong>A patient with blood cancer is tested for cytogenetic analysis. A peripheral blood specimen is obtained by the patient to grow a tissue culture for WBC. What CPT code is reported?</strong></p>', '88237', '88230', '88235', '88239', '2023-09-28 23:40:50', '2023-09-28 23:40:50', 'ans_a'),
(3334, NULL, 92, 1, '<p><strong>What is another term for a document, provided by a healthcare provider to a Medicare patient, which releases the provider from liability in cases where Medicare may not reimburse for a particular service or test?</strong></p>', 'Advanced Business Notice', 'Service Waive Notice', 'Automated Benefit Notice', 'Advance Beneficiary Notice', '2023-09-28 23:41:35', '2023-09-28 23:41:35', 'ans_d'),
(3335, NULL, 92, 1, '<p><strong>Which is included in the post operative global surgical package?</strong></p>', 'Preoperative visit on the day of the procedure', 'Postoperative care after completion of global period', 'Anesthesia services performed by anesthesiologist', 'A visit unrelated to the diagnosis for which the surgical procedure was performed', '2023-09-28 23:43:18', '2023-09-28 23:43:18', 'ans_a'),
(3336, NULL, 92, 1, '<p><strong>A patient presents to the emergency room with severe leg pain following a skateboard accident. Radiological findings reveal retention of embedded gravel in the torn muscle. The ER physician states the patient has an open fracture of the tibia. The physician extends the open wound under anesthesia to remove the muscle and fascia until clean tissue remains.</strong></p>\r\n\r\n<p><strong>What CPT would report the procedure?</strong></p>', '11011', '11012', '11044', '11043', '2023-09-28 23:43:57', '2023-09-28 23:43:57', 'ans_a'),
(3337, NULL, 92, 1, '<p><strong>Medicare has classified certain surgical CPT codes as major and minor surgeries according to their global period. What is not included in the global package of major surgeries?</strong></p>', 'Routine postoperative care', 'All inpatient and outpatient hospital care directly related to the surgery', 'Any new injury after the discharge', 'Pre-operative services that are part of the surgery', '2023-09-28 23:44:42', '2023-09-28 23:44:42', 'ans_c'),
(3338, NULL, 92, 1, '<p><strong>A _______is assigned to many CPT codes to determine the medical necessity of the procedure.</strong></p>', 'Local coverage determination (LCD)', 'Relative value unit (RVU)', 'National Correct Coding initiative (NCCI)', 'Medically Unlikely Edit (MUE)', '2023-09-28 23:45:44', '2023-09-28 23:45:44', 'ans_a'),
(3339, NULL, 92, 1, '<p><strong>In US RCM- &ldquo;LCD&rdquo; stands for:</strong></p>', 'Local Common determination', 'Liquid Crystal Display', 'Local Coverage Determination', 'Local Covered Diagnosis', '2023-09-28 23:46:28', '2023-09-28 23:46:28', 'ans_c'),
(3340, NULL, 92, 1, '<p><strong>About the lobes of Lungs, which statement is true:</strong></p>', 'Left Lung has 3 lobes and right lung has 2 lobes', 'Left lung has 2 lobes and right lung has 3 lobes', 'Both lung have 2 lobes each', 'There are total 6 lobes in both the lungs', '2023-09-28 23:47:18', '2023-09-28 23:47:18', 'ans_b'),
(3341, NULL, 92, 1, '<p><strong>How many vertebral bones we have in back:</strong></p>', '22', '33', '12', '46', '2023-09-28 23:47:48', '2023-09-28 23:47:48', 'ans_b'),
(3342, NULL, 92, 1, '<p><strong>A _______is assigned to all CPT codes to determine the maximum billable units on a DOS for a particular CPT code.</strong></p>', 'Local coverage determination (LCD)', 'Relative value unit (RVU)', 'National Correct Coding initiative (NCCI)', 'Medically Unlikely Edit (MUE)', '2023-09-28 23:49:06', '2023-09-28 23:49:06', 'ans_d'),
(3343, NULL, 92, 1, '<p><strong>When was HIPAA implemented:</strong></p>', '1986', '1998', '2003', '1996', '2023-09-28 23:49:52', '2023-09-28 23:49:52', 'ans_d'),
(3344, NULL, 92, 1, '<p><strong>What does HIPAA stand for?</strong></p>', 'Health Information Privacy and Protection Act', 'Health Insurance Portability and Accountability Act', 'Hospital Information Processing and Assurance Act', 'Healthcare Integrity and Privacy Act', '2023-09-28 23:50:38', '2023-09-28 23:50:38', 'ans_b'),
(3345, NULL, 92, 1, '<p><strong>Which federal agency is responsible for enforcing HIPAA regulations related to healthcare privacy and security?</strong></p>', 'Centers for Disease Control and Prevention (CDC)', 'Food and Drug Administration (FDA)', 'Department of Health and Human Services (HHS)', 'Federal Trade Commission (FTC)', '2023-09-29 00:08:40', '2023-09-29 00:08:40', 'ans_c'),
(3346, NULL, 92, 1, '<p><strong>Which of the following is NOT considered protected health information (PHI) under HIPAA?</strong></p>', 'Patient\'s name and address', 'Medical diagnosis and treatment plan', 'Social Security Number (SSN)', 'Healthcare provider\'s contact information', '2023-09-29 00:09:18', '2023-09-29 00:09:18', 'ans_d'),
(3347, NULL, 92, 1, '<p><strong>What does the acronym &quot;EHR&quot; stand for in the context of healthcare compliance?</strong></p>', 'Electronic Health Record', 'Efficient Healthcare Reporting', 'Essential Health Regulations', 'Emergency Health Response', '2023-09-29 00:09:53', '2023-09-29 00:09:53', 'ans_a'),
(3348, NULL, 92, 1, '<p><strong>Which federal agency administers the Medicaid program in the United States?</strong></p>', 'Occupational Safety and Health Administration (OSHA)', 'Food and Drug Administration (FDA)', 'Centers for Medicare & Medicaid Services (CMS)', 'Department of Health and Human Services (HHS)', '2023-09-29 00:11:02', '2023-09-29 00:11:02', 'ans_c'),
(3349, NULL, 92, 1, '<p><strong>What does the term &quot;Compliance Officer&quot; typically refer to in healthcare organizations?</strong></p>', 'A healthcare provider responsible for diagnosing patients', 'A legal expert who represents healthcare organizations in court', 'An individual responsible for ensuring that the organization complies with all applicable laws and regulations ', 'A nurse responsible for administering medications to patients', '2023-09-29 00:11:46', '2023-09-29 00:11:46', 'ans_c'),
(3350, NULL, 92, 1, '<p><strong>Which of the following is NOT a key component of an effective healthcare compliance program?</strong></p>', 'Employee training and education', 'Routine patient billing audits', 'Whistleblower protection', 'Marketing and advertising strategies', '2023-09-29 00:12:37', '2023-09-29 00:12:37', 'ans_d'),
(3351, NULL, 92, 1, '<p><strong>What is the main goal of the HIPAA Security Rule?</strong></p>', 'To establish pricing controls for medical services', 'To regulate the use of paper medical records', 'To protect the confidentiality, integrity, and availability of electronic protected health information (ePHI)', 'To enforce billing practices in healthcare', '2023-09-29 00:13:15', '2023-09-29 00:13:15', 'ans_c'),
(3352, NULL, 92, 1, '<p><strong>Which of the following is NOT considered a common healthcare compliance issue?</strong></p>', 'Patient confidentiality breaches', 'Fraudulent billing practices', 'Proper disposal of medical waste', 'Physician self-referral violations', '2023-09-29 00:13:53', '2023-09-29 00:13:53', 'ans_c'),
(3353, NULL, 92, 1, '<p><strong>What is the primary focus of the Anti-Kickback Statute in healthcare?</strong></p>', 'To regulate the use of electronic health records (EHRs)', 'To prohibit healthcare providers from accepting bribes or kickbacks for referrals', 'To mandate charity care provided by healthcare organizations', 'To encourage healthcare providers to offer discounts to uninsured patients', '2023-09-29 00:14:32', '2023-09-29 00:14:32', 'ans_b'),
(3354, NULL, 92, 1, '<p><strong>Which federal agency enforces compliance with the False Claims Act in healthcare?</strong></p>', 'Department of Homeland Security (DHS)', 'Federal Bureau of Investigation (FBI)', 'Department of Justice (DOJ)', 'Internal Revenue Service (IRS)', '2023-09-29 00:15:21', '2023-09-29 00:15:21', 'ans_c'),
(3355, NULL, 92, 1, '<p><strong>What is healthcare &quot;fraud&quot;?</strong></p>', 'A common billing practice in healthcare', 'An unintentional error in medical coding', 'An intentional deception or misrepresentation to obtain unauthorized benefits or payments', 'A standard medical treatment procedure', '2023-09-29 00:16:09', '2023-09-29 00:16:09', 'ans_c'),
(3356, NULL, 92, 1, '<p><strong>Which federal agency is primarily responsible for investigating and prosecuting healthcare fraud and abuse cases in the United States?</strong></p>', 'Department of Health and Human Services (HHS)', 'Environmental Protection Agency (EPA)', 'Federal Trade Commission (FTC)', 'Department of Homeland Security (DHS)', '2023-09-29 00:50:34', '2023-09-29 00:50:34', 'ans_a'),
(3357, NULL, 92, 1, '<p><strong>What does &quot;kickback&quot; mean in the context of healthcare compliance?</strong></p>', 'A type of athletic footwear worn by healthcare workers', 'A financial incentive provided to patients for using a specific healthcare provider', 'A form of illegal remuneration or payment made to induce patient referrals or services', 'A specialized medical procedure', '2023-09-29 00:51:10', '2023-09-29 00:51:10', 'ans_c'),
(3358, NULL, 92, 1, '<p><strong>What is a common example of healthcare &quot;waste&quot;?</strong></p>', 'Legitimate medical treatments and services', 'Patient insurance claims that are coded accurately', 'Properly documented patient records', 'Unnecessary medical tests or procedures that do not improve patient care', '2023-09-29 00:51:46', '2023-09-29 00:51:46', 'ans_d'),
(3359, NULL, 92, 1, '<p><strong>What is healthcare &quot;abuse&quot;?</strong></p>', 'A standard practice in healthcare billing', 'A type of insurance coverage', 'An intentional, deceptive act to obtain unauthorized benefits', 'Substandard or excessive care that results in unnecessary costs', '2023-09-29 00:52:43', '2023-09-29 00:52:43', 'ans_d'),
(3360, NULL, 92, 1, '<p><strong>Which federal agency is responsible for investigating and addressing healthcare abuse in long-term care facilities such as nursing homes?</strong></p>', 'Department of Homeland Security (DHS)', 'Centers for Medicare & Medicaid Services (CMS)', 'Federal Bureau of Investigation (FBI)', 'Department of Justice (DOJ)', '2023-09-29 00:53:18', '2023-09-29 00:53:18', 'ans_b'),
(3361, NULL, 92, 1, '<p><strong>What is &quot;patient dumping&quot; in the context of healthcare compliance?</strong></p>', 'A term used to describe patients who arrive at healthcare facilities without appointments', 'The act of discharging patients from hospitals without appropriate planning or referral', 'A common billing practice in healthcare', 'The act of admitting patients without proper identification', '2023-09-29 00:54:05', '2023-09-29 00:54:05', 'ans_b'),
(3362, NULL, 92, 1, '<p><strong>What is the Medicare Advantage program (Part C)?</strong></p>', 'A program for low-income individuals not eligible for Original Medicare', 'A supplemental insurance program for Medicare beneficiaries', 'A private insurance plan that combines Part A, Part B, and often Part D coverage', 'A federal program for long-term care services', '2023-09-29 00:54:50', '2023-09-29 00:54:50', 'ans_c'),
(3363, NULL, 92, 1, '<p><strong>What is the primary funding source for Medicare?</strong></p>', 'State taxes', 'Federal income taxes', 'Employer contributions', 'Sales taxes', '2023-09-29 00:55:22', '2023-09-29 00:55:22', 'ans_b'),
(3364, NULL, 92, 1, '<p><strong>What is Medicare?</strong></p>', 'A federal program providing health coverage for low-income individuals', 'A state-run health insurance program for children', 'A federal program that provides health insurance to individuals aged 65 and older and certain younger individuals with disabilities', 'A government agency responsible for regulating private health insurance companies', '2023-09-29 00:58:17', '2023-09-29 00:58:17', 'ans_c'),
(3365, NULL, 92, 1, '<p><strong>Which of the following is NOT a common red flag for potential healthcare fraud?</strong></p>', 'Frequent and excessive billing for unnecessary medical tests', 'Consistent use of accurate and appropriate medical coding', 'Billing for services not rendered', 'Alteration of medical records to support false claims', '2023-09-29 00:59:10', '2023-09-29 00:59:10', 'ans_b'),
(3366, NULL, 92, 1, '<p><strong>A patient is given a joint injection of 80 mg Depo-Medrol into the right shoulder. How is the medication reported?</strong></p>', 'J1030x2', 'J1050', 'J1020', 'J1040', '2023-09-29 01:00:02', '2023-09-29 01:00:02', 'ans_d'),
(3367, NULL, 92, 1, '<p><strong>What is the HCPCS Level ll code for a short arm fiberglass cast for a 12-year-old patient?</strong></p>', 'Q4007', 'Q4010', 'Q4011', 'Q4009', '2023-09-29 01:01:20', '2023-09-29 01:01:20', 'ans_b'),
(3368, NULL, 92, 1, '<p><strong>What code is reported for the supply of a 2 chambers rate responsive pacemaker?</strong></p>', 'C1786', 'C1785', 'C2610', 'C2620', '2023-09-29 01:01:52', '2023-09-29 01:01:52', 'ans_b'),
(3369, NULL, 92, 1, '<p><strong>45-year-old established Medicaid patient presents for her annual exam for cervical and breast cancer screening. She has no history of the disease. Today, pelvic and clinical breast exams are performed. What HCPCS Level I code is reported for this procedure?</strong></p>', 'G0124', 'G0101', 'G0123', 'S0612', '2023-09-29 01:02:22', '2023-09-29 01:02:22', 'ans_d'),
(3370, NULL, 92, 1, '<p><strong>Mr Ben is in a skilled nursing facility and is having shortness of breath and chest pain. The doctor at the facility arranges for him to be transported by advanced life support non-emergency transport from the skilled nursing facility to the hospital. How is this coded?</strong></p>', 'A0426-QN', 'A0427-QN', 'A0426-QM', 'A0427-QM', '2023-09-29 01:03:00', '2023-09-29 01:03:00', 'ans_c'),
(3371, NULL, 92, 1, '<p><strong>Which place of service code is submitted on the claim for a service that is performed in a home?</strong></p>', '12', '14', '23', '22', '2023-09-29 01:03:36', '2023-09-29 01:03:36', 'ans_a'),
(3372, NULL, 92, 1, '<p><strong>Which place of service code is submitted on the claim for a service that is performed in a Birthing Center?</strong></p>', '25', '14', '23', '22', '2023-09-29 01:04:17', '2023-09-29 01:04:17', 'ans_a'),
(3373, NULL, 92, 1, '<p><strong>What are the CPT codes for extensive destruction via cryosurgery of eight genital warts on the patient&#39;s vulva?</strong></p>', '56515', '56501', '56501x8', '56515x8', '2023-09-29 01:04:44', '2023-09-29 01:04:44', 'ans_a'),
