INSERT INTO `team_details` (`id`, `name`, `designation`, `content`, `photo`, `status`, `description`, `created_at`, `updated_at`) VALUES
(3, 'Vikas Maheshwari', 'Managing Director', 'Greetings! Mr. Vikas Maheshwari, let\'s delighted to take you on a journey through his professional odyssey. With a remarkable career spanning over two decades, He has had the privilege of donning several mid-management hats within renowned global corporations in the Healthcare sector. Currently, he is associated with Genus Healthcare Solution, a hub of innovation and transformation.\r\n\r\nThroughout his journey, He has had the privilege of contributing his expertise to some remarkable establishments. His voyage commenced with the prestigious Escorts Heart Institute, where he began crafting the bedrock of his healthcare management acumen. This was followed by impactful stints at corporate giants like Wipro, Eli Research and Innodata, where he immersed himself in the art of crafting, customizing, and delivering top-tier products and services meticulously tailored to meet the distinct needs of our valued clients.\r\n\r\nA dynamic blend of experience and evolution has equipped him with a profound understanding of the intricacies of our industry. His forte lies in nurturing excellence, be it through his adeptness in Medical Coding Training or prowess in Project Management. Guiding teams to not just meet, but exceed expectations has always been his prime motivator.\r\n\r\nHis educational journey aligns seamlessly with his professional pursuits. Armed with an MBA in Healthcare Services from SMU, He has developed a holistic perspective that intertwines business acumen with the nuances of healthcare dynamics. Furthermore, his certification as a CCS from AHIMA adds an extra layer of credibility to his prowess in the intricate realm of medical coding.\r\n\r\nAs a fervent advocate of continuous learning, He has woven a tapestry of achievements that testify to his commitment to excellence. However, what truly fuels his passion is the opportunity to contribute to the betterment of healthcare systems and processes. In a landscape where innovation is the currency of progress, He is relentlessly focused on steering his endeavors towards creating impactful changes that resonate on a global scale.\r\n\r\nSo, whether it\'s cultivating talent, orchestrating successful projects, or sculpting the future of healthcare solutions, He is here to catalyze positive transformation. Join us in unraveling the boundless potential that healthcare management holds, and together, let\'s pave the way for a brighter, healthier tomorrow.', '1650450275.jpg', 1, NULL, '2022-04-19 06:45:24', '2023-08-10 02:10:21'),
(6, 'Monika Verma', 'Director', 'Monika is an accomplished professional with a wealth of experience spanning over 6 years in a range of influential mid-management positions within the global corporate landscape. Her career journey has been marked by her dynamic contributions to various industries, showcasing her exceptional leadership and strategic acumen.\r\n\r\nSince 2014, Monika has been an integral part of Genus Healthcare Solutions, where she continues to make a significant impact. Her tenure at Genus Healthcare Solutions has been characterized by her consistent dedication to driving innovation, optimizing processes, and enhancing overall operational efficiency. Monika\'s academic foundation includes a B. Sc IT degree, which has equipped her with a solid understanding of information technology and its applications in the corporate world.', '1650439520.jpg', 1, NULL, '2022-04-20 01:55:20', '2023-08-14 03:58:34');
INSERT INTO `trainings` (`id`, `heading`, `photo`, `content`, `short_content`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Medical Coding', '1650533821.jpg', '<h3>Medical Coding</h3>\r\n\r\n<p>Medical coding CPC/CCS preparation course syllabus The Professional Medical Coding training module covers the CPT, HCPCS, ICD-10-CM, ICD-10 PCS&nbsp;codes and coding guidelines.</p>\r\n\r\n<p>CPC/CCS&nbsp;Exam Training and Syllabus</p>\r\n\r\n<p><strong>Prerequisites:</strong>&nbsp;Knowledge of medical terminology and anatomy strongly recommended or Graduation in Life-sciences domain.</p>\r\n\r\n<p><strong>Clock Hours:</strong>&nbsp;80 hours for experienced trainees and 120 hours for Freshers in classes. Study time will vary widely per individual.</p>\r\n\r\n<p><strong>Course Length:</strong>&nbsp;To be completed in 2 months. CPC/CCS&nbsp;exam will be scheduled in the next month after completion of syllabus.</p>\r\n\r\n<p><strong>Class Hours</strong>: Days/Times Per Week: Classes will be held Monday-Friday. Classroom sessions will be of 2 hours duration every day. Weekend and evening batches are also available to suit the needs of workings professionals.</p>\r\n\r\n<p><strong>Certificate of Completion Issued</strong>: Yes. CPC/CCS&nbsp;Certification will be issued by AAPC or AHIMA respectively and will be available online.</p>\r\n\r\n<p><strong>Course Description</strong>: The trainees will learn principles and guidelines of medical coding related to the three main coding manuals: CPT&reg;, ICD-10-CM, ICD-10-PCS and HCPCS level II</p>', 'Medical Coding\r\nMedical coding CPC/CCS preparation course syllabus The Professional Medical Coding training module covers the CPT, HCPCS, ICD-10-CM, ICD-10 PCS codes and coding guidelines.\r\n\r\nCPC/CCS Exam Training and Syllabus\r\nPrerequisites: Knowledge of medical terminology and anatomy strongly recommended or Graduation in Life-sciences domain.', 1, '2022-04-20 22:43:01', '2023-05-04 02:03:08'),
(2, 'Medical Billing & AR', '1650533883.jpg', '<h3>Medical Billing & AR</h3>\r\n                            <p>The US medical insurance industry is a rapidly growing multi-billion dollar industry. Medical Billing/Revenue Cycle Management (RCM) is an important part of this industry. Medical billing includes submitting and following up on claims to insurance companies in order to receive payment for services rendered by healthcare providers. Medical billers play a very crucial role in ensuring operations run smoothly between insurance companies, physicians and patients. There is a great demand for well-trained medical billers in India.</p>\r\n                            <p>Clock Hours: 40 hours for experienced, 120 hours for fresh candidates as part of classroom session.</p>\r\n                            <p>Course Length: 6 weeks comprehensive program.</p>\r\n                            <p>Certificate of Completion Issued: Yes along with placement assistance.</p>\r\n                            Course Description: Brilliantly designed & exhaustive module to make you ready for live production immediately after completion of the course. You will be trained to fulfil the current industry requirements for end-to-end processing:</p>\r\n                            <ul class=\"mb-0\">\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Voice & Accent training by best Voice & Accent experts.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Insurance Claim Forms (USA healthcare).</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Medical reports & documentation.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Billing Management system.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Details of Revenue Cycle Management (RCM) Process.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Medical Coding at a glance.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Medical Billing Terminology & Data Interchange and Modifiers.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Denials Management.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> AR Calling</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Practice Case Studies.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Hands-on experience for easy adaptability to the work environment.</li>\r\n                            </ul>', 'Medical Billing & AR\r\nThe US medical insurance industry is a rapidly growing multi-billion dollar industry. Medical Billing/Revenue Cycle Management (RCM) is an important part of this industry. Medical billing includes submitting and following up on claims to insurance companies in order to receive payment for services rendered by healthcare providers. Medical billers play a very crucial role in ensuring operations run smoothly between insurance companies, physicians and patients. There is a great demand for well-trained medical billers in India.', 1, '2022-04-20 22:44:39', '2022-04-21 04:18:31'),
(3, 'Claims Adjudication', '1650533925.jpg', '<h3>Claims Adjudication</h3>\r\n                            <p>Coming Soon</p>\r\n                            <ul class=\"mb-0\">\r\n                                <li><i class=\"flaticon-right-arrow\"></i> SME Finance Investment Service.</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> SME Finance Advisory Finance</li>\r\n                                <li><i class=\"flaticon-right-arrow\"></i> Global SME Finance Facility</li>\r\n                            </ul>', 'Claims Adjudication\r\nComing Soon\r\n\r\nSME Finance Investment Service\r\nSME Finance Advisory Finance\r\nGlobal SME Finance Facility', 1, '2022-04-20 22:46:53', '2022-04-21 04:19:40'),
(5, 'On Job Training', '1650533787.jpg', '<h3>On Job Training</h3>\r\n                            <p>30 Days specilized training on live reports which will cover different Speciality as per choice of Candidates i.e.</p>\r\n                            <ul class=\"mb-0\">\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    Surgery\r\n                                </li>\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    E/M\r\n                                </li>\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    Radiology\r\n                                </li>\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    ED\r\n                                </li>\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    Anesthesia\r\n                                </li>\r\n                                <li>\r\n                                    <i class=\"flaticon-check-mark\"></i>\r\n                                    HCC\r\n                                </li>\r\n                            </ul>', 'On Job Training\r\n30 Days specilized training on live reports which will cover different Speciality as per choice of Candidates i.e.\r\n\r\n Surgery\r\n E/M\r\n Radiology\r\n ED\r\n Anesthesia\r\n HCC', 1, '2022-04-20 22:56:10', '2022-04-21 04:20:13');
